B.a8O=new A.d(B.c,["\u201cIt was only 97.\u201d","\u201cSolo fue 97.\u201d","\u201eEs waren nur 97.\u201c","\u201cCe n\u2019\xe9tait que 97.\u201d","\u201c\u0643\u0627\u0646 \u0641\u0642\u0637 97.\u201d","\u201c\ub2e8\uc9c0 97\uc774\uc5c8\uc5b4\uc694.\u201d","\u201c\u53ea\u662f97\u3002\u201d","\u201c\u092f\u0939 \u0915\u0947\u0935\u0932 97 \u0925\u093e\u0964\u201d","\u201cFuit tantum 97.\u201d","\u201cEra solo 97.\u201d","\u201c\u0641\u0642\u0637 97 \u0628\u0648\u062f.\u201d"],t.w)
B.a87=new A.d(B.c,["\u201cI know 97/100 is good, but it still feels like failing. I keep thinking about the 3 points I missed.\u201d\n\nWhich emotion seems strongest behind this thought?","\u201cS\xe9 que 97/100 est\xe1 bien, pero a\xfan as\xed se siente como un fracaso. Sigo pensando en los 3 puntos que me faltaron.\u201d\n\n\xbfQu\xe9 emoci\xf3n parece m\xe1s fuerte detr\xe1s de este pensamiento?","\u201eIch wei\xdf, dass 97/100 gut ist, aber es f\xfchlt sich trotzdem wie ein Versagen an. Ich denke immer an die 3 Punkte, die ich verpasst habe.\u201d\n\nWelche Emotion scheint hinter diesem Gedanken am st\xe4rksten zu sein?","\u201cJe sais que 97/100 est bien, mais cela ressemble encore \xe0 un \xe9chec. Je continue de penser aux 3 points que j\u2019ai manqu\xe9s.\u201d\n\nQuelle \xe9motion semble la plus forte derri\xe8re cette pens\xe9e ?","\u201c\u0623\u0639\u0644\u0645 \u0623\u0646 97/100 \u062c\u064a\u062f\u060c \u0644\u0643\u0646 \u0644\u0627 \u064a\u0632\u0627\u0644 \u064a\u0628\u062f\u0648 \u0643\u0627\u0644\u0641\u0634\u0644. \u0623\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0641\u064a \u0627\u0644\u0646\u0642\u0627\u0637 \u0627\u0644\u062b\u0644\u0627\u062b \u0627\u0644\u062a\u064a \u0641\u0627\u062a\u062a\u0646\u064a.\u201d\n\n\u0623\u064a \u0639\u0627\u0637\u0641\u0629 \u062a\u0628\u062f\u0648 \u0627\u0644\u0623\u0642\u0648\u0649 \u0648\u0631\u0627\u0621 \u0647\u0630\u0627 \u0627\u0644\u062a\u0641\u0643\u064a\u0631\u061f","\u201c97/100\uc774 \uc88b\ub2e4\ub294 \uac83\uc740 \uc54c\uc9c0\ub9cc \uc5ec\uc804\ud788 \uc2e4\ud328\ud55c \ub290\ub08c\uc774 \ub4ed\ub2c8\ub2e4. \ub0b4\uac00 \ub193\uce5c 3\uc810\uc5d0 \ub300\ud574 \uacc4\uc18d \uc0dd\uac01\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\u201d\n\n\uc774 \uc0dd\uac01 \ub4a4\uc5d0 \uac00\uc7a5 \uac15\ud55c \uac10\uc815\uc740 \ubb34\uc5c7\uc778\uac00\uc694?","\u201c\u6211\u77e5\u905397/100\u5f88\u597d\uff0c\u4f46\u8fd8\u662f\u611f\u89c9\u50cf\u662f\u5931\u8d25\u3002\u6211\u4e00\u76f4\u5728\u60f3\u7740\u6211\u9519\u8fc7\u7684\u90a33\u5206\u3002\u201d\n\n\u8fd9\u4e2a\u60f3\u6cd5\u80cc\u540e\u6700\u5f3a\u70c8\u7684\u60c5\u611f\u662f\u4ec0\u4e48\uff1f","\u201c\u092e\u0941\u091d\u0947 \u092a\u0924\u093e \u0939\u0948 \u0915\u093f 97/100 \u0905\u091a\u094d\u091b\u093e \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u092b\u093f\u0930 \u092d\u0940 \u092f\u0939 \u0905\u0938\u092b\u0932 \u0939\u094b\u0928\u0947 \u091c\u0948\u0938\u093e \u0932\u0917\u0924\u093e \u0939\u0948\u0964 \u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u0909\u0928 3 \u0905\u0902\u0915\u094b\u0902 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0938\u094b\u091a\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0942\u0901 \u091c\u093f\u0928\u094d\u0939\u0947\u0902 \u092e\u0948\u0902\u0928\u0947 \u0916\u094b \u0926\u093f\u092f\u093e\u0964\u201d\n\n\u0907\u0938 \u0935\u093f\u091a\u093e\u0930 \u0915\u0947 \u092a\u0940\u091b\u0947 \u0938\u092c\u0938\u0947 \u092e\u091c\u092c\u0942\u0924 \u092d\u093e\u0935\u0928\u093e \u0915\u094d\u092f\u093e \u0939\u0948?","\u201eScio 97/100 esse bonum, sed adhuc sensus defectus est. Semper cogito de tribus punctis quae amisi.\u201d\n\nQuae affectio est validissima post hunc cogitationem?","\u201cSo che 97/100 \xe8 buono, ma mi sembra ancora di fallire. Continuo a pensare ai 3 punti che ho perso.\u201d\n\nQuale emozione sembra la pi\xf9 forte dietro questo pensiero?","\u201c\u0645\u06cc\u200c\u062f\u0627\u0646\u0645 \u06a9\u0647 97/100 \u062e\u0648\u0628 \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u0647\u0646\u0648\u0632 \u0627\u062d\u0633\u0627\u0633 \u0634\u06a9\u0633\u062a \u0645\u06cc\u200c\u06a9\u0646\u0645. \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 3 \u0627\u0645\u062a\u06cc\u0627\u0632 \u0627\u0632 \u062f\u0633\u062a \u0631\u0641\u062a\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u062d\u0633\u0627\u0633 \u067e\u0634\u062a \u0627\u06cc\u0646 \u0641\u06a9\u0631 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0633\u062a\u061f"],t.w)
