B.a95=new A.d(B.c,["The focus is not on the success itself, but on fear of falling short. That leans toward anxiety.","El enfoque no est\xe1 en el \xe9xito en s\xed, sino en el miedo a no ser suficiente. Eso se inclina hacia la ansiedad.","Der Fokus liegt nicht auf dem Erfolg selbst, sondern auf der Angst, zu scheitern. Das neigt zur Angst.","L\u2019accent n\u2019est pas mis sur le succ\xe8s lui-m\xeame, mais sur la peur de ne pas \xeatre \xe0 la hauteur. Cela penche vers l\u2019anxi\xe9t\xe9.","\u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0644\u064a\u0633 \u0639\u0644\u0649 \u0627\u0644\u0646\u062c\u0627\u062d \u0646\u0641\u0633\u0647\u060c \u0628\u0644 \u0639\u0644\u0649 \u0627\u0644\u062e\u0648\u0641 \u0645\u0646 \u0627\u0644\u062a\u0642\u0635\u064a\u0631. \u0648\u0647\u0630\u0627 \u064a\u0645\u064a\u0644 \u0646\u062d\u0648 \u0627\u0644\u0642\u0644\u0642.","\uc131\uacf5 \uc790\uccb4\ubcf4\ub2e4\ub294 \ubd80\uc871\ud560 \uac83\uc5d0 \ub300\ud55c \ub450\ub824\uc6c0\uc5d0 \uc9d1\uc911\ud569\ub2c8\ub2e4. \uc774\ub294 \ubd88\uc548\uc73c\ub85c \uc774\uc5b4\uc9d1\ub2c8\ub2e4.","\u7126\u70b9\u4e0d\u5728\u4e8e\u6210\u529f\u672c\u8eab\uff0c\u800c\u662f\u5728\u4e8e\u5bb3\u6015\u5931\u8d25\u3002\u8fd9\u66f4\u503e\u5411\u4e8e\u7126\u8651\u3002","\u092b\u094b\u0915\u0938 \u0938\u092b\u0932\u0924\u093e \u092a\u0930 \u0928\u0939\u0940\u0902 \u092c\u0932\u094d\u0915\u093f \u0928\u093e\u0915\u093e\u092e\u0940 \u0915\u0947 \u0921\u0930 \u092a\u0930 \u0939\u0948\u0964 \u092f\u0939 \u091a\u093f\u0902\u0924\u093e \u0915\u0940 \u0913\u0930 \u0932\u0947 \u091c\u093e\u0924\u093e \u0939\u0948\u0964","Focus non est in successu ipso, sed in timore deficientiae. Id inclinatur ad anxietatem.","Il focus non \xe8 sul successo in s\xe9, ma sulla paura di non farcela. Questo porta verso l\u2019ansia.","\u062a\u0645\u0631\u06a9\u0632 \u0628\u0631 \u0631\u0648\u06cc \u0645\u0648\u0641\u0642\u06cc\u062a \u0646\u06cc\u0633\u062a\u060c \u0628\u0644\u06a9\u0647 \u0628\u0631 \u062a\u0631\u0633 \u0627\u0632 \u0634\u06a9\u0633\u062a \u0627\u0633\u062a. \u0627\u06cc\u0646 \u0628\u0647 \u0627\u0636\u0637\u0631\u0627\u0628 \u0645\u06cc\u200c\u0627\u0646\u062c\u0627\u0645\u062f."],t.w)
