B.adP=new A.d(B.c,["\u201cI do not want to text again.\u201d","\u201cNo quiero volver a enviar mensajes.\u201d","\u201eIch will nicht wieder schreiben.\u201c","\u201cJe ne veux plus envoyer de messages.\u201d","\u201c\u0644\u0627 \u0623\u0631\u064a\u062f \u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.\u201d","\u201c\ub2e4\uc2dc \ubb38\uc790\ub97c \ubcf4\ub0b4\uace0 \uc2f6\uc9c0 \uc54a\uc544\uc694.\u201d","\u201c\u6211\u4e0d\u60f3\u518d\u53d1\u4fe1\u606f\u4e86\u3002\u201d","\u201c\u092e\u0948\u0902 \u092b\u093f\u0930 \u0938\u0947 \u092e\u0948\u0938\u0947\u091c \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u093e\u0964\u201d","\u201cNoli iterum mittere nuntios.\u201d","\u201cNon voglio pi\xf9 inviare messaggi.\u201d","\u201c\u062f\u06cc\u06af\u0631 \u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u0645 \u067e\u06cc\u0627\u0645 \u0628\u0641\u0631\u0633\u062a\u0645.\u201d"],t.w)
B.ae3=new A.d(B.c,["\u201cWe were supposed to hang out. They never replied, and now I don\u2019t even want to text them back at all.\u201d\n\nWhat emotion is likely sitting underneath this reaction?","\u201cSe supon\xeda que \xedbamos a pasar el rato. Nunca respondieron, y ahora ni siquiera quiero responderles.\u201d\n\n\xbfQu\xe9 emoci\xf3n est\xe1 probablemente debajo de esta reacci\xf3n?","\u201eWir wollten uns treffen. Sie haben nie geantwortet, und jetzt m\xf6chte ich ihnen nicht einmal mehr schreiben.\u201c\n\nWelche Emotion steckt wahrscheinlich hinter dieser Reaktion?","\u201cNous \xe9tions cens\xe9s tra\xeener ensemble. Ils n\u2019ont jamais r\xe9pondu, et maintenant je ne veux m\xeame plus leur r\xe9pondre.\u201d\n\nQuelle \xe9motion est probablement cach\xe9e derri\xe8re cette r\xe9action ?","\u201c\u0643\u0627\u0646 \u0645\u0646 \u0627\u0644\u0645\u0641\u062a\u0631\u0636 \u0623\u0646 \u0646\u062a\u062c\u0645\u0639. \u0644\u0645 \u064a\u0631\u062f\u0648\u0627 \u0623\u0628\u062f\u064b\u0627\u060c \u0648\u0627\u0644\u0622\u0646 \u0644\u0627 \u0623\u0631\u064a\u062f \u062d\u062a\u0649 \u0623\u0646 \u0623\u0631\u0633\u0644 \u0644\u0647\u0645 \u0631\u0633\u0627\u0644\u0629 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0639\u0627\u0637\u0641\u0629 \u0627\u0644\u062a\u064a \u0645\u0646 \u0627\u0644\u0645\u062d\u062a\u0645\u0644 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0648\u0631\u0627\u0621 \u0647\u0630\u0647 \u0627\u0644\u0631\u062f\u0648\u062f\u061f","\u201c\uc6b0\ub9ac\ub294 \ud568\uaed8 \ub180\uae30\ub85c \ud588\uc5b4\uc694. \uadf8\ub4e4\uc740 \ub2f5\uc7a5\uc744 \ud558\uc9c0 \uc54a\uc558\uace0, \uc774\uc81c\ub294 \uc544\uc608 \uadf8\ub4e4\uc5d0\uac8c \ub2f5\uc7a5\ud558\uace0 \uc2f6\uc9c0\ub3c4 \uc54a\uc544\uc694.\u201d\n\n\uc774 \ubc18\uc751 \ub4a4\uc5d0\ub294 \uc5b4\ub5a4 \uac10\uc815\uc774 \uc228\uc5b4 \uc788\uc744\uae4c\uc694?","\u201c\u6211\u4eec\u672c\u8be5\u4e00\u8d77\u51fa\u53bb\u73a9\u3002\u4ed6\u4eec\u4ece\u672a\u56de\u590d\u8fc7\uff0c\u73b0\u5728\u6211\u751a\u81f3\u4e0d\u60f3\u518d\u56de\u590d\u4ed6\u4eec\u3002\u201d\n\n\u8fd9\u79cd\u53cd\u5e94\u80cc\u540e\u53ef\u80fd\u9690\u85cf\u7740\u4ec0\u4e48\u60c5\u7eea\uff1f","\u201c\u0939\u092e\u0947\u0902 \u090f\u0915 \u0938\u093e\u0925 \u092c\u093e\u0939\u0930 \u091c\u093e\u0928\u093e \u0925\u093e\u0964 \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0915\u092d\u0940 \u091c\u0935\u093e\u092c \u0928\u0939\u0940\u0902 \u0926\u093f\u092f\u093e, \u0914\u0930 \u0905\u092c \u092e\u0948\u0902 \u0909\u0928\u094d\u0939\u0947\u0902 \u092b\u093f\u0930 \u0938\u0947 \u0938\u0902\u0926\u0947\u0936 \u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u093e\u0964\u201d\n\n\u0907\u0938 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0915\u0947 \u0928\u0940\u091a\u0947 \u0915\u094c\u0928 \u0938\u0940 \u092d\u093e\u0935\u0928\u093e \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948?","\u201cNos convicere debebamus. Numquam responderunt, et nunc ne ego quidem respondebo.\u201d\n\nQuae affectio sub hac reaktione probabiliter latet?","\u201cEravamo stati programmati per uscire insieme. Non hanno mai risposto, e ora non voglio nemmeno rispondere loro.\u201d\n\nQuale emozione \xe8 probabilmente nascosta dietro questa reazione?","\u201c\u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u0628\u0627 \u0647\u0645 \u0628\u06cc\u0631\u0648\u0646 \u0628\u0631\u0648\u06cc\u0645. \u0622\u0646\u0647\u0627 \u0647\u06cc\u0686\u200c\u0648\u0642\u062a \u062c\u0648\u0627\u0628 \u0646\u062f\u0627\u062f\u0646\u062f \u0648 \u062d\u0627\u0644\u0627 \u0627\u0635\u0644\u0627\u064b \u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u0645 \u0628\u0647 \u0622\u0646\u0647\u0627 \u067e\u06cc\u0627\u0645 \u0628\u062f\u0647\u0645.\u201d\n\n\u0686\u0647 \u0627\u062d\u0633\u0627\u0633\u06cc \u0627\u062d\u062a\u0645\u0627\u0644\u0627\u064b \u067e\u0634\u062a \u0627\u06cc\u0646 \u0648\u0627\u06a9\u0646\u0634 \u0646\u0647\u0641\u062a\u0647 \u0627\u0633\u062a\u061f"],t.w)
