B.aeJ=new A.d(B.c,["Pulling away (\u201cI don\u2019t want to text at all\u201d) often hides hurt or disappointment, not true indifference.","Alejarse (\u201cNo quiero enviar mensajes en absoluto\u201d) a menudo oculta el dolor o la decepci\xf3n, no la verdadera indiferencia.","Sich zur\xfcckzuziehen (\u201eIch will \xfcberhaupt nicht mehr schreiben\u201c) verbirgt oft Schmerz oder Entt\xe4uschung, keine wahre Gleichg\xfcltigkeit.","Se retirer (\u201cJe ne veux m\xeame plus envoyer de messages\u201d) cache souvent de la douleur ou de la d\xe9ception, pas de la v\xe9ritable indiff\xe9rence.","\u0627\u0644\u0627\u0628\u062a\u0639\u0627\u062f (\u201c\u0644\u0627 \u0623\u0631\u064a\u062f \u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642\u201d) \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u062e\u0641\u064a \u0627\u0644\u0623\u0644\u0645 \u0623\u0648 \u062e\u064a\u0628\u0629 \u0627\u0644\u0623\u0645\u0644\u060c \u0648\u0644\u064a\u0633 \u0627\u0644\u0644\u0627\u0645\u0628\u0627\u0644\u0627\u0629 \u0627\u0644\u062d\u0642\u064a\u0642\u064a\u0629.","\ubb3c\ub7ec\ub098\uae30 (\u201c\uc544\uc608 \ubb38\uc790 \ubcf4\ub0b4\uace0 \uc2f6\uc9c0 \uc54a\uc544\uc694\u201d)\ub294 \uc885\uc885 \uc0c1\ucc98\ub098 \uc2e4\ub9dd\uc744 \uc228\uae30\uba70, \uc9c4\uc815\ud55c \ubb34\uad00\uc2ec\uc774 \uc544\ub2d9\ub2c8\ub2e4.","\u64a4\u56de\uff08\u201c\u6211\u6839\u672c\u4e0d\u60f3\u53d1\u77ed\u4fe1\u201d\uff09\u901a\u5e38\u9690\u85cf\u4e86\u4f24\u5bb3\u6216\u5931\u671b\uff0c\u800c\u4e0d\u662f\u771f\u6b63\u7684\u51b7\u6f20\u3002","\u0926\u0942\u0930 \u0939\u091f\u0928\u093e (\u201c\u092e\u0948\u0902 \u092c\u093f\u0932\u094d\u0915\u0941\u0932 \u092d\u0940 \u0938\u0902\u0926\u0947\u0936 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u093e\u201d) \u0905\u0915\u094d\u0938\u0930 \u0926\u0930\u094d\u0926 \u092f\u093e \u0928\u093f\u0930\u093e\u0936\u093e \u0915\u094b \u091b\u0941\u092a\u093e\u0924\u093e \u0939\u0948, \u0928 \u0915\u093f \u0938\u091a\u094d\u091a\u0940 \u0909\u0926\u093e\u0938\u0940\u0928\u0924\u093e\u0964","Se recedere (\u201cNoli iterum mittere nuntios\u201d) saepe celat dolorem aut deceptionem, non veram indifferentiam.","Allontanarsi (\u201cNon voglio nemmeno pi\xf9 inviare messaggi\u201d) spesso nasconde dolore o delusione, non vera indifferenza.","\u06a9\u0646\u0627\u0631\u0647\u200c\u06af\u06cc\u0631\u06cc (\u201c\u0645\u0646 \u0627\u0635\u0644\u0627\u064b \u067e\u06cc\u0627\u0645 \u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u0645 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0645\u201d) \u0627\u063a\u0644\u0628 \u062f\u0631\u062f \u06cc\u0627 \u0646\u0627\u0627\u0645\u06cc\u062f\u06cc \u0631\u0627 \u067e\u0646\u0647\u0627\u0646 \u0645\u06cc\u200c\u06a9\u0646\u062f\u060c \u0646\u0647 \u0628\u06cc\u200c\u062a\u0641\u0627\u0648\u062a\u06cc \u0648\u0627\u0642\u0639\u06cc."],t.w)
