B.a81=new A.d(B.c,["\u201cI hate my life now.\u201d","\u201cOdio mi vida ahora.\u201d","\u201eIch hasse mein Leben jetzt.\u201c","\u201cJe d\xe9teste ma vie maintenant.\u201d","\u201c\u0623\u0643\u0631\u0647 \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u0622\u0646.\u201d","\u201c\uc9c0\uae08 \ub0b4 \uc0b6\uc774 \uc2eb\uc5b4\uc694.\u201d","\u201c\u6211\u73b0\u5728\u8ba8\u538c\u6211\u7684\u751f\u6d3b\u3002\u201d","\u201c\u092e\u0941\u091d\u0947 \u0905\u092c \u0905\u092a\u0928\u0940 \u091c\u093f\u0902\u0926\u0917\u0940 \u0938\u0947 \u0928\u092b\u0930\u0924 \u0939\u0948\u0964\u201d","\u201cNunc vitam meam odi.\u201d","\u201cOdio la mia vita adesso.\u201d","\u201c\u0627\u0644\u0627\u0646 \u0627\u0632 \u0632\u0646\u062f\u06af\u06cc\u200c\u0627\u0645 \u0645\u062a\u0646\u0641\u0631\u0645.\u201d"],t.w)
B.ae7=new A.d(B.c,["\u201cI scroll through people traveling, succeeding, looking amazing\u2026 and suddenly I hate everything about my own life.\u201d\n\nWhich emotion bundle fits best?","\u201cDesplazo por personas viajando, teniendo \xe9xito, vi\xe9ndose incre\xedbles\u2026 y de repente odio todo sobre mi propia vida.\u201d\n\n\xbfQu\xe9 conjunto de emociones encaja mejor?","\u201eIch scrolle durch Bilder von Leuten, die reisen, erfolgreich sind, toll aussehen\u2026 und pl\xf6tzlich hasse ich alles an meinem eigenen Leben.\u201c\n\nWelches Emotionsb\xfcndel passt am besten?","\u201cJe fais d\xe9filer des gens qui voyagent, r\xe9ussissent, ont l\u2019air incroyables\u2026 et soudainement je d\xe9teste tout dans ma propre vie.\u201d\n\nQuel ensemble d\u2019\xe9motions correspond le mieux ?","\u201c\u0623\u062a\u0645\u0634\u0649 \u0639\u0628\u0631 \u0635\u0648\u0631 \u0623\u0634\u062e\u0627\u0635 \u064a\u0633\u0627\u0641\u0631\u0648\u0646\u060c \u064a\u062d\u0642\u0642\u0648\u0646 \u0627\u0644\u0646\u062c\u0627\u062d\u060c \u0648\u064a\u0628\u062f\u0648\u0646 \u0631\u0627\u0626\u0639\u064a\u0646\u2026 \u0648\u0641\u062c\u0623\u0629 \u0623\u0643\u0631\u0647 \u0643\u0644 \u0634\u064a\u0621 \u0641\u064a \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u062e\u0627\u0635\u0629.\u201d\n\n\u0623\u064a \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0645\u0634\u0627\u0639\u0631 \u062a\u0646\u0627\u0633\u0628 \u0647\u0630\u0647 \u0627\u0644\u062d\u0627\u0644\u0629\u061f","\u201c\uc5ec\ud589\ud558\uace0 \uc131\uacf5\ud558\uba70 \uba4b\uc838 \ubcf4\uc774\ub294 \uc0ac\ub78c\ub4e4\uc744 \uc2a4\ud06c\ub864\ud558\ub2e4\u2026 \uadf8\ub9ac\uace0 \uac11\uc790\uae30 \ub0b4 \uc0b6\uc5d0 \ub300\ud574 \ubaa8\ub4e0 \uac83\uc774 \uc2eb\uc5b4\uc84c\uc5b4\uc694.\u201d\n\n\uc5b4\ub5a4 \uac10\uc815 \ub369\uc5b4\ub9ac\uac00 \uac00\uc7a5 \uc798 \ub9de\uc744\uae4c\uc694?","\u201c\u6211\u5728\u6d4f\u89c8\u90a3\u4e9b\u65c5\u884c\u3001\u6210\u529f\u3001\u770b\u8d77\u6765\u5f88\u68d2\u7684\u4eba\u2026\u2026\u7136\u540e\u7a81\u7136\u6211\u8ba8\u538c\u6211\u81ea\u5df1\u751f\u6d3b\u7684\u4e00\u5207\u3002\u201d\n\n\u54ea\u79cd\u60c5\u7eea\u7ec4\u5408\u6700\u8d34\u5207\uff1f","\u201c\u092e\u0948\u0902 \u0932\u094b\u0917\u094b\u0902 \u0915\u094b \u092f\u093e\u0924\u094d\u0930\u093e \u0915\u0930\u0924\u0947, \u0938\u092b\u0932 \u0939\u094b\u0924\u0947 \u0914\u0930 \u0905\u0926\u094d\u092d\u0941\u0924 \u0926\u093f\u0916\u0924\u0947 \u0939\u0941\u090f \u0938\u094d\u0915\u094d\u0930\u0949\u0932 \u0915\u0930\u0924\u093e \u0939\u0942\u0901\u2026 \u0914\u0930 \u0905\u091a\u093e\u0928\u0915 \u092e\u0941\u091d\u0947 \u0905\u092a\u0928\u0940 \u091c\u093c\u093f\u0928\u094d\u0926\u0917\u0940 \u0938\u0947 \u0928\u092b\u0930\u0924 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964\u201d\n\n\u0915\u094c\u0928 \u0938\u093e \u092d\u093e\u0935\u0928\u093e \u0938\u092e\u0942\u0939 \u0938\u092c\u0938\u0947 \u0905\u091a\u094d\u091b\u093e \u092e\u0947\u0932 \u0916\u093e\u0924\u093e \u0939\u0948?","\u201cPer viatores, qui succedunt, pulchri sunt\u2026 et subito omnia de vita mea odi.\u201d\n\nQuae affectus complexus optime convenit?","\u201cScorro tra persone che viaggiano, che hanno successo, che sembrano fantastiche\u2026 e improvvisamente odio tutto della mia vita.\u201d\n\nQuale combinazione di emozioni si adatta meglio?","\u201c\u0645\u0646 \u062f\u0631 \u062d\u0627\u0644 \u067e\u06cc\u0645\u0627\u06cc\u0634 \u0627\u0632 \u0627\u0641\u0631\u0627\u062f\u06cc \u0647\u0633\u062a\u0645 \u06a9\u0647 \u0633\u0641\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f\u060c \u0645\u0648\u0641\u0642 \u0647\u0633\u062a\u0646\u062f\u060c \u0648 \u0634\u06af\u0641\u062a\u200c\u0627\u0646\u06af\u06cc\u0632 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u200c\u0631\u0633\u0646\u062f\u2026 \u0648 \u0646\u0627\u06af\u0647\u0627\u0646 \u0627\u0632 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u062f\u0631 \u0632\u0646\u062f\u06af\u06cc\u200c\u0627\u0645 \u0645\u062a\u0646\u0641\u0631 \u0645\u06cc\u200c\u0634\u0648\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0645\u062c\u0645\u0648\u0639\u0647 \u0627\u062d\u0633\u0627\u0633\u0627\u062a \u0628\u0647\u062a\u0631\u06cc\u0646 \u062a\u0637\u0627\u0628\u0642 \u0631\u0627 \u062f\u0627\u0631\u062f\u061f"],t.w)
