B.acS=new A.d(B.c,["Hating your own life in comparison usually mixes envy (wanting what they have) with shame (\u201cI am not enough\u201d).","Odiar tu propia vida en comparaci\xf3n generalmente mezcla envidia (querer lo que ellos tienen) con verg\xfcenza (\u201cNo soy suficiente\u201d).","Das Hassen des eigenen Lebens im Vergleich vermischt normalerweise Neid (wollen, was sie haben) mit Scham (\u201eIch bin nicht genug\u201c).","D\xe9tester sa propre vie en comparaison m\xe9lange g\xe9n\xe9ralement l\u2019envie (vouloir ce qu\u2019ils ont) avec la honte (\u201cJe ne suis pas assez\u201d).",'\u0643\u0631\u0627\u0647\u064a\u0629 \u062d\u064a\u0627\u062a\u0643 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u0645\u0642\u0627\u0631\u0646\u0629 \u0639\u0627\u062f\u0629 \u0645\u0627 \u062a\u062e\u0644\u0637 \u0627\u0644\u062d\u0633\u062f (\u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u064a \u0645\u0627 \u0644\u062f\u064a\u0647\u0645) \u0645\u0639 \u0627\u0644\u062e\u062c\u0644 ("\u0623\u0646\u0627 \u0644\u0633\u062a \u0643\u0627\u0641\u064a\u064b\u0627").',"\uc790\uc2e0\uc758 \uc0b6\uc744 \ube44\uad50\ud558\uba74\uc11c \uc2eb\uc5b4\ud558\ub294 \uac83\uc740 \ubcf4\ud1b5 \ubd80\ub7ec\uc6c0(\uadf8\ub4e4\uc774 \uac00\uc9c4 \uac83\uc744 \uc6d0\ud568)\uacfc \uc218\uce58\uc2ec(\u201c\ub098\ub294 \ucda9\ubd84\ud558\uc9c0 \uc54a\ub2e4\u201d)\uc744 \uc11e\uc2b5\ub2c8\ub2e4.","\u4e0e\u4ed6\u4eba\u76f8\u6bd4\uff0c\u8ba8\u538c\u81ea\u5df1\u7684\u751f\u6d3b\u901a\u5e38\u4f1a\u5c06\u5ac9\u5992\uff08\u60f3\u8981\u4ed6\u4eec\u6240\u62e5\u6709\u7684\uff09\u4e0e\u7f9e\u803b\uff08\u201c\u6211\u4e0d\u591f\u597d\u201d\uff09\u6df7\u5408\u5728\u4e00\u8d77\u3002","\u0905\u092a\u0928\u0940 \u091c\u093c\u093f\u0928\u094d\u0926\u0917\u0940 \u0938\u0947 \u0928\u092b\u0930\u0924 \u0915\u0930\u0928\u093e \u0906\u092e\u0924\u094c\u0930 \u092a\u0930 \u0908\u0930\u094d\u0937\u094d\u092f\u093e (\u091c\u094b \u0909\u0928\u0915\u0947 \u092a\u093e\u0938 \u0939\u0948 \u0909\u0938\u0947 \u091a\u093e\u0939\u0928\u093e) \u0914\u0930 \u0936\u0930\u094d\u092e (\u201c\u092e\u0948\u0902 \u092a\u0930\u094d\u092f\u093e\u092a\u094d\u0924 \u0928\u0939\u0940\u0902 \u0939\u0942\u0901\u201d) \u0915\u094b \u092e\u093f\u0932\u093e\u0924\u093e \u0939\u0948\u0964","Odiendo vitam tuam comparatione, plerumque invidiam (quid illi habent) cum pudore (\u201cnon satis sum\u201d) miscet.","Odiare la propria vita in confronto mescola solitamente l\u2019invidia (volere ci\xf2 che hanno) con la vergogna (\u201cNon sono abbastanza\u201d).","\u0646\u0641\u0631\u062a \u0627\u0632 \u0632\u0646\u062f\u06af\u06cc \u062e\u0648\u062f \u062f\u0631 \u0645\u0642\u0627\u06cc\u0633\u0647 \u0645\u0639\u0645\u0648\u0644\u0627\u064b \u062d\u0633\u0627\u062f\u062a (\u062e\u0648\u0627\u0633\u062a\u0646 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u0622\u0646\u0647\u0627 \u062f\u0627\u0631\u0646\u062f) \u0631\u0627 \u0628\u0627 \u0634\u0631\u0645 (\u201c\u0645\u0646 \u06a9\u0627\u0641\u06cc \u0646\u06cc\u0633\u062a\u0645\u201d) \u062a\u0631\u06a9\u06cc\u0628 \u0645\u06cc\u200c\u06a9\u0646\u062f."],t.w)
