B.aaI=new A.d(B.c,["\u201cEveryone will see I am fake.\u201d","\u201cTodos ver\xe1n que soy falso.\u201d","\u201eJeder wird sehen, dass ich fake bin.\u201c","\u201cTout le monde verra que je suis faux.\u201d","\u201c\u0627\u0644\u062c\u0645\u064a\u0639 \u0633\u064a\u0631\u0648\u0646 \u0623\u0646\u0646\u064a \u0645\u0632\u064a\u0641.\u201d","\u201c\ubaa8\ub450\uac00 \ub0b4\uac00 \uac00\uc9dc\ub77c\ub294 \uac83\uc744 \uc54c\uac8c \ub420 \uac70\uc608\uc694.\u201d","\u201c\u6bcf\u4e2a\u4eba\u90fd\u4f1a\u770b\u5230\u6211\u662f\u5047\u88c5\u7684\u3002\u201d","\u201c\u0938\u092c\u0915\u094b \u0932\u0917\u0947\u0917\u093e \u0915\u093f \u092e\u0948\u0902 \u0928\u0915\u0932\u0940 \u0939\u0942\u0902\u0964\u201d","\u201cOmnes videbunt me esse falsum.\u201d","\u201cTutti vedranno che sono falso.\u201d","\u201c\u0647\u0645\u0647 \u062e\u0648\u0627\u0647\u0646\u062f \u062f\u06cc\u062f \u06a9\u0647 \u0645\u0646 \u062a\u0642\u0644\u0628\u06cc \u0647\u0633\u062a\u0645.\u201d"],t.w)
B.a9E=new A.d(B.c,["\u201cPeople think I am good at this, but I am just lucky. One day they\u2019ll realize I have no idea what I\u2019m doing.\u201d\n\nWhich emotion is loudest here?","\u201cLa gente piensa que soy bueno en esto, pero solo tengo suerte. Un d\xeda se dar\xe1n cuenta de que no tengo idea de lo que estoy haciendo.\u201d\n\n\xbfQu\xe9 emoci\xf3n es la m\xe1s fuerte aqu\xed?","\u201eDie Leute denken, dass ich gut darin bin, aber ich habe einfach Gl\xfcck. Eines Tages werden sie merken, dass ich keine Ahnung habe, was ich tue.\u201c\n\nWelche Emotion ist hier am st\xe4rksten zu h\xf6ren?","\u201cLes gens pensent que je suis bon dans ce domaine, mais j\u2019ai juste de la chance. Un jour, ils r\xe9aliseront que je n\u2019ai aucune id\xe9e de ce que je fais.\u201d\n\nQuelle \xe9motion est la plus forte ici ?","\u201c\u0627\u0644\u0646\u0627\u0633 \u064a\u0638\u0646\u0648\u0646 \u0623\u0646\u0646\u064a \u062c\u064a\u062f \u0641\u064a \u0647\u0630\u0627\u060c \u0644\u0643\u0646\u0646\u064a \u0645\u062c\u0631\u062f \u0645\u062d\u0638\u0648\u0638. \u0641\u064a \u064a\u0648\u0645 \u0645\u0627 \u0633\u064a\u0643\u062a\u0634\u0641\u0648\u0646 \u0623\u0646\u0647 \u0644\u064a\u0633 \u0644\u062f\u064a \u0641\u0643\u0631\u0629 \u0639\u0645\u0627 \u0623\u0641\u0639\u0644\u0647.\u201d\n\n\u0623\u064a \u0639\u0627\u0637\u0641\u0629 \u0647\u064a \u0627\u0644\u0623\u0642\u0648\u0649 \u0647\u0646\u0627\u061f","\u201c\uc0ac\ub78c\ub4e4\uc740 \ub0b4\uac00 \uc774\uac78 \uc798\ud55c\ub2e4\uace0 \uc0dd\uac01\ud558\uc9c0\ub9cc, \ub098\ub294 \uadf8\ub0e5 \uc6b4\uc774 \uc88b\uc744 \ubfd0\uc774\uc5d0\uc694. \uc5b8\uc820\uac00\ub294 \uadf8\ub4e4\uc774 \ub0b4\uac00 \ubb58 \ud558\uace0 \uc788\ub294\uc9c0 \uc804\ud600 \ubaa8\ub978\ub2e4\ub294 \uac78 \uc54c\uac8c \ub420 \uac70\uc608\uc694.\u201d\n\n\uc5ec\uae30\uc11c \uac00\uc7a5 \uac15\ud55c \uac10\uc815\uc740 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u201c\u4eba\u4eec\u4ee5\u4e3a\u6211\u5f88\u64c5\u957f\u8fd9\u4e2a\uff0c\u4f46\u6211\u53ea\u662f\u8fd0\u6c14\u597d\u3002\u6709\u4e00\u5929\u4ed6\u4eec\u4f1a\u610f\u8bc6\u5230\u6211\u6839\u672c\u4e0d\u77e5\u9053\u81ea\u5df1\u5728\u505a\u4ec0\u4e48\u3002\u201d\n\n\u8fd9\u91cc\u6700\u5f3a\u70c8\u7684\u60c5\u611f\u662f\u4ec0\u4e48\uff1f","\u201c\u0932\u094b\u0917 \u0938\u094b\u091a\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u092e\u0948\u0902 \u0907\u0938\u092e\u0947\u0902 \u0905\u091a\u094d\u091b\u093e \u0939\u0942\u0902, \u0932\u0947\u0915\u093f\u0928 \u092e\u0948\u0902 \u0938\u093f\u0930\u094d\u092b \u092d\u093e\u0917\u094d\u092f\u0936\u093e\u0932\u0940 \u0939\u0942\u0902\u0964 \u090f\u0915 \u0926\u093f\u0928 \u0935\u0947 \u0938\u092e\u091d \u091c\u093e\u090f\u0902\u0917\u0947 \u0915\u093f \u092e\u0941\u091d\u0947 \u092f\u0939 \u0928\u0939\u0940\u0902 \u092a\u0924\u093e \u0915\u093f \u092e\u0948\u0902 \u0915\u094d\u092f\u093e \u0915\u0930 \u0930\u0939\u093e \u0939\u0942\u0902\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0938\u092c\u0938\u0947 \u091c\u094b\u0930\u0926\u093e\u0930 \u092d\u093e\u0935\u0928\u093e \u0915\u094d\u092f\u093e \u0939\u0948?","\u201cHomines putant me hoc bene agere, sed ego tantum felicissimus sum. Aliquando intellegent me nullo modo scire quid faciam.\u201d\n\nQuae affectio hic loudest est?","\u201cLa gente pensa che sia bravo in questo, ma sono solo fortunato. Un giorno si renderanno conto che non ho idea di cosa sto facendo.\u201d\n\nQuale emozione \xe8 la pi\xf9 forte qui?","\u201c\u0645\u0631\u062f\u0645 \u0641\u06a9\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f \u06a9\u0647 \u0645\u0646 \u062f\u0631 \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u062e\u0648\u0628 \u0647\u0633\u062a\u0645\u060c \u0627\u0645\u0627 \u0645\u0646 \u0641\u0642\u0637 \u062e\u0648\u0634\u200c\u0634\u0627\u0646\u0633 \u0647\u0633\u062a\u0645. \u0631\u0648\u0632\u06cc \u062e\u0648\u0627\u0647\u0646\u062f \u0641\u0647\u0645\u06cc\u062f \u06a9\u0647 \u0647\u06cc\u0686 \u0627\u06cc\u062f\u0647\u200c\u0627\u06cc \u0646\u062f\u0627\u0631\u0645 \u06a9\u0647 \u0686\u0647 \u06a9\u0627\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u062d\u0633\u0627\u0633 \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0628\u0644\u0646\u062f\u062a\u0631\u06cc\u0646 \u0627\u0633\u062a\u061f"],t.w)
