B.aeM=new A.d(B.c,["Future you looks back at this exact day where you are reading this card.\n\nWhich message fits a caring postcard?","Tu futuro se mira hacia este mismo d\xeda en el que est\xe1s leyendo esta tarjeta.\n\n\xbfQu\xe9 mensaje encaja en una postal cari\xf1osa?","Dein zuk\xfcnftiges Ich blickt auf diesen Tag zur\xfcck, an dem du gerade diese Karte liest.\n\nWelche Nachricht passt zu einer f\xfcrsorglichen Postkarte?","Ton futur toi regarde en arri\xe8re ce jour exact o\xf9 tu lis cette carte.\n\nQuel message correspond \xe0 une carte postale bienveillante ?","\u0623\u0646\u062a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 \u062a\u0646\u0638\u0631 \u0625\u0644\u0649 \u0627\u0644\u0648\u0631\u0627\u0621 \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u064a\u0648\u0645 \u0627\u0644\u0645\u062d\u062f\u062f \u062d\u064a\u062b \u062a\u0642\u0631\u0623 \u0647\u0630\u0647 \u0627\u0644\u0628\u0637\u0627\u0642\u0629.\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0631\u0633\u0627\u0644\u0629 \u0627\u0644\u062a\u064a \u062a\u0646\u0627\u0633\u0628 \u0628\u0637\u0627\u0642\u0629 \u0628\u0631\u064a\u062f\u064a\u0629 \u0645\u0644\u064a\u0626\u0629 \u0628\u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645\u061f","\ubbf8\ub798\uc758 \ub2f9\uc2e0\uc740 \uc9c0\uae08 \uc774 \uce74\ub4dc\ub97c \uc77d\uace0 \uc788\ub294 \uc624\ub298\uc744 \ub3cc\uc544\ubd05\ub2c8\ub2e4.\n\n\uc5b4\ub5a4 \uba54\uc2dc\uc9c0\uac00 \ubc30\ub824 \uae4a\uc740 \uc5fd\uc11c\uc5d0 \uc801\ud569\ud560\uae4c\uc694?","\u672a\u6765\u7684\u4f60\u56de\u987e\u4eca\u5929\u7684\u8fd9\u4e00\u5929\uff0c\u4f60\u6b63\u5728\u9605\u8bfb\u8fd9\u5f20\u660e\u4fe1\u7247\u3002\n\n\u54ea\u6761\u6d88\u606f\u9002\u5408\u5173\u7231\u7684\u660e\u4fe1\u7247\uff1f","\u092d\u0935\u093f\u0937\u094d\u092f \u092e\u0947\u0902 \u0906\u092a \u0907\u0938 \u0926\u093f\u0928 \u0915\u094b \u0926\u0947\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902 \u091c\u092c \u0906\u092a \u0907\u0938 \u0915\u093e\u0930\u094d\u0921 \u0915\u094b \u092a\u0922\u093c \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\n\n\u0915\u094c\u0928 \u0938\u093e \u0938\u0902\u0926\u0947\u0936 \u090f\u0915 \u0926\u0947\u0916\u092d\u093e\u0932 \u0935\u093e\u0932\u0940 \u092a\u094b\u0938\u094d\u091f\u0915\u093e\u0930\u094d\u0921 \u092a\u0930 \u092b\u093f\u091f \u092c\u0948\u0920\u0924\u093e \u0939\u0948?","Futurum te respicit ad hunc diem exactum, ubi hanc chartam legis.\n\nQuae epistola congruit amicae? ","Il tuo futuro s\xe9 guarda indietro a questo esatto giorno in cui stai leggendo questa cartolina.\n\nQuale messaggio si adatta a una cartolina affettuosa?","\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u0631\u0648\u0632 \u062e\u0627\u0635 \u06a9\u0647 \u0634\u0645\u0627 \u062f\u0631 \u062d\u0627\u0644 \u062e\u0648\u0627\u0646\u062f\u0646 \u0627\u06cc\u0646 \u06a9\u0627\u0631\u062a \u067e\u0633\u062a\u0627\u0644 \u0647\u0633\u062a\u06cc\u062f\u060c \u0646\u06af\u0627\u0647 \u0645\u06cc\u200c\u06a9\u0646\u062f.\n\n\u06a9\u062f\u0627\u0645 \u067e\u06cc\u0627\u0645 \u0645\u0646\u0627\u0633\u0628 \u06cc\u06a9 \u06a9\u0627\u0631\u062a \u067e\u0633\u062a\u0627\u0644 \u062f\u0644\u0633\u0648\u0632\u0627\u0646\u0647 \u0627\u0633\u062a\u061f"],t.w)
B.a8r=new A.d(B.c,["\u201cYou were a lost cause; nothing you did mattered to me.\u201d","\u201cFuiste una causa perdida; nada de lo que hiciste me import\xf3.\u201d","\u201eDu warst ein hoffnungsloser Fall; nichts, was du tatest, war mir wichtig.\u201d","\u201cTu \xe9tais une cause perdue ; rien de ce que tu as fait ne m\u2019a int\xe9ress\xe9.\u201d","\u201c\u0643\u0646\u062a \u0642\u0636\u064a\u0629 \u062e\u0627\u0633\u0631\u0629\u061b \u0644\u0645 \u064a\u0643\u0646 \u0623\u064a \u0634\u064a\u0621 \u0641\u0639\u0644\u062a\u0647 \u0645\u0647\u0645\u064b\u0627 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u064a.\u201d","\u201c\ub108\ub294 \ud76c\ub9dd\uc774 \uc5c6\ub294 \uc874\uc7ac\uc600\uc5b4; \ub124\uac00 \ud55c \uc77c\uc740 \ub098\uc5d0\uac8c \uc544\ubb34 \uc758\ubbf8\uac00 \uc5c6\uc5b4.\u201d","\u201c\u4f60\u662f\u4e2a\u65e0\u836f\u53ef\u6551\u7684\u60c5\u51b5\uff1b\u4f60\u505a\u7684\u4e00\u5207\u5bf9\u6211\u6ca1\u6709\u4efb\u4f55\u610f\u4e49\u3002\u201d","\u201c\u0924\u0941\u092e \u090f\u0915 \u0916\u094b\u0908 \u0939\u0941\u0908 \u0938\u094d\u0925\u093f\u0924\u093f \u0925\u0947; \u0924\u0941\u092e\u0928\u0947 \u091c\u094b \u092d\u0940 \u0915\u093f\u092f\u093e, \u0935\u0939 \u092e\u0947\u0930\u0947 \u0932\u093f\u090f \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e\u0964\u201d","\u201cPerdita causa eras; nihil egisti quod mihi curavit.\u201d","\u201cEri una causa persa; niente di quello che hai fatto mi \xe8 importato.\u201d","\u201c\u062a\u0648 \u06cc\u06a9 \u0642\u0636\u06cc\u0647 \u0627\u0632 \u062f\u0633\u062a \u0631\u0641\u062a\u0647 \u0628\u0648\u062f\u06cc\u061b \u0647\u06cc\u0686\u200c\u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f\u06cc \u0628\u0631\u0627\u06cc \u0645\u0646 \u0645\u0647\u0645 \u0646\u0628\u0648\u062f.\u201d"],t.w)
