B.acF=new A.d(B.c,["\u201cYou tried to figure things out with the tools you had then. I am proud you kept going even when unsure.\u201d","\u201cIntentaste resolver las cosas con las herramientas que ten\xedas entonces. Estoy orgulloso de que hayas seguido adelante incluso cuando no estabas seguro.\u201d","\u201eDu hast versucht, die Dinge mit den Werkzeugen zu l\xf6sen, die du damals hattest. Ich bin stolz, dass du weitergemacht hast, auch wenn du unsicher warst.\u201c","\u201cTu as essay\xe9 de r\xe9soudre les choses avec les outils que tu avais \xe0 ce moment-l\xe0. Je suis fier de toi, tu as continu\xe9 m\xeame quand tu n\u2019\xe9tais pas s\xfbr.\u201d","\u201c\u0644\u0642\u062f \u062d\u0627\u0648\u0644\u062a \u0625\u064a\u062c\u0627\u062f \u0627\u0644\u062d\u0644\u0648\u0644 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0623\u062f\u0648\u0627\u062a \u0627\u0644\u062a\u064a \u0643\u0627\u0646\u062a \u0644\u062f\u064a\u0643 \u062d\u064a\u0646\u0647\u0627. \u0623\u0646\u0627 \u0641\u062e\u0648\u0631 \u0628\u0623\u0646\u0643 \u0627\u0633\u062a\u0645\u0631\u064a\u062a \u062d\u062a\u0649 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u063a\u064a\u0631 \u0645\u062a\u0623\u0643\u062f.\u201d","\u201c\uadf8 \ub2f9\uc2dc \ub2f9\uc2e0\uc774 \uac00\uc9c4 \ub3c4\uad6c\ub85c \ubb38\uc81c\ub97c \ud574\uacb0\ud558\ub824\uace0 \ud588\uc5b4\uc694. \ubd88\ud655\uc2e4\ud560 \ub54c\ub3c4 \uacc4\uc18d \ub098\uc544\uac04 \ub2f9\uc2e0\uc774 \uc790\ub791\uc2a4\ub7ec\uc6cc\uc694.\u201d","\u201c\u4f60\u5c1d\u8bd5\u7528\u90a3\u65f6\u62e5\u6709\u7684\u5de5\u5177\u53bb\u89e3\u51b3\u95ee\u9898\u3002\u6211\u4e3a\u4f60\u5373\u4f7f\u5728\u4e0d\u786e\u5b9a\u65f6\u4ecd\u7136\u575a\u6301\u4e0b\u53bb\u800c\u611f\u5230\u9a84\u50b2\u3002\u201d","\u201c\u0924\u0941\u092e\u0928\u0947 \u0909\u0938 \u0938\u092e\u092f \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092a\u093e\u0938 \u091c\u094b \u092d\u0940 \u0938\u093e\u0927\u0928 \u0925\u0947, \u0909\u0928\u0938\u0947 \u091a\u0940\u091c\u093c\u094b\u0902 \u0915\u094b \u0939\u0932 \u0915\u0930\u0928\u0947 \u0915\u0940 \u0915\u094b\u0936\u093f\u0936 \u0915\u0940\u0964 \u092e\u0941\u091d\u0947 \u0917\u0930\u094d\u0935 \u0939\u0948 \u0915\u093f \u0924\u0941\u092e \u0905\u0938\u092e\u0902\u091c\u0938 \u092e\u0947\u0902 \u0939\u094b\u0928\u0947 \u0915\u0947 \u092c\u093e\u0935\u091c\u0942\u0926 \u091a\u0932\u0924\u0947 \u0930\u0939\u0947\u0964\u201d","\u201cCum instrumentis tunc habuisti, res solvendas temptasti. Superbus sum quod pergisti, etiam cum incertus eras.\u201d","\u201cHai cercato di risolvere le cose con gli strumenti che avevi allora. Sono fiero che tu sia andato avanti anche quando non eri sicuro.\u201d","\u201c\u062a\u0648 \u062a\u0644\u0627\u0634 \u06a9\u0631\u062f\u06cc \u062a\u0627 \u0628\u0627 \u0627\u0628\u0632\u0627\u0631\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0622\u0646 \u0645\u0648\u0642\u0639 \u062f\u0627\u0634\u062a\u06cc\u060c \u0645\u0634\u06a9\u0644\u0627\u062a \u0631\u0627 \u062d\u0644 \u06a9\u0646\u06cc. \u0645\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u06a9\u0647 \u0628\u0627 \u0648\u062c\u0648\u062f \u062a\u0631\u062f\u06cc\u062f \u0627\u062f\u0627\u0645\u0647 \u062f\u0627\u062f\u06cc \u0627\u0641\u062a\u062e\u0627\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645.\u201d"],t.w)
