B.aaO=new A.d(B.c,["\u201cYou should have known everything already.\u201d","\u201cYa deber\xedas haberlo sabido todo.\u201d","\u201eDu h\xe4ttest alles schon wissen m\xfcssen.\u201c","\u201cTu aurais d\xfb tout savoir d\xe9j\xe0.\u201d","\u201c\u0643\u0627\u0646 \u064a\u062c\u0628 \u0623\u0646 \u062a\u0639\u0631\u0641 \u0643\u0644 \u0634\u064a\u0621 \u0628\u0627\u0644\u0641\u0639\u0644.\u201d","\u201c\uc774\ubbf8 \ubaa8\ub4e0 \uac83\uc744 \uc54c\uc558\uc5b4\uc57c \ud588\ub2e4.\u201d","\u201c\u4f60\u672c\u8be5\u65e9\u5c31\u77e5\u9053\u4e00\u5207\u3002\u201d","\u201c\u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u092a\u0939\u0932\u0947 \u0938\u0947 \u0938\u092c \u0915\u0941\u091b \u092a\u0924\u093e \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u090f \u0925\u093e\u0964\u201d","\u201cOmnia iam scire debebas.\u201d","\u201cAvresti dovuto sapere tutto gi\xe0.\u201d","\u201c\u0628\u0627\u06cc\u062f \u0642\u0628\u0644\u0627\u064b \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0645\u06cc\u200c\u062f\u0627\u0646\u0633\u062a\u06cc.\u201d"],t.w)
