B.abV=new A.d(B.c,["Good future-self messages honor effort and confusion instead of judging the past self for not knowing more.","Los buenos mensajes de tu futuro yo honran el esfuerzo y la confusi\xf3n en lugar de juzgar al yo del pasado por no saber m\xe1s.","Gute Nachrichten von deinem zuk\xfcnftigen Selbst ehren den Aufwand und die Verwirrung, anstatt das vergangene Selbst daf\xfcr zu verurteilen, dass es nicht mehr wusste.","Les bons messages de ton futur toi honorent l\u2019effort et la confusion au lieu de juger le pass\xe9 soi pour ne pas savoir plus.","\u0631\u0633\u0627\u0626\u0644 \u062c\u064a\u062f\u0629 \u0645\u0646 \u0646\u0641\u0633\u0643 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u062a\u0643\u0631\u0645 \u0627\u0644\u062c\u0647\u062f \u0648\u0627\u0644\u0627\u0631\u062a\u0628\u0627\u0643 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0627\u0644\u062d\u0643\u0645 \u0639\u0644\u0649 \u0646\u0641\u0633\u0643 \u0641\u064a \u0627\u0644\u0645\u0627\u0636\u064a \u0644\u0639\u062f\u0645 \u0645\u0639\u0631\u0641\u062a\u0643 \u0628\u0627\u0644\u0645\u0632\u064a\u062f.","\ubbf8\ub798\uc758 \uc790\uc2e0\uc774 \ubcf4\ub0b4\ub294 \uc88b\uc740 \uba54\uc2dc\uc9c0\ub294 \ub354 \ub9ce\uc774 \uc54c\uc9c0 \ubabb\ud55c \uacfc\uac70\uc758 \uc790\uc2e0\uc744 \ud310\ub2e8\ud558\uae30\ubcf4\ub2e4 \ub178\ub825\uacfc \ud63c\ub780\uc744 \uc874\uc911\ud569\ub2c8\ub2e4.","\u597d\u7684\u672a\u6765\u81ea\u6211\u4fe1\u606f\u4f1a\u5c0a\u91cd\u52aa\u529b\u548c\u56f0\u60d1\uff0c\u800c\u4e0d\u662f\u56e0\u4e3a\u8fc7\u53bb\u81ea\u5df1\u4e0d\u77e5\u9053\u66f4\u591a\u800c\u8bc4\u5224\u8fc7\u53bb\u7684\u81ea\u5df1\u3002","\u0905\u091a\u094d\u091b\u0947 \u092d\u0935\u093f\u0937\u094d\u092f-\u0938\u094d\u0935\u092f\u0902 \u0938\u0902\u0926\u0947\u0936 \u092a\u094d\u0930\u092f\u093e\u0938 \u0914\u0930 \u0909\u0932\u091d\u0928 \u0915\u094b \u0938\u092e\u094d\u092e\u093e\u0928\u093f\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u092c\u091c\u093e\u092f \u0907\u0938\u0915\u0947 \u0915\u093f \u0905\u0924\u0940\u0924 \u0915\u0947 \u0938\u094d\u0935\u092f\u0902 \u0915\u094b \u0907\u0938 \u0915\u093e\u0930\u0923 \u0938\u0947 \u091c\u091c \u0915\u0930\u0947\u0902 \u0915\u093f \u0909\u0928\u094d\u0939\u0947\u0902 \u091c\u094d\u092f\u093e\u0926\u093e \u092a\u0924\u093e \u0928\u0939\u0940\u0902 \u0925\u093e\u0964","Bona futura-te nuntia honorem conatum et confusionem, non iudicando praeteritum te pro non sciendo plura.","I buoni messaggi del tuo futuro s\xe9 onorano lo sforzo e la confusione invece di giudicare il passato s\xe9 per non sapere di pi\xf9.","\u067e\u06cc\u0627\u0645\u200c\u0647\u0627\u06cc \u062e\u0648\u0628 \u0627\u0632 \u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0628\u0647 \u062a\u0644\u0627\u0634 \u0648 \u0633\u0631\u062f\u0631\u06af\u0645\u06cc \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u06cc\u200c\u06af\u0630\u0627\u0631\u0646\u062f\u060c \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u062e\u0648\u062f \u06af\u0630\u0634\u062a\u0647 \u0631\u0627 \u0628\u0647 \u062e\u0627\u0637\u0631 \u0646\u062f\u0627\u0646\u0633\u062a\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0642\u0636\u0627\u0648\u062a \u06a9\u0646\u0646\u062f."],t.w)
