B.a94=new A.d(B.c,["\u201cI do not want to celebrate.\u201d","\u201cNo quiero celebrar.\u201d","\u201eIch m\xf6chte nicht feiern.\u201c","\u201cJe ne veux pas c\xe9l\xe9brer.\u201d","\u201c\u0644\u0627 \u0623\u0631\u064a\u062f \u0627\u0644\u0627\u062d\u062a\u0641\u0627\u0644.\u201d","\u201c\ucd95\ud558\ud558\uace0 \uc2f6\uc9c0 \uc54a\uc544\uc694.\u201d","\u201c\u6211\u4e0d\u60f3\u5e86\u795d\u3002\u201d","\u201c\u092e\u0948\u0902 \u091c\u0936\u094d\u0928 \u0928\u0939\u0940\u0902 \u092e\u0928\u093e\u0928\u093e \u091a\u093e\u0939\u0924\u093e\u0964\u201d","\u201cNolo celebrari.\u201d","\u201cNon voglio festeggiare.\u201d","\u201c\u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u0645 \u062c\u0634\u0646 \u0628\u06af\u06cc\u0631\u0645.\u201d"],t.w)
B.af6=new A.d(B.c,["\u201cI got good news, but I don\u2019t feel like celebrating. I just feel\u2026 tired.\u201d\n\nWhich emotion might be hiding behind the flatness?","\u201cTengo buenas noticias, pero no tengo ganas de celebrar. Simplemente me siento\u2026 cansado.\u201d\n\n\xbfQu\xe9 emoci\xf3n podr\xeda estar escondida detr\xe1s de la indiferencia?","\u201eIch habe gute Nachrichten, aber ich habe keine Lust zu feiern. Ich f\xfchle mich einfach\u2026 m\xfcde.\u201c\n\nWelche Emotion k\xf6nnte hinter dieser Flachheit stecken?","\u201cJ\u2019ai de bonnes nouvelles, mais je n\u2019ai pas envie de c\xe9l\xe9brer. Je me sens juste\u2026 fatigu\xe9.\u201d\n\nQuelle \xe9motion pourrait se cacher derri\xe8re cette indiff\xe9rence ?","\u201c\u062a\u0644\u0642\u064a\u062a \u0623\u062e\u0628\u0627\u0631\u064b\u0627 \u062c\u064a\u062f\u0629\u060c \u0644\u0643\u0646\u0646\u064a \u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u0627\u062d\u062a\u0641\u0627\u0644. \u0623\u0634\u0639\u0631 \u0641\u0642\u0637... \u0628\u0627\u0644\u062a\u0639\u0628.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0639\u0627\u0637\u0641\u0629 \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u0643\u0648\u0646 \u0645\u062e\u062a\u0628\u0626\u0629 \u0648\u0631\u0627\u0621 \u0647\u0630\u0627 \u0627\u0644\u0631\u0643\u0648\u062f\u061f","\u201c\uc88b\uc740 \uc18c\uc2dd\uc744 \ub4e4\uc5c8\uc9c0\ub9cc \ucd95\ud558\ud558\uace0 \uc2f6\uc740 \uae30\ubd84\uc774 \uc544\ub2c8\uc5d0\uc694. \uadf8\ub0e5\u2026 \ud53c\uace4\ud574\uc694.\u201d\n\n\uc774 \ud3c9\uc628\ud568 \ub4a4\uc5d0 \uc228\uc5b4 \uc788\uc744 \uac10\uc815\uc740 \ubb34\uc5c7\uc778\uac00\uc694?","\u201c\u6211\u6536\u5230\u4e86\u597d\u6d88\u606f\uff0c\u4f46\u6211\u6ca1\u6709\u5e86\u795d\u7684\u5fc3\u60c5\u3002\u6211\u53ea\u662f\u611f\u5230\u2026\u2026\u75b2\u60eb\u3002\u201d\n\n\u8fd9\u79cd\u5e73\u6de1\u80cc\u540e\u53ef\u80fd\u9690\u85cf\u7740\u4ec0\u4e48\u60c5\u611f\uff1f","\u201c\u092e\u0941\u091d\u0947 \u0905\u091a\u094d\u091b\u0940 \u0916\u092c\u0930 \u092e\u093f\u0932\u0940, \u0932\u0947\u0915\u093f\u0928 \u092e\u0941\u091d\u0947 \u091c\u0936\u094d\u0928 \u092e\u0928\u093e\u0928\u0947 \u0915\u093e \u092e\u0928 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u092e\u0941\u091d\u0947 \u092c\u0938... \u0925\u0915\u093e \u0939\u0941\u0906 \u092e\u0939\u0938\u0942\u0938 \u0939\u094b \u0930\u0939\u093e \u0939\u0948\u0964\u201d\n\n\u0907\u0938 \u0909\u092c\u093e\u090a\u092a\u0928 \u0915\u0947 \u092a\u0940\u091b\u0947 \u0915\u094c\u0928 \u0938\u0940 \u092d\u093e\u0935\u0928\u093e \u091b\u093f\u092a\u0940 \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948?","\u201cBona nuntia accepi, sed celebrandi non habeo cupiditatem. Simpliciter me sentio\u2026 fessum.\u201d\n\nQuae affectio esse posset latens post aegritudinem?","\u201cHo ricevuto buone notizie, ma non ho voglia di festeggiare. Mi sento solo\u2026 stanco.\u201d\n\nQuale emozione potrebbe nascondersi dietro questa piattezza?","\u201c\u062e\u0628\u0631 \u062e\u0648\u0628 \u06af\u0631\u0641\u062a\u0645\u060c \u0627\u0645\u0627 \u062d\u0648\u0635\u0644\u0647 \u062c\u0634\u0646 \u06af\u0631\u0641\u062a\u0646 \u0646\u062f\u0627\u0631\u0645. \u0641\u0642\u0637 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u0645... \u062e\u0633\u062a\u0647\u200c\u0627\u0645.\u201d\n\n\u0686\u0647 \u0627\u062d\u0633\u0627\u0633\u06cc \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u067e\u0634\u062a \u0627\u06cc\u0646 \u0628\u06cc\u200c\u0631\u0648\u062d\u06cc \u067e\u0646\u0647\u0627\u0646 \u0628\u0627\u0634\u062f\u061f"],t.w)
