B.acg=new A.d(B.c,["Sometimes \u201cno feeling\u201d after good news actually signals exhaustion or burnout, not a lack of caring.","A veces, el \u201cno sentir nada\u201d despu\xe9s de buenas noticias en realidad indica agotamiento o burnout, no una falta de inter\xe9s.","Manchmal bedeutet \u201ekein Gef\xfchl\u201c nach guten Nachrichten tats\xe4chlich Ersch\xf6pfung oder Burnout, nicht ein Mangel an F\xfcrsorge.","Parfois, le \u201cne rien ressentir\u201d apr\xe8s de bonnes nouvelles est en r\xe9alit\xe9 un signe d\u2019\xe9puisement ou de burn-out, et non d\u2019un manque d\u2019int\xe9r\xeat.","\u0623\u062d\u064a\u0627\u0646\u064b\u0627 \u064a\u0639\u0646\u064a \u201c\u0639\u062f\u0645 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0634\u064a\u0621\u201d \u0628\u0639\u062f \u0627\u0644\u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u062c\u064a\u062f\u0629 \u0641\u064a \u0627\u0644\u0648\u0627\u0642\u0639 \u0627\u0644\u0625\u0631\u0647\u0627\u0642 \u0623\u0648 \u0627\u0644\u0627\u062d\u062a\u0631\u0627\u0642 \u0627\u0644\u0648\u0638\u064a\u0641\u064a\u060c \u0648\u0644\u064a\u0633 \u0646\u0642\u0635\u064b\u0627 \u0641\u064a \u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645.","\uc88b\uc740 \uc18c\uc2dd \ud6c4\uc5d0 \u201c\uc544\ubb34 \uac10\uc815\ub3c4 \uc5c6\ub2e4\u201d\ub294 \uac83\uc740 \uc2e4\uc81c\ub85c \ud0c8\uc9c4\uc774\ub098 \ubc88\uc544\uc6c3\uc744 \ub098\ud0c0\ub0b4\uba70, \uad00\uc2ec \ubd80\uc871\uc774 \uc544\ub2d9\ub2c8\ub2e4.","\u6709\u65f6\uff0c\u201c\u6ca1\u6709\u611f\u89c9\u201d\u5e76\u4e0d\u610f\u5473\u7740\u7f3a\u4e4f\u5173\u5fc3\uff0c\u800c\u662f\u5728\u597d\u6d88\u606f\u4e4b\u540e\u5b9e\u9645\u4e0a\u662f\u75b2\u52b3\u6216\u804c\u4e1a\u5026\u6020\u7684\u4fe1\u53f7\u3002",'\u0915\u092d\u0940-\u0915\u092d\u0940, \u0905\u091a\u094d\u091b\u0947 \u0938\u092e\u093e\u091a\u093e\u0930\u094b\u0902 \u0915\u0947 \u092c\u093e\u0926 "\u0915\u094b\u0908 \u092d\u093e\u0935\u0928\u093e \u0928\u0939\u0940\u0902" \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0925\u0915\u093e\u0928 \u092f\u093e \u092c\u0930\u094d\u0928\u0906\u0909\u091f \u0915\u093e \u0938\u0902\u0915\u0947\u0924 \u0939\u094b\u0924\u0940 \u0939\u0948, \u0928 \u0915\u093f \u0907\u0938 \u092c\u093e\u0924 \u0915\u0940 \u0915\u092e\u0940 \u0915\u093f \u0939\u092e\u0947\u0902 \u092a\u0930\u0935\u093e\u0939 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964',"Aliquando \u201cnullum sensum\u201d post bonas nuntias reconditum significat exhaustionem aut burnout, non defectum curandi.","A volte, \u201cnessuna sensazione\u201d dopo buone notizie in realt\xe0 segnala esaurimento o burnout, non la mancanza di interesse.","\u06af\u0627\u0647\u06cc \u0627\u0648\u0642\u0627\u062a \u201c\u0639\u062f\u0645 \u0627\u062d\u0633\u0627\u0633\u201d \u067e\u0633 \u0627\u0632 \u062f\u0631\u06cc\u0627\u0641\u062a \u0627\u062e\u0628\u0627\u0631 \u062e\u0648\u0628 \u062f\u0631 \u0648\u0627\u0642\u0639 \u0646\u0634\u0627\u0646\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u0633\u062a\u06af\u06cc \u06cc\u0627 \u0633\u0648\u062e\u062a\u06af\u06cc \u0634\u063a\u0644\u06cc \u0627\u0633\u062a\u060c \u0646\u0647 \u0628\u06cc\u200c\u062a\u0641\u0627\u0648\u062a\u06cc."],t.w)
B.adx=new A.d(B.c,["Burnout signal","Se\xf1al de agotamiento","Burnout-Signal","Signal de burnout","\u0625\u0634\u0627\u0631\u0629 \u0627\u0644\u0627\u062d\u062a\u0631\u0627\u0642 \u0627\u0644\u0648\u0638\u064a\u0641\u064a","\ubc88\uc544\uc6c3 \uc2e0\ud638","\u5026\u6020\u4fe1\u53f7","\u092c\u0930\u094d\u0928\u0906\u0909\u091f \u0938\u0902\u0915\u0947\u0924","Signum burnout","Segnale di burnout","\u0646\u0634\u0627\u0646\u0647 \u0633\u0648\u062e\u062a\u06af\u06cc \u0634\u063a\u0644\u06cc"],t.w)
