B.a9Y=new A.d(B.c,["\u201cI talk too much.\u201d","\u201cHablo demasiado.\u201d","\u201eIch rede zu viel.\u201c","\u201cJe parle trop.\u201d","\u201c\u0623\u0646\u0627 \u0623\u062a\u062d\u062f\u062b \u0643\u062b\u064a\u0631\u064b\u0627.\u201d","\u201c\ub098\ub294 \ub108\ubb34 \ub9ce\uc774 \ub9d0\ud574.\u201d","\u201c\u6211\u8bf4\u5f97\u592a\u591a\u4e86\u3002\u201d","\u201c\u092e\u0948\u0902 \u092c\u0939\u0941\u0924 \u092c\u093e\u0924 \u0915\u0930\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cLoquor nimis.\u201d","\u201cParlo troppo.\u201d","\u201c\u0645\u0646 \u0632\u06cc\u0627\u062f \u0635\u062d\u0628\u062a \u0645\u06cc\u200c\u06a9\u0646\u0645.\u201d"],t.w)
B.a9t=new A.d(B.c,["\u201cAfter I leave a conversation, I replay every sentence and feel like I talked too much, took up too much space.\u201d\n\nWhat emotion is most likely here?","\u201cDespu\xe9s de dejar una conversaci\xf3n, repaso cada frase y siento que habl\xe9 demasiado, ocup\xe9 demasiado espacio.\u201d\n\n\xbfQu\xe9 emoci\xf3n es la m\xe1s probable aqu\xed?","\u201eNachdem ich ein Gespr\xe4ch verlassen habe, spiele ich jeden Satz nochmal ab und habe das Gef\xfchl, zu viel geredet zu haben, zu viel Raum eingenommen zu haben.\u201c\n\nWelche Emotion ist hier am wahrscheinlichsten?","\u201cApr\xe8s avoir quitt\xe9 une conversation, je repasse chaque phrase et j\u2019ai l\u2019impression d\u2019avoir trop parl\xe9, d\u2019avoir pris trop de place.\u201d\n\nQuelle \xe9motion est la plus probable ici ?","\u201c\u0628\u0639\u062f \u0645\u063a\u0627\u062f\u0631\u062a\u064a \u0644\u0645\u062d\u0627\u062f\u062b\u0629\u060c \u0623\u0639\u064a\u062f \u062a\u0634\u063a\u064a\u0644 \u0643\u0644 \u062c\u0645\u0644\u0629 \u0648\u0623\u0634\u0639\u0631 \u0623\u0646\u0646\u064a \u062a\u062d\u062f\u062b\u062a \u0643\u062b\u064a\u0631\u064b\u0627\u060c \u0634\u063a\u0644\u062a \u0645\u0633\u0627\u062d\u0629 \u0643\u0628\u064a\u0631\u0629.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0639\u0627\u0637\u0641\u0629 \u0627\u0644\u0623\u0643\u062b\u0631 \u0627\u062d\u062a\u0645\u0627\u0644\u064b\u0627 \u0647\u0646\u0627\u061f","\u201c\ub300\ud654\ub97c \ub05d\ub0b4\uace0 \ub098\uba74, \ub098\ub294 \ubaa8\ub4e0 \ubb38\uc7a5\uc744 \ub418\uc0c8\uae30\uba70 \ub108\ubb34 \ub9ce\uc774 \uc774\uc57c\uae30\ud588\uace0, \ub108\ubb34 \ub9ce\uc740 \uacf5\uac04\uc744 \ucc28\uc9c0\ud588\ub2e4\uace0 \ub290\uaef4.\u201d\n\n\uc5ec\uae30\uc11c \uac00\uc7a5 \uac00\ub2a5\uc131 \ub192\uc740 \uac10\uc815\uc740 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u201c\u5728\u6211\u7ed3\u675f\u4e00\u573a\u5bf9\u8bdd\u540e\uff0c\u6211\u4f1a\u56de\u60f3\u6bcf\u4e00\u53e5\u8bdd\uff0c\u89c9\u5f97\u81ea\u5df1\u8bf4\u5f97\u592a\u591a\uff0c\u5360\u7528\u4e86\u592a\u591a\u7a7a\u95f4\u3002\u201d\n\n\u8fd9\u91cc\u6700\u53ef\u80fd\u7684\u60c5\u7eea\u662f\u4ec0\u4e48\uff1f","\u201c\u092e\u0948\u0902 \u091c\u092c \u092d\u0940 \u0915\u093f\u0938\u0940 \u092c\u093e\u0924\u091a\u0940\u0924 \u0915\u094b \u0916\u0924\u094d\u092e \u0915\u0930\u0924\u093e \u0939\u0942\u0901, \u0939\u0930 \u090f\u0915 \u0935\u093e\u0915\u094d\u092f \u0915\u094b \u0926\u094b\u092c\u093e\u0930\u093e \u0938\u094b\u091a\u0924\u093e \u0939\u0942\u0901 \u0914\u0930 \u0932\u0917\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902\u0928\u0947 \u092c\u0939\u0941\u0924 \u091c\u094d\u092f\u093e\u0926\u093e \u092c\u093e\u0924 \u0915\u0940, \u092c\u0939\u0941\u0924 \u091c\u094d\u092f\u093e\u0926\u093e \u091c\u0917\u0939 \u0932\u0940\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0938\u092c\u0938\u0947 \u091c\u094d\u092f\u093e\u0926\u093e \u0938\u0902\u092d\u093e\u0935\u093f\u0924 \u092d\u093e\u0935\u0928\u093e \u0915\u094d\u092f\u093e \u0939\u0948?","\u201cPostquam conversationem reliqui, omnem sententiam iterum transigam et sentio me nimis locutum esse, nimis locum ceptum esse.\u201d\n\nQuae affectio hic probabiliter latet?","\u201cDopo aver lasciato una conversazione, ripenso ogni frase e sento di aver parlato troppo, di aver preso troppo spazio.\u201d\n\nQuale emozione \xe8 pi\xf9 probabile qui?","\u201c\u0628\u0639\u062f \u0627\u0632 \u062a\u0631\u06a9 \u0645\u06a9\u0627\u0644\u0645\u0647\u060c \u0647\u0631 \u062c\u0645\u0644\u0647 \u0631\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u0645\u0631\u0648\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645 \u0648 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u0645 \u06a9\u0647 \u062e\u06cc\u0644\u06cc \u0635\u062d\u0628\u062a \u06a9\u0631\u062f\u0645\u060c \u0641\u0636\u0627\u06cc \u0632\u06cc\u0627\u062f\u06cc \u06af\u0631\u0641\u062a\u0645.\u201d\n\n\u0627\u062d\u0633\u0627\u0633 \u0627\u0635\u0644\u06cc \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0686\u06cc\u0633\u062a\u061f"],t.w)
