B.a8X=new A.d(B.c,["Over-analyzing your own words after social interactions is a common pattern in social anxiety.","Analizar en exceso tus propias palabras despu\xe9s de las interacciones sociales es un patr\xf3n com\xfan en la ansiedad social.","Das \xdcberanalysieren der eigenen Worte nach sozialen Interaktionen ist ein h\xe4ufiges Muster bei sozialer Angst.","L\u2019analyse excessive de ses propres mots apr\xe8s des interactions sociales est un sch\xe9ma courant dans l\u2019anxi\xe9t\xe9 sociale.","\u0625\u0639\u0627\u062f\u0629 \u062a\u062d\u0644\u064a\u0644 \u0643\u0644\u0645\u0627\u062a\u0643 \u0628\u0639\u062f \u0627\u0644\u062a\u0641\u0627\u0639\u0644\u0627\u062a \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u064a\u0629 \u0647\u0648 \u0646\u0645\u0637 \u0634\u0627\u0626\u0639 \u0641\u064a \u0627\u0644\u0642\u0644\u0642 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u064a.","\uc0ac\ud68c\uc801 \uc0c1\ud638\uc791\uc6a9 \ud6c4 \uc790\uc2e0\uc758 \ub9d0\uc744 \uacfc\ub3c4\ud558\uac8c \ubd84\uc11d\ud558\ub294 \uac83\uc740 \uc0ac\ud68c\uc801 \ubd88\uc548\uc5d0\uc11c \ud754\ud788 \ub098\ud0c0\ub098\ub294 \ud328\ud134\uc785\ub2c8\ub2e4.","\u5728\u793e\u4ea4\u4e92\u52a8\u540e\u8fc7\u5ea6\u5206\u6790\u81ea\u5df1\u7684\u8bdd\u8bed\u662f\u793e\u4ea4\u7126\u8651\u4e2d\u7684\u5e38\u89c1\u6a21\u5f0f\u3002","\u0938\u093e\u092e\u093e\u091c\u093f\u0915 \u092c\u093e\u0924\u091a\u0940\u0924 \u0915\u0947 \u092c\u093e\u0926 \u0905\u092a\u0928\u0940 \u092c\u093e\u0924\u094b\u0902 \u0915\u093e \u0905\u0927\u093f\u0915 \u0935\u093f\u0936\u094d\u0932\u0947\u0937\u0923 \u0915\u0930\u0928\u093e \u0938\u093e\u092e\u093e\u091c\u093f\u0915 \u091a\u093f\u0902\u0924\u093e \u092e\u0947\u0902 \u090f\u0915 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u092a\u0948\u091f\u0930\u094d\u0928 \u0939\u0948\u0964","Post socialia interactiones superanalysare verba tua est commune exemplum in anxietate sociali.","Analizzare eccessivamente le proprie parole dopo interazioni sociali \xe8 un modello comune nell\u2019ansia sociale.","\u062a\u062d\u0644\u06cc\u0644 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u06a9\u0644\u0645\u0627\u062a \u062e\u0648\u062f \u067e\u0633 \u0627\u0632 \u062a\u0639\u0627\u0645\u0644\u0627\u062a \u0627\u062c\u062a\u0645\u0627\u0639\u06cc \u06cc\u06a9 \u0627\u0644\u06af\u0648\u06cc \u0631\u0627\u06cc\u062c \u062f\u0631 \u0627\u0636\u0637\u0631\u0627\u0628 \u0627\u062c\u062a\u0645\u0627\u0639\u06cc \u0627\u0633\u062a."],t.w)
