B.ae9=new A.d(B.c,["\u201cI do not care anymore.\u201d","\u201cYa no me importa.\u201d","\u201eEs ist mir jetzt egal.\u201d","\u201cJe n\u2019en ai plus rien \xe0 faire.\u201d","\u201c\u0644\u0645 \u064a\u0639\u062f \u064a\u0647\u0645\u0646\u064a.\u201d","\u201c\uc774\uc81c \ub354 \uc774\uc0c1 \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\uc544\uc694.\u201d","\u201c\u6211\u4e0d\u518d\u5728\u4e4e\u4e86\u3002\u201d","\u201c\u0905\u092c \u092e\u0941\u091d\u0947 \u0915\u094b\u0908 \u092b\u0930\u094d\u0915 \u0928\u0939\u0940\u0902 \u092a\u0921\u093c\u0924\u093e\u0964\u201d","\u201cNihil mihi interest amplius.\u201d","\u201cNon mi importa pi\xf9.\u201d","\u201c\u062f\u06cc\u06af\u0631 \u0627\u0647\u0645\u06cc\u062a\u06cc \u0646\u0645\u06cc\u200c\u062f\u0647\u0645.\u201d"],t.w)
B.acr=new A.d(B.c,["\u201cWhatever. I don\u2019t care anymore.\u201d\n\nWhen someone says this after being hurt, what is usually underneath?","\u201cLo que sea. Ya no me importa.\u201d\n\nCuando alguien dice esto despu\xe9s de haber sido herido, \xbfqu\xe9 suele haber debajo?","\u201eWas auch immer. Es ist mir jetzt egal.\u201c\n\nWenn jemand dies nach einem Schmerz sagt, was ist normalerweise darunter?","\u201cPeu importe. Je n\u2019en ai plus rien \xe0 faire.\u201d\n\nLorsque quelqu\u2019un dit cela apr\xe8s avoir \xe9t\xe9 bless\xe9, qu\u2019est-ce qui se cache g\xe9n\xe9ralement sous cette phrase ?","\u201c\u0645\u0647\u0645\u0646\u064a\u0634. \u0644\u0645 \u064a\u0639\u062f \u064a\u0647\u0645\u0646\u064a.\u201d\n\n\u0639\u0646\u062f\u0645\u0627 \u064a\u0642\u0648\u0644 \u0634\u062e\u0635 \u0645\u0627 \u0647\u0630\u0627 \u0628\u0639\u062f \u0623\u0646 \u064a\u062a\u0623\u0630\u0649\u060c \u0645\u0627 \u0647\u0648 \u0627\u0644\u0634\u0639\u0648\u0631 \u0627\u0644\u0630\u064a \u064a\u0643\u0648\u0646 \u0639\u0627\u062f\u0629\u064b \u062a\u062d\u062a \u0647\u0630\u0627 \u0627\u0644\u062a\u0635\u0631\u0641\u061f","\u201c\ubb50 \uc5b4\ub54c. \uc774\uc81c \ub354 \uc774\uc0c1 \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\uc544\uc694.\u201d\n\n\ub204\uad70\uac00\uac00 \uc0c1\ucc98\ub97c \ubc1b\uc740 \ud6c4 \uc774\ub807\uac8c \ub9d0\ud560 \ub54c, \ubcf4\ud1b5 \uadf8 \uc548\uc5d0 \ubb34\uc5c7\uc774 \uc228\uc5b4 \uc788\uc744\uae4c\uc694?","\u201c\u968f\u4fbf\u3002\u73b0\u5728\u6211\u4e0d\u518d\u5728\u4e4e\u4e86\u3002\u201d\n\n\u5f53\u6709\u4eba\u5728\u53d7\u4f24\u540e\u8bf4\u51fa\u8fd9\u53e5\u8bdd\u65f6\uff0c\u901a\u5e38\u80cc\u540e\u9690\u85cf\u7740\u4ec0\u4e48\u60c5\u611f\uff1f","\u201c\u091c\u094b \u092d\u0940 \u0939\u094b\u0964 \u0905\u092c \u092e\u0941\u091d\u0947 \u0915\u094b\u0908 \u092b\u0930\u094d\u0915 \u0928\u0939\u0940\u0902 \u092a\u0921\u093c\u0924\u093e\u0964\u201d\n\n\u091c\u092c \u0915\u094b\u0908 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u092f\u0939 \u0915\u0939\u0924\u093e \u0939\u0948 \u0924\u094b \u0907\u0938\u0915\u0947 \u092a\u0940\u091b\u0947 \u0906\u092e\u0924\u094c\u0930 \u092a\u0930 \u0915\u094d\u092f\u093e \u091b\u093f\u092a\u093e \u0939\u094b\u0924\u093e \u0939\u0948?","\u201cQuidquid. Nihil mihi interest amplius.\u201d\n\nCum aliquis hoc dicit post vulnerationem, quid sub hac reactione latet?","\u201cQualunque cosa. Non mi importa pi\xf9.\u201d\n\nQuando qualcuno dice questo dopo essere stato ferito, cosa si nasconde solitamente sotto?","\u201c\u0647\u0631 \u0686\u06cc. \u062f\u06cc\u06af\u0647 \u0628\u0631\u0627\u0645 \u0645\u0647\u0645 \u0646\u06cc\u0633\u062a.\u201d\n\n\u0648\u0642\u062a\u06cc \u06a9\u0633\u06cc \u0627\u06cc\u0646 \u0631\u0648 \u0628\u0639\u062f \u0627\u0632 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0646 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f\u060c \u0645\u0639\u0645\u0648\u0644\u0627\u064b \u0686\u0647 \u0686\u06cc\u0632\u06cc \u062f\u0631 \u0632\u06cc\u0631 \u0622\u0646 \u0646\u0647\u0641\u062a\u0647 \u0627\u0633\u062a\u061f"],t.w)
