B.adr=new A.d(B.c,["\u201cI don\u2019t care\u201d often acts as armor over feelings like sadness and frustration, not the absence of emotion.","\u201cNo me importa\u201d a menudo act\xfaa como una armadura sobre sentimientos como la tristeza y la frustraci\xf3n, no la ausencia de emoci\xf3n.","\u201eEs ist mir egal\u201c wirkt oft wie eine R\xfcstung \xfcber Gef\xfchlen wie Traurigkeit und Frustration, nicht wie das Fehlen von Emotionen.","\u201cJe n\u2019en ai plus rien \xe0 faire\u201d agit souvent comme une armure sur des sentiments comme la tristesse et la frustration, et non l\u2019absence d\u2019\xe9motion.","\u201c\u0644\u0627 \u064a\u0647\u0645\u0646\u064a\u201d \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u0639\u0645\u0644 \u0643\u062f\u0631\u0648\u0639 \u0641\u0648\u0642 \u0627\u0644\u0645\u0634\u0627\u0639\u0631 \u0645\u062b\u0644 \u0627\u0644\u062d\u0632\u0646 \u0648\u0627\u0644\u0625\u062d\u0628\u0627\u0637\u060c \u0648\u0644\u064a\u0633 \u063a\u064a\u0627\u0628 \u0627\u0644\u0639\u0627\u0637\u0641\u0629.","\u201c\uc0c1\uad00\uc5c6\uc5b4\u201d\ub294 \uc885\uc885 \uc2ac\ud514\uacfc \uc88c\uc808 \uac19\uc740 \uac10\uc815 \uc704\uc5d0 \uac11\uc637\ucc98\ub7fc \uc791\uc6a9\ud569\ub2c8\ub2e4. \uac10\uc815\uc758 \ubd80\uc7ac\uac00 \uc544\ub2d9\ub2c8\ub2e4.","\u201c\u6211\u4e0d\u518d\u5728\u4e4e\u201d\u901a\u5e38\u50cf\u76d4\u7532\u4e00\u6837\u8986\u76d6\u5728\u60b2\u4f24\u548c\u6cae\u4e27\u7b49\u60c5\u611f\u4e4b\u4e0a\uff0c\u800c\u4e0d\u662f\u60c5\u611f\u7684\u7f3a\u5931\u3002","\u201c\u092e\u0941\u091d\u0947 \u0905\u092c \u0915\u094b\u0908 \u092b\u0930\u094d\u0915 \u0928\u0939\u0940\u0902 \u092a\u0921\u093c\u0924\u093e\u201d \u0905\u0915\u094d\u0938\u0930 \u0909\u0926\u093e\u0938\u0940 \u0914\u0930 \u0928\u093f\u0930\u093e\u0936\u093e \u091c\u0948\u0938\u0940 \u092d\u093e\u0935\u0928\u093e\u0913\u0902 \u0915\u0947 \u090a\u092a\u0930 \u0915\u0935\u091a \u0915\u0940 \u0924\u0930\u0939 \u0915\u093e\u092e \u0915\u0930\u0924\u093e \u0939\u0948, \u0928 \u0915\u093f \u092d\u093e\u0935\u0928\u093e\u0913\u0902 \u0915\u0940 \u0905\u0928\u0941\u092a\u0938\u094d\u0925\u093f\u0924\u093f\u0964","\u201cNihil mihi interest\u201d saepe operitur affectus sicut tristitia et frustratio, non absenntia affectuum.","\u201cNon mi importa pi\xf9\u201d spesso agisce come una corazza su sentimenti come tristezza e frustrazione, non l\u2019assenza di emozione.","\u201c\u062f\u06cc\u06af\u0631 \u0627\u0647\u0645\u06cc\u062a\u06cc \u0646\u0645\u06cc\u200c\u062f\u0647\u0645\u201d \u0627\u063a\u0644\u0628 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06cc\u06a9 \u0632\u0631\u0647 \u0631\u0648\u06cc \u0627\u062d\u0633\u0627\u0633\u0627\u062a\u06cc \u0645\u0627\u0646\u0646\u062f \u063a\u0645 \u0648 \u0646\u0627\u0627\u0645\u06cc\u062f\u06cc \u0639\u0645\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f\u060c \u0646\u0647 \u0639\u062f\u0645 \u0648\u062c\u0648\u062f \u0627\u062d\u0633\u0627\u0633\u0627\u062a."],t.w)
