B.adR=new A.d(B.c,["\u201cI cannot switch off.\u201d","\u201cNo puedo apagarme.\u201d","\u201eIch kann nicht abschalten.\u201c","\u201cJe ne peux pas m\u2019\xe9teindre.\u201d","\u201c\u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0637\u0641\u0626 \u0646\u0641\u0633\u064a.\u201d","\u201c\ub098\ub294 \ub04c \uc218 \uc5c6\uc5b4.\u201d","\u201c\u6211\u65e0\u6cd5\u5173\u95ed\u81ea\u5df1\u3002\u201d","\u201c\u092e\u0948\u0902 \u0916\u0941\u0926 \u0915\u094b \u092c\u0902\u0926 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u093e\u0964\u201d","\u201cNon possum me ipsum opprimere.\u201d","\u201cNon riesco a spegnermi.\u201d","\u201c\u0645\u0646 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u062e\u0648\u062f \u0631\u0627 \u062e\u0627\u0645\u0648\u0634 \u06a9\u0646\u0645.\u201d"],t.w)
B.ae1=new A.d(B.c,["\u201cI lie down to sleep, and my brain suddenly remembers every mistake I made in the last 5 years.\u201d\n\nWhich emotion is dominant here?","\u201cMe acuesto a dormir, y mi cerebro de repente recuerda cada error que comet\xed en los \xfaltimos 5 a\xf1os.\u201d\n\n\xbfQu\xe9 emoci\xf3n es dominante aqu\xed?","\u201eIch lege mich zum Schlafen und pl\xf6tzlich erinnert sich mein Gehirn an jeden Fehler, den ich in den letzten 5 Jahren gemacht habe.\u201c\n\nWelche Emotion ist hier dominant?","\u201cJe m\u2019allonge pour dormir, et mon cerveau se souvient soudainement de chaque erreur que j\u2019ai commise au cours des 5 derni\xe8res ann\xe9es.\u201d\n\nQuelle \xe9motion est dominante ici ?","\u201c\u0623\u0633\u062a\u0644\u0642\u064a \u0644\u0644\u0646\u0648\u0645\u060c \u0648\u0641\u062c\u0623\u0629 \u064a\u062a\u0630\u0643\u0631 \u0639\u0642\u0644\u064a \u0643\u0644 \u062e\u0637\u0623 \u0627\u0631\u062a\u0643\u0628\u062a\u0647 \u0641\u064a \u0627\u0644\u0633\u0646\u0648\u0627\u062a \u0627\u0644\u062e\u0645\u0633 \u0627\u0644\u0645\u0627\u0636\u064a\u0629.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0639\u0627\u0637\u0641\u0629 \u0627\u0644\u0633\u0627\u0626\u062f\u0629 \u0647\u0646\u0627\u061f","\u201c\uc7a0\uc744 \uc790\ub824\uace0 \ub204\uc6e0\ub294\ub370, \uac11\uc790\uae30 \ub0b4 \ub1cc\ub294 \uc9c0\ub09c 5\ub144 \ub3d9\uc548 \ub0b4\uac00 \ud55c \ubaa8\ub4e0 \uc2e4\uc218\ub97c \uae30\uc5b5\ud574\uc694.\u201d\n\n\uc5ec\uae30\uc11c \uc9c0\ubc30\uc801\uc778 \uac10\uc815\uc740 \ubb34\uc5c7\uc778\uac00\uc694?","\u201c\u6211\u8eba\u4e0b\u6765\u51c6\u5907\u7761\u89c9\uff0c\u7a81\u7136\u6211\u7684\u5927\u8111\u60f3\u8d77\u4e86\u8fc7\u53bb\u4e94\u5e74\u91cc\u6211\u72af\u7684\u6bcf\u4e2a\u9519\u8bef\u3002\u201d\n\n\u8fd9\u91cc\u4e3b\u5bfc\u7684\u60c5\u611f\u662f\u4ec0\u4e48\uff1f","\u201c\u092e\u0948\u0902 \u0938\u094b\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0932\u0947\u091f \u091c\u093e\u0924\u093e \u0939\u0942\u0901, \u0914\u0930 \u092e\u0947\u0930\u093e \u0926\u093f\u092e\u093e\u0917 \u0905\u091a\u093e\u0928\u0915 \u092a\u093f\u091b\u0932\u0947 5 \u0938\u093e\u0932\u094b\u0902 \u092e\u0947\u0902 \u0915\u0940 \u0917\u0908 \u0939\u0930 \u090f\u0915 \u0917\u0932\u0924\u0940 \u0915\u094b \u092f\u093e\u0926 \u0915\u0930\u0924\u093e \u0939\u0948\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0938\u092c\u0938\u0947 \u092a\u094d\u0930\u092e\u0941\u0916 \u092d\u093e\u0935\u0928\u093e \u0915\u094d\u092f\u093e \u0939\u0948?","\u201cAd dormienti me iaceo, et cerebrum meum subito meminit omnis erroris quem in ultimis 5 annis feci.\u201d\n\nQuae affectio hic dominatur?","\u201cMi sdraio per dormire e improvvisamente il mio cervello ricorda ogni errore che ho fatto negli ultimi 5 anni.\u201d\n\nQuale emozione \xe8 dominante qui?","\u201c\u0645\u0646 \u0628\u0631\u0627\u06cc \u062e\u0648\u0627\u0628\u06cc\u062f\u0646 \u062f\u0631\u0627\u0632 \u0645\u06cc\u200c\u06a9\u0634\u0645 \u0648 \u0646\u0627\u06af\u0647\u0627\u0646 \u0645\u063a\u0632\u0645 \u0647\u0631 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u0631\u0627 \u06a9\u0647 \u062f\u0631 5 \u0633\u0627\u0644 \u06af\u0630\u0634\u062a\u0647 \u0645\u0631\u062a\u06a9\u0628 \u0634\u062f\u0645\u060c \u0628\u0647 \u06cc\u0627\u062f \u0645\u06cc\u200c\u0622\u0648\u0631\u062f.\u201d\n\n\u0627\u062d\u0633\u0627\u0633 \u063a\u0627\u0644\u0628 \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0686\u06cc\u0633\u062a\u061f"],t.w)
