B.a7J=new A.d(B.c,["\u201cI\u2019m not good enough.\u201d","\u201cNo soy lo suficientemente bueno.\u201d","\u201eIch bin nicht gut genug.\u201c","\u201cJe ne suis pas assez bien.\u201d","\u201c\u0644\u0633\u062a \u062c\u064a\u062f\u064b\u0627 \u0628\u0645\u0627 \u0641\u064a\u0647 \u0627\u0644\u0643\u0641\u0627\u064a\u0629.\u201d","\u201c\ub098\ub294 \ucda9\ubd84\ud788 \uc88b\uc9c0 \uc54a\uc544\uc694.\u201d","\u201c\u6211\u4e0d\u591f\u597d\u3002\u201d","\u201c\u092e\u0948\u0902 \u0915\u093e\u092b\u0940 \u0905\u091a\u094d\u091b\u093e \u0928\u0939\u0940\u0902 \u0939\u0942\u0901\u0964\u201d","\u201cNon satis bonus sum.\u201d","\u201cNon sono abbastanza bravo.\u201d","\u201c\u0645\u0646 \u0628\u0647 \u0627\u0646\u062f\u0627\u0632\u0647 \u06a9\u0627\u0641\u06cc \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a\u0645.\u201d"],t.w)
B.aeW=new A.d(B.c,["\u201cI see others succeeding, and it feels like I\u2019m failing because I\u2019m not where they are.\u201d\n\nWhich emotion is likely here?","\u201cVeo a otros teniendo \xe9xito, y siento que estoy fracasando porque no estoy donde ellos est\xe1n.\u201d\n\n\xbfQu\xe9 emoci\xf3n es la m\xe1s probable aqu\xed?","\u201eIch sehe andere erfolgreich sein, und es f\xfchlt sich an, als ob ich scheitere, weil ich nicht da bin, wo sie sind.\u201c\n\nWelche Emotion ist hier wahrscheinlich?","\u201cJe vois les autres r\xe9ussir, et cela me donne l\u2019impression d\u2019\xe9chouer parce que je ne suis pas l\xe0 o\xf9 ils sont.\u201d\n\nQuelle \xe9motion est la plus probable ici ?","\u201c\u0623\u0631\u0649 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u064a\u0646\u062c\u062d\u0648\u0646\u060c \u0648\u0623\u0634\u0639\u0631 \u0623\u0646\u0646\u064a \u0623\u0641\u0634\u0644 \u0644\u0623\u0646\u0646\u064a \u0644\u0633\u062a \u0641\u064a \u0645\u0643\u0627\u0646\u0647\u0645.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0639\u0627\u0637\u0641\u0629 \u0627\u0644\u0623\u0643\u062b\u0631 \u0627\u062d\u062a\u0645\u0627\u0644\u064b\u0627 \u0647\u0646\u0627\u061f","\u201c\ub098\ub294 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc774 \uc131\uacf5\ud558\ub294 \uac78 \ubcf4\uace0, \ub0b4\uac00 \uadf8\ub4e4\uc774 \uc788\ub294 \uacf3\uc5d0 \uc788\uc9c0 \uc54a\uc544\uc11c \uc2e4\ud328\ud558\ub294 \uac83\ucc98\ub7fc \ub290\uaef4\uc694.\u201d\n\n\uc5ec\uae30\uc11c \uac00\uc7a5 \uac00\ub2a5\uc131 \ub192\uc740 \uac10\uc815\uc740 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u201c\u6211\u770b\u5230\u522b\u4eba\u6210\u529f\uff0c\u800c\u6211\u89c9\u5f97\u81ea\u5df1\u5728\u5931\u8d25\uff0c\u56e0\u4e3a\u6211\u6ca1\u6709\u8fbe\u5230\u4ed6\u4eec\u7684\u6c34\u5e73\u3002\u201d\n\n\u8fd9\u91cc\u6700\u53ef\u80fd\u7684\u60c5\u611f\u662f\u4ec0\u4e48\uff1f","\u201c\u092e\u0948\u0902 \u0926\u0942\u0938\u0930\u094b\u0902 \u0915\u094b \u0938\u092b\u0932 \u0939\u094b\u0924\u0947 \u0926\u0947\u0916\u0924\u093e \u0939\u0942\u0901, \u0914\u0930 \u092e\u0941\u091d\u0947 \u0932\u0917\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0928\u093e\u0915\u093e\u092e \u0939\u094b \u0930\u0939\u093e \u0939\u0942\u0901 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092e\u0948\u0902 \u0935\u0939\u093e\u0901 \u0928\u0939\u0940\u0902 \u0939\u0942\u0901 \u091c\u0939\u093e\u0901 \u0935\u0947 \u0939\u0948\u0902\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0938\u092c\u0938\u0947 \u091c\u094d\u092f\u093e\u0926\u093e \u0938\u0902\u092d\u093e\u0935\u093f\u0924 \u092d\u093e\u0935\u0928\u093e \u0915\u094d\u092f\u093e \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948?","\u201cVide others successos esse, et sentio me deficere quia non sum ubi ipsi sunt.\u201d\n\nQuae affectio hic probabiliter latet?","\u201cVedo gli altri avere successo e mi sembra di fallire perch\xe9 non sono dove sono loro.\u201d\n\nQuale emozione \xe8 la pi\xf9 probabile qui?","\u201c\u0645\u0646 \u0645\u06cc\u200c\u0628\u06cc\u0646\u0645 \u062f\u06cc\u06af\u0631\u0627\u0646 \u0645\u0648\u0641\u0642 \u0647\u0633\u062a\u0646\u062f \u0648 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u0645 \u0645\u0646 \u062f\u0631 \u062d\u0627\u0644 \u0634\u06a9\u0633\u062a \u0647\u0633\u062a\u0645 \u0632\u06cc\u0631\u0627 \u0645\u0646 \u062c\u0627\u06cc\u06cc \u0646\u06cc\u0633\u062a\u0645 \u06a9\u0647 \u0622\u0646\u0647\u0627 \u0647\u0633\u062a\u0646\u062f.\u201d\n\n\u0686\u0647 \u0627\u062d\u0633\u0627\u0633\u06cc \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0627\u062d\u062a\u0645\u0627\u0644 \u062f\u0627\u0631\u062f\u061f"],t.w)
