B.acW=new A.d(B.c,["You sit at your desk, tabs and tasks everywhere. The thought is:\n\u201cThere is too much. I will never catch up.\u201d\n\nWhich tiny next step is most realistic and kind?","Est\xe1s sentado en tu escritorio, con pesta\xf1as y tareas por todas partes. El pensamiento es:\n\u201cEs demasiado. Nunca me pondr\xe9 al d\xeda.\u201d\n\n\xbfCu\xe1l es el siguiente paso m\xe1s realista y amable?","Du sitzt an deinem Schreibtisch, Tabs und Aufgaben \xfcberall. Der Gedanke ist:\n\u201eEs ist zu viel. Ich werde niemals hinterherkommen.\u201c\n\nWelcher kleine n\xe4chste Schritt ist am realistischsten und freundlichsten?","Vous \xeates assis \xe0 votre bureau, avec des onglets et des t\xe2ches partout. La pens\xe9e est :\n\u201cC\u2019est trop. Je ne pourrai jamais rattraper mon retard.\u201d\n\nQuel petit pas suivant est le plus r\xe9aliste et bienveillant ?","\u0623\u0646\u062a \u062a\u062c\u0644\u0633 \u0639\u0644\u0649 \u0645\u0643\u062a\u0628\u0643\u060c \u0645\u0639 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0646\u0648\u0627\u0641\u0630 \u0627\u0644\u0645\u0641\u062a\u0648\u062d\u0629 \u0648\u0627\u0644\u0645\u0647\u0627\u0645 \u0641\u064a \u0643\u0644 \u0645\u0643\u0627\u0646. \u0627\u0644\u0641\u0643\u0631\u0629 \u0647\u064a:\n\u201c\u0647\u0646\u0627\u0643 \u0627\u0644\u0643\u062b\u064a\u0631. \u0644\u0646 \u0623\u0644\u062d\u0642 \u0623\u0628\u062f\u064b\u0627.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u062a\u0627\u0644\u064a\u0629 \u0627\u0644\u0623\u0643\u062b\u0631 \u0648\u0627\u0642\u0639\u064a\u0629 \u0648\u0644\u0637\u0641\u064b\u0627\u061f","\ub2f9\uc2e0\uc740 \ucc45\uc0c1\uc5d0 \uc549\uc544 \uc788\uace0, \ud0ed\uacfc \ud560 \uc77c\uc774 \uc5ec\uae30\uc800\uae30 \uc788\uc2b5\ub2c8\ub2e4. \uc0dd\uac01\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4:\n\u201c\ub108\ubb34 \ub9ce\ub2e4. \ub098\ub294 \uacb0\ucf54 \ub530\ub77c\uc7a1\uc9c0 \ubabb\ud560 \uac83\uc774\ub2e4.\u201d\n\n\uc5b4\ub5a4 \uc791\uc740 \ub2e4\uc74c \ub2e8\uacc4\uac00 \uac00\uc7a5 \ud604\uc2e4\uc801\uc774\uace0 \uce5c\uc808\ud55c\uac00\uc694?","\u4f60\u5750\u5728\u684c\u5b50\u524d\uff0c\u4efb\u52a1\u548c\u6807\u7b7e\u5230\u5904\u90fd\u662f\u3002\u4f60\u7684\u60f3\u6cd5\u662f\uff1a\n\u201c\u592a\u591a\u4e86\u3002\u6211\u6c38\u8fdc\u8ffd\u4e0d\u4e0a\u3002\u201d\n\n\u54ea\u4e2a\u5c0f\u6b65\u9aa4\u662f\u6700\u73b0\u5b9e\u548c\u6700\u6e29\u548c\u7684\uff1f","\u0906\u092a \u0905\u092a\u0928\u0947 \u0921\u0947\u0938\u094d\u0915 \u092a\u0930 \u092c\u0948\u0920\u0947 \u0939\u0948\u0902, \u0939\u0930 \u091c\u0917\u0939 \u091f\u0948\u092c \u0914\u0930 \u0915\u093e\u0930\u094d\u092f \u0939\u0948\u0902\u0964 \u0935\u093f\u091a\u093e\u0930 \u0939\u0948:\n\u201c\u092f\u0939 \u092c\u0939\u0941\u0924 \u091c\u094d\u092f\u093e\u0926\u093e \u0939\u0948\u0964 \u092e\u0948\u0902 \u0915\u092d\u0940 \u092d\u0940 \u092a\u0915\u0921\u093c \u0928\u0939\u0940\u0902 \u092a\u093e\u090a\u0901\u0917\u093e\u0964\u201d\n\n\u0915\u094c\u0928 \u0938\u093e \u091b\u094b\u091f\u093e \u0905\u0917\u0932\u093e \u0915\u0926\u092e \u0938\u092c\u0938\u0947 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0914\u0930 \u0926\u092f\u093e\u0932\u0941 \u0939\u0948?","Sedens ad mensam tuam es, tabellae et negotia pervagantur. Cogitatio est:\n\u201cMultum est. Nunquam sequentur.\u201d\n\nQuae minima sequens actio est realissima et benigna?","Sei seduto alla tua scrivania, con schede e compiti ovunque. Il pensiero \xe8:\n\u201cC\u2019\xe8 troppo. Non riuscir\xf2 mai a recuperare.\u201d\n\nQuale piccolo passo successivo \xe8 il pi\xf9 realistico e gentile?","\u0634\u0645\u0627 \u062f\u0631 \u067e\u0634\u062a \u0645\u06cc\u0632\u06cc \u0646\u0634\u0633\u062a\u0647\u200c\u0627\u06cc\u062f \u06a9\u0647 \u067e\u0631 \u0627\u0632 \u062a\u0628\u200c\u0647\u0627 \u0648 \u06a9\u0627\u0631\u0647\u0627\u06cc \u0645\u062e\u062a\u0644\u0641 \u0627\u0633\u062a. \u0641\u06a9\u0631 \u0634\u0645\u0627 \u0627\u06cc\u0646 \u0627\u0633\u062a:\n\u201c\u062e\u06cc\u0644\u06cc \u0632\u06cc\u0627\u062f \u0627\u0633\u062a. \u0647\u06cc\u0686 \u0648\u0642\u062a \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0628\u0647 \u0622\u0646 \u0628\u0631\u0633\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0642\u062f\u0645 \u06a9\u0648\u0686\u06a9 \u0628\u0639\u062f\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0648\u0627\u0642\u0639\u200c\u0628\u06cc\u0646\u0627\u0646\u0647 \u0648 \u0645\u0647\u0631\u0628\u0627\u0646\u0627\u0646\u0647 \u0627\u0633\u062a\u061f"],t.w)
B.a80=new A.d(B.c,["Do everything tonight, no breaks, until 4 a.m.","Haz todo esta noche, sin descansos, hasta las 4 a.m.","Tu alles heute Nacht, ohne Pausen, bis 4 Uhr morgens.","Fais tout ce soir, sans pause, jusqu\u2019\xe0 4 h du matin.","\u0627\u0641\u0639\u0644 \u0643\u0644 \u0634\u064a\u0621 \u0627\u0644\u0644\u064a\u0644\u0629\u060c \u0628\u062f\u0648\u0646 \u062a\u0648\u0642\u0641\u060c \u062d\u062a\u0649 \u0627\u0644\u0633\u0627\u0639\u0629 4 \u0635\u0628\u0627\u062d\u064b\u0627.","\uc624\ub298 \ubc24 \ubaa8\ub4e0 \uac83\uc744 \ud574\ub77c, \uc26c\uc9c0 \ub9d0\uace0 \uc0c8\ubcbd 4\uc2dc\uae4c\uc9c0.","\u4eca\u665a\u505a\u5b8c\u6240\u6709\u4e8b\u60c5\uff0c\u4e0d\u4f11\u606f\uff0c\u76f4\u5230\u51cc\u66684\u70b9\u3002","\u0906\u091c \u0930\u093e\u0924 \u0938\u092c \u0915\u0941\u091b \u0915\u0930\u094b, \u092c\u093f\u0928\u093e \u092c\u094d\u0930\u0947\u0915 \u0915\u0947, \u0938\u0941\u092c\u0939 4 \u092c\u091c\u0947 \u0924\u0915\u0964","Fac omnia hac nocte, nullis intermissis, usque ad 4 am.","Fai tutto stasera, senza pause, fino alle 4 del mattino.","\u0627\u0645\u0634\u0628 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0647\u060c \u0628\u062f\u0648\u0646 \u0648\u0642\u0641\u0647\u060c \u062a\u0627 \u0633\u0627\u0639\u062a 4 \u0635\u0628\u062d."],t.w)
