B.aci=new A.d(B.c,["Pick one task and work on it for 10\u201315 minutes.","Elige una tarea y trabaja en ella durante 10-15 minutos.","W\xe4hle eine Aufgabe aus und arbeite 10-15 Minuten daran.","Choisis une t\xe2che et travaille dessus pendant 10-15 minutes.","\u0627\u062e\u062a\u0631 \u0645\u0647\u0645\u0629 \u0648\u0627\u062d\u062f\u0629 \u0648\u0627\u0639\u0645\u064e\u0644 \u0639\u0644\u064a\u0647\u0627 \u0644\u0645\u062f\u0629 10-15 \u062f\u0642\u064a\u0642\u0629.","\uc791\uc5c5 \ud558\ub098\ub97c \uc120\ud0dd\ud558\uace0 10~15\ubd84 \ub3d9\uc548 \uc791\uc5c5\ud569\ub2c8\ub2e4.","\u9009\u62e9\u4e00\u4e2a\u4efb\u52a1\u5e76\u82b110-15\u5206\u949f\u5b8c\u6210\u5b83\u3002","\u090f\u0915 \u0915\u093e\u0930\u094d\u092f \u091a\u0941\u0928\u0947\u0902 \u0914\u0930 \u0909\u0938 \u092a\u0930 10-15 \u092e\u093f\u0928\u091f \u0915\u093e\u092e \u0915\u0930\u0947\u0902\u0964","Elige un negotium et opera in eo per 10\u201315 minuta.","Scegli un compito e lavora su di esso per 10-15 minuti.","\u06cc\u06a9 \u06a9\u0627\u0631 \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0647 \u0648 \u0628\u0647 \u0645\u062f\u062a 10-15 \u062f\u0642\u06cc\u0642\u0647 \u0631\u0648\u06cc \u0622\u0646 \u06a9\u0627\u0631 \u06a9\u0646\u06cc\u062f."],t.w)
