B.add=new A.d(B.c,["Close your eyes and pretend nothing exists for a month.","Cierra los ojos y finge que nada existe durante un mes.","Schlie\xdfe die Augen und tu so, als ob nichts f\xfcr einen Monat existiert.","Ferme les yeux et fais comme si rien n\u2019existait pendant un mois.","\u0627\u063a\u0644\u0642 \u0639\u064a\u0646\u064a\u0643 \u0648\u062a\u0638\u0627\u0647\u0631 \u0628\u0639\u062f\u0645 \u0648\u062c\u0648\u062f \u0623\u064a \u0634\u064a\u0621 \u0644\u0645\u062f\u0629 \u0634\u0647\u0631.","\ub208\uc744 \uac10\uace0 \ud55c \ub2ec \ub3d9\uc548 \uc544\ubb34\uac83\ub3c4 \uc874\uc7ac\ud558\uc9c0 \uc54a\ub294 \ucc99 \ud558\uc138\uc694.","\u95ed\u4e0a\u773c\u775b\uff0c\u5047\u88c5\u4e00\u4e2a\u6708\u5185\u4ec0\u4e48\u90fd\u4e0d\u5b58\u5728\u3002","\u0906\u0902\u0916\u0947\u0902 \u092c\u0902\u0926 \u0915\u0930\u094b \u0914\u0930 \u090f\u0915 \u092e\u0939\u0940\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092f\u0939 \u0926\u093f\u0916\u093e\u0935\u093e \u0915\u0930\u094b \u0915\u093f \u0915\u0941\u091b \u092d\u0940 \u0905\u0938\u094d\u0924\u093f\u0924\u094d\u0935 \u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964","Clude oculos tuos et simulabis nihil esse per mensem.","Chiudi gli occhi e fingi che nulla esista per un mese.","\u0686\u0634\u0645\u0627\u0646\u062a \u0631\u0627 \u0628\u0628\u0646\u062f \u0648 \u0648\u0627\u0646\u0645\u0648\u062f \u06a9\u0646 \u06a9\u0647 \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0645\u0627\u0647 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f."],t.w)
