B.a8E=new A.d(B.c,["Micro steps shrink \u201cdo everything\u201d into \u201cdo one small piece\u201d, which is how momentum actually starts.","Los micro pasos reducen \u201chacer todo\u201d a \u201chacer una peque\xf1a parte\u201d, que es c\xf3mo realmente comienza el impulso.","Mikroschritte verkleinern \u201ealles tun\u201c zu \u201eein kleines St\xfcck tun\u201c, was der eigentliche Start von Momentum ist.","Les micro-pas r\xe9duisent \u201ctout faire\u201d en \u201cfaire une petite partie\u201d, ce qui est le d\xe9but r\xe9el de l\u2019\xe9lan.","\u0627\u0644\u062e\u0637\u0648\u0627\u062a \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u062a\u0642\u0644\u0644 \u0645\u0646 \u201c\u0627\u0641\u0639\u0644 \u0643\u0644 \u0634\u064a\u0621\u201d \u0625\u0644\u0649 \u201c\u0627\u0641\u0639\u0644 \u062c\u0632\u0621\u064b\u0627 \u0635\u063a\u064a\u0631\u064b\u0627\u201d\u060c \u0648\u0647\u0630\u0627 \u0647\u0648 \u0643\u064a\u0641\u064a\u0629 \u0628\u062f\u0621 \u0627\u0644\u0632\u062e\u0645.","\ub9c8\uc774\ud06c\ub85c \ub2e8\uacc4\ub294 \u201c\ubaa8\ub4e0 \uac83 \ud558\uc138\uc694\u201d\ub97c \u201c\uc791\uc740 \ubd80\ubd84 \ud558\ub098 \ud558\uae30\u201d\ub85c \ucd95\uc18c\ud569\ub2c8\ub2e4. \uc774\uac83\uc774 \uc2e4\uc81c\ub85c \ucd94\uc9c4\ub825\uc774 \uc2dc\uc791\ub418\ub294 \ubc29\uc2dd\uc785\ub2c8\ub2e4.","\u5fae\u6b65\u9aa4\u5c06\u201c\u505a\u6240\u6709\u4e8b\u60c5\u201d\u7f29\u5c0f\u4e3a\u201c\u505a\u4e00\u4e2a\u5c0f\u90e8\u5206\u201d\uff0c\u8fd9\u5c31\u662f\u52a8\u529b\u771f\u6b63\u5f00\u59cb\u7684\u65b9\u5f0f\u3002","\u0938\u0942\u0915\u094d\u0937\u094d\u092e \u0915\u0926\u092e \u201c\u0938\u092c \u0915\u0941\u091b \u0915\u0930\u0947\u0902\u201d \u0915\u094b \u201c\u090f\u0915 \u091b\u094b\u091f\u093e \u0939\u093f\u0938\u094d\u0938\u093e \u0915\u0930\u0947\u0902\u201d \u092e\u0947\u0902 \u092c\u0926\u0932 \u0926\u0947\u0924\u0947 \u0939\u0948\u0902, \u092f\u0939\u0940 \u0935\u0939 \u0924\u0930\u0940\u0915\u093e \u0939\u0948 \u091c\u093f\u0938\u0938\u0947 \u0917\u0924\u093f \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0936\u0941\u0930\u0942 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964","Gradus minimi \u201comnia fac\u201d in \u201cfac unum parvum partem\u201d contrahunt, quod est modus verus ut impulsus incipiat.","I micro passaggi riducono \u201cfare tutto\u201d in \u201cfare un piccolo pezzo\u201d, che \xe8 come inizia effettivamente la spinta.","\u06af\u0627\u0645\u200c\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u201c\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0647\u201d \u0631\u0627 \u0628\u0647 \u201c\u06cc\u06a9 \u0642\u0637\u0639\u0647 \u06a9\u0648\u0686\u06a9 \u0627\u0646\u062c\u0627\u0645 \u0628\u062f\u0647\u201d \u06a9\u0627\u0647\u0634 \u0645\u06cc\u200c\u062f\u0647\u0646\u062f\u060c \u0627\u06cc\u0646\u06af\u0648\u0646\u0647 \u0627\u0633\u062a \u06a9\u0647 \u062d\u0631\u06a9\u062a \u0648\u0627\u0642\u0639\u0627\u064b \u0634\u0631\u0648\u0639 \u0645\u06cc\u200c\u0634\u0648\u062f."],t.w)
