B.abw=new A.d(B.c,["A message sits in your inbox. You have been avoiding replying for days.\nA small knot appears in your stomach each time you see it.\n\nWhat is a tiny next step?","Un mensaje est\xe1 en tu bandeja de entrada. Has estado evitando responderlo durante d\xedas.\nUn peque\xf1o nudo aparece en tu est\xf3mago cada vez que lo ves.\n\n\xbfCu\xe1l es el siguiente peque\xf1o paso?","Eine Nachricht sitzt in deinem Posteingang. Du hast tagelang vermieden, zu antworten.\nEin kleiner Knoten erscheint in deinem Magen, jedes Mal, wenn du ihn siehst.\n\nWas ist der kleinste n\xe4chste Schritt?","Un message est dans votre bo\xeete de r\xe9ception. Vous avez \xe9vit\xe9 d\u2019y r\xe9pondre pendant des jours.\nUn petit n\u0153ud appara\xeet dans votre estomac chaque fois que vous le voyez.\n\nQuelle est la petite \xe9tape suivante ?","\u0647\u0646\u0627\u0643 \u0631\u0633\u0627\u0644\u0629 \u0641\u064a \u0635\u0646\u062f\u0648\u0642 \u0627\u0644\u0648\u0627\u0631\u062f \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0644\u0642\u062f \u0643\u0646\u062a \u062a\u062a\u062c\u0646\u0628 \u0627\u0644\u0631\u062f \u0639\u0644\u064a\u0647\u0627 \u0644\u0623\u064a\u0627\u0645.\n\u064a\u0638\u0647\u0631 \u0639\u0642\u062f\u0629 \u0635\u063a\u064a\u0631\u0629 \u0641\u064a \u0645\u0639\u062f\u062a\u0643 \u0641\u064a \u0643\u0644 \u0645\u0631\u0629 \u062a\u0631\u0627\u0647\u0627.\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u062a\u0627\u0644\u064a\u0629\u061f","\ubc1b\uc740 \ud3b8\uc9c0\ud568\uc5d0 \uba54\uc2dc\uc9c0\uac00 \uc788\uc2b5\ub2c8\ub2e4. \uba70\uce60 \ub3d9\uc548 \ub2f5\uc7a5\uc744 \ud53c\ud558\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\n\uba54\uc2dc\uc9c0\ub97c \ubcfc \ub54c\ub9c8\ub2e4 \uc791\uc740 \ub9e4\ub4ed\uc774 \ubc30\uc5d0\uc11c \uc0dd\uae41\ub2c8\ub2e4.\n\n\ub2e4\uc74c \uc791\uc740 \ub2e8\uacc4\ub294 \ubb34\uc5c7\uc778\uac00\uc694?","\u4f60\u7684\u6536\u4ef6\u7bb1\u91cc\u6709\u4e00\u6761\u4fe1\u606f\u3002\u4f60\u5df2\u7ecf\u907f\u5f00\u56de\u590d\u5b83\u597d\u51e0\u5929\u4e86\u3002\n\u6bcf\u6b21\u770b\u5230\u5b83\u65f6\uff0c\u4f60\u7684\u80c3\u91cc\u90fd\u4f1a\u51fa\u73b0\u4e00\u4e2a\u5c0f\u7ed3\u3002\n\n\u4e0b\u4e00\u4e2a\u5c0f\u6b65\u9aa4\u662f\u4ec0\u4e48\uff1f","\u090f\u0915 \u0938\u0902\u0926\u0947\u0936 \u0906\u092a\u0915\u0947 \u0907\u0928\u092c\u0949\u0915\u094d\u0938 \u092e\u0947\u0902 \u092a\u0921\u093c\u093e \u0939\u0948\u0964 \u0906\u092a \u0907\u0938\u0947 \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0928\u0947 \u0938\u0947 \u0915\u0908 \u0926\u093f\u0928\u094b\u0902 \u0938\u0947 \u092c\u091a \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\n\u0939\u0930 \u092c\u093e\u0930 \u0907\u0938\u0947 \u0926\u0947\u0916\u0928\u0947 \u092a\u0930 \u0906\u092a\u0915\u0947 \u092a\u0947\u091f \u092e\u0947\u0902 \u090f\u0915 \u091b\u094b\u091f\u093e \u0938\u093e \u0917\u093e\u0902\u0920 \u092e\u0939\u0938\u0942\u0938 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964\n\n\u090f\u0915 \u091b\u094b\u091f\u093e \u0938\u093e \u0905\u0917\u0932\u093e \u0915\u0926\u092e \u0915\u094d\u092f\u093e \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948?","Nuntius in receptaculo tuo sedet. Dies singulos evasisti respondere.\nPusillus nodus apparet in stomacho tuo singulis vicibus cum videris.\n\nQuid est minimum proximum gradum?","Un messaggio \xe8 nella tua casella di posta. Hai evitato di rispondere per giorni.\nUn piccolo nodo appare nel tuo stomaco ogni volta che lo vedi.\n\nQual \xe8 il prossimo piccolo passo?","\u06cc\u06a9 \u067e\u06cc\u0627\u0645 \u062f\u0631 \u0635\u0646\u062f\u0648\u0642 \u0648\u0631\u0648\u062f\u06cc \u0634\u0645\u0627 \u0646\u0634\u0633\u062a\u0647 \u0627\u0633\u062a. \u0686\u0646\u062f \u0631\u0648\u0632 \u0627\u0633\u062a \u06a9\u0647 \u0627\u0632 \u067e\u0627\u0633\u062e \u062f\u0627\u062f\u0646 \u0628\u0647 \u0622\u0646 \u062e\u0648\u062f\u062f\u0627\u0631\u06cc \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc\u062f.\n\u0647\u0631 \u0628\u0627\u0631 \u06a9\u0647 \u0622\u0646 \u0631\u0627 \u0645\u06cc\u200c\u0628\u06cc\u0646\u06cc\u062f\u060c \u06cc\u06a9 \u06af\u0631\u0647 \u06a9\u0648\u0686\u06a9 \u062f\u0631 \u0645\u0639\u062f\u0647\u200c\u062a\u0627\u0646 \u0638\u0627\u0647\u0631 \u0645\u06cc\u200c\u0634\u0648\u062f.\n\n\u0686\u0647 \u0642\u062f\u0645 \u06a9\u0648\u0686\u06a9\u06cc \u0628\u0639\u062f\u06cc \u0627\u0633\u062a\u061f"],t.w)
B.adm=new A.d(B.c,["Write a perfect novel-length reply in one go.","Escribir una respuesta perfecta de longitud de novela de una sola vez.","Schreibe eine perfekte Antwort in Romanl\xe4nge auf einmal.","\xc9crire une r\xe9ponse parfaite de la longueur d\u2019un roman d\u2019un seul coup.","\u0627\u0643\u062a\u0628 \u0631\u062f\u064b\u0627 \u0645\u062b\u0627\u0644\u064a\u064b\u0627 \u0628\u0637\u0648\u0644 \u0631\u0648\u0627\u064a\u0629 \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629.","\ud55c \ubc88\uc5d0 \uc644\ubcbd\ud55c \uc18c\uc124 \uae38\uc774\uc758 \ub2f5\uc7a5\uc744 \uc791\uc131\ud558\uc2ed\uc2dc\uc624.","\u4e00\u6b21\u6027\u5199\u51fa\u4e00\u7bc7\u5b8c\u7f8e\u7684\u5c0f\u8bf4\u957f\u5ea6\u7684\u56de\u590d\u3002","\u090f\u0915 \u092c\u093e\u0930 \u092e\u0947\u0902 \u090f\u0915 \u0906\u0926\u0930\u094d\u0936 \u0909\u092a\u0928\u094d\u092f\u093e\u0938-\u0932\u0902\u092c\u093e\u0908 \u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u0932\u093f\u0916\u0947\u0902\u0964","Scribe perfectam responsionem longitudinis novae in uno cursu.","Scrivi una risposta perfetta di lunghezza romanzo in una sola volta.","\u06cc\u06a9 \u067e\u0627\u0633\u062e \u06a9\u0627\u0645\u0644 \u0628\u0647 \u0637\u0648\u0644 \u0631\u0645\u0627\u0646 \u062f\u0631 \u06cc\u06a9 \u0645\u0631\u062d\u0644\u0647 \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f."],t.w)
