B.ad5=new A.d(B.c,["Open the message and write just the first reply sentence.","Abre el mensaje y escribe solo la primera oraci\xf3n de la respuesta.","\xd6ffne die Nachricht und schreibe nur den ersten Antwortsatz.","Ouvrir le message et \xe9crire seulement la premi\xe8re phrase de la r\xe9ponse.","\u0627\u0641\u062a\u062d \u0627\u0644\u0631\u0633\u0627\u0644\u0629 \u0648\u0627\u0643\u062a\u0628 \u0641\u0642\u0637 \u0627\u0644\u062c\u0645\u0644\u0629 \u0627\u0644\u0623\u0648\u0644\u0649 \u0645\u0646 \u0627\u0644\u0631\u062f.","\uba54\uc2dc\uc9c0\ub97c \uc5f4\uace0 \uccab \ubc88\uc9f8 \ub2f5\ubcc0 \ubb38\uc7a5\ub9cc \uc791\uc131\ud558\uc138\uc694.","\u6253\u5f00\u6d88\u606f\u5e76\u53ea\u5199\u7b2c\u4e00\u53e5\u56de\u590d\u3002","\u0938\u0902\u0926\u0947\u0936 \u0916\u094b\u0932\u0947\u0902 \u0914\u0930 \u0938\u093f\u0930\u094d\u092b \u092a\u0939\u0932\u093e \u0909\u0924\u094d\u0924\u0930 \u0935\u093e\u0915\u094d\u092f \u0932\u093f\u0916\u0947\u0902\u0964","Aperi nuntium et scribe solum primam sententiam responsionis.","Apri il messaggio e scrivi solo la prima frase della risposta.","\u067e\u06cc\u0627\u0645 \u0631\u0627 \u0628\u0627\u0632 \u06a9\u0646\u06cc\u062f \u0648 \u0641\u0642\u0637 \u0627\u0648\u0644\u06cc\u0646 \u062c\u0645\u0644\u0647 \u067e\u0627\u0633\u062e \u0631\u0627 \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f."],t.w)
