B.aao=new A.d(B.c,["Delete the app and never answer anyone again.","Eliminar la aplicaci\xf3n y nunca m\xe1s responder a nadie.","L\xf6sche die App und antworte niemandem jemals wieder.","Supprimer l\u2019application et ne jamais r\xe9pondre \xe0 personne \xe0 nouveau.","\u0627\u062d\u0630\u0641 \u0627\u0644\u062a\u0637\u0628\u064a\u0642 \u0648\u0644\u0627 \u062a\u0631\u062f \u0639\u0644\u0649 \u0623\u062d\u062f \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\uc571\uc744 \uc0ad\uc81c\ud558\uace0 \ub2e4\uc2dc\ub294 \ub204\uad6c\uc5d0\uac8c\ub3c4 \ub2f5\ud558\uc9c0 \ub9c8\uc138\uc694.","\u5220\u9664\u5e94\u7528\u7a0b\u5e8f\uff0c\u6c38\u8fdc\u4e0d\u518d\u56de\u590d\u4efb\u4f55\u4eba\u3002","\u0910\u092a \u0939\u091f\u093e\u090f\u0902 \u0914\u0930 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0915\u093f\u0938\u0940 \u0915\u094b \u091c\u0935\u093e\u092c \u0928 \u0926\u0947\u0902\u0964","Delere applicationem et numquam alicui respondere.","Elimina l\u2019app e non rispondere mai pi\xf9 a nessuno.","\u0627\u067e\u0644\u06cc\u06a9\u06cc\u0634\u0646 \u0631\u0627 \u062d\u0630\u0641 \u06a9\u0646\u06cc\u062f \u0648 \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686\u200c\u0648\u0642\u062a \u0628\u0647 \u06a9\u0633\u06cc \u067e\u0627\u0633\u062e \u0646\u062f\u0647\u06cc\u062f."],t.w)
