B.aae=new A.d(B.c,[u.X,u.J,"Du bemerkst, dass du angespannt und \xfcber dein Handy gebeugt bist.\nDein Verstand sagt: \u201eEs gibt keine Zeit zum Ausruhen; ich muss weitermachen.\u201c\n\nW\xe4hle einen kleinen Schritt, der deinen K\xf6rper respektiert.","Tu remarques que tu es tendu et courb\xe9 sur ton t\xe9l\xe9phone.\nTon esprit dit : \u201cIl n\u2019y a pas de temps pour se reposer ; je dois continuer.\u201d\n\nChoisis une petite \xe9tape qui respecte ton corps.","\u0623\u0646\u062a \u062a\u0644\u0627\u062d\u0638 \u0623\u0646\u0643 \u0645\u062a\u0648\u062a\u0631 \u0648\u0645\u0646\u062d\u0646\u064a \u0639\u0644\u0649 \u0647\u0627\u062a\u0641\u0643.\n\u0639\u0642\u0644\u0643 \u064a\u0642\u0648\u0644: \u201c\u0644\u0627 \u064a\u0648\u062c\u062f \u0648\u0642\u062a \u0644\u0644\u0631\u0627\u062d\u0629\u061b \u064a\u062c\u0628 \u0623\u0646 \u0623\u0633\u062a\u0645\u0631.\u201d\n\n\u0627\u062e\u062a\u0631 \u062e\u0637\u0648\u0629 \u0635\u063a\u064a\u0631\u0629 \u062a\u062d\u062a\u0631\u0645 \u062c\u0633\u062f\u0643.","\ub2f9\uc2e0\uc740 \uae34\uc7a5\ud558\uace0 \ud734\ub300\ud3f0\uc5d0 \ubab8\uc744 \uad6c\ubd80\ub9ac\uace0 \uc788\ub2e4\ub294 \uac83\uc744 \uc54c\uac8c \ub429\ub2c8\ub2e4.\n\ub2f9\uc2e0\uc758 \ub1cc\ub294 \uc774\ub807\uac8c \ub9d0\ud569\ub2c8\ub2e4: \u201c\uc274 \uc2dc\uac04\uc774 \uc5c6\ub2e4. \uacc4\uc18d \ud574\uc57c \ud55c\ub2e4.\u201d\n\n\ub2f9\uc2e0\uc758 \ubab8\uc744 \uc874\uc911\ud558\ub294 \uc791\uc740 \ub2e8\uacc4\ub97c \uc120\ud0dd\ud558\uc138\uc694.","\u4f60\u6ce8\u610f\u5230\u81ea\u5df1\u7d27\u5f20\u5e76\u5f2f\u8170\u4f4e\u5934\u770b\u624b\u673a\u3002\n\u4f60\u7684\u5927\u8111\u544a\u8bc9\u4f60\uff1a\u201c\u6ca1\u6709\u65f6\u95f4\u4f11\u606f\uff1b\u6211\u5fc5\u987b\u7ee7\u7eed\u524d\u8fdb\u3002\u201d\n\n\u9009\u62e9\u4e00\u4e2a\u5c0a\u91cd\u4f60\u8eab\u4f53\u7684\u5c0f\u6b65\u9aa4\u3002","\u0906\u092a \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0906\u092a \u0924\u0928\u093e\u0935\u0917\u094d\u0930\u0938\u094d\u0924 \u0939\u0948\u0902 \u0914\u0930 \u0905\u092a\u0928\u0947 \u092b\u094b\u0928 \u0915\u0947 \u090a\u092a\u0930 \u091d\u0941\u0915\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964\n\u0906\u092a\u0915\u093e \u092e\u0928 \u0915\u0939\u0924\u093e \u0939\u0948: \u201c\u0906\u0930\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u093e \u0938\u092e\u092f \u0928\u0939\u0940\u0902 \u0939\u0948; \u092e\u0941\u091d\u0947 \u091a\u0932\u0924\u0947 \u0930\u0939\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d\n\n\u090f\u0915 \u091b\u094b\u091f\u093e \u0915\u0926\u092e \u091a\u0941\u0928\u0947\u0902 \u091c\u094b \u0906\u092a\u0915\u0947 \u0936\u0930\u0940\u0930 \u0915\u093e \u0938\u092e\u094d\u092e\u093e\u0928 \u0915\u0930\u0924\u093e \u0939\u094b\u0964",'Animadvertis te esse tensum et incurvatum super telephonio tuo.\nMens tua dicit: "Nullus est tempus quiescendi; necesse est pergere." \n\nElige gradum minorem qui corpus tuum reveretur.',"Noti che sei teso e curvato sul tuo telefono.\nLa tua mente dice: \u201cNon c\u2019\xe8 tempo per riposare; devo continuare.\u201d\n\nScegli un piccolo passo che rispetti il tuo corpo.","\u0634\u0645\u0627 \u0645\u062a\u0648\u062c\u0647 \u0645\u06cc\u200c\u0634\u0648\u06cc\u062f \u06a9\u0647 \u062f\u0686\u0627\u0631 \u062a\u0646\u0634 \u0634\u062f\u0647\u200c\u0627\u06cc\u062f \u0648 \u0631\u0648\u06cc \u062a\u0644\u0641\u0646 \u0647\u0645\u0631\u0627\u0647 \u062e\u0648\u062f \u062e\u0645 \u0634\u062f\u0647\u200c\u0627\u06cc\u062f.\n\u0630\u0647\u0646 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f: \u201c\u0632\u0645\u0627\u0646\u06cc \u0628\u0631\u0627\u06cc \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f\u061b \u0628\u0627\u06cc\u062f \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647\u0645.\u201d\n\n\u06cc\u06a9 \u0642\u062f\u0645 \u06a9\u0648\u0686\u06a9 \u06a9\u0647 \u0628\u0647 \u0628\u062f\u0646 \u0634\u0645\u0627 \u0627\u062d\u062a\u0631\u0627\u0645 \u0645\u06cc\u200c\u06af\u0630\u0627\u0631\u062f \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f."],t.w)
