B.a8l=new A.d(B.c,[u.P,"Deja el tel\xe9fono y toma 3 respiraciones lentas.","Leg das Handy weg und atme 3 langsame Atemz\xfcge.",u.K,"\u0636\u0639 \u0627\u0644\u0647\u0627\u062a\u0641 \u0648\u0627\u062a\u062e\u0630 3 \u0623\u0646\u0641\u0627\u0633 \u0628\u0637\u064a\u0626\u0629.","\ud734\ub300\ud3f0\uc744 \ub0b4\ub824\ub193\uace0 3\ubc88 \ucc9c\ucc9c\ud788 \uc228\uc744 \uc26c\uc138\uc694.","\u653e\u4e0b\u624b\u673a\uff0c\u6162\u6162\u6df1\u547c\u5438\u4e09\u6b21\u3002","\u092b\u094b\u0928 \u0915\u094b \u0928\u0940\u091a\u0947 \u0930\u0916\u0947\u0902 \u0914\u0930 3 \u0917\u0939\u0930\u0940 \u0938\u093e\u0902\u0938 \u0932\u0947\u0902\u0964","Deponere telephonium et 3 respirationes lentas accipe.",u.V,"\u062a\u0644\u0641\u0646 \u0631\u0627 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u0648 \u0633\u0647 \u0646\u0641\u0633 \u0639\u0645\u06cc\u0642 \u0628\u06a9\u0634\u06cc\u062f."],t.w)
