B.aaz=new A.d(B.c,["You want to draw, write, or make music, but your mind says:\n\u201cIf it is not perfect, there is no point.\u201d\n\nWhat micro step opens a door?","Quieres dibujar, escribir o hacer m\xfasica, pero tu mente dice:\n\u201cSi no es perfecto, no tiene sentido.\u201d\n\n\xbfQu\xe9 peque\xf1o paso abre la puerta?","Du willst zeichnen, schreiben oder Musik machen, aber dein Verstand sagt:\n\u201eWenn es nicht perfekt ist, hat es keinen Sinn.\u201c\n\nWelcher kleine Schritt \xf6ffnet eine T\xfcr?","Tu veux dessiner, \xe9crire ou faire de la musique, mais ton esprit dit :\n\u201cSi ce n\u2019est pas parfait, \xe7a ne vaut pas la peine.\u201d\n\nQuel petit pas ouvre une porte ?","\u0623\u0646\u062a \u062a\u0631\u064a\u062f \u0627\u0644\u0631\u0633\u0645 \u0623\u0648 \u0627\u0644\u0643\u062a\u0627\u0628\u0629 \u0623\u0648 \u0635\u0646\u0639 \u0627\u0644\u0645\u0648\u0633\u064a\u0642\u0649\u060c \u0648\u0644\u0643\u0646 \u0639\u0642\u0644\u0643 \u064a\u0642\u0648\u0644:\n\u201c\u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0645\u062b\u0627\u0644\u064a\u064b\u0627\u060c \u0641\u0644\u0627 \u0641\u0627\u0626\u062f\u0629.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u062a\u064a \u062a\u0641\u062a\u062d \u0627\u0644\u0628\u0627\u0628\u061f","\uadf8\ub9bc\uc744 \uadf8\ub9ac\uac70\ub098 \uae00\uc744 \uc4f0\uac70\ub098 \uc74c\uc545\uc744 \ub9cc\ub4e4\uace0 \uc2f6\uc9c0\ub9cc, \ub2f9\uc2e0\uc758 \ub1cc\ub294 \uc774\ub807\uac8c \ub9d0\ud569\ub2c8\ub2e4:\n\u201c\uc644\ubcbd\ud558\uc9c0 \uc54a\uc73c\uba74 \uc758\ubbf8\uac00 \uc5c6\ub2e4.\u201d\n\n\uc5b4\ub5a4 \uc791\uc740 \ub2e8\uacc4\uac00 \ubb38\uc744 \uc5f4\uae4c\uc694?","\u4f60\u60f3\u753b\u753b\u3001\u5199\u4f5c\u6216\u505a\u97f3\u4e50\uff0c\u4f46\u4f60\u7684\u5927\u8111\u8bf4\uff1a\n\u201c\u5982\u679c\u4e0d\u5b8c\u7f8e\uff0c\u5c31\u6ca1\u6709\u610f\u4e49\u3002\u201d\n\n\u4ec0\u4e48\u5fae\u5c0f\u7684\u6b65\u9aa4\u80fd\u6253\u5f00\u4e00\u6247\u95e8\uff1f","\u0906\u092a \u091a\u093f\u0924\u094d\u0930 \u092c\u0928\u093e\u0928\u093e, \u0932\u093f\u0916\u0928\u093e \u092f\u093e \u0938\u0902\u0917\u0940\u0924 \u092c\u0928\u093e\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a\u0915\u093e \u092e\u0928 \u0915\u0939\u0924\u093e \u0939\u0948:\n\u201c\u0905\u0917\u0930 \u092f\u0939 \u092a\u0930\u092b\u0947\u0915\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u0907\u0938\u0915\u093e \u0915\u094b\u0908 \u092e\u0924\u0932\u092c \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\u201d\n\n\u0915\u094b\u0908 \u091b\u094b\u091f\u093e \u0915\u0926\u092e \u091c\u094b \u090f\u0915 \u0926\u0930\u0935\u093e\u091c\u093e \u0916\u094b\u0932\u0924\u093e \u0939\u0948?","Vis pingere, scribere, aut musicam facere, sed animus tuus dicit:\n\u201cSi non est perfectum, nulla ratio est.\u201d\n\nQuis gradus parvus ostium aperit?","Vuoi disegnare, scrivere o fare musica, ma la tua mente dice:\n\u201cSe non \xe8 perfetto, non ha senso.\u201d\n\nQuale piccolo passo apre una porta?","\u0634\u0645\u0627 \u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u06cc\u062f \u0646\u0642\u0627\u0634\u06cc \u0628\u06a9\u0634\u06cc\u062f\u060c \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f \u06cc\u0627 \u0645\u0648\u0633\u06cc\u0642\u06cc \u0628\u0633\u0627\u0632\u06cc\u062f\u060c \u0627\u0645\u0627 \u0630\u0647\u0646 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f:\n\u201c\u0627\u06af\u0631 \u0627\u06cc\u0646 \u06a9\u0627\u0645\u0644 \u0646\u06cc\u0633\u062a\u060c \u0647\u06cc\u0686 \u0645\u0639\u0646\u06cc \u0646\u062f\u0627\u0631\u062f.\u201d\n\n\u0686\u0647 \u0642\u062f\u0645 \u06a9\u0648\u0686\u06a9\u06cc \u062f\u0631 \u0631\u0627 \u0628\u0627\u0632 \u0645\u06cc\u200c\u06a9\u0646\u062f\u061f"],t.w)
B.a7D=new A.d(B.c,["Wait for the perfect idea and do nothing until then.","Espera la idea perfecta y no hagas nada hasta entonces.","Warte auf die perfekte Idee und tue bis dahin nichts.","Attends l\u2019id\xe9e parfaite et ne fais rien jusqu\u2019\xe0 ce moment-l\xe0.","\u0627\u0646\u062a\u0638\u0631 \u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u0645\u062b\u0627\u0644\u064a\u0629 \u0648\u0644\u0627 \u062a\u0641\u0639\u0644 \u0634\u064a\u0626\u064b\u0627 \u062d\u062a\u0649 \u0630\u0644\u0643 \u0627\u0644\u062d\u064a\u0646.","\uc644\ubcbd\ud55c \uc544\uc774\ub514\uc5b4\ub97c \uae30\ub2e4\ub9ac\uace0 \uadf8\ub54c\uae4c\uc9c0 \uc544\ubb34\uac83\ub3c4 \ud558\uc9c0 \ub9c8\uc138\uc694.","\u7b49\u5f85\u5b8c\u7f8e\u7684\u60f3\u6cd5\uff0c\u76f4\u5230\u90a3\u65f6\u4ec0\u4e48\u90fd\u4e0d\u505a\u3002","\u092a\u0930\u092b\u0947\u0915\u094d\u091f \u0906\u0907\u0921\u093f\u092f\u093e \u0915\u093e \u0907\u0902\u0924\u091c\u093e\u0930 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0924\u092c \u0924\u0915 \u0915\u0941\u091b \u0928 \u0915\u0930\u0947\u0902\u0964","Exspecta perfectum consilium et nihil facito usque ad illud.","Aspetta l\u2019idea perfetta e non fare nulla fino ad allora.","\u0645\u0646\u062a\u0638\u0631 \u0627\u06cc\u062f\u0647 \u06a9\u0627\u0645\u0644 \u0628\u0645\u0627\u0646\u06cc\u062f \u0648 \u062a\u0627 \u0622\u0646 \u0632\u0645\u0627\u0646 \u0647\u06cc\u0686 \u06a9\u0627\u0631\u06cc \u0627\u0646\u062c\u0627\u0645 \u0646\u062f\u0647\u06cc\u062f."],t.w)
