B.ade=new A.d(B.c,["Set a timer for 5 minutes and make something deliberately rough.","Pon un temporizador por 5 minutos y haz algo deliberadamente tosco.","Stelle einen Timer auf 5 Minuten und mache etwas absichtlich grob.","R\xe9gle un minuteur pour 5 minutes et fais quelque chose d\xe9lib\xe9r\xe9ment brut.","\u0627\u0636\u0628\u0637 \u0645\u0624\u0642\u062a\u064b\u0627 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u0648\u0627\u0635\u0646\u0639 \u0634\u064a\u0626\u064b\u0627 \u062e\u0634\u0646\u064b\u0627 \u0639\u0646 \u0639\u0645\u062f.","\ud0c0\uc774\uba38\ub97c 5\ubd84\uc73c\ub85c \uc124\uc815\ud558\uace0 \uc77c\ubd80\ub7ec \uac70\uce5c \uac83\uc744 \ub9cc\ub4dc\uc138\uc694.","\u5c06\u8ba1\u65f6\u5668\u8bbe\u7f6e\u4e3a5\u5206\u949f\uff0c\u6545\u610f\u505a\u4e00\u4e9b\u7c97\u7cd9\u7684\u4e1c\u897f\u3002","5 \u092e\u093f\u0928\u091f \u0915\u0947 \u0932\u093f\u090f \u091f\u093e\u0907\u092e\u0930 \u0938\u0947\u091f \u0915\u0930\u0947\u0902 \u0914\u0930 \u091c\u093e\u0928\u092c\u0942\u091d\u0915\u0930 \u0915\u0941\u091b \u0916\u0941\u0930\u0926\u0930\u093e \u092c\u0928\u093e\u090f\u0902\u0964","Tempus 5 minuta statuere et aliquid deliberate rudem fac.","Imposta un timer per 5 minuti e fai qualcosa deliberatamente grezzo.","\u06cc\u06a9 \u062a\u0627\u06cc\u0645\u0631 \u0628\u0631\u0627\u06cc 5 \u062f\u0642\u06cc\u0642\u0647 \u062a\u0646\u0638\u06cc\u0645 \u06a9\u0646\u06cc\u062f \u0648 \u0639\u0645\u062f\u064b\u0627 \u0686\u06cc\u0632\u06cc \u062e\u0634\u0646 \u0628\u0633\u0627\u0632\u06cc\u062f."],t.w)
