B.aeV=new A.d(B.c,["Decide creativity is for other people only.","Decide que la creatividad es solo para otras personas.","Entscheide, dass Kreativit\xe4t nur f\xfcr andere Menschen ist.","D\xe9cide que la cr\xe9ativit\xe9 est uniquement pour les autres.","\u0642\u0631\u0651\u0631 \u0623\u0646 \u0627\u0644\u0625\u0628\u062f\u0627\u0639 \u0645\u062e\u0635\u0635 \u0641\u0642\u0637 \u0644\u0644\u0622\u062e\u0631\u064a\u0646.","\ucc3d\uc758\uc131\uc740 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc744 \uc704\ud55c \uac83\uc774\ub77c\uace0 \uacb0\uc815\ud558\uc138\uc694.","\u51b3\u5b9a\u521b\u610f\u53ea\u5c5e\u4e8e\u522b\u4eba\u3002","\u0928\u093f\u0930\u094d\u0923\u092f \u0932\u0947\u0902 \u0915\u093f \u0930\u091a\u0928\u093e\u0924\u094d\u092e\u0915\u0924\u093e \u0915\u0947\u0935\u0932 \u0926\u0942\u0938\u0930\u094b\u0902 \u0915\u0947 \u0932\u093f\u090f \u0939\u0948\u0964","Decide creativitatem esse solum pro aliis.","Decidi che la creativit\xe0 \xe8 solo per gli altri.","\u062a\u0635\u0645\u06cc\u0645 \u0628\u06af\u06cc\u0631\u06cc\u062f \u06a9\u0647 \u062e\u0644\u0627\u0642\u06cc\u062a \u0641\u0642\u0637 \u0628\u0631\u0627\u06cc \u062f\u06cc\u06af\u0631\u0627\u0646 \u0627\u0633\u062a."],t.w)
