B.adC=new A.d(B.c,["Allowing \u201crough and small\u201d experiments weakens perfectionism and lets you actually touch the tools.","Permitir experimentos \u201ctoscos y peque\xf1os\u201d debilita el perfeccionismo y te permite tocar realmente las herramientas.","Das Zulassen von \u201egroben und kleinen\u201c Experimenten schw\xe4cht Perfektionismus und l\xe4sst dich tats\xe4chlich die Werkzeuge ber\xfchren.","Permettre des exp\xe9riences \u201cgrossi\xe8res et petites\u201d affaiblit le perfectionnisme et te permet r\xe9ellement de toucher les outils.","\u0627\u0644\u0633\u0645\u0627\u062d \u0628\u0627\u0644\u062a\u062c\u0627\u0631\u0628 \u201c\u0627\u0644\u062e\u0634\u0646\u0629 \u0648\u0627\u0644\u0635\u063a\u064a\u0631\u0629\u201d \u064a\u0636\u0639\u0641 \u0627\u0644\u0645\u062b\u0627\u0644\u064a\u0629 \u0648\u064a\u062a\u064a\u062d \u0644\u0643 \u0628\u0627\u0644\u0641\u0639\u0644 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0623\u062f\u0648\u0627\u062a.","\u201c\uac70\uce60\uace0 \uc791\uc740\u201d \uc2e4\ud5d8\uc744 \ud5c8\uc6a9\ud558\uba74 \uc644\ubcbd\uc8fc\uc758\uac00 \uc57d\ud574\uc9c0\uace0 \uc2e4\uc81c\ub85c \ub3c4\uad6c\ub97c \ub9cc\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u5141\u8bb8\u201c\u7c97\u7cd9\u548c\u5c0f\u201d\u7684\u5b9e\u9a8c\u524a\u5f31\u5b8c\u7f8e\u4e3b\u4e49\uff0c\u8ba9\u4f60\u771f\u6b63\u63a5\u89e6\u5230\u5de5\u5177\u3002","\u201c\u0916\u0941\u0930\u0926\u0930\u0947 \u0914\u0930 \u091b\u094b\u091f\u0947\u201d \u092a\u094d\u0930\u092f\u094b\u0917\u094b\u0902 \u0915\u094b \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0928\u093e \u092a\u0930\u092b\u0947\u0915\u094d\u0936\u0928\u093f\u091c\u094d\u092e \u0915\u094b \u0915\u092e\u091c\u094b\u0930 \u0915\u0930\u0924\u093e \u0939\u0948 \u0914\u0930 \u0906\u092a\u0915\u094b \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0909\u092a\u0915\u0930\u0923\u094b\u0902 \u0915\u094b \u091b\u0942\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0924\u093e \u0939\u0948\u0964",'Permittens "rude et parva" experimenta perfectionismum debilitant et tibi vere tangere instrumenta sinunt.',"Permettere esperimenti \u201cgrezzi e piccoli\u201d indebolisce il perfezionismo e ti consente di toccare effettivamente gli strumenti.",'\u0627\u062c\u0627\u0632\u0647 \u062f\u0627\u062f\u0646 \u0628\u0647 \u062a\u062c\u0631\u0628\u06cc\u0627\u062a "\u062e\u0634\u0646 \u0648 \u06a9\u0648\u0686\u06a9" \u0645\u0648\u062c\u0628 \u062a\u0636\u0639\u06cc\u0641 \u06a9\u0645\u0627\u0644\u200c\u06af\u0631\u0627\u06cc\u06cc \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u0628\u0647 \u0634\u0645\u0627 \u0627\u06cc\u0646 \u0627\u0645\u06a9\u0627\u0646 \u0631\u0627 \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u0648\u0627\u0642\u0639\u0627\u064b \u0627\u0628\u0632\u0627\u0631\u0647\u0627 \u0631\u0627 \u0644\u0645\u0633 \u06a9\u0646\u06cc\u062f.'],t.w)
