B.adZ=new A.d(B.c,["Your inbox is flooded with messages. The thought is: \u201cI\u2019ll never get through all of these.\u201d\n\nWhat small step can you take to tackle this overwhelm?","Tu bandeja de entrada est\xe1 llena de mensajes. El pensamiento es: \u201cNunca pasar\xe9 por todos estos.\u201d\n\n\xbfQu\xe9 peque\xf1o paso puedes dar para enfrentar esta sobrecarga?","Dein Posteingang ist mit Nachrichten \xfcberflutet. Der Gedanke ist: \u201eIch werde nie alle diese Nachrichten durchgehen.\u201c\n\nWelchen kleinen Schritt kannst du unternehmen, um diese \xdcberforderung zu bew\xe4ltigen?","Votre bo\xeete de r\xe9ception est inond\xe9e de messages. La pens\xe9e est : \u201cJe ne pourrai jamais passer tous ceux-ci.\u201d\n\nQuel petit pas pouvez-vous faire pour g\xe9rer cette surcharge ?","\u0635\u0646\u062f\u0648\u0642 \u0627\u0644\u0648\u0627\u0631\u062f \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u0644\u064a\u0621 \u0628\u0627\u0644\u0631\u0633\u0627\u0626\u0644. \u0627\u0644\u0641\u0643\u0631\u0629 \u0647\u064a: \u201c\u0644\u0646 \u0623\u062a\u0645\u0643\u0646 \u0645\u0646 \u0627\u0644\u0645\u0631\u0648\u0631 \u0628\u0643\u0644 \u0647\u0630\u0647.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u062a\u064a \u064a\u0645\u0643\u0646\u0643 \u0627\u062a\u062e\u0627\u0630\u0647\u0627 \u0644\u0644\u062a\u0639\u0627\u0645\u0644 \u0645\u0639 \u0647\u0630\u0627 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0625\u0631\u0647\u0627\u0642\u061f","\uc774\uba54\uc77c\ud568\uc774 \uba54\uc2dc\uc9c0\ub85c \uac00\ub4dd \ucc3c\uc2b5\ub2c8\ub2e4. \uc0dd\uac01\uc740 \u201c\uc774 \ubaa8\ub4e0 \uac78 \ub05d\ub0bc \uc218 \uc5c6\uc744 \uac70\uc57c.\u201d\n\n\uc774 \uc555\ubc15\uc744 \ucc98\ub9ac\ud558\uae30 \uc704\ud55c \uc791\uc740 \ub2e8\uacc4\ub294 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u4f60\u7684\u6536\u4ef6\u7bb1\u88ab\u6d88\u606f\u6df9\u6ca1\u4e86\u3002\u8fd9\u4e2a\u60f3\u6cd5\u662f\uff1a\u201c\u6211\u6c38\u8fdc\u4e5f\u5904\u7406\u4e0d\u5b8c\u8fd9\u4e9b\u3002\u201d\n\n\u4f60\u80fd\u91c7\u53d6\u4ec0\u4e48\u5c0f\u6b65\u9aa4\u6765\u5e94\u5bf9\u8fd9\u79cd\u538b\u5012\u611f\uff1f",'\u0906\u092a\u0915\u093e \u0907\u0928\u092c\u0949\u0915\u094d\u0938 \u0938\u0902\u0926\u0947\u0936\u094b\u0902 \u0938\u0947 \u092d\u0930\u093e \u0939\u0941\u0906 \u0939\u0948\u0964 \u0935\u093f\u091a\u093e\u0930 \u0939\u0948: "\u092e\u0948\u0902 \u0907\u0928 \u0938\u092d\u0940 \u0915\u094b \u0915\u092d\u0940 \u0928\u0939\u0940\u0902 \u0928\u093f\u092a\u091f\u093e \u092a\u093e\u090a\u0901\u0917\u093e\u0964"\n\n\u0907\u0938 \u0926\u092c\u093e\u0935 \u0915\u094b \u0938\u0902\u092d\u093e\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0906\u092a \u0915\u094c\u0928 \u0938\u093e \u091b\u094b\u091f\u093e \u0915\u0926\u092e \u0909\u0920\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902?',"Inbox tuus inundatus est epistolis. Cogitatio est: \u201cNumquam perveniam ad omnia haec.\u201d\n\nQuid parvum gradum capere potes ad hoc onus tollendum?","La tua casella di posta \xe8 inondata di messaggi. Il pensiero \xe8: \u201cNon finir\xf2 mai tutto questo.\u201d\n\nQuale piccolo passo puoi fare per affrontare questo sovraccarico?","\u0635\u0646\u062f\u0648\u0642 \u0648\u0631\u0648\u062f\u06cc \u0634\u0645\u0627 \u0628\u0627 \u067e\u06cc\u0627\u0645\u200c\u0647\u0627 \u067e\u0631 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0641\u06a9\u0631 \u0627\u06cc\u0646 \u0627\u0633\u062a: \u201c\u0645\u0646 \u0647\u0631\u06af\u0632 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u0632 \u067e\u0633 \u0647\u0645\u0647 \u0627\u06cc\u0646\u200c\u0647\u0627 \u0628\u0631\u0628\u06cc\u0627\u06cc\u0645.\u201d\n\n\u0686\u0647 \u0642\u062f\u0645 \u06a9\u0648\u0686\u06a9 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0628\u0631\u062f\u0627\u0631\u06cc\u062f \u062a\u0627 \u0628\u0627 \u0627\u06cc\u0646 \u0641\u0634\u0627\u0631 \u0631\u0648\u0628\u0631\u0648 \u0634\u0648\u06cc\u062f\u061f"],t.w)
B.a9n=new A.d(B.c,["Ignore the inbox and hope it gets better by itself.","Ignorar la bandeja de entrada y esperar que mejore por s\xed sola.","Posteingang ignorieren und hoffen, dass es von alleine besser wird.","Ignorer la bo\xeete de r\xe9ception et esp\xe9rer qu\u2019elle s\u2019am\xe9liore toute seule.","\u062a\u062c\u0627\u0647\u0644 \u0635\u0646\u062f\u0648\u0642 \u0627\u0644\u0648\u0627\u0631\u062f \u0648\u0627\u0646\u062a\u0638\u0631 \u0623\u0646 \u064a\u062a\u062d\u0633\u0646 \u0645\u0646 \u062a\u0644\u0642\u0627\u0621 \u0646\u0641\u0633\u0647.","\ubc1b\uc740 \ud3b8\uc9c0\ud568\uc744 \ubb34\uc2dc\ud558\uace0 \uc2a4\uc2a4\ub85c \uc88b\uc544\uc9c0\uae30\ub97c \ubc14\ub780\ub2e4.","\u5ffd\u89c6\u6536\u4ef6\u7bb1\uff0c\u6307\u671b\u5b83\u81ea\u5df1\u53d8\u597d\u3002","\u0908\u092e\u0947\u0932 \u0907\u0928\u092c\u0949\u0915\u094d\u0938 \u0915\u094b \u0905\u0928\u0926\u0947\u0916\u093e \u0915\u0930\u0947\u0902 \u0914\u0930 \u0906\u0936\u093e \u0915\u0930\u0947\u0902 \u0915\u093f \u092f\u0939 \u0916\u0941\u0926 \u0939\u0940 \u092c\u0947\u0939\u0924\u0930 \u0939\u094b \u091c\u093e\u090f\u0917\u093e\u0964","Inbox neglectus sit, sperare id melius se ipse fieri.","Ignora la casella di posta e spera che migliori da sola.","\u0635\u0646\u062f\u0648\u0642 \u0648\u0631\u0648\u062f\u06cc \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0628\u06af\u06cc\u0631\u06cc\u062f \u0648 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631 \u0628\u0627\u0634\u06cc\u062f \u06a9\u0647 \u062e\u0648\u062f\u0634 \u0628\u0647\u062a\u0631 \u0634\u0648\u062f."],t.w)
