B.a8z=new A.d(B.c,["Delete all emails and forget about them.","Eliminar todos los correos electr\xf3nicos y olvidarlos.","Alle E-Mails l\xf6schen und vergessen.","Supprimer tous les e-mails et les oublier.","\u062d\u0630\u0641 \u062c\u0645\u064a\u0639 \u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0648\u0646\u0633\u064a\u0627\u0646\u0647\u0627.","\ubaa8\ub4e0 \uc774\uba54\uc77c\uc744 \uc0ad\uc81c\ud558\uace0 \uc78a\uc5b4\ubc84\ub9ac\uc138\uc694.","\u5220\u9664\u6240\u6709\u7535\u5b50\u90ae\u4ef6\u5e76\u5fd8\u8bb0\u5b83\u4eec\u3002","\u0938\u092d\u0940 \u0908\u092e\u0947\u0932 \u0939\u091f\u093e \u0926\u0947\u0902 \u0914\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u092d\u0942\u0932 \u091c\u093e\u090f\u0902\u0964","Delere omnes epistolas et oblivisci.","Elimina tutte le e-mail e dimenticale.","\u062a\u0645\u0627\u0645 \u0627\u06cc\u0645\u06cc\u0644\u200c\u0647\u0627 \u0631\u0627 \u062d\u0630\u0641 \u06a9\u0646\u06cc\u062f \u0648 \u0641\u0631\u0627\u0645\u0648\u0634 \u06a9\u0646\u06cc\u062f."],t.w)
