B.abn=new A.d(B.c,["Picking just one task to start with is a manageable step that allows you to make progress without overwhelming yourself.","Elegir una sola tarea para empezar es un paso manejable que te permite avanzar sin sobrecargarte.","Nur eine Aufgabe auszuw\xe4hlen, mit der man anfangen kann, ist ein \xfcberschaubarer Schritt, der es erm\xf6glicht, Fortschritte zu machen, ohne sich selbst zu \xfcberfordern.","Choisir une seule t\xe2che pour commencer est un pas g\xe9rable qui te permet de progresser sans te surcharger.","\u0627\u062e\u062a\u064a\u0627\u0631 \u0645\u0647\u0645\u0629 \u0648\u0627\u062d\u062f\u0629 \u0641\u0642\u0637 \u0644\u0644\u0628\u062f\u0621 \u0647\u0648 \u062e\u0637\u0648\u0629 \u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u062a\u062d\u0643\u0645 \u062a\u062a\u064a\u062d \u0644\u0643 \u0627\u0644\u062a\u0642\u062f\u0645 \u062f\u0648\u0646 \u0625\u0631\u0647\u0627\u0642 \u0646\u0641\u0633\u0643.","\ud558\ub098\uc758 \uc791\uc5c5\uc744 \uc120\ud0dd\ud558\ub294 \uac83\uc740 \uc9c4\ud589\uc744 \ud560 \uc218 \uc788\ub3c4\ub85d \ub3d5\ub294 \uad00\ub9ac \uac00\ub2a5\ud55c \ub2e8\uacc4\uc785\ub2c8\ub2e4.","\u53ea\u9009\u62e9\u4e00\u9879\u4efb\u52a1\u5f00\u59cb\u662f\u4e00\u4e2a\u53ef\u7ba1\u7406\u7684\u6b65\u9aa4\uff0c\u5b83\u53ef\u4ee5\u8ba9\u4f60\u5728\u4e0d\u611f\u5230\u8fc7\u5ea6\u538b\u529b\u7684\u60c5\u51b5\u4e0b\u53d6\u5f97\u8fdb\u5c55\u3002","\u0915\u0947\u0935\u0932 \u090f\u0915 \u0915\u093e\u0930\u094d\u092f \u091a\u0941\u0928\u0928\u093e \u090f\u0915 \u092a\u094d\u0930\u092c\u0902\u0927\u0928\u0940\u092f \u0915\u0926\u092e \u0939\u0948 \u091c\u094b \u0906\u092a\u0915\u094b \u0916\u0941\u0926 \u0915\u094b \u0905\u0927\u093f\u0915 \u092c\u094b\u091d\u093f\u0932 \u0915\u093f\u090f \u092c\u093f\u0928\u093e \u092a\u094d\u0930\u0917\u0924\u093f \u0915\u0930\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0924\u093e \u0939\u0948\u0964","Unum negotium eligere ad incipiendum est gradus tractabilis, qui tibi sinit progredi sine te onerando.","Scegliere solo un compito da cui iniziare \xe8 un passo gestibile che ti consente di fare progressi senza sopraffarti.","\u0627\u0646\u062a\u062e\u0627\u0628 \u0641\u0642\u0637 \u06cc\u06a9 \u06a9\u0627\u0631 \u0628\u0631\u0627\u06cc \u0634\u0631\u0648\u0639 \u06cc\u06a9 \u0642\u062f\u0645 \u0642\u0627\u0628\u0644 \u06a9\u0646\u062a\u0631\u0644 \u0627\u0633\u062a \u06a9\u0647 \u0628\u0647 \u0634\u0645\u0627 \u0627\u06cc\u0646 \u0627\u0645\u06a9\u0627\u0646 \u0631\u0627 \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u0628\u062f\u0648\u0646 \u0641\u0634\u0627\u0631 \u0632\u06cc\u0627\u062f \u067e\u06cc\u0634\u0631\u0641\u062a \u06a9\u0646\u06cc\u062f."],t.w)
