B.aeQ=new A.d(B.c,["You\u2019ve been working for hours without stopping. The thought is: \u201cIf I stop now, I\u2019ll never get back to it.\u201d\n\nWhat tiny action will help you take a break without guilt?","Has estado trabajando durante horas sin parar. El pensamiento es: \u201cSi paro ahora, nunca volver\xe9 a hacerlo.\u201d\n\n\xbfQu\xe9 peque\xf1a acci\xf3n te ayudar\xe1 a tomar un descanso sin culpa?","Du arbeitest schon seit Stunden ohne Pause. Der Gedanke ist: \u201eWenn ich jetzt aufh\xf6re, komme ich nie wieder dazu.\u201c\n\nWelche kleine Handlung hilft dir, eine Pause ohne Schuldgef\xfchle zu machen?","Tu travailles depuis des heures sans t\u2019arr\xeater. La pens\xe9e est : \u201cSi je m\u2019arr\xeate maintenant, je ne reviendrai jamais \xe0 cela.\u201d\n\nQuelle petite action t\u2019aidera \xe0 faire une pause sans culpabilit\xe9 ?","\u0644\u0642\u062f \u0643\u0646\u062a \u062a\u0639\u0645\u0644 \u0644\u0633\u0627\u0639\u0627\u062a \u062f\u0648\u0646 \u062a\u0648\u0642\u0641. \u0627\u0644\u0641\u0643\u0631\u0629 \u0647\u064a: \u201c\u0625\u0630\u0627 \u062a\u0648\u0642\u0641\u062a \u0627\u0644\u0622\u0646\u060c \u0641\u0644\u0646 \u0623\u062a\u0645\u0643\u0646 \u0645\u0646 \u0627\u0644\u0639\u0648\u062f\u0629 \u0644\u0630\u0644\u0643.\u201d\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u062a\u064a \u0633\u062a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0623\u062e\u0630 \u0627\u0633\u062a\u0631\u0627\u062d\u0629 \u062f\u0648\u0646 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0630\u0646\u0628\u061f","\uba87 \uc2dc\uac04 \ub3d9\uc548 \uc26c\uc9c0 \uc54a\uace0 \uc77c\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc0dd\uac01\uc740 \u201c\uc9c0\uae08 \uba48\ucd94\uba74 \ub2e4\uc2dc\ub294 \ub3cc\uc544\uac00\uc9c0 \ubabb\ud560 \uac70\uc57c.\u201d\n\n\uc8c4\ucc45\uac10 \uc5c6\uc774 \ud734\uc2dd\uc744 \ucde8\ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc904 \uc791\uc740 \ud589\ub3d9\uc740 \ubb34\uc5c7\uc778\uac00\uc694?","\u4f60\u5df2\u7ecf\u8fde\u7eed\u5de5\u4f5c\u4e86\u597d\u51e0\u4e2a\u5c0f\u65f6\u3002\u8fd9\u4e2a\u60f3\u6cd5\u662f\uff1a\u201c\u5982\u679c\u6211\u73b0\u5728\u505c\u4e0b\u6765\uff0c\u6211\u6c38\u8fdc\u4e5f\u4e0d\u4f1a\u56de\u6765\u4e86\u3002\u201d\n\n\u4ec0\u4e48\u5c0f\u884c\u52a8\u80fd\u5e2e\u52a9\u4f60\u6beb\u65e0\u5185\u759a\u5730\u4f11\u606f\uff1f",'\u0906\u092a \u0915\u0908 \u0918\u0902\u091f\u094b\u0902 \u0938\u0947 \u092c\u093f\u0928\u093e \u0930\u0941\u0915\u0947 \u0915\u093e\u092e \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0935\u093f\u091a\u093e\u0930 \u0939\u0948: "\u0905\u0917\u0930 \u092e\u0948\u0902 \u0905\u092c \u0930\u0941\u0915 \u0917\u092f\u093e, \u0924\u094b \u092e\u0948\u0902 \u0907\u0938\u0947 \u0915\u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u092a\u093e\u090a\u0901\u0917\u093e\u0964"\n\n\u0906\u092a\u0915\u0947 \u0932\u093f\u090f \u0915\u093f\u0938 \u091b\u094b\u091f\u0947 \u0915\u0926\u092e \u0938\u0947 \u0906\u092a \u092c\u093f\u0928\u093e \u0915\u093f\u0938\u0940 \u0926\u094b\u0937 \u0915\u0947 \u092c\u094d\u0930\u0947\u0915 \u0932\u0947 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902?','Laboras per horas sine intermissione. Cogitatio est: "Si nunc desisto, numquam ad id revertar."\n\nQuid parvum actum adiuvabit ut sine culpa intermissionem accipias?','Hai lavorato per ore senza fermarti. Il pensiero \xe8: "Se mi fermo ora, non ci torner\xf2 mai pi\xf9." \n\nQuale piccola azione ti aiuter\xe0 a fare una pausa senza sensi di colpa?',"\u0633\u0627\u0639\u0627\u062a \u0632\u06cc\u0627\u062f\u06cc \u0628\u062f\u0648\u0646 \u062a\u0648\u0642\u0641 \u06a9\u0627\u0631 \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc\u062f. \u0641\u06a9\u0631 \u0627\u06cc\u0646 \u0627\u0633\u062a: \u201c\u0627\u06af\u0631 \u0627\u0644\u0627\u0646 \u0645\u062a\u0648\u0642\u0641 \u0634\u0648\u0645\u060c \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0628\u0647 \u0622\u0646 \u0628\u0631\u0646\u0645\u06cc\u200c\u06af\u0631\u062f\u0645.\u201d\n\n\u0686\u0647 \u0627\u0642\u062f\u0627\u0645 \u06a9\u0648\u0686\u06a9\u06cc \u0628\u0647 \u0634\u0645\u0627 \u06a9\u0645\u06a9 \u062e\u0648\u0627\u0647\u062f \u06a9\u0631\u062f \u062a\u0627 \u0628\u062f\u0648\u0646 \u0627\u062d\u0633\u0627\u0633 \u06af\u0646\u0627\u0647 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u06cc\u062f\u061f"],t.w)
B.aen=new A.d(B.c,["Push through and work until exhaustion.","Sigue trabajando hasta la extenuaci\xf3n.","Durchhalten und bis zur Ersch\xf6pfung arbeiten.","Continue de travailler jusqu\u2019\xe0 l\u2019\xe9puisement.","\u0627\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u0639\u0645\u0644 \u062d\u062a\u0649 \u0627\u0644\u0625\u0646\u0647\u0627\u0643.","\uc9c0\uce58\ub3c4\ub85d \uacc4\uc18d \uc77c\ud558\uc138\uc694.","\u7ee7\u7eed\u5de5\u4f5c\u76f4\u5230\u7b4b\u75b2\u529b\u5c3d\u3002","\u0925\u0915\u093e\u0928 \u0924\u0915 \u0915\u093e\u092e \u0915\u0930\u0924\u0947 \u0930\u0939\u0947\u0902\u0964","Perge et labora usque ad defectum.","Continua a lavorare fino all\u2019esaurimento.","\u062a\u0627 \u0632\u0645\u0627\u0646 \u062e\u0633\u062a\u06af\u06cc \u06a9\u0627\u0631 \u06a9\u0646\u06cc\u062f."],t.w)
