B.a8v=new A.d(B.c,["Take a 5-minute walk outside.","Da un paseo de 5 minutos afuera.","Mache einen 5-min\xfctigen Spaziergang drau\xdfen.","Fais une promenade de 5 minutes dehors.","\u062e\u0630 \u062c\u0648\u0644\u0629 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u0641\u064a \u0627\u0644\u062e\u0627\u0631\u062c.","\ubc16\uc5d0\uc11c 5\ubd84 \uc0b0\ucc45\uc744 \ud558\uc138\uc694.","\u51fa\u53bb\u8d705\u5206\u949f\u3002","\u092c\u093e\u0939\u0930 5 \u092e\u093f\u0928\u091f \u0915\u0940 \u0938\u0948\u0930 \u0915\u0930\u0947\u0902\u0964","Ambula 5 minuta foris.","Fai una passeggiata di 5 minuti all\u2019esterno.","\u06cc\u06a9 \u067e\u06cc\u0627\u062f\u0647\u200c\u0631\u0648\u06cc 5 \u062f\u0642\u06cc\u0642\u0647\u200c\u0627\u06cc \u0628\u06cc\u0631\u0648\u0646 \u0628\u0631\u0648\u06cc\u062f."],t.w)
