B.a9j=new A.d(B.c,["Quit everything and take a 3-day break.","Deja todo y toma un descanso de 3 d\xedas.","Verlasse alles und mache eine 3-t\xe4gige Pause.","Quitte tout et prends une pause de 3 jours.","\u0627\u062a\u0631\u0643 \u0643\u0644 \u0634\u064a\u0621 \u0648\u062e\u0630 \u0627\u0633\u062a\u0631\u0627\u062d\u0629 \u0644\u0645\u062f\u0629 3 \u0623\u064a\u0627\u0645.","\ubaa8\ub4e0 \uac83\uc744 \uadf8\ub9cc\ub450\uace0 3\uc77c \ud734\uc2dd\uc744 \ucde8\ud558\uc138\uc694.","\u653e\u4e0b\u6240\u6709\u4e8b\u60c5\uff0c\u4f11\u606f3\u5929\u3002","\u0938\u092c \u0915\u0941\u091b \u091b\u094b\u0921\u093c \u0926\u0947\u0902 \u0914\u0930 3 \u0926\u093f\u0928 \u0915\u093e \u092c\u094d\u0930\u0947\u0915 \u0932\u0947\u0902\u0964","Relinque omnia et fac intermissum 3 dies.","Lascia tutto e fai una pausa di 3 giorni.","\u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0631\u0647\u0627 \u06a9\u0646\u06cc\u062f \u0648 3 \u0631\u0648\u0632 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u06cc\u062f."],t.w)
