B.aay=new A.d(B.c,["Taking small breaks throughout the day, such as a 5-minute walk, can help maintain focus and prevent burnout.","Tomarse peque\xf1os descansos durante el d\xeda, como una caminata de 5 minutos, puede ayudar a mantener la concentraci\xf3n y prevenir el agotamiento.","Kleine Pausen w\xe4hrend des Tages, wie ein 5-min\xfctiger Spaziergang, k\xf6nnen helfen, die Konzentration aufrechtzuerhalten und Burnout zu vermeiden.","Prendre de petites pauses tout au long de la journ\xe9e, comme une promenade de 5 minutes, peut aider \xe0 maintenir la concentration et \xe0 pr\xe9venir l\u2019\xe9puisement.","\u0623\u062e\u0630 \u0641\u062a\u0631\u0627\u062a \u0631\u0627\u062d\u0629 \u0635\u063a\u064a\u0631\u0629 \u0637\u0648\u0627\u0644 \u0627\u0644\u064a\u0648\u0645\u060c \u0645\u062b\u0644 \u0627\u0644\u0633\u064a\u0631 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642\u060c \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0648\u0645\u0646\u0639 \u0627\u0644\u0625\u0631\u0647\u0627\u0642.","\ud558\ub8e8 \uc885\uc77c 5\ubd84 \uc0b0\ucc45\uacfc \uac19\uc740 \uc791\uc740 \ud734\uc2dd\uc744 \ucde8\ud558\uba74 \uc9d1\uc911\ub825\uc744 \uc720\uc9c0\ud558\uace0 \ud0c8\uc9c4\uc744 \uc608\ubc29\ud558\ub294 \ub370 \ub3c4\uc6c0\uc774 \ub429\ub2c8\ub2e4.","\u5168\u5929\u4f11\u606f\u77ed\u6682\u7684\u65f6\u95f4\uff0c\u6bd4\u5982\u5916\u51fa\u8d705\u5206\u949f\uff0c\u53ef\u4ee5\u5e2e\u52a9\u4fdd\u6301\u4e13\u6ce8\u5e76\u9884\u9632\u8fc7\u5ea6\u52b3\u7d2f\u3002","\u0926\u093f\u0928 \u092d\u0930 \u092e\u0947\u0902 \u091b\u094b\u091f\u0947 \u092c\u094d\u0930\u0947\u0915 \u0932\u0947\u0928\u093e, \u091c\u0948\u0938\u0947 5 \u092e\u093f\u0928\u091f \u0915\u0940 \u0938\u0948\u0930, \u0927\u094d\u092f\u093e\u0928 \u0915\u0947\u0902\u0926\u094d\u0930\u093f\u0924 \u0930\u0916\u0928\u0947 \u092e\u0947\u0902 \u092e\u0926\u0926 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0948 \u0914\u0930 \u091c\u0932\u0928\u0947 \u0938\u0947 \u092c\u091a\u093e \u0938\u0915\u0924\u093e \u0939\u0948\u0964","Parvae intermissiones per diem capiendo, sicut 5 minuta ambulatio, adiuvare potest ad conservandum focus et preveniendum burnout.","Fare piccole pause durante la giornata, come una passeggiata di 5 minuti, pu\xf2 aiutare a mantenere la concentrazione e prevenire il burnout.","\u06af\u0631\u0641\u062a\u0646 \u0627\u0633\u062a\u0631\u0627\u062d\u062a\u200c\u0647\u0627\u06cc \u06a9\u0648\u062a\u0627\u0647 \u062f\u0631 \u0637\u0648\u0644 \u0631\u0648\u0632\u060c \u0645\u0627\u0646\u0646\u062f \u067e\u06cc\u0627\u062f\u0647\u200c\u0631\u0648\u06cc \u06f5 \u062f\u0642\u06cc\u0642\u0647\u200c\u0627\u06cc\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0628\u0647 \u062d\u0641\u0638 \u062a\u0645\u0631\u06a9\u0632 \u0648 \u062c\u0644\u0648\u06af\u06cc\u0631\u06cc \u0627\u0632 \u0633\u0648\u062e\u062a\u06af\u06cc \u06a9\u0645\u06a9 \u06a9\u0646\u062f."],t.w)
