B.aaS=new A.d(B.c,["\u201cYes, I ruined everything. I should avoid meetings from now on.\u201d","\u201cS\xed, arruin\xe9 todo. Deber\xeda evitar las reuniones a partir de ahora.\u201d","\u201eJa, ich habe alles ruiniert. Ich sollte ab jetzt Besprechungen meiden.\u201c","\u201cOui, j\u2019ai tout g\xe2ch\xe9. Je devrais \xe9viter les r\xe9unions \xe0 partir de maintenant.\u201d","\u201c\u0646\u0639\u0645\u060c \u0644\u0642\u062f \u0623\u0641\u0633\u062f\u062a \u0643\u0644 \u0634\u064a\u0621. \u064a\u062c\u0628 \u0639\u0644\u064a \u062a\u062c\u0646\u0628 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u0627\u062a \u0645\u0646 \u0627\u0644\u0622\u0646 \u0641\u0635\u0627\u0639\u062f\u064b\u0627.\u201d","\u201c\ub124, \ub098\ub294 \ubaa8\ub4e0 \uac83\uc744 \ub9dd\ucce4\ub2e4. \uc774\uc81c\ubd80\ud130 \ud68c\uc758\ub97c \ud53c\ud574\uc57c \ud55c\ub2e4.\u201d","\u201c\u662f\u7684\uff0c\u6211\u641e\u7838\u4e86\u4e00\u5207\u3002\u4ece\u73b0\u5728\u5f00\u59cb\uff0c\u6211\u5e94\u8be5\u907f\u514d\u5f00\u4f1a\u3002\u201d","\u201c\u0939\u093e\u0901, \u092e\u0948\u0902\u0928\u0947 \u0938\u092c \u0915\u0941\u091b \u092c\u0930\u094d\u092c\u093e\u0926 \u0915\u0930 \u0926\u093f\u092f\u093e\u0964 \u092e\u0941\u091d\u0947 \u0905\u092c \u0938\u0947 \u092c\u0948\u0920\u0915\u0947\u0902 \u091f\u093e\u0932\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964\u201d","\u201cIta, omnia perdidi. Ex hoc tempore conventus vitare debeo.\u201d","\u201cS\xec, ho rovinato tutto. Dovrei evitare le riunioni da ora in poi.\u201d","\u201c\u0628\u0644\u0647\u060c \u0645\u0646 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0645. \u0627\u0632 \u0627\u06cc\u0646 \u067e\u0633 \u0628\u0627\u06cc\u062f \u0627\u0632 \u062c\u0644\u0633\u0627\u062a \u0627\u062c\u062a\u0646\u0627\u0628 \u06a9\u0646\u0645.\u201d"],t.w)
