B.a7L=new A.d(B.c,["\u201cSome parts went badly, some went okay. I can repair this by following up clearly.\u201d","\u201cAlgunas partes fueron mal, otras fueron bien. Puedo arreglar esto haciendo un seguimiento claro.\u201d","\u201eEinige Teile liefen schlecht, einige okay. Ich kann das reparieren, indem ich klar nachhake.\u201c","\u201cCertaines parties se sont mal pass\xe9es, d\u2019autres ont \xe9t\xe9 correctes. Je peux r\xe9parer cela en faisant un suivi clair.\u201d","\u201c\u0628\u0639\u0636 \u0627\u0644\u0623\u062c\u0632\u0627\u0621 \u0643\u0627\u0646\u062a \u0633\u064a\u0626\u0629\u060c \u0648\u0628\u0639\u0636\u0647\u0627 \u0643\u0627\u0646\u062a \u062c\u064a\u062f\u0629. \u064a\u0645\u0643\u0646\u0646\u064a \u0625\u0635\u0644\u0627\u062d \u0630\u0644\u0643 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u0645\u062a\u0627\u0628\u0639\u0629 \u0628\u0648\u0636\u0648\u062d.\u201d","\u201c\uc77c\ubd80\ub294 \uc798\ubabb\ub418\uc5c8\uace0, \uc77c\ubd80\ub294 \uad1c\ucc2e\uc558\ub2e4. \ub098\ub294 \uc774\ub97c \uba85\ud655\ud788 \ud6c4\uc18d \uc870\uce58\ub97c \ud1b5\ud574 \uace0\uce60 \uc218 \uc788\ub2e4.\u201d","\u201c\u6709\u4e9b\u90e8\u5206\u505a\u5f97\u4e0d\u597d\uff0c\u6709\u4e9b\u90e8\u5206\u8fd8\u884c\u3002\u6211\u53ef\u4ee5\u901a\u8fc7\u6e05\u695a\u5730\u8ddf\u8fdb\u6765\u4fee\u590d\u5b83\u3002\u201d","\u201c\u0915\u0941\u091b \u0939\u093f\u0938\u094d\u0938\u0947 \u092c\u0941\u0930\u0947 \u0917\u090f, \u0915\u0941\u091b \u0920\u0940\u0915 \u0939\u0941\u090f\u0964 \u092e\u0948\u0902 \u0907\u0938\u0947 \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0942\u092a \u0938\u0947 \u092b\u0949\u0932\u094b \u0915\u0930\u0915\u0947 \u0920\u0940\u0915 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cAliqua pars male pervagavit, aliqua bene. Hanc rem reparare possum sequendo clare.\u201d","\u201cAlcuni parti sono andati male, altre sono andate bene. Posso ripararlo facendo un follow-up chiaro.\u201d","\u201c\u0628\u0639\u0636\u06cc \u0642\u0633\u0645\u062a\u200c\u0647\u0627 \u0628\u062f \u067e\u06cc\u0634 \u0631\u0641\u062a\u060c \u0628\u0639\u0636\u06cc\u200c\u0647\u0627 \u062e\u0648\u0628 \u0628\u0648\u062f\u0646\u062f. \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u06cc\u0646 \u0631\u0627 \u0628\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u0648\u0627\u0636\u062d \u0627\u0635\u0644\u0627\u062d \u06a9\u0646\u0645.\u201d"],t.w)
