B.a9P=new A.d(B.c,["\u201cNothing matters anyway; it is pointless to think about it.\u201d","\u201cNada importa de todos modos; no tiene sentido pensar en ello.\u201d","\u201eEs spielt sowieso keine Rolle; es ist sinnlos, dar\xfcber nachzudenken.\u201c","\u201cDe toute fa\xe7on, rien n\u2019a d\u2019importance ; il est inutile d\u2019y penser.\u201d","\u201c\u0644\u0627 \u0634\u064a\u0621 \u064a\u0647\u0645 \u0639\u0644\u0649 \u0623\u064a \u062d\u0627\u0644\u061b \u0625\u0646\u0647 \u0628\u0644\u0627 \u0645\u0639\u0646\u0649 \u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0641\u064a\u0647.\u201d","\u201c\uc5b4\ucc28\ud53c \uc544\ubb34\uac83\ub3c4 \uc911\uc694\ud558\uc9c0 \uc54a\ub2e4. \uc0dd\uac01\ud560 \ud544\uc694 \uc5c6\ub2e4.\u201d","\u201c\u53cd\u6b63\u4ec0\u4e48\u90fd\u4e0d\u91cd\u8981\uff0c\u60f3\u5b83\u4e5f\u6ca1\u610f\u4e49\u3002\u201d","\u201c\u0935\u0948\u0938\u0947 \u092d\u0940 \u0915\u0941\u091b \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e; \u0907\u0938\u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0938\u094b\u091a\u0928\u093e \u092c\u0947\u0915\u093e\u0930 \u0939\u0948\u0964\u201d","\u201cNihil refert; inutile est cogitare de hoc.\u201d","\u201cComunque niente ha importanza; non ha senso pensarci.\u201d","\u201c\u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0627\u0647\u0645\u06cc\u062a \u0646\u062f\u0627\u0631\u062f\u061b \u0641\u06a9\u0631 \u06a9\u0631\u062f\u0646 \u0628\u0647 \u0622\u0646 \u0628\u06cc\u200c\u0641\u0627\u06cc\u062f\u0647 \u0627\u0633\u062a.\u201d"],t.w)
