B.aeO=new A.d(B.c,["\u201cI am always behind.\u201d","\u201cSiempre estoy atrasado.\u201d","\u201eIch bin immer hinterher.\u201c","\xab Je suis toujours en retard. \xbb","\u201c\u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0645\u062a\u0623\u062e\u0631.\u201d","\u201c\ub098\ub294 \ud56d\uc0c1 \ub4a4\uccd0\uc838 \uc788\ub2e4.\u201d","\u201c\u6211\u603b\u662f\u843d\u540e\u3002\u201d","\u201c\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u092a\u0940\u091b\u0947 \u0930\u0939\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cSemper retro sum.\u201d","\u201cSono sempre indietro.\u201d","\u201c\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0642\u0628 \u0647\u0633\u062a\u0645.\u201d"],t.w)
B.aeZ=new A.d(B.c,["Automatic thought:\n\u201cEveryone my age is ahead of me. I am permanently behind and will never catch up.\u201d\n\nChoose the reframe that keeps compassion + realism.","Pensamiento autom\xe1tico:\n\u201cTodos los de mi edad est\xe1n adelante. Estoy permanentemente atr\xe1s y nunca alcanzar\xe9.\u201d\n\nElige el reencuadre que mantenga la compasi\xf3n y el realismo.","Automatischer Gedanke:\n\u201eAlle in meinem Alter sind mir voraus. Ich bin dauerhaft hinterher und werde nie aufholen.\u201c\n\nW\xe4hle den Umdeutungsansatz, der Mitgef\xfchl und Realismus vereint.","Pens\xe9e automatique :\n\u201cTout le monde de mon \xe2ge est en avance sur moi. Je suis d\xe9finitivement en retard et je ne rattraperai jamais.\u201d\n\nChoisissez le reformatage qui garde de la compassion et du r\xe9alisme.","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0627\u0644\u062c\u0645\u064a\u0639 \u0641\u064a \u0633\u0646\u064a \u064a\u062a\u0641\u0648\u0642\u0648\u0646 \u0639\u0644\u064a. \u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0645\u062a\u0623\u062e\u0631 \u0648\u0644\u0646 \u0623\u0644\u062d\u0642 \u0628\u0647\u0645 \u0623\u0628\u062f\u064b\u0627.\u201d\n\n\u0627\u062e\u062a\u0631 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0627\u0644\u062a\u0639\u0627\u0637\u0641 \u0648\u0627\u0644\u0648\u0627\u0642\u0639\u064a\u0629.","\uc790\ub3d9 \uc0dd\uac01:\n\u201c\ub0b4 \ub098\uc774 \ub610\ub798\ub294 \ubaa8\ub450 \ub098\ubcf4\ub2e4 \uc55e\uc11c \uc788\ub2e4. \ub098\ub294 \uc601\uc6d0\ud788 \ub4a4\ucc98\uc9c0\uace0 \ub2e4\uc2dc\ub294 \ub530\ub77c\uc7a1\uc744 \uc218 \uc5c6\ub2e4.\u201d\n\n\ub3d9\uc815\uc2ec\uacfc \ud604\uc2e4\uc744 \ubaa8\ub450 \uace0\ub824\ud55c \uc7ac\uad6c\uc131\uc744 \uc120\ud0dd\ud558\uc138\uc694.","\u81ea\u52a8\u60f3\u6cd5\uff1a\n\u201c\u6211\u8fd9\u4e2a\u5e74\u9f84\u7684\u4eba\u90fd\u6bd4\u6211\u9886\u5148\u3002\u6211\u6c38\u8fdc\u843d\u540e\uff0c\u6c38\u8fdc\u8ffd\u4e0d\u4e0a\u3002\u201d\n\n\u9009\u62e9\u90a3\u4e2a\u65e2\u4fdd\u6301\u540c\u60c5\u53c8\u73b0\u5b9e\u7684\u91cd\u65b0\u6846\u67b6\u3002","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0947\u0930\u0947 \u0909\u092e\u094d\u0930 \u0915\u0947 \u0938\u092d\u0940 \u0932\u094b\u0917 \u092e\u0941\u091d\u0938\u0947 \u0906\u0917\u0947 \u0939\u0948\u0902\u0964 \u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u092a\u0940\u091b\u0947 \u0939\u0942\u0901 \u0914\u0930 \u0915\u092d\u0940 \u092d\u0940 \u092a\u0915\u0921\u093c \u0928\u0939\u0940\u0902 \u092a\u093e\u090a\u0901\u0917\u093e\u0964\u201d\n\n\u091c\u094b \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u0915\u0930\u0941\u0923\u093e \u0914\u0930 \u092f\u0925\u093e\u0930\u094d\u0925\u0935\u093e\u0926 \u092c\u0928\u093e\u090f \u0930\u0916\u0947, \u0909\u0938\u0947 \u091a\u0941\u0928\u0947\u0902\u0964","Cogitatio automatica:\n\u201cOmnes in aetate mea mihi anteferuntur. Ego semper retro sum et numquam assequar.\u201d\n\nEligite reframe quae compassio et realismum servet.","Pensiero automatico:\n\u201cTutti nella mia et\xe0 sono avanti a me. Sono permanentemente indietro e non recuperer\xf2 mai.\u201d\n\nScegli la riformulazione che mantenga compassione e realismo.","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0647\u0645\u0647 \u0627\u0641\u0631\u0627\u062f\u06cc \u06a9\u0647 \u0647\u0645 \u0633\u0646 \u0645\u0646 \u0647\u0633\u062a\u0646\u062f \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631\u0646\u062f. \u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0639\u0642\u0628 \u0647\u0633\u062a\u0645 \u0648 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u062c\u0628\u0631\u0627\u0646 \u06a9\u0646\u0645.\u201d\n\n\u0628\u0627\u0632\u0633\u0627\u0632\u06cc\u200c\u0627\u06cc \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0647\u0645\u062f\u0644\u06cc \u0648 \u0648\u0627\u0642\u0639\u200c\u06af\u0631\u0627\u06cc\u06cc \u0631\u0627 \u062d\u0641\u0638 \u06a9\u0646\u062f."],t.w)
B.abG=new A.d(B.c,["\u201cMy timeline is my own; I can still move forward from where I am now.\u201d","\u201cMi l\xednea de tiempo es m\xeda; todav\xeda puedo avanzar desde donde estoy ahora.\u201d","\u201eMeine Zeitlinie geh\xf6rt mir; ich kann immer noch von hier aus vorankommen.\u201c","\u201cMa ligne de temps est la mienne ; je peux encore avancer \xe0 partir d\u2019ici.\u201d","\u201c\u062c\u062f\u0648\u0644\u064a \u0627\u0644\u0632\u0645\u0646\u064a \u0645\u0644\u0643\u064a\u061b \u0644\u0627 \u064a\u0632\u0627\u0644 \u0628\u0625\u0645\u0643\u0627\u0646\u064a \u0627\u0644\u062a\u0642\u062f\u0645 \u0645\u0646 \u062d\u064a\u062b \u0623\u0646\u0627 \u0627\u0644\u0622\u0646.\u201d","\u201c\ub0b4 \ud0c0\uc784\ub77c\uc778\uc740 \ub0b4 \uac83; \uc9c0\uae08 \uc788\ub294 \uacf3\uc5d0\uc11c \uc5ec\uc804\ud788 \uc55e\uc73c\ub85c \ub098\uc544\uac08 \uc218 \uc788\ub2e4.\u201d","\u201c\u6211\u7684\u65f6\u95f4\u7ebf\u662f\u6211\u81ea\u5df1\u7684\uff1b\u6211\u4ecd\u7136\u53ef\u4ee5\u4ece\u73b0\u5728\u5f00\u59cb\u524d\u8fdb\u3002\u201d","\u201c\u092e\u0947\u0930\u0940 \u0938\u092e\u092f\u0930\u0947\u0916\u093e \u092e\u0947\u0930\u0940 \u0905\u092a\u0928\u0940 \u0939\u0948; \u092e\u0948\u0902 \u0905\u092c \u0938\u0947 \u0906\u0917\u0947 \u092c\u0922\u093c \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cTempus meum est meum; adhuc progredi possum ab hoc loco.\u201d","\u201cLa mia linea temporale \xe8 la mia; posso comunque andare avanti da dove sono ora.\u201d","\u201c\u062e\u0637 \u0632\u0645\u0627\u0646\u06cc \u0645\u0646 \u0645\u062a\u0639\u0644\u0642 \u0628\u0647 \u062e\u0648\u062f\u0645 \u0627\u0633\u062a\u061b \u0645\u0646 \u0647\u0646\u0648\u0632 \u0647\u0645 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u0632 \u062c\u0627\u06cc\u06cc \u06a9\u0647 \u0647\u0633\u062a\u0645 \u067e\u06cc\u0634 \u0628\u0631\u0648\u0645.\u201d"],t.w)
