B.acv=new A.d(B.c,["\u201cThey are ahead, so I should just give up and stop trying.\u201d","\u201cEllos est\xe1n adelante, as\xed que deber\xeda rendirme y dejar de intentar.\u201d","\u201eSie sind voraus, also sollte ich einfach aufgeben und aufh\xf6ren zu versuchen.\u201c","\u201cIls sont en avance, alors je devrais abandonner et arr\xeater d\u2019essayer.\u201d","\u201c\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631\u0646\u062f\u060c \u0644\u0630\u0627 \u0628\u0627\u06cc\u062f \u062a\u0633\u0644\u06cc\u0645 \u0634\u0648\u0645 \u0648 \u062f\u0633\u062a \u0627\u0632 \u062a\u0644\u0627\u0634 \u0628\u0631\u062f\u0627\u0631\u0645.\u201d","\u201c\uadf8\ub4e4\uc740 \uc55e\uc11c \uc788\ub2e4, \uadf8\ub798\uc11c \ub098\ub294 \uadf8\ub0e5 \ud3ec\uae30\ud558\uace0 \ub178\ub825\ud558\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4.\u201d","\u201c\u4ed6\u4eec\u9886\u5148\uff0c\u6211\u5e94\u8be5\u653e\u5f03\u5e76\u505c\u6b62\u5c1d\u8bd5\u3002\u201d","\u201c\u0935\u0947 \u092e\u0941\u091d\u0938\u0947 \u0906\u0917\u0947 \u0939\u0948\u0902, \u0924\u094b \u092e\u0941\u091d\u0947 \u092c\u0938 \u0939\u093e\u0930 \u092e\u093e\u0928 \u0932\u0947\u0928\u0940 \u091a\u093e\u0939\u093f\u090f \u0914\u0930 \u0915\u094b\u0936\u093f\u0936 \u0915\u0930\u0928\u093e \u092c\u0902\u0926 \u0915\u0930 \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d","\u201cIpsi sunt ante, ergo ego simpliciter desistere et conari desinere debui.\u201d","\u201cLoro sono avanti, quindi dovrei arrendermi e smettere di provare.\u201d","\u201c\u0622\u0646\u200c\u0647\u0627 \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631\u0646\u062f\u060c \u067e\u0633 \u0628\u0627\u06cc\u062f \u062a\u0633\u0644\u06cc\u0645 \u0634\u0648\u0645 \u0648 \u062f\u06cc\u06af\u0631 \u062a\u0644\u0627\u0634 \u0646\u06a9\u0646\u0645.\u201d"],t.w)
