B.ab0=new A.d(B.c,["\u201cNo one else exists; only my path matters, nothing else is real.\u201d","\u201cNo existe nadie m\xe1s; solo mi camino importa, nada m\xe1s es real.\u201d","\u201eEs existiert niemand anderes; nur mein Weg z\xe4hlt, nichts anderes ist real.\u201c","\u201cIl n\u2019existe personne d\u2019autre ; seul mon chemin compte, rien d\u2019autre n\u2019est r\xe9el.\u201d","\u201c\u0644\u0627 \u064a\u0648\u062c\u062f \u0623\u062d\u062f \u0622\u062e\u0631\u061b \u0641\u0642\u0637 \u0637\u0631\u064a\u0642\u064a \u0647\u0648 \u0627\u0644\u0645\u0647\u0645\u060c \u0644\u0627 \u0634\u064a\u0621 \u0622\u062e\u0631 \u062d\u0642\u064a\u0642\u064a.\u201d","\u201c\ub2e4\ub978 \uc0ac\ub78c\uc740 \uc874\uc7ac\ud558\uc9c0 \uc54a\ub294\ub2e4; \uc624\uc9c1 \ub0b4 \uae38\ub9cc \uc911\uc694\ud558\ub2e4, \ub2e4\ub978 \uac83\uc740 \ubaa8\ub450 \uac00\uc9dc\ub2e4.\u201d","\u201c\u6ca1\u6709\u522b\u4eba\u5b58\u5728\uff1b\u53ea\u6709\u6211\u7684\u8def\u624d\u91cd\u8981\uff0c\u5176\u4ed6\u4e00\u5207\u90fd\u4e0d\u771f\u5b9e\u3002\u201d","\u201c\u0915\u094b\u0908 \u0914\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948; \u0915\u0947\u0935\u0932 \u092e\u0947\u0930\u0940 \u0930\u093e\u0939 \u092e\u093e\u092f\u0928\u0947 \u0930\u0916\u0924\u0940 \u0939\u0948, \u0915\u0941\u091b \u092d\u0940 \u0905\u0938\u0932\u0940 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\u201d","\u201cNemo alius exsistit; solum via mea refert, nihil aliud verum est.\u201d","\u201cNon esiste nessun altro; solo il mio cammino conta, nient\u2019altro \xe8 reale.\u201d","\u201c\u0647\u06cc\u0686 \u06a9\u0633 \u062f\u06cc\u06af\u0631\u06cc \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f\u061b \u062a\u0646\u0647\u0627 \u0645\u0633\u06cc\u0631 \u0645\u0646 \u0645\u0647\u0645 \u0627\u0633\u062a\u060c \u0647\u06cc\u0686 \u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0648\u0627\u0642\u0639\u06cc \u0646\u06cc\u0633\u062a.\u201d"],t.w)
