B.abB=new A.d(B.c,["\u201cIf I rest, I am lazy.\u201d","\u201cSi descanso, soy perezoso.\u201d","\u201eWenn ich mich ausruhe, bin ich faul.\u201c","\xab Si je me repose, je suis paresseux. \xbb","\u201c\u0625\u0630\u0627 \u0627\u0633\u062a\u0631\u062d\u062a\u060c \u0641\u0623\u0646\u0627 \u0643\u0633\u0648\u0644.\u201d","\u201c\ud734\uc2dd\ud558\uba74 \ub098\ub294 \uac8c\uc73c\ub974\ub2e4.\u201d","\u201c\u5982\u679c\u6211\u4f11\u606f\uff0c\u6211\u5c31\u662f\u61d2\u60f0\u7684\u3002\u201d","\u201c\u0905\u0917\u0930 \u092e\u0948\u0902 \u0906\u0930\u093e\u092e \u0915\u0930\u0924\u093e \u0939\u0942\u0901, \u0924\u094b \u092e\u0948\u0902 \u0906\u0932\u0938\u0940 \u0939\u0942\u0901\u0964\u201d","\u201cSi quiesco, sum piger.\u201d","\u201cSe mi riposo, sono pigro.\u201d","\u201c\u0627\u06af\u0631 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u0645\u060c \u0645\u0646 \u062a\u0646\u0628\u0644 \u0647\u0633\u062a\u0645.\u201d"],t.w)
B.a84=new A.d(B.c,["Automatic thought:\n\u201cIf I take a break, it means I am lazy and weak.\u201d\n\nWhich reframe is most helpful?","Pensamiento autom\xe1tico:\n\u201cSi descanso, significa que soy perezoso y d\xe9bil.\u201d\n\n\xbfQu\xe9 reencuadre es el m\xe1s \xfatil?","Automatischer Gedanke:\n\u201eWenn ich eine Pause mache, bedeutet das, dass ich faul und schwach bin.\u201c\n\nWelche Umformulierung ist am hilfreichsten?","Pens\xe9e automatique:\n\u201cSi je prends une pause, cela signifie que je suis paresseux et faible.\u201d\n\nQuelle reformulation est la plus utile ?","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0625\u0630\u0627 \u0623\u062e\u0630\u062a \u0627\u0633\u062a\u0631\u0627\u062d\u0629\u060c \u0641\u0647\u0630\u0627 \u064a\u0639\u0646\u064a \u0623\u0646\u0646\u064a \u0643\u0633\u0648\u0644 \u0648\u0636\u0639\u064a\u0641.\u201d\n\n\u0623\u064a \u0625\u0639\u0627\u062f\u0629 \u0635\u064a\u0627\u063a\u0629 \u0647\u064a \u0627\u0644\u0623\u0643\u062b\u0631 \u0641\u0627\u0626\u062f\u0629\u061f","\uc790\ub3d9\uc801 \uc0ac\uace0:\n\u201c\ud734\uc2dd\uc744 \ucde8\ud558\uba74 \ub098\ub294 \uac8c\uc73c\ub974\uace0 \uc57d\ud558\ub2e4.\u201d\n\n\uc5b4\ub5a4 \uc7ac\uad6c\uc131\uc774 \uac00\uc7a5 \ub3c4\uc6c0\uc774 \ub420\uae4c\uc694?","\u81ea\u52a8\u601d\u7ef4\uff1a\n\u201c\u5982\u679c\u6211\u4f11\u606f\uff0c\u610f\u5473\u7740\u6211\u61d2\u60f0\u4e14\u865a\u5f31\u3002\u201d\n\n\u54ea\u4e2a\u91cd\u65b0\u6846\u67b6\u6700\u6709\u5e2e\u52a9\uff1f","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u0905\u0917\u0930 \u092e\u0948\u0902 \u0906\u0930\u093e\u092e \u0915\u0930\u0924\u093e \u0939\u0942\u0901, \u0924\u094b \u0907\u0938\u0915\u093e \u092e\u0924\u0932\u092c \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0906\u0932\u0938\u0940 \u0914\u0930 \u0915\u092e\u091c\u094b\u0930 \u0939\u0942\u0901\u0964\u201d\n\n\u0938\u092c\u0938\u0947 \u092e\u0926\u0926\u0917\u093e\u0930 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u0915\u094c\u0928 \u0938\u0940 \u0939\u0948?","Cogitatio automatica:\n\u201cSi quiesco, significat me pigram et infirmum esse.\u201d\n\nQuod reframing maxime utile est?","Pensiero automatico:\n\u201cSe mi prendo una pausa, significa che sono pigro e debole.\u201d\n\nQuale reframe \xe8 il pi\xf9 utile?","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0627\u06af\u0631 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u0645\u060c \u06cc\u0639\u0646\u06cc \u0645\u0646 \u062a\u0646\u0628\u0644 \u0648 \u0636\u0639\u06cc\u0641 \u0647\u0633\u062a\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0645\u0641\u06cc\u062f \u0627\u0633\u062a\u061f"],t.w)
B.abY=new A.d(B.c,["\u201cRest is proof I am lazy; I should work until I break.\u201d","\u201cEl descanso es prueba de que soy perezoso; debo trabajar hasta romperme.\u201d","\u201eRuhe ist der Beweis, dass ich faul bin; ich sollte arbeiten, bis ich zusammenbreche.\u201c","\u201cSe reposer est la preuve que je suis paresseux; je dois travailler jusqu\u2019\xe0 ce que je craque.\u201d","\u201c\u0627\u0644\u0631\u0627\u062d\u0629 \u0647\u064a \u062f\u0644\u064a\u0644 \u0639\u0644\u0649 \u0623\u0646\u0646\u064a \u0643\u0633\u0648\u0644\u061b \u064a\u062c\u0628 \u0623\u0646 \u0623\u0639\u0645\u0644 \u062d\u062a\u0649 \u0623\u062a\u0643\u0633\u0631.\u201d","\u201c\ud734\uc2dd\uc740 \ub0b4\uac00 \uac8c\uc73c\ub974\ub2e4\ub294 \uc99d\uac70\uc785\ub2c8\ub2e4; \ub098\ub294 \ubd80\uc11c\uc9c8 \ub54c\uae4c\uc9c0 \uc77c\ud574\uc57c \ud569\ub2c8\ub2e4.\u201d","\u201c\u4f11\u606f\u662f\u6211\u61d2\u60f0\u7684\u8bc1\u660e\uff1b\u6211\u5e94\u8be5\u5de5\u4f5c\u5230\u5d29\u6e83\u3002\u201d","\u201c\u0906\u0930\u093e\u092e \u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0906\u0932\u0938\u0940 \u0939\u0942\u0902; \u092e\u0941\u091d\u0947 \u091f\u0942\u091f\u0928\u0947 \u0924\u0915 \u0915\u093e\u092e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d","\u201cQuies est probatio me pigrum esse; ego laborare debeo usque ad frangendum.\u201d","\u201cIl riposo \xe8 la prova che sono pigro; dovrei lavorare fino a crollare.\u201d","\u201c\u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0646\u0634\u0627\u0646\u0647\u200c\u0627\u06cc \u0627\u0632 \u062a\u0646\u0628\u0644\u06cc \u0645\u0646 \u0627\u0633\u062a\u061b \u0628\u0627\u06cc\u062f \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0628\u0634\u06a9\u0646\u0645 \u06a9\u0627\u0631 \u06a9\u0646\u0645.\u201d"],t.w)
