B.abA=new A.d(B.c,["Automatic thought:\n\u201cThey took hours to reply to my message. I am clearly not important to them.\u201d\n\nSelect the best reframe.","Pensamiento autom\xe1tico:\n\u201cSe tardaron horas en responder a mi mensaje. Claramente no soy importante para ellos.\u201d\n\nSelecciona el mejor reencuadre.","Automatischer Gedanke:\n\u201eEs hat Stunden gedauert, bis sie auf meine Nachricht geantwortet haben. Ich bin ihnen offensichtlich nicht wichtig.\u201c\n\nW\xe4hle die beste Umformulierung aus.","Pens\xe9e automatique :\n\u201cIls ont mis des heures \xe0 r\xe9pondre \xe0 mon message. Clairement, je ne suis pas important pour eux.\u201d\n\nS\xe9lectionne la meilleure reformulation.","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0627\u0633\u062a\u063a\u0631\u0642\u0648\u0627 \u0633\u0627\u0639\u0627\u062a \u0644\u0644\u0631\u062f \u0639\u0644\u0649 \u0631\u0633\u0627\u0644\u062a\u064a. \u0645\u0646 \u0627\u0644\u0648\u0627\u0636\u062d \u0623\u0646\u0646\u064a \u0644\u0633\u062a \u0645\u0647\u0645\u064b\u0627 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0647\u0645.\u201d\n\n\u062d\u062f\u062f \u0623\u0641\u0636\u0644 \u0625\u0639\u0627\u062f\u0629 \u0635\u064a\u0627\u063a\u0629.","\uc790\ub3d9\uc801 \uc0ac\uace0:\n\u201c\uadf8\ub4e4\uc740 \ub0b4 \uba54\uc2dc\uc9c0\uc5d0 \uc751\ub2f5\ud558\ub294 \ub370 \uba87 \uc2dc\uac04\uc774 \uac78\ub838\ub2e4. \ub098\ub294 \ubd84\uba85\ud788 \uadf8\ub4e4\uc5d0\uac8c \uc911\uc694\ud558\uc9c0 \uc54a\ub2e4.\u201d\n\n\uac00\uc7a5 \uc88b\uc740 \uc7ac\uad6c\uc131\uc744 \uc120\ud0dd\ud558\uc138\uc694.","\u81ea\u52a8\u601d\u7ef4\uff1a\n\u201c\u4ed6\u4eec\u82b1\u4e86\u597d\u51e0\u4e2a\u5c0f\u65f6\u624d\u56de\u590d\u6211\u7684\u6d88\u606f\u3002\u663e\u7136\u6211\u5bf9\u4ed6\u4eec\u5e76\u4e0d\u91cd\u8981\u3002\u201d\n\n\u9009\u62e9\u6700\u597d\u7684\u91cd\u65b0\u6846\u67b6\u3002","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u092e\u0947\u0930\u0940 \u0938\u0902\u0926\u0947\u0936 \u0915\u093e \u091c\u0935\u093e\u092c \u0926\u0947\u0928\u0947 \u092e\u0947\u0902 \u0915\u0908 \u0918\u0902\u091f\u0947 \u0932\u093f\u090f\u0964 \u092e\u0948\u0902 \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0942\u092a \u0938\u0947 \u0909\u0928\u0915\u0947 \u0932\u093f\u090f \u092e\u0939\u0924\u094d\u0935\u092a\u0942\u0930\u094d\u0923 \u0928\u0939\u0940\u0902 \u0939\u0942\u0902\u0964\u201d\n\n\u0938\u092c\u0938\u0947 \u0905\u091a\u094d\u091b\u093e \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u091a\u0941\u0928\u0947\u0902\u0964","Cogitatio automatica:\n\u201cMultas horas ad meum nuntium respondere ceperunt. Manifestum est me non magni esse eis.\u201d\n\nOptime reframing elige.","Pensiero automatico:\n\u201cCi hanno messo ore per rispondere al mio messaggio. Chiaramente non sono importante per loro.\u201d\n\nSeleziona la miglior riformulazione.","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0622\u0646\u0647\u0627 \u0633\u0627\u0639\u062a\u200c\u0647\u0627 \u0637\u0648\u0644 \u06a9\u0634\u06cc\u062f \u062a\u0627 \u0628\u0647 \u067e\u06cc\u0627\u0645 \u0645\u0646 \u067e\u0627\u0633\u062e \u062f\u0647\u0646\u062f. \u0648\u0627\u0636\u062d \u0627\u0633\u062a \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0622\u0646\u0647\u0627 \u0645\u0647\u0645 \u0646\u06cc\u0633\u062a\u0645.\u201d\n\n\u0628\u0647\u062a\u0631\u06cc\u0646 \u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f."],t.w)
B.aaB=new A.d(B.c,["\u201cEither people reply instantly or they do not care about me at all.\u201d","\u201cO la gente responde al instante o no les importo en absoluto.\u201d","\u201eEntweder antworten die Leute sofort oder sie k\xfcmmern sich \xfcberhaupt nicht um mich.\u201c","\u201cSoit les gens r\xe9pondent instantan\xe9ment, soit ils ne se soucient pas du tout de moi.\u201d","\u201c\u0625\u0645\u0627 \u0623\u0646 \u064a\u0631\u062f \u0627\u0644\u0646\u0627\u0633 \u0641\u0648\u0631\u064b\u0627 \u0623\u0648 \u0623\u0646\u0647\u0645 \u0644\u0627 \u064a\u0647\u062a\u0645\u0648\u0646 \u0628\u064a \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.\u201d","\u201c\uc0ac\ub78c\ub4e4\uc774 \uc989\uc2dc \uc751\ub2f5\ud558\uac70\ub098 \uc544\uc608 \ub098\ub97c \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\ub294 \uac83\uc774\ub2e4.\u201d","\u201c\u8981\u4e48\u4eba\u4eec\u7acb\u5373\u56de\u590d\uff0c\u8981\u4e48\u6839\u672c\u4e0d\u5728\u4e4e\u6211\u3002\u201d","\u201c\u092f\u093e \u0924\u094b \u0932\u094b\u0917 \u0924\u0941\u0930\u0902\u0924 \u091c\u0935\u093e\u092c \u0926\u0947\u0924\u0947 \u0939\u0948\u0902 \u092f\u093e \u0935\u0947 \u092e\u0941\u091d\u0947 \u092c\u093f\u0932\u094d\u0915\u0941\u0932 \u092d\u0940 \u092a\u0930\u0935\u093e\u0939 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947\u0964\u201d","\u201cAut respondunt homines statim aut nullum me curant.\u201d","\u201cO le persone rispondono subito, oppure non gli importa di me per niente.\u201d","\u201c\u06cc\u0627 \u0645\u0631\u062f\u0645 \u0641\u0648\u0631\u0627\u064b \u067e\u0627\u0633\u062e \u0645\u06cc\u200c\u062f\u0647\u0646\u062f \u06cc\u0627 \u0627\u0635\u0644\u0627\u064b \u0628\u0647 \u0645\u0646 \u0627\u0647\u0645\u06cc\u062a \u0646\u0645\u06cc\u200c\u062f\u0647\u0646\u062f.\u201d"],t.w)
