B.a8Y=new A.d(B.c,["\u201cI will avoid everyone from now on; then I cannot be excluded.\u201d","\u201cEvitar\xe9 a todos a partir de ahora; as\xed no podr\xe9 ser excluido.\u201d","\u201eIch werde ab jetzt alle meiden; dann kann ich nicht ausgeschlossen werden.\u201c","\u201cJe vais \xe9viter tout le monde dor\xe9navant ; comme \xe7a je ne pourrai pas \xeatre exclu.\u201d","\u201c\u0645\u0646 \u0627\u0632 \u062d\u0627\u0644\u0627 \u0628\u0647 \u0628\u0639\u062f \u0627\u0632 \u0647\u0645\u0647 \u062f\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u0645\u061b \u067e\u0633 \u062f\u06cc\u06af\u0631 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u06a9\u0646\u0627\u0631 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0648\u0645.\u201d","\u201c\ub098\ub294 \uc774\uc81c\ubd80\ud130 \ubaa8\ub450\ub97c \ud53c\ud560 \uac83\uc774\ub2e4; \uadf8\ub7fc \ub098\ub294 \uc81c\uc678\ub420 \uc218 \uc5c6\ub2e4.\u201d","\u201c\u4ece\u73b0\u5728\u5f00\u59cb\uff0c\u6211\u4f1a\u907f\u514d\u6240\u6709\u4eba\uff1b\u90a3\u6837\u6211\u5c31\u4e0d\u4f1a\u88ab\u6392\u9664\u5728\u5916\u3002\u201d","\u201c\u0905\u092c \u0938\u0947 \u092e\u0948\u0902 \u0938\u092d\u0940 \u0938\u0947 \u092c\u091a\u0942\u0902\u0917\u093e; \u092b\u093f\u0930 \u092e\u0941\u091d\u0947 \u092c\u093e\u0939\u0930 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e \u091c\u093e \u0938\u0915\u0924\u093e\u0964\u201d","\u201cAb hoc tempore omnes vitabo; ita non possum exclusus esse.\u201d","\u201cDa ora in poi eviter\xf2 tutti; cos\xec non potr\xf2 essere escluso.\u201d","\u201c\u0627\u0632 \u0627\u06cc\u0646 \u0628\u0647 \u0628\u0639\u062f \u0627\u0632 \u0647\u0645\u0647 \u062f\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u0645\u061b \u067e\u0633 \u062f\u06cc\u06af\u0631 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u06a9\u0646\u0627\u0631 \u06af\u0630\u0627\u0634\u062a\u0647 \u0634\u0648\u0645.\u201d"],t.w)
