B.abb=new A.d(B.c,["We often treat one snapshot as the entire map. Reframes remind us that social circles are bigger than one event.","A menudo tratamos una sola instant\xe1nea como todo el mapa. Los reencuadres nos recuerdan que los c\xedrculos sociales son m\xe1s grandes que un solo evento.","Wir behandeln oft einen Schnappschuss als die gesamte Karte. Reframes erinnern uns daran, dass soziale Kreise gr\xf6\xdfer sind als ein einziges Ereignis.","Nous traitons souvent une seule photo comme toute la carte. Les reformatages nous rappellent que les cercles sociaux sont plus grands qu\u2019un seul \xe9v\xe9nement.","\u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u0646\u0639\u0627\u0645\u0644 \u0644\u0642\u0637\u0629 \u0648\u0627\u062d\u062f\u0629 \u0639\u0644\u0649 \u0623\u0646\u0647\u0627 \u0627\u0644\u062e\u0631\u064a\u0637\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629. \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u062a\u0630\u0643\u0631\u0646\u0627 \u0623\u0646 \u0627\u0644\u062f\u0648\u0627\u0626\u0631 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u064a\u0629 \u0623\u0643\u0628\u0631 \u0645\u0646 \u062d\u062f\u062b \u0648\u0627\u062d\u062f.","\uc6b0\ub9ac\ub294 \uc885\uc885 \ud558\ub098\uc758 \uc2a4\ub0c5\uc0f7\uc744 \uc804\uccb4 \ub9f5\uc73c\ub85c \ucde8\uae09\ud569\ub2c8\ub2e4. \uc7ac\uad6c\uc131\uc740 \uc0ac\ud68c\uc801 \uad00\uacc4\uac00 \ud558\ub098\uc758 \uc0ac\uac74\ubcf4\ub2e4 \ub354 \ud06c\ub2e4\ub294 \uac83\uc744 \uc0c1\uae30\uc2dc\ud0b5\ub2c8\ub2e4.","\u6211\u4eec\u7ecf\u5e38\u5c06\u4e00\u4e2a\u5feb\u7167\u89c6\u4e3a\u6574\u4e2a\u5730\u56fe\u3002\u91cd\u65b0\u6846\u67b6\u63d0\u9192\u6211\u4eec\uff0c\u793e\u4ea4\u5708\u6bd4\u4e00\u4e2a\u4e8b\u4ef6\u66f4\u5927\u3002","\u0939\u092e \u0905\u0915\u094d\u0938\u0930 \u090f\u0915 \u0938\u094d\u0928\u0948\u092a\u0936\u0949\u091f \u0915\u094b \u092a\u0942\u0930\u0940 \u092e\u093e\u0928\u091a\u093f\u0924\u094d\u0930 \u092e\u093e\u0928 \u0932\u0947\u0924\u0947 \u0939\u0948\u0902\u0964 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e\u090f\u0902 \u0939\u092e\u0947\u0902 \u092f\u093e\u0926 \u0926\u093f\u0932\u093e\u0924\u0940 \u0939\u0948\u0902 \u0915\u093f \u0938\u093e\u092e\u093e\u091c\u093f\u0915 \u0918\u0947\u0930\u0947 \u090f\u0915 \u0918\u091f\u0928\u093e \u0938\u0947 \u0915\u0939\u0940\u0902 \u092c\u0921\u093c\u0947 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964","Saepissime unum imaginem ut totam chartam tractamus. Reformationes nos admonent circulos sociales maiores esse quam unum eventum.","Spesso trattiamo una singola foto come l\u2019intera mappa. I reframe ci ricordano che i cerchi sociali sono pi\xf9 grandi di un singolo evento.","\u0645\u0627 \u0627\u063a\u0644\u0628 \u06cc\u06a9 \u0644\u062d\u0638\u0647 \u0631\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06a9\u0644 \u0646\u0642\u0634\u0647 \u062f\u0631 \u0646\u0638\u0631 \u0645\u06cc\u200c\u06af\u06cc\u0631\u06cc\u0645. \u0628\u0627\u0632\u0633\u0627\u0632\u06cc\u200c\u0647\u0627 \u0628\u0647 \u0645\u0627 \u06cc\u0627\u062f\u0622\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f \u06a9\u0647 \u062f\u0627\u06cc\u0631\u0647\u200c\u0647\u0627\u06cc \u0627\u062c\u062a\u0645\u0627\u0639\u06cc \u0628\u0632\u0631\u06af\u200c\u062a\u0631 \u0627\u0632 \u06cc\u06a9 \u0631\u0648\u06cc\u062f\u0627\u062f \u0648\u0627\u062d\u062f \u0647\u0633\u062a\u0646\u062f."],t.w)
