B.ac7=new A.d(B.c,["\u201cI am too sensitive.\u201d","\u201cSoy demasiado sensible.\u201d","\u201eIch bin zu empfindlich.\u201c","\xab Je suis trop sensible. \xbb","\u201c\u0623\u0646\u0627 \u062d\u0633\u0627\u0633 \u0644\u0644\u063a\u0627\u064a\u0629.\u201d","\u201c\ub098\ub294 \ub108\ubb34 \uc608\ubbfc\ud574.\u201d","\u201c\u6211\u592a\u654f\u611f\u4e86\u3002\u201d","\u201c\u092e\u0948\u0902 \u092c\u0939\u0941\u0924 \u0938\u0902\u0935\u0947\u0926\u0928\u0936\u0940\u0932 \u0939\u0942\u0901\u0964\u201d","\u201cSum nimis sensitiva.\u201d","\u201cSono troppo sensibile.\u201d","\u201c\u0645\u0646 \u062e\u06cc\u0644\u06cc \u062d\u0633\u0627\u0633 \u0647\u0633\u062a\u0645.\u201d"],t.w)
B.aaf=new A.d(B.c,["Automatic thought:\n\u201cIf I feel hurt easily, it means I am weak and broken.\u201d\n\nWhich reframe protects both truth and kindness?","Pensamiento autom\xe1tico:\n\u201cSi me duele f\xe1cilmente, significa que soy d\xe9bil y roto.\u201d\n\n\xbfCu\xe1l es el reencuadre que protege tanto la verdad como la amabilidad?","Automatischer Gedanke:\n\u201eWenn ich leicht verletzt bin, bedeutet das, dass ich schwach und zerbrochen bin.\u201c\n\nWelches Reframing sch\xfctzt sowohl die Wahrheit als auch die Freundlichkeit?","Pens\xe9e automatique :\n\u201cSi je me sens facilement bless\xe9, cela signifie que je suis faible et bris\xe9.\u201d\n\nQuel reformatage prot\xe8ge \xe0 la fois la v\xe9rit\xe9 et la bienveillance ?","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0625\u0630\u0627 \u0634\u0639\u0631\u062a \u0628\u0627\u0644\u0623\u0644\u0645 \u0628\u0633\u0647\u0648\u0644\u0629\u060c \u0641\u0647\u0630\u0627 \u064a\u0639\u0646\u064a \u0623\u0646\u0646\u064a \u0636\u0639\u064a\u0641 \u0648\u0645\u0643\u0633\u0648\u0631.\u201d\n\n\u0645\u0627 \u0647\u0648 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u0645\u064a \u0643\u0644\u0627\u064b \u0645\u0646 \u0627\u0644\u062d\u0642\u064a\u0642\u0629 \u0648\u0627\u0644\u0644\u0637\u0641\u061f","\uc790\ub3d9\uc801 \uc0ac\uace0:\n\u201c\ub0b4\uac00 \uc27d\uac8c \uc0c1\ucc98\ub97c \ubc1b\uc73c\uba74, \uadf8\uac83\uc740 \ub0b4\uac00 \uc57d\ud558\uace0 \ubd80\uc11c\uc84c\ub2e4\ub294 \ub73b\uc774\ub2e4.\u201d\n\n\uc5b4\ub5a4 \uc7ac\uad6c\uc131\uc774 \uc9c4\uc2e4\uacfc \uce5c\uc808\uc744 \ubaa8\ub450 \ubcf4\ud638\ud560\uae4c\uc694?","\u81ea\u52a8\u601d\u7ef4\uff1a\n\u201c\u5982\u679c\u6211\u5bb9\u6613\u53d7\u4f24\uff0c\u90a3\u610f\u5473\u7740\u6211\u8106\u5f31\u4e14\u7834\u788e\u3002\u201d\n\n\u54ea\u4e2a\u91cd\u65b0\u6846\u67b6\u80fd\u591f\u540c\u65f6\u4fdd\u62a4\u771f\u76f8\u548c\u5584\u610f\uff1f","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u0905\u0917\u0930 \u092e\u0948\u0902 \u091c\u0932\u094d\u0926\u0940 \u0906\u0939\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0942\u0901, \u0924\u094b \u0907\u0938\u0915\u093e \u092e\u0924\u0932\u092c \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0915\u092e\u091c\u094b\u0930 \u0914\u0930 \u091f\u0942\u091f\u093e \u0939\u0941\u0906 \u0939\u0942\u0901\u0964\u201d\n\n\u0915\u094c\u0928 \u0938\u093e \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u0938\u0924\u094d\u092f \u0914\u0930 \u0926\u092f\u093e\u0932\u0941\u0924\u093e \u0926\u094b\u0928\u094b\u0902 \u0915\u0940 \u0930\u0915\u094d\u0937\u093e \u0915\u0930\u0924\u093e \u0939\u0948?","Cogitatio automatica:\n\u201cSi facile laedor, significat me debilem esse et fractum.\u201d\n\nQuod reformatio utrumque veritatem et benignitatem tuetur?","Pensiero automatico:\n\u201cSe mi sento facilmente ferito, significa che sono debole e rotto.\u201d\n\nQuale riformulazione protegge sia la verit\xe0 che la gentilezza?","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0627\u06af\u0631 \u0645\u0646 \u0628\u0647 \u0631\u0627\u062d\u062a\u06cc \u0622\u0633\u06cc\u0628 \u0645\u06cc\u200c\u0628\u06cc\u0646\u0645\u060c \u0627\u06cc\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0639\u0646\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0645\u0646 \u0636\u0639\u06cc\u0641 \u0648 \u0634\u06a9\u0633\u062a\u0647 \u0647\u0633\u062a\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0647\u0645 \u062d\u0642\u06cc\u0642\u062a \u0648 \u0647\u0645 \u0645\u0647\u0631\u0628\u0627\u0646\u06cc \u0631\u0627 \u0645\u062d\u0627\u0641\u0638\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f\u061f"],t.w)
B.abs=new A.d(B.c,["\u201cFeelings are a design flaw; I should shut them off.\u201d","\u201cLos sentimientos son un defecto de dise\xf1o; debo apagarlos.\u201d","\u201eGef\xfchle sind ein Designfehler; ich sollte sie ausschalten.\u201c","\u201cLes sentiments sont un d\xe9faut de conception ; je devrais les \xe9teindre.\u201d","\u201c\u0627\u0644\u0645\u0634\u0627\u0639\u0631 \u0647\u064a \u0639\u064a\u0628 \u0641\u064a \u0627\u0644\u062a\u0635\u0645\u064a\u0645\u061b \u064a\u062c\u0628 \u0623\u0646 \u0623\u063a\u0644\u0642\u0647\u0627.\u201d","\u201c\uac10\uc815\uc740 \uc124\uacc4 \uacb0\ud568\uc774\ub2e4; \ub098\ub294 \uadf8\uac83\ub4e4\uc744 \uaebc\uc57c \ud55c\ub2e4.\u201d","\u201c\u60c5\u611f\u662f\u4e00\u79cd\u8bbe\u8ba1\u7f3a\u9677\uff1b\u6211\u5e94\u8be5\u5173\u95ed\u5b83\u4eec\u3002\u201d","\u201c\u092d\u093e\u0935\u0928\u093e\u090f\u0902 \u090f\u0915 \u0921\u093f\u091c\u093c\u093e\u0907\u0928 \u0926\u094b\u0937 \u0939\u0948\u0902; \u092e\u0941\u091d\u0947 \u0909\u0928\u094d\u0939\u0947\u0902 \u092c\u0902\u0926 \u0915\u0930 \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d","\u201cSentimentum est vitium consilii; eos exstinguere debeo.\u201d","\u201cI sentimenti sono un difetto di progettazione; dovrei spegnerli.\u201d","\u201c\u0627\u062d\u0633\u0627\u0633\u0627\u062a \u06cc\u06a9 \u0646\u0642\u0635 \u0637\u0631\u0627\u062d\u06cc \u0647\u0633\u062a\u0646\u062f\u061b \u0628\u0627\u06cc\u062f \u0622\u0646\u200c\u0647\u0627 \u0631\u0627 \u062e\u0627\u0645\u0648\u0634 \u06a9\u0646\u0645.\u201d"],t.w)
