B.ace=new A.d(B.c,["\u201cFeeling deeply can be a strength; I can learn how to care for that sensitivity instead of shaming it.\u201d","\u201cSentir profundamente puede ser una fortaleza; puedo aprender a cuidar esa sensibilidad en lugar de avergonzarme de ella.\u201d","\u201eTief zu f\xfchlen kann eine St\xe4rke sein; ich kann lernen, wie ich f\xfcr diese Sensibilit\xe4t sorge, anstatt sie zu besch\xe4men.\u201c","\u201cRessentir profond\xe9ment peut \xeatre une force ; je peux apprendre \xe0 prendre soin de cette sensibilit\xe9 au lieu de la honte.\u201d","\u201c\u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0639\u0645\u0642 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0642\u0648\u0629\u061b \u064a\u0645\u0643\u0646\u0646\u064a \u0623\u0646 \u0623\u062a\u0639\u0644\u0645 \u0643\u064a\u0641 \u0623\u0639\u062a\u0646\u064a \u0628\u062a\u0644\u0643 \u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0623\u0646 \u0623\u062e\u062c\u0644 \u0645\u0646\u0647\u0627.\u201d","\u201c\uae4a\uc774 \ub290\ub07c\ub294 \uac83\uc740 \ud798\uc774 \ub420 \uc218 \uc788\ub2e4; \ub098\ub294 \uadf8\uac83\uc744 \ubd80\ub044\ub7ec\uc6cc\ud558\ub294 \ub300\uc2e0 \uadf8 \ubbfc\uac10\uc131\uc744 \ub3cc\ubcf4\ub294 \ubc29\ubc95\uc744 \ubc30\uc6b8 \uc218 \uc788\ub2e4.\u201d","\u201c\u6df1\u523b\u7684\u611f\u53d7\u53ef\u4ee5\u662f\u4e00\u79cd\u529b\u91cf\uff1b\u6211\u53ef\u4ee5\u5b66\u4e60\u5982\u4f55\u7167\u987e\u8fd9\u79cd\u654f\u611f\u6027\uff0c\u800c\u4e0d\u662f\u7f9e\u803b\u5b83\u3002\u201d","\u201c\u0917\u0939\u0930\u0947 \u0905\u0928\u0941\u092d\u0935 \u0915\u0930\u0928\u093e \u090f\u0915 \u0924\u093e\u0915\u0924 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948; \u092e\u0948\u0902 \u0907\u0938\u0947 \u0936\u0930\u094d\u092e\u093f\u0902\u0926\u093e \u0915\u0930\u0928\u0947 \u0915\u0947 \u092c\u091c\u093e\u092f \u0909\u0938 \u0938\u0902\u0935\u0947\u0926\u0928\u0936\u0940\u0932\u0924\u093e \u0915\u093e \u0916\u094d\u092f\u093e\u0932 \u0930\u0916\u0928\u093e \u0938\u0940\u0916 \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cSentire alte potest esse virtus; possum discere curare illam sensum potius quam eam erubescere.\u201d","\u201cSentire profondamente pu\xf2 essere una forza; posso imparare a prendermi cura di quella sensibilit\xe0 invece di vergognarmene.\u201d","\u201c\u0627\u062d\u0633\u0627\u0633 \u0639\u0645\u06cc\u0642 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u06cc\u06a9 \u0642\u062f\u0631\u062a \u0628\u0627\u0634\u062f\u061b \u0645\u0646 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u06cc\u0627\u062f \u0628\u06af\u06cc\u0631\u0645 \u06a9\u0647 \u0686\u06af\u0648\u0646\u0647 \u0627\u0632 \u0622\u0646 \u062d\u0633\u0627\u0633\u06cc\u062a \u0645\u0631\u0627\u0642\u0628\u062a \u06a9\u0646\u0645 \u0628\u0647 \u062c\u0627\u06cc \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0632 \u0622\u0646 \u0634\u0631\u0645\u0646\u062f\u0647 \u0634\u0648\u0645.\u201d"],t.w)
