B.acb=new A.d(B.c,["\u201cIf I am sensitive, I get a free pass to avoid all responsibility.\u201d","\u201cSi soy sensible, tengo pase libre para evitar toda responsabilidad.\u201d","\u201eWenn ich sensibel bin, habe ich ein Freifahrtschein, um alle Verantwortung zu vermeiden.\u201c","\u201cSi je suis sensible, j\u2019ai un laissez-passer pour \xe9viter toute responsabilit\xe9.\u201d","\u201c\u0625\u0630\u0627 \u0643\u0646\u062a \u062d\u0633\u0627\u0633\u064b\u0627\u060c \u0641\u0623\u0646\u0627 \u0623\u062d\u0635\u0644 \u0639\u0644\u0649 \u0625\u0639\u0641\u0627\u0621 \u0645\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u0633\u0624\u0648\u0644\u064a\u0627\u062a.\u201d","\u201c\ub0b4\uac00 \ubbfc\uac10\ud558\ub2e4\uba74, \ubaa8\ub4e0 \ucc45\uc784\uc744 \ud53c\ud560 \uc218 \uc788\ub2e4.\u201d","\u201c\u5982\u679c\u6211\u5f88\u654f\u611f\uff0c\u6211\u5c31\u53ef\u4ee5\u907f\u5f00\u6240\u6709\u8d23\u4efb\u3002\u201d","\u201c\u0905\u0917\u0930 \u092e\u0948\u0902 \u0938\u0902\u0935\u0947\u0926\u0928\u0936\u0940\u0932 \u0939\u0942\u0901, \u0924\u094b \u092e\u0941\u091d\u0947 \u0938\u092d\u0940 \u091c\u093f\u092e\u094d\u092e\u0947\u0926\u093e\u0930\u093f\u092f\u094b\u0902 \u0938\u0947 \u092c\u091a\u0928\u0947 \u0915\u093e \u090f\u0915 \u092e\u0941\u092b\u094d\u0924 \u092a\u093e\u0938 \u092e\u093f\u0932 \u091c\u093e\u0924\u093e \u0939\u0948\u0964\u201d","\u201cSi sensitiva sum, libellum impunitatis habeo ut omnem responsabilitatem vitarem.\u201d","\u201cSe sono sensibile, ottengo un pass gratuito per evitare ogni responsabilit\xe0.\u201d","\u201c\u0627\u06af\u0631 \u0645\u0646 \u062d\u0633\u0627\u0633 \u0628\u0627\u0634\u0645\u060c \u0628\u0631\u0627\u06cc \u0627\u062c\u062a\u0646\u0627\u0628 \u0627\u0632 \u062a\u0645\u0627\u0645 \u0645\u0633\u0626\u0648\u0644\u06cc\u062a\u200c\u0647\u0627 \u06a9\u0627\u0631\u062a \u0645\u0639\u0627\u0641\u06cc\u062a \u062f\u0627\u0631\u0645.\u201d"],t.w)
