B.adQ=new A.d(B.c,["Sensitivity is not a defect; it is a trait that needs skills and boundaries, not self-hate.","La sensibilidad no es un defecto; es un rasgo que necesita habilidades y l\xedmites, no auto-odio.","Sensibilit\xe4t ist kein Mangel; es ist eine Eigenschaft, die F\xe4higkeiten und Grenzen erfordert, nicht Selbsthass.","La sensibilit\xe9 n\u2019est pas un d\xe9faut ; c\u2019est une caract\xe9ristique qui n\xe9cessite des comp\xe9tences et des limites, pas de l\u2019auto-haine.","\u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629 \u0644\u064a\u0633\u062a \u0639\u064a\u0628\u064b\u0627\u061b \u0625\u0646\u0647\u0627 \u0633\u0645\u0629 \u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u0645\u0647\u0627\u0631\u0627\u062a \u0648\u062d\u062f\u0648\u062f\u060c \u0648\u0644\u064a\u0633 \u0643\u0631\u0627\u0647\u064a\u0629 \u0627\u0644\u0630\u0627\u062a.","\ubbfc\uac10\uc131\uc740 \uacb0\ud568\uc774 \uc544\ub2c8\ub2e4; \uadf8\uac83\uc740 \uae30\uc220\uacfc \uacbd\uacc4\uac00 \ud544\uc694\ud55c \ud2b9\uc131\uc774\uc9c0, \uc790\uc544\ud610\uc624\uac00 \uc544\ub2c8\ub2e4.","\u654f\u611f\u6027\u4e0d\u662f\u7f3a\u9677\uff1b\u5b83\u662f\u4e00\u79cd\u9700\u8981\u6280\u80fd\u548c\u754c\u9650\u7684\u7279\u5f81\uff0c\u800c\u4e0d\u662f\u81ea\u6211\u618e\u6068\u3002","\u0938\u0902\u0935\u0947\u0926\u0928\u0936\u0940\u0932\u0924\u093e \u090f\u0915 \u0926\u094b\u0937 \u0928\u0939\u0940\u0902 \u0939\u0948; \u092f\u0939 \u090f\u0915 \u0935\u093f\u0936\u0947\u0937\u0924\u093e \u0939\u0948 \u091c\u093f\u0938\u0947 \u0915\u094c\u0936\u0932 \u0914\u0930 \u0938\u0940\u092e\u093e\u0913\u0902 \u0915\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948, \u0906\u0924\u094d\u092e-\u0918\u0943\u0923\u093e \u0928\u0939\u0940\u0902\u0964","Sensitivitas non est vitium; est proprium quod artes et fines requirit, non sui odium.","La sensibilit\xe0 non \xe8 un difetto; \xe8 una caratteristica che necessita di abilit\xe0 e confini, non di auto-odio.","\u062d\u0633\u0627\u0633\u06cc\u062a \u0646\u0642\u0635 \u0646\u06cc\u0633\u062a\u061b \u0627\u06cc\u0646 \u06cc\u06a9 \u0648\u06cc\u0698\u06af\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0628\u0647 \u0645\u0647\u0627\u0631\u062a\u200c\u0647\u0627 \u0648 \u0645\u0631\u0632\u0647\u0627 \u0646\u06cc\u0627\u0632 \u062f\u0627\u0631\u062f\u060c \u0646\u0647 \u062a\u0646\u0641\u0631 \u0627\u0632 \u062e\u0648\u062f."],t.w)
