B.acV=new A.d(B.c,["\u201cIt is too late for me.\u201d","\u201cYa es demasiado tarde para m\xed.\u201d","\u201eEs ist zu sp\xe4t f\xfcr mich.\u201c","\xab Il est trop tard pour moi. \xbb","\u201c\u0644\u0642\u062f \u0641\u0627\u062a \u0627\u0644\u0623\u0648\u0627\u0646 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u064a.\u201d","\u201c\ub098\uc5d0\uac8c\ub294 \ub108\ubb34 \ub2a6\uc5c8\uc5b4.\u201d","\u201c\u5bf9\u6211\u6765\u8bf4\u5df2\u7ecf\u592a\u665a\u4e86\u3002\u201d","\u201c\u092e\u0947\u0930\u0947 \u0932\u093f\u090f \u0905\u092c \u092c\u0939\u0941\u0924 \u0926\u0947\u0930 \u0939\u094b \u091a\u0941\u0915\u0940 \u0939\u0948\u0964\u201d","\u201cTarde est mihi.\u201d","\u201c\xc8 troppo tardi per me.\u201d","\u201c\u0628\u0631\u0627\u06cc \u0645\u0646 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0634\u062f\u0647 \u0627\u0633\u062a.\u201d"],t.w)
B.abJ=new A.d(B.c,["Automatic thought:\n\u201cI wasted so much time; it is too late to start anything new.\u201d\n\nChoose the reframe that opens at least a small door.","Pensamiento autom\xe1tico:\n\u201cPerd\xed tanto tiempo; es demasiado tarde para comenzar algo nuevo.\u201d\n\nElige el reencuadre que al menos abre una peque\xf1a puerta.","Automatischer Gedanke:\n\u201eIch habe so viel Zeit verschwendet; es ist zu sp\xe4t, um etwas Neues zu beginnen.\u201c\n\nW\xe4hle das Reframing, das zumindest eine kleine T\xfcr \xf6ffnet.","Pens\xe9e automatique :\n\u201cJ\u2019ai perdu tellement de temps ; il est trop tard pour commencer quelque chose de nouveau.\u201d\n\nChoisissez le reformatage qui ouvre au moins une petite porte.","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0644\u0642\u062f \u0623\u0636\u0639\u062a \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0648\u0642\u062a\u061b \u0641\u0627\u062a \u0627\u0644\u0623\u0648\u0627\u0646 \u0644\u0628\u062f\u0621 \u0634\u064a\u0621 \u062c\u062f\u064a\u062f.\u201d\n\n\u0627\u062e\u062a\u0631 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u062a\u064a \u062a\u0641\u062a\u062d \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0628\u0627\u0628\u064b\u0627 \u0635\u063a\u064a\u0631\u064b\u0627.","\uc790\ub3d9\uc801 \uc0ac\uace0:\n\u201c\ub098\ub294 \ub108\ubb34 \ub9ce\uc740 \uc2dc\uac04\uc744 \ub0ad\ube44\ud588\ub2e4; \uc774\uc81c \uc0c8\ub85c\uc6b4 \uac83\uc744 \uc2dc\uc791\ud558\uae30\uc5d0\ub294 \ub108\ubb34 \ub2a6\uc5c8\ub2e4.\u201d\n\n\uc801\uc5b4\ub3c4 \uc791\uc740 \ubb38\uc744 \uc5ec\ub294 \uc7ac\uad6c\uc131\uc744 \uc120\ud0dd\ud558\uc2ed\uc2dc\uc624.","\u81ea\u52a8\u601d\u7ef4\uff1a\n\u201c\u6211\u6d6a\u8d39\u4e86\u592a\u591a\u65f6\u95f4\uff1b\u73b0\u5728\u5f00\u59cb\u4efb\u4f55\u65b0\u4e8b\u7269\u90fd\u592a\u665a\u4e86\u3002\u201d\n\n\u9009\u62e9\u4e00\u4e2a\u81f3\u5c11\u6253\u5f00\u4e00\u6247\u5c0f\u95e8\u7684\u91cd\u65b0\u6846\u67b6\u3002","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u092c\u0939\u0941\u0924 \u0938\u092e\u092f \u092c\u0930\u094d\u092c\u093e\u0926 \u0915\u093f\u092f\u093e; \u0905\u092c \u0915\u0941\u091b \u0928\u092f\u093e \u0936\u0941\u0930\u0942 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092c\u0939\u0941\u0924 \u0926\u0947\u0930 \u0939\u094b \u091a\u0941\u0915\u0940 \u0939\u0948\u0964\u201d\n\n\u0935\u0939 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u091a\u0941\u0928\u0947\u0902 \u091c\u094b \u0915\u092e \u0938\u0947 \u0915\u092e \u090f\u0915 \u091b\u094b\u091f\u093e \u0926\u0930\u0935\u093e\u091c\u093e \u0916\u094b\u0932\u0947\u0964","Cogitatio automatica:\n\u201cTam multum tempus perdidi; nunc iam nimis sero est quidquam novum incipere.\u201d\n\nElige reformatio quod saltem parvam portam aperiat.","Pensiero automatico:\n\u201cHo sprecato cos\xec tanto tempo; \xe8 troppo tardi per iniziare qualcosa di nuovo.\u201d\n\nScegli la riformulazione che apre almeno una piccola porta.","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0632\u0645\u0627\u0646 \u0632\u06cc\u0627\u062f\u06cc \u0631\u0627 \u0647\u062f\u0631 \u062f\u0627\u062f\u0645\u061b \u062f\u06cc\u06af\u0631 \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0634\u062f\u0647 \u0627\u0633\u062a \u06a9\u0647 \u0686\u06cc\u0632\u06cc \u062c\u062f\u06cc\u062f \u0634\u0631\u0648\u0639 \u06a9\u0646\u0645.\u201d\n\n\u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u062d\u062f\u0627\u0642\u0644 \u06cc\u06a9 \u062f\u0631 \u06a9\u0648\u0686\u06a9 \u0631\u0627 \u0628\u0627\u0632 \u06a9\u0646\u062f."],t.w)
B.abM=new A.d(B.c,["\u201cYes, it is too late; I should not attempt anything.\u201d","\u201cS\xed, es demasiado tarde; no deber\xeda intentar nada.\u201d","\u201eJa, es ist zu sp\xe4t; ich sollte nichts mehr versuchen.\u201c","\u201cOui, il est trop tard ; je ne devrais rien essayer.\u201d","\u201c\u0646\u0639\u0645\u060c \u0644\u0642\u062f \u0641\u0627\u062a \u0627\u0644\u0623\u0648\u0627\u0646\u061b \u064a\u062c\u0628 \u0623\u0644\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u064a \u0634\u064a\u0621.\u201d","\u201c\ub124, \ub108\ubb34 \ub2a6\uc5c8\uc5b4; \ub098\ub294 \uc544\ubb34\uac83\ub3c4 \uc2dc\ub3c4\ud558\uc9c0 \ub9d0\uc544\uc57c \ud574.\u201d","\u201c\u662f\u7684\uff0c\u5df2\u7ecf\u592a\u665a\u4e86\uff1b\u6211\u4e0d\u5e94\u8be5\u5c1d\u8bd5\u4efb\u4f55\u4e8b\u60c5\u3002\u201d","\u201c\u0939\u093e\u0902, \u0905\u092c \u092c\u0939\u0941\u0924 \u0926\u0947\u0930 \u0939\u094b \u091a\u0941\u0915\u0940 \u0939\u0948; \u092e\u0941\u091d\u0947 \u0915\u0941\u091b \u092d\u0940 \u092a\u094d\u0930\u092f\u093e\u0938 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d","\u201cIta est, nimis sero est; nihil conari debeo.\u201d","\u201cS\xec, \xe8 troppo tardi; non dovrei provare nulla.\u201d","\u201c\u0628\u0644\u0647\u060c \u062e\u06cc\u0644\u06cc \u062f\u06cc\u0631 \u0634\u062f\u0647 \u0627\u0633\u062a\u061b \u0645\u0646 \u0646\u0628\u0627\u06cc\u062f \u0686\u06cc\u0632\u06cc \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u0645.\u201d"],t.w)
