B.a8J=new A.d(B.c,["\u201cI cannot change past years, but I can influence what I do with the next month or year.\u201d","\u201cNo puedo cambiar los a\xf1os pasados, pero puedo influir en lo que haga con el pr\xf3ximo mes o a\xf1o.\u201d","\u201eIch kann die vergangenen Jahre nicht \xe4ndern, aber ich kann beeinflussen, was ich im n\xe4chsten Monat oder Jahr tue.\u201c","\u201cJe ne peux pas changer les ann\xe9es pass\xe9es, mais je peux influencer ce que je ferai avec le prochain mois ou l\u2019ann\xe9e \xe0 venir.\u201d","\u201c\u0645\u0646 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0633\u0627\u0644\u200c\u0647\u0627\u06cc \u06af\u0630\u0634\u062a\u0647 \u0631\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0647\u0645\u060c \u0627\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0628\u0631 \u0622\u0646\u0686\u0647 \u062f\u0631 \u0645\u0627\u0647 \u06cc\u0627 \u0633\u0627\u0644 \u0622\u06cc\u0646\u062f\u0647 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u200c\u062f\u0647\u0645 \u062a\u0623\u062b\u06cc\u0631 \u0628\u06af\u0630\u0627\u0631\u0645.\u201d","\u201c\ub098\ub294 \uc9c0\ub09c \uba87 \ub144\uc744 \ubc14\uafc0 \uc218 \uc5c6\uc9c0\ub9cc, \ub2e4\uc74c \ud55c \ub2ec \ub610\ub294 1\ub144\uc5d0 \ubb34\uc5c7\uc744 \ud560\uc9c0\uc5d0 \uc601\ud5a5\uc744 \uc904 \uc218 \uc788\ub2e4.\u201d","\u201c\u6211\u65e0\u6cd5\u6539\u53d8\u8fc7\u53bb\u7684\u51e0\u5e74\uff0c\u4f46\u6211\u53ef\u4ee5\u5f71\u54cd\u63a5\u4e0b\u6765\u4e00\u4e2a\u6708\u6216\u4e00\u5e74\u7684\u4e8b\u60c5\u3002\u201d","\u201c\u092e\u0948\u0902 \u092a\u093f\u091b\u0932\u0947 \u0938\u093e\u0932\u094b\u0902 \u0915\u094b \u092c\u0926\u0932 \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e, \u0932\u0947\u0915\u093f\u0928 \u092e\u0948\u0902 \u0905\u0917\u0932\u0947 \u092e\u0939\u0940\u0928\u0947 \u092f\u093e \u0938\u093e\u0932 \u092e\u0947\u0902 \u091c\u094b \u0915\u0930\u0924\u093e \u0939\u0942\u0901 \u0909\u0938\u0947 \u092a\u094d\u0930\u092d\u093e\u0935\u093f\u0924 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964\u201d","\u201cNon possum mutare annos praeteritos, sed possum afficere quid faciam cum proxime mense vel anno.\u201d","\u201cNon posso cambiare gli anni passati, ma posso influenzare quello che far\xf2 con il prossimo mese o anno.\u201d","\u201c\u0645\u0646 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0633\u0627\u0644\u200c\u0647\u0627\u06cc \u06af\u0630\u0634\u062a\u0647 \u0631\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0647\u0645\u060c \u0627\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u062a\u0623\u062b\u06cc\u0631 \u0628\u06af\u0630\u0627\u0631\u0645 \u06a9\u0647 \u062f\u0631 \u0645\u0627\u0647 \u06cc\u0627 \u0633\u0627\u0644 \u0622\u06cc\u0646\u062f\u0647 \u0686\u0647 \u06a9\u0627\u0631 \u06a9\u0646\u0645.\u201d"],t.w)
