B.acy=new A.d(B.c,["\u201cTime is fake; I will ignore everything and everyone.\u201d","\u201cEl tiempo es falso; ignorar\xe9 todo y a todos.\u201d","\u201eZeit ist Fake; ich werde alles und jeden ignorieren.\u201c","\u201cLe temps est faux ; je vais ignorer tout et tout le monde.\u201d","\u201c\u0627\u0644\u0648\u0642\u062a \u0632\u0627\u0626\u0641\u061b \u0633\u0623\u062a\u062c\u0627\u0647\u0644 \u0643\u0644 \u0634\u064a\u0621 \u0648\u0643\u0644 \u0634\u062e\u0635.\u201d","\u201c\uc2dc\uac04\uc740 \uac00\uc9dc\ub2e4; \ub098\ub294 \ubaa8\ub4e0 \uac83\uacfc \ubaa8\ub4e0 \uc0ac\ub78c\uc744 \ubb34\uc2dc\ud560 \uac83\uc774\ub2e4.\u201d","\u201c\u65f6\u95f4\u662f\u5047\u7684\uff1b\u6211\u5c06\u5ffd\u89c6\u4e00\u5207\u548c\u6bcf\u4e00\u4e2a\u4eba\u3002\u201d","\u201c\u0938\u092e\u092f \u0928\u0915\u0932\u0940 \u0939\u0948; \u092e\u0948\u0902 \u0938\u092c \u0915\u0941\u091b \u0914\u0930 \u0938\u092d\u0940 \u0915\u094b \u0928\u091c\u0930\u0905\u0902\u0926\u093e\u091c \u0915\u0930\u0942\u0901\u0917\u093e\u0964\u201d","\u201cTempus falsum est; omnia et omnes neglegam.\u201d","\u201cIl tempo \xe8 falso; ignorer\xf2 tutto e tutti.\u201d","\u201c\u0632\u0645\u0627\u0646 \u062a\u0642\u0644\u0628\u06cc \u0627\u0633\u062a\u061b \u0645\u0646 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0648 \u0647\u0645\u0647 \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0645\u06cc\u200c\u06af\u06cc\u0631\u0645.\u201d"],t.w)
