B.a9k=new A.d(B.c,["A helpful reframe doesn\u2019t pretend time was not lost; it simply reminds you that change is still possible from today.","Un reencuadre \xfatil no finge que el tiempo no se ha perdido; simplemente te recuerda que el cambio a\xfan es posible desde hoy.","Ein hilfreiches Reframing tut nicht so, als ob keine Zeit verloren w\xe4re; es erinnert dich einfach daran, dass Ver\xe4nderung noch heute m\xf6glich ist.","Un bon reformatage ne fait pas semblant que le temps n\u2019a pas \xe9t\xe9 perdu ; il vous rappelle simplement que le changement est encore possible d\xe8s aujourd\u2019hui.","\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u0645\u0641\u064a\u062f\u0629 \u0644\u0627 \u062a\u062f\u0639\u064a \u0623\u0646 \u0627\u0644\u0648\u0642\u062a \u0644\u0645 \u064a\u064f\u0641\u0642\u062f\u061b \u0628\u0628\u0633\u0627\u0637\u0629 \u062a\u0630\u0643\u0631\u0643 \u0623\u0646 \u0627\u0644\u062a\u063a\u064a\u064a\u0631 \u0644\u0627 \u064a\u0632\u0627\u0644 \u0645\u0645\u0643\u0646\u064b\u0627 \u0645\u0646 \u0627\u0644\u064a\u0648\u0645.","\uc720\uc6a9\ud55c \uc7ac\uad6c\uc131\uc740 \uc2dc\uac04\uc774 \ub0ad\ube44\ub418\uc9c0 \uc54a\uc558\ub2e4\uace0 \uac00\uc7a5\ud558\uc9c0 \uc54a\ub294\ub2e4. \uadf8\uac83\uc740 \ub2e8\uc21c\ud788 \uc624\ub298\ubd80\ud130 \ubcc0\ud654\uac00 \uc5ec\uc804\ud788 \uac00\ub2a5\ud558\ub2e4\uace0 \uc0c1\uae30\uc2dc\ucf1c\uc900\ub2e4.","\u6709\u7528\u7684\u91cd\u65b0\u6846\u67b6\u4e0d\u4f1a\u5047\u88c5\u65f6\u95f4\u6ca1\u6709\u6d6a\u8d39\uff1b\u5b83\u53ea\u662f\u7b80\u5355\u5730\u63d0\u9192\u4f60\uff0c\u4ece\u4eca\u5929\u5f00\u59cb\uff0c\u53d8\u5316\u4ecd\u7136\u662f\u53ef\u80fd\u7684\u3002","\u090f\u0915 \u0938\u0939\u093e\u092f\u0915 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u092f\u0939 \u0928\u0939\u0940\u0902 \u092e\u093e\u0928\u0924\u0940 \u0915\u093f \u0938\u092e\u092f \u092c\u0930\u094d\u092c\u093e\u0926 \u0928\u0939\u0940\u0902 \u0939\u0941\u0906; \u092f\u0939 \u092c\u0938 \u0906\u092a\u0915\u094b \u092f\u093e\u0926 \u0926\u093f\u0932\u093e\u0924\u0940 \u0939\u0948 \u0915\u093f \u0906\u091c \u0938\u0947 \u092c\u0926\u0932\u093e\u0935 \u0905\u092d\u0940 \u092d\u0940 \u0938\u0902\u092d\u0935 \u0939\u0948\u0964","Reformatio utilis non simulans tempus amissum non fuisse; simpliciter te monet mutationem adhuc ab hodie possibilem esse.","Una riformulazione utile non fa finta che il tempo non sia stato perso; semplicemente ti ricorda che il cambiamento \xe8 ancora possibile da oggi.","\u06cc\u06a9 \u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0645\u0641\u06cc\u062f \u0627\u062f\u0639\u0627 \u0646\u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0632\u0645\u0627\u0646 \u0647\u062f\u0631 \u0646\u0631\u0641\u062a\u0647 \u0627\u0633\u062a\u061b \u062a\u0646\u0647\u0627 \u0628\u0647 \u0634\u0645\u0627 \u06cc\u0627\u062f\u0622\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u0647\u0646\u0648\u0632 \u0627\u0632 \u0627\u0645\u0631\u0648\u0632 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a."],t.w)
