B.aaX=new A.d(B.c,["\u201cI missed the opportunity.\u201d","\u201cPerd\xed la oportunidad.\u201d","\u201eIch habe die Gelegenheit verpasst.\u201c","\xab J\u2019ai rat\xe9 l\u2019opportunit\xe9. \xbb","\u201c\u0644\u0642\u062f \u0641\u0627\u062a\u062a\u0646\u064a \u0627\u0644\u0641\u0631\u0635\u0629.\u201d","\u201c\uae30\ud68c\ub97c \ub193\ucce4\ub2e4.\u201d","\u201c\u6211\u9519\u8fc7\u4e86\u673a\u4f1a\u3002\u201d","\u201c\u092e\u0948\u0902\u0928\u0947 \u0905\u0935\u0938\u0930 \u0917\u0935\u093e \u0926\u093f\u092f\u093e\u0964\u201d","\u201cOccasione amissa est.\u201d","\u201cHo perso l\u2019opportunit\xe0.\u201d","\u201c\u0645\u0646 \u0641\u0631\u0635\u062a \u0631\u0627 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0645.\u201d"],t.w)
B.aex=new A.d(B.c,["Automatic thought:\n\u201cI missed the opportunity to apply for that job. It\u2019s over for me.\u201d\n\nChoose the most balanced reframe.","Pensamiento autom\xe1tico:\n\u201cPerd\xed la oportunidad de postularme para ese trabajo. Ya termin\xf3 para m\xed.\u201d\n\nElige el reencuadre m\xe1s equilibrado.","Automatischer Gedanke:\n\u201eIch habe die Gelegenheit verpasst, mich f\xfcr diesen Job zu bewerben. Es ist vorbei f\xfcr mich.\u201c\n\nW\xe4hle das ausgewogenste Reframing.","Pens\xe9e automatique :\n\u201cJ\u2019ai rat\xe9 l\u2019opportunit\xe9 de postuler pour ce travail. C\u2019est fini pour moi.\u201d\n\nChoisissez le reformatage le plus \xe9quilibr\xe9.","\u0627\u0644\u0641\u0643\u0631\u0629 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629:\n\u201c\u0644\u0642\u062f \u0641\u0627\u062a\u062a\u0646\u064a \u0627\u0644\u0641\u0631\u0635\u0629 \u0644\u0644\u062a\u0642\u062f\u0645 \u0644\u062a\u0644\u0643 \u0627\u0644\u0648\u0638\u064a\u0641\u0629. \u0627\u0646\u062a\u0647\u0649 \u0627\u0644\u0623\u0645\u0631 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u064a.\u201d\n\n\u0627\u062e\u062a\u0631 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u0623\u0643\u062b\u0631 \u062a\u0648\u0627\u0632\u0646\u0627\u064b.","\uc790\ub3d9\uc801 \uc0ac\uace0:\n\u201c\uadf8 \uc9c1\uc7a5\uc5d0 \uc9c0\uc6d0\ud560 \uae30\ud68c\ub97c \ub193\ucce4\ub2e4. \uc774\uc81c \ub098\uc5d0\uac8c\ub294 \ub05d\ub0ac\ub2e4.\u201d\n\n\uac00\uc7a5 \uade0\ud615 \uc7a1\ud78c \uc7ac\uad6c\uc131\uc744 \uc120\ud0dd\ud558\uc2ed\uc2dc\uc624.","\u81ea\u52a8\u601d\u7ef4\uff1a\n\u201c\u6211\u9519\u8fc7\u4e86\u7533\u8bf7\u90a3\u4efd\u5de5\u4f5c\u7684\u673a\u4f1a\u3002\u5bf9\u6211\u6765\u8bf4\u4e00\u5207\u90fd\u7ed3\u675f\u4e86\u3002\u201d\n\n\u9009\u62e9\u6700\u5e73\u8861\u7684\u91cd\u65b0\u6846\u67b6\u3002","\u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0909\u0938 \u0928\u094c\u0915\u0930\u0940 \u0915\u0947 \u0932\u093f\u090f \u0906\u0935\u0947\u0926\u0928 \u0915\u0930\u0928\u0947 \u0915\u093e \u0905\u0935\u0938\u0930 \u0916\u094b \u0926\u093f\u092f\u093e\u0964 \u092e\u0947\u0930\u0947 \u0932\u093f\u090f \u0938\u092c \u0915\u0941\u091b \u0916\u0924\u094d\u092e \u0939\u094b \u0917\u092f\u093e \u0939\u0948\u0964\u201d\n\n\u0938\u092c\u0938\u0947 \u0938\u0902\u0924\u0941\u0932\u093f\u0924 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u091a\u0941\u0928\u0947\u0902\u0964","Cogitatio automatica:\n\u201cOccasione amissa est ad hoc officium applicandum. Mihi finitum est.\u201d\n\nElige reformatio aequilibratissima.","Pensiero automatico:\n\u201cHo perso l\u2019opportunit\xe0 di candidarmi per quel lavoro. \xc8 finita per me.\u201d\n\nScegli la riformulazione pi\xf9 equilibrata.","\u0641\u06a9\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631:\n\u201c\u0641\u0631\u0635\u062a \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0628\u0631\u0627\u06cc \u0622\u0646 \u0634\u063a\u0644 \u0631\u0627 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0645. \u0628\u0631\u0627\u06cc \u0645\u0646 \u062a\u0645\u0627\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a.\u201d\n\n\u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0645\u062a\u0639\u0627\u062f\u0644\u200c\u062a\u0631\u06cc\u0646 \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f."],t.w)
