B.a7K=new A.d(B.c,["A helpful reframe doesn\u2019t ignore missed opportunities but reminds you that there are always new chances to try again.","Un reencuadre \xfatil no ignora las oportunidades perdidas, sino que te recuerda que siempre hay nuevas oportunidades para volver a intentarlo.","Ein hilfreiches Reframing ignoriert verpasste Chancen nicht, sondern erinnert dich daran, dass es immer neue M\xf6glichkeiten gibt, es noch einmal zu versuchen.","Un bon reformatage ne n\xe9glige pas les opportunit\xe9s manqu\xe9es, mais vous rappelle qu\u2019il y a toujours de nouvelles chances d\u2019essayer \xe0 nouveau.","\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0635\u064a\u0627\u063a\u0629 \u0627\u0644\u0645\u0641\u064a\u062f\u0629 \u0644\u0627 \u062a\u062a\u062c\u0627\u0647\u0644 \u0627\u0644\u0641\u0631\u0635 \u0627\u0644\u0636\u0627\u0626\u0639\u0629\u060c \u0628\u0644 \u062a\u0630\u0643\u0631\u0643 \u0623\u0646\u0647 \u062a\u0648\u062c\u062f \u062f\u0627\u0626\u0645\u064b\u0627 \u0641\u0631\u0635 \u062c\u062f\u064a\u062f\u0629 \u0644\u062a\u062c\u0631\u0628\u0629 \u0634\u064a\u0621 \u0622\u062e\u0631.","\uc720\uc6a9\ud55c \uc7ac\uad6c\uc131\uc740 \ub193\uce5c \uae30\ud68c\ub97c \ubb34\uc2dc\ud558\uc9c0 \uc54a\uace0, \ud56d\uc0c1 \ub2e4\uc2dc \uc2dc\ub3c4\ud560 \uc218 \uc788\ub294 \uc0c8\ub85c\uc6b4 \uae30\ud68c\uac00 \uc788\ub2e4\ub294 \uac83\uc744 \uc0c1\uae30\uc2dc\ucf1c\uc90d\ub2c8\ub2e4.","\u6709\u7528\u7684\u91cd\u65b0\u6846\u67b6\u4e0d\u4f1a\u5ffd\u7565\u9519\u8fc7\u7684\u673a\u4f1a\uff0c\u800c\u662f\u63d0\u9192\u4f60\u603b\u6709\u65b0\u7684\u673a\u4f1a\u53ef\u4ee5\u91cd\u65b0\u5c1d\u8bd5\u3002","\u090f\u0915 \u0938\u0939\u093e\u092f\u0915 \u092a\u0941\u0928\u0930\u094d\u092a\u0930\u093f\u092d\u093e\u0937\u093e \u0916\u094b\u0908 \u0939\u0941\u0908 \u0905\u0935\u0938\u0930\u094b\u0902 \u0915\u094b \u0928\u091c\u093c\u0930\u0905\u0902\u0926\u093e\u091c\u093c \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0940, \u092c\u0932\u094d\u0915\u093f \u092f\u0939 \u092f\u093e\u0926 \u0926\u093f\u0932\u093e\u0924\u0940 \u0939\u0948 \u0915\u093f \u0939\u092e\u0947\u0936\u093e \u0928\u0908 \u0915\u094b\u0936\u093f\u0936 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0928\u090f \u092e\u094c\u0915\u0947 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964","Reformatio utilis non neglectas occasiones ignorat, sed monet te semper novas opportunitates esse ut iterum coneris.","Una riformulazione utile non ignora le opportunit\xe0 perse, ma ti ricorda che ci sono sempre nuove occasioni per riprovare.","\u06cc\u06a9 \u0628\u0627\u0632\u0633\u0627\u0632\u06cc \u0645\u0641\u06cc\u062f \u0641\u0631\u0635\u062a\u200c\u0647\u0627\u06cc \u0627\u0632 \u062f\u0633\u062a \u0631\u0641\u062a\u0647 \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0646\u0645\u06cc\u200c\u06af\u06cc\u0631\u062f\u060c \u0628\u0644\u06a9\u0647 \u0628\u0647 \u0634\u0645\u0627 \u06cc\u0627\u062f\u0622\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0634\u0627\u0646\u0633\u200c\u0647\u0627\u06cc \u062c\u062f\u06cc\u062f\u06cc \u0628\u0631\u0627\u06cc \u0627\u0645\u062a\u062d\u0627\u0646 \u062f\u0648\u0628\u0627\u0631\u0647 \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f."],t.w)
