B.a8n=new A.d(B.c,["You imagine a version of you one year from now writing you a postcard.\nYour week has been messy and full of small failures.\n\nWhich message fits a supportive \u201cFuture Me\u201d?","Imaginas una versi\xf3n de ti dentro de un a\xf1o escribi\xe9ndote una postal.\nTu semana ha sido desordenada y llena de peque\xf1os fracasos.\n\n\xbfQu\xe9 mensaje encajar\xeda con un \u201cFuturo yo\u201d que te apoya?","Du stellst dir eine Version von dir vor, die in einem Jahr dir eine Postkarte schreibt.\nDeine Woche war chaotisch und voller kleiner Misserfolge.\n\nWelche Nachricht passt zu einem unterst\xfctzenden \u201eZuk\xfcnftigen Ich\u201c?","Tu imagines une version de toi dans un an t\u2019\xe9crivant une carte postale.\nTa semaine a \xe9t\xe9 chaotique et pleine de petits \xe9checs.\n\nQuel message correspondrait \xe0 un \u201cFutur moi\u201d qui te soutient ?","\u062a\u062a\u062e\u064a\u0644 \u0646\u0633\u062e\u0629 \u0645\u0646\u0643 \u0628\u0639\u062f \u0639\u0627\u0645 \u064a\u0643\u062a\u0628 \u0644\u0643 \u0628\u0637\u0627\u0642\u0629 \u0628\u0631\u064a\u062f\u064a\u0629.\n\u0644\u0642\u062f \u0643\u0627\u0646 \u0623\u0633\u0628\u0648\u0639\u0643 \u0641\u0648\u0636\u0648\u064a\u064b\u0627 \u0648\u0645\u0644\u064a\u0626\u064b\u0627 \u0628\u0627\u0644\u0625\u062e\u0641\u0627\u0642\u0627\u062a \u0627\u0644\u0635\u063a\u064a\u0631\u0629.\n\n\u0623\u064a \u0631\u0633\u0627\u0644\u0629 \u062a\u0646\u0627\u0633\u0628 \u201c\u0623\u0646\u0627 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u201d \u0627\u0644\u0630\u064a \u064a\u062f\u0639\u0645\u0643\u061f","1\ub144 \ud6c4\uc758 \uc790\uc2e0\uc774 \ub098\uc5d0\uac8c \uc5fd\uc11c\ub97c \uc4f0\ub294 \uc7a5\uba74\uc744 \uc0c1\uc0c1\ud574 \ubcf4\uc138\uc694.\n\uc774\ubc88 \uc8fc\ub294 \uc5c9\ub9dd\uc774\uc5c8\uace0 \uc791\uc740 \uc2e4\ud328\ub4e4\uc774 \ub9ce\uc558\uc2b5\ub2c8\ub2e4.\n\n\uc5b4\ub5a4 \uba54\uc2dc\uc9c0\uac00 \u201c\ubbf8\ub798\uc758 \ub098\u201d\uc758 \uc9c0\uc6d0\uc744 \uac00\uc7a5 \uc798 \ud45c\ud604\ud560\uae4c\uc694?","\u4f60\u60f3\u8c61\u4e00\u5e74\u540e\u7684\u4e00\u7248\u672c\u81ea\u5df1\u7ed9\u4f60\u5199\u660e\u4fe1\u7247\u3002\n\u8fd9\u4e00\u5468\u4f60\u7684\u751f\u6d3b\u6742\u4e71\u65e0\u7ae0\uff0c\u5145\u6ee1\u4e86\u5c0f\u5c0f\u7684\u5931\u8d25\u3002\n\n\u54ea\u6761\u4fe1\u606f\u6700\u7b26\u5408\u4e00\u4e2a\u652f\u6301\u4f60\u7684\u201c\u672a\u6765\u7684\u6211\u201d\uff1f","\u0906\u092a \u090f\u0915 \u0938\u093e\u0932 \u092c\u093e\u0926 \u0915\u0947 \u0905\u092a\u0928\u0947 \u0906\u092a \u0915\u094b \u0915\u0932\u094d\u092a\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u091c\u094b \u0906\u092a\u0915\u094b \u090f\u0915 \u092a\u094b\u0938\u094d\u091f\u0915\u093e\u0930\u094d\u0921 \u0932\u093f\u0916 \u0930\u0939\u093e \u0939\u0948\u0964\n\u0906\u092a\u0915\u093e \u0938\u092a\u094d\u0924\u093e\u0939 \u0905\u0938\u094d\u0924\u0935\u094d\u092f\u0938\u094d\u0924 \u0914\u0930 \u091b\u094b\u091f\u0947-\u091b\u094b\u091f\u0947 \u0935\u093f\u092b\u0932\u0924\u093e\u0913\u0902 \u0938\u0947 \u092d\u0930\u093e \u0930\u0939\u093e \u0939\u0948\u0964\n\n\u201c\u092d\u0935\u093f\u0937\u094d\u092f \u0915\u093e \u092e\u0948\u0902\u201d \u0938\u0947 \u090f\u0915 \u0938\u0939\u093e\u092f\u0915 \u0938\u0902\u0926\u0947\u0936 \u0915\u094d\u092f\u093e \u0939\u094b\u0917\u093e?","Imaginare versionem tui post annum tibi epistulam postaliam scribentem.\nHebdomas tua confusa fuit et plena parvulorum defectuum.\n\nQuae epistula convenit \u201cFuturo Me\u201d qui te adiuvat?","Immagini una versione di te tra un anno che ti scrive una cartolina.\nLa tua settimana \xe8 stata disordinata e piena di piccoli fallimenti.\n\nQuale messaggio si adatta a un \u201cFuturo Me\u201d che ti supporta?","\u06cc\u06a9 \u0646\u0633\u062e\u0647 \u0627\u0632 \u062e\u0648\u062f \u0631\u0627 \u062f\u0631 \u06cc\u06a9 \u0633\u0627\u0644 \u0622\u06cc\u0646\u062f\u0647 \u062a\u0635\u0648\u0631 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0628\u0631\u0627\u06cc \u0634\u0645\u0627 \u06cc\u06a9 \u06a9\u0627\u0631\u062a \u067e\u0633\u062a\u0627\u0644 \u0645\u06cc\u200c\u0646\u0648\u06cc\u0633\u062f.\n\u0647\u0641\u062a\u0647 \u0634\u0645\u0627 \u067e\u0631 \u0627\u0632 \u0622\u0634\u0641\u062a\u06af\u06cc \u0648 \u0634\u06a9\u0633\u062a\u200c\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u0628\u0648\u062f\u0647 \u0627\u0633\u062a.\n\n\u06a9\u062f\u0627\u0645 \u067e\u06cc\u0627\u0645 \u0628\u0631\u0627\u06cc \u201c\u0645\u0646 \u0622\u06cc\u0646\u062f\u0647\u201d \u06a9\u0647 \u0627\u0632 \u0634\u0645\u0627 \u062d\u0645\u0627\u06cc\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u0645\u0646\u0627\u0633\u0628 \u0627\u0633\u062a\u061f"],t.w)
B.afh=new A.d(B.c,["\u201cYou ruined everything. I am disappointed in you.\u201d","\u201cLo arruinaste todo. Estoy decepcionado en ti.\u201d","\u201eDu hast alles ruiniert. Ich bin entt\xe4uscht von dir.\u201c","\u201cTu as tout g\xe2ch\xe9. Je suis d\xe9\xe7u de toi.\u201d","\u201c\u0623\u0646\u062a \u062f\u0645\u0631\u062a \u0643\u0644 \u0634\u064a\u0621. \u0623\u0646\u0627 \u062e\u0627\u0626\u0628 \u0627\u0644\u0623\u0645\u0644 \u0645\u0646\u0643.\u201d","\u201c\ub108\ub294 \ubaa8\ub4e0 \uac83\uc744 \ub9dd\ucce4\uc5b4. \ub098\ub294 \uc2e4\ub9dd\ud588\uc5b4.\u201d","\u201c\u4f60\u6bc1\u4e86\u4e00\u5207\u3002\u6211\u5bf9\u4f60\u5931\u671b\u3002\u201d","\u201c\u0924\u0941\u092e\u0928\u0947 \u0938\u092c \u0915\u0941\u091b \u092c\u0930\u094d\u092c\u093e\u0926 \u0915\u0930 \u0926\u093f\u092f\u093e\u0964 \u092e\u0941\u091d\u0947 \u0924\u0941\u092e\u0938\u0947 \u0928\u093f\u0930\u093e\u0936\u093e \u0939\u0941\u0908 \u0939\u0948\u0964\u201d","\u201cOmnia pervagasti. Ego sum de te deceptus.\u201d","\u201cHai rovinato tutto. Sono deluso da te.\u201d","\u201c\u062a\u0648 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u06cc. \u0645\u0646 \u0627\u0632 \u062a\u0648 \u0646\u0627\u0627\u0645\u06cc\u062f \u0634\u062f\u0645.\u201d"],t.w)
