B.acc=new A.d(B.c,["\u201cYou are more resilient than you feel right now. These weeks become part of how you learn to adapt.\u201d","\u201cEres m\xe1s resiliente de lo que sientes ahora. Estas semanas se convierten en parte de c\xf3mo aprendes a adaptarte.\u201d","\u201eDu bist widerstandsf\xe4higer, als du dich gerade f\xfchlst. Diese Wochen werden Teil davon, wie du lernst, dich anzupassen.\u201c","\u201cTu es plus r\xe9silient que ce que tu ressens maintenant. Ces semaines font partie de la fa\xe7on dont tu apprends \xe0 t\u2019adapter.\u201d","\u201c\u0623\u0646\u062a \u0623\u0643\u062b\u0631 \u0645\u0631\u0648\u0646\u0629 \u0645\u0645\u0627 \u062a\u0634\u0639\u0631 \u0628\u0647 \u0627\u0644\u0622\u0646. \u0647\u0630\u0647 \u0627\u0644\u0623\u0633\u0627\u0628\u064a\u0639 \u062a\u0635\u0628\u062d \u062c\u0632\u0621\u064b\u0627 \u0645\u0646 \u0643\u064a\u0641\u064a\u0629 \u062a\u0639\u0644\u0645\u0643 \u0627\u0644\u062a\u0643\u064a\u0641.\u201d","\u201c\uc9c0\uae08 \ub290\ub07c\ub294 \uac83\ubcf4\ub2e4 \ub354 \uac15\ud55c \ud68c\ubcf5\ub825\uc744 \uac00\uc9c0\uace0 \uc788\uc5b4. \uc774\ubc88 \uc8fc\ub4e4\uc740 \ub124\uac00 \uc801\uc751\ud558\ub294 \ubc95\uc744 \ubc30\uc6b0\ub294 \uacfc\uc815\uc758 \uc77c\ubd80\uac00 \ub420 \uac70\uc57c.\u201d","\u201c\u4f60\u6bd4\u73b0\u5728\u611f\u89c9\u7684\u66f4\u6709\u97e7\u6027\u3002\u8fd9\u4e9b\u5468\u6210\u4e3a\u4f60\u5b66\u4e60\u9002\u5e94\u7684\u4e00\u90e8\u5206\u3002\u201d","\u201c\u0924\u0941\u092e \u0905\u092c \u091c\u093f\u0938 \u0924\u0930\u0939 \u092e\u0939\u0938\u0942\u0938 \u0915\u0930 \u0930\u0939\u0947 \u0939\u094b, \u0909\u0938\u0938\u0947 \u0915\u0939\u0940\u0902 \u091c\u094d\u092f\u093e\u0926\u093e \u0932\u091a\u0940\u0932\u0947 \u0939\u094b\u0964 \u092f\u0947 \u0939\u092b\u094d\u0924\u0947 \u0909\u0938 \u0924\u0930\u0940\u0915\u0947 \u0915\u093e \u0939\u093f\u0938\u094d\u0938\u093e \u092c\u0928\u0947\u0902\u0917\u0947 \u091c\u093f\u0938 \u0924\u0930\u0939 \u0924\u0941\u092e \u0938\u0940\u0916\u0924\u0947 \u0939\u094b\u0964\u201d","\u201cFortior es quam nunc sentias. Haec hebdomas pars est quomodo discas adaptari.\u201d","\u201cSei pi\xf9 resiliente di quanto ti senti ora. Queste settimane fanno parte di come impari ad adattarti.\u201d","\u201c\u062a\u0648 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u0627\u0644\u0627\u0646 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u06cc \u0645\u0642\u0627\u0648\u0645\u062a\u06cc \u062f\u0627\u0631\u06cc. \u0627\u06cc\u0646 \u0647\u0641\u062a\u0647\u200c\u0647\u0627 \u0628\u062e\u0634\u06cc \u0627\u0632 \u0646\u062d\u0648\u0647 \u06cc\u0627\u062f\u06af\u06cc\u0631\u06cc \u062a\u0648 \u0628\u0631\u0627\u06cc \u0627\u0646\u0637\u0628\u0627\u0642 \u062e\u0648\u0627\u0647\u0646\u062f \u0628\u0648\u062f.\u201d"],t.w)
