B.acA=new A.d(B.c,["\u201cNothing matters, so give up on all of it.\u201d","\u201cNada importa, as\xed que abandona todo.\u201d","\u201eNichts ist wichtig, also gib alles auf.\u201c","\u201cRien n\u2019a d\u2019importance, donc abandonne tout.\u201d","\u201c\u0644\u0627 \u0634\u064a\u0621 \u064a\u0647\u0645\u060c \u0644\u0630\u0627 \u0627\u0633\u062a\u0633\u0644\u0645 \u0644\u0643\u0644 \u0634\u064a\u0621.\u201d","\u201c\uc544\ubb34\uac83\ub3c4 \uc911\uc694\ud558\uc9c0 \uc54a\uc73c\ub2c8 \ub2e4 \ud3ec\uae30\ud574.\u201d","\u201c\u4ec0\u4e48\u90fd\u4e0d\u91cd\u8981\uff0c\u6240\u4ee5\u653e\u5f03\u4e00\u5207\u3002\u201d","\u201c\u0915\u0941\u091b \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e, \u0907\u0938\u0932\u093f\u090f \u0938\u092c \u0915\u0941\u091b \u091b\u094b\u0921\u093c \u0926\u094b\u0964\u201d","\u201cNihil interest, igitur omnia desiste.\u201d","\u201cNulla importa, quindi rinuncia a tutto.\u201d","\u201c\u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0627\u0647\u0645\u06cc\u062a \u0646\u062f\u0627\u0631\u062f\u060c \u067e\u0633 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0631\u0647\u0627 \u06a9\u0646.\u201d"],t.w)
