B.aeB=new A.d(B.c,["You are scared to start a new project or habit.\nFuture-you has already done some of the work.\n\nWhat might they write back?","Tienes miedo de empezar un nuevo proyecto o h\xe1bito.\nTu futuro ya ha hecho algo del trabajo.\n\n\xbfQu\xe9 podr\xedan escribirte?","Du hast Angst, ein neues Projekt oder eine neue Gewohnheit zu beginnen.\nDein zuk\xfcnftiges Selbst hat schon einen Teil der Arbeit erledigt.\n\nWas k\xf6nnte es dir zur\xfcckschreiben?","Tu as peur de commencer un nouveau projet ou une nouvelle habitude.\nTon futur toi a d\xe9j\xe0 fait une partie du travail.\n\nQue pourrait-il t\u2019\xe9crire ?","\u0623\u0646\u062a \u062e\u0627\u0626\u0641 \u0645\u0646 \u0628\u062f\u0621 \u0645\u0634\u0631\u0648\u0639 \u0623\u0648 \u0639\u0627\u062f\u0629 \u062c\u062f\u064a\u062f\u0629.\n\u0644\u0642\u062f \u0642\u0627\u0645 \u201c\u0623\u0646\u062a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u201d \u0628\u0627\u0644\u0641\u0639\u0644 \u0628\u0628\u0639\u0636 \u0645\u0646 \u0627\u0644\u0639\u0645\u0644.\n\n\u0645\u0627\u0630\u0627 \u0642\u062f \u064a\u0643\u062a\u0628 \u0644\u0643\u061f","\uc0c8\ub85c\uc6b4 \ud504\ub85c\uc81d\ud2b8\ub098 \uc2b5\uad00\uc744 \uc2dc\uc791\ud558\ub294 \uac83\uc774 \ub450\ub835\uc2b5\ub2c8\ub2e4.\n\ubbf8\ub798\uc758 \ub2f9\uc2e0\uc740 \uc774\ubbf8 \uc77c\ubd80 \uc791\uc5c5\uc744 \ud588\uc2b5\ub2c8\ub2e4.\n\n\uadf8\ub4e4\uc774 \ubb34\uc5c7\uc744 \uc4f8 \uc218 \uc788\uc744\uae4c\uc694?","\u4f60\u5bb3\u6015\u5f00\u59cb\u4e00\u4e2a\u65b0\u9879\u76ee\u6216\u65b0\u4e60\u60ef\u3002\n\u672a\u6765\u7684\u4f60\u5df2\u7ecf\u505a\u4e86\u4e00\u4e9b\u5de5\u4f5c\u3002\n\n\u4ed6\u4eec\u53ef\u80fd\u4f1a\u5199\u4ec0\u4e48\uff1f","\u0906\u092a\u0915\u094b \u0928\u092f\u093e \u092a\u094d\u0930\u094b\u091c\u0947\u0915\u094d\u091f \u092f\u093e \u0906\u0926\u0924 \u0936\u0941\u0930\u0942 \u0915\u0930\u0928\u0947 \u0938\u0947 \u0921\u0930 \u0932\u0917 \u0930\u0939\u093e \u0939\u0948\u0964\n\u092d\u0935\u093f\u0937\u094d\u092f \u092e\u0947\u0902 \u0906\u092a\u0928\u0947 \u092a\u0939\u0932\u0947 \u0939\u0940 \u0915\u0941\u091b \u0915\u093e\u092e \u0915\u0930 \u0932\u093f\u092f\u093e \u0939\u0948\u0964\n\n\u0935\u0947 \u0915\u094d\u092f\u093e \u0932\u093f\u0916 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902?","Timore obviante, novi proiectum aut consuetudinem incipiendo.\nFuturum te iam aliquid ex opere perficit.\n\nQuid illi respondere posset?","Hai paura di iniziare un nuovo progetto o abitudine.\nIl tuo futuro te ha gi\xe0 fatto parte del lavoro.\n\nCosa potrebbero scriverti?","\u0627\u0632 \u0634\u0631\u0648\u0639 \u06cc\u06a9 \u067e\u0631\u0648\u0698\u0647 \u06cc\u0627 \u0639\u0627\u062f\u062a \u062c\u062f\u06cc\u062f \u062a\u0631\u0633 \u062f\u0627\u0631\u06cc\u062f.\n\u062e\u0648\u062f\u0650 \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0642\u0628\u0644\u0627\u064b \u0645\u0642\u062f\u0627\u0631\u06cc \u0627\u0632 \u06a9\u0627\u0631 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f\u0647 \u0627\u0633\u062a.\n\n\u0686\u0647 \u0686\u06cc\u0632\u06cc \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647 \u0634\u0645\u0627 \u0628\u0646\u0648\u06cc\u0633\u0646\u062f\u061f"],t.w)
B.ady=new A.d(B.c,["\u201cDo not try. The fear you feel now never changes.\u201d","\u201cNo intentes. El miedo que sientes ahora nunca cambia.\u201d","\u201eVersuche es nicht. Die Angst, die du jetzt f\xfchlst, \xe4ndert sich nie.\u201c","\u201cNe tente pas. La peur que tu ressens maintenant ne change jamais.\u201d","\u201c\u0644\u0627 \u062a\u062d\u0627\u0648\u0644. \u0627\u0644\u062e\u0648\u0641 \u0627\u0644\u0630\u064a \u062a\u0634\u0639\u0631 \u0628\u0647 \u0627\u0644\u0622\u0646 \u0644\u0627 \u064a\u062a\u063a\u064a\u0631 \u0623\u0628\u062f\u064b\u0627.\u201d","\u201c\uc2dc\ub3c4\ud558\uc9c0 \ub9c8\uc138\uc694. \uc9c0\uae08 \ub290\ub07c\ub294 \ub450\ub824\uc6c0\uc740 \uc808\ub300 \ubcc0\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\u201d","\u201c\u4e0d\u8981\u5c1d\u8bd5\u3002\u4f60\u73b0\u5728\u7684\u6050\u60e7\u6c38\u8fdc\u4e0d\u4f1a\u6539\u53d8\u3002\u201d","\u201c\u0915\u094b\u0936\u093f\u0936 \u092e\u0924 \u0915\u0930\u094b\u0964 \u091c\u094b \u0921\u0930 \u0924\u0941\u092e \u0905\u092c \u092e\u0939\u0938\u0942\u0938 \u0915\u0930 \u0930\u0939\u0947 \u0939\u094b \u0935\u0939 \u0915\u092d\u0940 \u0928\u0939\u0940\u0902 \u092c\u0926\u0932\u0924\u093e\u0964\u201d","\u201cNoli conari. Timor, quem nunc sentis, numquam mutatur.\u201d","\u201cNon provarci. La paura che senti ora non cambia mai.\u201d","\u201c\u062a\u0644\u0627\u0634 \u0646\u06a9\u0646. \u062a\u0631\u0633\u06cc \u06a9\u0647 \u0627\u06a9\u0646\u0648\u0646 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u06cc \u0647\u06cc\u0686 \u0648\u0642\u062a \u062a\u063a\u06cc\u06cc\u0631 \u0646\u0645\u06cc\u200c\u06a9\u0646\u062f.\u201d"],t.w)
