B.abi=new A.d(B.c,["\u201cThe fear felt huge at first, but it shrank once I took a few clumsy first steps.\u201d","\u201cEl miedo se sinti\xf3 enorme al principio, pero se redujo una vez que di unos torpes primeros pasos.\u201d","\u201eDie Angst war zu Beginn riesig, aber sie wurde kleiner, als ich ein paar unbeholfene erste Schritte machte.\u201c","\u201cLa peur semblait \xe9norme au d\xe9but, mais elle a diminu\xe9 une fois que j\u2019ai fait quelques premiers pas maladroits.\u201d","\u201c\u0641\u064a \u0627\u0644\u0628\u062f\u0627\u064a\u0629 \u0634\u0639\u0631\u062a \u0628\u0627\u0644\u062e\u0648\u0641 \u0627\u0644\u0643\u0628\u064a\u0631\u060c \u0648\u0644\u0643\u0646 \u062a\u0642\u0644\u0635 \u0639\u0646\u062f\u0645\u0627 \u0623\u062e\u0630\u062a \u0628\u0639\u0636 \u0627\u0644\u062e\u0637\u0648\u0627\u062a \u0627\u0644\u062e\u0631\u0642\u0627\u0621 \u0627\u0644\u0623\u0648\u0644\u0649.\u201d","\u201c\ucc98\uc74c\uc5d0\ub294 \ub450\ub824\uc6c0\uc774 \ucef8\uc9c0\ub9cc, \uba87 \ubc88\uc758 \uc11c\ud22c\ub978 \uccab \uac78\uc74c\uc744 \ub5c0 \ud6c4 \uc904\uc5b4\ub4e4\uc5c8\uc5b4\uc694.\u201d","\u201c\u6700\u5f00\u59cb\u65f6\uff0c\u6050\u60e7\u611f\u5de8\u5927\uff0c\u4f46\u4e00\u65e6\u6211\u8fc8\u51fa\u4e86\u51e0\u6b65\u7b28\u62d9\u7684\u6b65\u4f10\uff0c\u5b83\u5c31\u51cf\u5c0f\u4e86\u3002\u201d","\u201c\u0936\u0941\u0930\u0941\u0906\u0924 \u092e\u0947\u0902 \u0921\u0930 \u092c\u0939\u0941\u0924 \u092c\u0921\u093c\u093e \u092e\u0939\u0938\u0942\u0938 \u0939\u0941\u0906, \u0932\u0947\u0915\u093f\u0928 \u091c\u0948\u0938\u0947 \u0939\u0940 \u092e\u0948\u0902\u0928\u0947 \u0915\u0941\u091b \u0909\u0925\u0932\u0947 \u092a\u0939\u0932\u0947 \u0915\u0926\u092e \u0909\u0920\u093e\u090f, \u0935\u0939 \u0918\u091f \u0917\u092f\u093e\u0964\u201d","\u201cTimor initio ingens fuit, sed minuit postquam paucos gressus ineptos feci.\u201d","\u201cLa paura sembrava enorme all\u2019inizio, ma \xe8 diminuita una volta che ho fatto alcuni passi goffi.\u201d","\u201c\u062a\u0631\u0633 \u062f\u0631 \u0627\u0628\u062a\u062f\u0627 \u0628\u0632\u0631\u06af \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u200c\u0631\u0633\u06cc\u062f\u060c \u0627\u0645\u0627 \u0648\u0642\u062a\u06cc \u0686\u0646\u062f \u0642\u062f\u0645 \u062f\u0633\u062a \u0648 \u067e\u0627 \u0686\u0644\u0641\u062a\u06cc \u0628\u0631\u062f\u0627\u0634\u062a\u0645\u060c \u06a9\u0648\u0686\u06a9 \u0634\u062f.\u201d"],t.w)
