B.a9x=new A.d(B.c,["\u201cOnly start if you can do it perfectly.\u201d","\u201cSolo empieza si puedes hacerlo perfectamente.\u201d","\u201eFang nur an, wenn du es perfekt machen kannst.\u201c","\u201cCommence seulement si tu peux le faire parfaitement.\u201d","\u201c\u0627\u0628\u062f\u0623 \u0641\u0642\u0637 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u062a\u0641\u0639\u0644\u0647\u0627 \u0628\u0634\u0643\u0644 \u0645\u062b\u0627\u0644\u064a.\u201d","\u201c\uc644\ubcbd\ud558\uac8c \ud560 \uc218 \uc788\uc744 \ub54c\ub9cc \uc2dc\uc791\ud574\ub77c.\u201d","\u201c\u53ea\u6709\u5728\u4f60\u80fd\u505a\u5f97\u5b8c\u7f8e\u65f6\u624d\u5f00\u59cb\u3002\u201d","\u201c\u0938\u093f\u0930\u094d\u092b \u0924\u092c \u0936\u0941\u0930\u0942 \u0915\u0930\u0947\u0902 \u091c\u092c \u0906\u092a \u0907\u0938\u0947 \u092c\u093f\u0932\u094d\u0915\u0941\u0932 \u0938\u0939\u0940 \u0924\u0930\u0940\u0915\u0947 \u0938\u0947 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964\u201d","\u201cSolum incipere si perfecte facere potes.\u201d","\u201cInizia solo se puoi farlo perfettamente.\u201d","\u201c\u0641\u0642\u0637 \u0634\u0631\u0648\u0639 \u06a9\u0646 \u0627\u06af\u0631 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc \u0622\u0646 \u0631\u0627 \u06a9\u0627\u0645\u0644\u0627\u064b \u0628\u0647 \u062f\u0631\u0633\u062a\u06cc \u0627\u0646\u062c\u0627\u0645 \u062f\u0647\u06cc.\u201d"],t.w)
