B.adJ=new A.d(B.c,["Future you can validate that fear is loud at the beginning but changes with small actions.","Tu futuro yo puede validar que el miedo es fuerte al principio, pero cambia con peque\xf1as acciones.","Dein zuk\xfcnftiges Selbst kann best\xe4tigen, dass Angst am Anfang laut ist, aber sich mit kleinen Schritten \xe4ndert.","Ton futur toi peut valider que la peur est forte au d\xe9but, mais elle change avec de petites actions.","\u064a\u0645\u0643\u0646\u0643 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0646\u0641\u0633\u0643 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u0623\u0646 \u062a\u062a\u062d\u0642\u0642 \u0645\u0646 \u0623\u0646 \u0627\u0644\u062e\u0648\u0641 \u0642\u0648\u064a \u0641\u064a \u0627\u0644\u0628\u062f\u0627\u064a\u0629\u060c \u0644\u0643\u0646\u0647 \u064a\u062a\u063a\u064a\u0631 \u0645\u0639 \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0627\u0644\u0635\u063a\u064a\u0631\u0629.","\ubbf8\ub798\uc758 \uc790\uc2e0\uc740 \ub450\ub824\uc6c0\uc774 \ucc98\uc74c\uc5d0\ub294 \ud06c\uac8c \ub290\uaef4\uc9c0\uc9c0\ub9cc, \uc791\uc740 \ud589\ub3d9\ub4e4\ub85c \ubcc0\ud654\ud55c\ub2e4\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u672a\u6765\u7684\u4f60\u53ef\u4ee5\u9a8c\u8bc1\uff0c\u6050\u60e7\u4e00\u5f00\u59cb\u5f88\u5f3a\u70c8\uff0c\u4f46\u968f\u7740\u5c0f\u6b65\u9aa4\u7684\u884c\u52a8\uff0c\u5b83\u4f1a\u53d1\u751f\u53d8\u5316\u3002","\u092d\u0935\u093f\u0937\u094d\u092f \u092e\u0947\u0902 \u0906\u092a \u092f\u0939 \u092e\u093e\u0928\u094d\u092f \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0936\u0941\u0930\u0941\u0906\u0924 \u092e\u0947\u0902 \u0921\u0930 \u092c\u0939\u0941\u0924 \u0924\u0947\u091c \u0939\u094b\u0924\u093e \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u091b\u094b\u091f\u0947 \u0915\u0926\u092e\u094b\u0902 \u0938\u0947 \u092f\u0939 \u092c\u0926\u0932 \u091c\u093e\u0924\u093e \u0939\u0948\u0964","Futurum ego validare potest timorem esse vehementem initio, sed mutari per minimos actus.","Il tuo futuro te pu\xf2 convalidare che la paura \xe8 forte all\u2019inizio, ma cambia con piccole azioni.","\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0627\u06cc\u0646 \u062a\u0631\u0633 \u0631\u0627 \u062a\u0623\u06cc\u06cc\u062f \u06a9\u0646\u062f \u06a9\u0647 \u062f\u0631 \u0627\u0628\u062a\u062f\u0627 \u0632\u06cc\u0627\u062f \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u0628\u0627 \u0627\u0642\u062f\u0627\u0645\u200c\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u062a\u063a\u06cc\u06cc\u0631 \u0645\u06cc\u200c\u06a9\u0646\u062f."],t.w)
