B.a9p=new A.d(B.c,["You feel a friendship drifting and are scared of being alone.\n\nFuture you has survived this patch. What do they send in a postcard?","Sientes que una amistad se desvanece y tienes miedo de estar solo.\n\nTu futuro ya ha sobrevivido a esta etapa. \xbfQu\xe9 te enviar\xeda en una postal?","Du sp\xfcrst, wie sich eine Freundschaft entfernt, und hast Angst, alleine zu sein.\n\nDein zuk\xfcnftiges Ich hat diese Phase \xfcberstanden. Was w\xfcrde es dir auf einer Postkarte schreiben?","Tu sens qu\u2019une amiti\xe9 s\u2019\xe9loigne et tu as peur de te retrouver seul.\n\nTon futur toi a surv\xe9cu \xe0 cette p\xe9riode. Que t\u2019enverrait-il sur une carte postale ?","\u062a\u0634\u0639\u0631 \u0628\u0623\u0646 \u0635\u062f\u0627\u0642\u0629 \u062a\u062a\u0628\u0627\u0639\u062f \u0648\u0623\u0646\u062a \u062e\u0627\u0626\u0641 \u0645\u0646 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0648\u062d\u064a\u062f\u064b\u0627.\n\n\u0644\u0642\u062f \u0646\u062c\u062d\u062a \u0623\u0646\u062a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u0645\u0631\u062d\u0644\u0629. \u0645\u0627\u0630\u0627 \u0633\u062a\u0631\u0633\u0644 \u0644\u0643 \u0641\u064a \u0628\u0637\u0627\u0642\u0629 \u0628\u0631\u064a\u062f\u064a\u0629\u061f","\uce5c\uad6c \uad00\uacc4\uac00 \uba40\uc5b4\uc9c0\uace0 \uc788\uace0 \ud63c\uc790\uc77c\uae4c\ubd10 \ub450\ub824\uc6cc\uc694.\n\n\ubbf8\ub798\uc758 \ub098\ub294 \uc774 \uc2dc\uae30\ub97c \uc798 \uacac\ub38c\ub0c8\uc2b5\ub2c8\ub2e4. \uadf8\ub4e4\uc774 \uc5fd\uc11c\uc5d0 \ubb34\uc5c7\uc744 \ubcf4\ub0bc\uae4c\uc694?","\u4f60\u611f\u5230\u4e00\u6bb5\u53cb\u8c0a\u5728\u758f\u8fdc\uff0c\u5bb3\u6015\u5b64\u72ec\u3002\n\n\u672a\u6765\u7684\u4f60\u5df2\u7ecf\u633a\u8fc7\u4e86\u8fd9\u4e00\u9636\u6bb5\u3002\u4ed6\u4eec\u4f1a\u5728\u660e\u4fe1\u7247\u4e0a\u5199\u4e9b\u4ec0\u4e48\uff1f","\u0906\u092a \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u090f\u0915 \u0926\u094b\u0938\u094d\u0924\u0940 \u0926\u0942\u0930 \u0939\u094b \u0930\u0939\u0940 \u0939\u0948 \u0914\u0930 \u0906\u092a\u0915\u094b \u0905\u0915\u0947\u0932\u0947 \u0939\u094b\u0928\u0947 \u0915\u093e \u0921\u0930 \u0939\u0948\u0964\n\n\u092d\u0935\u093f\u0937\u094d\u092f \u092e\u0947\u0902 \u0906\u092a\u0928\u0947 \u0907\u0938 \u0938\u092e\u092f \u0915\u094b \u092a\u093e\u0930 \u0915\u093f\u092f\u093e \u0939\u0948\u0964 \u0935\u0947 \u092a\u094b\u0938\u094d\u091f\u0915\u093e\u0930\u094d\u0921 \u092a\u0930 \u0906\u092a\u0915\u094b \u0915\u094d\u092f\u093e \u092d\u0947\u091c\u0947\u0902\u0917\u0947?","Sentis amicitiam diffundi et times solum esse.\n\nFuturum te hanc partem superavit. Quid tibi in post card mittet?","Senti che un\u2019amicizia sta cambiando e hai paura di stare solo.\n\nIl tuo futuro te ha gi\xe0 superato questo periodo. Cosa ti invierebbe su una cartolina?","\u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u06a9\u0647 \u06cc\u06a9 \u062f\u0648\u0633\u062a\u06cc \u062f\u0631 \u062d\u0627\u0644 \u0641\u0627\u0635\u0644\u0647 \u06af\u0631\u0641\u062a\u0646 \u0627\u0633\u062a \u0648 \u0627\u0632 \u062a\u0646\u0647\u0627 \u0628\u0648\u062f\u0646 \u0645\u06cc\u200c\u062a\u0631\u0633\u06cc\u062f.\n\n\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0627\u0632 \u0627\u06cc\u0646 \u0645\u0631\u062d\u0644\u0647 \u0639\u0628\u0648\u0631 \u06a9\u0631\u062f\u0647 \u0627\u0633\u062a. \u0686\u0647 \u0686\u06cc\u0632\u06cc \u0631\u0627 \u062f\u0631 \u06cc\u06a9 \u06a9\u0627\u0631\u062a \u067e\u0633\u062a\u0627\u0644 \u0628\u0631\u0627\u06cc\u062a\u0627\u0646 \u0645\u06cc\u200c\u0641\u0631\u0633\u062a\u062f\u061f"],t.w)
B.aa0=new A.d(B.c,["\u201cYou were right: no one stays, ever.\u201d","\u201cTen\xedas raz\xf3n: nadie se queda, jam\xe1s.\u201d","\u201eDu hattest recht: Niemand bleibt, jemals.\u201c","\u201cTu avais raison : personne ne reste, jamais.\u201d","\u201c\u0643\u0646\u062a \u0639\u0644\u0649 \u062d\u0642: \u0644\u0627 \u0623\u062d\u062f \u064a\u0628\u0642\u0649\u060c \u0623\u0628\u062f\u064b\u0627.\u201d","\u201c\ub10c \ub9de\uc558\uc5b4: \uc544\ubb34\ub3c4 \ub0a8\uc9c0 \uc54a\uc544.\u201d","\u201c\u4f60\u662f\u5bf9\u7684\uff1a\u6ca1\u6709\u4eba\u4f1a\u7559\u4e0b\u3002\u201d","\u201c\u0924\u0941\u092e \u0938\u0939\u0940 \u0925\u0947: \u0915\u094b\u0908 \u0928\u0939\u0940\u0902 \u0930\u0941\u0915\u0924\u093e, \u0915\u092d\u0940 \u0928\u0939\u0940\u0902\u0964\u201d","\u201cIta es: nemo manet, umquam.\u201d","\u201cAvevi ragione: nessuno rimane, mai.\u201d","\u201c\u062d\u0642 \u0628\u0627 \u062a\u0648 \u0628\u0648\u062f: \u0647\u06cc\u0686\u200c\u06a9\u0633 \u0646\u0645\u06cc\u200c\u0645\u0627\u0646\u062f\u060c \u0647\u06cc\u0686 \u0648\u0642\u062a.\u201d"],t.w)
