B.a8h=new A.d(B.c,["Future you looks back at a challenging decision you made today.\n\nWhat message would they send to encourage you?","Tu futuro se mira hacia una decisi\xf3n desafiante que tomaste hoy.\n\n\xbfQu\xe9 mensaje te enviar\xedan para animarte?","Dein zuk\xfcnftiges Ich blickt auf eine schwierige Entscheidung zur\xfcck, die du heute getroffen hast.\n\nWelche Nachricht w\xfcrden sie dir schicken, um dich zu ermutigen?","Ton futur toi regarde en arri\xe8re une d\xe9cision difficile que tu as prise aujourd\u2019hui.\n\nQuel message t\u2019enverraient-ils pour t\u2019encourager ?","\u0623\u0646\u062a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 \u062a\u0646\u0638\u0631 \u0625\u0644\u0649 \u0642\u0631\u0627\u0631 \u0635\u0639\u0628 \u0627\u062a\u062e\u0630\u062a\u0647 \u0627\u0644\u064a\u0648\u0645.\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0631\u0633\u0627\u0644\u0629 \u0627\u0644\u062a\u064a \u0633\u064a\u0631\u0633\u0644\u0648\u0646\u0647\u0627 \u0644\u062a\u0634\u062c\u064a\u0639\u0643\u061f","\ubbf8\ub798\uc758 \ub2f9\uc2e0\uc740 \uc624\ub298 \ub0b4\ub9b0 \uc5b4\ub824\uc6b4 \uacb0\uc815\uc744 \ub3cc\uc544\ubd05\ub2c8\ub2e4.\n\n\uadf8\ub4e4\uc774 \ub2f9\uc2e0\uc744 \uaca9\ub824\ud558\uae30 \uc704\ud574 \uc5b4\ub5a4 \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0bc\uae4c\uc694?","\u672a\u6765\u7684\u4f60\u56de\u987e\u4eca\u5929\u505a\u51fa\u7684\u4e00\u4e2a\u56f0\u96be\u51b3\u5b9a\u3002\n\n\u4ed6\u4eec\u4f1a\u53d1\u9001\u4ec0\u4e48\u4fe1\u606f\u6765\u9f13\u52b1\u4f60\uff1f","\u092d\u0935\u093f\u0937\u094d\u092f \u092e\u0947\u0902 \u0906\u092a \u0906\u091c \u0915\u093f\u090f \u0917\u090f \u090f\u0915 \u0915\u0920\u093f\u0928 \u0928\u093f\u0930\u094d\u0923\u092f \u0915\u094b \u0926\u0947\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\n\n\u0935\u0947 \u0906\u092a\u0915\u094b \u0909\u0924\u094d\u0938\u093e\u0939\u0935\u0930\u094d\u0927\u0928 \u0915\u0947 \u0932\u093f\u090f \u0915\u094c\u0928 \u0938\u093e \u0938\u0902\u0926\u0947\u0936 \u092d\u0947\u091c\u0947\u0902\u0917\u0947?","Futurum te respicit ad difficultatem electio hodie factam.\n\nQuod nuntium tibi mittunt ad te hortandum?","Il tuo futuro s\xe9 guarda indietro a una decisione difficile che hai preso oggi.\n\nChe messaggio ti invierebbero per incoraggiarti?","\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0628\u0647 \u06cc\u06a9 \u062a\u0635\u0645\u06cc\u0645 \u0686\u0627\u0644\u0634\u200c\u0628\u0631\u0627\u0646\u06af\u06cc\u0632 \u06a9\u0647 \u0627\u0645\u0631\u0648\u0632 \u06af\u0631\u0641\u062a\u0647\u200c\u0627\u06cc\u062f \u0646\u06af\u0627\u0647 \u0645\u06cc\u200c\u06a9\u0646\u062f.\n\n\u0622\u0646\u0647\u0627 \u0686\u0647 \u067e\u06cc\u0627\u0645\u06cc \u0628\u0631\u0627\u06cc \u062a\u0634\u0648\u06cc\u0642 \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f\u061f"],t.w)
B.aaZ=new A.d(B.c,["\u201cYou made the wrong choice. You will regret this forever.\u201d","\u201cTomaste la decisi\xf3n equivocada. Te arrepentir\xe1s de esto para siempre.\u201d","\u201eDu hast die falsche Wahl getroffen. Du wirst es f\xfcr immer bereuen.\u201c","\u201cTu as fait le mauvais choix. Tu le regretteras pour toujours.\u201d","\u201c\u0627\u062a\u062e\u0630\u062a \u0627\u0644\u062e\u064a\u0627\u0631 \u0627\u0644\u062e\u0637\u0623. \u0633\u062a\u0646\u062f\u0645 \u0639\u0644\u0649 \u0630\u0644\u0643 \u0644\u0644\u0623\u0628\u062f.\u201d","\u201c\ub108\ub294 \uc798\ubabb\ub41c \uc120\ud0dd\uc744 \ud588\ub2e4. \ub108\ub294 \uc774\uac83\uc744 \uc601\uc6d0\ud788 \ud6c4\ud68c\ud560 \uac83\uc774\ub2e4.\u201d","\u201c\u4f60\u505a\u51fa\u4e86\u9519\u8bef\u7684\u9009\u62e9\u3002\u4f60\u5c06\u6c38\u8fdc\u540e\u6094\u3002\u201d","\u201c\u0924\u0941\u092e\u0928\u0947 \u0917\u0932\u0924 \u091a\u0941\u0928\u093e\u0935 \u0915\u093f\u092f\u093e\u0964 \u0924\u0941\u092e \u0907\u0938\u0947 \u0939\u092e\u0947\u0936\u093e \u0915\u0947 \u0932\u093f\u090f \u092a\u091b\u0924\u093e\u0913\u0917\u0947\u0964\u201d","\u201cFecisti errorem electio. Semper poenitebit hoc.\u201d","\u201cHai fatto la scelta sbagliata. Te ne pentirai per sempre.\u201d","\u201c\u0634\u0645\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u06a9\u0631\u062f\u06cc\u062f. \u0628\u0631\u0627\u06cc \u0647\u0645\u06cc\u0634\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u067e\u0634\u06cc\u0645\u0627\u0646 \u062e\u0648\u0627\u0647\u06cc\u062f \u0634\u062f.\u201d"],t.w)
