B.a8P=new A.d(B.c,["\u201cIt was a tough decision, but you are learning and growing. Trust yourself.\u201d","\u201cFue una decisi\xf3n dif\xedcil, pero est\xe1s aprendiendo y creciendo. Conf\xeda en ti mismo.\u201d","\u201eEs war eine schwierige Entscheidung, aber du lernst und w\xe4chst. Vertraue auf dich selbst.\u201c","\u201cC\u2019\xe9tait une d\xe9cision difficile, mais tu es en train d\u2019apprendre et de grandir. Fais confiance en toi.\u201d","\u201c\u0643\u0627\u0646 \u0642\u0631\u0627\u0631\u064b\u0627 \u0635\u0639\u0628\u064b\u0627\u060c \u0644\u0643\u0646\u0643 \u062a\u062a\u0639\u0644\u0645 \u0648\u062a\u0646\u0645\u0648. \u062b\u0642 \u0628\u0646\u0641\u0633\u0643.\u201d","\u201c\uc5b4\ub824\uc6b4 \uacb0\uc815\uc774\uc5c8\uc9c0\ub9cc, \ub2f9\uc2e0\uc740 \ubc30\uc6b0\uace0 \uc131\uc7a5\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc790\uc2e0\uc744 \ubbff\uc73c\uc138\uc694.\u201d","\u201c\u8fd9\u662f\u4e00\u4e2a\u8270\u96be\u7684\u51b3\u5b9a\uff0c\u4f46\u4f60\u6b63\u5728\u5b66\u4e60\u548c\u6210\u957f\u3002\u76f8\u4fe1\u81ea\u5df1\u3002\u201d","\u201c\u092f\u0939 \u090f\u0915 \u0915\u0920\u093f\u0928 \u0928\u093f\u0930\u094d\u0923\u092f \u0925\u093e, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a \u0938\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092c\u0922\u093c \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0916\u0941\u0926 \u092a\u0930 \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0915\u0930\u0947\u0902\u0964\u201d","\u201cDifficilis electio erat, sed discis et crescis. Confide tibi.\u201d","\u201c\xc8 stata una decisione difficile, ma stai imparando e crescendo. Fidati di te stesso.\u201d","\u201c\u0627\u06cc\u0646 \u06cc\u06a9 \u062a\u0635\u0645\u06cc\u0645 \u0633\u062e\u062a \u0628\u0648\u062f\u060c \u0627\u0645\u0627 \u0634\u0645\u0627 \u062f\u0631 \u062d\u0627\u0644 \u06cc\u0627\u062f\u06af\u06cc\u0631\u06cc \u0648 \u0631\u0634\u062f \u0647\u0633\u062a\u06cc\u062f. \u0628\u0647 \u062e\u0648\u062f\u062a\u0627\u0646 \u0627\u0639\u062a\u0645\u0627\u062f \u06a9\u0646\u06cc\u062f.\u201d"],t.w)
