B.aew=new A.d(B.c,["\u201cYou should have never made that decision. You are a failure.\u201d","\u201cNunca debiste haber tomado esa decisi\xf3n. Eres un fracaso.\u201d","\u201eDu h\xe4ttest diese Entscheidung niemals treffen d\xfcrfen. Du bist ein Versager.\u201c","\u201cTu n\u2019aurais jamais d\xfb prendre cette d\xe9cision. Tu es un \xe9chec.\u201d","\u201c\u0644\u0645 \u064a\u0643\u0646 \u064a\u062c\u0628 \u0623\u0646 \u062a\u062a\u062e\u0630 \u0647\u0630\u0627 \u0627\u0644\u0642\u0631\u0627\u0631 \u0623\u0628\u062f\u064b\u0627. \u0623\u0646\u062a \u0641\u0627\u0634\u0644.\u201d","\u201c\ub108\ub294 \uadf8 \uacb0\uc815\uc744 \uc808\ub300 \ub0b4\uc120 \uc548 \ub410\ub2e4. \ub10c \uc2e4\ud328\uc790\uc57c.\u201d","\u201c\u4f60\u6c38\u8fdc\u4e0d\u8be5\u505a\u51fa\u90a3\u4e2a\u51b3\u5b9a\u3002\u4f60\u662f\u4e2a\u5931\u8d25\u8005\u3002\u201d","\u201c\u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0915\u092d\u0940 \u0935\u0939 \u0928\u093f\u0930\u094d\u0923\u092f \u0928\u0939\u0940\u0902 \u0932\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f \u0925\u093e\u0964 \u0924\u0941\u092e \u090f\u0915 \u0935\u093f\u092b\u0932\u0924\u093e \u0939\u094b\u0964\u201d","\u201cNumquam fecisti hanc decisionem. Es defectus.\u201d","\u201cNon avresti mai dovuto prendere quella decisione. Sei un fallimento.\u201d","\u201c\u0647\u0631\u06af\u0632 \u0646\u0628\u0627\u06cc\u062f \u0622\u0646 \u062a\u0635\u0645\u06cc\u0645 \u0631\u0627 \u0645\u06cc\u200c\u06af\u0631\u0641\u062a\u06cc. \u062a\u0648 \u06cc\u06a9 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0647\u200c\u0627\u06cc.\u201d"],t.w)
