B.adF=new A.d(B.c,["Good future-self messages acknowledge the difficulty of decisions and encourage self-trust and growth.","Los buenos mensajes del futuro se reconocen la dificultad de las decisiones y fomentan la autoconfianza y el crecimiento.","Gute Nachrichten von deinem zuk\xfcnftigen Selbst erkennen die Schwierigkeit von Entscheidungen an und f\xf6rdern Selbstvertrauen und Wachstum.","Les bons messages du futur toi reconnaissent la difficult\xe9 des d\xe9cisions et encouragent la confiance en soi et la croissance.","\u0631\u0633\u0627\u0626\u0644 \u062c\u064a\u062f\u0629 \u0645\u0646 \u0646\u0641\u0633\u0643 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u062a\u0639\u062a\u0631\u0641 \u0628\u0635\u0639\u0648\u0628\u0629 \u0627\u0644\u0642\u0631\u0627\u0631\u0627\u062a \u0648\u062a\u0634\u062c\u0639 \u0639\u0644\u0649 \u0627\u0644\u062b\u0642\u0629 \u0628\u0627\u0644\u0646\u0641\u0633 \u0648\u0627\u0644\u0646\u0645\u0648.","\ubbf8\ub798\uc758 \uc790\uc2e0\uc774 \ubcf4\ub0b4\ub294 \uc88b\uc740 \uba54\uc2dc\uc9c0\ub294 \uacb0\uc815\uc744 \ub0b4\ub9ac\ub294 \uc5b4\ub824\uc6c0\uc744 \uc778\uc815\ud558\uace0 \uc790\uc2e0\uac10\uacfc \uc131\uc7a5\uc744 \ucd09\uc9c4\ud569\ub2c8\ub2e4.","\u597d\u7684\u672a\u6765\u81ea\u6211\u4fe1\u606f\u627f\u8ba4\u51b3\u7b56\u7684\u56f0\u96be\uff0c\u5e76\u9f13\u52b1\u81ea\u4fe1\u548c\u6210\u957f\u3002","\u0905\u091a\u094d\u091b\u0947 \u092d\u0935\u093f\u0937\u094d\u092f-\u0938\u094d\u0935\u092f\u0902 \u0938\u0902\u0926\u0947\u0936 \u0928\u093f\u0930\u094d\u0923\u092f\u094b\u0902 \u0915\u0940 \u0915\u0920\u093f\u0928\u093e\u0908 \u0915\u094b \u0938\u094d\u0935\u0940\u0915\u093e\u0930 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0906\u0924\u094d\u092e\u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0914\u0930 \u0935\u093f\u0915\u093e\u0938 \u0915\u094b \u092a\u094d\u0930\u094b\u0924\u094d\u0938\u093e\u0939\u093f\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964","Bona futura-te nuntia agnoscunt difficultatem decisionum et hortantur fiduciam in se et incrementum.","I buoni messaggi del tuo futuro s\xe9 riconoscono la difficolt\xe0 delle decisioni e incoraggiano la fiducia in s\xe9 e la crescita.","\u067e\u06cc\u0627\u0645\u200c\u0647\u0627\u06cc \u062e\u0648\u0628 \u0627\u0632 \u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0628\u0647 \u0633\u062e\u062a\u06cc \u062a\u0635\u0645\u06cc\u0645\u0627\u062a \u0627\u0634\u0627\u0631\u0647 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f \u0648 \u0627\u0639\u062a\u0645\u0627\u062f \u0628\u0647 \u0646\u0641\u0633 \u0648 \u0631\u0634\u062f \u0631\u0627 \u062a\u0634\u0648\u06cc\u0642 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f."],t.w)
B.Ct=new A.d(B.c,["Future self","Futuro yo","Zuk\xfcnftiges Selbst","Futur soi","\u0627\u0644\u0630\u0627\u062a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629","\ubbf8\ub798\uc758 \uc790\uc2e0","\u672a\u6765\u7684\u81ea\u5df1","\u092d\u0935\u093f\u0937\u094d\u092f \u0915\u093e \u0938\u094d\u0935\u092f\u0902","Futurum te","Futuro s\xe9","\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647"],t.w)
