B.a8R=new A.d(B.c,["After a tough day","Despu\xe9s de un d\xeda dif\xedcil","Nach einem harten Tag","Apr\xe8s une journ\xe9e difficile","\u0628\u0639\u062f \u064a\u0648\u0645 \u0635\u0639\u0628","\ud798\ub4e0 \ud558\ub8e8 \ud6c4","\u8270\u96be\u7684\u4e00\u5929\u540e","\u0915\u0920\u093f\u0928 \u0926\u093f\u0928 \u0915\u0947 \u092c\u093e\u0926","Post diem durum","Dopo una giornata difficile","\u0628\u0639\u062f \u0627\u0632 \u06cc\u06a9 \u0631\u0648\u0632 \u0633\u062e\u062a"],t.w)
B.adO=new A.d(B.c,["You imagine your future self after a tough day, feeling drained and discouraged.\n\nWhat message does your future self send to remind you of your strength?","Te imaginas a tu futuro yo despu\xe9s de un d\xeda dif\xedcil, sinti\xe9ndote agotado y desanimado.\n\n\xbfQu\xe9 mensaje te env\xeda tu futuro yo para recordarte tu fortaleza?","Du stellst dir dein zuk\xfcnftiges Selbst nach einem harten Tag vor, ersch\xf6pft und entmutigt.\n\nWelche Nachricht schickt dir dein zuk\xfcnftiges Selbst, um dich an deine St\xe4rke zu erinnern?","Tu t\u2019imagines ton futur toi apr\xe8s une journ\xe9e difficile, te sentant vid\xe9 et d\xe9courag\xe9.\n\nQuel message ton futur toi t\u2019envoie-t-il pour te rappeler ta force ?","\u0623\u0646\u062a \u062a\u062a\u062e\u064a\u0644 \u0646\u0641\u0633\u0643 \u0641\u064a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 \u0628\u0639\u062f \u064a\u0648\u0645 \u0635\u0639\u0628\u060c \u0648\u0623\u0646\u062a \u062a\u0634\u0639\u0631 \u0628\u0627\u0644\u0625\u0631\u0647\u0627\u0642 \u0648\u0627\u0644\u0625\u062d\u0628\u0627\u0637.\n\n\u0645\u0627 \u0647\u064a \u0627\u0644\u0631\u0633\u0627\u0644\u0629 \u0627\u0644\u062a\u064a \u064a\u0631\u0633\u0644\u0647\u0627 \u0644\u0643 \u0646\u0641\u0633\u0643 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u0644\u062a\u0630\u0643\u064a\u0631\u0643 \u0628\u0642\u0648\u062a\u0643\u061f","\ub2f9\uc2e0\uc740 \ud798\ub4e0 \ud558\ub8e8\ub97c \ubcf4\ub0b8 \ud6c4 \ubbf8\ub798\uc758 \uc790\uc2e0\uc744 \uc0c1\uc0c1\ud569\ub2c8\ub2e4. \uc9c0\uce58\uace0 \ub099\ub2f4\ud55c \uae30\ubd84.\n\n\ubbf8\ub798\uc758 \uc790\uc2e0\uc740 \ub2f9\uc2e0\uc5d0\uac8c \uc790\uc2e0\uc758 \uac15\uc810\uc744 \uc0c1\uae30\uc2dc\ud0a4\uae30 \uc704\ud574 \uc5b4\ub5a4 \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0bc\uae4c\uc694?","\u4f60\u60f3\u8c61\u81ea\u5df1\u5728\u7ecf\u5386\u4e86\u8270\u96be\u7684\u4e00\u5929\u540e\uff0c\u611f\u5230\u7cbe\u75b2\u529b\u7aed\u548c\u6cae\u4e27\u3002\n\n\u4f60\u7684\u672a\u6765\u81ea\u6211\u4f1a\u53d1\u4ec0\u4e48\u6d88\u606f\u6765\u63d0\u9192\u4f60\u81ea\u5df1\u7684\u529b\u91cf\uff1f","\u0906\u092a \u0905\u092a\u0928\u0947 \u092d\u0935\u093f\u0937\u094d\u092f \u0915\u0947 \u0916\u0941\u0926 \u0915\u094b \u090f\u0915 \u0915\u0920\u093f\u0928 \u0926\u093f\u0928 \u0915\u0947 \u092c\u093e\u0926 \u0915\u0932\u094d\u092a\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0925\u0915\u093e \u0939\u0941\u0906 \u0914\u0930 \u0939\u0924\u094b\u0924\u094d\u0938\u093e\u0939\u093f\u0924 \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f\u0964\n\n\u0906\u092a\u0915\u093e \u092d\u0935\u093f\u0937\u094d\u092f-\u0938\u094d\u0935\u092f\u0902 \u0906\u092a\u0915\u094b \u0905\u092a\u0928\u0940 \u0924\u093e\u0915\u0924 \u092f\u093e\u0926 \u0926\u093f\u0932\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u094c\u0928 \u0938\u093e \u0938\u0902\u0926\u0947\u0936 \u092d\u0947\u091c\u0924\u093e \u0939\u0948?","Futurum te post diem durum imaginare, fatigatum et disceptatum.\n\nQuod nuntium futurum te mittit ut memores simus de virtute tua?","Immagini il tuo futuro s\xe9 dopo una giornata difficile, sentendoti esausto e scoraggiato.\n\nChe messaggio ti manda il tuo futuro s\xe9 per ricordarti della tua forza?","\u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0631\u0627 \u0628\u0639\u062f \u0627\u0632 \u06cc\u06a9 \u0631\u0648\u0632 \u0633\u062e\u062a \u062a\u0635\u0648\u0631 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f\u060c \u0627\u062d\u0633\u0627\u0633 \u062e\u0633\u062a\u06af\u06cc \u0648 \u062f\u0644\u0633\u0631\u062f\u06cc.\n\n\u0686\u0647 \u067e\u06cc\u0627\u0645\u06cc \u0627\u0632 \u0637\u0631\u0641 \u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0628\u0631\u0627\u06cc \u06cc\u0627\u062f\u0622\u0648\u0631\u06cc \u0642\u062f\u0631\u062a \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u0634\u0648\u062f\u061f"],t.w)
B.af2=new A.d(B.c,["\u201cYou\u2019re weak; nothing ever gets better.\u201d","\u201cEres d\xe9bil; nada mejora nunca.\u201d","\u201eDu bist schwach; es wird nie besser.\u201c","\u201cTu es faible ; rien ne s\u2019am\xe9liore jamais.\u201d","\u201c\u0623\u0646\u062a \u0636\u0639\u064a\u0641\u061b \u0644\u0627 \u0634\u064a\u0621 \u064a\u062a\u062d\u0633\u0646 \u0623\u0628\u062f\u064b\u0627.\u201d","\u201c\ub108\ub294 \uc57d\ud574; \uc544\ubb34\uac83\ub3c4 \ub098\uc544\uc9c0\uc9c0 \uc54a\uc544.\u201d","\u201c\u4f60\u5f88\u5f31\uff1b\u4ec0\u4e48\u4e5f\u4e0d\u4f1a\u53d8\u597d\u3002\u201d","\u201c\u0924\u0941\u092e \u0915\u092e\u091c\u094b\u0930 \u0939\u094b; \u0915\u092d\u0940 \u0915\u0941\u091b \u092d\u0940 \u092c\u0947\u0939\u0924\u0930 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964\u201d","\u201cEs infirmus; nihil umquam melioratur.\u201d","\u201cSei debole; niente migliora mai.\u201d","\u201c\u062a\u0648 \u0636\u0639\u06cc\u0641\u06cc\u061b \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0647\u0631\u06af\u0632 \u0628\u0647\u062a\u0631 \u0646\u0645\u06cc\u200c\u0634\u0648\u062f.\u201d"],t.w)
