B.abD=new A.d(B.c,["\u201cThis day is hard, but you\u2019ve handled tough things before. Rest and try again tomorrow.\u201d","\u201cEste d\xeda es dif\xedcil, pero ya has manejado cosas dif\xedciles antes. Descansa y vuelve a intentarlo ma\xf1ana.\u201d","\u201eDieser Tag ist hart, aber du hast schon schwierige Dinge gemeistert. Ruhe dich aus und versuche es morgen wieder.\u201c","\u201cCette journ\xe9e est difficile, mais tu as d\xe9j\xe0 affront\xe9 des choses difficiles. Repose-toi et essaie \xe0 nouveau demain.\u201d","\u201c\u0647\u0630\u0627 \u0627\u0644\u064a\u0648\u0645 \u0635\u0639\u0628\u060c \u0644\u0643\u0646\u0643 \u062a\u0639\u0627\u0645\u0644\u062a \u0645\u0639 \u0623\u0645\u0648\u0631 \u0635\u0639\u0628\u0629 \u0645\u0646 \u0642\u0628\u0644. \u0627\u0633\u062a\u0631\u062d \u0648\u062d\u0627\u0648\u0644 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649 \u063a\u062f\u064b\u0627.\u201d","\u201c\uc624\ub298\uc740 \ud798\ub4e4\uc5c8\uc9c0\ub9cc, \ub108\ub294 \uc774\uc804\uc5d0\ub3c4 \ud798\ub4e0 \uc77c\ub4e4\uc744 \uc798 \ucc98\ub9ac\ud588\uc5b4. \uc26c\uace0 \ub0b4\uc77c \ub2e4\uc2dc \uc2dc\ub3c4\ud574\ubd10.\u201d","\u201c\u4eca\u5929\u5f88\u96be\uff0c\u4f46\u4f60\u4e4b\u524d\u4e5f\u5904\u7406\u8fc7\u56f0\u96be\u7684\u4e8b\u60c5\u3002\u4f11\u606f\u4e00\u4e0b\uff0c\u660e\u5929\u518d\u8bd5\u3002\u201d","\u201c\u092f\u0939 \u0926\u093f\u0928 \u0915\u0920\u093f\u0928 \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0924\u0941\u092e \u092a\u0939\u0932\u0947 \u092d\u0940 \u0915\u0920\u093f\u0928 \u091a\u0940\u091c\u094b\u0902 \u0915\u094b \u0938\u0902\u092d\u093e\u0932 \u091a\u0941\u0915\u0947 \u0939\u094b\u0964 \u0906\u0930\u093e\u092e \u0915\u0930\u094b \u0914\u0930 \u0915\u0932 \u092b\u093f\u0930 \u0938\u0947 \u0915\u094b\u0936\u093f\u0936 \u0915\u0930\u094b\u0964\u201d","\u201cHic dies durus est, sed antea res difficiles tractavisti. Quiesce et cras iterum conare.\u201d","\u201cQuesto giorno \xe8 difficile, ma hai gi\xe0 affrontato cose difficili. Riposa e prova di nuovo domani.\u201d","\u201c\u0627\u06cc\u0646 \u0631\u0648\u0632 \u0633\u062e\u062a \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u062a\u0648 \u0642\u0628\u0644\u0627\u064b \u06a9\u0627\u0631\u0647\u0627\u06cc \u0633\u062e\u062a\u06cc \u0631\u0627 \u0645\u062f\u06cc\u0631\u06cc\u062a \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc. \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646 \u0648 \u0641\u0631\u062f\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646.\u201d"],t.w)
