B.abq=new A.d(B.c,["\u201cYou should never have tried; it was destined to fail.\u201d","\u201cNunca debiste haber intentado; estaba destinado al fracaso.\u201d","\u201eDu h\xe4ttest es niemals versuchen sollen; es war dazu bestimmt zu scheitern.\u201c","\u201cTu n\u2019aurais jamais d\xfb essayer ; c\u2019\xe9tait destin\xe9 \xe0 \xe9chouer.\u201d","\u201c\u0644\u0645 \u064a\u0643\u0646 \u064a\u062c\u0628 \u0623\u0646 \u062a\u062d\u0627\u0648\u0644 \u0623\u0628\u062f\u064b\u0627. \u0643\u0627\u0646 \u0645\u0646 \u0627\u0644\u0645\u062d\u062a\u0648\u0645 \u0623\u0646 \u062a\u0641\u0634\u0644.\u201d","\u201c\ub108\ub294 \uc808\ub300 \uc2dc\ub3c4\ud558\uc9c0 \ub9d0\uc558\uc5b4\uc57c \ud588\ub2e4; \uadf8\uac83\uc740 \uc2e4\ud328\ud560 \uc6b4\uba85\uc774\uc5c8\uc5b4.\u201d","\u201c\u4f60\u6c38\u8fdc\u4e0d\u8be5\u5c1d\u8bd5; \u5b83\u6ce8\u5b9a\u8981\u5931\u8d25\u3002\u201d","\u201c\u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0915\u092d\u0940 \u0915\u094b\u0936\u093f\u0936 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f \u0925\u0940; \u092f\u0939 \u0905\u0938\u092b\u0932 \u0939\u094b\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0932\u093f\u0916\u093e \u0917\u092f\u093e \u0925\u093e\u0964\u201d","\u201cNumquam conari debebas; id destinatum erat ad defectionem.\u201d","\u201cNon avresti mai dovuto provare; era destinato a fallire.\u201d","\u201c\u0647\u0631\u06af\u0632 \u0646\u0628\u0627\u06cc\u062f \u0627\u0645\u062a\u062d\u0627\u0646 \u0645\u06cc\u200c\u06a9\u0631\u062f\u06cc\u061b \u0627\u06cc\u0646 \u0627\u0632 \u0627\u0628\u062a\u062f\u0627 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0646 \u0628\u0648\u062f.\u201d"],t.w)
