B.a9B=new A.d(B.c,["A supportive future-self message encourages rest and reassures you that things can improve with time and effort.","Un mensaje de futuro yo que apoya te anima a descansar y te asegura que las cosas pueden mejorar con el tiempo y el esfuerzo.","Eine unterst\xfctzende Nachricht aus der Zukunft ermutigt dich, dich auszuruhen, und versichert dir, dass sich mit Zeit und M\xfche Dinge verbessern k\xf6nnen.","Un message de futur soi encourage le repos et te rassure que les choses peuvent s\u2019am\xe9liorer avec le temps et les efforts.","\u0631\u0633\u0627\u0644\u0629 \u062f\u0627\u0639\u0645\u0629 \u0645\u0646 \u0646\u0641\u0633\u0643 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u062a\u0634\u062c\u0639\u0643 \u0639\u0644\u0649 \u0627\u0644\u0631\u0627\u062d\u0629 \u0648\u062a\u0624\u0643\u062f \u0644\u0643 \u0623\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u062a\u062d\u0633\u0646 \u0645\u0639 \u0645\u0631\u0648\u0631 \u0627\u0644\u0648\u0642\u062a \u0648\u0627\u0644\u062c\u0647\u062f.","\uc9c0\uc9c0\ud558\ub294 \ubbf8\ub798\uc758 \uba54\uc2dc\uc9c0\ub294 \ud734\uc2dd\uc744 \ucde8\ud558\ub77c\uace0 \uaca9\ub824\ud558\uace0 \uc2dc\uac04\uc774 \uc9c0\ub098\uba74 \uc0c1\ud669\uc774 \uc88b\uc544\uc9c8 \uc218 \uc788\ub2e4\uace0 \uc548\uc2ec\uc2dc\ud0b5\ub2c8\ub2e4.","\u652f\u6301\u6027\u7684\u672a\u6765\u4fe1\u606f\u9f13\u52b1\u4f11\u606f\uff0c\u5e76\u5411\u4f60\u4fdd\u8bc1\uff0c\u4e8b\u60c5\u53ef\u4ee5\u901a\u8fc7\u65f6\u95f4\u548c\u52aa\u529b\u5f97\u5230\u6539\u5584\u3002","\u090f\u0915 \u0938\u0939\u093e\u092f\u0915 \u092d\u0935\u093f\u0937\u094d\u092f-\u0938\u094d\u0935\u092f\u0902 \u0938\u0902\u0926\u0947\u0936 \u0906\u0930\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092a\u094d\u0930\u094b\u0924\u094d\u0938\u093e\u0939\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0914\u0930 \u092f\u0939 \u0906\u0936\u094d\u0935\u0938\u094d\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u0938\u092e\u092f \u0914\u0930 \u092a\u094d\u0930\u092f\u093e\u0938 \u0915\u0947 \u0938\u093e\u0925 \u091a\u0940\u091c\u0947\u0902 \u092c\u0947\u0939\u0924\u0930 \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948\u0902\u0964","Nuntium futurum te adiuvat quietem et securitatem, quod res cum tempore et conatu meliorare possunt.","Un messaggio di futuro s\xe9 ti incoraggia a riposare e ti assicura che le cose possano migliorare con il tempo e lo sforzo.","\u06cc\u06a9 \u067e\u06cc\u0627\u0645 \u062d\u0645\u0627\u06cc\u062a\u06cc \u0627\u0632 \u062e\u0648\u062f \u0622\u06cc\u0646\u062f\u0647\u200c\u062a\u0627\u0646 \u0634\u0645\u0627 \u0631\u0627 \u0628\u0647 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u062a\u0634\u0648\u06cc\u0642 \u0645\u06cc\u200c\u06a9\u0646\u062f \u0648 \u0628\u0647 \u0634\u0645\u0627 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u0628\u0627 \u0632\u0645\u0627\u0646 \u0648 \u062a\u0644\u0627\u0634\u060c \u0627\u0645\u0648\u0631 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0628\u0647\u0628\u0648\u062f \u06cc\u0627\u0628\u0646\u062f."],t.w)
