B.abz=new A.d(B.c,["Your thought:\n\u201cI messed up that presentation; I am embarrassing and hopeless.\u201d\n\nIf your best friend said this about themselves, what is a more compassionate reply?","Tu pensamiento:\n\u201cArruin\xe9 esa presentaci\xf3n; soy una verg\xfcenza y no tengo esperanza.\u201d\n\nSi tu mejor amigo dijera esto sobre s\xed mismo, \xbfcu\xe1l ser\xeda una respuesta m\xe1s compasiva?","Dein Gedanke:\n\u201eIch habe die Pr\xe4sentation vermasselt; ich bin peinlich und hoffnungslos.\u201c\n\nWenn dein bester Freund dies \xfcber sich selbst sagen w\xfcrde, was w\xe4re eine mitf\xfchlendere Antwort?","Votre pens\xe9e :\n\u201cJ'ai rat\xe9 cette pr\xe9sentation ; je suis embarrassant et sans espoir.\u201d\n\nSi votre meilleur ami disait cela \xe0 propos de lui-m\xeame, quelle serait une r\xe9ponse plus compatissante ?","\u0641\u0643\u0631\u062a\u0643:\n\u201c\u0644\u0642\u062f \u0623\u062e\u0641\u0642\u062a \u0641\u064a \u062a\u0644\u0643 \u0627\u0644\u0639\u0631\u0636\u061b \u0623\u0646\u0627 \u0645\u062d\u0631\u062c \u0648\u0628\u0644\u0627 \u0623\u0645\u0644.\u201d\n\n\u0625\u0630\u0627 \u0642\u0627\u0644 \u0635\u062f\u064a\u0642\u0643 \u0627\u0644\u0645\u0642\u0631\u0628 \u0647\u0630\u0627 \u0639\u0646 \u0646\u0641\u0633\u0647\u060c \u0645\u0627 \u0647\u064a \u0627\u0644\u0625\u062c\u0627\u0628\u0629 \u0627\u0644\u0623\u0643\u062b\u0631 \u062a\u0639\u0627\u0637\u0641\u064b\u0627\u061f","\ub2f9\uc2e0\uc758 \uc0dd\uac01:\n\u201c\ub098\ub294 \uadf8 \ubc1c\ud45c\ub97c \ub9dd\ucce4\ub2e4; \ub098\ub294 \ubd80\ub044\ub7fd\uace0 \ud76c\ub9dd\uc774 \uc5c6\ub2e4.\u201d\n\n\ub9cc\uc57d \ub2f9\uc2e0\uc758 \uac00\uc7a5 \uce5c\ud55c \uce5c\uad6c\uac00 \uc790\uc2e0\uc5d0 \ub300\ud574 \uc774\ub807\uac8c \ub9d0\ud55c\ub2e4\uba74, \ub354 \uc790\ube44\ub85c\uc6b4 \ub300\ub2f5\uc740 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u4f60\u7684\u60f3\u6cd5\uff1a\n\u201c\u6211\u641e\u7838\u4e86\u90a3\u4e2a\u6f14\u8bb2\uff1b\u6211\u5f88\u5c34\u5c2c\uff0c\u6beb\u65e0\u5e0c\u671b\u3002\u201d\n\n\u5982\u679c\u4f60\u7684\u597d\u670b\u53cb\u5bf9\u81ea\u5df1\u8fd9\u4e48\u8bf4\uff0c\u4ec0\u4e48\u662f\u66f4\u6709\u540c\u60c5\u5fc3\u7684\u56de\u7b54\uff1f","\u0906\u092a\u0915\u093e \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0909\u0938 \u092a\u094d\u0930\u0938\u094d\u0924\u0941\u0924\u093f \u0915\u094b \u092c\u093f\u0917\u093e\u0921\u093c \u0926\u093f\u092f\u093e; \u092e\u0948\u0902 \u0936\u0930\u094d\u092e\u0928\u093e\u0915 \u0914\u0930 \u0928\u093f\u0930\u093e\u0936\u093e\u091c\u0928\u0915 \u0939\u0942\u0902\u0964\u201d\n\n\u0905\u0917\u0930 \u0906\u092a\u0915\u093e \u0938\u092c\u0938\u0947 \u0905\u091a\u094d\u091b\u093e \u0926\u094b\u0938\u094d\u0924 \u0916\u0941\u0926 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0910\u0938\u093e \u0915\u0939\u0924\u093e, \u0924\u094b \u0915\u094d\u092f\u093e \u0939\u094b\u0917\u093e \u090f\u0915 \u0914\u0930 \u0905\u0927\u093f\u0915 \u0938\u0939\u093e\u0928\u0941\u092d\u0942\u0924\u093f\u092a\u0942\u0930\u094d\u0923 \u0909\u0924\u094d\u0924\u0930?","Cogitatio tua:\n\u201cEgo erravi in illa praesentatio; ego sum turpium et sine spe.\u201d\n\nSi amicus tuus optimus hoc de seipso diceret, quid esset responsum magis misericors?","Il tuo pensiero:\n\u201cHo rovinato quella presentazione; sono imbarazzante e senza speranza.\u201d\n\nSe il tuo migliore amico dicesse questo su se stesso, qual \xe8 una risposta pi\xf9 compassionevole?","\u0641\u06a9\u0631\u062a\u0627\u0646:\n\u201c\u0645\u0646 \u0622\u0646 \u0627\u0631\u0627\u0626\u0647 \u0631\u0627 \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f\u0645\u061b \u0645\u0646 \u0634\u0631\u0645 \u0622\u0648\u0631 \u0648 \u0628\u06cc\u200c\u0627\u0645\u06cc\u062f \u0647\u0633\u062a\u0645.\u201d\n\n\u0627\u06af\u0631 \u0628\u0647\u062a\u0631\u06cc\u0646 \u062f\u0648\u0633\u062a \u0634\u0645\u0627 \u0627\u06cc\u0646 \u0631\u0627 \u062f\u0631 \u0645\u0648\u0631\u062f \u062e\u0648\u062f \u0645\u06cc\u200c\u06af\u0641\u062a\u060c \u067e\u0627\u0633\u062e \u0645\u0647\u0631\u0628\u0627\u0646\u0627\u0646\u0647\u200c\u062a\u0631\u06cc \u0686\u06cc\u0633\u062a\u061f"],t.w)
B.adE=new A.d(B.c,["\u201cYes, you are hopeless. Please never speak again.\u201d","\u201cS\xed, eres in\xfatil. Por favor, nunca hables de nuevo.\u201d","\u201eJa, du bist hoffnungslos. Bitte sprich nie wieder.\u201c","\u201cOui, tu es sans espoir. S'il te pla\xeet, ne parle plus jamais.\u201d","\u201c\u0646\u0639\u0645\u060c \u0623\u0646\u062a \u0628\u0644\u0627 \u0623\u0645\u0644. \u0645\u0646 \u0641\u0636\u0644\u0643 \u0644\u0627 \u062a\u062a\u062d\u062f\u062b \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.\u201d","\u201c\ub124, \ub2f9\uc2e0\uc740 \ud76c\ub9dd\uc774 \uc5c6\uc2b5\ub2c8\ub2e4. \ub2e4\uc2dc\ub294 \ub9d0\ud558\uc9c0 \ub9c8\uc138\uc694.\u201d","\u201c\u662f\u7684\uff0c\u4f60\u6beb\u65e0\u5e0c\u671b\u3002\u8bf7\u4e0d\u8981\u518d\u8bf4\u8bdd\u4e86\u3002\u201d","\u201c\u0939\u093e\u0902, \u0924\u0941\u092e \u0928\u093f\u0930\u093e\u0936 \u0939\u094b\u0964 \u0915\u0943\u092a\u092f\u093e \u0915\u092d\u0940 \u092b\u093f\u0930 \u0938\u0947 \u092c\u093e\u0924 \u092e\u0924 \u0915\u0930\u094b\u0964\u201d","\u201cIta vero, tu es sine spe. Quaeso, ne umquam loquaris iterum.\u201d","\u201cS\xec, sei senza speranza. Per favore, non parlare mai pi\xf9.\u201d","\u201c\u0628\u0644\u0647\u060c \u0634\u0645\u0627 \u0628\u06cc\u200c\u0627\u0645\u06cc\u062f \u0647\u0633\u062a\u06cc\u062f. \u0644\u0637\u0641\u0627\u064b \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0635\u062d\u0628\u062a \u0646\u06a9\u0646\u06cc\u062f.\u201d"],t.w)
