B.aaM=new A.d(B.c,["\u201cYou were nervous and some parts were rough, but that does not erase your skills or your chances to improve.\u201d","\u201cEstabas nervioso y algunas partes fueron duras, pero eso no borra tus habilidades ni tus oportunidades de mejorar.\u201d","\u201eDu warst nerv\xf6s und einige Teile waren holprig, aber das l\xf6scht nicht deine F\xe4higkeiten oder deine Chancen, dich zu verbessern.\u201c","\u201cTu \xe9tais nerveux et certaines parties \xe9taient difficiles, mais cela n\u2019efface pas tes comp\xe9tences ni tes chances de t\u2019am\xe9liorer.\u201d","\u201c\u0643\u0646\u062a \u0645\u062a\u0648\u062a\u0631\u064b\u0627 \u0648\u0628\u0639\u0636 \u0627\u0644\u0623\u062c\u0632\u0627\u0621 \u0643\u0627\u0646\u062a \u0635\u0639\u0628\u0629\u060c \u0644\u0643\u0646 \u0647\u0630\u0627 \u0644\u0627 \u064a\u0645\u062d\u064a \u0645\u0647\u0627\u0631\u0627\u062a\u0643 \u0623\u0648 \u0641\u0631\u0635\u0643 \u0644\u0644\u062a\u062d\u0633\u0646.\u201d","\u201c\ub2f9\uc2e0\uc740 \uae34\uc7a5\ud588\uc5c8\uace0 \uc77c\ubd80 \ubd80\ubd84\uc740 \uac70\uce60\uc5c8\uc9c0\ub9cc, \uadf8\uac83\uc774 \ub2f9\uc2e0\uc758 \ub2a5\ub825\uc774\ub098 \uac1c\uc120 \uae30\ud68c\ub97c \uc5c6\uc560\uc9c0\ub294 \uc54a\uc2b5\ub2c8\ub2e4.\u201d","\u201c\u4f60\u5f88\u7d27\u5f20\uff0c\u67d0\u4e9b\u90e8\u5206\u5f88\u751f\u786c\uff0c\u4f46\u8fd9\u5e76\u4e0d\u62b9\u53bb\u4f60\u7684\u6280\u80fd\u6216\u63d0\u9ad8\u7684\u673a\u4f1a\u3002\u201d","\u201c\u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0918\u092c\u0930\u093e\u0939\u091f \u0925\u0940 \u0914\u0930 \u0915\u0941\u091b \u0939\u093f\u0938\u094d\u0938\u0947 \u0915\u0920\u093f\u0928 \u0925\u0947, \u0932\u0947\u0915\u093f\u0928 \u092f\u0939 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u0915\u094d\u0937\u092e\u0924\u093e\u0913\u0902 \u092f\u093e \u0938\u0941\u0927\u093e\u0930 \u0915\u0947 \u0905\u0935\u0938\u0930\u094b\u0902 \u0915\u094b \u092e\u093f\u091f\u093e\u0924\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\u201d","\u201cNervosus eras et quaedam pars erat difficilis, sed hoc non tollit tuas artes vel vias meliorandi.\u201d","\u201cEri nervoso e alcune parti sono state difficili, ma questo non cancella le tue capacit\xe0 o le tue possibilit\xe0 di migliorare.\u201d","\u201c\u0634\u0645\u0627 \u0639\u0635\u0628\u06cc \u0628\u0648\u062f\u06cc\u062f \u0648 \u0628\u0631\u062e\u06cc \u0642\u0633\u0645\u062a\u200c\u0647\u0627 \u062f\u0634\u0648\u0627\u0631 \u0628\u0648\u062f\u0646\u062f\u060c \u0627\u0645\u0627 \u0627\u06cc\u0646 \u0645\u0647\u0627\u0631\u062a\u200c\u0647\u0627 \u06cc\u0627 \u0641\u0631\u0635\u062a\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0628\u0631\u0627\u06cc \u0628\u0647\u0628\u0648\u062f \u0631\u0627 \u0627\u0632 \u0628\u06cc\u0646 \u0646\u0645\u06cc\u200c\u0628\u0631\u062f.\u201d"],t.w)
