B.abp=new A.d(B.c,["\u201cFeel nothing. Just move on and never think about it.\u201d","\u201cNo sientas nada. Simplemente sigue adelante y nunca pienses en ello.\u201d","\u201eF\xfchl nichts. Geh einfach weiter und denke nie wieder daran.\u201c","\u201cNe ressens rien. Passe juste \xe0 autre chose et ne pense plus jamais \xe0 \xe7a.\u201d","\u201c\u0644\u0627 \u062a\u0634\u0639\u0631 \u0628\u0623\u064a \u0634\u064a\u0621. \u0641\u0642\u0637 \u0627\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u0645\u0636\u064a \u0642\u062f\u0645\u064b\u0627 \u0648\u0644\u0627 \u062a\u0641\u0643\u0631 \u0641\u064a \u0630\u0644\u0643 \u0623\u0628\u062f\u064b\u0627.\u201d","\u201c\uc544\ubb34\uac83\ub3c4 \ub290\ub07c\uc9c0 \ub9c8\uc138\uc694. \uadf8\ub0e5 \uc9c0\ub098\uac00\uace0 \ub2e4\uc2dc\ub294 \uadf8\uc5d0 \ub300\ud574 \uc0dd\uac01\ud558\uc9c0 \ub9c8\uc138\uc694.\u201d","\u201c\u4e0d\u8981\u611f\u53d7\u4efb\u4f55\u4e1c\u897f\u3002\u53ea\u9700\u7ee7\u7eed\u524d\u8fdb\uff0c\u518d\u4e5f\u4e0d\u8981\u60f3\u8d77\u5b83\u3002\u201d","\u201c\u0915\u0941\u091b \u092e\u0924 \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u094b\u0964 \u092c\u0938 \u0906\u0917\u0947 \u092c\u0922\u093c\u094b \u0914\u0930 \u0907\u0938\u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0915\u092d\u0940 \u092e\u0924 \u0938\u094b\u091a\u094b\u0964\u201d","\u201cNihil sentias. Solum procedas et numquam de hoc cogites.\u201d","\u201cNon sentire nulla. Vai avanti e non pensarci mai pi\xf9.\u201d","\u201c\u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0627\u062d\u0633\u0627\u0633 \u0646\u06a9\u0646\u06cc\u062f. \u0641\u0642\u0637 \u0628\u0647 \u062c\u0644\u0648 \u0628\u0631\u0648\u06cc\u062f \u0648 \u0647\u0631\u06af\u0632 \u0628\u0647 \u0622\u0646 \u0641\u06a9\u0631 \u0646\u06a9\u0646\u06cc\u062f.\u201d"],t.w)
