B.a99=new A.d(B.c,["Compassionate responses acknowledge struggle without erasing worth or possibility.","Las respuestas compasivas reconocen la lucha sin borrar el valor ni la posibilidad.","Mitf\xfchlende Antworten erkennen den Kampf an, ohne den Wert oder die M\xf6glichkeit zu l\xf6schen.","Les r\xe9ponses compatissantes reconnaissent la lutte sans effacer la valeur ou la possibilit\xe9.","\u0627\u0644\u0631\u062f\u0648\u062f \u0627\u0644\u0631\u062d\u064a\u0645\u0629 \u062a\u0639\u062a\u0631\u0641 \u0628\u0627\u0644\u0635\u0631\u0627\u0639 \u062f\u0648\u0646 \u0645\u062d\u0648 \u0627\u0644\u0642\u064a\u0645\u0629 \u0623\u0648 \u0627\u0644\u0625\u0645\u0643\u0627\u0646\u064a\u0629.","\uc790\ube44\ub85c\uc6b4 \ub2f5\ubcc0\uc740 \uac00\uce58\ub098 \uac00\ub2a5\uc131\uc744 \uc9c0\uc6b0\uc9c0 \uc54a\uace0 \ud22c\uc7c1\uc744 \uc778\uc815\ud569\ub2c8\ub2e4.","\u5bcc\u6709\u540c\u60c5\u5fc3\u7684\u56de\u7b54\u627f\u8ba4\u6597\u4e89\uff0c\u800c\u4e0d\u62b9\u53bb\u4ef7\u503c\u6216\u53ef\u80fd\u6027\u3002","\u0938\u0939\u093e\u0928\u0941\u092d\u0942\u0924\u093f\u092a\u0942\u0930\u094d\u0923 \u0909\u0924\u094d\u0924\u0930 \u0938\u0902\u0918\u0930\u094d\u0937 \u0915\u094b \u0938\u094d\u0935\u0940\u0915\u093e\u0930 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u092c\u093f\u0928\u093e \u092e\u0942\u0932\u094d\u092f \u092f\u093e \u0938\u0902\u092d\u093e\u0935\u0928\u093e \u0915\u094b \u092e\u093f\u091f\u093e\u090f\u0964","Responsa misericordia agnoscunt certamen sine abolendo valorem vel possibilitatem.","Le risposte compassionevoli riconoscono la lotta senza cancellare il valore o la possibilit\xe0.","\u067e\u0627\u0633\u062e\u200c\u0647\u0627\u06cc \u0645\u0647\u0631\u0628\u0627\u0646\u0627\u0646\u0647\u060c \u0645\u0628\u0627\u0631\u0632\u0647 \u0631\u0627 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u0646\u062f\u060c \u0628\u062f\u0648\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0627\u0631\u0632\u0634 \u06cc\u0627 \u0627\u0645\u06a9\u0627\u0646 \u0631\u0627 \u0627\u0632 \u0628\u06cc\u0646 \u0628\u0628\u0631\u0646\u062f."],t.w)
