B.aau=new A.d(B.c,["Your thought:\n\u201cI haven't done enough today. I need to work harder to be worthy.\u201d\n\nWhat would a compassionate reframe sound like?","Tu pensamiento:\n\u201cNo he hecho suficiente hoy. Necesito trabajar m\xe1s duro para ser digno.\u201d\n\n\xbfC\xf3mo sonar\xeda una reformulaci\xf3n compasiva?","Dein Gedanke:\n\u201eIch habe heute nicht genug getan. Ich muss h\xe4rter arbeiten, um w\xfcrdig zu sein.\u201c\n\nWie w\xfcrde eine mitf\xfchlende Umformulierung klingen?","Votre pens\xe9e :\n\u201cJe n'ai pas fait assez aujourd'hui. Je dois travailler plus dur pour \xeatre digne.\u201d\n\nComment sonnerait une reformulation compatissante ?","\u0641\u0643\u0631\u062a\u0643:\n\u201c\u0644\u0645 \u0623\u0641\u0639\u0644 \u0645\u0627 \u064a\u0643\u0641\u064a \u0627\u0644\u064a\u0648\u0645. \u064a\u062c\u0628 \u0639\u0644\u064a \u0627\u0644\u0639\u0645\u0644 \u0623\u0643\u062b\u0631 \u0644\u0623\u0643\u0648\u0646 \u062c\u062f\u064a\u0631\u064b\u0627.\u201d\n\n\u0643\u064a\u0641 \u0633\u062a\u0628\u062f\u0648 \u0625\u0639\u0627\u062f\u0629 \u0635\u064a\u0627\u063a\u0629 \u062a\u0639\u0627\u0637\u0641\u064a\u0629\u061f","\ub2f9\uc2e0\uc758 \uc0dd\uac01:\n\u201c\uc624\ub298 \ucda9\ubd84\ud788 \ud558\uc9c0 \uc54a\uc558\uc5b4. \ub098\ub294 \uc790\uaca9\uc744 \uac16\ucd94\uae30 \uc704\ud574 \ub354 \uc5f4\uc2ec\ud788 \uc77c\ud574\uc57c \ud574.\u201d\n\n\uc790\ube44\ub85c\uc6b4 \uc7ac\uad6c\uc131\uc740 \uc5b4\ub5bb\uac8c \ub4e4\ub9b4\uae4c\uc694?","\u4f60\u7684\u60f3\u6cd5\uff1a\n\u201c\u4eca\u5929\u6211\u505a\u5f97\u4e0d\u591f\u3002\u6211\u9700\u8981\u66f4\u52a0\u52aa\u529b\u5de5\u4f5c\u624d\u80fd\u914d\u5f97\u4e0a\u3002\u201d\n\n\u4e00\u4e2a\u6709\u540c\u60c5\u5fc3\u7684\u91cd\u65b0\u6846\u67b6\u4f1a\u662f\u4ec0\u4e48\u6837\u7684\uff1f","\u0906\u092a\u0915\u093e \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0906\u091c \u0915\u093e\u092b\u0940 \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e\u0964 \u092e\u0941\u091d\u0947 \u092f\u094b\u0917\u094d\u092f \u0939\u094b\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0914\u0930 \u0905\u0927\u093f\u0915 \u092e\u0947\u0939\u0928\u0924 \u0915\u0930\u0928\u0940 \u0939\u094b\u0917\u0940\u0964\u201d\n\n\u090f\u0915 \u0938\u0939\u093e\u0928\u0941\u092d\u0942\u0924\u093f\u092a\u0942\u0930\u094d\u0923 \u092a\u0941\u0928\u0930\u094d\u0935\u093f\u091a\u093e\u0930 \u0915\u0948\u0938\u093e \u0939\u094b\u0917\u093e?","Cogitatio tua:\n\u201cHodie satis non feci. Opus est ut amplius laborer ad dignitatem consequendam.\u201d\n\nQuomodo sonaret misericordiam reframing?","Il tuo pensiero:\n\u201cOggi non ho fatto abbastanza. Devo lavorare di pi\xf9 per essere degno.\u201d\n\nCome suonerebbe una riformulazione compassionevole?","\u0641\u06a9\u0631\u062a\u0627\u0646:\n\u201c\u0627\u0645\u0631\u0648\u0632 \u06a9\u0627\u0641\u06cc \u06a9\u0627\u0631 \u0646\u06a9\u0631\u062f\u0645. \u0628\u0631\u0627\u06cc \u0634\u0627\u06cc\u0633\u062a\u0647 \u0628\u0648\u062f\u0646 \u0628\u0627\u06cc\u062f \u0633\u062e\u062a\u200c\u062a\u0631 \u06a9\u0627\u0631 \u06a9\u0646\u0645.\u201d\n\n\u06cc\u06a9 \u0628\u0627\u0632\u0641\u0631\u0645\u200c\u0633\u0627\u0632\u06cc \u0647\u0645\u062f\u0644\u0627\u0646\u0647 \u0686\u06af\u0648\u0646\u0647 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f\u061f"],t.w)
B.a7E=new A.d(B.c,["\u201cYou are not doing enough; you need to work harder.\u201d","\u201cNo est\xe1s haciendo suficiente; necesitas trabajar m\xe1s duro.\u201d","\u201eDu machst nicht genug; du musst h\xe4rter arbeiten.\u201c","\u201cTu ne fais pas assez ; tu dois travailler plus dur.\u201d","\u201c\u0623\u0646\u062a \u0644\u0627 \u062a\u0641\u0639\u0644 \u0645\u0627 \u064a\u0643\u0641\u064a\u061b \u064a\u062c\u0628 \u0639\u0644\u064a\u0643 \u0627\u0644\u0639\u0645\u0644 \u0628\u062c\u062f \u0623\u0643\u062b\u0631.\u201d","\u201c\ub108\ub294 \ucda9\ubd84\ud788 \ud558\uace0 \uc788\uc9c0 \uc54a\uc544; \ub354 \uc5f4\uc2ec\ud788 \uc77c\ud574\uc57c \ud574.\u201d","\u201c\u4f60\u505a\u5f97\u4e0d\u591f\uff1b\u4f60\u9700\u8981\u66f4\u52a0\u52aa\u529b\u3002\u201d","\u201c\u0924\u0941\u092e \u0915\u093e\u092b\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0930\u0939\u0947 \u0939\u094b; \u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0914\u0930 \u092e\u0947\u0939\u0928\u0924 \u0915\u0930\u0928\u0940 \u0939\u094b\u0917\u0940\u0964\u201d","\u201cNon satis facis; opus est ut amplius laboras.\u201d","\u201cNon stai facendo abbastanza; devi lavorare di pi\xf9.\u201d","\u201c\u062a\u0648 \u06a9\u0627\u0641\u06cc \u06a9\u0627\u0631 \u0646\u0645\u06cc\u200c\u06a9\u0646\u06cc\u061b \u0628\u0627\u06cc\u062f \u0633\u062e\u062a\u200c\u062a\u0631 \u06a9\u0627\u0631 \u06a9\u0646\u06cc.\u201d"],t.w)
