B.adV=new A.d(B.c,["\u201cYou did well today; everyone needs rest. Your efforts matter, even on slow days.\u201d","\u201cLo hiciste bien hoy; todos necesitan descansar. Tus esfuerzos importan, incluso en los d\xedas lentos.\u201d","\u201eDu hast heute gut gearbeitet; jeder braucht Ruhe. Deine Bem\xfchungen z\xe4hlen, auch an langsamen Tagen.\u201c","\u201cTu as bien travaill\xe9 aujourd'hui ; tout le monde a besoin de repos. Tes efforts comptent, m\xeame les jours lents.\u201d","\u201c\u0644\u0642\u062f \u0642\u0645\u062a \u0628\u0639\u0645\u0644 \u062c\u064a\u062f \u0627\u0644\u064a\u0648\u0645\u061b \u064a\u062d\u062a\u0627\u062c \u0627\u0644\u062c\u0645\u064a\u0639 \u0644\u0644\u0631\u0627\u062d\u0629. \u062c\u0647\u0648\u062f\u0643 \u0645\u0647\u0645\u0629\u060c \u062d\u062a\u0649 \u0641\u064a \u0627\u0644\u0623\u064a\u0627\u0645 \u0627\u0644\u0628\u0637\u064a\u0626\u0629.\u201d","\u201c\uc624\ub298 \uc798\ud588\uc5b4; \ubaa8\ub450\ub294 \ud734\uc2dd\uc774 \ud544\uc694\ud574. \ub290\ub9b0 \ub0a0\uc5d0\ub3c4 \ub124 \ub178\ub825\uc740 \uc911\uc694\ud574.\u201d","\u201c\u4eca\u5929\u4f60\u505a\u5f97\u5f88\u597d\uff1b\u6bcf\u4e2a\u4eba\u90fd\u9700\u8981\u4f11\u606f\u3002\u5373\u4f7f\u662f\u7f13\u6162\u7684\u65e5\u5b50\uff0c\u4f60\u7684\u52aa\u529b\u4e5f\u5f88\u91cd\u8981\u3002\u201d","\u201c\u0906\u092a\u0928\u0947 \u0906\u091c \u0905\u091a\u094d\u091b\u093e \u0915\u093f\u092f\u093e; \u0938\u092d\u0940 \u0915\u094b \u0906\u0930\u093e\u092e \u0915\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u0927\u0940\u092e\u0947 \u0926\u093f\u0928\u094b\u0902 \u092e\u0947\u0902 \u092d\u0940 \u0906\u092a\u0915\u0947 \u092a\u094d\u0930\u092f\u093e\u0938 \u092e\u093e\u092f\u0928\u0947 \u0930\u0916\u0924\u0947 \u0939\u0948\u0902\u0964\u201d","\u201cBene fecisti hodie; omnes requiescunt. Tua conamina sunt momenti, etiam in diebus tardis.\u201d","\u201cHai fatto bene oggi; tutti hanno bisogno di riposo. I tuoi sforzi contano, anche nei giorni lenti.\u201d","\u201c\u0627\u0645\u0631\u0648\u0632 \u062e\u0648\u0628 \u06a9\u0627\u0631 \u06a9\u0631\u062f\u06cc\u061b \u0647\u0645\u0647 \u0628\u0647 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0646\u06cc\u0627\u0632 \u062f\u0627\u0631\u0646\u062f. \u062a\u0644\u0627\u0634\u200c\u0647\u0627\u06cc \u062a\u0648 \u062d\u062a\u06cc \u062f\u0631 \u0631\u0648\u0632\u0647\u0627\u06cc \u06a9\u0646\u062f \u0647\u0645 \u0645\u0647\u0645 \u0627\u0633\u062a.\u201d"],t.w)
