B.abX=new A.d(B.c,["\u201cNothing matters; you are worthless.\u201d","\u201cNada importa; no vales nada.\u201d","\u201eNichts z\xe4hlt; du bist wertlos.\u201c","\u201cRien n'a d'importance ; tu es sans valeur.\u201d","\u201c\u0644\u0627 \u0634\u064a\u0621 \u064a\u0647\u0645\u061b \u0623\u0646\u062a \u0628\u0644\u0627 \u0642\u064a\u0645\u0629.\u201d","\u201c\uc544\ubb34\uac83\ub3c4 \uc911\uc694\ud558\uc9c0 \uc54a\uc544; \ub108\ub294 \uac00\uce58\uac00 \uc5c6\uc5b4.\u201d","\u201c\u6ca1\u6709\u4ec0\u4e48\u91cd\u8981\uff1b\u4f60\u4e00\u65e0\u662f\u5904\u3002\u201d","\u201c\u0915\u0941\u091b \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e; \u0924\u0941\u092e \u092c\u0947\u092e\u093e\u0928\u0940 \u0939\u094b\u0964\u201d","\u201cNihil refert; es nullus valor.\u201d","\u201cNiente importa; sei inutile.\u201d","\u201c\u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0645\u0647\u0645 \u0646\u06cc\u0633\u062a\u061b \u062a\u0648 \u0628\u06cc\u200c\u0627\u0631\u0632\u0634 \u0647\u0633\u062a\u06cc.\u201d"],t.w)
