B.a9W=new A.d(B.c,["Missing a deadline","Perder una fecha l\xedmite","Verpassen einer Frist","Manquer une date limite","\u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0645\u0648\u0639\u062f \u0627\u0644\u0646\u0647\u0627\u0626\u064a","\ub9c8\uac10\uc77c \ub193\uce58\uae30","\u9519\u8fc7\u622a\u6b62\u65e5\u671f","\u0928\u093f\u0930\u094d\u0927\u093e\u0930\u093f\u0924 \u0938\u092e\u092f \u0938\u0940\u092e\u093e \u091a\u0942\u0915\u0928\u093e","Fines termini amissa","Perdere una scadenza","\u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0646 \u0645\u0647\u0644\u062a"],t.w)
B.a8f=new A.d(B.c,["Your thought:\n\u201cI missed the deadline. I am so irresponsible and unreliable.\u201d\n\nWhat would a compassionate friend say?","Tu pensamiento:\n\u201cPerd\xed la fecha l\xedmite. Soy tan irresponsable e inconstante.\u201d\n\n\xbfQu\xe9 dir\xeda un amigo compasivo?","Dein Gedanke:\n\u201eIch habe die Frist verpasst. Ich bin so unverantwortlich und unzuverl\xe4ssig.\u201c\n\nWas w\xfcrde ein mitf\xfchlender Freund sagen?","Votre pens\xe9e :\n\u201cJ\u2019ai rat\xe9 la date limite. Je suis tellement irresponsable et peu fiable.\u201d\n\nQue dirait un ami compatissant ?","\u0641\u0643\u0631\u062a\u0643:\n\u201c\u0641\u0642\u062f\u062a \u0627\u0644\u0645\u0648\u0639\u062f \u0627\u0644\u0646\u0647\u0627\u0626\u064a. \u0623\u0646\u0627 \u063a\u064a\u0631 \u0645\u0633\u0624\u0648\u0644 \u0644\u0644\u063a\u0627\u064a\u0629 \u0648\u063a\u064a\u0631 \u0645\u0648\u062b\u0648\u0642.\u201d\n\n\u0645\u0627\u0630\u0627 \u0633\u064a\u0642\u0648\u0644 \u0635\u062f\u064a\u0642 \u0645\u062a\u0639\u0627\u0637\u0641\u061f","\ub2f9\uc2e0\uc758 \uc0dd\uac01:\n\u201c\ub9c8\uac10\uc77c\uc744 \ub193\ucce4\uc5b4. \ub098\ub294 \ub108\ubb34 \ubb34\ucc45\uc784\ud558\uace0 \uc2e0\ub8b0\ud560 \uc218 \uc5c6\uc5b4.\u201d\n\n\uc790\ube44\ub85c\uc6b4 \uce5c\uad6c\ub294 \ubb50\ub77c\uace0 \ub9d0\ud560\uae4c\uc694?","\u4f60\u7684\u60f3\u6cd5\uff1a\n\u201c\u6211\u9519\u8fc7\u4e86\u622a\u6b62\u65e5\u671f\u3002\u6211\u592a\u4e0d\u8d1f\u8d23\u4efb\u548c\u4e0d\u53ef\u9760\u4e86\u3002\u201d\n\n\u4e00\u4e2a\u5bcc\u6709\u540c\u60c5\u5fc3\u7684\u670b\u53cb\u4f1a\u600e\u4e48\u8bf4\uff1f","\u0906\u092a\u0915\u093e \u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0938\u092e\u092f \u0938\u0940\u092e\u093e \u091a\u0942\u0915 \u0926\u0940\u0964 \u092e\u0948\u0902 \u092c\u0939\u0941\u0924 \u0939\u0940 \u0917\u0948\u0930 \u091c\u093f\u092e\u094d\u092e\u0947\u0926\u093e\u0930 \u0914\u0930 \u0905\u0935\u093f\u0936\u094d\u0935\u0938\u0928\u0940\u092f \u0939\u0942\u0902\u0964\u201d\n\n\u090f\u0915 \u0938\u0939\u093e\u0928\u0941\u092d\u0942\u0924\u093f\u092a\u0942\u0930\u094d\u0923 \u0926\u094b\u0938\u094d\u0924 \u0915\u094d\u092f\u093e \u0915\u0939\u0947\u0917\u093e?","Cogitatio tua:\n\u201cTerminum non servavi. Sum tam ignavus et infidelis.\u201d\n\nQuid amicus misericordiam dicet?","Il tuo pensiero:\n\u201cHo perso la scadenza. Sono cos\xec irresponsabile e inaffidabile.\u201d\n\nCosa direbbe un amico compassionevole?","\u0641\u06a9\u0631\u062a\u0627\u0646:\n\u201c\u0645\u0646 \u0645\u0647\u0644\u062a \u0631\u0627 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0645. \u0645\u0646 \u062e\u06cc\u0644\u06cc \u0628\u06cc\u200c\u0645\u0633\u0626\u0648\u0644\u06cc\u062a \u0648 \u063a\u06cc\u0631\u0642\u0627\u0628\u0644 \u0627\u0639\u062a\u0645\u0627\u062f \u0647\u0633\u062a\u0645.\u201d\n\n\u06cc\u06a9 \u062f\u0648\u0633\u062a \u0647\u0645\u062f\u0644 \u0686\u0647 \u062e\u0648\u0627\u0647\u062f \u06af\u0641\u062a\u061f"],t.w)
B.a8a=new A.d(B.c,["\u201cYou are right. You always mess up. Just give up.\u201d","\u201cTienes raz\xf3n. Siempre lo arruinas. Simplemente rinde.\u201d","\u201eDu hast recht. Du versagst immer. Gib einfach auf.\u201c","\u201cTu as raison. Tu g\xe2ches toujours tout. Abandonne simplement.\u201d","\u201c\u0623\u0646\u062a \u0639\u0644\u0649 \u062d\u0642. \u0623\u0646\u062a \u062f\u0627\u0626\u0645\u064b\u0627 \u062a\u062e\u0641\u0642. \u0641\u0642\u0637 \u0627\u0633\u062a\u0633\u0644\u0645.\u201d","\u201c\ub9de\uc544. \ub108\ub294 \ud56d\uc0c1 \ub9dd\uccd0. \uadf8\ub0e5 \ud3ec\uae30\ud574.\u201d","\u201c\u4f60\u8bf4\u5f97\u5bf9\u3002\u4f60\u603b\u662f\u641e\u7838\u3002\u5c31\u653e\u5f03\u5427\u3002\u201d","\u201c\u0924\u0941\u092e \u0938\u0939\u0940 \u0939\u094b\u0964 \u0924\u0941\u092e \u0939\u092e\u0947\u0936\u093e \u0917\u0932\u0924\u0940 \u0915\u0930\u0924\u0947 \u0939\u094b\u0964 \u092c\u0938 \u0939\u093e\u0930 \u092e\u093e\u0928 \u0932\u094b\u0964\u201d","\u201cRecte dicis. Semper frangis. Desiste.\u201d","\u201cHai ragione. Fallisci sempre. Arrenditi.\u201d","\u201c\u062a\u0648 \u062d\u0642 \u0628\u0627 \u062a\u0648\u0633\u062a. \u0647\u0645\u06cc\u0634\u0647 \u062e\u0631\u0627\u0628 \u0645\u06cc\u200c\u06a9\u0646\u06cc. \u0641\u0642\u0637 \u062a\u0633\u0644\u06cc\u0645 \u0634\u0648.\u201d"],t.w)
