B.acM=new A.d(B.c,["\u201cNothing matters. You\u2019re a failure and always will be.\u201d","\u201cNada importa. Eres un fracaso y siempre lo ser\xe1s.\u201d","\u201eNichts z\xe4hlt. Du bist ein Versager und wirst es immer bleiben.\u201c","\u201cRien n'a d'importance. Tu es un \xe9chec et tu le seras toujours.\u201d","\u201c\u0644\u0627 \u0634\u064a\u0621 \u064a\u0647\u0645. \u0623\u0646\u062a \u0641\u0627\u0634\u0644 \u0648\u0633\u062a\u0638\u0644 \u062f\u0627\u0626\u0645\u064b\u0627 \u0643\u0630\u0644\u0643.\u201d","\u201c\uc544\ubb34\uac83\ub3c4 \uc911\uc694\ud558\uc9c0 \uc54a\uc544. \ub108\ub294 \uc2e4\ud328\uc790\uace0 \ud56d\uc0c1 \uadf8\ub7f4 \uac70\uc57c.\u201d","\u201c\u6ca1\u6709\u4ec0\u4e48\u91cd\u8981\u3002\u4f60\u662f\u4e2a\u5931\u8d25\u8005\uff0c\u6c38\u8fdc\u90fd\u662f\u3002\u201d","\u201c\u0915\u0941\u091b \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e\u0964 \u0924\u0941\u092e \u090f\u0915 \u0905\u0938\u092b\u0932\u0924\u093e \u0939\u094b \u0914\u0930 \u0939\u092e\u0947\u0936\u093e \u0930\u0939\u094b\u0917\u0947\u0964\u201d","\u201cNihil refert. Es defectus et semper eris.\u201d","\u201cNiente importa. Sei un fallimento e lo sarai sempre.\u201d","\u201c\u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0645\u0647\u0645 \u0646\u06cc\u0633\u062a. \u062a\u0648 \u0634\u06a9\u0633\u062a\u200c\u062e\u0648\u0631\u062f\u0647 \u0647\u0633\u062a\u06cc \u0648 \u0647\u0645\u06cc\u0634\u0647 \u062e\u0648\u0627\u0647\u06cc \u0628\u0648\u062f.\u201d"],t.w)
