B.aaR=new A.d(B.c,["Thought:\n\u201cI failed this test, so I am stupid and will never succeed.\u201d\n\nWhich story filter (distortion) fits this thought best?","Pensamiento:\n\u201cFracas\xe9 en este examen, as\xed que soy est\xfapido y nunca tendr\xe9 \xe9xito.\u201d\n\n\xbfQu\xe9 filtro de historia (distorsi\xf3n) encaja mejor con este pensamiento?","Gedanke:\n\u201eIch habe diesen Test nicht bestanden, also bin ich dumm und werde nie erfolgreich sein.\u201c\n\nWelches Verzerrungsmuster passt am besten zu diesem Gedanken?","Pens\xe9e :\n\u201cJ\u2019ai \xe9chou\xe9 \xe0 ce test, donc je suis stupide et je ne r\xe9ussirai jamais.\u201d\n\nQuel filtre de narration (distorsion) correspond le mieux \xe0 cette pens\xe9e ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0641\u0634\u0644\u062a \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u0627\u062e\u062a\u0628\u0627\u0631\u060c \u0644\u0630\u0627 \u0623\u0646\u0627 \u063a\u0628\u064a \u0648\u0644\u0646 \u0623\u0646\u062c\u062d \u0623\u0628\u062f\u064b\u0627.\u201d\n\n\u0623\u064a \u0641\u0644\u062a\u0631 \u0642\u0635\u0629 (\u062a\u0634\u0648\u064a\u0647) \u064a\u0646\u0627\u0633\u0628 \u0647\u0630\u0647 \u0627\u0644\u0641\u0643\u0631\u0629 \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644\u061f","\uc0dd\uac01:\n\u201c\ub098\ub294 \uc774 \uc2dc\ud5d8\uc5d0 \uc2e4\ud328\ud588\ub2e4, \uadf8\ub798\uc11c \ub098\ub294 \ubc14\ubcf4\uace0 \uacb0\ucf54 \uc131\uacf5\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub2e4.\u201d\n\n\uc774 \uc0dd\uac01\uc5d0 \uac00\uc7a5 \uc798 \ub9de\ub294 \uc774\uc57c\uae30 \ud544\ud130(\uc65c\uace1)\ub294 \ubb34\uc5c7\uc778\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6211\u6ca1\u901a\u8fc7\u8fd9\u4e2a\u6d4b\u8bd5\uff0c\u6240\u4ee5\u6211\u5f88\u611a\u8822\uff0c\u6c38\u8fdc\u4e0d\u4f1a\u6210\u529f\u3002\u201d\n\n\u54ea\u79cd\u6545\u4e8b\u8fc7\u6ee4\u5668\uff08\u626d\u66f2\uff09\u6700\u9002\u5408\u8fd9\u4e2a\u60f3\u6cd5\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0907\u0938 \u092a\u0930\u0940\u0915\u094d\u0937\u0923 \u092e\u0947\u0902 \u0905\u0938\u092b\u0932\u0924\u093e \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0940, \u0907\u0938\u0932\u093f\u090f \u092e\u0948\u0902 \u092e\u0942\u0930\u094d\u0916 \u0939\u0942\u0902 \u0914\u0930 \u0915\u092d\u0940 \u0938\u092b\u0932 \u0928\u0939\u0940\u0902 \u0939\u094b\u090a\u0902\u0917\u093e\u0964\u201d\n\n\u0907\u0938 \u0935\u093f\u091a\u093e\u0930 \u0915\u0947 \u0932\u093f\u090f \u0938\u092c\u0938\u0947 \u0909\u092a\u092f\u0941\u0915\u094d\u0924 \u0915\u094c\u0928 \u0938\u093e \u0915\u0939\u093e\u0928\u0940 \u092b\u093f\u0932\u094d\u091f\u0930 (\u0935\u093f\u0915\u0943\u0924\u093f) \u0939\u0948?","Cogitatio:\n\u201cHoc examen defeci, ergo sum stultus et nunquam successurus.\u201d\n\nQuod fabulae filum (distorsio) huic cogitationi aptissimum est?","Pensiero:\n\u201cHo fallito questo test, quindi sono stupido e non avr\xf2 mai successo.\u201d\n\nQuale filtro narrativo (distorsione) si adatta meglio a questo pensiero?","\u0641\u06a9\u0631:\n\u201c\u0645\u0646 \u062f\u0631 \u0627\u06cc\u0646 \u0622\u0632\u0645\u0648\u0646 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0645\u060c \u067e\u0633 \u0627\u062d\u0645\u0642 \u0647\u0633\u062a\u0645 \u0648 \u0647\u0631\u06af\u0632 \u0645\u0648\u0641\u0642 \u0646\u062e\u0648\u0627\u0647\u0645 \u0634\u062f.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0641\u06cc\u0644\u062a\u0631 \u062f\u0627\u0633\u062a\u0627\u0646\u06cc (\u0627\u0646\u062d\u0631\u0627\u0641) \u0628\u0647\u062a\u0631 \u0628\u0647 \u0627\u06cc\u0646 \u0641\u06a9\u0631 \u0645\u06cc\u200c\u062e\u0648\u0631\u062f\u061f"],t.w)
