B.af9=new A.d(B.c,["The thought takes one event (\u201cthis test\u201d) and turns it into a permanent rule about the self (\u201cI am stupid\u201d). That is classic overgeneralization.","El pensamiento toma un evento (\u201ceste examen\u201d) y lo convierte en una regla permanente sobre uno mismo (\u201csoy est\xfapido\u201d). Eso es una sobregeneralizaci\xf3n cl\xe1sica.","Der Gedanke nimmt ein Ereignis (\u201edieser Test\u201c) und macht es zu einer permanenten Regel \xfcber das Selbst (\u201eIch bin dumm\u201c). Das ist klassische \xdcberverallgemeinerung.","La pens\xe9e prend un \xe9v\xe9nement (\u201cce test\u201d) et le transforme en une r\xe8gle permanente sur soi-m\xeame (\u201cje suis stupide\u201d). C\u2019est une sur-g\xe9n\xe9ralisation classique.","\u0627\u0644\u0641\u0643\u0631\u0629 \u062a\u0623\u062e\u0630 \u062d\u062f\u062b\u064b\u0627 \u0648\u0627\u062d\u062f\u064b\u0627 (\u201c\u0647\u0630\u0627 \u0627\u0644\u0627\u062e\u062a\u0628\u0627\u0631\u201d) \u0648\u062a\u062d\u0648\u0644\u0647 \u0625\u0644\u0649 \u0642\u0627\u0639\u062f\u0629 \u062f\u0627\u0626\u0645\u0629 \u0639\u0646 \u0627\u0644\u0630\u0627\u062a (\u201c\u0623\u0646\u0627 \u063a\u0628\u064a\u201d). \u0647\u0630\u0647 \u0647\u064a \u0627\u0644\u062a\u0639\u0645\u064a\u0645 \u0627\u0644\u0645\u0641\u0631\u0637 \u0627\u0644\u0643\u0644\u0627\u0633\u064a\u0643\u064a.","\uc0dd\uac01\uc740 \ud558\ub098\uc758 \uc0ac\uac74(\u201c\uc774 \uc2dc\ud5d8\u201d)\uc744 \uac00\uc838\uc640\uc11c \uadf8\uac83\uc744 \uc790\uae30 \uc790\uc2e0\uc5d0 \ub300\ud55c \uc601\uad6c\uc801\uc778 \uaddc\uce59(\u201c\ub098\ub294 \ubc14\ubcf4\uc774\ub2e4\u201d)\uc73c\ub85c \ubc14\uafbc\ub2e4. \uadf8\uac83\uc740 \uace0\uc804\uc801\uc778 \uacfc\ub3c4\ud55c \uc77c\ubc18\ud654\uc774\ub2e4.","\u8fd9\u4e2a\u60f3\u6cd5\u5c06\u4e00\u4e2a\u4e8b\u4ef6\uff08\u201c\u8fd9\u4e2a\u6d4b\u8bd5\u201d\uff09\u53d8\u6210\u4e86\u5173\u4e8e\u81ea\u6211\u7684\u6c38\u4e45\u89c4\u5219\uff08\u201c\u6211\u5f88\u611a\u8822\u201d\uff09\u3002 \u8fd9\u5c31\u662f\u7ecf\u5178\u7684\u8fc7\u5ea6\u6982\u62ec\u3002","\u0935\u093f\u091a\u093e\u0930 \u090f\u0915 \u0918\u091f\u0928\u093e (\u201c\u092f\u0939 \u092a\u0930\u0940\u0915\u094d\u0937\u0923\u201d) \u0915\u094b \u0932\u0947\u0915\u0930 \u0907\u0938\u0947 \u0906\u0924\u094d\u092e\u093e \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u090f\u0915 \u0938\u094d\u0925\u093e\u092f\u0940 \u0928\u093f\u092f\u092e (\u201c\u092e\u0948\u0902 \u092e\u0942\u0930\u094d\u0916 \u0939\u0942\u0902\u201d) \u092e\u0947\u0902 \u092c\u0926\u0932 \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u092f\u0939 \u0915\u094d\u0932\u093e\u0938\u093f\u0915 \u0905\u0924\u093f\u0938\u093e\u092e\u093e\u0928\u094d\u092f\u0940\u0915\u0930\u0923 \u0939\u0948\u0964","Cogitatio unum eventum (\u201choc examen\u201d) accipit et in regulam perpetuam de se (\u201cego stultus sum\u201d) vertitur. Haec est classicus supergeneralizatio.","Il pensiero prende un evento (\u201cquesto test\u201d) e lo trasforma in una regola permanente su se stessi (\u201csono stupido\u201d). Questa \xe8 una classica sovrageneralizzazione.","\u0641\u06a9\u0631 \u06cc\u06a9 \u0631\u0648\u06cc\u062f\u0627\u062f (\u201c\u0627\u06cc\u0646 \u0622\u0632\u0645\u0648\u0646\u201d) \u0631\u0627 \u06af\u0631\u0641\u062a\u0647 \u0648 \u0622\u0646 \u0631\u0627 \u0628\u0647 \u06cc\u06a9 \u0642\u0627\u0639\u062f\u0647 \u062f\u0627\u0626\u0645\u06cc \u062f\u0631\u0628\u0627\u0631\u0647 \u062e\u0648\u062f (\u201c\u0645\u0646 \u0627\u062d\u0645\u0642\u0645\u201d) \u062a\u0628\u062f\u06cc\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u0627\u06cc\u0646 \u06cc\u06a9 \u062a\u0639\u0645\u06cc\u0645\u200c\u0633\u0627\u0632\u06cc \u06a9\u0644\u0627\u0633\u06cc\u06a9 \u0627\u0633\u062a."],t.w)
