B.aeN=new A.d(B.c,["Thought:\n\u201cIf I am not the best in the group, I am basically a failure.\u201d\n\nWhich distortion is loudest?","Pensamiento:\n\u201cSi no soy el mejor en el grupo, b\xe1sicamente soy un fracaso.\u201d\n\n\xbfCu\xe1l distorsi\xf3n es m\xe1s fuerte?","Gedanke:\n\u201eWenn ich nicht der Beste in der Gruppe bin, bin ich im Grunde ein Versager.\u201c\n\nWelche Verzerrung ist am lautesten?","Pens\xe9e :\n\u201cSi je ne suis pas le meilleur du groupe, je suis fondamentalement un \xe9chec.\u201d\n\nQuelle distorsion est la plus forte ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0625\u0630\u0627 \u0644\u0645 \u0623\u0643\u0646 \u0627\u0644\u0623\u0641\u0636\u0644 \u0641\u064a \u0627\u0644\u0645\u062c\u0645\u0648\u0639\u0629\u060c \u0641\u0623\u0646\u0627 \u0623\u0633\u0627\u0633\u064b\u0627 \u0641\u0627\u0634\u0644.\u201d\n\n\u0645\u0627 \u0647\u0648 \u0627\u0644\u062a\u0634\u0648\u064a\u0647 \u0627\u0644\u0623\u0643\u062b\u0631 \u0648\u0636\u0648\u062d\u064b\u0627\u061f","\uc0dd\uac01:\n\u201c\uadf8\ub8f9\uc5d0\uc11c \ub0b4\uac00 \uac00\uc7a5 \uc798\ud558\uc9c0 \uc54a\uc73c\uba74 \ub098\ub294 \uc0ac\uc2e4 \uc2e4\ud328\uc790\ub2e4.\u201d\n\n\uc5b4\ub5a4 \uc65c\uace1\uc774 \uac00\uc7a5 \ud06c\ub0d0?","\u60f3\u6cd5\uff1a\n\u201c\u5982\u679c\u6211\u4e0d\u662f\u5c0f\u7ec4\u91cc\u6700\u4f18\u79c0\u7684\uff0c\u90a3\u4e48\u6211\u57fa\u672c\u4e0a\u5c31\u662f\u4e2a\u5931\u8d25\u8005\u3002\u201d\n\n\u54ea\u4e2a\u626d\u66f2\u6700\u660e\u663e\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u0905\u0917\u0930 \u092e\u0948\u0902 \u0938\u092e\u0942\u0939 \u092e\u0947\u0902 \u0938\u092c\u0938\u0947 \u0905\u091a\u094d\u091b\u093e \u0928\u0939\u0940\u0902 \u0939\u0942\u0902, \u0924\u094b \u092e\u0948\u0902 \u092e\u0942\u0932 \u0930\u0942\u092a \u0938\u0947 \u0905\u0938\u092b\u0932 \u0939\u0942\u0902\u0964\u201d\n\n\u0915\u094c\u0928 \u0938\u093e \u0935\u093f\u0915\u0943\u0924\u093f \u0938\u092c\u0938\u0947 \u0905\u0927\u093f\u0915 \u0939\u0948?","Cogitatio:\n\u201cSi non optimus in grege sum, basicus defectus sum.\u201d\n\nQuod distorsio maxime auditur?","Pensiero:\n\u201cSe non sono il migliore del gruppo, sono fondamentalmente un fallimento.\u201d\n\nQuale distorsione \xe8 la pi\xf9 forte?","\u0641\u06a9\u0631:\n\u201c\u0627\u06af\u0631 \u0645\u0646 \u0628\u0647\u062a\u0631\u06cc\u0646 \u062f\u0631 \u06af\u0631\u0648\u0647 \u0646\u0628\u0627\u0634\u0645\u060c \u0627\u0633\u0627\u0633\u0627\u064b \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0647\u200c\u0627\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u0646\u062d\u0631\u0627\u0641 \u0628\u06cc\u0634\u062a\u0631\u06cc\u0646 \u062a\u0623\u062b\u06cc\u0631 \u0631\u0627 \u062f\u0627\u0631\u062f\u061f"],t.w)
