B.ac9=new A.d(B.c,["It takes a neutral event (no reply) and makes it all about you and your worth. That is personalization.","Toma un evento neutral (sin respuesta) y lo convierte todo en algo sobre ti y tu valor. Eso es personalizaci\xf3n.","Es nimmt ein neutrales Ereignis (keine Antwort) und macht es ganz um dich und deinen Wert. Das ist Personalisierung.","Cela prend un \xe9v\xe9nement neutre (pas de r\xe9ponse) et en fait tout un sujet sur vous et votre valeur. C\u2019est de la personnalisation.","\u0625\u0646\u0647\u0627 \u062a\u0623\u062e\u0630 \u062d\u062f\u062b\u064b\u0627 \u0645\u062d\u0627\u064a\u062f\u064b\u0627 (\u0644\u0627 \u0631\u062f) \u0648\u062a\u062c\u0639\u0644\u0647\u0627 \u0643\u0644\u0647\u0627 \u0639\u0646\u0643 \u0648\u0639\u0646 \u0642\u064a\u0645\u062a\u0643. \u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u062a\u062e\u0635\u064a\u0635.","\uc774\uac83\uc740 \uc911\ub9bd\uc801\uc778 \uc0ac\uac74(\ub2f5\uc7a5 \uc5c6\uc74c)\uc744 \uac00\uc838\uc640\uc11c \uadf8\uac83\uc744 \ub2f9\uc2e0\uacfc \ub2f9\uc2e0\uc758 \uac00\uce58\uc5d0 \uad00\ud55c \uac83\uc73c\ub85c \ub9cc\ub4ed\ub2c8\ub2e4. \uadf8\uac83\uc740 \uac1c\uc778\ud654\uc785\ub2c8\ub2e4.","\u5b83\u5c06\u4e00\u4e2a\u4e2d\u7acb\u7684\u4e8b\u4ef6\uff08\u6ca1\u6709\u56de\u590d\uff09\u53d8\u6210\u4e86\u5b8c\u5168\u5173\u4e8e\u4f60\u548c\u4f60\u4ef7\u503c\u7684\u4e8b\u60c5\u3002\u8fd9\u5c31\u662f\u4e2a\u6027\u5316\u3002","\u092f\u0939 \u090f\u0915 \u0924\u091f\u0938\u094d\u0925 \u0918\u091f\u0928\u093e (\u0915\u094b\u0908 \u0909\u0924\u094d\u0924\u0930 \u0928\u0939\u0940\u0902) \u0932\u0947\u0915\u0930 \u0907\u0938\u0947 \u0906\u092a\u0915\u0947 \u0914\u0930 \u0906\u092a\u0915\u0940 \u0915\u0940\u092e\u0924 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u092c\u0928\u093e \u0926\u0947\u0924\u0940 \u0939\u0948\u0964 \u092f\u0939\u0940 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0924\u094d\u0935\u0915\u0930\u0923 \u0939\u0948\u0964","Hoc accipit eventum neutrum (nulla responsio) et totum in te et tuum pretium facit. Haec est personalizatio.","Prende un evento neutro (nessuna risposta) e lo rende tutto su di te e sul tuo valore. Questa \xe8 la personalizzazione.","\u0627\u06cc\u0646 \u06cc\u06a9 \u0631\u0648\u06cc\u062f\u0627\u062f \u062e\u0646\u062b\u06cc (\u0628\u062f\u0648\u0646 \u067e\u0627\u0633\u062e) \u0631\u0627 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f \u0648 \u062a\u0645\u0627\u0645 \u0622\u0646 \u0631\u0627 \u062f\u0631 \u0645\u0648\u0631\u062f \u0634\u0645\u0627 \u0648 \u0627\u0631\u0632\u0634 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u0627\u06cc\u0646 \u0634\u062e\u0635\u06cc\u200c\u0633\u0627\u0632\u06cc \u0627\u0633\u062a."],t.w)
