B.afm=new A.d(B.c,["Thought:\n\u201cIf I try this new thing, it will definitely go wrong, so why even start?\u201d\n\nWhich distortion best fits?","Pensamiento:\n\u201cSi intento esto nuevo, definitivamente saldr\xe1 mal, \xbfpor qu\xe9 intentarlo?\u201d\n\n\xbfQu\xe9 distorsi\xf3n se ajusta mejor?","Gedanke:\n\u201eWenn ich diese neue Sache versuche, wird sie definitiv schiefgehen, also warum \xfcberhaupt anfangen?\u201c\n\nWelche Verzerrung passt am besten?","Pens\xe9e :\n\u201cSi j\u2019essaie cette nouvelle chose, \xe7a va s\xfbrement \xe9chouer, alors pourquoi commencer ?\u201d\n\nQuelle distorsion correspond le mieux ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0625\u0630\u0627 \u062c\u0631\u0628\u062a \u0647\u0630\u0627 \u0627\u0644\u0634\u064a\u0621 \u0627\u0644\u062c\u062f\u064a\u062f\u060c \u0641\u0633\u064a\u062e\u0637\u0626 \u0628\u0627\u0644\u062a\u0623\u0643\u064a\u062f\u060c \u0641\u0644\u0645\u0627\u0630\u0627 \u0623\u0628\u062f\u0623\u061f\u201d\n\n\u0623\u064a \u062a\u0634\u0648\u064a\u0647 \u064a\u0646\u0627\u0633\u0628 \u0647\u0630\u0647 \u0627\u0644\u0641\u0643\u0631\u0629\u061f","\uc0dd\uac01:\n\u201c\uc774 \uc0c8\ub85c\uc6b4 \uac83\uc744 \uc2dc\ub3c4\ud558\uba74 \ubd84\uba85\ud788 \uc798\ubabb\ub420 \uac83\uc774\ub2e4. \uadf8\ub7fc \uc2dc\uc791\ud560 \uc774\uc720\uac00 \ubb50\uc9c0?\u201d\n\n\uc5b4\ub5a4 \uc65c\uace1\uc774 \uac00\uc7a5 \uc801\ud569\ud55c\uac00?","\u60f3\u6cd5\uff1a\n\u201c\u5982\u679c\u6211\u5c1d\u8bd5\u8fd9\u4e2a\u65b0\u4e8b\u7269\uff0c\u80af\u5b9a\u4f1a\u5931\u8d25\uff0c\u90a3\u6211\u4e3a\u4ec0\u4e48\u8fd8\u8981\u5f00\u59cb\uff1f\u201d\n\n\u54ea\u79cd\u626d\u66f2\u6700\u9002\u5408\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u0905\u0917\u0930 \u092e\u0948\u0902\u0928\u0947 \u092f\u0939 \u0928\u092f\u093e \u0915\u093e\u092e \u0915\u093f\u092f\u093e, \u0924\u094b \u092f\u0939 \u0928\u093f\u0936\u094d\u091a\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u0917\u0932\u0924 \u0939\u094b\u0917\u093e, \u0924\u094b \u092b\u093f\u0930 \u0936\u0941\u0930\u0942 \u0939\u0940 \u0915\u094d\u092f\u094b\u0902 \u0915\u0930\u0942\u0901?\u201d\n\n\u0915\u094c\u0928 \u0938\u093e \u0935\u093f\u0915\u0943\u0924\u093f \u0938\u092c\u0938\u0947 \u0909\u092a\u092f\u0941\u0915\u094d\u0924 \u0939\u0948?","Cogitatio:\n\u201cSi hoc novum conor, certe deficiet, cur igitur incipiam?\u201d\n\nQuod distorsio optime convenit?","Pensiero:\n\u201cSe provo questa nuova cosa, sicuramente andr\xe0 storto, quindi perch\xe9 iniziare?\u201d\n\nQuale distorsione si adatta meglio?","\u0641\u06a9\u0631:\n\u201c\u0627\u06af\u0631 \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u062c\u062f\u06cc\u062f \u0631\u0627 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u0645\u060c \u062d\u062a\u0645\u0627\u064b \u0627\u0634\u062a\u0628\u0627\u0647 \u062e\u0648\u0627\u0647\u062f \u0634\u062f\u060c \u067e\u0633 \u0686\u0631\u0627 \u0634\u0631\u0648\u0639 \u06a9\u0646\u0645\u061f\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u0646\u062d\u0631\u0627\u0641 \u0628\u0647\u062a\u0631\u06cc\u0646 \u062a\u0637\u0627\u0628\u0642 \u0631\u0627 \u062f\u0627\u0631\u062f\u061f"],t.w)
