B.acD=new A.d(B.c,["Thought:\n\u201cThey said something nice about my work, but they were just being polite. It does not count.\u201d\n\nWhich distortion is operating here?","Pensamiento:\n\u201cDijeron algo bonito sobre mi trabajo, pero solo estaban siendo educados. No cuenta.\u201d\n\n\xbfQu\xe9 distorsi\xf3n est\xe1 operando aqu\xed?","Gedanke:\n\u201eSie haben etwas Nettes \xfcber meine Arbeit gesagt, aber sie waren nur h\xf6flich. Es z\xe4hlt nicht.\u201c\n\nWelche Verzerrung liegt hier vor?","Pens\xe9e :\n\u201cIls ont dit quelque chose de gentil sur mon travail, mais ils \xe9taient juste polis. Cela ne compte pas.\u201d\n\nQuelle distorsion fonctionne ici ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0642\u0627\u0644\u0648\u0627 \u0634\u064a\u0626\u064b\u0627 \u0644\u0637\u064a\u0641\u064b\u0627 \u0639\u0646 \u0639\u0645\u0644\u064a\u060c \u0644\u0643\u0646\u0647\u0645 \u0643\u0627\u0646\u0648\u0627 \u0641\u0642\u0637 \u0645\u0624\u062f\u0628\u064a\u0646. \u0647\u0630\u0627 \u0644\u0627 \u064a\u062d\u062a\u0633\u0628.\u201d\n\n\u0645\u0627 \u0647\u0648 \u0627\u0644\u062a\u0634\u0648\u064a\u0647 \u0627\u0644\u0630\u064a \u064a\u0639\u0645\u0644 \u0647\u0646\u0627\u061f","\uc0dd\uac01:\n\u201c\uadf8\ub4e4\uc740 \ub0b4 \uc791\uc5c5\uc5d0 \ub300\ud574 \uc88b\uc740 \ub9d0\uc744 \ud588\uc9c0\ub9cc \uadf8\ub0e5 \uc608\uc758\uc0c1 \ud55c \uac70\uc600\uc5b4. \uadf8\uac74 \uc911\uc694\ud558\uc9c0 \uc54a\uc544.\u201d\n\n\uc5ec\uae30\uc5d0\uc11c \uc5b4\ub5a4 \uc65c\uace1\uc774 \ubc1c\uc0dd\ud558\uace0 \uc788\ub098\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u4ed6\u4eec\u8bf4\u4e86\u4e9b\u5173\u4e8e\u6211\u5de5\u4f5c\u7684\u597d\u8bdd\uff0c\u4f46\u4ed6\u4eec\u53ea\u662f\u51fa\u4e8e\u793c\u8c8c\u3002\u8fd9\u4e0d\u7b97\u6570\u3002\u201d\n\n\u8fd9\u91cc\u7684\u626d\u66f2\u662f\u4ec0\u4e48\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u092e\u0947\u0930\u0947 \u0915\u093e\u092e \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0915\u0941\u091b \u0905\u091a\u094d\u091b\u093e \u0915\u0939\u093e, \u0932\u0947\u0915\u093f\u0928 \u0935\u0947 \u092c\u0938 \u0936\u093f\u0937\u094d\u091f\u0924\u093e \u0926\u093f\u0916\u093e \u0930\u0939\u0947 \u0925\u0947\u0964 \u092f\u0939 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0915\u094c\u0928 \u0938\u093e \u0935\u093f\u0915\u0943\u0924\u093f \u0915\u093e\u0930\u094d\u092f \u0915\u0930 \u0930\u0939\u093e \u0939\u0948?","Cogitatio:\n\u201cDixerunt aliquid pulchrum de opere meo, sed solum erant politissimi. Non valet.\u201d\n\nQuod distorsio hic operatur?","Pensiero:\n\u201cHanno detto qualcosa di carino sul mio lavoro, ma stavano solo facendo i gentili. Non conta.\u201d\n\nQuale distorsione sta operando qui?","\u0641\u06a9\u0631:\n\u201c\u0622\u0646\u0647\u0627 \u062f\u0631\u0628\u0627\u0631\u0647 \u06a9\u0627\u0631 \u0645\u0646 \u0686\u06cc\u0632\u06cc \u062e\u0648\u0628 \u06af\u0641\u062a\u0646\u062f\u060c \u0627\u0645\u0627 \u0641\u0642\u0637 \u0645\u0648\u062f\u0628 \u0628\u0648\u062f\u0646\u062f. \u0627\u06cc\u0646 \u0627\u0647\u0645\u06cc\u062a\u06cc \u0646\u062f\u0627\u0631\u062f.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u0646\u062d\u0631\u0627\u0641 \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u06a9\u0627\u0631 \u0645\u06cc\u200c\u06a9\u0646\u062f\u061f"],t.w)
