B.a9O=new A.d(B.c,["Thought:\n\u201cI didn\u2019t do enough today, I\u2019m just lazy and unproductive.\u201d\n\nWhich distortion is most likely present here?","Pensamiento:\n\u201cNo hice suficiente hoy, soy solo perezoso e improductivo.\u201d\n\n\xbfQu\xe9 distorsi\xf3n est\xe1 presente aqu\xed?","Gedanke:\n\u201eIch habe heute nicht genug getan, ich bin einfach faul und unproduktiv.\u201c\n\nWelche Verzerrung ist hier am wahrscheinlichsten?","Pens\xe9e :\n\u201cJe n\u2019ai pas fait assez aujourd\u2019hui, je suis juste paresseux et improductif.\u201d\n\nQuelle distorsion est probablement pr\xe9sente ici ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0644\u0645 \u0623\u0641\u0639\u0644 \u0645\u0627 \u064a\u0643\u0641\u064a \u0627\u0644\u064a\u0648\u0645\u060c \u0623\u0646\u0627 \u0643\u0633\u0648\u0644 \u0648\u063a\u064a\u0631 \u0645\u0646\u062a\u062c.\u201d\n\n\u0645\u0627 \u0647\u0648 \u0627\u0644\u062a\u0634\u0648\u064a\u0647 \u0627\u0644\u0623\u0643\u062b\u0631 \u0627\u062d\u062a\u0645\u0627\u0644\u0627\u064b \u0647\u0646\u0627\u061f","\uc0dd\uac01:\n\u201c\ub098\ub294 \uc624\ub298 \ucda9\ubd84\ud788 \ud558\uc9c0 \uc54a\uc558\uc5b4, \ub098\ub294 \uadf8\ub0e5 \uac8c\uc73c\ub974\uace0 \ube44\uc0dd\uc0b0\uc801\uc774\uc57c.\u201d\n\n\uc5ec\uae30\uc5d0\uc11c \uac00\uc7a5 \uac00\ub2a5\uc131 \uc788\ub294 \uc65c\uace1\uc740 \ubb34\uc5c7\uc778\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6211\u4eca\u5929\u505a\u5f97\u4e0d\u591f\uff0c\u6211\u53ea\u662f\u61d2\u60f0\u548c\u65e0\u751f\u4ea7\u529b\u3002\u201d\n\n\u8fd9\u91cc\u6700\u53ef\u80fd\u5b58\u5728\u7684\u626d\u66f2\u662f\u4ec0\u4e48\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902\u0928\u0947 \u0906\u091c \u092a\u0930\u094d\u092f\u093e\u092a\u094d\u0924 \u092a\u094d\u0930\u092f\u093e\u0938 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e, \u092e\u0948\u0902 \u092c\u0938 \u0906\u0932\u0938\u0940 \u0914\u0930 \u0905\u092a\u094d\u0930\u0924\u093f\u0938\u093e\u0926\u0940 \u0939\u0942\u0902\u0964\u201d\n\n\u092f\u0939\u093e\u0902 \u0938\u092c\u0938\u0947 \u0905\u0927\u093f\u0915 \u0938\u0902\u092d\u093e\u0935\u0928\u093e \u0935\u093e\u0932\u093e \u0935\u093f\u0915\u0943\u0924\u093f \u0915\u094c\u0928 \u0938\u093e \u0939\u0948?","Cogitatio:\n\u201cHodie satis non feci, solum sum piger et inproduktivus.\u201d\n\nQuod distorsio hic potissimum praesentem est?","Pensiero:\n\u201cNon ho fatto abbastanza oggi, sono solo pigro e improduttivo.\u201d\n\nQuale distorsione \xe8 pi\xf9 probabile qui?","\u0641\u06a9\u0631:\n\u201c\u0645\u0646 \u0627\u0645\u0631\u0648\u0632 \u06a9\u0627\u0641\u06cc \u06a9\u0627\u0631 \u0646\u06a9\u0631\u062f\u0645\u060c \u0645\u0646 \u0641\u0642\u0637 \u062a\u0646\u0628\u0644 \u0648 \u063a\u06cc\u0631\u0645\u0648\u0644\u062f \u0647\u0633\u062a\u0645.\u201d\n\n\u06a9\u062f\u0627\u0645 \u0627\u0646\u062d\u0631\u0627\u0641 \u062f\u0631 \u0627\u06cc\u0646\u062c\u0627 \u0628\u06cc\u0634\u062a\u0631 \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f\u061f"],t.w)
