B.aat=new A.d(B.c,["The thought uses an all-or-nothing approach: you either did enough or you are completely lazy. This is classic all-or-nothing thinking.","El pensamiento utiliza un enfoque todo o nada: o hiciste lo suficiente o eres completamente perezoso. Esto es pensamiento todo o nada.","Der Gedanke verwendet einen Alles-oder-Nichts-Ansatz: Entweder hast du genug getan oder du bist v\xf6llig faul. Das ist klassisches Alles-oder-Nichts-Denken.","La pens\xe9e utilise une approche tout ou rien : soit vous avez fait assez, soit vous \xeates compl\xe8tement paresseux. C\u2019est de la pens\xe9e tout ou rien.","\u0627\u0644\u0641\u0643\u0631\u0629 \u062a\u0633\u062a\u062e\u062f\u0645 \u0646\u0647\u062c \u0627\u0644\u0643\u0644 \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621: \u0625\u0645\u0627 \u0623\u0646\u0643 \u0641\u0639\u0644\u062a \u0645\u0627 \u064a\u0643\u0641\u064a \u0623\u0648 \u0623\u0646\u0643 \u0643\u0633\u0648\u0644 \u062a\u0645\u0627\u0645\u064b\u0627. \u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0627\u0644\u0643\u0644\u064a \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621.","\uc774 \uc0dd\uac01\uc740 \ubaa8\ub4e0 \uac83\uc774\uac70\ub098 \uc804\ud600 \uc544\ub2cc \uc811\uadfc \ubc29\uc2dd\uc744 \uc0ac\uc6a9\ud569\ub2c8\ub2e4: \ub2f9\uc2e0\uc740 \ucda9\ubd84\ud788 \ud588\uac70\ub098 \uc644\uc804\ud788 \uac8c\uc73c\ub985\ub2c8\ub2e4. \uc774\uac83\uc740 \uc804\ud615\uc801\uc778 \ubaa8\ub4e0 \uac83 \uc544\ub2c8\uba74 \uc804\ud600 \uc5c6\ub294 \uc0ac\uace0\uc785\ub2c8\ub2e4.","\u8fd9\u4e2a\u60f3\u6cd5\u4f7f\u7528\u5168\u6216\u65e0\u7684\u65b9\u5f0f\uff1a\u4f60\u8981\u4e48\u505a\u5f97\u8db3\u591f\uff0c\u8981\u4e48\u5b8c\u5168\u61d2\u60f0\u3002\u8fd9\u5c31\u662f\u7ecf\u5178\u7684\u5168\u6216\u65e0\u601d\u7ef4\u3002","\u092f\u0939 \u0935\u093f\u091a\u093e\u0930 \u0938\u092d\u0940 \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0915\u0947 \u0926\u0943\u0937\u094d\u091f\u093f\u0915\u094b\u0923 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0924\u093e \u0939\u0948: \u0906\u092a\u0928\u0947 \u092f\u093e \u0924\u094b \u092a\u0930\u094d\u092f\u093e\u092a\u094d\u0924 \u0915\u093f\u092f\u093e \u0939\u0948 \u092f\u093e \u0906\u092a \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0938\u0947 \u0906\u0932\u0938\u0940 \u0939\u0948\u0902\u0964 \u092f\u0939 \u0915\u094d\u0932\u093e\u0938\u093f\u0915 \u0938\u092d\u0940 \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0938\u094b\u091a \u0939\u0948\u0964","Cogitatio omnia vel nihil accessum utitur: aut satis fecisti aut omnino piger es. Haec est cogitatio omnia vel nihil.","Il pensiero utilizza un approccio tutto o niente: o hai fatto abbastanza o sei completamente pigro. Questo \xe8 il pensiero tutto o niente.","\u0641\u06a9\u0631 \u0627\u0632 \u0631\u0648\u06cc\u06a9\u0631\u062f \u0647\u0645\u0647 \u06cc\u0627 \u0647\u06cc\u0686 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0645\u06cc\u200c\u06a9\u0646\u062f: \u06cc\u0627 \u06a9\u0627\u0641\u06cc \u06a9\u0627\u0631 \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc \u06cc\u0627 \u06a9\u0627\u0645\u0644\u0627\u064b \u062a\u0646\u0628\u0644 \u0647\u0633\u062a\u06cc. \u0627\u06cc\u0646 \u062a\u0641\u06a9\u0631 \u0647\u0645\u0647 \u06cc\u0627 \u0647\u06cc\u0686 \u0627\u0633\u062a."],t.w)
