B.a7X=new A.d(B.c,["Absolutely nothing; bodies never give useful info.","Absolutamente nada; los cuerpos nunca dan informaci\xf3n \xfatil.","Absolut nichts; K\xf6rper geben nie n\xfctzliche Informationen.","Absolument rien; les corps ne donnent jamais d'informations utiles.","\u0644\u0627 \u0634\u064a\u0621 \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642\u061b \u0627\u0644\u0623\u062c\u0633\u0627\u0645 \u0644\u0627 \u062a\u0639\u0637\u064a \u0623\u0628\u062f\u064b\u0627 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0645\u0641\u064a\u062f\u0629.","\uc804\ud600 \uc5c6\ub2e4; \ubab8\uc740 \uacb0\ucf54 \uc720\uc6a9\ud55c \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uc9c0 \uc54a\ub294\ub2e4.","\u7edd\u5bf9\u6ca1\u6709\uff1b\u8eab\u4f53\u4ece\u4e0d\u63d0\u4f9b\u6709\u7528\u7684\u4fe1\u606f\u3002","\u092c\u093f\u0932\u0915\u0941\u0932 \u0915\u0941\u091b \u0928\u0939\u0940\u0902; \u0936\u0930\u0940\u0930 \u0915\u092d\u0940 \u092d\u0940 \u0909\u092a\u092f\u094b\u0917\u0940 \u091c\u093e\u0928\u0915\u093e\u0930\u0940 \u0928\u0939\u0940\u0902 \u0926\u0947\u0924\u093e\u0964","Nihil omnino; corpora numquam utilem informationem praebent.","Assolutamente niente; i corpi non danno mai informazioni utili.","\u0647\u06cc\u0686 \u0686\u06cc\u0632 \u0645\u0637\u0644\u0642\u0627\u064b\u061b \u0628\u062f\u0646\u200c\u0647\u0627 \u0647\u06cc\u0686\u200c\u06af\u0627\u0647 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0645\u0641\u06cc\u062f\u06cc \u0627\u0631\u0627\u0626\u0647 \u0646\u0645\u06cc\u200c\u062f\u0647\u0646\u062f."],t.w)
