B.abU=new A.d(B.c,["Your body often reacts before words. Tightness and bracing can signal anxiety, dread, or feeling unsafe.","Tu cuerpo a menudo reacciona antes que las palabras. La tensi\xf3n y la rigidez pueden se\xf1alar ansiedad, temor o sentirse inseguro.","Dein K\xf6rper reagiert oft vor den Worten. Spannung und Anspannung k\xf6nnen Angst, Furcht oder Unsicherheit signalisieren.","Ton corps r\xe9agit souvent avant les mots. La tension et l'appr\xe9hension peuvent signaler de l'anxi\xe9t\xe9, de la crainte ou un sentiment d'ins\xe9curit\xe9.","\u062c\u0633\u0645\u0643 \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u062a\u0641\u0627\u0639\u0644 \u0642\u0628\u0644 \u0627\u0644\u0643\u0644\u0645\u0627\u062a. \u0642\u062f \u064a\u0634\u064a\u0631 \u0627\u0644\u0634\u062f \u0648\u0627\u0644\u062a\u0648\u062a\u0631 \u0625\u0644\u0649 \u0627\u0644\u0642\u0644\u0642 \u0648\u0627\u0644\u062e\u0648\u0641 \u0623\u0648 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0639\u062f\u0645 \u0627\u0644\u0623\u0645\u0627\u0646.","\ub2f9\uc2e0\uc758 \ubab8\uc740 \uc885\uc885 \ub9d0\ubcf4\ub2e4 \uba3c\uc800 \ubc18\uc751\ud569\ub2c8\ub2e4. \uae34\uc7a5\uacfc \uae34\uc7a5\uc740 \ubd88\uc548, \ub450\ub824\uc6c0 \ub610\ub294 \uc548\uc804\ud558\uc9c0 \uc54a\uc740 \ub290\ub08c\uc744 \ub098\ud0c0\ub0bc \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u4f60\u7684\u8eab\u4f53\u5f80\u5f80\u5728\u8a00\u8bed\u4e4b\u524d\u5c31\u505a\u51fa\u53cd\u5e94\u3002\u7d27\u5f20\u548c\u6536\u7d27\u53ef\u80fd\u662f\u7126\u8651\u3001\u6050\u60e7\u6216\u611f\u5230\u4e0d\u5b89\u5168\u7684\u4fe1\u53f7\u3002","\u0906\u092a\u0915\u093e \u0936\u0930\u0940\u0930 \u0905\u0915\u094d\u0938\u0930 \u0936\u092c\u094d\u0926\u094b\u0902 \u0938\u0947 \u092a\u0939\u0932\u0947 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u0924\u0928\u093e\u0935 \u0914\u0930 \u0938\u0902\u0915\u094b\u091a \u091a\u093f\u0902\u0924\u093e, \u0921\u0930 \u092f\u093e \u0905\u0938\u0941\u0930\u0915\u094d\u0937\u093e \u0915\u093e \u0938\u0902\u0915\u0947\u0924 \u0926\u0947 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964","Corpus tuum saepe ante verba reconditur. Tensus et stridor anxietatem, timorem, vel insicuri sensum significare possunt.","Il tuo corpo spesso reagisce prima delle parole. La tensione e l'indurimento possono segnalare ansia, paura o un senso di insicurezza.","\u0628\u062f\u0646 \u0634\u0645\u0627 \u0627\u063a\u0644\u0628 \u067e\u06cc\u0634 \u0627\u0632 \u06a9\u0644\u0645\u0627\u062a \u0648\u0627\u06a9\u0646\u0634 \u0646\u0634\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u062f. \u0627\u0646\u0642\u0628\u0627\u0636 \u0648 \u062a\u0646\u0634 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0646\u0634\u0627\u0646\u0647\u200c\u0627\u06cc \u0627\u0632 \u0627\u0636\u0637\u0631\u0627\u0628\u060c \u062a\u0631\u0633 \u06cc\u0627 \u0627\u062d\u0633\u0627\u0633 \u0646\u0627\u0627\u0645\u0646\u06cc \u0628\u0627\u0634\u062f."],t.w)
