B.a9L=new A.d(B.c,["Warm chest with music","Pecho c\xe1lido con m\xfasica","Warme Brust mit Musik","Poitrine chaude avec de la musique","\u0635\u062f\u0631 \u062f\u0627\u0641\u0626 \u0645\u0639 \u0627\u0644\u0645\u0648\u0633\u064a\u0642\u0649","\uc74c\uc545\uacfc \ud568\uaed8 \ub530\ub73b\ud55c \uac00\uc2b4","\u97f3\u4e50\u5e26\u6765\u7684\u6e29\u6696\u80f8\u90e8","\u0938\u0902\u0917\u0940\u0924 \u0915\u0947 \u0938\u093e\u0925 \u0917\u0930\u094d\u092e \u091b\u093e\u0924\u0940","Pectus calidum cum musica","Petto caldo con la musica","\u0633\u06cc\u0646\u0647 \u06af\u0631\u0645 \u0628\u0627 \u0645\u0648\u0633\u06cc\u0642\u06cc"],t.w)
B.a8g=new A.d(B.c,["Scenario:\nYou put on a song you love. Your chest feels warm, and your eyes almost tear up, but in a soft way.\n\nWhat might this be pointing toward?","Escenario:\nPones una canci\xf3n que amas. Tu pecho se siente c\xe1lido, y tus ojos casi se llenan de l\xe1grimas, pero de manera suave.\n\n\xbfQu\xe9 podr\xeda estar se\xf1alando esto?","Szenario:\nDu h\xf6rst ein Lied, das du liebst. Deine Brust f\xfchlt sich warm an, und deine Augen f\xfcllen sich fast mit Tr\xe4nen, aber auf sanfte Weise.\n\nWorauf k\xf6nnte dies hindeuten?","Sc\xe9nario :\nVous mettez une chanson que vous aimez. Votre poitrine se r\xe9chauffe et vos yeux se remplissent presque de larmes, mais de mani\xe8re douce.\n\nQu'est-ce que cela pourrait indiquer ?","\u0627\u0644\u0633\u064a\u0646\u0627\u0631\u064a\u0648:\n\u0623\u0646\u062a \u062a\u0634\u063a\u0644 \u0623\u063a\u0646\u064a\u0629 \u062a\u062d\u0628\u0647\u0627. \u0634\u0639\u0631\u062a \u0628\u062f\u0641\u0621 \u0641\u064a \u0635\u062f\u0631\u0643 \u0648\u0639\u064a\u0646\u064a\u0643 \u0639\u0644\u0649 \u0648\u0634\u0643 \u0627\u0644\u0628\u0643\u0627\u0621\u060c \u0648\u0644\u0643\u0646 \u0628\u0637\u0631\u064a\u0642\u0629 \u0646\u0627\u0639\u0645\u0629.\n\n\u0645\u0627\u0630\u0627 \u0642\u062f \u064a\u0634\u064a\u0631 \u0647\u0630\u0627\u061f","\uc2dc\ub098\ub9ac\uc624:\n\ub2f9\uc2e0\uc774 \uc88b\uc544\ud558\ub294 \ub178\ub798\ub97c \ud2c0\uc5c8\uc2b5\ub2c8\ub2e4. \uac00\uc2b4\uc774 \ub530\ub73b\ud574\uc9c0\uace0 \ub208\ubb3c\uc774 \ub098\ub824\uace0 \ud558\uc9c0\ub9cc \ubd80\ub4dc\ub7fd\uac8c \ub290\uaef4\uc9d1\ub2c8\ub2e4.\n\n\uc774\uac83\uc774 \ubb34\uc5c7\uc744 \ub098\ud0c0\ub0bc \uc218 \uc788\uc744\uae4c\uc694?","\u573a\u666f\uff1a\n\u4f60\u653e\u4e86\u4e00\u9996\u4f60\u559c\u6b22\u7684\u6b4c\u3002\u4f60\u7684\u80f8\u90e8\u611f\u89c9\u6e29\u6696\uff0c\u773c\u775b\u51e0\u4e4e\u8981\u6d41\u6cea\uff0c\u4f46\u4ee5\u4e00\u79cd\u67d4\u548c\u7684\u65b9\u5f0f\u3002\n\n\u8fd9\u53ef\u80fd\u8868\u660e\u4ec0\u4e48\u5462\uff1f","\u092a\u0930\u093f\u0938\u094d\u0925\u093f\u0924\u093f:\n\u0906\u092a \u090f\u0915 \u0917\u093e\u0928\u093e \u0932\u0917\u093e\u0924\u0947 \u0939\u0948\u0902 \u091c\u093f\u0938\u0947 \u0906\u092a \u092a\u0938\u0902\u0926 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0940 \u091b\u093e\u0924\u0940 \u0917\u0930\u094d\u092e \u092e\u0939\u0938\u0942\u0938 \u0939\u094b\u0924\u0940 \u0939\u0948, \u0914\u0930 \u0906\u092a\u0915\u0940 \u0906\u0902\u0916\u0947\u0902 \u0932\u0917\u092d\u0917 \u0906\u0902\u0938\u0941\u0913\u0902 \u0938\u0947 \u092d\u0930 \u091c\u093e\u0924\u0940 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u090f\u0915 \u0928\u0930\u092e \u0924\u0930\u0940\u0915\u0947 \u0938\u0947\u0964\n\n\u092f\u0939 \u0915\u094d\u092f\u093e \u0938\u0902\u0915\u0947\u0924 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0948?","Scenario:\nCarmina, quae amas, induis. Pectus tuum calidum fit, et oculi tui fere lacrimant, sed leniter.\n\nQuid hoc indicare potest?","Scenario:\nMetti una canzone che ami. Il tuo petto si sente caldo e i tuoi occhi quasi si riempiono di lacrime, ma in modo delicato.\n\nCosa potrebbe indicare questo?","\u0633\u0646\u0627\u0631\u06cc\u0648:\n\u0634\u0645\u0627 \u06cc\u06a9 \u0622\u0647\u0646\u06af \u0645\u0648\u0631\u062f \u0639\u0644\u0627\u0642\u0647\u200c\u062a\u0627\u0646 \u0631\u0627 \u067e\u062e\u0634 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f. \u0633\u06cc\u0646\u0647\u200c\u062a\u0627\u0646 \u06af\u0631\u0645 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u0686\u0634\u0645\u0627\u0646\u062a\u0627\u0646 \u062a\u0642\u0631\u06cc\u0628\u0627\u064b \u067e\u0631 \u0627\u0632 \u0627\u0634\u06a9 \u0645\u06cc\u200c\u0634\u0648\u062f\u060c \u0627\u0645\u0627 \u0628\u0647 \u0637\u0648\u0631 \u0645\u0644\u0627\u06cc\u0645.\n\n\u0627\u06cc\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647 \u0686\u0647 \u0686\u06cc\u0632\u06cc \u0627\u0634\u0627\u0631\u0647 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f\u061f"],t.w)
