B.aac=new A.d(B.c,["Warmth + tears can carry layered feelings: joy, tenderness, missing something, or being moved.","La calidez + las l\xe1grimas pueden llevar sentimientos complejos: alegr\xeda, ternura, extra\xf1ar algo o sentirse conmovido.","W\xe4rme + Tr\xe4nen k\xf6nnen vielschichtige Gef\xfchle tragen: Freude, Z\xe4rtlichkeit, etwas vermissen oder bewegt sein.","La chaleur + les larmes peuvent porter des sentiments complexes : joie, tendresse, nostalgie ou \xeatre \xe9mu.","\u0627\u0644\u062f\u0641\u0621 + \u0627\u0644\u062f\u0645\u0648\u0639 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u062d\u0645\u0644 \u0645\u0634\u0627\u0639\u0631 \u0645\u062a\u0639\u062f\u062f\u0629: \u0627\u0644\u0641\u0631\u062d\u060c \u0627\u0644\u0631\u0642\u0629\u060c \u0627\u0644\u0627\u0634\u062a\u064a\u0627\u0642 \u0644\u0634\u064a\u0621\u060c \u0623\u0648 \u0627\u0644\u062a\u0623\u062b\u0631.","\ub530\ub73b\ud568 + \ub208\ubb3c\uc740 \uc5ec\ub7ec \uac10\uc815\uc744 \ub2f4\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4: \uae30\uc068, \ubd80\ub4dc\ub7ec\uc6c0, \uadf8\ub9ac\uc6c0 \ub610\ub294 \uac10\ub3d9.","\u6e29\u6696 + \u773c\u6cea\u53ef\u4ee5\u627f\u8f7d\u5c42\u6b21\u4e30\u5bcc\u7684\u611f\u60c5\uff1a\u559c\u60a6\u3001\u6e29\u67d4\u3001\u601d\u5ff5\u6216\u88ab\u611f\u52a8\u3002","\u0917\u0930\u094d\u092e\u093e\u0939\u091f + \u0906\u0902\u0938\u0942 \u092e\u093f\u0936\u094d\u0930\u093f\u0924 \u092d\u093e\u0935\u0928\u093e\u0913\u0902 \u0915\u094b \u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902: \u0916\u0941\u0936\u0940, \u0938\u094d\u0928\u0947\u0939, \u0915\u0941\u091b \u0915\u0940 \u0915\u092e\u0940 \u092f\u093e \u092d\u093e\u0935\u0928\u093e\u0924\u094d\u092e\u0915 \u0930\u0942\u092a \u0938\u0947 \u092a\u094d\u0930\u092d\u093e\u0935\u093f\u0924 \u0939\u094b\u0928\u093e\u0964","Calor + lacrimae multos affectus gerere possunt: gaudium, tenderitatem, aliquid amittere, vel motum esse.","Il calore + le lacrime possono portare sentimenti complessi: gioia, tenerezza, mancare qualcosa o essere commossi.","\u06af\u0631\u0645\u0627 + \u0627\u0634\u06a9\u200c\u0647\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0627\u062d\u0633\u0627\u0633\u0627\u062a \u0686\u0646\u062f \u0644\u0627\u06cc\u0647\u200c\u0627\u06cc \u0631\u0627 \u062d\u0645\u0644 \u06a9\u0646\u0646\u062f: \u0634\u0627\u062f\u06cc\u060c \u0644\u0637\u0627\u0641\u062a\u060c \u062f\u0644\u062a\u0646\u06af\u06cc \u0686\u06cc\u0632\u06cc \u06cc\u0627 \u062a\u062d\u062a \u062a\u0627\u062b\u06cc\u0631 \u0642\u0631\u0627\u0631 \u06af\u0631\u0641\u062a\u0646."],t.w)
