B.a8V=new A.d(B.c,["Jaw tension at work","Tensi\xf3n en la mand\xedbula en el trabajo","Kieferspannung bei der Arbeit","Tension dans la m\xe2choire au travail","\u062a\u0648\u062a\u0631 \u0627\u0644\u0641\u0643 \u0641\u064a \u0627\u0644\u0639\u0645\u0644","\uc9c1\uc7a5\uc5d0\uc11c\uc758 \ud131 \uae34\uc7a5","\u5de5\u4f5c\u65f6\u7684\u4e0b\u5df4\u7d27\u5f20","\u0915\u093e\u092e \u0915\u0947 \u0926\u094c\u0930\u093e\u0928 \u091c\u092c\u0921\u093c\u0947 \u092e\u0947\u0902 \u0924\u0928\u093e\u0935","Tensio mandibulae in opere","Tensione nella mascella al lavoro","\u062a\u0646\u0634 \u062f\u0631 \u0641\u06a9 \u0647\u0646\u06af\u0627\u0645 \u06a9\u0627\u0631"],t.w)
B.acP=new A.d(B.c,["Scenario:\nDuring certain tasks or meetings, your jaw clenches and your teeth press together.\n\nWhat is a reasonable guess about this signal?","Escenario:\nDurante ciertas tareas o reuniones, tu mand\xedbula se aprieta y tus dientes se presionan juntos.\n\n\xbfQu\xe9 podr\xeda significar este signo?","Szenario:\nBei bestimmten Aufgaben oder Besprechungen verkrampft sich dein Kiefer und deine Z\xe4hne pressen sich zusammen.\n\nWas k\xf6nnte dieses Signal bedeuten?","Sc\xe9nario :\nLors de certaines t\xe2ches ou r\xe9unions, votre m\xe2choire se serre et vos dents se pressent ensemble.\n\nQue pourrait signifier ce signal ?","\u0627\u0644\u0633\u064a\u0646\u0627\u0631\u064a\u0648:\n\u062e\u0644\u0627\u0644 \u0628\u0639\u0636 \u0627\u0644\u0645\u0647\u0627\u0645 \u0623\u0648 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u0627\u062a\u060c \u064a\u0646\u063a\u0644\u0642 \u0641\u0643\u0643 \u0648\u062a\u0644\u062a\u0635\u0642 \u0623\u0633\u0646\u0627\u0646\u0643 \u0628\u0628\u0639\u0636\u0647\u0627.\n\n\u0645\u0627 \u0647\u0648 \u0627\u0644\u062a\u0641\u0633\u064a\u0631 \u0627\u0644\u0645\u062d\u062a\u0645\u0644 \u0644\u0647\u0630\u0627 \u0627\u0644\u0625\u0634\u0627\u0631\u0629\u061f","\uc2dc\ub098\ub9ac\uc624:\n\ud2b9\uc815 \uc791\uc5c5\uc774\ub098 \ud68c\uc758 \uc911\uc5d0 \ud131\uc774 \uaf49 \ub2e4\ubb3c\uc5b4\uc9c0\uace0 \uc774\ube68\uc774 \ud568\uaed8 \ub20c\ub9bd\ub2c8\ub2e4.\n\n\uc774 \uc2e0\ud638\uc5d0 \ub300\ud55c \ud569\ub9ac\uc801\uc778 \ucd94\uce21\uc740 \ubb34\uc5c7\uc77c\uae4c\uc694?","\u573a\u666f\uff1a\n\u5728\u67d0\u4e9b\u4efb\u52a1\u6216\u4f1a\u8bae\u4e2d\uff0c\u4f60\u7684\u4e0b\u5df4\u7d27\u95ed\uff0c\u7259\u9f7f\u7d27\u538b\u5728\u4e00\u8d77\u3002\n\n\u8fd9\u4e2a\u4fe1\u53f7\u53ef\u80fd\u610f\u5473\u7740\u4ec0\u4e48\uff1f","\u092a\u0930\u093f\u0938\u094d\u0925\u093f\u0924\u093f:\n\u0915\u0941\u091b \u0915\u093e\u0930\u094d\u092f\u094b\u0902 \u092f\u093e \u092c\u0948\u0920\u0915\u094b\u0902 \u0915\u0947 \u0926\u094c\u0930\u093e\u0928, \u0906\u092a\u0915\u093e \u091c\u092c\u0921\u093c\u093e \u0915\u0938\u0915\u0930 \u092c\u0902\u0926 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u0914\u0930 \u0906\u092a\u0915\u0947 \u0926\u093e\u0902\u0924 \u090f\u0915 \u0938\u093e\u0925 \u0926\u092c\u0924\u0947 \u0939\u0948\u0902\u0964\n\n\u0907\u0938 \u0938\u0902\u0915\u0947\u0924 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u090f\u0915 \u0909\u091a\u093f\u0924 \u0905\u0928\u0941\u092e\u093e\u0928 \u0915\u094d\u092f\u093e \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948?","Scenario:\nIn quibusdam operibus vel conventibus, mandibula tua compingitur et dentes simul premuntur.\n\nQuid hoc signum significare potest?","Scenario:\nDurante alcune attivit\xe0 o riunioni, la tua mascella si serrano e i tuoi denti si premono insieme.\n\nCosa potrebbe significare questo segnale?","\u0633\u0646\u0627\u0631\u06cc\u0648:\n\u062f\u0631 \u0637\u0648\u0644 \u0628\u0631\u062e\u06cc \u0627\u0632 \u0648\u0638\u0627\u06cc\u0641 \u06cc\u0627 \u062c\u0644\u0633\u0627\u062a\u060c \u0641\u06a9 \u0634\u0645\u0627 \u0645\u062d\u06a9\u0645 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u062f\u0646\u062f\u0627\u0646\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0628\u0647 \u0647\u0645 \u0641\u0634\u0627\u0631 \u0645\u06cc\u200c\u0622\u06cc\u062f.\n\n\u0627\u06cc\u0646 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0686\u0647 \u0645\u0639\u0646\u0627\u06cc\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f\u061f"],t.w)
B.aa5=new A.d(B.c,["You might be holding anger, stress, or unspoken words.","Podr\xedas estar conteniendo ira, estr\xe9s o palabras no dichas.","Vielleicht h\xe4ltst du Wut, Stress oder unausgesprochene Worte zur\xfcck.","Vous pourriez retenir de la col\xe8re, du stress ou des mots non dits.","\u0642\u062f \u062a\u0643\u0648\u0646 \u062a\u062d\u0645\u0644 \u0627\u0644\u063a\u0636\u0628\u060c \u0627\u0644\u062a\u0648\u062a\u0631\u060c \u0623\u0648 \u0643\u0644\u0645\u0627\u062a \u063a\u064a\u0631 \u0645\u064f\u0642\u0627\u0644\u0629.","\ub2f9\uc2e0\uc740 \ud654, \uc2a4\ud2b8\ub808\uc2a4, \ub610\ub294 \ub9d0\ud558\uc9c0 \uc54a\uc740 \ub9d0\uc744 \ucc38\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u4f60\u53ef\u80fd\u5728\u538b\u6291\u6124\u6012\u3001\u538b\u529b\u6216\u672a\u8bf4\u51fa\u7684\u8bed\u8a00\u3002","\u0906\u092a \u0917\u0941\u0938\u094d\u0938\u0947, \u0924\u0928\u093e\u0935, \u092f\u093e \u0905\u0928\u0915\u0939\u0947 \u0936\u092c\u094d\u0926\u094b\u0902 \u0915\u094b \u0926\u092c\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964","Forsitan iram, stressum, aut verba non dicta tenes.","Potresti stare trattenendo rabbia, stress o parole non dette.","\u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0634\u0645\u0627 \u062e\u0634\u0645\u060c \u0627\u0633\u062a\u0631\u0633 \u06cc\u0627 \u06a9\u0644\u0645\u0627\u062a \u0646\u06af\u0641\u062a\u0647 \u0631\u0627 \u062f\u0631 \u062e\u0648\u062f \u0646\u06af\u0647 \u062f\u0627\u0631\u06cc\u062f."],t.w)
