B.afa=new A.d(B.c,["It means you should never speak again.","Significa que nunca deber\xedas hablar nuevamente.","Es bedeutet, dass du nie wieder sprechen solltest.","Cela signifie que vous ne devez jamais parler \xe0 nouveau.","\u064a\u0639\u0646\u064a \u0623\u0646\u0643 \u064a\u062c\u0628 \u0623\u0644\u0627 \u062a\u062a\u062d\u062f\u062b \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\ub2e4\uc2dc \ub9d0\ud558\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4.","\u8fd9\u610f\u5473\u7740\u4f60\u5e94\u8be5\u6c38\u8fdc\u4e0d\u518d\u8bf4\u8bdd\u3002","\u0907\u0938\u0915\u093e \u092e\u0924\u0932\u092c \u0939\u0948 \u0915\u093f \u0906\u092a\u0915\u094b \u092b\u093f\u0930 \u0915\u092d\u0940 \u092c\u093e\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964","Significat est ne iterum loqui.","Significa che non dovresti mai pi\xf9 parlare.","\u0627\u06cc\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0639\u0646\u0627\u0633\u062a \u06a9\u0647 \u0634\u0645\u0627 \u0646\u0628\u0627\u06cc\u062f \u062f\u06cc\u06af\u0631 \u0635\u062d\u0628\u062a \u06a9\u0646\u06cc\u062f."],t.w)
