B.adp=new A.d(B.c,["Jaw clenching is common when we are bracing, frustrated, or swallowing what we want to say.","El apret\xf3n de mand\xedbula es com\xfan cuando estamos tensos, frustrados o tragando lo que queremos decir.","Kieferverkrampfung ist \xfcblich, wenn wir uns anstrengen, frustriert sind oder das sagen, was wir sagen wollen, herunterschlucken.","Le serrage de la m\xe2choire est courant lorsque nous sommes tendus, frustr\xe9s ou en train d\u2019avaler ce que nous voulons dire.","\u0625\u0637\u0628\u0627\u0642 \u0627\u0644\u0641\u0643 \u0623\u0645\u0631 \u0634\u0627\u0626\u0639 \u0639\u0646\u062f\u0645\u0627 \u0646\u0643\u0648\u0646 \u0645\u062a\u0648\u062a\u0631\u064a\u0646 \u0623\u0648 \u0645\u062d\u0628\u0637\u064a\u0646 \u0623\u0648 \u0646\u0628\u062a\u0644\u0639 \u0645\u0627 \u0646\u0631\u064a\u062f \u0642\u0648\u0644\u0647.","\ud131\uc744 \uaf49 \ubb3c\uba74 \uc6b0\ub9ac\uac00 \uc900\ube44\ud558\uace0 \uc788\uac70\ub098, \uc88c\uc808\ud558\uac70\ub098, \ud558\uace0 \uc2f6\uc740 \ub9d0\uc744 \uc0bc\ud0ac \ub54c \ud754\ud558\uac8c \ub098\ud0c0\ub0a9\ub2c8\ub2e4.","\u5f53\u6211\u4eec\u5728\u652f\u6491\u3001\u6cae\u4e27\u6216\u541e\u54bd\u6211\u4eec\u60f3\u8bf4\u7684\u8bdd\u65f6\uff0c\u54ac\u7d27\u7259\u5173\u662f\u5f88\u5e38\u89c1\u7684\u3002","\u091c\u092c \u0939\u092e \u0924\u0948\u092f\u093e\u0930 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0928\u093f\u0930\u093e\u0936 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u092f\u093e \u091c\u094b \u0915\u0939\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902, \u0909\u0938\u0947 \u0928\u093f\u0917\u0932\u0924\u0947 \u0939\u0948\u0902, \u0924\u092c \u091c\u092c\u0921\u093c\u0947 \u0915\u094b \u0915\u0938\u0928\u093e \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0939\u0948\u0964","Mandibula contrahens est commune, cum nos sustentamus, frustremur, aut ea quae dicere volumus deglutimus.","Stringere la mascella \xe8 comune quando siamo tesi, frustrati o stiamo inghiottendo ci\xf2 che vogliamo dire.","\u0641\u0634\u0631\u062f\u0646 \u0641\u06a9 \u0631\u0627\u06cc\u062c \u0627\u0633\u062a \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0645\u0627 \u062e\u0648\u062f \u0631\u0627 \u0622\u0645\u0627\u062f\u0647 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u0645\u060c \u062f\u0644\u0633\u0631\u062f \u0645\u06cc\u200c\u0634\u0648\u06cc\u0645 \u06cc\u0627 \u0686\u06cc\u0632\u06cc \u06a9\u0647 \u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u06cc\u0645 \u0628\u06af\u0648\u06cc\u06cc\u0645 \u0631\u0627 \u0645\u06cc\u200c\u0628\u0644\u0639\u06cc\u0645."],t.w)
