B.acT=new A.d(B.c,["Tension in the shoulders after stressful news","Tensi\xf3n en los hombros despu\xe9s de noticias estresantes","Spannung in den Schultern nach stressigen Nachrichten","Tension dans les \xe9paules apr\xe8s des nouvelles stressantes","\u062a\u0648\u062a\u0631 \u0641\u064a \u0627\u0644\u0643\u062a\u0641\u064a\u0646 \u0628\u0639\u062f \u0623\u062e\u0628\u0627\u0631 \u0645\u0631\u0647\u0642\u0629","\uc2a4\ud2b8\ub808\uc2a4 \ubc1b\ub294 \ub274\uc2a4 \ud6c4 \uc5b4\uae68 \uae34\uc7a5","\u538b\u529b\u65b0\u95fb\u540e\u7684\u80a9\u90e8\u7d27\u5f20","\u0924\u0928\u093e\u0935\u092a\u0942\u0930\u094d\u0923 \u0938\u092e\u093e\u091a\u093e\u0930\u094b\u0902 \u0915\u0947 \u092c\u093e\u0926 \u0915\u0902\u0927\u094b\u0902 \u092e\u0947\u0902 \u0924\u0928\u093e\u0935","Tensio in humeris post nuntios anxios","Tensione nelle spalle dopo notizie stressanti","\u062a\u0646\u0634 \u062f\u0631 \u0634\u0627\u0646\u0647\u200c\u0647\u0627 \u0628\u0639\u062f \u0627\u0632 \u0627\u062e\u0628\u0627\u0631 \u0627\u0633\u062a\u0631\u0633\u200c\u0632\u0627"],t.w)
B.aan=new A.d(B.c,["Scenario:\nYou hear some distressing news, and suddenly you feel a tightening in your shoulders and neck.\n\nWhat could this body reaction indicate?","Escenario:\nEscuchas algunas noticias angustiosas y, de repente, sientes una tensi\xf3n en los hombros y el cuello.\n\n\xbfQu\xe9 podr\xeda indicar esta reacci\xf3n corporal?","Szenario:\nDu h\xf6rst beunruhigende Nachrichten und pl\xf6tzlich sp\xfcrst du eine Anspannung in deinen Schultern und im Nacken.\n\nWas k\xf6nnte diese K\xf6rperreaktion anzeigen?","Sc\xe9nario :\nVous entendez des nouvelles inqui\xe9tantes, et soudainement vous ressentez une tension dans vos \xe9paules et votre cou.\n\nQue pourrait indiquer cette r\xe9action corporelle ?","\u0627\u0644\u0633\u064a\u0646\u0627\u0631\u064a\u0648:\n\u062a\u0633\u0645\u0639 \u0628\u0639\u0636 \u0627\u0644\u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u0645\u0632\u0639\u062c\u0629\u060c \u0648\u0641\u062c\u0623\u0629 \u062a\u0634\u0639\u0631 \u0628\u0634\u062f \u0641\u064a \u0643\u062a\u0641\u064a\u0643 \u0648\u0631\u0642\u0628\u062a\u0643.\n\n\u0645\u0627\u0630\u0627 \u0642\u062f \u062a\u0634\u064a\u0631 \u0647\u0630\u0647 \u0627\u0644\u062a\u0641\u0627\u0639\u0644 \u0627\u0644\u062c\u0633\u062f\u064a\u061f","\uc2dc\ub098\ub9ac\uc624:\n\uac71\uc815\ub418\ub294 \ub274\uc2a4\ub97c \ub4e3\uace0 \uac11\uc790\uae30 \uc5b4\uae68\uc640 \ubaa9\uc5d0 \uae34\uc7a5\uc774 \ub290\uaef4\uc9d1\ub2c8\ub2e4.\n\n\uc774 \uc2e0\uccb4 \ubc18\uc751\uc740 \ubb34\uc5c7\uc744 \ub098\ud0c0\ub0bc \uc218 \uc788\uc2b5\ub2c8\uae4c?","\u573a\u666f\uff1a\n\u4f60\u542c\u5230\u4e86\u4e00\u4e9b\u4ee4\u4eba\u4e0d\u5b89\u7684\u6d88\u606f\uff0c\u7a81\u7136\u611f\u5230\u80a9\u8180\u548c\u8116\u5b50\u7d27\u5f20\u3002\n\n\u8fd9\u79cd\u8eab\u4f53\u53cd\u5e94\u53ef\u80fd\u8868\u793a\u4ec0\u4e48\uff1f","\u092a\u0930\u093f\u0938\u094d\u0925\u093f\u0924\u093f:\n\u0906\u092a \u0915\u0941\u091b \u091a\u093f\u0902\u0924\u093e\u091c\u0928\u0915 \u0938\u092e\u093e\u091a\u093e\u0930 \u0938\u0941\u0928\u0924\u0947 \u0939\u0948\u0902, \u0914\u0930 \u0905\u091a\u093e\u0928\u0915 \u0906\u092a\u0915\u094b \u0915\u0902\u0927\u0947 \u0914\u0930 \u0917\u0930\u094d\u0926\u0928 \u092e\u0947\u0902 \u0915\u0938\u093e\u0935 \u092e\u0939\u0938\u0942\u0938 \u0939\u094b\u0924\u093e \u0939\u0948\u0964\n\n\u092f\u0939 \u0936\u093e\u0930\u0940\u0930\u093f\u0915 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0915\u094d\u092f\u093e \u0938\u0902\u0915\u0947\u0924 \u0926\u0947 \u0938\u0915\u0924\u0940 \u0939\u0948?","Scenario:\nNuntios anxios audis, et subito sentiendi tensio in humeris et collo.\n\nQuid haec reactio corporis indicare potest?","Scenario:\nAscolti alcune notizie inquietanti e improvvisamente senti una tensione nelle spalle e nel collo.\n\nCosa potrebbe indicare questa reazione del corpo?","\u0633\u0646\u0627\u0631\u06cc\u0648:\n\u0634\u0645\u0627 \u0628\u0631\u062e\u06cc \u0627\u062e\u0628\u0627\u0631 \u0646\u0627\u0631\u0627\u062d\u062a\u200c\u06a9\u0646\u0646\u062f\u0647 \u0645\u06cc\u200c\u0634\u0646\u0648\u06cc\u062f \u0648 \u0646\u0627\u06af\u0647\u0627\u0646 \u0627\u062d\u0633\u0627\u0633 \u06a9\u0634\u06cc\u062f\u06af\u06cc \u062f\u0631 \u0634\u0627\u0646\u0647\u200c\u0647\u0627 \u0648 \u06af\u0631\u062f\u0646 \u062e\u0648\u062f \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f.\n\n\u0627\u06cc\u0646 \u0648\u0627\u06a9\u0646\u0634 \u0628\u062f\u0646\u06cc \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0686\u0647 \u0686\u06cc\u0632\u06cc \u0631\u0627 \u0646\u0634\u0627\u0646 \u062f\u0647\u062f\u061f"],t.w)
B.adf=new A.d(B.c,["It could indicate that you are holding stress and anxiety in your body.","Podr\xeda indicar que est\xe1s acumulando estr\xe9s y ansiedad en tu cuerpo.","Es k\xf6nnte darauf hinweisen, dass du Stress und Angst in deinem K\xf6rper h\xe4ltst.","Cela pourrait indiquer que vous retenez du stress et de l'anxi\xe9t\xe9 dans votre corps.","\u0642\u062f \u064a\u0634\u064a\u0631 \u0625\u0644\u0649 \u0623\u0646\u0643 \u062a\u062d\u0645\u0644 \u0627\u0644\u062a\u0648\u062a\u0631 \u0648\u0627\u0644\u0642\u0644\u0642 \u0641\u064a \u062c\u0633\u0645\u0643.","\uc774\uac83\uc740 \ub2f9\uc2e0\uc774 \ubab8\uc5d0 \uc2a4\ud2b8\ub808\uc2a4\uc640 \ubd88\uc548\uc744 \uc313\uace0 \uc788\uc74c\uc744 \ub098\ud0c0\ub0bc \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u8fd9\u53ef\u80fd\u8868\u793a\u4f60\u5728\u8eab\u4f53\u4e2d\u79ef\u538b\u4e86\u538b\u529b\u548c\u7126\u8651\u3002","\u092f\u0939 \u0938\u0902\u0915\u0947\u0924 \u0926\u0947 \u0938\u0915\u0924\u093e \u0939\u0948 \u0915\u093f \u0906\u092a \u0905\u092a\u0928\u0947 \u0936\u0930\u0940\u0930 \u092e\u0947\u0902 \u0924\u0928\u093e\u0935 \u0914\u0930 \u091a\u093f\u0902\u0924\u093e \u0915\u094b \u0938\u0902\u091c\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","Hoc indicare potest te in corpore stressum et anxietatem tenere.","Potrebbe indicare che stai trattenendo stress e ansia nel tuo corpo.","\u0627\u06cc\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0646\u0634\u0627\u0646 \u062f\u0647\u062f \u06a9\u0647 \u0634\u0645\u0627 \u0627\u0633\u062a\u0631\u0633 \u0648 \u0627\u0636\u0637\u0631\u0627\u0628 \u0631\u0627 \u062f\u0631 \u0628\u062f\u0646\u062a\u0627\u0646 \u0646\u06af\u0647 \u062f\u0627\u0634\u062a\u0647\u200c\u0627\u06cc\u062f."],t.w)
