B.a9H=new A.d(B.c,["It means you are in perfect condition and should be happy.","Significa que est\xe1s en perfecto estado y deber\xedas ser feliz.","Es bedeutet, dass du in perfektem Zustand bist und gl\xfccklich sein solltest.","Cela signifie que vous \xeates en parfaite condition et que vous devriez \xeatre heureux.","\u064a\u0639\u0646\u064a \u0623\u0646\u0643 \u0641\u064a \u062d\u0627\u0644\u0629 \u0645\u062b\u0627\u0644\u064a\u0629 \u0648\u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0633\u0639\u064a\u062f\u064b\u0627.","\uc774\ub294 \ub2f9\uc2e0\uc774 \uc644\ubcbd\ud55c \uc0c1\ud0dc\uc5d0 \uc788\uace0 \ud589\ubcf5\ud574\uc57c \ud55c\ub2e4\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.","\u8fd9\u610f\u5473\u7740\u4f60\u5904\u4e8e\u5b8c\u7f8e\u7684\u72b6\u6001\uff0c\u5e94\u8be5\u611f\u5230\u5e78\u798f\u3002","\u0907\u0938\u0915\u093e \u092e\u0924\u0932\u092c \u0939\u0948 \u0915\u093f \u0906\u092a \u090f\u0915\u0926\u092e \u0938\u0939\u0940 \u0938\u094d\u0925\u093f\u0924\u093f \u092e\u0947\u0902 \u0939\u0948\u0902 \u0914\u0930 \u0906\u092a\u0915\u094b \u0916\u0941\u0936 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Hoc significat te in perfecto statu esse et laetum esse debere.","Significa che sei in perfette condizioni e dovresti essere felice.","\u0627\u06cc\u0646 \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0639\u0646\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0634\u0645\u0627 \u062f\u0631 \u0634\u0631\u0627\u06cc\u0637 \u0639\u0627\u0644\u06cc \u0647\u0633\u062a\u06cc\u062f \u0648 \u0628\u0627\u06cc\u062f \u062e\u0648\u0634\u062d\u0627\u0644 \u0628\u0627\u0634\u06cc\u062f."],t.w)
