B.a7H=new A.d(B.c,["Feeling tension in the shoulders after stressful news is often linked to the body responding to stress.","Sentir tensi\xf3n en los hombros despu\xe9s de noticias estresantes est\xe1 a menudo relacionado con la respuesta del cuerpo al estr\xe9s.","Das Gef\xfchl der Spannung in den Schultern nach stressigen Nachrichten h\xe4ngt oft mit der Reaktion des K\xf6rpers auf Stress zusammen.","Ressentir de la tension dans les \xe9paules apr\xe8s des nouvelles stressantes est souvent li\xe9 \xe0 la r\xe9ponse du corps au stress.","\u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u062a\u0648\u062a\u0631 \u0641\u064a \u0627\u0644\u0643\u062a\u0641\u064a\u0646 \u0628\u0639\u062f \u0627\u0644\u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u0645\u0631\u0647\u0642\u0629 \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u0631\u062a\u0628\u0637 \u0628\u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0627\u0644\u062c\u0633\u0645 \u0644\u0644\u062a\u0648\u062a\u0631.","\uc2a4\ud2b8\ub808\uc2a4 \ubc1b\ub294 \ub274\uc2a4 \ud6c4 \uc5b4\uae68\uc5d0 \uae34\uc7a5\uc774 \ub290\uaef4\uc9c0\ub294 \uac83\uc740 \uc885\uc885 \uc2a4\ud2b8\ub808\uc2a4\uc5d0 \ub300\ud55c \ubab8\uc758 \ubc18\uc751\uacfc \uad00\ub828\uc774 \uc788\uc2b5\ub2c8\ub2e4.","\u5728\u538b\u529b\u65b0\u95fb\u540e\u611f\u5230\u80a9\u90e8\u7d27\u5f20\u901a\u5e38\u4e0e\u8eab\u4f53\u5bf9\u538b\u529b\u7684\u53cd\u5e94\u6709\u5173\u3002","\u0924\u0928\u093e\u0935\u092a\u0942\u0930\u094d\u0923 \u0938\u092e\u093e\u091a\u093e\u0930\u094b\u0902 \u0915\u0947 \u092c\u093e\u0926 \u0915\u0902\u0927\u094b\u0902 \u092e\u0947\u0902 \u0924\u0928\u093e\u0935 \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u0928\u093e \u0905\u0915\u094d\u0938\u0930 \u0936\u0930\u0940\u0930 \u0915\u0947 \u0924\u0928\u093e\u0935 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0938\u0947 \u091c\u0941\u0921\u093c\u093e \u0939\u094b\u0924\u093e \u0939\u0948\u0964","Sentire tensio in humeris post nuntios anxios saepe coniungitur cum reactione corporis ad stress.","Sentire tensione nelle spalle dopo notizie stressanti \xe8 spesso legato alla risposta del corpo allo stress.","\u0627\u062d\u0633\u0627\u0633 \u06a9\u0634\u06cc\u062f\u06af\u06cc \u062f\u0631 \u0634\u0627\u0646\u0647\u200c\u0647\u0627 \u0628\u0639\u062f \u0627\u0632 \u0627\u062e\u0628\u0627\u0631 \u0627\u0633\u062a\u0631\u0633\u200c\u0632\u0627 \u0645\u0639\u0645\u0648\u0644\u0627\u064b \u0628\u0647 \u0648\u0627\u06a9\u0646\u0634 \u0628\u062f\u0646 \u0628\u0647 \u0627\u0633\u062a\u0631\u0633 \u0645\u0631\u062a\u0628\u0637 \u0627\u0633\u062a."],t.w)
