B.a9e=new A.d(B.c,["It proves that you are simply unfit and need rest.","Prueba que simplemente no est\xe1s en forma y necesitas descanso.","Es beweist, dass du einfach nicht fit bist und Ruhe brauchst.","Cela prouve que vous n'\xeates tout simplement pas en forme et que vous avez besoin de repos.","\u064a\u062b\u0628\u062a \u0623\u0646\u0643 \u0628\u0628\u0633\u0627\u0637\u0629 \u063a\u064a\u0631 \u0644\u0627\u0626\u0642 \u0648\u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u0627\u0644\u0631\u0627\u062d\u0629.","\ub2e8\uc21c\ud788 \ubab8\uc774 \uc88b\uc9c0 \uc54a\uc544\uc11c \ud734\uc2dd\uc774 \ud544\uc694\ud558\ub2e4\ub294 \uac83\uc744 \uc99d\uba85\ud569\ub2c8\ub2e4.","\u8fd9\u8bc1\u660e\u4f60\u6839\u672c\u4e0d\u9002\u5408\uff0c\u9700\u8981\u4f11\u606f\u3002","\u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u0906\u092a \u092c\u0938 \u092b\u093f\u091f \u0928\u0939\u0940\u0902 \u0939\u0948\u0902 \u0914\u0930 \u0906\u0930\u093e\u092e \u0915\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0939\u0948\u0964","Hoc probat te simpliciter non idoneum esse et requiem opus esse.","Prova che semplicemente non sei in forma e hai bisogno di riposo.","\u0627\u06cc\u0646 \u062b\u0627\u0628\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0634\u0645\u0627 \u0628\u0647 \u0633\u0627\u062f\u06af\u06cc \u062a\u0646\u0627\u0633\u0628 \u0627\u0646\u062f\u0627\u0645 \u0646\u062f\u0627\u0631\u06cc\u062f \u0648 \u0628\u0647 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0646\u06cc\u0627\u0632 \u062f\u0627\u0631\u06cc\u062f."],t.w)
