B.aap=new A.d(B.c,["The late friend","El amigo tarde","Der sp\xe4te Freund","L'ami en retard","\u0627\u0644\u0635\u062f\u064a\u0642 \u0627\u0644\u0645\u062a\u0623\u062e\u0631","\ub2a6\uc740 \uce5c\uad6c","\u8fdf\u5230\u7684\u670b\u53cb","\u0926\u0947\u0930 \u0938\u0947 \u0906\u0928\u0947 \u0935\u093e\u0932\u093e \u0926\u094b\u0938\u094d\u0924","Amicus tardus","L'amico in ritardo","\u062f\u0648\u0633\u062a \u062f\u06cc\u0631 \u0631\u0633"],t.w)
B.aa6=new A.d(B.c,["A rainy evening, soft music in your earbuds. You are in a corner caf\xe9, hands wrapped around a warm drink. Your friend is now 20 minutes late. Each time the door opens, your chest tightens a bit. What is the most balanced way to read this?","Una noche lluviosa, m\xfasica suave en tus auriculares. Est\xe1s en una cafeter\xeda en una esquina, con las manos rodeando una bebida caliente. Tu amigo llega 20 minutos tarde. Cada vez que se abre la puerta, tu pecho se aprieta un poco. \xbfCu\xe1l es la forma m\xe1s equilibrada de leer esto?","Ein regnerischer Abend, sanfte Musik in deinen Ohren. Du bist in einem Eckcaf\xe9, die H\xe4nde um ein warmes Getr\xe4nk gewickelt. Dein Freund ist jetzt 20 Minuten zu sp\xe4t. Jedes Mal, wenn die T\xfcr aufgeht, zieht sich deine Brust ein wenig zusammen. Wie liest man das am ausgewogensten?","Une soir\xe9e pluvieuse, de la musique douce dans vos \xe9couteurs. Vous \xeates dans un caf\xe9 au coin, les mains autour d'une boisson chaude. Votre ami a maintenant 20 minutes de retard. Chaque fois que la porte s'ouvre, votre poitrine se serre un peu. Quelle est la fa\xe7on la plus \xe9quilibr\xe9e de lire cela?","\u0645\u0633\u0627\u0621 \u0645\u0645\u0637\u0631\u060c \u0645\u0648\u0633\u064a\u0642\u0649 \u0646\u0627\u0639\u0645\u0629 \u0641\u064a \u0633\u0645\u0627\u0639\u0627\u062a\u0643. \u0623\u0646\u062a \u0641\u064a \u0645\u0642\u0647\u0649 \u0632\u0627\u0648\u064a\u060c \u064a\u062f\u064a\u0643 \u0645\u0644\u0641\u0648\u0641\u0629 \u062d\u0648\u0644 \u0645\u0634\u0631\u0648\u0628 \u062f\u0627\u0641\u0626. \u0635\u062f\u064a\u0642\u0643 \u0627\u0644\u0622\u0646 \u0645\u062a\u0623\u062e\u0631 \u0628\u0645\u0642\u062f\u0627\u0631 20 \u062f\u0642\u064a\u0642\u0629. \u0643\u0644\u0645\u0627 \u0641\u062a\u062d\u062a \u0627\u0644\u0628\u0627\u0628\u060c \u064a\u0636\u064a\u0642 \u0635\u062f\u0631\u0643 \u0642\u0644\u064a\u0644\u0627\u064b. \u0645\u0627 \u0647\u0648 \u0627\u0644\u062a\u0641\u0633\u064a\u0631 \u0627\u0644\u0623\u0643\u062b\u0631 \u062a\u0648\u0627\u0632\u0646\u0627\u064b \u0644\u0647\u0630\u0627\u061f","\ube44 \uc624\ub294 \uc800\ub141, \ubd80\ub4dc\ub7ec\uc6b4 \uc74c\uc545\uc774 \uadc0\uc5d0 \ub4e4\ub9b0\ub2e4. \ub2f9\uc2e0\uc740 \ucf54\ub108 \uce74\ud398\uc5d0 \uc788\uc73c\uba70, \ub530\ub73b\ud55c \uc74c\ub8cc\ub97c \uc190\uc5d0 \uc950\uace0 \uc788\ub2e4. \uce5c\uad6c\ub294 \uc774\uc81c 20\ubd84 \ub2a6\uc5c8\ub2e4. \ubb38\uc774 \uc5f4\ub9b4 \ub54c\ub9c8\ub2e4 \uac00\uc2b4\uc774 \uc57d\uac04 \uc870\uc5ec\uc9c4\ub2e4. \uc774\ub97c \uc77d\ub294 \uac00\uc7a5 \uade0\ud615 \uc7a1\ud78c \ubc29\ubc95\uc740 \ubb34\uc5c7\uc77c\uae4c?","\u4e00\u4e2a\u96e8\u591c\uff0c\u8033\u673a\u91cc\u4f20\u6765\u67d4\u548c\u7684\u97f3\u4e50\u3002\u4f60\u5750\u5728\u89d2\u843d\u7684\u5496\u5561\u9986\uff0c \u624b\u91cc\u6367\u7740\u4e00\u676f\u6e29\u6696\u7684\u996e\u6599\u3002\u4f60\u7684\u670b\u53cb\u73b0\u5728\u8fdf\u5230\u4e8620\u5206\u949f\u3002 \u6bcf\u6b21\u95e8\u6253\u5f00\u65f6\uff0c\u4f60\u7684\u80f8\u53e3\u90fd\u4f1a\u7d27\u5f20\u4e00\u4e0b\u3002\u6700\u5e73\u8861\u7684\u89e3\u8bfb\u65b9\u5f0f\u662f\u4ec0\u4e48\uff1f","\u090f\u0915 \u092c\u0930\u0938\u093e\u0924 \u0915\u0940 \u0936\u093e\u092e, \u0906\u092a\u0915\u0947 \u0907\u092f\u0930\u092c\u0921\u094d\u0938 \u092e\u0947\u0902 \u0939\u0932\u094d\u0915\u0940 \u0938\u0902\u0917\u0940\u0924\u0964 \u0906\u092a \u090f\u0915 \u0915\u094b\u0928\u0947 \u0915\u0947 \u0915\u0948\u092b\u0947 \u092e\u0947\u0902 \u0939\u0948\u0902, \u0917\u0930\u094d\u092e \u092a\u0947\u092f \u0915\u0947 \u0938\u093e\u0925 \u0939\u093e\u0925\u094b\u0902 \u092e\u0947\u0902\u0964 \u0906\u092a\u0915\u093e \u0926\u094b\u0938\u094d\u0924 \u0905\u092c 20 \u092e\u093f\u0928\u091f \u0926\u0947\u0930 \u0938\u0947 \u0906\u092f\u093e \u0939\u0948\u0964 \u091c\u092c \u092d\u0940 \u0926\u0930\u0935\u093e\u091c\u093e \u0916\u0941\u0932\u0924\u093e \u0939\u0948, \u0906\u092a\u0915\u093e \u0938\u0940\u0928\u093e \u0925\u094b\u0921\u093c\u093e \u0938\u0902\u0915\u0941\u091a\u093f\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0947 \u092a\u0922\u093c\u0928\u0947 \u0915\u093e \u0938\u092c\u0938\u0947 \u0938\u0902\u0924\u0941\u0932\u093f\u0924 \u0924\u0930\u0940\u0915\u093e \u0915\u094d\u092f\u093e \u0939\u0948?","Serenus vesper, lenis musica in auribus. In angulo caf\xe9 es, manibus calidum potum circumdatis. Amicus tuus nunc 20 minuta tardus est. Quoties ostium aperitur, pectus tuum aliquantum contrahit. Quomodo hoc plene legitur?","Una serata piovosa, dolce musica nelle tue cuffie. Sei in un angolo di caff\xe8, le mani intorno a una bevanda calda. Il tuo amico \xe8 ora 20 minuti in ritardo. Ogni volta che la porta si apre, il tuo petto si stringe un po'. Qual \xe8 il modo pi\xf9 equilibrato per leggere questo?","\u06cc\u06a9 \u0634\u0628 \u0628\u0627\u0631\u0627\u0646\u06cc\u060c \u0645\u0648\u0633\u06cc\u0642\u06cc \u0622\u0631\u0627\u0645 \u062f\u0631 \u06af\u0648\u0634\u200c\u0647\u0627\u06cc \u0634\u0645\u0627. \u0634\u0645\u0627 \u062f\u0631 \u06cc\u06a9 \u06a9\u0627\u0641\u0647 \u06af\u0648\u0634\u0647\u200c\u0627\u06cc \u0647\u0633\u062a\u06cc\u062f\u060c \u062f\u0633\u062a\u200c\u0647\u0627\u06cc\u062a\u0627\u0646 \u062f\u0631 \u062d\u0627\u0644 \u0646\u06af\u0647 \u062f\u0627\u0634\u062a\u0646 \u06cc\u06a9 \u0646\u0648\u0634\u06cc\u062f\u0646\u06cc \u06af\u0631\u0645. \u062f\u0648\u0633\u062a \u0634\u0645\u0627 \u062d\u0627\u0644\u0627 20 \u062f\u0642\u06cc\u0642\u0647 \u062f\u06cc\u0631 \u06a9\u0631\u062f\u0647 \u0627\u0633\u062a. \u0647\u0631 \u0628\u0627\u0631 \u06a9\u0647 \u062f\u0631 \u0628\u0627\u0632 \u0645\u06cc\u200c\u0634\u0648\u062f\u060c \u0633\u06cc\u0646\u0647\u200c\u062a\u0627\u0646 \u06a9\u0645\u06cc \u0645\u0646\u0642\u0628\u0636 \u0645\u06cc\u200c\u0634\u0648\u062f. \u0645\u062a\u0639\u0627\u062f\u0644\u200c\u062a\u0631\u06cc\u0646 \u0631\u0627\u0647 \u0628\u0631\u0627\u06cc \u062e\u0648\u0627\u0646\u062f\u0646 \u0627\u06cc\u0646 \u0686\u06cc\u0633\u062a\u061f"],t.w)
B.ads=new A.d(B.c,["They clearly do not respect me at all and never have.","Claramente no me respetan en absoluto y nunca lo han hecho.","Sie respektieren mich offensichtlich \xfcberhaupt nicht und haben es nie getan.","Ils ne me respectent clairement pas du tout et ne l'ont jamais fait.","\u0625\u0646\u0647\u0645 \u0644\u0627 \u064a\u062d\u062a\u0631\u0645\u0648\u0646\u064a \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642 \u0648\u0644\u0645 \u064a\u0641\u0639\u0644\u0648\u0627 \u0630\u0644\u0643 \u0623\u0628\u062f\u0627\u064b.","\uadf8\ub4e4\uc740 \ub098\ub97c \uc804\ud600 \uc874\uc911\ud558\uc9c0 \uc54a\uc73c\uba70 \uc808\ub300 \uadf8\ub807\uc9c0 \uc54a\uc558\ub2e4.","\u4ed6\u4eec\u663e\u7136\u6839\u672c\u4e0d\u5c0a\u91cd\u6211\uff0c\u4e5f\u4ece\u672a\u5c0a\u91cd\u8fc7\u6211\u3002","\u0935\u0947 \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0942\u092a \u0938\u0947 \u092e\u0947\u0930\u0940 \u092c\u093f\u0932\u094d\u0915\u0941\u0932 \u092d\u0940 \u0907\u091c\u094d\u091c\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947 \u0914\u0930 \u0915\u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947 \u0925\u0947\u0964","Ipsi me non omnino reverentur et numquam fecerunt.","Non mi rispettano affatto e non lo hanno mai fatto.","\u0622\u0646\u0647\u0627 \u0628\u0647 \u0648\u0636\u0648\u062d \u0647\u06cc\u0686 \u0627\u062d\u062a\u0631\u0627\u0645\u06cc \u0628\u0647 \u0645\u0646 \u0646\u062f\u0627\u0631\u0646\u062f \u0648 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0646\u062f\u0627\u0634\u062a\u0647\u200c\u0627\u0646\u062f."],t.w)
