B.aaF=new A.d(B.c,["Something probably delayed them \u2014 traffic, work, or a small chaos I cannot see yet.","Algo probablemente los retras\xf3 \u2014 tr\xe1fico, trabajo o un peque\xf1o caos que a\xfan no puedo ver.","Etwas hat sie wahrscheinlich verz\xf6gert \u2013 Verkehr, Arbeit oder ein kleines Chaos, das ich noch nicht sehen kann.","Quelque chose les a probablement retard\xe9s \u2014 trafic, travail ou un petit chaos que je ne peux pas encore voir.","\u0631\u0628\u0645\u0627 \u062a\u0623\u062e\u0631\u0648\u0627 \u0628\u0633\u0628\u0628 \u0634\u064a\u0621 \u0645\u0627 \u2014 \u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631\u060c \u0627\u0644\u0639\u0645\u0644\u060c \u0623\u0648 \u0641\u0648\u0636\u0649 \u0635\u063a\u064a\u0631\u0629 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0631\u0624\u064a\u062a\u0647\u0627 \u0628\u0639\u062f.","\ubb34\uc5b8\uac00\uac00 \uadf8\ub4e4\uc744 \uc9c0\uc5f0\uc2dc\ucf30\uc744 \uac83\uc774\ub2e4 \u2014 \uad50\ud1b5, \uc77c, \ub610\ub294 \uc544\uc9c1 \ubcf4\uc9c0 \ubabb\ud55c \uc791\uc740 \ud63c\ub780.","\u53ef\u80fd\u6709\u67d0\u4e9b\u4e8b\u60c5\u62d6\u5ef6\u4e86\u4ed6\u4eec\u2014\u2014\u4ea4\u901a\u3001\u5de5\u4f5c\uff0c\u6216\u8005\u662f\u6211\u8fd8\u770b\u4e0d\u89c1\u7684\u5c0f\u6df7\u4e71\u3002","\u0915\u0941\u091b \u0936\u093e\u092f\u0926 \u0909\u0928\u094d\u0939\u0947\u0902 \u0926\u0947\u0930\u0940 \u0915\u0930 \u0926\u093f\u092f\u093e \u2014 \u091f\u094d\u0930\u0948\u092b\u093f\u0915, \u0915\u093e\u092e, \u092f\u093e \u090f\u0915 \u091b\u094b\u091f\u093e \u0938\u093e \u0905\u0935\u094d\u092f\u0935\u0938\u094d\u0925\u093e \u091c\u093f\u0938\u0947 \u092e\u0948\u0902 \u0905\u092d\u0940 \u0924\u0915 \u0928\u0939\u0940\u0902 \u0926\u0947\u0916 \u0938\u0915\u0924\u093e\u0964","Aliquid forte eos tardavit \u2014 vectura, labor, vel parvum chaos quod nondum video.","Probabilmente qualcosa li ha ritardati \u2014 traffico, lavoro o un piccolo caos che non posso ancora vedere.","\u0686\u06cc\u0632\u06cc \u0627\u062d\u062a\u0645\u0627\u0644\u0627\u064b \u0622\u0646\u0647\u0627 \u0631\u0627 \u062a\u0623\u062e\u06cc\u0631 \u0627\u0646\u062f\u0627\u062e\u062a\u0647 \u0627\u0633\u062a \u2014 \u062a\u0631\u0627\u0641\u06cc\u06a9\u060c \u06a9\u0627\u0631\u060c \u06cc\u0627 \u06cc\u06a9 \u0622\u0634\u0641\u062a\u06af\u06cc \u06a9\u0648\u0686\u06a9 \u06a9\u0647 \u0647\u0646\u0648\u0632 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0628\u0628\u06cc\u0646\u0645."],t.w)
