B.acx=new A.d(B.c,["I must have done something wrong and they are avoiding me now.","Debo haber hecho algo mal y ahora me est\xe1n evitando.","Ich muss etwas falsch gemacht haben und sie meiden mich jetzt.","J'ai d\xfb faire quelque chose de mal et ils m'\xe9vite maintenant.","\u0644\u0627\u0628\u062f \u0623\u0646\u0646\u064a \u0641\u0639\u0644\u062a \u0634\u064a\u0626\u064b\u0627 \u062e\u0627\u0637\u0626\u064b\u0627 \u0648\u0647\u0645 \u064a\u062a\u062c\u0646\u0628\u0648\u0646\u0646\u064a \u0627\u0644\u0622\u0646.","\ub0b4\uac00 \ubb54\uac00 \uc798\ubabb\ud588\ub098\ubd10, \uc774\uc81c \uadf8\ub4e4\uc774 \ub098\ub97c \ud53c\ud558\uace0 \uc788\uc5b4.","\u6211\u4e00\u5b9a\u505a\u9519\u4e86\u4ec0\u4e48\uff0c\u4ed6\u4eec\u73b0\u5728\u5728\u907f\u5f00\u6211\u3002","\u092e\u0941\u091d\u0947 \u0915\u0941\u091b \u0917\u0932\u0924 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f \u0914\u0930 \u0935\u0947 \u092e\u0941\u091d\u0947 \u0905\u092c \u091f\u093e\u0932 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","Aliquid male feci et nunc me evitant.","Devo aver fatto qualcosa di sbagliato e ora mi stanno evitando.","\u062d\u062a\u0645\u0627\u064b \u06a9\u0627\u0631 \u0627\u0634\u062a\u0628\u0627\u0647\u06cc \u06a9\u0631\u062f\u0647\u200c\u0627\u0645 \u0648 \u0627\u06a9\u0646\u0648\u0646 \u0627\u0632 \u0645\u0646 \u062f\u0648\u0631\u06cc \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f."],t.w)
