B.a8F=new A.d(B.c,["Jumping straight to \u201cthey don\u2019t respect me\u201d or \u201cit must be my fault\u201d skips many possible explanations. Considering ordinary delays first is a more balanced pattern.",'Saltar directamente a "no me respetan" o "es mi culpa" omite muchas posibles explicaciones. Considerar retrasos ordinarios primero es un patr\xf3n m\xe1s equilibrado.',"Direkt zu \u201eSie respektieren mich nicht\u201c oder \u201eEs muss meine Schuld sein\u201c zu springen, \xfcberspringt viele m\xf6gliche Erkl\xe4rungen. Zuerst gew\xf6hnliche Verz\xf6gerungen zu ber\xfccksichtigen, ist ein ausgewogeneres Muster.","Passer directement \xe0 \xab ils ne me respectent pas \xbb ou \xab c'est ma faute \xbb saute de nombreuses explications possibles. Consid\xe9rer d'abord les retards ordinaires est un sch\xe9ma plus \xe9quilibr\xe9.",'\u0627\u0644\u0642\u0641\u0632 \u0645\u0628\u0627\u0634\u0631\u0629 \u0625\u0644\u0649 "\u0647\u0645 \u0644\u0627 \u064a\u062d\u062a\u0631\u0645\u0648\u0646\u064a" \u0623\u0648 "\u0644\u0627\u0628\u062f \u0623\u0646\u0646\u064a \u0623\u062e\u0637\u0623\u062a" \u064a\u062a\u062c\u0627\u0648\u0632 \u0627\u0644\u0639\u062f\u064a\u062f \u0645\u0646 \u0627\u0644\u062a\u0641\u0633\u064a\u0631\u0627\u062a \u0627\u0644\u0645\u0645\u0643\u0646\u0629. \u064a\u0639\u062f \u0627\u0644\u0646\u0638\u0631 \u0641\u064a \u0627\u0644\u062a\u0623\u062e\u064a\u0631\u0627\u062a \u0627\u0644\u0639\u0627\u062f\u064a\u0629 \u0623\u0648\u0644\u0627\u064b \u0646\u0645\u0637\u064b\u0627 \u0623\u0643\u062b\u0631 \u062a\u0648\u0627\u0632\u0646\u064b\u0627.',"\u201c\uadf8\ub4e4\uc740 \ub098\ub97c \uc874\uc911\ud558\uc9c0 \uc54a\ub294\ub2e4\u201d \ub610\ub294 \u201c\ub0b4 \uc798\ubabb\uc774\ub2e4\u201d\ub85c \ubc14\ub85c \ub6f0\uc5b4\ub4dc\ub294 \uac83\uc740 \ub9ce\uc740 \uac00\ub2a5\ud55c \uc124\uba85\ub4e4\uc744 \uac74\ub108\ub6f0\ub294 \uac83\uc785\ub2c8\ub2e4. \uc77c\ubc18\uc801\uc778 \uc9c0\uc5f0\uc744 \uba3c\uc800 \uace0\ub824\ud558\ub294 \uac83\uc774 \ub354 \uade0\ud615 \uc7a1\ud78c \ubc29\uc2dd\uc785\ub2c8\ub2e4.","\u76f4\u63a5\u8df3\u5230\u201c\u4ed6\u4eec\u4e0d\u5c0a\u91cd\u6211\u201d\u6216\u201c\u8fd9\u80af\u5b9a\u662f\u6211\u7684\u9519\u201d\u5ffd\u7565\u4e86\u8bb8\u591a \u53ef\u80fd\u7684\u89e3\u91ca\u3002\u9996\u5148\u8003\u8651\u666e\u901a\u7684\u5ef6\u8fdf\u662f\u4e00\u79cd\u66f4\u5e73\u8861\u7684\u65b9\u5f0f\u3002","\u201c\u0935\u0947 \u092e\u0941\u091d\u0947 \u0938\u092e\u094d\u092e\u093e\u0928 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947\u201d \u092f\u093e \u201c\u092f\u0939 \u092e\u0947\u0930\u0940 \u0917\u0932\u0924\u0940 \u0939\u0948\u201d \u092a\u0930 \u0938\u0940\u0927\u0947 \u0915\u0942\u0926\u0928\u093e \u0915\u0908 \u0938\u0902\u092d\u093e\u0935\u093f\u0924 \u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e\u0913\u0902 \u0915\u094b \u091b\u094b\u0921\u093c \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u092a\u0939\u0932\u0947 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0926\u0947\u0930\u0940 \u092a\u0930 \u0935\u093f\u091a\u093e\u0930 \u0915\u0930\u0928\u093e \u090f\u0915 \u0905\u0927\u093f\u0915 \u0938\u0902\u0924\u0941\u0932\u093f\u0924 \u092a\u0948\u091f\u0930\u094d\u0928 \u0939\u0948\u0964","Statim ad \u201cnon me reverentur\u201d vel \u201cmea culpa est\u201d transire plures omittit explicationes posibles. Retractationes ordinarias primum considerare est modum aequabilem.","Passare direttamente a \u201cnon mi rispettano\u201d o \u201c\xe8 colpa mia\u201d salta molte possibili spiegazioni. Considerare prima i ritardi ordinari \xe8 uno schema pi\xf9 equilibrato.",'\u067e\u0631\u06cc\u062f\u0646 \u0628\u0647 \u0637\u0648\u0631 \u0645\u0633\u062a\u0642\u06cc\u0645 \u0628\u0647 "\u0622\u0646\u0647\u0627 \u0645\u0646 \u0631\u0627 \u0627\u062d\u062a\u0631\u0627\u0645 \u0646\u0645\u06cc\u200c\u06a9\u0646\u0646\u062f" \u06cc\u0627 "\u0627\u06cc\u0646 \u0627\u062d\u062a\u0645\u0627\u0644\u0627\u064b \u062a\u0642\u0635\u06cc\u0631 \u0645\u0646 \u0627\u0633\u062a" \u0628\u0633\u06cc\u0627\u0631\u06cc \u0627\u0632 \u062a\u0648\u0636\u06cc\u062d\u0627\u062a \u0645\u0645\u06a9\u0646 \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f. \u062f\u0631 \u0646\u0638\u0631 \u06af\u0631\u0641\u062a\u0646 \u062a\u0627\u062e\u06cc\u0631\u0647\u0627\u06cc \u0639\u0627\u062f\u06cc \u0627\u0628\u062a\u062f\u0627 \u06cc\u06a9 \u0627\u0644\u06af\u0648\u06cc \u0645\u062a\u0639\u0627\u062f\u0644\u200c\u062a\u0631 \u0627\u0633\u062a.'],t.w)
