B.ac6=new A.d(B.c,["Ninety-five out of one hundred","Noventa y cinco de cien","F\xfcnfundneunzig von hundert","Quatre-vingt-quinze sur cent","\u062e\u0645\u0633\u0629 \u0648\u062a\u0633\u0639\u0648\u0646 \u0645\u0646 \u0645\u0626\u0629","\ubc31\uc810 \uc911\uc5d0 \uad6c\uc2ed\uc624","\u4e00\u767e\u5206\u4e2d\u7684\u4e5d\u5341\u4e94","\u0938\u094c \u092e\u0947\u0902 \u0938\u0947 \u092a\u091a\u093e\u0938\u0940","Novi et quinquaginta ex centum","Novantacinque su cento","\u0646\u0648\u062f \u0648 \u067e\u0646\u062c \u0627\u0632 \u0635\u062f"],t.w)
B.aer=new A.d(B.c,["A quiet study desk, pen marks on paper, the exam lying in front of you: 95/100. People tell you \u201cnice work\u201d, but your eyes keep zooming into the red ink on the missing 5 points, as if the page is only that corner.","Un escritorio de estudio tranquilo, marcas de bol\xedgrafo en el papel, el examen frente a ti: 95/100. La gente te dice \u201cbuen trabajo\u201d, pero tus ojos siguen enfoc\xe1ndose en la tinta roja en los 5 puntos faltantes, como si la p\xe1gina fuera solo esa esquina.","Ein ruhiger Schreibtisch, Stiftmarken auf dem Papier, die Pr\xfcfung liegt vor dir: 95/100. Die Leute sagen \u201eGute Arbeit\u201c, aber deine Augen bleiben immer wieder an der roten Tinte auf den fehlenden 5 Punkten h\xe4ngen, als ob die Seite nur diese Ecke w\xe4re.","Un bureau tranquille, des marques de stylo sur le papier, l'examen devant vous : 95/100. Les gens vous disent \"bon travail\", mais vos yeux continuent de zoomer sur l'encre rouge des 5 points manquants, comme si la page n'\xe9tait que ce coin.",'\u0645\u0643\u062a\u0628 \u062f\u0631\u0627\u0633\u0629 \u0647\u0627\u062f\u0626\u060c \u0639\u0644\u0627\u0645\u0627\u062a \u0627\u0644\u0642\u0644\u0645 \u0639\u0644\u0649 \u0627\u0644\u0648\u0631\u0642\u060c \u0627\u0644\u0627\u0645\u062a\u062d\u0627\u0646 \u0623\u0645\u0627\u0645\u0643: 95/100. \u064a\u0642\u0648\u0644 \u0644\u0643 \u0627\u0644\u0646\u0627\u0633 "\u0639\u0645\u0644 \u062c\u064a\u062f"\u060c \u0644\u0643\u0646 \u0639\u064a\u0646\u064a\u0643 \u062a\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0639\u0644\u0649 \u0627\u0644\u062d\u0628\u0631 \u0627\u0644\u0623\u062d\u0645\u0631 \u0639\u0644\u0649 \u0627\u0644\u0646\u0642\u0627\u0637 \u0627\u0644\u062e\u0645\u0633 \u0627\u0644\u0645\u0641\u0642\u0648\u062f\u0629\u060c \u0643\u0645\u0627 \u0644\u0648 \u0623\u0646 \u0627\u0644\u0635\u0641\u062d\u0629 \u0647\u064a \u0641\u0642\u0637 \u062a\u0644\u0643 \u0627\u0644\u0632\u0627\u0648\u064a\u0629.','\uc870\uc6a9\ud55c \uacf5\ubd80 \ucc45\uc0c1, \uc885\uc774\uc5d0 \ud39c \uc790\uad6d, \uc2dc\ud5d8\uc9c0\uac00 \ub2f9\uc2e0 \uc55e\uc5d0 \ub193\uc5ec \uc788\uc2b5\ub2c8\ub2e4: 95/100. \uc0ac\ub78c\ub4e4\uc774 "\uc798\ud588\uc5b4\uc694"\ub77c\uace0 \ub9d0\ud558\uc9c0\ub9cc, \ub2f9\uc2e0\uc740 \uacc4\uc18d\ud574\uc11c \ube60\uc9c4 5\uc810\uc758 \ube68\uac04 \uc789\ud06c\uc5d0 \uc9d1\uc911\ud558\uac8c \ub429\ub2c8\ub2e4. \ub9c8\uce58 \ud398\uc774\uc9c0\uac00 \uadf8 \ucf54\ub108\ub9cc \uc788\ub294 \uac83\ucc98\ub7fc.',"\u4e00\u4e2a\u5b89\u9759\u7684\u5b66\u4e60\u684c\uff0c\u7eb8\u4e0a\u6709\u7b14\u8bb0\uff0c\u8003\u8bd5\u5728\u4f60\u9762\u524d\uff1a95/100\u3002\u4eba\u4eec\u5bf9\u4f60\u8bf4\u201c\u505a\u5f97\u597d\u201d\uff0c\u4f46\u662f\u4f60\u7684\u773c\u775b\u4e00\u76f4\u96c6\u4e2d\u5728\u4e22\u5931\u76845\u5206\u7684\u7ea2\u8272\u58a8\u6c34\u4e0a\uff0c\u4eff\u4f5b\u9875\u9762\u53ea\u6709\u90a3\u4e2a\u89d2\u843d\u3002","\u090f\u0915 \u0936\u093e\u0902\u0924 \u0905\u0927\u094d\u092f\u092f\u0928 \u0921\u0947\u0938\u094d\u0915, \u0915\u093e\u0917\u091c \u092a\u0930 \u092a\u0947\u0928 \u0915\u0947 \u0928\u093f\u0936\u093e\u0928, \u092a\u0930\u0940\u0915\u094d\u0937\u093e \u0906\u092a\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u0939\u0948: 95/100\u0964 \u0932\u094b\u0917 \u0906\u092a\u0915\u094b \u201c\u0905\u091a\u094d\u091b\u093e \u0915\u093e\u092e\u201d \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a\u0915\u0940 \u0906\u0902\u0916\u0947\u0902 \u0932\u0917\u093e\u0924\u093e\u0930 \u0916\u094b\u090f \u0939\u0941\u090f 5 \u0905\u0902\u0915\u094b\u0902 \u0915\u0947 \u0932\u093e\u0932 \u0938\u094d\u092f\u093e\u0939\u0940 \u092a\u0930 \u092b\u094b\u0915\u0938 \u0915\u0930\u0924\u0940 \u0939\u0948\u0902, \u091c\u0948\u0938\u0947 \u092a\u0943\u0937\u094d\u0920 \u0915\u0947\u0935\u0932 \u0935\u0939\u0940 \u0915\u094b\u0928\u093e \u0939\u094b\u0964","Quietus mensa studii, notae stilo in charta, examen ante te: 95/100. Homines dicunt \u201cbene factum,\u201d sed oculi tui semper in rubro inaequali punctis deperditis intendunt, tamquam pagina esset solum illa angulus.","Una scrivania tranquilla, segni di penna sul foglio, l'esame davanti a te: 95/100. Le persone ti dicono \"buon lavoro\", ma i tuoi occhi continuano a concentrarsi sull'inchiostro rosso dei 5 punti mancanti, come se la pagina fosse solo quell'angolo.",'\u06cc\u06a9 \u0645\u06cc\u0632 \u0645\u0637\u0627\u0644\u0639\u0647 \u0622\u0631\u0627\u0645\u060c \u0639\u0644\u0627\u0645\u062a\u200c\u0647\u0627\u06cc \u062e\u0648\u062f\u06a9\u0627\u0631 \u0631\u0648\u06cc \u06a9\u0627\u063a\u0630\u060c \u0627\u0645\u062a\u062d\u0627\u0646 \u062c\u0644\u0648\u06cc \u0634\u0645\u0627: 95/100. \u0627\u0641\u0631\u0627\u062f \u0628\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u0646\u062f "\u06a9\u0627\u0631 \u062e\u0648\u0628"\u060c \u0627\u0645\u0627 \u0686\u0634\u0645\u0627\u0646 \u0634\u0645\u0627 \u0647\u0645\u0686\u0646\u0627\u0646 \u0628\u0631 \u0631\u0648\u06cc \u062c\u0648\u0647\u0631 \u0642\u0631\u0645\u0632 \u0628\u0631 \u0631\u0648\u06cc 5 \u0627\u0645\u062a\u06cc\u0627\u0632 \u06af\u0645 \u0634\u062f\u0647 \u062a\u0645\u0631\u06a9\u0632 \u0645\u06cc\u200c\u06a9\u0646\u062f\u060c \u06af\u0648\u06cc\u06cc \u0635\u0641\u062d\u0647 \u0641\u0642\u0637 \u0647\u0645\u0627\u0646 \u06af\u0648\u0634\u0647 \u0627\u0633\u062a.'],t.w)
B.a9S=new A.d(B.c,["This proves I am not good enough; real success would be 100 or nothing.","Esto prueba que no soy lo suficientemente bueno; el verdadero \xe9xito ser\xeda 100 o nada.","Das beweist, dass ich nicht gut genug bin; echter Erfolg w\xe4re 100 oder nichts.","Cela prouve que je ne suis pas assez bon ; le vrai succ\xe8s serait 100 ou rien.","\u0647\u0630\u0627 \u064a\u062b\u0628\u062a \u0623\u0646\u0646\u064a \u0644\u0633\u062a \u062c\u064a\u062f\u064b\u0627 \u0628\u0645\u0627 \u0641\u064a\u0647 \u0627\u0644\u0643\u0641\u0627\u064a\u0629\u061b \u0627\u0644\u0646\u062c\u0627\u062d \u0627\u0644\u062d\u0642\u064a\u0642\u064a \u0633\u064a\u0643\u0648\u0646 100 \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621.","\uc774\uac83\uc740 \ub0b4\uac00 \ucda9\ubd84\ud788 \uc88b\uc9c0 \uc54a\ub2e4\ub294 \uac83\uc744 \uc99d\uba85\ud55c\ub2e4; \uc9c4\uc815\ud55c \uc131\uacf5\uc740 100 \uc544\ub2c8\uba74 \uc544\ubb34\uac83\ub3c4 \uc5c6\ub2e4.","\u8fd9\u8bc1\u660e\u6211\u4e0d\u591f\u597d\uff1b\u771f\u6b63\u7684\u6210\u529f\u5e94\u8be5\u662f100\u5206\u6216\u8005\u4ec0\u4e48\u90fd\u6ca1\u6709\u3002","\u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u092a\u0930\u094d\u092f\u093e\u092a\u094d\u0924 \u0905\u091a\u094d\u091b\u093e \u0928\u0939\u0940\u0902 \u0939\u0942\u0902; \u0905\u0938\u0932\u0940 \u0938\u092b\u0932\u0924\u093e 100 \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0939\u094b\u0917\u0940\u0964","Hoc probat me non satis esse bonum; verus successus esset 100 vel nihil.","Questo dimostra che non sono abbastanza bravo; il vero successo sarebbe 100 o nulla.","\u0627\u06cc\u0646 \u062b\u0627\u0628\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0645\u0646 \u06a9\u0627\u0641\u06cc \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a\u0645\u061b \u0645\u0648\u0641\u0642\u06cc\u062a \u0648\u0627\u0642\u0639\u06cc 100 \u06cc\u0627 \u0647\u06cc\u0686 \u0686\u06cc\u0632 \u0646\u06cc\u0633\u062a."],t.w)
