B.aep=new A.d(B.c,["95 is strong work, and I can still learn from the questions I missed.","95 es un trabajo fuerte, y a\xfan puedo aprender de las preguntas que me perd\xed.","95 ist eine starke Leistung, und ich kann immer noch von den Fragen lernen, die ich verpasst habe.","95 est un bon travail, et je peux encore apprendre des questions que j'ai rat\xe9es.","95 \u0647\u0648 \u0639\u0645\u0644 \u0642\u0648\u064a\u060c \u0648\u0645\u0627 \u0632\u0644\u062a \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u062a\u0639\u0644\u0645 \u0645\u0646 \u0627\u0644\u0623\u0633\u0626\u0644\u0629 \u0627\u0644\u062a\u064a \u0641\u0627\u062a\u0646\u064a.","95\ub294 \uac15\ud55c \uc791\uc5c5\uc774\uba70, \ub0b4\uac00 \ub193\uce5c \uc9c8\ubb38\uc5d0\uc11c \uc5ec\uc804\ud788 \ubc30\uc6b8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","95\u5206\u662f\u5f3a\u6709\u529b\u7684\u8868\u73b0\uff0c\u6211\u4ecd\u7136\u53ef\u4ee5\u4ece\u6211\u9519\u8fc7\u7684\u95ee\u9898\u4e2d\u5b66\u4e60\u3002","95 \u090f\u0915 \u092e\u091c\u092c\u0942\u0924 \u0915\u093e\u092e \u0939\u0948, \u0914\u0930 \u092e\u0948\u0902 \u0905\u092d\u0940 \u092d\u0940 \u0909\u0928 \u092a\u094d\u0930\u0936\u094d\u0928\u094b\u0902 \u0938\u0947 \u0938\u0940\u0916 \u0938\u0915\u0924\u093e \u0939\u0942\u0902 \u091c\u093f\u0928\u094d\u0939\u0947\u0902 \u092e\u0948\u0902\u0928\u0947 \u0916\u094b \u0926\u093f\u092f\u093e\u0964","95 est opus firmum, et ego adhuc possum discere a quaestionibus quae amisi.","95 \xe8 un buon lavoro, e posso ancora imparare dalle domande che ho perso.","95 \u06cc\u06a9 \u06a9\u0627\u0631 \u0642\u0648\u06cc \u0627\u0633\u062a \u0648 \u0647\u0646\u0648\u0632 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u0632 \u0633\u0648\u0627\u0644\u0627\u062a\u06cc \u06a9\u0647 \u0627\u0632 \u062f\u0633\u062a \u062f\u0627\u062f\u0647\u200c\u0627\u0645 \u06cc\u0627\u062f \u0628\u06af\u06cc\u0631\u0645."],t.w)
