B.aeD=new A.d(B.c,["The exam was probably broken; no score actually means anything.","El examen probablemente estaba roto; ninguna calificaci\xf3n realmente significa algo.","Die Pr\xfcfung war wahrscheinlich fehlerhaft; keine Note bedeutet tats\xe4chlich etwas.","L'examen \xe9tait probablement cass\xe9 ; aucune note ne signifie r\xe9ellement quoi que ce soit.","\u0631\u0628\u0645\u0627 \u0643\u0627\u0646 \u0627\u0644\u0627\u0645\u062a\u062d\u0627\u0646 \u0645\u0639\u0637\u0644\u0627\u064b\u061b \u0644\u0627 \u062a\u0639\u0646\u064a \u0623\u064a \u062f\u0631\u062c\u0629 \u0634\u064a\u0626\u064b\u0627 \u0628\u0627\u0644\u0641\u0639\u0644.","\uc2dc\ud5d8\uc774 \uc544\ub9c8 \uace0\uc7a5\ub0ac\uc744 \uac83\uc774\ub2e4; \uc810\uc218\ub294 \uc2e4\uc81c\ub85c \uc544\ubb34\uac83\ub3c4 \uc758\ubbf8\ud558\uc9c0 \uc54a\ub294\ub2e4.","\u8003\u8bd5\u53ef\u80fd\u51fa\u73b0\u4e86\u95ee\u9898\uff1b\u6ca1\u6709\u4efb\u4f55\u5206\u6570\u771f\u6b63\u610f\u5473\u7740\u4ec0\u4e48\u3002","\u092a\u0930\u0940\u0915\u094d\u0937\u093e \u0936\u093e\u092f\u0926 \u0916\u0930\u093e\u092c \u0939\u094b \u0917\u0908 \u0925\u0940; \u0915\u094b\u0908 \u092d\u0940 \u0938\u094d\u0915\u094b\u0930 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0939\u0948\u0964","Examen fortasse fractum erat; nulla nota re vera aliquid significat.","Probabilmente l'esame era rotto; nessun punteggio significa davvero nulla.","\u0627\u0645\u062a\u062d\u0627\u0646 \u0627\u062d\u062a\u0645\u0627\u0644\u0627\u064b \u062e\u0631\u0627\u0628 \u0628\u0648\u062f\u061b \u0647\u06cc\u0686 \u0646\u0645\u0631\u0647\u200c\u0627\u06cc \u062f\u0631 \u0648\u0627\u0642\u0639 \u0647\u06cc\u0686 \u0686\u06cc\u0632 \u0645\u0639\u0646\u06cc \u0646\u0645\u06cc\u200c\u062f\u0647\u062f."],t.w)
