B.a9a=new A.d(B.c,["Seeing 95 as \u201cfailure\u201d is all-or-nothing thinking. A more flexible view holds both: this was a strong performance and there is room to grow.",'Ver 95 como "fracaso" es un pensamiento todo o nada. Una visi\xf3n m\xe1s flexible tiene en cuenta ambos: esto fue un rendimiento s\xf3lido y hay espacio para crecer.',"95 als \u201eMisserfolg\u201c zu sehen, ist alles-oder-nichts Denke. Eine flexiblere Sichtweise ber\xfccksichtigt beides: Dies war eine starke Leistung und es gibt Raum f\xfcr Wachstum.",'Voir 95 comme un "\xe9chec" est une pens\xe9e tout ou rien. Une vue plus flexible prend en compte les deux : c\'\xe9tait une forte performance et il y a de la place pour grandir.','\u0631\u0624\u064a\u0629 95 \u0643\u0640 "\u0641\u0634\u0644" \u0647\u0648 \u062a\u0641\u0643\u064a\u0631 \u0625\u0645\u0627 \u0643\u064f\u0644 \u0634\u064a\u0621 \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621. \u0631\u0624\u064a\u0629 \u0623\u0643\u062b\u0631 \u0645\u0631\u0648\u0646\u0629 \u062a\u0623\u062e\u0630 \u0641\u064a \u0627\u0644\u0627\u0639\u062a\u0628\u0627\u0631 \u0643\u0644\u064a\u0647\u0645\u0627: \u0643\u0627\u0646\u062a \u0647\u0630\u0647 \u0646\u062a\u064a\u062c\u0629 \u0642\u0648\u064a\u0629 \u0648\u0647\u0646\u0627\u0643 \u0645\u062c\u0627\u0644 \u0644\u0644\u0646\u0645\u0648.',"95\ub97c \u201c\uc2e4\ud328\u201d\ub85c \ubcf4\ub294 \uac83\uc740 \uc804\ubd80 \uc544\ub2c8\uba74 \uc804\ud600 \uc5c6\ub294 \uc0ac\uace0\ubc29\uc2dd\uc785\ub2c8\ub2e4. \ub354 \uc720\uc5f0\ud55c \uc2dc\uac01\uc740 \ub450 \uac00\uc9c0\ub97c \ubaa8\ub450 \uace0\ub824\ud569\ub2c8\ub2e4: \uc774\uac83\uc740 \uac15\ud55c \uc131\uacfc\uc600\uace0, \uc131\uc7a5\ud560 \uc5ec\uc9c0\uac00 \uc788\uc2b5\ub2c8\ub2e4.","\u628a95\u770b\u4f5c\u201c\u5931\u8d25\u201d\u662f\u4e00\u79cd\u975e\u6b64\u5373\u5f7c\u7684\u601d\u7ef4\u65b9\u5f0f\u3002\u66f4\u7075\u6d3b\u7684\u89c2\u70b9\u5305\u542b\u4e24\u8005\uff1a\u8fd9\u662f\u4e00\u4e2a\u5f3a\u52b2\u7684\u8868\u73b0\uff0c\u5e76\u4e14\u4ecd\u6709\u6210\u957f\u7a7a\u95f4\u3002","95 \u0915\u094b \u201c\u0905\u0938\u092b\u0932\u0924\u093e\u201d \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u0926\u0947\u0916\u0928\u093e \u0938\u092c \u0915\u0941\u091b \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0938\u094b\u091a\u0928\u0947 \u0915\u0940 \u0936\u0948\u0932\u0940 \u0939\u0948\u0964 \u090f\u0915 \u0914\u0930 \u0932\u091a\u0940\u0932\u093e \u0926\u0943\u0937\u094d\u091f\u093f\u0915\u094b\u0923 \u0926\u094b\u0928\u094b\u0902 \u0915\u094b \u092e\u093e\u0928\u0924\u093e \u0939\u0948: \u092f\u0939 \u090f\u0915 \u092e\u091c\u092c\u0942\u0924 \u092a\u094d\u0930\u0926\u0930\u094d\u0936\u0928 \u0925\u093e \u0914\u0930 \u0935\u093f\u0915\u093e\u0938 \u0915\u0947 \u0932\u093f\u090f \u0938\u094d\u0925\u093e\u0928 \u0939\u0948\u0964","Videre 95 ut \u201cdefectum\u201d est cogitatio omne aut nihil. Flexibilior visio utrumque continet: haec erat robusta operatio et est locus ad crescendum.","Vedere 95 come \u201cfallimento\u201d \xe8 un pensiero tutto o nulla. Una visione pi\xf9 flessibile tiene conto di entrambi: questa \xe8 stata una prestazione forte e c'\xe8 spazio per crescere.",'\u062f\u06cc\u062f\u0646 95 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 "\u0634\u06a9\u0633\u062a" \u0646\u0648\u0639\u06cc \u062a\u0641\u06a9\u0631 \u0647\u0645\u0647 \u06cc\u0627 \u0647\u06cc\u0686 \u0627\u0633\u062a. \u06cc\u06a9 \u062f\u06cc\u062f\u06af\u0627\u0647 \u0627\u0646\u0639\u0637\u0627\u0641\u200c\u067e\u0630\u06cc\u0631\u062a\u0631 \u0647\u0631 \u062f\u0648 \u0631\u0627 \u062f\u0631 \u0646\u0638\u0631 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f: \u0627\u06cc\u0646 \u06cc\u06a9 \u0639\u0645\u0644\u06a9\u0631\u062f \u0642\u0648\u06cc \u0628\u0648\u062f \u0648 \u0641\u0636\u0627\u06cc \u0631\u0634\u062f \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f.'],t.w)
B.a9X=new A.d(B.c,["All-or-nothing thinking","Pensamiento de todo o nada","Alles-oder-nichts-Denken","Pens\xe9e du tout ou rien","\u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0625\u0645\u0627 \u0643\u0644 \u0634\u064a\u0621 \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621","\ubaa8\ub450 \uc544\ub2c8\uba74 \uc544\ubb34\uac83\ub3c4 \uc0ac\uace0","\u5168\u6709\u6216\u5168\u65e0\u601d\u7ef4","\u0938\u092c \u0915\u0941\u091b \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0915\u093e \u0935\u093f\u091a\u093e\u0930","Omnia aut nihil cogitatio","Pensiero tutto o niente","\u062a\u0641\u06a9\u0631 \u0647\u0645\u0647 \u06cc\u0627 \u0647\u06cc\u0686"],t.w)
