B.aeC=new A.d(B.c,["The quiet group chat","El chat grupal silencioso","Der stille Gruppenchat","Le chat de groupe silencieux","\u062f\u0631\u062f\u0634\u0629 \u0627\u0644\u0645\u062c\u0645\u0648\u0639\u0629 \u0627\u0644\u0647\u0627\u062f\u0626\u0629","\uc870\uc6a9\ud55c \uadf8\ub8f9 \ucc44\ud305","\u5b89\u9759\u7684\u7fa4\u804a","\u091a\u0941\u092a \u091a\u0948\u091f \u0938\u092e\u0942\u0939","Serpens tacitus","La chat di gruppo silenziosa","\u0686\u062a \u06af\u0631\u0648\u0647\u06cc \u0628\u06cc\u200c\u0635\u062f\u0627"],t.w)
B.a9d=new A.d(B.c,["It is late. The room is dark except for your phone screen. You send a thoughtful message to a group chat and watch the little \u201ctyping\u2026\u201d bubbles pop up and vanish, but no one replies to what you said.",'Es tarde. La habitaci\xf3n est\xe1 oscura excepto por la pantalla de tu tel\xe9fono. Env\xedas un mensaje reflexivo a un chat grupal y ves las peque\xf1as burbujas de "escribiendo..." aparecer y desaparecer, pero nadie responde a lo que dijiste.',"Es ist sp\xe4t. Der Raum ist dunkel, bis auf den Bildschirm deines Handys. Du sendest eine durchdachte Nachricht in einen Gruppenchat und siehst die kleinen \u201etippen\u2026\u201c-Blasen auftauchen und verschwinden, aber niemand antwortet auf das, was du gesagt hast.","Il est tard. La pi\xe8ce est sombre, \xe0 l'exception de l'\xe9cran de votre t\xe9l\xe9phone. Vous envoyez un message r\xe9fl\xe9chi dans un chat de groupe et regardez les petites bulles de \xab saisie\u2026 \xbb appara\xeetre et dispara\xeetre, mais personne ne r\xe9pond \xe0 ce que vous avez dit.",'\u0644\u0642\u062f \u062a\u0623\u062e\u0631 \u0627\u0644\u0648\u0642\u062a. \u0627\u0644\u063a\u0631\u0641\u0629 \u0645\u0638\u0644\u0645\u0629 \u0628\u0627\u0633\u062a\u062b\u0646\u0627\u0621 \u0634\u0627\u0634\u0629 \u0647\u0627\u062a\u0641\u0643. \u062a\u0631\u0633\u0644 \u0631\u0633\u0627\u0644\u0629 \u0645\u062f\u0631\u0648\u0633\u0629 \u0625\u0644\u0649 \u062f\u0631\u062f\u0634\u0629 \u062c\u0645\u0627\u0639\u064a\u0629 \u0648\u062a\u0634\u0627\u0647\u062f \u0641\u0642\u0627\u0639\u0627\u062a "\u064a\u0643\u062a\u0628..." \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u062a\u0638\u0647\u0631 \u0648\u062a\u062e\u062a\u0641\u064a\u060c \u0644\u0643\u0646 \u0644\u0627 \u0623\u062d\u062f \u064a\u0631\u062f \u0639\u0644\u0649 \u0645\u0627 \u0642\u0644\u062a\u0647.',"\ub2a6\uc5c8\uc5b4\uc694. \ubc29\uc740 \uc5b4\ub450\uc6b4\ub370 \uc804\ud654 \ud654\uba74\ub9cc \ubcf4\uc785\ub2c8\ub2e4. \uadf8\ub8f9 \ucc44\ud305\uc5d0 \uc2e0\uc911\ud55c \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0b4\uace0 \uc791\uc740 \u201c\ud0c0\uc774\ud551 \uc911\u2026\u201d \ubc84\ube14\uc774 \ub728\uace0 \uc0ac\ub77c\uc9c0\ub294 \uac83\uc744 \uc9c0\ucf1c\ubcf4\uc9c0\ub9cc, \uc544\ubb34\ub3c4 \ub0b4\uac00 \ud55c \ub9d0\uc5d0 \ub300\ub2f5\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.","\u5df2\u7ecf\u5f88\u665a\u4e86\u3002\u623f\u95f4\u91cc\u5f88\u9ed1\uff0c\u53ea\u6709\u4f60\u7684\u624b\u673a\u5c4f\u5e55\u3002\u4f60\u5411\u4e00\u4e2a\u7fa4\u804a\u53d1\u9001\u4e86\u4e00\u6761\u6df1\u601d\u719f\u8651\u7684\u4fe1\u606f\uff0c\u770b\u7740\u5c0f\u5c0f\u7684\u201c\u6b63\u5728\u8f93\u5165\u2026\u201d\u6c14\u6ce1\u5f39\u51fa\u7136\u540e\u6d88\u5931\uff0c\u4f46\u662f\u6ca1\u6709\u4eba\u56de\u590d\u4f60\u8bf4\u7684\u8bdd\u3002","\u092f\u0939 \u0926\u0947\u0930 \u0930\u093e\u0924 \u0939\u0948\u0964 \u0915\u092e\u0930\u0947 \u092e\u0947\u0902 \u0905\u0902\u0927\u0947\u0930\u093e \u0939\u0948, \u0915\u0947\u0935\u0932 \u0906\u092a\u0915\u093e \u092b\u094b\u0928 \u0938\u094d\u0915\u094d\u0930\u0940\u0928 \u0930\u094b\u0936\u0928 \u0939\u0948\u0964 \u0906\u092a\u0928\u0947 \u090f\u0915 \u0938\u092e\u0942\u0939 \u091a\u0948\u091f \u092e\u0947\u0902 \u090f\u0915 \u0935\u093f\u091a\u093e\u0930\u0936\u0940\u0932 \u0938\u0902\u0926\u0947\u0936 \u092d\u0947\u091c\u093e \u0914\u0930 \u091b\u094b\u091f\u0947 \u201c\u091f\u093e\u0907\u092a \u0915\u0930 \u0930\u0939\u093e \u0939\u0948...\u201d \u092c\u092c\u0932\u094d\u0938 \u0915\u094b \u0906\u0924\u0947 \u0914\u0930 \u091c\u093e\u0924\u0947 \u0926\u0947\u0916\u093e, \u0932\u0947\u0915\u093f\u0928 \u0915\u094b\u0908 \u092d\u0940 \u0909\u0938 \u092a\u0930 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093e \u0939\u0948 \u091c\u094b \u0906\u092a\u0928\u0947 \u0915\u0939\u093e \u0925\u093e\u0964","Serpens est sero. Camera obscura est praeterquam tela tui telephoni. Mittebas cogitata nuntium in chat coetus et spectas minutas \u201escribendo\u2026\u201c bullas eruptas et evanescens, sed nemo respondit ad quod dixisti.",'\xc8 tardi. La stanza \xe8 buia, tranne lo schermo del tuo telefono. Mandi un messaggio pensieroso in una chat di gruppo e guardi le piccole bolle di "scrivendo..." apparire e scomparire, ma nessuno risponde a quello che hai detto.','\u062f\u06cc\u0631 \u0648\u0642\u062a \u0627\u0633\u062a. \u0627\u062a\u0627\u0642 \u062a\u0627\u0631\u06cc\u06a9 \u0627\u0633\u062a \u0645\u06af\u0631 \u0635\u0641\u062d\u0647 \u0646\u0645\u0627\u06cc\u0634 \u06af\u0648\u0634\u06cc \u0634\u0645\u0627. \u06cc\u06a9 \u067e\u06cc\u0627\u0645 \u0641\u06a9\u0631 \u0634\u062f\u0647 \u0628\u0647 \u06cc\u06a9 \u0686\u062a \u06af\u0631\u0648\u0647\u06cc \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u0648 \u0645\u06cc\u200c\u0628\u06cc\u0646\u06cc\u062f \u06a9\u0647 \u062d\u0628\u0627\u0628\u200c\u0647\u0627\u06cc \u06a9\u0648\u0686\u06a9 "\u062f\u0631 \u062d\u0627\u0644 \u062a\u0627\u06cc\u067e..." \u0638\u0627\u0647\u0631 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u0646\u0627\u067e\u062f\u06cc\u062f \u0645\u06cc\u200c\u0634\u0648\u062f\u060c \u0627\u0645\u0627 \u0647\u06cc\u0686\u200c\u06a9\u0633 \u0628\u0647 \u0622\u0646\u0686\u0647 \u0634\u0645\u0627 \u06af\u0641\u062a\u0647\u200c\u0627\u06cc\u062f \u067e\u0627\u0633\u062e \u0646\u0645\u06cc\u200c\u062f\u0647\u062f.'],t.w)
B.aaC=new A.d(B.c,["Everyone secretly dislikes me; they are ignoring me on purpose.","Todos me desprecian en secreto; me est\xe1n ignorando a prop\xf3sito.","Alle m\xf6gen mich heimlich nicht; sie ignorieren mich absichtlich.","Tout le monde me d\xe9teste secr\xe8tement; ils m'ignorent expr\xe8s.","\u0627\u0644\u062c\u0645\u064a\u0639 \u064a\u0643\u0631\u0647\u0646\u064a \u0633\u0631\u0627\u061b \u0625\u0646\u0647\u0645 \u064a\u062a\u062c\u0627\u0647\u0644\u0648\u0646\u0646\u064a \u0639\u0646 \u0639\u0645\u062f.","\ubaa8\ub450\uac00 \ube44\ubc00\ub9ac\uc5d0 \ub098\ub97c \uc2eb\uc5b4\ud55c\ub2e4; \uc77c\ubd80\ub7ec \ub098\ub97c \ubb34\uc2dc\ud558\uace0 \uc788\ub2e4.","\u6bcf\u4e2a\u4eba\u90fd\u79d8\u5bc6\u5730\u4e0d\u559c\u6b22\u6211\uff1b\u4ed6\u4eec\u6545\u610f\u5ffd\u89c6\u6211\u3002","\u0938\u092d\u0940 \u0932\u094b\u0917 \u0917\u0941\u092a\u094d\u0924 \u0930\u0942\u092a \u0938\u0947 \u092e\u0941\u091d\u0938\u0947 \u0928\u092b\u0930\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902; \u0935\u0947 \u091c\u093e\u0928\u092c\u0942\u091d\u0915\u0930 \u092e\u0941\u091d\u0947 \u0905\u0928\u0926\u0947\u0916\u093e \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","Omnes secreto me oderunt; me inscius negligent.","Tutti mi disprezzano segretamente; mi ignorano di proposito.","\u0647\u0645\u0647 \u0628\u0647 \u0637\u0648\u0631 \u0645\u062e\u0641\u06cc\u0627\u0646\u0647 \u0645\u0631\u0627 \u062f\u0648\u0633\u062a \u0646\u062f\u0627\u0631\u0646\u062f\u061b \u0622\u0646\u0647\u0627 \u0639\u0645\u062f\u06cc \u0645\u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0645\u06cc\u200c\u06af\u06cc\u0631\u0646\u062f."],t.w)
