B.aaG=new A.d(B.c,["People might be busy or distracted. Messages in group chats often slip by.","Las personas pueden estar ocupadas o distra\xeddas. Los mensajes en los chats grupales a menudo se pierden.","Menschen k\xf6nnten besch\xe4ftigt oder abgelenkt sein. Nachrichten in Gruppenchats gehen oft unter.","Les gens peuvent \xeatre occup\xe9s ou distraits. Les messages dans les chats de groupe passent souvent inaper\xe7us.","\u0642\u062f \u064a\u0643\u0648\u0646 \u0627\u0644\u0646\u0627\u0633 \u0645\u0634\u063a\u0648\u0644\u064a\u0646 \u0623\u0648 \u0645\u0634\u062a\u062a\u064a\u0646. \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u062a\u0636\u064a\u0639 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0641\u064a \u0627\u0644\u062f\u0631\u062f\u0634\u0627\u062a \u0627\u0644\u062c\u0645\u0627\u0639\u064a\u0629.","\uc0ac\ub78c\ub4e4\uc740 \ubc14\uc058\uac70\ub098 \uc0b0\ub9cc\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub8f9 \ucc44\ud305\uc5d0\uc11c \uba54\uc2dc\uc9c0\ub294 \uc885\uc885 \ube60\uc9c0\uace4 \ud569\ub2c8\ub2e4.","\u4eba\u4eec\u53ef\u80fd\u5f88\u5fd9\u6216\u5206\u5fc3\u3002\u7fa4\u804a\u4e2d\u7684\u6d88\u606f\u7ecf\u5e38\u88ab\u5ffd\u89c6\u3002","\u0932\u094b\u0917 \u0935\u094d\u092f\u0938\u094d\u0924 \u092f\u093e \u0935\u093f\u091a\u0932\u093f\u0924 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964 \u0938\u092e\u0942\u0939 \u091a\u0948\u091f \u092e\u0947\u0902 \u0938\u0902\u0926\u0947\u0936 \u0905\u0915\u094d\u0938\u0930 \u0905\u0928\u0926\u0947\u0916\u0947 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964","Homines occupati esse possunt aut distracti. Nuntii in chat coetibus saepe elabuntur.","Le persone potrebbero essere occupate o distratte. I messaggi nelle chat di gruppo spesso passano inosservati.","\u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0645\u0631\u062f\u0645 \u0645\u0634\u063a\u0648\u0644 \u06cc\u0627 \u062d\u0648\u0627\u0633\u200c\u067e\u0631\u062a \u0628\u0627\u0634\u0646\u062f. \u067e\u06cc\u0627\u0645\u200c\u0647\u0627 \u062f\u0631 \u0686\u062a\u200c\u0647\u0627\u06cc \u06af\u0631\u0648\u0647\u06cc \u0627\u063a\u0644\u0628 \u0646\u0627\u062f\u06cc\u062f\u0647 \u06af\u0631\u0641\u062a\u0647 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f."],t.w)
