B.a9l=new A.d(B.c,["I should leave the group immediately; silence means I do not belong.","Deber\xeda salir del grupo inmediatamente; el silencio significa que no pertenezco.","Ich sollte die Gruppe sofort verlassen; Stille bedeutet, dass ich nicht dazugeh\xf6re.","Je devrais quitter le groupe imm\xe9diatement; le silence signifie que je n'appartiens pas.","\u064a\u062c\u0628 \u0639\u0644\u064a \u0645\u063a\u0627\u062f\u0631\u0629 \u0627\u0644\u0645\u062c\u0645\u0648\u0639\u0629 \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0631\u061b \u0627\u0644\u0635\u0645\u062a \u064a\u0639\u0646\u064a \u0623\u0646\u0646\u064a \u0644\u0627 \u0623\u0646\u062a\u0645\u064a.","\uc989\uc2dc \uadf8\ub8f9\uc744 \ub5a0\ub098\uc57c \ud55c\ub2e4; \uce68\ubb35\uc740 \ub0b4\uac00 \uc18d\ud558\uc9c0 \uc54a\ub294\ub2e4\ub294 \uac83\uc744 \uc758\ubbf8\ud55c\ub2e4.","\u6211\u5e94\u8be5\u7acb\u5373\u79bb\u5f00\u7fa4\u804a\uff1b\u6c89\u9ed8\u610f\u5473\u7740\u6211\u4e0d\u5c5e\u4e8e\u8fd9\u91cc\u3002","\u092e\u0941\u091d\u0947 \u0924\u0941\u0930\u0902\u0924 \u0938\u092e\u0942\u0939 \u091b\u094b\u0921\u093c \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f; \u091a\u0941\u092a\u094d\u092a\u0940 \u0915\u093e \u092e\u0924\u0932\u092c \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u092f\u0939\u093e\u0902 \u0928\u0939\u0940\u0902 \u0939\u0942\u0902\u0964","Ego debe statim discedere ex coetu; silentium significat me non pertinere.","Dovrei lasciare il gruppo immediatamente; il silenzio significa che non appartengo.","\u0628\u0627\u06cc\u062f \u0641\u0648\u0631\u0627\u064b \u06af\u0631\u0648\u0647 \u0631\u0627 \u062a\u0631\u06a9 \u06a9\u0646\u0645\u061b \u0633\u06a9\u0648\u062a \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0639\u0646\u0627\u0633\u062a \u06a9\u0647 \u0645\u0646 \u062c\u0627\u06cc\u06cc \u0646\u062f\u0627\u0631\u0645."],t.w)
