B.ac3=new A.d(B.c,["Assuming silence equals rejection is personalization. Group chats are noisy, and many messages get lost. A neutral explanation is more realistic.","Suponer que el silencio equivale al rechazo es personalizaci\xf3n. Los chats grupales son ruidosos, y muchos mensajes se pierden. Una explicaci\xf3n neutral es m\xe1s realista.","Zu vermuten, dass Stille Ablehnung bedeutet, ist Personalisierung. Gruppenchats sind laut, und viele Nachrichten gehen verloren. Eine neutrale Erkl\xe4rung ist realistischer.","Supposer que le silence \xe9quivaut \xe0 un rejet est une personnalisation. Les chats de groupe sont bruyants, et beaucoup de messages sont perdus. Une explication neutre est plus r\xe9aliste.","\u0627\u0641\u062a\u0631\u0627\u0636 \u0623\u0646 \u0627\u0644\u0635\u0645\u062a \u064a\u0639\u0646\u064a \u0627\u0644\u0631\u0641\u0636 \u0647\u0648 \u0627\u0644\u062a\u062e\u0635\u064a\u0635. \u0627\u0644\u062f\u0631\u062f\u0634\u0627\u062a \u0627\u0644\u062c\u0645\u0627\u0639\u064a\u0629 \u0635\u0627\u062e\u0628\u0629\u060c \u0648\u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u062a\u0636\u064a\u0639. \u062a\u0641\u0633\u064a\u0631 \u0645\u062d\u0627\u064a\u062f \u0647\u0648 \u0627\u0644\u0623\u0643\u062b\u0631 \u0648\u0627\u0642\u0639\u064a\u0629.","\uce68\ubb35\uc744 \uac70\uc808\ub85c \uac00\uc815\ud558\ub294 \uac83\uc740 \uac1c\uc778\ud654\uc785\ub2c8\ub2e4. \uadf8\ub8f9 \ucc44\ud305\uc740 \uc2dc\ub044\ub7fd\uace0 \ub9ce\uc740 \uba54\uc2dc\uc9c0\uac00 \uc0ac\ub77c\uc9d1\ub2c8\ub2e4. \uc911\ub9bd\uc801\uc778 \uc124\uba85\uc774 \ub354 \ud604\uc2e4\uc801\uc785\ub2c8\ub2e4.","\u5047\u8bbe\u6c89\u9ed8\u7b49\u4e8e\u62d2\u7edd\u662f\u4e2a\u6027\u5316\u3002\u7fa4\u804a\u5f88\u5608\u6742\uff0c\u8bb8\u591a\u6d88\u606f\u4f1a\u4e22\u5931\u3002\u4e2d\u7acb\u7684\u89e3\u91ca\u66f4\u4e3a\u73b0\u5b9e\u3002","\u091a\u0941\u092a\u094d\u092a\u0940 \u0915\u094b \u0905\u0938\u094d\u0935\u0940\u0915\u0943\u0924\u093f \u092e\u093e\u0928\u0928\u093e \u200b\u200b\u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0917\u0924\u0915\u0930\u0923 \u0939\u0948\u0964 \u0938\u092e\u0942\u0939 \u091a\u0948\u091f \u0936\u094b\u0930\u0917\u0941\u0932 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0914\u0930 \u0915\u0908 \u0938\u0902\u0926\u0947\u0936 \u0916\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u090f\u0915 \u0924\u091f\u0938\u094d\u0925 \u0938\u094d\u092a\u0937\u094d\u091f\u0940\u0915\u0930\u0923 \u0905\u0927\u093f\u0915 \u092f\u0925\u093e\u0930\u094d\u0925\u0935\u093e\u0926\u0940 \u0939\u0948\u0964","Assumere silentium aequale rejectioni est personalizatio. Chat coetibus sunt clamorosi, et multi nuntii amittuntur. Explicatio neutra est magis realistica.","Supporre che il silenzio equivalga al rifiuto \xe8 personalizzazione. Le chat di gruppo sono rumorose, e molti messaggi vengono persi. Una spiegazione neutra \xe8 pi\xf9 realistica.","\u0641\u0631\u0636 \u06a9\u0631\u062f\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0633\u06a9\u0648\u062a \u0628\u0647 \u0645\u0639\u0646\u0627\u06cc \u0631\u062f \u0627\u0633\u062a\u060c \u0634\u062e\u0635\u06cc\u200c\u0633\u0627\u0632\u06cc \u0627\u0633\u062a. \u0686\u062a\u200c\u0647\u0627\u06cc \u06af\u0631\u0648\u0647\u06cc \u067e\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627 \u0647\u0633\u062a\u0646\u062f\u060c \u0648 \u0628\u0633\u06cc\u0627\u0631\u06cc \u0627\u0632 \u067e\u06cc\u0627\u0645\u200c\u0647\u0627 \u06af\u0645 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f. \u06cc\u06a9 \u062a\u0648\u0636\u06cc\u062d \u0628\u06cc\u200c\u0637\u0631\u0641\u0627\u0646\u0647 \u0648\u0627\u0642\u0639\u06cc\u200c\u062a\u0631 \u0627\u0633\u062a."],t.w)
