B.acZ=new A.d(B.c,["The interview replay","La repetici\xf3n de la entrevista","Das Interview-Wiederholen","La reprise de l'entretien","\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0645\u0642\u0627\u0628\u0644\u0629","\uba74\uc811 \uc7ac\uc0dd","\u9762\u8bd5\u91cd\u64ad","\u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d\u0915\u093e\u0930 \u0915\u093e \u092a\u0941\u0928\u0903\u092a\u094d\u0930\u0938\u093e\u0930\u0923","Interview repetitio","La ripetizione dell'intervista","\u0628\u0627\u0632\u067e\u062e\u0634 \u0645\u0635\u0627\u062d\u0628\u0647"],t.w)
B.aca=new A.d(B.c,["You are home after a job interview, sitting at your desk. The room is calm, but your mind is stuck on one sentence you stumbled over. The rest of the conversation blurs out; only that line remains sharp.","Est\xe1s en casa despu\xe9s de una entrevista de trabajo, sentado en tu escritorio. La habitaci\xf3n est\xe1 tranquila, pero tu mente est\xe1 atrapada en una frase en la que te trabaste. El resto de la conversaci\xf3n se difumina; solo esa l\xednea permanece n\xedtida.","Du bist nach einem Vorstellungsgespr\xe4ch zu Hause und sitzt an deinem Schreibtisch. Der Raum ist ruhig, aber dein Kopf h\xe4ngt an einem Satz, bei dem du ins Stolpern geraten bist. Der Rest des Gespr\xe4chs verschwimmt, nur dieser Satz bleibt scharf.","Tu es chez toi apr\xe8s un entretien d'embauche, assis \xe0 ton bureau. La pi\xe8ce est calme, mais ton esprit est bloqu\xe9 sur une phrase o\xf9 tu as bafouill\xe9. Le reste de la conversation devient flou ; seule cette ligne reste nette.","\u0623\u0646\u062a \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644 \u0628\u0639\u062f \u0645\u0642\u0627\u0628\u0644\u0629 \u0639\u0645\u0644\u060c \u062c\u0627\u0644\u0633 \u0639\u0644\u0649 \u0645\u0643\u062a\u0628\u0643. \u0627\u0644\u063a\u0631\u0641\u0629 \u0647\u0627\u062f\u0626\u0629\u060c \u0648\u0644\u0643\u0646 \u0639\u0642\u0644\u0643 \u0639\u0627\u0644\u0650\u0642 \u0641\u064a \u062c\u0645\u0644\u0629 \u062a\u0639\u062b\u0631\u062a \u0641\u064a\u0647\u0627. \u0628\u0627\u0642\u064a \u0627\u0644\u062d\u062f\u064a\u062b \u064a\u0635\u0628\u062d \u0636\u0628\u0627\u0628\u064a\u064b\u0627\u061b \u0641\u0642\u0637 \u062a\u0644\u0643 \u0627\u0644\u062c\u0645\u0644\u0629 \u062a\u0638\u0644 \u062d\u0627\u062f\u0629.","\ub2f9\uc2e0\uc740 \ucde8\uc5c5 \uba74\uc811 \ud6c4 \uc9d1\uc5d0 \uc788\uc73c\uba70 \ucc45\uc0c1\uc5d0 \uc549\uc544 \uc788\uc2b5\ub2c8\ub2e4. \ubc29\uc740 \uc870\uc6a9\ud558\uc9c0\ub9cc, \ub2f9\uc2e0\uc758 \ub9c8\uc74c\uc740 \ub2f9\uc2e0\uc774 \ub9d0\uc2e4\uc218\ub97c \ud55c \ud55c \ubb38\uc7a5\uc5d0 \uac07\ud600 \uc788\uc2b5\ub2c8\ub2e4. \ub098\uba38\uc9c0 \ub300\ud654\ub294 \ud750\ub9bf\ud574\uc9c0\uace0, \uadf8 \ubb38\uc7a5\ub9cc \ub610\ub837\ud558\uac8c \ub0a8\uc2b5\ub2c8\ub2e4.","\u4f60\u5728\u5de5\u4f5c\u9762\u8bd5\u540e\u56de\u5230\u5bb6\uff0c\u5750\u5728\u684c\u524d\u3002\u623f\u95f4\u5f88\u5b89\u9759\uff0c\u4f46\u4f60\u7684\u8111\u6d77 \u91cc\u5361\u5728\u4e00\u4e2a\u4f60\u78d5\u78d5\u7eca\u7eca\u7684\u53e5\u5b50\u4e0a\u3002\u5176\u4f59\u7684\u5bf9\u8bdd\u53d8\u5f97\u6a21\u7cca\uff0c\u53ea\u6709\u90a3\u53e5\u8bdd\u4ecd\u7136\u6e05\u6670\u3002","\u0906\u092a \u090f\u0915 \u0928\u094c\u0915\u0930\u0940 \u0915\u0947 \u0907\u0902\u091f\u0930\u0935\u094d\u092f\u0942 \u0915\u0947 \u092c\u093e\u0926 \u0918\u0930 \u092a\u0930 \u0939\u0948\u0902, \u0905\u092a\u0928\u0947 \u0921\u0947\u0938\u094d\u0915 \u092a\u0930 \u092c\u0948\u0920\u0947 \u0939\u0948\u0902\u0964 \u0915\u092e\u0930\u093e \u0936\u093e\u0902\u0924 \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a\u0915\u093e \u092e\u0928 \u090f\u0915 \u0935\u093e\u0915\u094d\u092f \u092a\u0930 \u0905\u091f\u0915\u093e \u0939\u0941\u0906 \u0939\u0948 \u091c\u093f\u0938 \u092a\u0930 \u0906\u092a\u0928\u0947 \u0905\u091f\u0915 \u0915\u093f\u092f\u093e \u0925\u093e\u0964 \u092c\u093e\u0915\u0940 \u092c\u093e\u0924\u091a\u0940\u0924 \u0927\u0941\u0902\u0927\u0932\u0940 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948; \u0915\u0947\u0935\u0932 \u0935\u0939\u0940 \u0932\u093e\u0907\u0928 \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0939\u0924\u0940 \u0939\u0948\u0964","Domum rediens post colloquium laboris, ad mensam sedens. Cubiculum quietum est, sed mens tua in uno verbo in quo offendisti haeret. Ceteri sermones fuscantur; solum haec linea acuta manet.","Sei a casa dopo un colloquio di lavoro, seduto alla tua scrivania. La stanza \xe8 calma, ma la tua mente \xe8 bloccata su una frase che hai inciampato. Il resto della conversazione sfuma, solo quella frase rimane nitida.","\u0634\u0645\u0627 \u067e\u0633 \u0627\u0632 \u06cc\u06a9 \u0645\u0635\u0627\u062d\u0628\u0647 \u0634\u063a\u0644\u06cc \u062f\u0631 \u062e\u0627\u0646\u0647 \u0647\u0633\u062a\u06cc\u062f\u060c \u062f\u0631 \u0645\u06cc\u0632 \u062e\u0648\u062f \u0646\u0634\u0633\u062a\u0647\u200c\u0627\u06cc\u062f. \u0627\u062a\u0627\u0642 \u0622\u0631\u0627\u0645 \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u0630\u0647\u0646 \u0634\u0645\u0627 \u062f\u0631 \u06cc\u06a9 \u062c\u0645\u0644\u0647 \u06a9\u0647 \u062f\u0631 \u0622\u0646 \u06af\u06cc\u0631 \u06a9\u0631\u062f\u0647\u200c\u0627\u06cc\u062f\u060c \u0645\u062a\u0648\u0642\u0641 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0628\u0627\u0642\u06cc \u0645\u06a9\u0627\u0644\u0645\u0647 \u0645\u0628\u0647\u0645 \u0645\u06cc\u200c\u0634\u0648\u062f\u061b \u0641\u0642\u0637 \u0622\u0646 \u062c\u0645\u0644\u0647 \u0648\u0627\u0636\u062d \u0628\u0627\u0642\u06cc \u0645\u06cc\u200c\u0645\u0627\u0646\u062f."],t.w)
B.afg=new A.d(B.c,["That one sentence ruined my chances completely.","Esa frase arruin\xf3 por completo mis posibilidades.","Dieser eine Satz hat meine Chancen v\xf6llig ruiniert.","Cette phrase a compl\xe8tement ruin\xe9 mes chances.","\u062a\u0644\u0643 \u0627\u0644\u062c\u0645\u0644\u0629 \u062f\u0645\u0631\u062a \u0641\u0631\u0635\u064a \u062a\u0645\u0627\u0645\u064b\u0627.","\uadf8 \ubb38\uc7a5 \ud558\ub098\uac00 \ub0b4 \uae30\ud68c\ub97c \uc644\uc804\ud788 \ub9dd\ucce4\ub2e4.","\u90a3\u53e5\u8bdd\u5b8c\u5168\u6bc1\u4e86\u6211\u7684\u673a\u4f1a\u3002","\u0935\u0939 \u090f\u0915 \u0935\u093e\u0915\u094d\u092f \u0928\u0947 \u092e\u0947\u0930\u0940 \u0938\u093e\u0930\u0940 \u0938\u0902\u092d\u093e\u0935\u0928\u093e\u0913\u0902 \u0915\u094b \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0938\u0947 \u0928\u0937\u094d\u091f \u0915\u0930 \u0926\u093f\u092f\u093e\u0964","Una haec sententia cunctas meae occasiones perdidit.","Quella frase ha rovinato completamente le mie possibilit\xe0.","\u0622\u0646 \u062c\u0645\u0644\u0647 \u062a\u0645\u0627\u0645 \u0641\u0631\u0635\u062a\u200c\u0647\u0627\u06cc \u0645\u0646 \u0631\u0627 \u06a9\u0627\u0645\u0644\u0627\u064b \u062e\u0631\u0627\u0628 \u06a9\u0631\u062f."],t.w)
