B.a8q=new A.d(B.c,["Interviews are imperfect by nature; one awkward line rarely decides everything.","Las entrevistas son imperfectas por naturaleza; una l\xednea torpe rara vez decide todo.","Interviews sind von Natur aus unvollkommen; ein unbeholfener Satz entscheidet selten alles.","Les entretiens sont imparfaits par nature ; une phrase maladroite ne d\xe9cide presque jamais de tout.","\u0627\u0644\u0645\u0642\u0627\u0628\u0644\u0627\u062a \u063a\u064a\u0631 \u0643\u0627\u0645\u0644\u0629 \u0628\u0637\u0628\u064a\u0639\u062a\u0647\u0627\u061b \u0633\u0637\u0631 \u063a\u064a\u0631 \u0645\u0631\u062a\u0628\u0643 \u0646\u0627\u062f\u0631\u064b\u0627 \u0645\u0627 \u064a\u0642\u0631\u0631 \u0643\u0644 \u0634\u064a\u0621.","\uba74\uc811\uc740 \ubcf8\uc9c8\uc801\uc73c\ub85c \ubd88\uc644\uc804\ud558\ub2e4; \uc5b4\uc0c9\ud55c \ud55c \ubb38\uc7a5\uc774 \ubaa8\ub4e0 \uac83\uc744 \uacb0\uc815\ud558\uc9c0\ub294 \uc54a\ub294\ub2e4.","\u9762\u8bd5\u672c\u8d28\u4e0a\u662f\u4e0d\u5b8c\u7f8e\u7684\uff1b\u4e00\u53e5\u7b28\u62d9\u7684\u8bdd\u5f88\u5c11\u51b3\u5b9a\u4e00\u5207\u3002","\u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d\u0915\u093e\u0930 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0930\u0942\u092a \u0938\u0947 \u0905\u092a\u0942\u0930\u094d\u0923 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902; \u090f\u0915 \u0905\u091c\u0940\u092c \u0935\u093e\u0915\u094d\u092f \u0936\u093e\u092f\u0926 \u0939\u0940 \u0938\u092c \u0915\u0941\u091b \u0924\u092f \u0915\u0930\u0924\u093e \u0939\u0948\u0964","Colloquia natura imperfecta sunt; una inepta sententia rarius omnia decernit.","I colloqui sono imperfetti per natura; una frase imbarazzante raramente decide tutto.","\u0645\u0635\u0627\u062d\u0628\u0647\u200c\u0647\u0627 \u0628\u0647 \u0637\u0648\u0631 \u0637\u0628\u06cc\u0639\u06cc \u0646\u0627\u0642\u0635 \u0647\u0633\u062a\u0646\u062f\u061b \u06cc\u06a9 \u062c\u0645\u0644\u0647 \u0646\u0627\u0622\u0631\u0627\u0645 \u0628\u0647 \u0646\u062f\u0631\u062a \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u062a\u0635\u0645\u06cc\u0645 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f."],t.w)
