B.a9I=new A.d(B.c,["If they hire me, it will be a mistake on their side.","Si me contratan, ser\xe1 un error de su parte.","Wenn sie mich einstellen, wird es ein Fehler auf ihrer Seite sein.","Si ils m'embauchent, ce sera une erreur de leur part.","\u0625\u0630\u0627 \u0648\u0638\u0641\u0648\u0646\u064a\u060c \u0633\u064a\u0643\u0648\u0646 \u0630\u0644\u0643 \u062e\u0637\u0623 \u0645\u0646 \u062c\u0627\u0646\u0628\u0647\u0645.","\uadf8\ub4e4\uc774 \ub098\ub97c \uace0\uc6a9\ud55c\ub2e4\uba74, \uadf8\uac83\uc740 \uadf8\ub4e4\uc758 \uc2e4\uc218\uc77c \uac83\uc774\ub2e4.","\u5982\u679c\u4ed6\u4eec\u96c7\u7528\u6211\uff0c\u90a3\u5c06\u662f\u4ed6\u4eec\u7684\u9519\u8bef\u3002","\u0905\u0917\u0930 \u0935\u0947 \u092e\u0941\u091d\u0947 \u0928\u093f\u092f\u0941\u0915\u094d\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u092f\u0939 \u0909\u0928\u0915\u0940 \u0917\u0932\u0924\u0940 \u0939\u094b\u0917\u0940\u0964","Si me conducunt, erit error eorum.","Se mi assumono, sar\xe0 un errore da parte loro.","\u0627\u06af\u0631 \u0622\u0646\u0647\u0627 \u0645\u0646 \u0631\u0627 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u06a9\u0646\u0646\u062f\u060c \u0627\u06cc\u0646 \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0632 \u0637\u0631\u0641 \u0622\u0646\u0647\u0627 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f."],t.w)
