B.a8S=new A.d(B.c,["Magnifying one imperfect moment and shrinking everything else is a classic distortion. Real decisions consider the whole conversation, not a single glitch.","Ampliar un momento imperfecto y reducir todo lo dem\xe1s es una distorsi\xf3n cl\xe1sica. Las decisiones reales consideran toda la conversaci\xf3n, no un solo error.","Ein unvollkommenes Moment zu vergr\xf6\xdfern und alles andere zu verkleinern, ist eine klassische Verzerrung. Reale Entscheidungen ber\xfccksichtigen das ganze Gespr\xe4ch, nicht nur einen Fehler.","Magnifier un moment imparfait et r\xe9duire tout le reste est une distorsion classique. Les vraies d\xe9cisions prennent en compte toute la conversation, pas un seul faux pas.","\u062a\u0643\u0628\u064a\u0631 \u0644\u062d\u0638\u0629 \u063a\u064a\u0631 \u0643\u0627\u0645\u0644\u0629 \u0648\u062a\u0642\u0644\u064a\u0635 \u0643\u0644 \u0634\u064a\u0621 \u0622\u062e\u0631 \u0647\u0648 \u062a\u0634\u0648\u064a\u0647 \u0643\u0644\u0627\u0633\u064a\u0643\u064a. \u0627\u0644\u0642\u0631\u0627\u0631\u0627\u062a \u0627\u0644\u062d\u0642\u064a\u0642\u064a\u0629 \u062a\u0623\u062e\u0630 \u0641\u064a \u0627\u0644\u0627\u0639\u062a\u0628\u0627\u0631 \u0627\u0644\u0645\u062d\u0627\u062f\u062b\u0629 \u0628\u0623\u0643\u0645\u0644\u0647\u0627\u060c \u0648\u0644\u064a\u0633 \u062e\u0637\u0623 \u0648\u0627\u062d\u062f.","\ud558\ub098\uc758 \ubd88\uc644\uc804\ud55c \uc21c\uac04\uc744 \ud655\ub300\ud558\uace0 \ub098\uba38\uc9c0\ub294 \ucd95\uc18c\ud558\ub294 \uac83\uc740 \uace0\uc804\uc801\uc778 \uc65c\uace1\uc785\ub2c8\ub2e4. \uc9c4\uc815\ud55c \uacb0\uc815\uc740 \ud558\ub098\uc758 \uc2e4\uc218\uac00 \uc544\ub2cc \uc804\uccb4 \ub300\ud654\ub97c \uace0\ub824\ud569\ub2c8\ub2e4.","\u653e\u5927\u4e00\u4e2a\u4e0d\u5b8c\u7f8e\u7684\u77ac\u95f4\u5e76\u7f29\u5c0f\u5176\u4ed6\u6240\u6709\u7684\u90e8\u5206\u662f\u7ecf\u5178\u7684\u626d\u66f2\u3002\u771f\u6b63\u7684\u51b3\u7b56\u8003\u8651\u6574\u4e2a\u5bf9\u8bdd\uff0c\u800c\u4e0d\u4ec5\u4ec5\u662f\u4e00\u4e2a\u5c0f\u9519\u8bef\u3002","\u090f\u0915 \u0905\u092a\u094d\u0930\u0924\u094d\u092f\u093e\u0936\u093f\u0924 \u0915\u094d\u0937\u0923 \u0915\u094b \u092c\u0922\u093c\u093e\u0928\u093e \u0914\u0930 \u092c\u093e\u0915\u0940 \u0938\u092c \u0915\u0941\u091b \u0915\u094b \u0918\u091f\u093e\u0928\u093e \u090f\u0915 \u0915\u094d\u0932\u093e\u0938\u093f\u0915 \u0935\u093f\u0915\u0943\u0924\u093f \u0939\u0948\u0964 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0928\u093f\u0930\u094d\u0923\u092f \u092a\u0942\u0930\u0940 \u092c\u093e\u0924\u091a\u0940\u0924 \u092a\u0930 \u0935\u093f\u091a\u093e\u0930 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0928 \u0915\u093f \u090f\u0915\u0932 \u0917\u0932\u0924\u0940 \u092a\u0930\u0964","Magnificando un momentum imperfectum et omnia alia minuentia est distorsio classica. Veri decisionem omnia sermone considerant, non unam lapsum.","Ingrandire un momento imperfetto e ridurre tutto il resto \xe8 una distorsione classica. Le vere decisioni considerano tutta la conversazione, non un singolo errore.","\u0628\u0632\u0631\u06af\u200c\u0646\u0645\u0627\u06cc\u06cc \u06cc\u06a9 \u0644\u062d\u0638\u0647 \u0646\u0627\u0642\u0635 \u0648 \u06a9\u0648\u0686\u06a9 \u06a9\u0631\u062f\u0646 \u0628\u0642\u06cc\u0647 \u0645\u0648\u0627\u0631\u062f \u06cc\u06a9 \u062a\u062d\u0631\u06cc\u0641 \u06a9\u0644\u0627\u0633\u06cc\u06a9 \u0627\u0633\u062a. \u062a\u0635\u0645\u06cc\u0645\u0627\u062a \u0648\u0627\u0642\u0639\u06cc \u06a9\u0644 \u0645\u06a9\u0627\u0644\u0645\u0647 \u0631\u0627 \u062f\u0631 \u0646\u0638\u0631 \u0645\u06cc\u200c\u06af\u06cc\u0631\u0646\u062f\u060c \u0646\u0647 \u0641\u0642\u0637 \u06cc\u06a9 \u0627\u0634\u062a\u0628\u0627\u0647."],t.w)
