B.a8H=new A.d(B.c,["The late-night scrolling","El desplazamiento nocturno","Das n\xe4chtliche Scrollen","Le d\xe9filement de nuit","\u0627\u0644\u062a\u0645\u0631\u064a\u0631 \u0641\u064a \u0648\u0642\u062a \u0645\u062a\u0623\u062e\u0631 \u0645\u0646 \u0627\u0644\u0644\u064a\u0644","\ub2a6\uc740 \ubc24 \uc2a4\ud06c\ub864\ub9c1","\u6df1\u591c\u6eda\u52a8","\u0930\u093e\u0924 \u092e\u0947\u0902 \u0938\u094d\u0915\u094d\u0930\u0949\u0932 \u0915\u0930\u0928\u093e","Serpens nocte","Lo scorrimento notturno","\u0627\u0633\u06a9\u0631\u0648\u0644 \u0634\u0628\u0627\u0646\u0647"],t.w)
B.abv=new A.d(B.c,["It is 2 a.m. Your blanket, your pillow, your screen. You scroll through perfect holidays, perfect bodies, perfect friendships. A small voice whispers: \u201cEveryone is already ahead. I am late to my own life.\u201d","Son las 2 a.m. Tu manta, tu almohada, tu pantalla. Desplazas a trav\xe9s de vacaciones perfectas, cuerpos perfectos, amistades perfectas. Una peque\xf1a voz susurra: \u201cTodos ya est\xe1n adelante. Yo estoy atrasado en mi propia vida.\u201d","Es ist 2 Uhr morgens. Deine Decke, dein Kissen, dein Bildschirm. Du scrollst durch perfekte Ferien, perfekte K\xf6rper, perfekte Freundschaften. Eine kleine Stimme fl\xfcstert: \u201eAlle sind schon weiter. Ich komme zu sp\xe4t in meinem eigenen Leben.\u201c","Il est 2 heures du matin. Ta couverture, ton oreiller, ton \xe9cran. Tu fais d\xe9filer des vacances parfaites, des corps parfaits, des amiti\xe9s parfaites. Une petite voix murmure : \xab Tout le monde est d\xe9j\xe0 en avance. Je suis en retard dans ma propre vie. \xbb",'\u0627\u0644\u0633\u0627\u0639\u0629 2 \u0635\u0628\u0627\u062d\u064b\u0627. \u0628\u0637\u0627\u0646\u064a\u062a\u0643\u060c \u0648\u0633\u0627\u062f\u062a\u0643\u060c \u0648\u0634\u0627\u0634\u062a\u0643. \u062a\u062a\u0635\u0641\u062d \u0639\u0637\u0644\u0627\u062a \u0645\u062b\u0627\u0644\u064a\u0629\u060c \u0623\u062c\u0633\u0627\u062f \u0645\u062b\u0627\u0644\u064a\u0629\u060c \u0635\u062f\u0627\u0642\u0627\u062a \u0645\u062b\u0627\u0644\u064a\u0629. \u0647\u0645\u0633\u0629 \u0635\u063a\u064a\u0631\u0629 \u062a\u0642\u0648\u0644: "\u0627\u0644\u062c\u0645\u064a\u0639 \u0642\u062f \u062a\u0642\u062f\u0645 \u0628\u0627\u0644\u0641\u0639\u0644. \u0623\u0646\u0627 \u0645\u062a\u0623\u062e\u0631 \u0641\u064a \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u062e\u0627\u0635\u0629."','\uc624\uc804 2\uc2dc. \ub2f4\uc694, \ubca0\uac1c, \ud654\uba74. \uc644\ubcbd\ud55c \ud734\uac00, \uc644\ubcbd\ud55c \ubab8\ub9e4, \uc644\ubcbd\ud55c \uc6b0\uc815\uc744 \uc2a4\ud06c\ub864\ud569\ub2c8\ub2e4. \uc791\uc740 \ubaa9\uc18c\ub9ac\uac00 \uc18d\uc0ad\uc785\ub2c8\ub2e4: "\ubaa8\ub450 \uc774\ubbf8 \uc55e\uc11c\uac00\uace0 \uc788\uc5b4. \ub098\ub294 \ub0b4 \uc0b6\uc5d0 \ub2a6\uc5c8\uc5b4."',"\u51cc\u66682\u70b9\u3002\u4f60\u7684\u6bef\u5b50\uff0c\u4f60\u7684\u6795\u5934\uff0c\u4f60\u7684\u5c4f\u5e55\u3002\u4f60\u5728\u6d4f\u89c8\u5b8c\u7f8e\u7684\u5047\u671f\u3001\u5b8c\u7f8e\u7684\u8eab\u4f53\u3001\u5b8c\u7f8e\u7684\u53cb\u8c0a\u3002\u4e00\u4e2a\u5c0f\u58f0\u97f3\u4f4e\u8bed\uff1a\u201c\u6bcf\u4e2a\u4eba\u5df2\u7ecf\u9886\u5148\u4e86\u3002\u6211\u5bf9\u81ea\u5df1\u7684\u751f\u6d3b\u8fdf\u5230\u4e86\u3002\u201d",'\u092f\u0939 2 \u092c\u091c\u0947 \u0915\u093e \u0938\u092e\u092f \u0939\u0948\u0964 \u0906\u092a\u0915\u0940 \u0915\u0902\u092c\u0932, \u0924\u0915\u093f\u092f\u093e, \u0914\u0930 \u0938\u094d\u0915\u094d\u0930\u0940\u0928\u0964 \u0906\u092a \u0936\u093e\u0928\u0926\u093e\u0930 \u091b\u0941\u091f\u094d\u091f\u093f\u092f\u094b\u0902, \u0936\u093e\u0928\u0926\u093e\u0930 \u0936\u0930\u0940\u0930\u094b\u0902, \u0936\u093e\u0928\u0926\u093e\u0930 \u0926\u094b\u0938\u094d\u0924\u0940 \u0915\u0947 \u092e\u093e\u0927\u094d\u092f\u092e \u0938\u0947 \u0938\u094d\u0915\u094d\u0930\u0949\u0932 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u090f\u0915 \u091b\u094b\u091f\u0940 \u0906\u0935\u093e\u091c\u093c \u092b\u0941\u0938\u092b\u0941\u0938\u093e\u0924\u0940 \u0939\u0948: "\u0938\u092d\u0940 \u092a\u0939\u0932\u0947 \u0939\u0940 \u0906\u0917\u0947 \u092c\u0922\u093c \u091a\u0941\u0915\u0947 \u0939\u0948\u0902\u0964 \u092e\u0948\u0902 \u0905\u092a\u0928\u0940 \u091c\u093f\u0902\u0926\u0917\u0940 \u092e\u0947\u0902 \u0926\u0947\u0930 \u0938\u0947 \u0906 \u0917\u092f\u093e \u0939\u0942\u0902\u0964"','Serpens est 2 am. Lectus tuus, pulvinar tuum, tela tua. Deliciae perfectae, corpora perfecta, amicitiae perfectae scrollem. Vox parva susurrat: "Omnes iam ante sunt. Ego sero ad vitam meam."','Sono le 2 del mattino. La tua coperta, il tuo cuscino, il tuo schermo. Scorri attraverso vacanze perfette, corpi perfetti, amicizie perfette. Una piccola voce sussurra: "Tutti sono gi\xe0 avanti. Sono in ritardo nella mia vita."','\u0633\u0627\u0639\u062a \u06f2 \u0635\u0628\u062d \u0627\u0633\u062a. \u067e\u062a\u0648\u060c \u0628\u0627\u0644\u0634 \u0648 \u0635\u0641\u062d\u0647 \u0646\u0645\u0627\u06cc\u0634 \u0634\u0645\u0627. \u0634\u0645\u0627 \u0627\u0632 \u0645\u06cc\u0627\u0646 \u062a\u0639\u0637\u06cc\u0644\u0627\u062a \u06a9\u0627\u0645\u0644\u060c \u0628\u062f\u0646\u200c\u0647\u0627\u06cc \u06a9\u0627\u0645\u0644\u060c \u062f\u0648\u0633\u062a\u06cc\u200c\u0647\u0627\u06cc \u06a9\u0627\u0645\u0644 \u0645\u06cc\u200c\u0686\u0631\u062e\u06cc\u062f. \u06cc\u06a9 \u0635\u062f\u0627\u06cc \u06a9\u0648\u0686\u06a9 \u0632\u0645\u0632\u0645\u0647 \u0645\u06cc\u200c\u06a9\u0646\u062f: "\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631\u0646\u062f. \u0645\u0646 \u062f\u0631 \u0632\u0646\u062f\u06af\u06cc \u062e\u0648\u062f \u062f\u06cc\u0631 \u06a9\u0631\u062f\u0647\u200c\u0627\u0645."'],t.w)
B.a8T=new A.d(B.c,["They are all ahead of me; I may as well give up.","Todos est\xe1n adelante de m\xed; mejor me rindo.","Alle sind mir voraus; ich kann genauso gut aufgeben.","Ils sont tous en avance sur moi ; je ferais bien de renoncer.","\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631 \u0647\u0633\u062a\u0646\u062f\u061b \u0645\u0646 \u0628\u0627\u06cc\u062f \u062a\u0633\u0644\u06cc\u0645 \u0634\u0648\u0645.","\uadf8\ub4e4\uc740 \ubaa8\ub450 \ub098\ubcf4\ub2e4 \uc55e\uc11c \uc788\ub2e4; \ub098\ub294 \ud3ec\uae30\ud574\uc57c\uaca0\ub2e4.","\u4ed6\u4eec\u90fd\u6bd4\u6211\u9886\u5148\uff1b\u6211\u8fd8\u662f\u653e\u5f03\u5427\u3002","\u0935\u0947 \u0938\u092d\u0940 \u092e\u0941\u091d\u0938\u0947 \u0906\u0917\u0947 \u0939\u0948\u0902; \u092e\u0948\u0902 \u092d\u0940 \u0939\u093e\u0930 \u092e\u093e\u0928 \u0938\u0915\u0924\u093e \u0939\u0942\u0902\u0964","Omnes ante me sunt; ego me frangere possum.","Sono tutti avanti a me; tanto vale che molli.","\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u062c\u0644\u0648\u062a\u0631 \u0647\u0633\u062a\u0646\u062f\u061b \u0645\u0646 \u0647\u0645 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u062a\u0633\u0644\u06cc\u0645 \u0634\u0648\u0645."],t.w)
