B.acC=new A.d(B.c,["Social feeds show highlights, not full lives. I can still start small from where I am.","Los feeds sociales muestran lo m\xe1s destacado, no vidas completas. A\xfan puedo empezar peque\xf1o desde donde estoy.","Soziale Feeds zeigen Highlights, nicht das ganze Leben. Ich kann immer noch klein anfangen, wo ich bin.","Les flux sociaux montrent des points forts, pas des vies enti\xe8res. Je peux encore commencer petit depuis o\xf9 je suis.","\u0627\u0644\u0648\u0633\u0627\u0626\u0637 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u064a\u0629 \u062a\u0639\u0631\u0636 \u0627\u0644\u0646\u0642\u0627\u0637 \u0627\u0644\u0628\u0627\u0631\u0632\u0629\u060c \u0648\u0644\u064a\u0633 \u0627\u0644\u062d\u064a\u0627\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629. \u0644\u0627 \u064a\u0632\u0627\u0644 \u0628\u0625\u0645\u0643\u0627\u0646\u064a \u0627\u0644\u0628\u062f\u0621 \u0645\u0646 \u062d\u064a\u062b \u0623\u0646\u0627.","\uc18c\uc15c \ud53c\ub4dc\ub294 \ud558\uc774\ub77c\uc774\ud2b8\ub9cc \ubcf4\uc5ec\uc8fc\uace0, \uc804\uccb4 \uc0b6\uc740 \ubcf4\uc5ec\uc8fc\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub098\ub294 \uc5ec\uc804\ud788 \ub0b4\uac00 \uc788\ub294 \uacf3\uc5d0\uc11c \uc791\uc740 \uac83\uc744 \uc2dc\uc791\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u793e\u4ea4\u5a92\u4f53\u663e\u793a\u7684\u662f\u4eae\u70b9\uff0c\u800c\u4e0d\u662f\u5b8c\u6574\u7684\u751f\u6d3b\u3002\u6211\u4ecd\u7136\u53ef\u4ee5\u4ece\u6211\u73b0\u5728\u7684\u5730\u65b9\u5f00\u59cb\u3002","\u0938\u094b\u0936\u0932 \u092e\u0940\u0921\u093f\u092f\u093e \u092b\u0940\u0921\u094d\u0938 \u0939\u093e\u0907\u0932\u093e\u0907\u091f\u094d\u0938 \u0926\u093f\u0916\u093e\u0924\u0940 \u0939\u0948\u0902, \u0928 \u0915\u093f \u092a\u0942\u0930\u0940 \u091c\u093c\u093f\u0928\u094d\u0926\u0917\u0940\u0964 \u092e\u0948\u0902 \u0905\u092d\u0940 \u092d\u0940 \u091c\u0939\u093e\u0901 \u0939\u0942\u0902, \u0935\u0939\u0940\u0902 \u0938\u0947 \u091b\u094b\u091f\u0947 \u0915\u0926\u092e \u0938\u0947 \u0936\u0941\u0930\u0942 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0902\u0964","Socialis feeds ostendunt summas, non vita plena. Ego tamen a loco meo incipere possum.","I feed sociali mostrano i punti salienti, non la vita completa. Posso comunque iniziare in piccolo da dove sono.","\u0631\u0633\u0627\u0646\u0647\u200c\u0647\u0627\u06cc \u0627\u062c\u062a\u0645\u0627\u0639\u06cc \u0646\u06a9\u0627\u062a \u0628\u0631\u062c\u0633\u062a\u0647 \u0631\u0627 \u0646\u0634\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u0646\u062f\u060c \u0646\u0647 \u0632\u0646\u062f\u06af\u06cc \u06a9\u0627\u0645\u0644. \u0645\u0646 \u0647\u0646\u0648\u0632 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u0632 \u062c\u0627\u06cc\u06cc \u06a9\u0647 \u0647\u0633\u062a\u0645 \u0634\u0631\u0648\u0639 \u06a9\u0646\u0645."],t.w)
