B.ab9=new A.d(B.c,["Everyone is faking; nothing is real, so nothing matters.","Todos est\xe1n fingiendo; nada es real, as\xed que nada importa.","Alle tun so, als ob; nichts ist real, also spielt nichts eine Rolle.","Tout le monde fait semblant ; rien n'est r\xe9el, donc rien n'a d'importance.","\u0627\u0644\u062c\u0645\u064a\u0639 \u064a\u062a\u0638\u0627\u0647\u0631\u0648\u0646\u061b \u0644\u0627 \u0634\u064a\u0621 \u062d\u0642\u064a\u0642\u064a\u060c \u0644\u0630\u0644\u0643 \u0644\u0627 \u0634\u064a\u0621 \u064a\u0647\u0645.","\ubaa8\ub450\uac00 \uac00\uc9dc\uc774\ub2e4; \uc544\ubb34\uac83\ub3c4 \uc9c4\uc9dc\uac00 \uc544\ub2c8\ubbc0\ub85c \uc544\ubb34\uac83\ub3c4 \uc911\uc694\ud558\uc9c0 \uc54a\ub2e4.","\u6bcf\u4e2a\u4eba\u90fd\u5728\u5047\u88c5\uff1b\u6ca1\u6709\u4ec0\u4e48\u662f\u771f\u5b9e\u7684\uff0c\u6240\u4ee5\u6ca1\u6709\u4ec0\u4e48\u91cd\u8981\u3002","\u0938\u092d\u0940 \u0932\u094b\u0917 \u091d\u0942\u0920 \u092c\u094b\u0932 \u0930\u0939\u0947 \u0939\u0948\u0902; \u0915\u0941\u091b \u092d\u0940 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0907\u0938\u0932\u093f\u090f \u0915\u0941\u091b \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u093e\u0964","Omnes simulant; nihil est verum, ergo nihil interest.","Tutti stanno fingendo; nulla \xe8 reale, quindi nulla ha importanza.","\u0647\u0645\u0647 \u062f\u0631 \u062d\u0627\u0644 \u0641\u0631\u06cc\u0628 \u062f\u0627\u062f\u0646 \u0647\u0633\u062a\u0646\u062f\u061b \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0648\u0627\u0642\u0639\u06cc \u0646\u06cc\u0633\u062a\u060c \u0628\u0646\u0627\u0628\u0631\u0627\u06cc\u0646 \u0647\u06cc\u0686 \u0686\u06cc\u0632 \u0645\u0647\u0645 \u0646\u06cc\u0633\u062a."],t.w)
