B.aa2=new A.d(B.c,["A monitor glows in a dim workspace. You push a tiny code change, then see an error in production. Your shoulders tense. A thought hits: \u201cI break everything I touch. I should not be here.\u201d","Un monitor brilla en un espacio de trabajo tenue. Realizas un peque\xf1o cambio en el c\xf3digo y luego ves un error en producci\xf3n. Tus hombros se tensan. Un pensamiento aparece: \u201cRompo todo lo que toco. No deber\xeda estar aqu\xed.\u201d","Ein Monitor leuchtet in einem schwach beleuchteten Arbeitsbereich. Du nimmst eine kleine Code\xe4nderung vor und siehst dann einen Fehler in der Produktion. Deine Schultern verspannen sich. Ein Gedanke kommt: \u201eIch zerbreche alles, was ich ber\xfchre. Ich sollte nicht hier sein.\u201c","Un \xe9cran brille dans un espace de travail tamis\xe9. Vous effectuez un petit changement de code, puis vous voyez une erreur en production. Vos \xe9paules se tendent. Une pens\xe9e traverse votre esprit : \u201cJe brise tout ce que je touche. Je ne devrais pas \xeatre ici.\u201d",'\u0634\u0627\u0634\u0629 \u0645\u0636\u064a\u0626\u0629 \u0641\u064a \u0645\u0633\u0627\u062d\u0629 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0645\u0638\u0644\u0645\u0629. \u062a\u062c\u0631\u064a \u062a\u063a\u064a\u064a\u0631\u064b\u0627 \u0635\u063a\u064a\u0631\u064b\u0627 \u0641\u064a \u0627\u0644\u0643\u0648\u062f\u060c \u062b\u0645 \u062a\u0631\u0649 \u062e\u0637\u0623 \u0641\u064a \u0627\u0644\u0625\u0646\u062a\u0627\u062c. \u062a\u062a\u0634\u0646\u062c \u0643\u062a\u0641\u064a\u0643. \u064a\u0641\u0643\u0631 \u0639\u0642\u0644\u0643: "\u0623\u0646\u0627 \u0623\u0643\u0633\u0631 \u0643\u0644 \u0634\u064a\u0621 \u0623\u0644\u0645\u0633\u0647. \u0644\u0627 \u064a\u062c\u0628 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0647\u0646\u0627."',"\uc5b4\ub450\uc6b4 \uc791\uc5c5 \uacf5\uac04\uc5d0\uc11c \ubaa8\ub2c8\ud130\uac00 \ube5b\ub0a9\ub2c8\ub2e4. \uc791\uc740 \ucf54\ub4dc \ubcc0\uacbd\uc744 \uc2dc\ub3c4\ud55c \ud6c4, \ud504\ub85c\ub355\uc158\uc5d0\uc11c \uc624\ub958\ub97c \ubd05\ub2c8\ub2e4. \uc5b4\uae68\uac00 \uae34\uc7a5\ub429\ub2c8\ub2e4. \u201c\ub0b4\uac00 \ub9cc\uc9c0\ub294 \ubaa8\ub4e0 \uac83\uc740 \ub9dd\uac00\uc9c4\ub2e4. \ub098\ub294 \uc5ec\uae30\uc5d0 \uc788\uc744 \uc790\uaca9\uc774 \uc5c6\ub2e4.\u201d\ub294 \uc0dd\uac01\uc774 \ub4ed\ub2c8\ub2e4.","\u5728\u660f\u6697\u7684\u5de5\u4f5c\u7a7a\u95f4\u4e2d\uff0c\u663e\u793a\u5668\u53d1\u51fa\u5149\u4eae\u3002\u4f60\u505a\u4e86\u4e00\u4e2a\u5c0f\u7684\u4ee3\u7801\u66f4\u6539\uff0c\u7136\u540e\u5728\u751f\u4ea7\u4e2d\u770b\u5230\u9519\u8bef\u3002\u4f60\u7684\u80a9\u8180\u7d27\u7ef7\u3002\u4e00\u4e2a\u60f3\u6cd5\u51fa\u73b0\uff1a\u201c\u6211\u78b0\u5230\u7684\u6bcf\u6837\u4e1c\u897f\u90fd\u574f\u4e86\u3002\u6211\u4e0d\u5e94\u8be5\u5728\u8fd9\u91cc\u3002\u201d","\u090f\u0915 \u092e\u0902\u0926 workspace \u092e\u0947\u0902 \u090f\u0915 \u092e\u0949\u0928\u093f\u091f\u0930 \u091a\u092e\u0915 \u0930\u0939\u093e \u0939\u0948\u0964 \u0906\u092a \u090f\u0915 \u091b\u094b\u091f\u0947 \u0938\u0947 \u0915\u094b\u0921 \u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928 \u0915\u094b \u0932\u093e\u0917\u0942 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u092b\u093f\u0930 \u0909\u0924\u094d\u092a\u093e\u0926\u0928 \u092e\u0947\u0902 \u090f\u0915 \u0924\u094d\u0930\u0941\u091f\u093f \u0926\u0947\u0916\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u0915\u0902\u0927\u0947 \u0924\u0928\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964 \u090f\u0915 \u0935\u093f\u091a\u093e\u0930 \u0906\u0924\u093e \u0939\u0948: \u201c\u092e\u0948\u0902 \u091c\u094b \u0915\u0941\u091b \u092d\u0940 \u091b\u0942\u0924\u093e \u0939\u0942\u0902 \u0909\u0938\u0947 \u0924\u094b\u0921\u093c \u0926\u0947\u0924\u093e \u0939\u0942\u0902\u0964 \u092e\u0941\u091d\u0947 \u092f\u0939\u093e\u0902 \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964\u201d",'Monitor lucet in tenebris laborandi. Modicum mutationem codicis impellitur, tunc videt error in productione. Humeri tui tensi sunt. Cogitatio venit: "Omnia frangam, quae tangam. Non debeo hic esse."','Un monitor brilla in uno spazio di lavoro poco illuminato. Apporti una piccola modifica al codice e poi vedi un errore in produzione. Le tue spalle si irrigidiscono. Un pensiero ti colpisce: "Rompo tutto ci\xf2 che tocco. Non dovrei essere qui."','\u06cc\u06a9 \u0645\u0627\u0646\u06cc\u062a\u0648\u0631 \u062f\u0631 \u06cc\u06a9 \u0641\u0636\u0627\u06cc \u06a9\u0627\u0631\u06cc \u06a9\u0645 \u0646\u0648\u0631 \u062f\u0631\u062e\u0634\u06cc\u062f\u0647 \u0627\u0633\u062a. \u0634\u0645\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0648\u0686\u06a9\u06cc \u062f\u0631 \u06a9\u062f \u0627\u06cc\u062c\u0627\u062f \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f\u060c \u0633\u067e\u0633 \u062e\u0637\u0627\u06cc \u062a\u0648\u0644\u06cc\u062f \u0631\u0627 \u0645\u0634\u0627\u0647\u062f\u0647 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f. \u0634\u0627\u0646\u0647\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0633\u0641\u062a \u0645\u06cc\u200c\u0634\u0648\u0646\u062f. \u0641\u06a9\u0631\u06cc \u0628\u0647 \u0630\u0647\u0646 \u0645\u06cc\u200c\u0631\u0633\u062f: "\u0645\u0646 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u06a9\u0647 \u0644\u0645\u0633 \u0645\u06cc\u200c\u06a9\u0646\u0645 \u062e\u0631\u0627\u0628 \u0645\u06cc\u200c\u06a9\u0646\u0645. \u0646\u0628\u0627\u06cc\u062f \u0627\u06cc\u0646\u062c\u0627 \u0628\u0627\u0634\u0645."'],t.w)
B.adW=new A.d(B.c,["This proves I am a terrible developer and always will be.","Esto demuestra que soy un desarrollador terrible y siempre lo ser\xe9.","Das beweist, dass ich ein schrecklicher Entwickler bin und es immer sein werde.","Cela prouve que je suis un d\xe9veloppeur terrible et que je le serai toujours.","\u0647\u0630\u0627 \u064a\u062b\u0628\u062a \u0623\u0646\u0646\u064a \u0645\u0637\u0648\u0631 \u0641\u0638\u064a\u0639 \u0648\u0633\u0623\u0643\u0648\u0646 \u0643\u0630\u0644\u0643 \u062f\u0627\u0626\u0645\u064b\u0627.","\uc774\uac83\uc740 \ub0b4\uac00 \ub054\ucc0d\ud55c \uac1c\ubc1c\uc790\uc774\uba70 \ud56d\uc0c1 \uadf8\ub7f4 \uac83\uc784\uc744 \uc99d\uba85\ud569\ub2c8\ub2e4.","\u8fd9\u8bc1\u660e\u6211\u662f\u4e00\u4e2a\u7cdf\u7cd5\u7684\u5f00\u53d1\u4eba\u5458\uff0c\u5e76\u4e14\u6c38\u8fdc\u662f\u3002","\u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u090f\u0915 \u092d\u092f\u093e\u0928\u0915 \u0921\u0947\u0935\u0932\u092a\u0930 \u0939\u0942\u0902 \u0914\u0930 \u0939\u092e\u0947\u0936\u093e \u0910\u0938\u093e \u0939\u0940 \u0930\u0939\u0942\u0902\u0917\u093e\u0964","Hoc probat me esse malum programmatorem et semper futurum esse.","Questo dimostra che sono un cattivo sviluppatore e lo sar\xf2 sempre.","\u0627\u06cc\u0646 \u0646\u0634\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u0645\u0646 \u06cc\u06a9 \u062a\u0648\u0633\u0639\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0647\u0633\u062a\u0645 \u0648 \u0647\u0645\u06cc\u0634\u0647 \u0686\u0646\u06cc\u0646 \u062e\u0648\u0627\u0647\u0645 \u0628\u0648\u062f."],t.w)
