B.a89=new A.d(B.c,["Bugs are part of development. I can trace, fix, and improve the process for next time.","Los errores son parte del desarrollo. Puedo rastrear, corregir y mejorar el proceso para la pr\xf3xima vez.","Fehler geh\xf6ren zur Entwicklung. Ich kann sie zur\xfcckverfolgen, beheben und den Prozess f\xfcr das n\xe4chste Mal verbessern.","Les bugs font partie du d\xe9veloppement. Je peux les retracer, les corriger et am\xe9liorer le processus pour la prochaine fois.","\u0627\u0644\u0623\u062e\u0637\u0627\u0621 \u062c\u0632\u0621 \u0645\u0646 \u0627\u0644\u062a\u0637\u0648\u064a\u0631. \u064a\u0645\u0643\u0646\u0646\u064a \u062a\u062a\u0628\u0639\u0647\u0627\u060c \u0625\u0635\u0644\u0627\u062d\u0647\u0627\u060c \u0648\u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u0639\u0645\u0644\u064a\u0629 \u0644\u0644\u0645\u0631\u0629 \u0627\u0644\u0642\u0627\u062f\u0645\u0629.","\ubc84\uadf8\ub294 \uac1c\ubc1c\uc758 \uc77c\ubd80\uc785\ub2c8\ub2e4. \ub098\ub294 \uadf8\uac83\ub4e4\uc744 \ucd94\uc801\ud558\uace0 \uc218\uc815\ud558\uba70 \ub2e4\uc74c \ubc88\uc744 \uc704\ud574 \ud504\ub85c\uc138\uc2a4\ub97c \uac1c\uc120\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u9519\u8bef\u662f\u5f00\u53d1\u7684\u4e00\u90e8\u5206\u3002\u6211\u53ef\u4ee5\u8ffd\u8e2a\u3001\u4fee\u590d\u5e76\u6539\u5584\u4e0b\u6b21\u7684\u6d41\u7a0b\u3002","\u092c\u0917\u094d\u0938 \u0935\u093f\u0915\u093e\u0938 \u0915\u093e \u0939\u093f\u0938\u094d\u0938\u093e \u0939\u0948\u0902\u0964 \u092e\u0948\u0902 \u0909\u0928\u094d\u0939\u0947\u0902 \u091f\u094d\u0930\u0947\u0938, \u0920\u0940\u0915 \u0914\u0930 \u0905\u0917\u0932\u0940 \u092c\u093e\u0930 \u0915\u0947 \u0932\u093f\u090f \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e \u0915\u094b \u0938\u0941\u0927\u093e\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0902\u0964","Bug sunt pars evolutionis. Eos sequi, corrigere et processum ad proximam vicem emendare possum.","I bug fanno parte dello sviluppo. Posso tracciare, correggere e migliorare il processo per la prossima volta.","\u0627\u0634\u062a\u0628\u0627\u0647\u0627\u062a \u0628\u062e\u0634\u06cc \u0627\u0632 \u062a\u0648\u0633\u0639\u0647 \u0647\u0633\u062a\u0646\u062f. \u0645\u0646 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0622\u0646\u0647\u0627 \u0631\u0627 \u067e\u06cc\u06af\u06cc\u0631\u06cc \u06a9\u0646\u0645\u060c \u0627\u0635\u0644\u0627\u062d \u06a9\u0646\u0645 \u0648 \u0641\u0631\u0622\u06cc\u0646\u062f \u0631\u0627 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631 \u0628\u0639\u062f\u06cc \u0628\u0647\u0628\u0648\u062f \u0628\u062e\u0634\u0645."],t.w)
