B.abH=new A.d(B.c,["The project is cursed; nothing can be done about it.","El proyecto est\xe1 maldito; no se puede hacer nada al respecto.","Das Projekt ist verflucht; nichts kann dagegen getan werden.","Le projet est maudit; rien ne peut \xeatre fait \xe0 ce sujet.","\u0627\u0644\u0645\u0634\u0631\u0648\u0639 \u0645\u0644\u0639\u0648\u0646\u061b \u0644\u0627 \u064a\u0645\u0643\u0646 \u0641\u0639\u0644 \u0623\u064a \u0634\u064a\u0621 \u062d\u064a\u0627\u0644 \u0630\u0644\u0643.","\uc774 \ud504\ub85c\uc81d\ud2b8\ub294 \uc800\uc8fc\ub97c \ubc1b\uc558\ub2e4; \uc544\ubb34\uac83\ub3c4 \ud560 \uc218 \uc5c6\ub2e4.","\u8fd9\u4e2a\u9879\u76ee\u88ab\u8bc5\u5492\u4e86\uff1b\u4ec0\u4e48\u4e5f\u505a\u4e0d\u4e86\u3002","\u092a\u094d\u0930\u094b\u091c\u0947\u0915\u094d\u091f \u0936\u093e\u092a\u093f\u0924 \u0939\u0948; \u0907\u0938\u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0915\u0941\u091b \u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e \u091c\u093e \u0938\u0915\u0924\u093e\u0964","Projectum maledictum est; nihil fieri potest.","Il progetto \xe8 maledetto; non si pu\xf2 fare nulla a riguardo.","\u0627\u06cc\u0646 \u067e\u0631\u0648\u0698\u0647 \u0646\u0641\u0631\u06cc\u0646 \u0634\u062f\u0647 \u0627\u0633\u062a\u061b \u0647\u06cc\u0686 \u06a9\u0627\u0631\u06cc \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646 \u062f\u0631 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0627\u0646\u062c\u0627\u0645 \u062f\u0627\u062f."],t.w)
