B.aes=new A.d(B.c,["Taking one mistake as evidence of a fixed identity (\u201cI am terrible\u201d) is overgeneralization. Focusing on what you can learn and change is more accurate and useful.","Tomar un error como evidencia de una identidad fija (\u201csoy terrible\u201d) es una sobregeneralizaci\xf3n. Centrarse en lo que puedes aprender y cambiar es m\xe1s preciso y \xfatil.","Einen Fehler als Beweis f\xfcr eine feste Identit\xe4t (\u201eIch bin schrecklich\u201c) zu nehmen, ist eine \xdcberverallgemeinerung. Sich auf das zu konzentrieren, was man lernen und \xe4ndern kann, ist genauer und hilfreicher.","Prendre une erreur comme preuve d'une identit\xe9 fig\xe9e (\xab je suis terrible \xbb) est une g\xe9n\xe9ralisation excessive. Se concentrer sur ce que vous pouvez apprendre et changer est plus pr\xe9cis et utile.","\u0623\u062e\u0630 \u062e\u0637\u0623 \u0648\u0627\u062d\u062f \u0643\u062f\u0644\u064a\u0644 \u0639\u0644\u0649 \u0647\u0648\u064a\u0629 \u062b\u0627\u0628\u062a\u0629 (\u201c\u0623\u0646\u0627 \u0641\u0638\u064a\u0639\u201d) \u0647\u0648 \u062a\u0639\u0645\u064a\u0645 \u0645\u0641\u0631\u0637. \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0639\u0644\u0649 \u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u062a\u0639\u0644\u0645\u0647 \u0648\u062a\u063a\u064a\u064a\u0631\u0647 \u0647\u0648 \u0623\u0643\u062b\u0631 \u062f\u0642\u0629 \u0648\u0641\u0627\u0626\u062f\u0629.","\ud558\ub098\uc758 \uc2e4\uc218\ub97c \uace0\uc815\ub41c \uc815\uccb4\uc131(\u201c\ub098\ub294 \ub054\ucc0d\ud558\ub2e4\u201d)\uc758 \uc99d\uac70\ub85c \uc0bc\ub294 \uac83\uc740 \uacfc\ub3c4\ud55c \uc77c\ubc18\ud654\uc785\ub2c8\ub2e4. \ubc30\uc6b8 \uc218 \uc788\uace0 \ubcc0\uacbd\ud560 \uc218 \uc788\ub294 \uac83\uc5d0 \uc9d1\uc911\ud558\ub294 \uac83\uc774 \ub354 \uc815\ud655\ud558\uace0 \uc720\uc6a9\ud569\ub2c8\ub2e4.","\u5c06\u4e00\u4e2a\u9519\u8bef\u4f5c\u4e3a\u56fa\u5b9a\u8eab\u4efd\uff08\u201c\u6211\u5f88\u7cdf\u7cd5\u201d\uff09\u7684\u8bc1\u636e\u662f\u8fc7\u5ea6\u6cdb\u5316\u3002\u4e13\u6ce8\u4e8e\u4f60\u53ef\u4ee5\u5b66\u4e60\u548c\u6539\u53d8\u7684\u5185\u5bb9\u66f4\u4e3a\u51c6\u786e\u548c\u6709\u7528\u3002","\u090f\u0915 \u0917\u0932\u0924\u0940 \u0915\u094b \u0938\u094d\u0925\u093f\u0930 \u092a\u0939\u091a\u093e\u0928 (\u201c\u092e\u0948\u0902 \u092d\u092f\u093e\u0928\u0915 \u0939\u0942\u0902\u201d) \u0915\u0947 \u092a\u094d\u0930\u092e\u093e\u0923 \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u0932\u0947\u0928\u093e \u0905\u0927\u093f\u0915 \u0938\u093e\u092e\u093e\u0928\u094d\u092f\u0940\u0915\u0930\u0923 \u0939\u0948\u0964 \u091c\u093f\u0938\u0947 \u0906\u092a \u0938\u0940\u0916 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092c\u0926\u0932 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0909\u0938 \u092a\u0930 \u0927\u094d\u092f\u093e\u0928 \u0915\u0947\u0902\u0926\u094d\u0930\u093f\u0924 \u0915\u0930\u0928\u093e \u0905\u0927\u093f\u0915 \u0938\u091f\u0940\u0915 \u0914\u0930 \u0909\u092a\u092f\u094b\u0917\u0940 \u0939\u0948\u0964","Unum errorem ut probationem identitatis fixae (\u201cego horribilis sum\u201d) accipere est transgressio generalis. In eo quod discere et mutare possis, accuratius et utile est.","Prendere un errore come prova di un'identit\xe0 fissa (\u201csono terribile\u201d) \xe8 una sovrageneralizzazione. Concentrarsi su ci\xf2 che puoi imparare e cambiare \xe8 pi\xf9 accurato e utile.","\u06af\u0631\u0641\u062a\u0646 \u06cc\u06a9 \u0627\u0634\u062a\u0628\u0627\u0647 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0645\u062f\u0631\u06a9\u06cc \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u0647\u0648\u06cc\u062a \u062b\u0627\u0628\u062a (\u201c\u0645\u0646 \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0647\u0633\u062a\u0645\u201d) \u06cc\u06a9 \u062a\u0639\u0645\u06cc\u0645 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0627\u0633\u062a. \u062a\u0645\u0631\u06a9\u0632 \u0628\u0631 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0628\u06cc\u0627\u0645\u0648\u0632\u06cc\u062f \u0648 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0647\u06cc\u062f \u062f\u0642\u06cc\u0642\u200c\u062a\u0631 \u0648 \u0645\u0641\u06cc\u062f\u062a\u0631 \u0627\u0633\u062a."],t.w)
