B.acE=new A.d(B.c,["The half-full workshop","El taller medio lleno","Der halbvolle Workshop","L'atelier \xe0 moiti\xe9 plein","\u0648\u0631\u0634\u0629 \u0627\u0644\u0639\u0645\u0644 \u0646\u0635\u0641 \u0627\u0644\u0645\u0645\u062a\u0644\u0626\u0629","\ubc18\ucbe4 \ucc2c \uc6cc\ud06c\uc20d","\u534a\u6ee1\u7684\u5de5\u4f5c\u574a","\u0906\u0927\u093e \u092d\u0930\u093e \u0939\u0941\u0906 \u0915\u093e\u0930\u094d\u092f\u0936\u093e\u0932\u093e","Officina dimidia plena","Il workshop mezzo pieno","\u06a9\u0627\u0631\u06af\u0627\u0647 \u0646\u06cc\u0645\u0647 \u067e\u0631"],t.w)
B.aa4=new A.d(B.c,["You host an online workshop from your room. The participant number is smaller than you imagined, but chat messages are kind and specific. When you close the laptop, your brain only says: \u201cNot enough. Not good.\u201d","Organizas un taller en l\xednea desde tu habitaci\xf3n. El n\xfamero de participantes es menor de lo que imaginabas, pero los mensajes del chat son amables y espec\xedficos. Cuando cierras el port\xe1til, tu cerebro solo dice: \u201cNo es suficiente. No es bueno.\u201d","Du leitest einen Online-Workshop von deinem Zimmer aus. Die Teilnehmerzahl ist kleiner als du dir vorgestellt hast, aber die Chatnachrichten sind freundlich und spezifisch. Wenn du den Laptop schlie\xdft, sagt dein Gehirn nur: \u201eNicht genug. Nicht gut.\u201c",'Vous organisez un atelier en ligne depuis votre chambre. Le nombre de participants est plus petit que ce que vous imaginiez, mais les messages du chat sont gentils et sp\xe9cifiques. Lorsque vous fermez l\'ordinateur portable, votre cerveau dit seulement : "Pas assez. Pas bien."','\u0623\u0646\u062a \u062a\u0633\u062a\u0636\u064a\u0641 \u0648\u0631\u0634\u0629 \u0639\u0645\u0644 \u0639\u0628\u0631 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u0645\u0646 \u063a\u0631\u0641\u062a\u0643. \u0639\u062f\u062f \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u064a\u0646 \u0623\u0635\u063a\u0631 \u0645\u0645\u0627 \u062a\u062e\u064a\u0644\u062a\u060c \u0644\u0643\u0646 \u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u062f\u0631\u062f\u0634\u0629 \u0644\u0637\u064a\u0641\u0629 \u0648\u0645\u062d\u062f\u062f\u0629. \u0639\u0646\u062f\u0645\u0627 \u062a\u063a\u0644\u0642 \u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631 \u0627\u0644\u0645\u062d\u0645\u0648\u0644\u060c \u064a\u0642\u0648\u0644 \u0639\u0642\u0644\u0643 \u0641\u0642\u0637: "\u0644\u064a\u0633 \u0643\u0627\u0641\u064a\u064b\u0627. \u0644\u064a\u0633 \u062c\u064a\u062f\u064b\u0627."','\ub2f9\uc2e0\uc740 \ubc29\uc5d0\uc11c \uc628\ub77c\uc778 \uc6cc\ud06c\uc20d\uc744 \uc8fc\ucd5c\ud569\ub2c8\ub2e4. \ucc38\uac00\uc790 \uc218\ub294 \uc608\uc0c1\ubcf4\ub2e4 \uc801\uc9c0\ub9cc, \ucc44\ud305 \uba54\uc2dc\uc9c0\ub294 \uce5c\uc808\ud558\uace0 \uad6c\uccb4\uc801\uc785\ub2c8\ub2e4. \ub178\ud2b8\ubd81\uc744 \ub2eb\uc744 \ub54c, \ub2f9\uc2e0\uc758 \ub1cc\ub294 \uc774\ub807\uac8c \ub9d0\ud569\ub2c8\ub2e4: "\ubd88\ucda9\ubd84\ud558\ub2e4. \uc88b\uc9c0 \uc54a\ub2e4."',"\u4f60\u5728\u81ea\u5df1\u7684\u623f\u95f4\u4e3e\u529e\u4e00\u4e2a\u5728\u7ebf\u5de5\u4f5c\u574a\u3002\u53c2\u4e0e\u8005\u7684\u6570\u91cf\u6bd4\u4f60\u60f3\u8c61\u7684\u8981\u5c11\uff0c\u4f46\u804a\u5929\u6d88\u606f\u662f\u53cb\u597d\u548c\u5177\u4f53\u7684\u3002\u5f53\u4f60\u5173\u95ed\u7b14\u8bb0\u672c\u65f6\uff0c\u4f60\u7684\u5927\u8111\u53ea\u8bf4\uff1a\u201c\u4e0d\u591f\u3002\u4e0d\u597d\u3002\u201d",'\u0906\u092a \u0905\u092a\u0928\u0947 \u0915\u092e\u0930\u0947 \u0938\u0947 \u090f\u0915 \u0911\u0928\u0932\u093e\u0907\u0928 \u0915\u093e\u0930\u094d\u092f\u0936\u093e\u0932\u093e \u0906\u092f\u094b\u091c\u093f\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 \u092a\u094d\u0930\u0924\u093f\u092d\u093e\u0917\u093f\u092f\u094b\u0902 \u0915\u0940 \u0938\u0902\u0916\u094d\u092f\u093e \u0906\u092a\u0915\u0940 \u0915\u0932\u094d\u092a\u0928\u093e \u0938\u0947 \u0915\u092e \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u091a\u0948\u091f \u0938\u0902\u0926\u0947\u0936 \u0926\u092f\u093e\u0932\u0941 \u0914\u0930 \u0935\u093f\u0936\u093f\u0937\u094d\u091f \u0939\u0948\u0902\u0964 \u091c\u092c \u0906\u092a \u0932\u0948\u092a\u091f\u0949\u092a \u092c\u0902\u0926 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0906\u092a\u0915\u093e \u092e\u0938\u094d\u0924\u093f\u0937\u094d\u0915 \u0915\u0947\u0935\u0932 \u092f\u0939 \u0915\u0939\u0924\u093e \u0939\u0948: "\u092f\u0939 \u092a\u0930\u094d\u092f\u093e\u092a\u094d\u0924 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u092f\u0939 \u0905\u091a\u094d\u091b\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964"','Exercebas officinam online ex cubiculo tuo. Numerus participantium minor erat quam imaginatus es, sed nuntii in chat sunt amabili et specifici. Cum claudis lapto, tantum dicit mens tua: "Non satis. Non bene."','Organizzi un workshop online dalla tua stanza. Il numero di partecipanti \xe8 inferiore a quanto immaginavi, ma i messaggi nella chat sono gentili e specifici. Quando chiudi il laptop, la tua mente dice solo: "Non abbastanza. Non va bene."','\u0634\u0645\u0627 \u06cc\u06a9 \u06a9\u0627\u0631\u06af\u0627\u0647 \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u0632 \u0627\u062a\u0627\u0642 \u062e\u0648\u062f \u0645\u06cc\u0632\u0628\u0627\u0646\u06cc \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f. \u062a\u0639\u062f\u0627\u062f \u0634\u0631\u06a9\u062a\u200c\u06a9\u0646\u0646\u062f\u06af\u0627\u0646 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u0622\u0646\u0686\u0647 \u062a\u0635\u0648\u0631 \u0645\u06cc\u200c\u06a9\u0631\u062f\u06cc\u062f \u0627\u0633\u062a\u060c \u0627\u0645\u0627 \u067e\u06cc\u0627\u0645\u200c\u0647\u0627\u06cc \u0686\u062a \u0645\u0647\u0631\u0628\u0627\u0646 \u0648 \u062e\u0627\u0635 \u0647\u0633\u062a\u0646\u062f. \u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u0644\u067e\u200c\u062a\u0627\u067e \u062e\u0648\u062f \u0631\u0627 \u0645\u06cc\u200c\u0628\u0646\u062f\u06cc\u062f\u060c \u0645\u063a\u0632 \u0634\u0645\u0627 \u0641\u0642\u0637 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f: "\u06a9\u0627\u0641\u06cc \u0646\u06cc\u0633\u062a. \u062e\u0648\u0628 \u0646\u06cc\u0633\u062a."'],t.w)
B.abQ=new A.d(B.c,["If it is not full, it is basically a failure.","Si no est\xe1 lleno, b\xe1sicamente es un fracaso.","Wenn es nicht voll ist, ist es im Grunde ein Misserfolg.","Si ce n'est pas plein, c'est essentiellement un \xe9chec.","\u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0645\u0645\u062a\u0644\u0626\u064b\u0627\u060c \u0641\u0647\u0648 \u0641\u064a \u0627\u0644\u0623\u0633\u0627\u0633 \u0641\u0634\u0644.","\uac00\ub4dd \ucc28\uc9c0 \uc54a\uc73c\uba74 \uae30\ubcf8\uc801\uc73c\ub85c \uc2e4\ud328\uc785\ub2c8\ub2e4.","\u5982\u679c\u4e0d\u6ee1\uff0c\u90a3\u57fa\u672c\u4e0a\u5c31\u662f\u5931\u8d25\u3002","\u092f\u0926\u093f \u092f\u0939 \u092a\u0942\u0930\u093e \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u092f\u0939 \u092e\u0942\u0932 \u0930\u0942\u092a \u0938\u0947 \u0935\u093f\u092b\u0932\u0924\u093e \u0939\u0948\u0964","Si non plenum est, fere defectus est.","Se non \xe8 pieno, \xe8 fondamentalmente un fallimento.","\u0627\u06af\u0631 \u067e\u0631 \u0646\u0628\u0627\u0634\u062f\u060c \u0627\u0633\u0627\u0633\u0627\u064b \u0634\u06a9\u0633\u062a \u0627\u0633\u062a."],t.w)
