B.a9v=new A.d(B.c,["Reach was smaller than I wished, but the people who came found value \u2014 that matters too.","El alcance fue m\xe1s peque\xf1o de lo que deseaba, pero las personas que vinieron encontraron valor, eso tambi\xe9n importa.","Die Reichweite war kleiner als ich mir gew\xfcnscht hatte, aber die Leute, die gekommen sind, haben Wert gefunden \u2014 das z\xe4hlt auch.","La port\xe9e \xe9tait plus petite que ce que je souhaitais, mais les personnes qui sont venues ont trouv\xe9 de la valeur \u2014 cela compte aussi.","\u0643\u0627\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0623\u0635\u063a\u0631 \u0645\u0645\u0627 \u062a\u0645\u0646\u064a\u062a\u060c \u0644\u0643\u0646 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u062c\u0627\u0621\u0648\u0627 \u0648\u062c\u062f\u0648\u0627 \u0642\u064a\u0645\u0629 \u2014 \u0648\u0647\u0630\u0627 \u0623\u064a\u0636\u064b\u0627 \u0645\u0647\u0645.","\ub3c4\ub2ec \ubc94\uc704\ub294 \ub0b4\uac00 \ubc14\ub790\ub358 \uac83\ubcf4\ub2e4 \uc801\uc5c8\uc9c0\ub9cc, \uc628 \uc0ac\ub78c\ub4e4\uc740 \uac00\uce58\ub97c \ucc3e\uc558\uace0 \u2014 \uadf8\uac83\ub3c4 \uc911\uc694\ud569\ub2c8\ub2e4.","\u53c2\u4e0e\u4eba\u6570\u6bd4\u6211\u5e0c\u671b\u7684\u8981\u5c11\uff0c\u4f46\u6765\u7684\u4eba\u627e\u5230\u4e86\u4ef7\u503c\u2014\u2014\u8fd9\u4e5f\u5f88\u91cd\u8981\u3002","\u092a\u0939\u0941\u0901\u091a \u092e\u0947\u0930\u0940 \u0907\u091a\u094d\u091b\u093e \u0938\u0947 \u091b\u094b\u091f\u0940 \u0925\u0940, \u0932\u0947\u0915\u093f\u0928 \u091c\u094b \u0932\u094b\u0917 \u0906\u090f, \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u092e\u0942\u0932\u094d\u092f \u092a\u093e\u092f\u093e \u2014 \u092f\u0939 \u092d\u0940 \u092e\u093e\u092f\u0928\u0947 \u0930\u0916\u0924\u093e \u0939\u0948\u0964","Lata est minor quam volui, sed homines qui venerunt valuere invenerunt \u2014 id quoque refert.","La portata era inferiore a quanto desideravo, ma le persone che sono venute hanno trovato valore \u2014 anche questo conta.","\u062f\u0633\u062a\u0631\u0633 \u06a9\u0645\u062a\u0631 \u0627\u0632 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u0645\u06cc\u200c\u062e\u0648\u0627\u0633\u062a\u0645 \u0628\u0648\u062f\u060c \u0627\u0645\u0627 \u0627\u0641\u0631\u0627\u062f\u06cc \u06a9\u0647 \u0622\u0645\u062f\u0646\u062f \u0627\u0631\u0632\u0634 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0646\u062f \u2014 \u0627\u06cc\u0646 \u0647\u0645 \u0645\u0647\u0645 \u0627\u0633\u062a."],t.w)
