B.abg=new A.d(B.c,["I should stop sharing anything publicly ever again.","Deber\xeda dejar de compartir cualquier cosa p\xfablicamente.","Ich sollte niemals wieder etwas \xf6ffentlich teilen.","Je devrais arr\xeater de partager quoi que ce soit publiquement.","\u064a\u062c\u0628 \u0623\u0646 \u0623\u062a\u0648\u0642\u0641 \u0639\u0646 \u0645\u0634\u0627\u0631\u0643\u0629 \u0623\u064a \u0634\u064a\u0621 \u0639\u0644\u0646\u064b\u0627.","\ub098\ub294 \ub2e4\uc2dc\ub294 \uc544\ubb34\uac83\ub3c4 \uacf5\uac1c\uc801\uc73c\ub85c \uacf5\uc720\ud558\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4.","\u6211\u5e94\u8be5\u505c\u6b62\u516c\u5f00\u5206\u4eab\u4efb\u4f55\u4e8b\u60c5\u3002","\u092e\u0941\u091d\u0947 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0938\u093e\u0930\u094d\u0935\u091c\u0928\u093f\u0915 \u0930\u0942\u092a \u0938\u0947 \u0915\u0941\u091b \u092d\u0940 \u0938\u093e\u091d\u093e \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Desin me quidquam publice communicare.","Dovrei smettere di condividere qualsiasi cosa pubblicamente.","\u0628\u0627\u06cc\u062f \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0631\u0627 \u0628\u0647 \u0637\u0648\u0631 \u0639\u0645\u0648\u0645\u06cc \u0628\u0647 \u0627\u0634\u062a\u0631\u0627\u06a9 \u0646\u06af\u0630\u0627\u0631\u0645."],t.w)
