B.a8d=new A.d(B.c,["You walk down a school hallway. Behind you, a small group starts laughing. You do not hear any names, but your brain instantly zooms in: \u201cThey must be laughing at me.\u201d",'Caminas por un pasillo de la escuela. Detr\xe1s de ti, un peque\xf1o grupo comienza a re\xedr. No oyes nombres, pero tu cerebro se enfoca de inmediato: "Seguramente se est\xe1n riendo de m\xed."',"Du gehst einen Schulflur entlang. Hinter dir beginnt eine kleine Gruppe zu lachen. Du h\xf6rst keine Namen, aber dein Gehirn zoomt sofort in: \u201eSie m\xfcssen sich \xfcber mich lustig machen.\u201c","Vous marchez dans un couloir de l'\xe9cole. Derri\xe8re vous, un petit groupe commence \xe0 rire. Vous n'entendez aucun nom, mais votre cerveau se concentre instantan\xe9ment : \"Ils doivent se moquer de moi.\"",'\u0623\u0646\u062a \u062a\u0645\u0634\u064a \u0641\u064a \u0645\u0645\u0631 \u0627\u0644\u0645\u062f\u0631\u0633\u0629. \u062e\u0644\u0641\u0643\u060c \u064a\u0628\u062f\u0623 \u0645\u062c\u0645\u0648\u0639\u0629 \u0635\u063a\u064a\u0631\u0629 \u0628\u0627\u0644\u0636\u062d\u0643. \u0623\u0646\u062a \u0644\u0627 \u062a\u0633\u0645\u0639 \u0623\u064a \u0623\u0633\u0645\u0627\u0621\u060c \u0644\u0643\u0646 \u0639\u0642\u0644\u0643 \u064a\u0631\u0643\u0632 \u0641\u0648\u0631\u064b\u0627: "\u064a\u062c\u0628 \u0623\u0646\u0647\u0645 \u064a\u0636\u062d\u0643\u0648\u0646 \u0639\u0644\u064a\u0651."','\ub2f9\uc2e0\uc740 \ud559\uad50 \ubcf5\ub3c4\ub97c \uac77\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8 \ub4a4\uc5d0\uc11c \uc791\uc740 \uadf8\ub8f9\uc774 \uc6c3\uae30 \uc2dc\uc791\ud569\ub2c8\ub2e4. \ub2f9\uc2e0\uc740 \uc5b4\ub5a4 \uc774\ub984\ub3c4 \ub4e3\uc9c0 \ubabb\ud558\uc9c0\ub9cc, \ub2f9\uc2e0\uc758 \ub1cc\ub294 \uc989\uc2dc \uc9d1\uc911\ud569\ub2c8\ub2e4: "\uadf8\ub4e4\uc774 \ub098\ub97c \ube44\uc6c3\uace0 \uc788\uc5d0 \ud2c0\ub9bc\uc5c6\ub2e4."',"\u4f60\u8d70\u5728\u5b66\u6821\u7684\u8d70\u5eca\u4e0a\u3002\u5728\u4f60\u8eab\u540e\uff0c\u4e00\u4e2a\u5c0f\u7ec4\u5f00\u59cb\u7b11\u3002\u4f60\u542c\u4e0d\u89c1\u4efb\u4f55\u540d\u5b57\uff0c\u4f46\u4f60\u7684\u5927\u8111\u7acb\u523b\u805a\u7126\uff1a\u201c\u4ed6\u4eec\u4e00\u5b9a\u662f\u5728\u5632\u7b11\u6211\u3002\u201d",'\u0906\u092a \u0938\u094d\u0915\u0942\u0932 \u0915\u0947 \u0939\u0949\u0932\u0935\u0947 \u092e\u0947\u0902 \u091a\u0932 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u092a\u0940\u091b\u0947, \u090f\u0915 \u091b\u094b\u091f\u093e \u0938\u092e\u0942\u0939 \u0939\u0902\u0938\u0928\u093e \u0936\u0941\u0930\u0942 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u0906\u092a \u0915\u094b\u0908 \u0928\u093e\u092e \u0928\u0939\u0940\u0902 \u0938\u0941\u0928\u0924\u0947 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a\u0915\u093e \u092e\u0938\u094d\u0924\u093f\u0937\u094d\u0915 \u0924\u0941\u0930\u0902\u0924 \u0927\u094d\u092f\u093e\u0928 \u0915\u0947\u0902\u0926\u094d\u0930\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948: "\u0935\u0947 \u0928\u093f\u0936\u094d\u091a\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u092e\u0941\u091d \u092a\u0930 \u0939\u0902\u0938 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964"','Ambulas per scholae viam. Post te, parvus grex risu incipit. Nulla nomina audis, sed mens tua statim inzoomat: "Ipsi me derident."','Cammini lungo un corridoio scolastico. Dietro di te, un piccolo gruppo inizia a ridere. Non senti alcun nome, ma il tuo cervello si concentra subito: "Devono ridere di me."','\u0634\u0645\u0627 \u062f\u0631 \u0631\u0627\u0647\u0631\u0648\u06cc \u0645\u062f\u0631\u0633\u0647 \u0642\u062f\u0645 \u0645\u06cc\u200c\u0632\u0646\u06cc\u062f. \u067e\u0634\u062a \u0633\u0631 \u0634\u0645\u0627\u060c \u06cc\u06a9 \u06af\u0631\u0648\u0647 \u06a9\u0648\u0686\u06a9 \u0634\u0631\u0648\u0639 \u0628\u0647 \u062e\u0646\u062f\u06cc\u062f\u0646 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u0634\u0645\u0627 \u0647\u06cc\u0686 \u0646\u0627\u0645\u06cc \u0646\u0645\u06cc\u200c\u0634\u0646\u0648\u06cc\u062f\u060c \u0627\u0645\u0627 \u0645\u063a\u0632 \u0634\u0645\u0627 \u0628\u0644\u0627\u0641\u0627\u0635\u0644\u0647 \u062a\u0645\u0631\u06a9\u0632 \u0645\u06cc\u200c\u06a9\u0646\u062f: "\u0622\u0646\u0647\u0627 \u0628\u0627\u06cc\u062f \u0628\u0647 \u0645\u0646 \u0645\u06cc\u200c\u062e\u0646\u062f\u0646\u062f."'],t.w)
B.abh=new A.d(B.c,["They are definitely laughing at me; I must look ridiculous.","Seguro que se est\xe1n riendo de m\xed; debo verme rid\xedculo.","Sie lachen definitiv \xfcber mich; ich muss l\xe4cherlich aussehen.","Ils se moquent d\xe9finitivement de moi ; je dois avoir l'air ridicule.","\u0625\u0646\u0647\u0645 \u0628\u0627\u0644\u062a\u0623\u0643\u064a\u062f \u064a\u0636\u062d\u0643\u0648\u0646 \u0639\u0644\u064a\u0651\u061b \u064a\u062c\u0628 \u0623\u0646 \u0623\u0628\u062f\u0648 \u0633\u062e\u064a\u0641\u064b\u0627.","\uadf8\ub4e4\uc740 \ud655\uc2e4\ud788 \ub098\ub97c \ube44\uc6c3\uace0 \uc788\uc5b4; \ub098\ub294 \uc6b0\uc2a4\uaf5d\uc2a4\ub7ec\uc6cc \ubcf4\uc77c \uac83\uc774\ub2e4.","\u4ed6\u4eec\u80af\u5b9a\u5728\u5632\u7b11\u6211\uff1b\u6211\u4e00\u5b9a\u770b\u8d77\u6765\u5f88\u53ef\u7b11\u3002","\u0935\u0947 \u0928\u093f\u0936\u094d\u091a\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u092e\u0941\u091d \u092a\u0930 \u0939\u0902\u0938 \u0930\u0939\u0947 \u0939\u0948\u0902; \u092e\u0941\u091d\u0947 \u0905\u091c\u0940\u092c \u0932\u0917\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Ipsi certe me derident; ego ridiculum spectare debeo.","Stanno sicuramente ridendo di me; devo sembrare ridicolo.","\u0622\u0646\u0647\u0627 \u0642\u0637\u0639\u0627\u064b \u0628\u0647 \u0645\u0646 \u0645\u06cc\u200c\u062e\u0646\u062f\u0646\u062f\u061b \u0628\u0627\u06cc\u062f \u0627\u062d\u0645\u0642 \u0628\u0647 \u0646\u0638\u0631 \u0628\u0631\u0633\u0645."],t.w)
