B.ab1=new A.d(B.c,["They could be laughing about anything; I do not actually know what the joke is.","Podr\xedan estar riendo de cualquier cosa; en realidad no s\xe9 cu\xe1l es la broma.","Sie k\xf6nnten \xfcber alles lachen; ich wei\xdf eigentlich nicht, was der Witz ist.","Ils pourraient rire de n'importe quoi ; je ne sais en fait pas quelle est la blague.","\u0642\u062f \u064a\u0643\u0648\u0646\u0648\u0646 \u064a\u0636\u062d\u0643\u0648\u0646 \u0645\u0646 \u0623\u064a \u0634\u064a\u0621\u061b \u0641\u064a \u0627\u0644\u0648\u0627\u0642\u0639 \u0644\u0627 \u0623\u0639\u0631\u0641 \u0645\u0627 \u0647\u064a \u0627\u0644\u0646\u0643\u062a\u0629.","\uadf8\ub4e4\uc740 \ubb34\uc5c7\uc774\ub4e0 \uc6c3\uace0 \uc788\uc744 \uc218 \uc788\ub2e4; \ub098\ub294 \uc2e4\uc81c\ub85c \ubb34\uc5c7\uc774 \ub18d\ub2f4\uc778\uc9c0 \ubaa8\ub974\uaca0\ub2e4.","\u4ed6\u4eec\u53ef\u80fd\u5728\u7b11\u4efb\u4f55\u4e8b\u60c5\uff1b\u6211\u5b9e\u9645\u4e0a\u4e0d\u77e5\u9053\u662f\u4ec0\u4e48\u7b11\u8bdd\u3002","\u0935\u0947 \u0915\u093f\u0938\u0940 \u092d\u0940 \u091a\u0940\u091c\u093c \u092a\u0930 \u0939\u0902\u0938 \u0930\u0939\u0947 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902; \u092e\u0941\u091d\u0947 \u0905\u0938\u0932 \u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u092a\u0924\u093e \u0915\u093f \u092e\u091c\u093e\u0915 \u0915\u094d\u092f\u093e \u0939\u0948\u0964","Ipsi risu de quolibet possunt; reapse nescio quid iocus sit.","Potrebbero ridere di qualsiasi cosa; in realt\xe0 non so quale sia la battuta.","\u0622\u0646\u0647\u0627 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0627\u0632 \u0647\u0631 \u0686\u06cc\u0632\u06cc \u0628\u062e\u0646\u062f\u0646\u062f\u061b \u062f\u0631 \u0648\u0627\u0642\u0639 \u0645\u0646 \u0646\u0645\u06cc\u200c\u062f\u0627\u0646\u0645 \u0634\u0648\u062e\u06cc \u0686\u06cc\u0633\u062a."],t.w)
