B.a92=new A.d(B.c,["People always laugh at me; it has always been like this.","La gente siempre se r\xede de m\xed; siempre ha sido as\xed.","Die Leute lachen immer \xfcber mich; es war schon immer so.","Les gens se moquent toujours de moi ; cela a toujours \xe9t\xe9 comme \xe7a.","\u0627\u0644\u0646\u0627\u0633 \u062f\u0627\u0626\u0645\u064b\u0627 \u064a\u0636\u062d\u0643\u0648\u0646 \u0639\u0644\u064a\u0651\u061b \u0644\u0642\u062f \u0643\u0627\u0646 \u0627\u0644\u0623\u0645\u0631 \u062f\u0627\u0626\u0645\u064b\u0627 \u0647\u0643\u0630\u0627.","\uc0ac\ub78c\ub4e4\uc740 \ud56d\uc0c1 \ub098\ub97c \ube44\uc6c3\uace0 \uc788\ub2e4; \ud56d\uc0c1 \uadf8\ub7ac\ub2e4.","\u4eba\u4eec\u603b\u662f\u5632\u7b11\u6211\uff1b\u4e00\u76f4\u90fd\u662f\u8fd9\u6837\u3002","\u0932\u094b\u0917 \u0939\u092e\u0947\u0936\u093e \u092e\u0941\u091d \u092a\u0930 \u0939\u0902\u0938\u0924\u0947 \u0939\u0948\u0902; \u0939\u092e\u0947\u0936\u093e \u0910\u0938\u093e \u0939\u0940 \u0930\u0939\u093e \u0939\u0948\u0964","Homines semper me derident; semper ita fuit.","Le persone ridono sempre di me; \xe8 sempre stato cos\xec.","\u0645\u0631\u062f\u0645 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 \u0645\u0646 \u0645\u06cc\u200c\u062e\u0646\u062f\u0646\u062f\u061b \u0647\u0645\u06cc\u0634\u0647 \u0627\u06cc\u0646\u200c\u0637\u0648\u0631 \u0628\u0648\u062f\u0647 \u0627\u0633\u062a."],t.w)
