B.acw=new A.d(B.c,["Assuming others are talking about you without evidence is mind reading. A more grounded response is to admit \u201cI do not know what it was about.\u201d",'Suponer que los dem\xe1s est\xe1n hablando de ti sin pruebas es leer la mente. Una respuesta m\xe1s equilibrada es admitir: "No s\xe9 de qu\xe9 se trataba."',"Zu vermuten, dass andere \xfcber dich sprechen, ohne Beweise, ist Gedankenlesen. Eine fundiertere Reaktion ist zuzugeben: \u201eIch wei\xdf nicht, worum es ging.\u201c","Supposer que les autres parlent de vous sans preuve, c'est de la lecture de pens\xe9e. Une r\xe9ponse plus r\xe9aliste est d'admettre : \"Je ne sais pas de quoi il s'agissait.\"",'\u0627\u0641\u062a\u0631\u0627\u0636 \u0623\u0646 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u064a\u062a\u062d\u062f\u062b\u0648\u0646 \u0639\u0646\u0643 \u062f\u0648\u0646 \u062f\u0644\u064a\u0644 \u0647\u0648 \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0623\u0641\u0643\u0627\u0631. \u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0623\u0643\u062b\u0631 \u0648\u0627\u0642\u0639\u064a\u0629 \u0647\u064a \u0627\u0644\u0627\u0639\u062a\u0631\u0627\u0641: "\u0644\u0627 \u0623\u0639\u0631\u0641 \u0639\u0646 \u0645\u0627\u0630\u0627 \u0643\u0627\u0646."','\uc99d\uac70 \uc5c6\uc774 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc774 \ub2f9\uc2e0\uc5d0 \ub300\ud574 \uc774\uc57c\uae30\ud55c\ub2e4\uace0 \uac00\uc815\ud558\ub294 \uac83\uc740 \ub9c8\uc74c \uc77d\uae30\uc785\ub2c8\ub2e4. \ub354 \ud604\uc2e4\uc801\uc778 \ubc18\uc751\uc740 "\ubb34\uc5c7\uc5d0 \uad00\ud55c \uac83\uc774\uc5c8\ub294\uc9c0 \ubaa8\ub974\uaca0\ub2e4"\uace0 \uc778\uc815\ud558\ub294 \uac83\uc785\ub2c8\ub2e4.',"\u5047\u8bbe\u522b\u4eba\u6ca1\u6709\u8bc1\u636e\u5730\u5728\u8c08\u8bba\u4f60\uff0c\u8fd9\u5c31\u662f\u8bfb\u5fc3\u672f\u3002\u4e00\u4e2a\u66f4\u5b9e\u9645\u7684\u53cd\u5e94\u662f\u627f\u8ba4\uff1a\u201c\u6211\u4e0d\u77e5\u9053\u90a3\u662f\u4ec0\u4e48\u3002\u201d",'\u092f\u0939 \u092e\u093e\u0928\u0928\u093e \u0915\u093f \u0926\u0942\u0938\u0930\u0947 \u092c\u093f\u0928\u093e \u092a\u094d\u0930\u092e\u093e\u0923 \u0915\u0947 \u092e\u0947\u0930\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u092c\u093e\u0924 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902, \u092e\u0928 \u092a\u0922\u093c\u0928\u093e \u0939\u0948\u0964 \u090f\u0915 \u0914\u0930 \u0905\u0927\u093f\u0915 \u0935\u094d\u092f\u093e\u0935\u0939\u093e\u0930\u093f\u0915 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u092f\u0939 \u0939\u0948 \u0915\u093f "\u092e\u0941\u091d\u0947 \u0928\u0939\u0940\u0902 \u092a\u0924\u093e \u0915\u093f \u092f\u0939 \u0915\u093f\u0938 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0925\u093e\u0964"','Existimare alios de te loqui sine probatione est cogitationes legere. Responsio magis fundata est fateri: "Nescio quid id esset."','Supporre che gli altri parlino di te senza prove \xe8 leggere nella mente. Una risposta pi\xf9 realistica \xe8 ammettere: "Non so di cosa si trattava."','\u0641\u0631\u0636 \u06a9\u0631\u062f\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u062f\u06cc\u06af\u0631\u0627\u0646 \u0628\u062f\u0648\u0646 \u0645\u062f\u0631\u06a9 \u062f\u0631 \u0645\u0648\u0631\u062f \u0634\u0645\u0627 \u0635\u062d\u0628\u062a \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f\u060c \u062e\u0648\u0627\u0646\u062f\u0646 \u0630\u0647\u0646 \u0627\u0633\u062a. \u06cc\u06a9 \u0648\u0627\u06a9\u0646\u0634 \u0648\u0627\u0642\u0639\u200c\u0628\u06cc\u0646\u0627\u0646\u0647\u200c\u062a\u0631 \u0627\u06cc\u0646 \u0627\u0633\u062a \u06a9\u0647 \u0628\u067e\u0630\u06cc\u0631\u06cc\u062f: "\u0646\u0645\u06cc\u200c\u062f\u0627\u0646\u0645 \u0627\u06cc\u0646 \u062f\u0631 \u0645\u0648\u0631\u062f \u0686\u0647 \u0686\u06cc\u0632\u06cc \u0628\u0648\u062f."'],t.w)
