B.ac1=new A.d(B.c,["You send a long, vulnerable message. An hour later, it shows \u201cseen\u201d, but there is no reply. The chat bubble sits at the bottom of your screen like a weight.",'Env\xedas un mensaje largo y vulnerable. Una hora despu\xe9s, aparece "visto", pero no hay respuesta. La burbuja del chat se queda en la parte inferior de tu pantalla como un peso.',"Du sendest eine lange, verletzliche Nachricht. Eine Stunde sp\xe4ter steht \u201egelesen\u201c, aber es gibt keine Antwort. Die Chatblase bleibt wie ein Gewicht am unteren Rand deines Bildschirms sitzen.","Vous envoyez un message long et vuln\xe9rable. Une heure plus tard, il affiche \xab vu \xbb, mais il n'y a pas de r\xe9ponse. La bulle de chat reste en bas de votre \xe9cran comme un poids.",'\u0623\u0646\u062a \u062a\u0631\u0633\u0644 \u0631\u0633\u0627\u0644\u0629 \u0637\u0648\u064a\u0644\u0629 \u0648\u0647\u0634\u0629. \u0628\u0639\u062f \u0633\u0627\u0639\u0629\u060c \u064a\u0638\u0647\u0631 "\u062a\u0645\u062a \u0627\u0644\u0645\u0634\u0627\u0647\u062f\u0629"\u060c \u0648\u0644\u0643\u0646 \u0644\u0627 \u062a\u0648\u062c\u062f \u0625\u062c\u0627\u0628\u0629. \u062a\u0638\u0644 \u0641\u0642\u0627\u0639\u0629 \u0627\u0644\u062f\u0631\u062f\u0634\u0629 \u0641\u064a \u0623\u0633\u0641\u0644 \u0634\u0627\u0634\u062a\u0643 \u0645\u062b\u0644 \u0627\u0644\u0648\u0632\u0646.',"\ub2f9\uc2e0\uc740 \uae34, \ucde8\uc57d\ud55c \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0c5\ub2c8\ub2e4. \ud55c \uc2dc\uac04 \ud6c4, \u201c\uc77d\uc74c\u201d\uc774 \ud45c\uc2dc\ub418\uc9c0\ub9cc \ub2f5\uc7a5\uc740 \uc5c6\uc2b5\ub2c8\ub2e4. \ucc44\ud305 \ubc84\ube14\uc740 \ud654\uba74 \ud558\ub2e8\uc5d0 \ubb34\uac8c\ucc98\ub7fc \uc549\uc544 \uc788\uc2b5\ub2c8\ub2e4.","\u4f60\u53d1\u9001\u4e86\u4e00\u6761\u957f\u800c\u8106\u5f31\u7684\u6d88\u606f\u3002\u4e00\u5c0f\u65f6\u540e\uff0c\u5b83\u663e\u793a\u4e3a\u201c\u5df2\u8bfb\u201d\uff0c\u4f46\u6ca1\u6709\u56de\u590d\u3002\u804a\u5929\u6c14\u6ce1\u50cf\u91cd\u7269\u4e00\u6837\u505c\u7559\u5728\u5c4f\u5e55\u5e95\u90e8\u3002",'\u0906\u092a \u090f\u0915 \u0932\u0902\u092c\u093e, \u0938\u0902\u0935\u0947\u0926\u0928\u0936\u0940\u0932 \u0938\u0902\u0926\u0947\u0936 \u092d\u0947\u091c\u0924\u0947 \u0939\u0948\u0902\u0964 \u090f\u0915 \u0918\u0902\u091f\u0947 \u092c\u093e\u0926, \u092f\u0939 "\u0926\u0947\u0916\u093e" \u0926\u093f\u0916\u093e\u0924\u093e \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0915\u094b\u0908 \u0909\u0924\u094d\u0924\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u091a\u0948\u091f \u092c\u092c\u0932 \u0938\u094d\u0915\u094d\u0930\u0940\u0928 \u0915\u0947 \u0928\u0940\u091a\u0947 \u0935\u091c\u0928 \u0915\u0940 \u0924\u0930\u0939 \u092c\u0948\u0920\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964','Mitte longum et vulnerabilem nuntium. Post horam, ostenditur "visum", sed nulla responsio est. Bubble chat in fundo screen ut pondus sedet.',"Invii un lungo messaggio vulnerabile. Un'ora dopo, appare \"visto\", ma non c'\xe8 risposta. La bolla di chat resta in fondo allo schermo come un peso.",'\u0634\u0645\u0627 \u06cc\u06a9 \u067e\u06cc\u0627\u0645 \u0637\u0648\u0644\u0627\u0646\u06cc \u0648 \u0622\u0633\u06cc\u0628\u200c\u067e\u0630\u06cc\u0631 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f. \u06cc\u06a9 \u0633\u0627\u0639\u062a \u0628\u0639\u062f\u060c \u0646\u0634\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u062f "\u062f\u06cc\u062f\u0647 \u0634\u062f\u0647"\u060c \u0627\u0645\u0627 \u067e\u0627\u0633\u062e\u06cc \u0646\u06cc\u0633\u062a. \u062d\u0628\u0627\u0628 \u0686\u062a \u0645\u0627\u0646\u0646\u062f \u0648\u0632\u0646\u06cc \u062f\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0634\u0645\u0627 \u0628\u0627\u0642\u06cc \u0645\u06cc\u200c\u0645\u0627\u0646\u062f.'],t.w)
B.act=new A.d(B.c,["They have seen the real me and now they do not care.","Han visto el verdadero yo y ahora no les importa.","Sie haben das wahre Ich gesehen und jetzt interessiert es sie nicht.","Ils ont vu le vrai moi et maintenant ils s'en moquent.","\u0644\u0642\u062f \u0631\u0623\u0648\u0627 \u062d\u0642\u064a\u0642\u064a\u062a\u064a \u0627\u0644\u0622\u0646 \u0648\u0644\u0627 \u064a\u0647\u062a\u0645\u0648\u0646.","\uadf8\ub4e4\uc740 \uc9c4\uc9dc \ub098\ub97c \ubd24\uace0 \uc774\uc81c \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\ub294\ub2e4.","\u4ed6\u4eec\u770b\u5230\u4e86\u771f\u5b9e\u7684\u6211\uff0c\u73b0\u5728\u4e0d\u5728\u4e4e\u3002","\u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0905\u0938\u0932\u0940 \u092e\u0941\u091d\u0947 \u0926\u0947\u0916\u093e \u0939\u0948 \u0914\u0930 \u0905\u092c \u0909\u0928\u094d\u0939\u0947\u0902 \u0915\u094b\u0908 \u092a\u0930\u0935\u093e\u0939 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964","Viderunt me verum et nunc non curant.","Hanno visto il vero me e ora non gliene frega niente.","\u0622\u0646\u0647\u0627 \u0648\u0627\u0642\u0639\u0627\u064b \u0645\u0646 \u0631\u0627 \u062f\u06cc\u062f\u0647\u200c\u0627\u0646\u062f \u0648 \u062d\u0627\u0644\u0627 \u0627\u0647\u0645\u06cc\u062a\u06cc \u0646\u0645\u06cc\u200c\u062f\u0647\u0646\u062f."],t.w)
