B.a8s=new A.d(B.c,["They might be busy, unsure how to respond, or planning a thoughtful reply later.","Pueden estar ocupados, no saber c\xf3mo responder, o estar planeando una respuesta reflexiva m\xe1s tarde.","Sie k\xf6nnten besch\xe4ftigt sein, unsicher, wie sie antworten sollen, oder sp\xe4ter eine durchdachte Antwort planen.","Ils peuvent \xeatre occup\xe9s, ne pas savoir comment r\xe9pondre, ou pr\xe9voir une r\xe9ponse r\xe9fl\xe9chie plus tard.","\u0642\u062f \u064a\u0643\u0648\u0646\u0648\u0646 \u0645\u0634\u063a\u0648\u0644\u064a\u0646\u060c \u063a\u064a\u0631 \u0645\u062a\u0623\u0643\u062f\u064a\u0646 \u0645\u0646 \u0643\u064a\u0641\u064a\u0629 \u0627\u0644\u0631\u062f\u060c \u0623\u0648 \u064a\u062e\u0637\u0637\u0648\u0646 \u0644\u0644\u0631\u062f \u0628\u062a\u0641\u0643\u064a\u0631 \u0644\u0627\u062d\u0642.","\uadf8\ub4e4\uc740 \ubc14\uc060 \uc218\ub3c4 \uc788\uace0, \uc5b4\ub5bb\uac8c \ub2f5\ud574\uc57c \ud560\uc9c0 \ubaa8\ub974\uac70\ub098, \ub098\uc911\uc5d0 \uc2e0\uc911\ud55c \ub2f5\ubcc0\uc744 \uacc4\ud68d\ud558\uace0 \uc788\uc744 \uc218 \uc788\ub2e4.","\u4ed6\u4eec\u53ef\u80fd\u5f88\u5fd9\uff0c\u4e0d\u77e5\u9053\u5982\u4f55\u56de\u590d\uff0c\u6216\u8005\u8ba1\u5212\u7a0d\u540e\u56de\u590d\u3002","\u0935\u0947 \u0935\u094d\u092f\u0938\u094d\u0924 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902, \u092f\u0939 \u0938\u0941\u0928\u093f\u0936\u094d\u091a\u093f\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930 \u092a\u093e \u0930\u0939\u0947 \u0939\u094b\u0902\u0917\u0947 \u0915\u093f \u0915\u0948\u0938\u0947 \u091c\u0935\u093e\u092c \u0926\u0947\u0902, \u092f\u093e \u092c\u093e\u0926 \u092e\u0947\u0902 \u0935\u093f\u091a\u093e\u0930\u0936\u0940\u0932 \u091c\u0935\u093e\u092c \u0926\u0947\u0928\u0947 \u0915\u0940 \u092f\u094b\u091c\u0928\u093e \u092c\u0928\u093e \u0930\u0939\u0947 \u0939\u094b\u0902\u0917\u0947\u0964","Possunt esse occupati, incerti quid respondere, vel cogitatam responsionem postea cogitare.","Potrebbero essere occupati, incerti su come rispondere, o pianificare una risposta pensierosa pi\xf9 tardi.","\u0622\u0646\u0647\u0627 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0645\u0634\u063a\u0648\u0644 \u0628\u0627\u0634\u0646\u062f\u060c \u0646\u0645\u06cc\u200c\u062f\u0627\u0646\u0646\u062f \u0686\u06af\u0648\u0646\u0647 \u067e\u0627\u0633\u062e \u062f\u0647\u0646\u062f\u060c \u06cc\u0627 \u0642\u0635\u062f \u062f\u0627\u0631\u0646\u062f \u067e\u0627\u0633\u062e \u0645\u0641\u06a9\u0631\u06cc \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u0646\u062f."],t.w)
