B.a9N=new A.d(B.c,["It proves I should never open up to anyone again.","Demuestra que nunca deber\xeda abrirme a nadie m\xe1s.","Es beweist, dass ich mich niemals wieder jemandem \xf6ffnen sollte.","Cela prouve que je ne devrais plus jamais m'ouvrir \xe0 quelqu'un.","\u064a\u062b\u0628\u062a \u0623\u0646\u0647 \u064a\u062c\u0628 \u0639\u0644\u064a\u0651 \u0623\u0644\u0627 \u0623\u0641\u062a\u062d \u0623\u064a \u0634\u062e\u0635 \u0622\u062e\u0631 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\uc774\uac83\uc740 \ub0b4\uac00 \ub2e4\uc2dc\ub294 \ub204\uad6c\uc5d0\uac8c\ub3c4 \ub9c8\uc74c\uc744 \uc5f4\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4\ub294 \uac83\uc744 \uc99d\uba85\ud55c\ub2e4.","\u8fd9\u8bc1\u660e\u6211\u518d\u4e5f\u4e0d\u5e94\u8be5\u5bf9\u4efb\u4f55\u4eba\u655e\u5f00\u5fc3\u6249\u3002","\u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0941\u091d\u0947 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0915\u093f\u0938\u0940 \u0938\u0947 \u092d\u0940 \u0916\u0941\u0932\u0915\u0930 \u092c\u093e\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964","Hoc probat me numquam alii aperire debere.","Questo prova che non dovrei mai pi\xf9 aprirmi con nessuno.","\u0627\u06cc\u0646 \u0627\u062b\u0628\u0627\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u0646\u0628\u0627\u06cc\u062f \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686\u200c\u06af\u0627\u0647 \u062e\u0648\u062f \u0631\u0627 \u0628\u0647 \u06a9\u0633\u06cc \u0628\u0627\u0632 \u06a9\u0646\u0645."],t.w)
