B.acz=new A.d(B.c,["Treating a delayed reply as proof of rejection is emotional reasoning and catastrophizing. There are many reasons for silence that are not about your worth.","Tratar una respuesta retrasada como prueba de rechazo es un razonamiento emocional y catastrofismo. Hay muchas razones para el silencio que no tienen que ver con tu valor.","Eine verz\xf6gerte Antwort als Beweis f\xfcr Ablehnung zu behandeln, ist emotionales Denken und Katastrophisierung. Es gibt viele Gr\xfcnde f\xfcr Schweigen, die nichts mit deinem Wert zu tun haben.","Traiter une r\xe9ponse retard\xe9e comme une preuve de rejet est un raisonnement \xe9motionnel et une catastrophisation. Il y a de nombreuses raisons pour le silence qui ne concernent pas ta valeur.","\u0645\u0639\u0627\u0645\u0644\u0629 \u0627\u0644\u0631\u062f \u0627\u0644\u0645\u062a\u0623\u062e\u0631 \u0643\u062f\u0644\u064a\u0644 \u0639\u0644\u0649 \u0627\u0644\u0631\u0641\u0636 \u0647\u0648 \u062a\u0641\u0643\u064a\u0631 \u0639\u0627\u0637\u0641\u064a \u0648\u0645\u0628\u0627\u0644\u063a\u0629 \u0641\u064a \u0627\u0644\u0623\u0645\u0648\u0631. \u0647\u0646\u0627\u0643 \u0627\u0644\u0639\u062f\u064a\u062f \u0645\u0646 \u0627\u0644\u0623\u0633\u0628\u0627\u0628 \u0644\u0644\u0635\u0645\u062a \u0627\u0644\u062a\u064a \u0644\u0627 \u062a\u062a\u0639\u0644\u0642 \u0628\u0642\u064a\u0645\u062a\u0643.","\uc9c0\uc5f0\ub41c \ub2f5\ubcc0\uc744 \uac70\ubd80\uc758 \uc99d\uac70\ub85c \ucde8\uae09\ud558\ub294 \uac83\uc740 \uac10\uc815\uc801 \ucd94\ub860\uacfc \uc7ac\uc559\ud654\uc785\ub2c8\ub2e4. \uce68\ubb35\uc5d0\ub294 \ub2f9\uc2e0\uc758 \uac00\uce58\uc640 \uad00\uacc4\uc5c6\ub294 \ub9ce\uc740 \uc774\uc720\uac00 \uc788\uc2b5\ub2c8\ub2e4.","\u5c06\u5ef6\u8fdf\u7684\u56de\u590d\u89c6\u4e3a\u62d2\u7edd\u7684\u8bc1\u636e\u662f\u4e00\u79cd\u60c5\u611f\u63a8\u7406\u548c\u707e\u96be\u5316\u601d\u7ef4\u3002\u6c89\u9ed8\u6709\u5f88\u591a\u539f\u56e0\uff0c\u5e76\u4e0d\u4ee3\u8868\u4f60\u7684\u4ef7\u503c\u3002","\u0935\u093f\u0932\u0902\u092c\u093f\u0924 \u0909\u0924\u094d\u0924\u0930 \u0915\u094b \u0905\u0938\u094d\u0935\u0940\u0915\u0943\u0924\u093f \u0915\u0947 \u092a\u094d\u0930\u092e\u093e\u0923 \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u092e\u093e\u0928\u0928\u093e \u200b\u200b\u092d\u093e\u0935\u0928\u093e\u0924\u094d\u092e\u0915 \u0924\u0930\u094d\u0915 \u0914\u0930 \u0906\u092a\u0926\u093e \u0938\u094b\u091a \u0939\u0948\u0964 \u091a\u0941\u092a\u094d\u092a\u0940 \u0915\u0947 \u0915\u0908 \u0915\u093e\u0930\u0923 \u0939\u0948\u0902 \u091c\u094b \u0906\u092a\u0915\u0940 \u0915\u093c\u0940\u092e\u0924 \u0938\u0947 \u0938\u0902\u092c\u0902\u0927\u093f\u0924 \u0928\u0939\u0940\u0902 \u0939\u0948\u0902\u0964","Tractando moras responsiones ut probationem rejectionis, rationes emotionales et catastrophae sunt. Multa sunt silentii causae quae non sunt de tuo pretio.","Trattare una risposta ritardata come prova di rifiuto \xe8 un ragionamento emotivo e una catastrofizzazione. Ci sono molte ragioni per il silenzio che non riguardano il tuo valore.","\u0646\u06af\u0627\u0647 \u062f\u0627\u0634\u062a\u0646 \u067e\u0627\u0633\u062e \u062f\u06cc\u0631\u0647\u0646\u06af\u0627\u0645 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0645\u062f\u0631\u06a9 \u0631\u062f \u0634\u062f\u0646\u060c \u0627\u0633\u062a\u062f\u0644\u0627\u0644 \u0627\u062d\u0633\u0627\u0633\u06cc \u0648 \u0641\u0627\u062c\u0639\u0647\u200c\u0633\u0627\u0632\u06cc \u0627\u0633\u062a. \u062f\u0644\u0627\u06cc\u0644 \u0632\u06cc\u0627\u062f\u06cc \u0628\u0631\u0627\u06cc \u0633\u06a9\u0648\u062a \u0648\u062c\u0648\u062f \u062f\u0627\u0631\u062f \u06a9\u0647 \u0628\u0647 \u0627\u0631\u0632\u0634 \u0634\u0645\u0627 \u0645\u0631\u0628\u0648\u0637 \u0646\u06cc\u0633\u062a."],t.w)
