B.aeU=new A.d(B.c,["Your shoes are by the door, jacket on the chair. A message arrives: \u201cI am exhausted, can we reschedule?\u201d You look around at the quiet room and feel the air go heavy.","Tus zapatos est\xe1n junto a la puerta, la chaqueta sobre la silla. Llega un mensaje: \u201cEstoy agotado, \xbfpodemos reprogramarlo?\u201d Mir\xe1s a tu alrededor en la habitaci\xf3n tranquila y sientes el aire volverse pesado.","Deine Schuhe stehen an der T\xfcr, die Jacke auf dem Stuhl. Eine Nachricht kommt: \u201eIch bin ersch\xf6pft, k\xf6nnen wir es neu planen?\u201c Du schaust dich in dem ruhigen Raum um und sp\xfcrst, wie die Luft schwer wird.","Tes chaussures sont pr\xe8s de la porte, ta veste sur la chaise. Un message arrive : \u201cJe suis \xe9puis\xe9, peut-on reprogrammer ?\u201d Tu regardes autour de toi dans la pi\xe8ce silencieuse et ressens l'air devenir lourd.","\u062d\u0630\u0627\u0624\u0643 \u0628\u0627\u0644\u0642\u0631\u0628 \u0645\u0646 \u0627\u0644\u0628\u0627\u0628\u060c \u0648\u0627\u0644\u0645\u0639\u0637\u0641 \u0639\u0644\u0649 \u0627\u0644\u0643\u0631\u0633\u064a. \u0648\u0635\u0644\u062a \u0631\u0633\u0627\u0644\u0629: \u201c\u0623\u0646\u0627 \u0645\u0631\u0647\u0642\u060c \u0647\u0644 \u064a\u0645\u0643\u0646\u0646\u0627 \u0625\u0639\u0627\u062f\u0629 \u062c\u062f\u0648\u0644\u0629\u061f\u201d \u062a\u0646\u0638\u0631 \u062d\u0648\u0644\u0643 \u0641\u064a \u0627\u0644\u063a\u0631\u0641\u0629 \u0627\u0644\u0647\u0627\u062f\u0626\u0629 \u0648\u062a\u0634\u0639\u0631 \u0628\u0623\u0646 \u0627\u0644\u062c\u0648 \u0623\u0635\u0628\u062d \u062b\u0642\u064a\u0644\u064b\u0627.","\ub2f9\uc2e0\uc758 \uc2e0\ubc1c\uc740 \ubb38 \uc606\uc5d0 \uc788\uace0, \uc790\ucf13\uc740 \uc758\uc790\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \uba54\uc2dc\uc9c0\uac00 \ub3c4\ucc29\ud569\ub2c8\ub2e4: \u201c\ub098\ub294 \uc9c0\ucce4\uc5b4, \ub2e4\uc2dc \uc77c\uc815\uc744 \uc7a1\uc744 \uc218 \uc788\uc744\uae4c?\u201d \uc870\uc6a9\ud55c \ubc29\uc744 \ub458\ub7ec\ubcf4\uba70 \uacf5\uae30\uac00 \ubb34\uac81\uac8c \ub290\uaef4\uc9d1\ub2c8\ub2e4.","\u4f60\u7684\u978b\u5b50\u653e\u5728\u95e8\u65c1\uff0c\u5939\u514b\u653e\u5728\u6905\u5b50\u4e0a\u3002\u4e00\u6761\u6d88\u606f\u5230\u8fbe\uff1a\u201c\u6211\u7d2f\u574f\u4e86\uff0c\u6211\u4eec\u80fd\u91cd\u65b0\u5b89\u6392\u5417\uff1f\u201d\u4f60\u73af\u987e\u56db\u5468\uff0c\u770b\u7740\u5b89\u9759\u7684\u623f\u95f4\uff0c\u611f\u89c9\u7a7a\u6c14\u53d8\u5f97\u6c89\u91cd\u3002","\u0906\u092a\u0915\u0947 \u091c\u0942\u0924\u0947 \u0926\u0930\u0935\u093e\u091c\u0947 \u0915\u0947 \u092a\u093e\u0938 \u0939\u0948\u0902, \u091c\u0948\u0915\u0947\u091f \u0915\u0941\u0930\u094d\u0938\u0940 \u092a\u0930 \u0939\u0948\u0964 \u090f\u0915 \u0938\u0902\u0926\u0947\u0936 \u0906\u0924\u093e \u0939\u0948: \u201c\u092e\u0948\u0902 \u0925\u0915 \u091a\u0941\u0915\u093e \u0939\u0942\u0901, \u0915\u094d\u092f\u093e \u0939\u092e \u0907\u0938\u0947 \u092b\u093f\u0930 \u0938\u0947 \u0936\u0947\u0921\u094d\u092f\u0942\u0932 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902?\u201d \u0906\u092a \u091a\u093e\u0930\u094b\u0902 \u0913\u0930 \u0926\u0947\u0916\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0915\u092e\u0930\u0947 \u092e\u0947\u0902 \u0939\u0935\u093e \u092d\u093e\u0930\u0940 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964","Calceamenta tua iuxta ianuam sunt, tunica in sella. Nuntius venit: \u201cExhaustus sum, possumusne renuntiare?\u201d Circumspectans in quieto cubiculo, sensus aeris gravis fit.","Le tue scarpe sono vicino alla porta, la giacca sulla sedia. Arriva un messaggio: \u201cSono esausto, possiamo riprogrammare?\u201d Guardi intorno nella stanza silenziosa e senti l'aria diventare pesante.","\u06a9\u0641\u0634\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u06a9\u0646\u0627\u0631 \u062f\u0631 \u0647\u0633\u062a\u0646\u062f\u060c \u0698\u0627\u06a9\u062a \u0631\u0648\u06cc \u0635\u0646\u062f\u0644\u06cc \u0627\u0633\u062a. \u067e\u06cc\u0627\u0645\u06cc \u0645\u06cc\u200c\u0631\u0633\u062f: \u201c\u0645\u0646 \u062e\u0633\u062a\u0647 \u0647\u0633\u062a\u0645\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u0645 \u062f\u0648\u0628\u0627\u0631\u0647 \u0628\u0631\u0646\u0627\u0645\u0647\u200c\u0631\u06cc\u0632\u06cc \u06a9\u0646\u06cc\u0645\u061f\u201d \u0628\u0647 \u0627\u0637\u0631\u0627\u0641 \u0627\u062a\u0627\u0642 \u0622\u0631\u0627\u0645 \u0646\u06af\u0627\u0647 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u0648 \u0627\u062d\u0633\u0627\u0633 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u0647\u0648\u0627 \u0633\u0646\u06af\u06cc\u0646 \u0645\u06cc\u200c\u0634\u0648\u062f."],t.w)
B.aab=new A.d(B.c,["They do not actually enjoy spending time with me.","En realidad no disfrutan pasar tiempo conmigo.","Sie genie\xdfen es tats\xe4chlich nicht, Zeit mit mir zu verbringen.","Ils n'aiment en fait pas passer du temps avec moi.","\u0641\u064a \u0627\u0644\u0648\u0627\u0642\u0639\u060c \u0644\u0627 \u064a\u0633\u062a\u0645\u062a\u0639\u0648\u0646 \u0628\u0642\u0636\u0627\u0621 \u0627\u0644\u0648\u0642\u062a \u0645\u0639\u064a.","\uadf8\ub4e4\uc740 \uc2e4\uc81c\ub85c \ub098\uc640 \uc2dc\uac04\uc744 \ubcf4\ub0b4\ub294 \uac83\uc744 \uc990\uae30\uc9c0 \uc54a\ub294\ub2e4.","\u4ed6\u4eec\u5176\u5b9e\u4e0d\u559c\u6b22\u548c\u6211\u5728\u4e00\u8d77\u3002","\u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902, \u0935\u0947 \u092e\u0947\u0930\u0947 \u0938\u093e\u0925 \u0938\u092e\u092f \u092c\u093f\u0924\u093e\u0928\u093e \u092a\u0938\u0902\u0926 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947\u0964","Revera non fruuntur tempore mecum degendo.","In realt\xe0 non si divertono a passare del tempo con me.","\u062f\u0631 \u0648\u0627\u0642\u0639\u060c \u0622\u0646\u0647\u0627 \u0627\u0632 \u06af\u0630\u0631\u0627\u0646\u062f\u0646 \u0648\u0642\u062a \u0628\u0627 \u0645\u0646 \u0644\u0630\u062a \u0646\u0645\u06cc\u200c\u0628\u0631\u0646\u062f."],t.w)
