B.a8c=new A.d(B.c,["This always happens to me; nobody really wants me around.","Esto siempre me pasa; nadie realmente quiere que est\xe9 cerca.","Das passiert immer mir; niemand will mich wirklich um sich haben.","Cela m'arrive toujours ; personne ne veut vraiment ma pr\xe9sence.","\u0647\u0630\u0627 \u064a\u062d\u062f\u062b \u0644\u064a \u062f\u0627\u0626\u0645\u064b\u0627\u061b \u0644\u0627 \u0623\u062d\u062f \u064a\u0631\u064a\u062f\u0646\u064a \u062d\u0642\u064b\u0627 \u062d\u0648\u0644\u0647.","\uc774\uac74 \ud56d\uc0c1 \ub098\uc5d0\uac8c \uc77c\uc5b4\ub09c\ub2e4; \uc544\ubb34\ub3c4 \ub098\ub97c \uc6d0\ud558\uc9c0 \uc54a\ub294\ub2e4.","\u8fd9\u603b\u662f\u53d1\u751f\u5728\u6211\u8eab\u4e0a\uff1b\u6ca1\u6709\u4eba\u771f\u7684\u60f3\u8981\u6211\u5728\u8eab\u8fb9\u3002","\u092f\u0939 \u0939\u092e\u0947\u0936\u093e \u092e\u0947\u0930\u0947 \u0938\u093e\u0925 \u0939\u094b\u0924\u093e \u0939\u0948; \u0915\u094b\u0908 \u092d\u0940 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u092e\u0941\u091d\u0947 \u0905\u092a\u0928\u0947 \u092a\u093e\u0938 \u0928\u0939\u0940\u0902 \u091a\u093e\u0939\u0924\u093e\u0964","Hoc semper mihi accidit; nemo vere me circumtulit vult.","Mi succede sempre; nessuno vuole davvero che io sia vicino.","\u0627\u06cc\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0631\u0627\u06cc \u0645\u0646 \u0627\u062a\u0641\u0627\u0642 \u0645\u06cc\u200c\u0627\u0641\u062a\u062f\u061b \u0647\u06cc\u0686\u200c\u06a9\u0633 \u0648\u0627\u0642\u0639\u0627\u064b \u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u062f \u0645\u0646 \u062f\u0648\u0631 \u0648 \u0628\u0631\u0634\u0627\u0646 \u0628\u0627\u0634\u0645."],t.w)
