B.a9o=new A.d(B.c,["This proves my work and I are not worth much.","Esto demuestra que mi trabajo y yo no valemos mucho.","Das beweist, dass meine Arbeit und ich nicht viel wert sind.","Cela prouve que mon travail et moi ne valons pas grand-chose.","\u0647\u0630\u0627 \u064a\u062b\u0628\u062a \u0623\u0646 \u0639\u0645\u0644\u064a \u0648\u0623\u0646\u0627 \u0644\u0627 \u0646\u0633\u0627\u0648\u064a \u0627\u0644\u0643\u062b\u064a\u0631.","\uc774\uac83\uc740 \ub0b4 \uc791\uc5c5\uacfc \ub0b4\uac00 \uadf8\ub2e4\uc9c0 \uac00\uce58\uac00 \uc5c6\ub2e4\ub294 \uac83\uc744 \uc99d\uba85\ud569\ub2c8\ub2e4.","\u8fd9\u8bc1\u660e\u6211\u7684\u5de5\u4f5c\u548c\u6211\u4e0d\u503c\u4ec0\u4e48\u3002","\u092f\u0939 \u0938\u093e\u092c\u093f\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u093e \u0915\u093e\u092e \u0914\u0930 \u092e\u0948\u0902 \u091c\u094d\u092f\u093e\u0926\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0939\u0948\u0902\u0964","Hoc probat opus meum et me nihil magni esse.","Questo dimostra che il mio lavoro e io non valiamo molto.","\u0627\u06cc\u0646 \u062b\u0627\u0628\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u06a9\u0647 \u06a9\u0627\u0631 \u0645\u0646 \u0648 \u0645\u0646 \u0627\u0631\u0632\u0634 \u0632\u06cc\u0627\u062f\u06cc \u0646\u062f\u0627\u0631\u06cc\u0645."],t.w)
