B.aff=new A.d(B.c,["I should delete everything I post and never share again.","Deber\xeda eliminar todo lo que publique y no compartir nunca m\xe1s.","Ich sollte alles l\xf6schen, was ich poste, und nie wieder etwas teilen.","Je devrais supprimer tout ce que je publie et ne plus jamais rien partager.","\u064a\u062c\u0628 \u0623\u0646 \u0623\u062d\u0630\u0641 \u0643\u0644 \u0634\u064a\u0621 \u0623\u0646\u0634\u0631\u0647 \u0648\u0623\u0644\u0627 \u0623\u0634\u0627\u0631\u0643 \u0623\u0628\u062f\u064b\u0627 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\ub0b4\uac00 \uac8c\uc2dc\ud55c \ubaa8\ub4e0 \uac83\uc744 \uc0ad\uc81c\ud558\uace0 \ub2e4\uc2dc\ub294 \uacf5\uc720\ud558\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4.","\u6211\u5e94\u8be5\u5220\u9664\u6240\u6709\u53d1\u5e03\u7684\u5185\u5bb9\uff0c\u5e76\u4e14\u518d\u4e5f\u4e0d\u5206\u4eab\u4e86\u3002","\u092e\u0941\u091d\u0947 \u091c\u094b \u0915\u0941\u091b \u092d\u0940 \u092a\u094b\u0938\u094d\u091f \u0915\u093f\u092f\u093e \u0939\u0948 \u0909\u0938\u0947 \u0938\u092c \u0939\u091f\u093e \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f \u0914\u0930 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0938\u093e\u091d\u093e \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Omnia quae pono delere debeo et numquam iterum communicare.","Dovrei eliminare tutto ci\xf2 che pubblico e non condividere mai pi\xf9.","\u0628\u0627\u06cc\u062f \u062a\u0645\u0627\u0645 \u0622\u0646\u0686\u0647 \u0631\u0627 \u06a9\u0647 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0631\u062f\u0647\u200c\u0627\u0645 \u062d\u0630\u0641 \u06a9\u0646\u0645 \u0648 \u062f\u06cc\u06af\u0631 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0628\u0647 \u0627\u0634\u062a\u0631\u0627\u06a9 \u0646\u06af\u0630\u0627\u0631\u0645."],t.w)
