B.ae8=new A.d(B.c,["Equating likes with worth is a distortion. Algorithms, timing, and randomness play a huge role. Your value is not the same as the metrics.","Equivaler los \u201cme gusta\u201d con el valor es una distorsi\xf3n. Los algoritmos, el tiempo y la aleatoriedad juegan un papel muy importante. Tu valor no es lo mismo que las m\xe9tricas.","Das Gleiche von Likes und Wert ist eine Verzerrung. Algorithmen, Timing und Zufall spielen eine gro\xdfe Rolle. Dein Wert ist nicht dasselbe wie die Metriken.","\xc9quivaloir les \"j'aime\" \xe0 la valeur est une distorsion. Les algorithmes, le timing et le hasard jouent un grand r\xf4le. Ta valeur n'est pas la m\xeame que les m\xe9triques.","\u0645\u0633\u0627\u0648\u0627\u0629 \u0627\u0644\u0625\u0639\u062c\u0627\u0628\u0627\u062a \u0628\u0627\u0644\u0642\u064a\u0645\u0629 \u0647\u064a \u062a\u0634\u0648\u064a\u0647. \u062a\u0644\u0639\u0628 \u0627\u0644\u062e\u0648\u0627\u0631\u0632\u0645\u064a\u0627\u062a \u0648\u0627\u0644\u062a\u0648\u0642\u064a\u062a \u0648\u0627\u0644\u0635\u062f\u0641\u0629 \u062f\u0648\u0631\u064b\u0627 \u0643\u0628\u064a\u0631\u064b\u0627. \u0642\u064a\u0645\u062a\u0643 \u0644\u064a\u0633\u062a \u0647\u064a \u0646\u0641\u0633\u0647\u0627 \u0643\u0645\u0627 \u0641\u064a \u0627\u0644\u0645\u0642\u0627\u064a\u064a\u0633.","\uc88b\uc544\uc694\ub97c \uac00\uce58\uc640 \ub3d9\uc77c\uc2dc\ud558\ub294 \uac83\uc740 \uc65c\uace1\uc785\ub2c8\ub2e4. \uc54c\uace0\ub9ac\uc998, \ud0c0\uc774\ubc0d \ubc0f \ubb34\uc791\uc704\uc131\uc774 \uc911\uc694\ud55c \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. \ub2f9\uc2e0\uc758 \uac00\uce58\ub294 \uba54\ud2b8\ub9ad\uacfc \ub3d9\uc77c\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.","\u5c06\u70b9\u8d5e\u7b49\u540c\u4e8e\u4ef7\u503c\u662f\u79cd\u626d\u66f2\u3002\u7b97\u6cd5\u3001\u65f6\u673a\u548c\u968f\u673a\u6027\u8d77\u7740\u5de8\u5927\u7684\u4f5c\u7528\u3002\u4f60\u7684\u4ef7\u503c\u4e0d\u7b49\u4e8e\u8fd9\u4e9b\u5ea6\u91cf\u6807\u51c6\u3002","\u0932\u093e\u0907\u0915\u094d\u0938 \u0915\u094b \u092e\u0942\u0932\u094d\u092f \u0938\u0947 \u0938\u092e\u093e\u0928 \u092e\u093e\u0928\u0928\u093e \u090f\u0915 \u0935\u093f\u0915\u0943\u0924\u093f \u0939\u0948\u0964 \u090f\u0932\u094d\u0917\u094b\u0930\u093f\u0926\u092e, \u0938\u092e\u092f \u0914\u0930 \u092f\u093e\u0926\u0943\u091a\u094d\u091b\u093f\u0915\u0924\u093e \u090f\u0915 \u092c\u0921\u093c\u093e \u092d\u0942\u092e\u093f\u0915\u093e \u0928\u093f\u092d\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u093e \u092e\u0942\u0932\u094d\u092f \u092e\u0940\u091f\u094d\u0930\u093f\u0915 \u0938\u0947 \u0905\u0932\u0917 \u0939\u0948\u0964","Aequatio benevolentiae cum valore est distorsio. Algorithmi, tempus et casus magni momenti agunt. Tuum valor non est idem ac metrica.",'Eguagliare i "mi piace" con il valore \xe8 una distorsione. Gli algoritmi, il tempismo e la casualit\xe0 giocano un ruolo fondamentale. Il tuo valore non \xe8 lo stesso delle metriche.',"\u0645\u0633\u0627\u0648\u06cc \u06a9\u0631\u062f\u0646 \u0644\u0627\u06cc\u06a9\u200c\u0647\u0627 \u0628\u0627 \u0627\u0631\u0632\u0634 \u06cc\u06a9 \u062a\u062d\u0631\u06cc\u0641 \u0627\u0633\u062a. \u0627\u0644\u06af\u0648\u0631\u06cc\u062a\u0645\u200c\u0647\u0627\u060c \u0632\u0645\u0627\u0646\u200c\u0628\u0646\u062f\u06cc \u0648 \u062a\u0635\u0627\u062f\u0641 \u0646\u0642\u0634 \u0628\u0632\u0631\u06af\u06cc \u062f\u0627\u0631\u0646\u062f. \u0627\u0631\u0632\u0634 \u0634\u0645\u0627 \u0647\u0645\u0627\u0646\u0646\u062f \u0645\u0639\u06cc\u0627\u0631\u0647\u0627 \u0646\u06cc\u0633\u062a."],t.w)
