B.ae4=new A.d(B.c,["They must think I am a complete disaster.","Deben pensar que soy un desastre completo.","Sie m\xfcssen denken, dass ich ein v\xf6lliges Desaster bin.","Ils doivent penser que je suis un d\xe9sastre complet.","\u0644\u0627 \u0628\u062f \u0623\u0646\u0647\u0645 \u064a\u0639\u062a\u0642\u062f\u0648\u0646 \u0623\u0646\u0646\u064a \u0643\u0627\u0631\u062b\u0629 \u0643\u0627\u0645\u0644\u0629.","\uadf8\ub4e4\uc740 \ub0b4\uac00 \uc644\uc804\ud55c \uc7ac\uc559\uc774\ub77c\uace0 \uc0dd\uac01\ud574\uc57c \ud55c\ub2e4.","\u4ed6\u4eec\u4e00\u5b9a\u8ba4\u4e3a\u6211\u662f\u4e2a\u5f7b\u5e95\u7684\u707e\u96be\u3002","\u0909\u0928\u094d\u0939\u0947\u0902 \u091c\u0930\u0942\u0930 \u0932\u0917\u0924\u093e \u0939\u094b\u0917\u093e \u0915\u093f \u092e\u0948\u0902 \u090f\u0915 \u092a\u0942\u0930\u093e \u0906\u092a\u0926\u093e \u0939\u0942\u0902\u0964","Debent putare me esse totum cladem.","Devono pensare che sono un disastro completo.","\u0622\u0646\u200c\u0647\u0627 \u0628\u0627\u06cc\u062f \u0641\u06a9\u0631 \u06a9\u0646\u0646\u062f \u06a9\u0647 \u0645\u0646 \u06cc\u06a9 \u0641\u0627\u062c\u0639\u0647 \u06a9\u0627\u0645\u0644 \u0647\u0633\u062a\u0645."],t.w)
