B.abL=new A.d(B.c,["My choices are clearly wrong; I should let others decide everything for me.","Mis decisiones claramente son equivocadas; deber\xeda dejar que otros decidan todo por m\xed.","Meine Entscheidungen sind eindeutig falsch; ich sollte andere alles f\xfcr mich entscheiden lassen.","Mes choix sont clairement mauvais ; je devrais laisser les autres d\xe9cider de tout pour moi.","\u0627\u062e\u062a\u064a\u0627\u0631\u0627\u062a\u064a \u0648\u0627\u0636\u062d\u0629 \u0623\u0646\u0647\u0627 \u062e\u0627\u0637\u0626\u0629\u061b \u064a\u062c\u0628 \u0639\u0644\u064a \u0623\u0646 \u0623\u062f\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u064a\u0642\u0631\u0631\u0648\u0646 \u0643\u0644 \u0634\u064a\u0621 \u0644\u064a.","\ub0b4 \uc120\ud0dd\uc740 \ubd84\uba85\ud788 \uc798\ubabb\ub410\ub2e4; \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc774 \ub098\ub97c \ub300\uc2e0\ud574\uc11c \ubaa8\ub4e0 \uac83\uc744 \uacb0\uc815\ud558\uac8c \ud574\uc57c \ud55c\ub2e4.","\u6211\u7684\u9009\u62e9\u663e\u7136\u662f\u9519\u8bef\u7684\uff1b\u6211\u5e94\u8be5\u8ba9\u522b\u4eba\u4e3a\u6211\u51b3\u5b9a\u4e00\u5207\u3002","\u092e\u0947\u0930\u0947 \u0935\u093f\u0915\u0932\u094d\u092a \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0942\u092a \u0938\u0947 \u0917\u0932\u0924 \u0939\u0948\u0902; \u092e\u0941\u091d\u0947 \u0926\u0942\u0938\u0930\u094b\u0902 \u0915\u094b \u092e\u0947\u0930\u0947 \u0932\u093f\u090f \u0938\u092c \u0915\u0941\u091b \u0924\u092f \u0915\u0930\u0928\u0947 \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Mea electio clara sunt falsa; alios sinere omnia pro me decernere debeo.","Le mie scelte sono chiaramente sbagliate; dovrei lasciare che gli altri decidano tutto per me.","\u0627\u0646\u062a\u062e\u0627\u0628\u200c\u0647\u0627\u06cc \u0645\u0646 \u0642\u0637\u0639\u0627\u064b \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0633\u062a\u061b \u0628\u0627\u06cc\u062f \u0627\u062c\u0627\u0632\u0647 \u062f\u0647\u0645 \u062f\u06cc\u06af\u0631\u0627\u0646 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0628\u0631\u0627\u06cc \u0645\u0646 \u062a\u0635\u0645\u06cc\u0645 \u0628\u06af\u06cc\u0631\u0646\u062f."],t.w)
