B.aed=new A.d(B.c,["One vague comment does not define your entire path. Our brains can magnify criticism, especially from family, beyond what was actually said or meant.","Un comentario vago no define todo tu camino. Nuestros cerebros pueden magnificar la cr\xedtica, especialmente de la familia, m\xe1s all\xe1 de lo que realmente se dijo o signific\xf3.","Ein vages Kommentar definiert nicht deinen gesamten Weg. Unser Gehirn kann Kritik vergr\xf6\xdfern, besonders von der Familie, \xfcber das, was tats\xe4chlich gesagt oder gemeint war.","Un commentaire vague ne d\xe9finit pas tout ton parcours. Nos cerveaux peuvent amplifier la critique, surtout de la part de la famille, au-del\xe0 de ce qui a r\xe9ellement \xe9t\xe9 dit ou voulu.","\u062a\u0639\u0644\u064a\u0642 \u063a\u0627\u0645\u0636 \u0644\u0627 \u064a\u062d\u062f\u062f \u0645\u0633\u0627\u0631\u0643 \u0628\u0627\u0644\u0643\u0627\u0645\u0644. \u0639\u0642\u0648\u0644\u0646\u0627 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0643\u0628\u0631 \u0627\u0644\u0627\u0646\u062a\u0642\u0627\u062f\u0627\u062a\u060c \u0648\u062e\u0627\u0635\u0629 \u0645\u0646 \u0627\u0644\u0623\u0633\u0631\u0629\u060c \u0623\u0643\u062b\u0631 \u0645\u0645\u0627 \u0642\u064a\u0644 \u0641\u0639\u0644\u0627\u064b \u0623\u0648 \u0645\u0627 \u0643\u0627\u0646 \u064a\u0639\u0646\u064a\u0647.","\uc560\ub9e4\ud55c \ud55c \ub9c8\ub514\ub294 \ub2f9\uc2e0\uc758 \uc804\uccb4 \uacbd\ub85c\ub97c \uc815\uc758\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uc6b0\ub9ac\uc758 \ub1cc\ub294 \ube44\ud310\uc744 \uacfc\uc7a5\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4, \ud2b9\ud788 \uac00\uc871\uc73c\ub85c\ubd80\ud130\uc758 \ube44\ud310\uc740 \uc2e4\uc81c\ub85c \ub9d0\ud574\uc84c\uac70\ub098 \uc758\ub3c4\ud55c \uac83 \uc774\uc0c1\uc758 \uac83\uc785\ub2c8\ub2e4.","\u4e00\u4e2a\u6a21\u7cca\u7684\u8bc4\u8bba\u4e0d\u80fd\u5b9a\u4e49\u4f60\u7684\u4eba\u751f\u9053\u8def\u3002\u6211\u4eec\u7684\u8111\u888b\u80fd\u591f\u5938\u5927\u6279\u8bc4\uff0c\u7279\u522b\u662f\u6765\u81ea\u5bb6\u5ead\u7684\u6279\u8bc4\uff0c\u8d85\u8fc7\u4e86\u5b9e\u9645\u8bf4\u8fc7\u7684\u6216\u610f\u5473\u7740\u4ec0\u4e48\u3002","\u090f\u0915 \u0905\u0938\u094d\u092a\u0937\u094d\u091f \u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u0906\u092a\u0915\u0947 \u092a\u0942\u0930\u0947 \u092e\u093e\u0930\u094d\u0917 \u0915\u094b \u092a\u0930\u093f\u092d\u093e\u0937\u093f\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0940\u0964 \u0939\u092e\u093e\u0930\u093e \u092e\u0938\u094d\u0924\u093f\u0937\u094d\u0915 \u0906\u0932\u094b\u091a\u0928\u093e \u0915\u094b \u092c\u0922\u093c\u093e \u0938\u0915\u0924\u093e \u0939\u0948, \u0935\u093f\u0936\u0947\u0937 \u0930\u0942\u092a \u0938\u0947 \u092a\u0930\u093f\u0935\u093e\u0930 \u0938\u0947, \u091c\u094b \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0915\u0939\u093e \u0917\u092f\u093e \u0925\u093e \u092f\u093e \u091c\u094b \u092e\u0924\u0932\u092c \u0925\u093e \u0909\u0938\u0938\u0947 \u0905\u0927\u093f\u0915\u0964","Unum commentarium vage non definit totam viam tuam. Cerebra nostra possunt augere criticam, praesertim a familia, ultra id quod vere dictum aut sensum fuit.","Un commento vago non definisce tutto il tuo cammino. I nostri cervelli possono amplificare la critica, soprattutto dalla famiglia, oltre ci\xf2 che \xe8 stato effettivamente detto o inteso.","\u06cc\u06a9 \u0646\u0638\u0631 \u0645\u0628\u0647\u0645 \u0645\u0633\u06cc\u0631 \u0632\u0646\u062f\u06af\u06cc \u0634\u0645\u0627 \u0631\u0627 \u06a9\u0627\u0645\u0644 \u062a\u0639\u0631\u06cc\u0641 \u0646\u0645\u06cc\u200c\u06a9\u0646\u062f. \u0645\u063a\u0632\u0647\u0627\u06cc \u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0627\u0646\u062a\u0642\u0627\u062f \u0631\u0627 \u0628\u0632\u0631\u06af\u062a\u0631 \u06a9\u0646\u0646\u062f\u060c \u0628\u0647 \u0648\u06cc\u0698\u0647 \u0627\u0632 \u062e\u0627\u0646\u0648\u0627\u062f\u0647\u060c \u0641\u0631\u0627\u062a\u0631 \u0627\u0632 \u0622\u0646\u0686\u0647 \u06a9\u0647 \u062f\u0631 \u0648\u0627\u0642\u0639 \u06af\u0641\u062a\u0647 \u0634\u062f\u0647 \u06cc\u0627 \u0645\u0646\u0638\u0648\u0631 \u0628\u0648\u062f\u0647 \u0627\u0633\u062a."],t.w)
