B.adX=new A.d(B.c,["The almost-finished project","El proyecto casi terminado","Das fast fertige Projekt","Le projet presque termin\xe9","\u0627\u0644\u0645\u0634\u0631\u0648\u0639 \u0634\u0628\u0647 \u0627\u0644\u0645\u0646\u062a\u0647\u064a","\uac70\uc758 \ub05d\ub09c \ud504\ub85c\uc81d\ud2b8","\u51e0\u4e4e\u5b8c\u6210\u7684\u9879\u76ee","\u0932\u0917\u092d\u0917 \u0938\u092e\u093e\u092a\u094d\u0924 \u092a\u0930\u093f\u092f\u094b\u091c\u0928\u093e","Fere confectus inceptum","Il progetto quasi finito","\u067e\u0631\u0648\u0698\u0647 \u062a\u0642\u0631\u06cc\u0628\u0627\u064b \u062a\u0645\u0627\u0645 \u0634\u062f\u0647"],t.w)
B.a98=new A.d(B.c,["Your desk is scattered with notes, your project 80% done. All you can see now are the rough edges and small mistakes. A voice says: \u201cIf it is not perfect, it is trash.\u201d","Tu escritorio est\xe1 lleno de notas, tu proyecto est\xe1 al 80%. Ahora solo puedes ver los bordes rugosos y peque\xf1os errores. Una voz dice: \u201cSi no es perfecto, es basura.\u201d","Dein Schreibtisch ist voller Notizen, dein Projekt ist zu 80% fertig. Alles, was du jetzt siehst, sind die groben Kanten und kleinen Fehler. Eine Stimme sagt: \u201eWenn es nicht perfekt ist, ist es M\xfcll.\u201c","Ton bureau est rempli de notes, ton projet est termin\xe9 \xe0 80%. Tout ce que tu vois maintenant ce sont les bords rugueux et les petites erreurs. Une voix dit : \u201cSi ce n'est pas parfait, c'est de la poubelle.\u201d",'\u0645\u0643\u062a\u0628\u0643 \u0645\u0644\u064a\u0621 \u0628\u0627\u0644\u0645\u0644\u0627\u062d\u0638\u0627\u062a\u060c \u0645\u0634\u0631\u0648\u0639\u0643 \u0645\u0643\u062a\u0645\u0644 \u0628\u0646\u0633\u0628\u0629 80%. \u0643\u0644 \u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u0631\u0624\u064a\u062a\u0647 \u0627\u0644\u0622\u0646 \u0647\u0648 \u0627\u0644\u062d\u0648\u0627\u0641 \u0627\u0644\u062e\u0634\u0646\u0629 \u0648\u0627\u0644\u0623\u062e\u0637\u0627\u0621 \u0627\u0644\u0635\u063a\u064a\u0631\u0629. \u064a\u0642\u0648\u0644 \u0635\u0648\u062a: "\u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0645\u062b\u0627\u0644\u064a\u0627\u064b\u060c \u0641\u0647\u0648 \u0645\u062c\u0631\u062f \u0642\u0645\u0627\u0645\u0629".','\ucc45\uc0c1\uc5d0\ub294 \uba54\ubaa8\uac00 \ud769\uc5b4\uc838 \uc788\uace0, \ud504\ub85c\uc81d\ud2b8\ub294 80% \uc644\ub8cc\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc9c0\uae08 \ubcf4\uc774\ub294 \uac83\uc740 \uac70\uce5c \uac00\uc7a5\uc790\ub9ac \uc640 \uc791\uc740 \uc2e4\uc218\ub4e4\ubfd0\uc785\ub2c8\ub2e4. \ud55c \ubaa9\uc18c\ub9ac\uac00 \ub9d0\ud569\ub2c8\ub2e4: "\uc644\ubcbd\ud558\uc9c0 \uc54a\uc73c\uba74 \uc4f0\ub808\uae30\uc57c."',"\u4f60\u7684\u684c\u5b50\u4e0a\u6563\u843d\u7740\u7b14\u8bb0\uff0c\u9879\u76ee\u5b8c\u6210\u4e8680%\u3002\u73b0\u5728\u4f60\u770b\u5230\u7684\u53ea\u6709\u7c97\u7cd9\u7684\u8fb9\u7f18\u548c\u4e00\u4e9b\u5c0f\u9519\u8bef\u3002\u6709\u4e2a\u58f0\u97f3\u8bf4\uff1a\u201c\u5982\u679c\u4e0d\u5b8c\u7f8e\uff0c\u90a3\u5c31\u662f\u5783\u573e\u3002\u201d",'\u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u092e\u0947\u091c \u092a\u0930 \u0928\u094b\u091f\u094d\u0938 \u092c\u093f\u0916\u0930\u0947 \u0939\u0941\u090f \u0939\u0948\u0902, \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u093e \u092a\u094d\u0930\u094b\u091c\u0947\u0915\u094d\u091f 80% \u092a\u0942\u0930\u093e \u0939\u094b \u091a\u0941\u0915\u093e \u0939\u0948\u0964 \u0905\u092c \u0924\u0941\u092e \u0915\u0947\u0935\u0932 \u0916\u0941\u0930\u0926\u0930\u0947 \u0915\u093f\u0928\u093e\u0930\u0947 \u0914\u0930 \u091b\u094b\u091f\u0940-\u091b\u094b\u091f\u0940 \u0917\u0932\u0924\u093f\u092f\u093e\u0901 \u0939\u0940 \u0926\u0947\u0916 \u0938\u0915\u0924\u0947 \u0939\u094b\u0964 \u090f\u0915 \u0906\u0935\u093e\u091c \u0915\u0939\u0924\u0940 \u0939\u0948: "\u0905\u0917\u0930 \u092f\u0939 \u092a\u0930\u092b\u0947\u0915\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u092f\u0939 \u0915\u091a\u0930\u093e \u0939\u0948\u0964"','Mensa tua plena est notis, inceptum tuum 80% perfectum est. Nunc omnia quae vides sunt rudia margines et minimi errores. Vox dicit: "Si non perfectum est, est immunditia."','La tua scrivania \xe8 piena di appunti, il tuo progetto \xe8 completato all\'80%. Ora vedi solo gli angoli grezzi e piccoli errori. Una voce dice: "Se non \xe8 perfetto, \xe8 spazzatura."','\u0645\u06cc\u0632 \u0634\u0645\u0627 \u067e\u0631 \u0627\u0632 \u06cc\u0627\u062f\u062f\u0627\u0634\u062a\u200c\u0647\u0627 \u0627\u0633\u062a\u060c \u067e\u0631\u0648\u0698\u0647\u200c\u062a\u0627\u0646 80% \u062a\u06a9\u0645\u06cc\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0627\u06a9\u0646\u0648\u0646 \u062a\u0646\u0647\u0627 \u06af\u0648\u0634\u0647\u200c\u0647\u0627\u06cc \u0632\u0628\u0631 \u0648 \u0627\u0634\u062a\u0628\u0627\u0647\u0627\u062a \u06a9\u0648\u0686\u06a9 \u0631\u0627 \u0645\u06cc\u200c\u0628\u06cc\u0646\u06cc\u062f. \u0635\u062f\u0627\u06cc\u06cc \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f: "\u0627\u06af\u0631 \u06a9\u0627\u0645\u0644 \u0646\u06cc\u0633\u062a\u060c \u067e\u0633 \u0622\u0634\u063a\u0627\u0644 \u0627\u0633\u062a."'],t.w)
B.a7I=new A.d(B.c,["If it is not perfect, there is no point finishing it.","Si no es perfecto, no tiene sentido terminarlo.","Wenn es nicht perfekt ist, hat es keinen Sinn, es zu beenden.","Si ce n'est pas parfait, cela ne sert \xe0 rien de le finir.","\u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0645\u062b\u0627\u0644\u064a\u0627\u064b\u060c \u0641\u0644\u0627 \u0641\u0627\u0626\u062f\u0629 \u0645\u0646 \u0625\u062a\u0645\u0627\u0645\u0647.","\uc644\ubcbd\ud558\uc9c0 \uc54a\ub2e4\uba74 \ub05d\ub0b4\ub294 \uc758\ubbf8\uac00 \uc5c6\ub2e4.","\u5982\u679c\u4e0d\u5b8c\u7f8e\uff0c\u90a3\u5c31\u6ca1\u6709\u5b8c\u6210\u7684\u610f\u4e49\u3002","\u0905\u0917\u0930 \u092f\u0939 \u092a\u0930\u092b\u0947\u0915\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u0907\u0938\u0947 \u0916\u0924\u094d\u092e \u0915\u0930\u0928\u0947 \u0915\u093e \u0915\u094b\u0908 \u092e\u0924\u0932\u092c \u0928\u0939\u0940\u0902 \u0939\u0948\u0964","Si non perfectum est, nullum sensum habet finire.","Se non \xe8 perfetto, non ha senso finirlo.","\u0627\u06af\u0631 \u06a9\u0627\u0645\u0644 \u0646\u06cc\u0633\u062a\u060c \u062a\u0645\u0627\u0645 \u06a9\u0631\u062f\u0646\u0634 \u0647\u06cc\u0686 \u0641\u0627\u06cc\u062f\u0647\u200c\u0627\u06cc \u0646\u062f\u0627\u0631\u062f."],t.w)
