B.aaq=new A.d(B.c,["It can be \u201cgood enough\u201d for now, and I can improve it later instead of erasing everything.",'Puede ser "suficientemente bueno" por ahora, y puedo mejorarlo m\xe1s tarde en lugar de borrar todo.',"Es kann f\xfcr jetzt \u201egut genug\u201c sein, und ich kann es sp\xe4ter verbessern, anstatt alles zu l\xf6schen.",'Cela peut \xeatre "assez bon" pour le moment, et je peux l\'am\xe9liorer plus tard au lieu de tout effacer.','\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 "\u062c\u064a\u062f\u064b\u0627 \u0628\u0645\u0627 \u0641\u064a\u0647 \u0627\u0644\u0643\u0641\u0627\u064a\u0629" \u0627\u0644\u0622\u0646\u060c \u0648\u064a\u0645\u0643\u0646\u0646\u064a \u062a\u062d\u0633\u064a\u0646\u0647 \u0644\u0627\u062d\u0642\u064b\u0627 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0645\u0633\u062d \u0643\u0644 \u0634\u064a\u0621.','\uc9c0\uae08\uc740 "\ucda9\ubd84\ud788 \uad1c\ucc2e\uc740" \uac83\uc73c\ub85c, \ub098\uc911\uc5d0 \ubaa8\ub4e0 \uac83\uc744 \uc9c0\uc6b0\ub294 \ub300\uc2e0 \uac1c\uc120\ud560 \uc218 \uc788\ub2e4.',"\u73b0\u5728\u5b83\u53ef\u4ee5\u201c\u8db3\u591f\u597d\u201d\uff0c\u6211\u53ef\u4ee5\u7a0d\u540e\u6539\u8fdb\u5b83\uff0c\u800c\u4e0d\u662f\u62b9\u6389\u4e00\u5207\u3002",'\u092f\u0939 \u0905\u092c \u0915\u0947 \u0932\u093f\u090f "\u0915\u093e\u092b\u0940 \u0905\u091a\u094d\u091b\u093e" \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948, \u0914\u0930 \u092e\u0948\u0902 \u0907\u0938\u0947 \u092c\u093e\u0926 \u092e\u0947\u0902 \u0938\u0941\u0927\u093e\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0902, \u0938\u092c \u0915\u0941\u091b \u092e\u093f\u091f\u093e\u0928\u0947 \u0915\u0947 \u092c\u091c\u093e\u092f\u0964','Hoc potest esse "satis bonum" nunc, et postea meliorem facere potero, potius quam omnia delere.','Pu\xf2 essere "abbastanza buono" per ora, e posso migliorarne in seguito invece di cancellare tutto.','\u0627\u06cc\u0646 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0628\u0631\u0627\u06cc \u062d\u0627\u0644\u0627 "\u06a9\u0627\u0641\u06cc \u062e\u0648\u0628" \u0628\u0627\u0634\u062f \u0648 \u0645\u0646 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0628\u0639\u062f\u0627\u064b \u0622\u0646 \u0631\u0627 \u0628\u0647\u0628\u0648\u062f \u0628\u062e\u0634\u0645\u060c \u0628\u0647 \u062c\u0627\u06cc \u0627\u06cc\u0646\u06a9\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u067e\u0627\u06a9 \u06a9\u0646\u0645.'],t.w)
