B.ac8=new A.d(B.c,["I should never start any projects again.","Nunca deber\xeda comenzar proyectos nuevamente.","Ich sollte nie wieder Projekte anfangen.","Je ne devrais jamais recommencer de projets.","\u064a\u062c\u0628 \u0623\u0644\u0627 \u0623\u0628\u062f\u0623 \u0623\u064a \u0645\u0634\u0627\u0631\u064a\u0639 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\ub2e4\uc2dc\ub294 \ud504\ub85c\uc81d\ud2b8\ub97c \uc2dc\uc791\ud558\uc9c0 \ub9d0\uc544\uc57c \ud55c\ub2e4.","\u6211\u518d\u4e5f\u4e0d\u5e94\u8be5\u5f00\u59cb\u4efb\u4f55\u9879\u76ee\u3002","\u092e\u0941\u091d\u0947 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0915\u094b\u0908 \u092a\u0930\u093f\u092f\u094b\u091c\u0928\u093e \u0936\u0941\u0930\u0942 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964","Numquam iterum incepta incipere debeo.","Non dovrei mai pi\xf9 iniziare progetti.","\u0646\u0628\u0627\u06cc\u062f \u0647\u06cc\u0686 \u067e\u0631\u0648\u0698\u0647\u200c\u0627\u06cc \u0631\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u0634\u0631\u0648\u0639 \u06a9\u0646\u0645."],t.w)
