B.abK=new A.d(B.c,["Perfectionistic thinking says \u201cperfect or worthless.\u201d A more helpful approach allows for good-enough work and iterating over time.",'El pensamiento perfeccionista dice \u201cperfecto o in\xfatil\u201d. Un enfoque m\xe1s \xfatil permite un trabajo "suficientemente bueno" y mejorar con el tiempo.',"Perfektionistisches Denken sagt \u201eperfekt oder wertlos\u201c. Ein hilfreicherer Ansatz erlaubt \u201egut genug\u201c Arbeit und das Iterieren im Laufe der Zeit.",'La pens\xe9e perfectionniste dit \u201cparfait ou inutile\u201d. Une approche plus utile permet un travail "assez bon" et l\'it\xe9ration au fil du temps.','\u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0627\u0644\u0645\u062b\u0627\u0644\u064a \u064a\u0642\u0648\u0644 "\u0645\u062b\u0627\u0644\u064a \u0623\u0648 \u0644\u0627 \u0642\u064a\u0645\u0629 \u0644\u0647". \u0646\u0647\u062c \u0623\u0643\u062b\u0631 \u0641\u0627\u0626\u062f\u0629 \u064a\u0633\u0645\u062d \u0628\u0627\u0644\u0639\u0645\u0644 "\u0627\u0644\u062c\u064a\u062f \u0628\u0645\u0627 \u0641\u064a\u0647 \u0627\u0644\u0643\u0641\u0627\u064a\u0629" \u0648\u0627\u0644\u062a\u062d\u0633\u064a\u0646 \u0628\u0645\u0631\u0648\u0631 \u0627\u0644\u0648\u0642\u062a.','\uc644\ubcbd\uc8fc\uc758\uc801 \uc0ac\uace0\ub294 "\uc644\ubcbd\ud558\uac70\ub098 \uac00\uce58 \uc5c6\uc74c"\uc774\ub77c\uace0 \ub9d0\ud569\ub2c8\ub2e4. \ub354 \uc720\uc6a9\ud55c \uc811\uadfc\ubc95\uc740 "\ucda9\ubd84\ud788 \uad1c\ucc2e\uc740" \uc791\uc5c5\uacfc \uc2dc\uac04\uc5d0 \ub530\ub77c \ubc18\ubcf5\ud560 \uc218 \uc788\uac8c \ud569\ub2c8\ub2e4.',"\u5b8c\u7f8e\u4e3b\u4e49\u601d\u7ef4\u8bf4\u201c\u5b8c\u7f8e\u6216\u65e0\u4ef7\u503c\u201d\u3002\u4e00\u4e2a\u66f4\u6709\u5e2e\u52a9\u7684\u65b9\u6cd5\u662f\u5141\u8bb8\u201c\u8db3\u591f\u597d\u201d\u7684\u5de5\u4f5c\uff0c\u5e76\u968f\u7740\u65f6\u95f4\u63a8\u79fb\u9010\u6b65\u6539\u8fdb\u3002",'\u092a\u0942\u0930\u094d\u0923\u0924\u093e\u0935\u093e\u0926\u0940 \u0938\u094b\u091a \u0915\u0939\u0924\u0940 \u0939\u0948 "\u092a\u0930\u092b\u0947\u0915\u094d\u091f \u092f\u093e \u092c\u0947\u0915\u093e\u0930"\u0964 \u090f\u0915 \u0905\u0927\u093f\u0915 \u0938\u0939\u093e\u092f\u0915 \u0926\u0943\u0937\u094d\u091f\u093f\u0915\u094b\u0923 "\u0915\u093e\u092b\u0940 \u0905\u091a\u094d\u091b\u093e" \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0914\u0930 \u0938\u092e\u092f \u0915\u0947 \u0938\u093e\u0925 \u0909\u0938\u0947 \u0938\u0941\u0927\u093e\u0930\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0924\u093e \u0939\u0948\u0964','Cerebrum perfectionisticum dicit "perfectum aut indignum". Approximatio utilior permittit operam "satis bonam" et iterare tempore.','Il pensiero perfezionista dice \u201cperfetto o inutile\u201d. Un approccio pi\xf9 utile consente un lavoro "abbastanza buono" e di iterare nel tempo.','\u062a\u0641\u06a9\u0631 \u06a9\u0645\u0627\u0644\u200c\u06af\u0631\u0627\u06cc\u0627\u0646\u0647 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f "\u06a9\u0627\u0645\u0644 \u06cc\u0627 \u0628\u06cc\u200c\u0627\u0631\u0632\u0634". \u06cc\u06a9 \u0631\u0648\u06cc\u06a9\u0631\u062f \u0645\u0641\u06cc\u062f\u062a\u0631 \u0627\u062c\u0627\u0632\u0647 \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u06a9\u0627\u0631 "\u06a9\u0627\u0641\u06cc \u062e\u0648\u0628" \u0627\u0646\u062c\u0627\u0645 \u0634\u0648\u062f \u0648 \u0628\u0627 \u06af\u0630\u0631 \u0632\u0645\u0627\u0646 \u0628\u0647\u0628\u0648\u062f \u06cc\u0627\u0628\u062f.'],t.w)
