B.a7S=new A.d(B.c,["The tired mirror","El espejo cansado","Der m\xfcde Spiegel","Le miroir fatigu\xe9","\u0627\u0644\u0645\u0631\u0622\u0629 \u0627\u0644\u0645\u062a\u0639\u0628\u0629","\ud53c\uace4\ud55c \uac70\uc6b8","\u75b2\u60eb\u7684\u955c\u5b50","\u0925\u0915\u093e \u0939\u0941\u0906 \u0906\u0908\u0928\u093e","Speculum fessum","Lo specchio stanco","\u0622\u06cc\u0646\u0647 \u062e\u0633\u062a\u0647"],t.w)
B.a9G=new A.d(B.c,["Late at night, you pass a mirror on the way to bed. Your hair is messy, your eyes are tired, the light is harsh. A fast thought pops up: \u201cThis is how I always look. It is awful.\u201d","En la noche, pasas por un espejo en el camino a la cama. Tu cabello est\xe1 desordenado, tus ojos est\xe1n cansados, la luz es dura. Un pensamiento r\xe1pido aparece: \u201cAs\xed es como siempre me veo. Es horrible.\u201d","Sp\xe4t in der Nacht gehst du an einem Spiegel vorbei auf dem Weg ins Bett. Dein Haar ist zerzaust, deine Augen sind m\xfcde, das Licht ist hart. Ein schneller Gedanke kommt auf: \u201eSo sehe ich immer aus. Es ist schrecklich.\u201c","Tard dans la nuit, tu passes devant un miroir en allant te coucher. Tes cheveux sont en d\xe9sordre, tes yeux sont fatigu\xe9s, la lumi\xe8re est dure. Une pens\xe9e rapide traverse ton esprit : \u201cC\u2019est comme \xe7a que je ressemble toujours. C\u2019est affreux.\u201d",'\u0641\u064a \u0648\u0642\u062a \u0645\u062a\u0623\u062e\u0631 \u0645\u0646 \u0627\u0644\u0644\u064a\u0644\u060c \u062a\u0645\u0631 \u0628\u062c\u0627\u0646\u0628 \u0645\u0631\u0622\u0629 \u0641\u064a \u0637\u0631\u064a\u0642\u0643 \u0625\u0644\u0649 \u0627\u0644\u0633\u0631\u064a\u0631. \u0634\u0639\u0631\u0643 \u0641\u0648\u0636\u0648\u064a\u060c \u0648\u0639\u064a\u0646\u0643 \u0645\u062a\u0639\u0628\u062a\u0627\u0646\u060c \u0627\u0644\u0636\u0648\u0621 \u0642\u0627\u0633\u064a. \u0641\u0643\u0631 \u0633\u0631\u064a\u0639 \u064a\u0637\u0631\u0623: "\u0647\u0643\u0630\u0627 \u0623\u0628\u062f\u0648 \u062f\u0627\u0626\u0645\u064b\u0627. \u0625\u0646\u0647 \u0623\u0645\u0631 \u0641\u0638\u064a\u0639."','\ub2a6\uc740 \ubc24, \uce68\ub300\ub85c \uac00\ub294 \uae38\uc5d0 \uac70\uc6b8\uc744 \uc9c0\ub098\uce69\ub2c8\ub2e4. \uba38\ub9ac\ub294 \uc5c9\ub9dd\uc774\uace0, \ub208\uc740 \ud53c\uace4\ud558\uace0, \ube5b\uc740 \uac70\uce60\uc5b4\uc694. \ube60\ub978 \uc0dd\uac01\uc774 \ub5a0\uc624\ub985\ub2c8\ub2e4: "\uc774\uac8c \ub0b4\uac00 \ud56d\uc0c1 \uc5b4\ub5bb\uac8c \ubcf4\uc774\ub294\uc9c0. \ub054\ucc0d\ud574."',"\u6df1\u591c\uff0c\u4f60\u7ecf\u8fc7\u4e00\u9762\u955c\u5b50\u8d70\u5411\u5e8a\u94fa\u3002\u4f60\u7684\u5934\u53d1\u51cc\u4e71\uff0c\u773c\u775b\u75b2\u5026\uff0c\u5149\u7ebf\u523a\u773c\u3002 \u4e00\u4e2a\u5feb\u901f\u7684\u60f3\u6cd5\u51fa\u73b0\uff1a\u201c\u8fd9\u5c31\u662f\u6211\u603b\u662f\u770b\u8d77\u6765\u7684\u6837\u5b50\u3002\u592a\u53ef\u6015\u4e86\u3002\u201d",'\u0930\u093e\u0924 \u0915\u0947 \u0926\u0947\u0930 \u0938\u092e\u092f \u092e\u0947\u0902, \u0906\u092a \u092c\u093f\u0938\u094d\u0924\u0930 \u0915\u0940 \u0913\u0930 \u091c\u093e\u0924\u0947 \u0939\u0941\u090f \u090f\u0915 \u0906\u0908\u0928\u0947 \u0915\u0947 \u092a\u093e\u0938 \u0938\u0947 \u0917\u0941\u091c\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u093e \u092c\u093e\u0932 \u0905\u0938\u094d\u0924\u0935\u094d\u092f\u0938\u094d\u0924 \u0939\u0948, \u0906\u092a\u0915\u0940 \u0906\u0901\u0916\u0947\u0902 \u0925\u0915\u0940 \u0939\u0941\u0908 \u0939\u0948\u0902, \u0930\u094b\u0936\u0928\u0940 \u0924\u0947\u091c \u0939\u0948\u0964 \u090f\u0915 \u0924\u094d\u0935\u0930\u093f\u0924 \u0935\u093f\u091a\u093e\u0930 \u0906\u0924\u093e \u0939\u0948: "\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u0910\u0938\u093e \u0939\u0940 \u0926\u093f\u0916\u0924\u093e \u0939\u0942\u0901\u0964 \u092f\u0939 \u092d\u092f\u093e\u0928\u0915 \u0939\u0948\u0964"','Serpens vesperis, speculum transiens in via ad lectum. Capillus tuus turbatum est, oculi tui fatiguati sunt, lux acerba est. Celeres cogitationes emergunt: "Sic semper specto. Foedum est."','Tardi nella notte, passi davanti a uno specchio mentre vai a letto. I tuoi capelli sono disordinati, gli occhi sono stanchi, la luce \xe8 dura. Un pensiero veloce ti attraversa: "Ecco come appaio sempre. \xc8 terribile."','\u062f\u06cc\u0631 \u0634\u0628\u060c \u062f\u0631 \u0645\u0633\u06cc\u0631 \u062a\u062e\u062a \u062e\u0648\u0627\u0628 \u0627\u0632 \u06a9\u0646\u0627\u0631 \u06cc\u06a9 \u0622\u06cc\u0646\u0647 \u0645\u06cc\u200c\u06af\u0630\u0631\u06cc\u062f. \u0645\u0648\u0647\u0627\u06cc\u062a\u0627\u0646 \u0628\u0647 \u0647\u0645 \u0631\u06cc\u062e\u062a\u0647 \u0627\u0633\u062a\u060c \u0686\u0634\u0645\u0627\u0646\u062a\u0627\u0646 \u062e\u0633\u062a\u0647 \u0627\u0633\u062a\u060c \u0646\u0648\u0631 \u0634\u062f\u06cc\u062f \u0627\u0633\u062a. \u06cc\u06a9 \u0641\u06a9\u0631 \u0633\u0631\u06cc\u0639 \u0628\u0647 \u0630\u0647\u0646 \u0645\u06cc\u200c\u0631\u0633\u062f: "\u0627\u06cc\u0646\u0637\u0648\u0631 \u0647\u0645\u06cc\u0634\u0647 \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc\u200c\u0631\u0633\u0645. \u0627\u06cc\u0646 \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0627\u0633\u062a."'],t.w)
