B.ael=new A.d(B.c,["The friend who calls at 3 a.m.","El amigo que llama a las 3 a.m.","Der Freund, der um 3 Uhr morgens anruft.","L'ami qui appelle \xe0 3h du matin","\u0627\u0644\u0635\u062f\u064a\u0642 \u0627\u0644\u0630\u064a \u064a\u062a\u0635\u0644 \u0641\u064a \u0627\u0644\u0633\u0627\u0639\u0629 3 \u0635\u0628\u0627\u062d\u064b\u0627","\uc0c8\ubcbd 3\uc2dc\uc5d0 \uc804\ud654\ud558\ub294 \uce5c\uad6c","\u51cc\u66683\u70b9\u6253\u7535\u8bdd\u7684\u670b\u53cb","\u0935\u0939 \u092e\u093f\u0924\u094d\u0930 \u091c\u094b 3 \u092c\u091c\u0947 \u0915\u0949\u0932 \u0915\u0930\u0924\u093e \u0939\u0948","Amicus qui vocat ad 3 a.m.","L'amico che chiama alle 3 di mattina","\u062f\u0648\u0633\u062a\u06cc \u06a9\u0647 \u0633\u0627\u0639\u062a 3 \u0635\u0628\u062d \u062a\u0645\u0627\u0633 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f"],t.w)
B.a8_=new A.d(B.c,["You are exhausted and have school/work in the morning. A friend keeps calling late at night to vent.\nYou care about them, but your body is falling apart.\n\nWhich response respects both you and them?","Est\xe1s agotado y tienes escuela/trabajo por la ma\xf1ana. Un amigo sigue llamando tarde en la noche para desahogarse.\nTe importa, pero tu cuerpo se est\xe1 agotando.\n\n\xbfQu\xe9 respuesta respeta tanto a ti como a ellos?","Du bist ersch\xf6pft und hast am Morgen Schule/Arbeit. Ein Freund ruft die ganze Nacht an, um sich auszuweinen.\nDu k\xfcmmerst dich um ihn, aber dein K\xf6rper ist ersch\xf6pft.\n\nWelche Antwort respektiert sowohl dich als auch ihn?","Vous \xeates \xe9puis\xe9 et avez \xe9cole/travail le matin. Un ami continue de vous appeler tard la nuit pour se confier.\nVous tenez \xe0 lui, mais votre corps est en train de l\xe2cher.\n\nQuelle r\xe9ponse respecte \xe0 la fois vous et eux ?","\u0623\u0646\u062a \u0645\u0631\u0647\u0642 \u0648\u0644\u062f\u064a\u0643 \u0645\u062f\u0631\u0633\u0629/\u0639\u0645\u0644 \u0641\u064a \u0627\u0644\u0635\u0628\u0627\u062d. \u0635\u062f\u064a\u0642 \u064a\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0641\u064a \u0648\u0642\u062a \u0645\u062a\u0623\u062e\u0631 \u0645\u0646 \u0627\u0644\u0644\u064a\u0644 \u0644\u0644\u062a\u0646\u0641\u064a\u0633.\n\u062a\u0647\u062a\u0645 \u0628\u0647\u0645\u060c \u0644\u0643\u0646 \u062c\u0633\u062f\u0643 \u0641\u064a \u0637\u0631\u064a\u0642\u0647 \u0644\u0644\u062a\u0648\u0642\u0641.\n\n\u0623\u064a \u0631\u062f \u064a\u062d\u062a\u0631\u0645\u0643 \u0648\u064a\u062d\u062a\u0631\u0645\u0647\u0645\u061f","\ub2f9\uc2e0\uc740 \uc9c0\uccd0 \uc788\uace0 \uc544\uce68\uc5d0 \ud559\uad50/\uc77c\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uce5c\uad6c\ub294 \ubc24\ub2a6\uac8c \uacc4\uc18d \uc804\ud654\ud558\uc5ec \uc18d\uc0c1\ud55c \ub9c8\uc74c\uc744 \ud138\uc5b4\ub193\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\uadf8\ub4e4\uc744 \uac71\uc815\ud558\uc9c0\ub9cc, \ub2f9\uc2e0\uc758 \ubab8\uc740 \ubb34\ub108\uc838 \uac00\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\n\uc5b4\ub5a4 \ubc18\uc751\uc774 \ub2f9\uc2e0\uacfc \uadf8\ub4e4\uc744 \ubaa8\ub450 \uc874\uc911\ud560\uae4c\uc694?","\u4f60\u5f88\u7d2f\uff0c\u65e9\u4e0a\u6709\u5b66\u6821/\u5de5\u4f5c\u3002\u4e00\u4e2a\u670b\u53cb\u4e00\u76f4\u6253\u7535\u8bdd\u7ed9\u4f60\uff0c\u665a\u4e0a\u5f88\u665a\u624d\u63a5\u3002\n\u4f60\u5173\u5fc3\u4ed6\u4eec\uff0c\u4f46\u4f60\u7684\u8eab\u4f53\u5df2\u7ecf\u5d29\u6e83\u3002\n\n\u54ea\u4e2a\u56de\u5e94\u65e2\u5c0a\u91cd\u4f60\u4e5f\u5c0a\u91cd\u4ed6\u4eec\uff1f","\u0906\u092a \u0925\u0915\u0947 \u0939\u0941\u090f \u0939\u0948\u0902 \u0914\u0930 \u0938\u0941\u092c\u0939 \u0938\u094d\u0915\u0942\u0932/\u0915\u093e\u092e \u0939\u0948\u0964 \u090f\u0915 \u0926\u094b\u0938\u094d\u0924 \u0930\u093e\u0924 \u0915\u0947 \u0938\u092e\u092f \u092c\u093e\u0930-\u092c\u093e\u0930 \u092b\u094b\u0928 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948\u0964\n\u0906\u092a \u0909\u0928\u0915\u0940 \u092a\u0930\u0935\u093e\u0939 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a\u0915\u093e \u0936\u0930\u0940\u0930 \u091f\u0942\u091f \u0930\u0939\u093e \u0939\u0948\u0964\n\n\u0915\u094c\u0928 \u0938\u093e \u0909\u0924\u094d\u0924\u0930 \u0926\u094b\u0928\u094b\u0902 \u0906\u092a\u0915\u0947 \u0914\u0930 \u0909\u0928\u0915\u0947 \u0932\u093f\u090f \u0938\u092e\u094d\u092e\u093e\u0928\u091c\u0928\u0915 \u0939\u0948?","Es fractus es et schola/opus mane habes. Amicus tuus vocat sero ut confiteatur.\nCuras de eis, sed corpus tuum frangitur.\n\nQuae responsio tam te quam eos respicit?","Sei esausto e hai scuola/lavoro al mattino. Un amico continua a chiamarti tardi la notte per sfogarsi.\nCi tieni a lui, ma il tuo corpo sta cedendo.\n\nQuale risposta rispetta sia te che loro?","\u0634\u0645\u0627 \u062e\u0633\u062a\u0647 \u0647\u0633\u062a\u06cc\u062f \u0648 \u0635\u0628\u062d \u0645\u062f\u0631\u0633\u0647/\u06a9\u0627\u0631 \u062f\u0627\u0631\u06cc\u062f. \u06cc\u06a9 \u062f\u0648\u0633\u062a \u0645\u062f\u0627\u0645 \u062f\u0631 \u0634\u0628 \u062f\u06cc\u0631 \u0648\u0642\u062a \u062a\u0645\u0627\u0633 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f \u062a\u0627 \u0627\u0632 \u062e\u0648\u062f\u0634 \u0628\u06af\u0648\u06cc\u062f.\n\u0634\u0645\u0627 \u0628\u0647 \u0622\u0646\u0647\u0627 \u0627\u0647\u0645\u06cc\u062a \u0645\u06cc\u200c\u062f\u0647\u06cc\u062f \u0627\u0645\u0627 \u0628\u062f\u0646\u062a\u0627\u0646 \u062f\u0631 \u062d\u0627\u0644 \u0627\u0632 \u0647\u0645 \u067e\u0627\u0634\u06cc\u062f\u0646 \u0627\u0633\u062a.\n\n\u06a9\u062f\u0627\u0645 \u067e\u0627\u0633\u062e \u0647\u0645 \u0634\u0645\u0627 \u0648 \u0647\u0645 \u0622\u0646\u0647\u0627 \u0631\u0627 \u0645\u062d\u062a\u0631\u0645 \u0645\u06cc\u200c\u0634\u0645\u0627\u0631\u062f\u061f"],t.w)
B.a8N=new A.d(B.c,["Answer every call no matter what and ignore your own sleep.","Contesta todas las llamadas sin importar qu\xe9 y ignora tu propio sue\xf1o.","Nimm jeden Anruf entgegen, egal was passiert, und ignoriere deinen eigenen Schlaf.","R\xe9pondre \xe0 chaque appel quoi qu'il arrive et ignorer ton propre sommeil.","\u0623\u062c\u0628 \u0639\u0644\u0649 \u0643\u0644 \u0645\u0643\u0627\u0644\u0645\u0629 \u0628\u063a\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0623\u064a \u0634\u064a\u0621 \u0648\u062a\u062c\u0627\u0647\u0644 \u0646\u0648\u0645\u0643.","\ubaa8\ub4e0 \uc804\ud654\ub97c \ubc1b\uc544\ub4e4\uc5ec \uc790\uc2e0\uc758 \uc7a0\uc744 \ubb34\uc2dc\ud558\uc2ed\uc2dc\uc624.","\u4e0d\u7ba1\u600e\u6837\u90fd\u63a5\u6bcf\u4e00\u4e2a\u7535\u8bdd\uff0c\u65e0\u89c6\u81ea\u5df1\u7684\u7761\u7720\u3002","\u0939\u0930 \u0915\u0949\u0932 \u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0902, \u091a\u093e\u0939\u0947 \u0915\u0941\u091b \u092d\u0940 \u0939\u094b, \u0914\u0930 \u0905\u092a\u0928\u0940 \u0928\u0940\u0902\u0926 \u0915\u0940 \u0909\u092a\u0947\u0915\u094d\u0937\u093e \u0915\u0930\u0947\u0902\u0964","Responde omni vocatio quocumque sit et ignore tuam somnum.","Rispondi a ogni chiamata a prescindere e ignora il tuo sonno.","\u0628\u0647 \u0647\u0631 \u062a\u0645\u0627\u0633 \u067e\u0627\u0633\u062e \u062f\u0647\u06cc\u062f \u0648 \u062e\u0648\u0627\u0628 \u062e\u0648\u062f \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0628\u06af\u06cc\u0631\u06cc\u062f."],t.w)
