B.aba=new A.d(B.c,["\u201cI care about you, but 3 a.m. calls are too hard on me. Can we talk earlier in the day?\u201d","\u201cMe importas, pero las llamadas a las 3 a.m. son demasiado dif\xedciles para m\xed. \xbfPodemos hablar antes en el d\xeda?\u201d","\u201eIch k\xfcmmere mich um dich, aber Anrufe um 3 Uhr morgens sind zu schwer f\xfcr mich. K\xf6nnen wir fr\xfcher am Tag sprechen?\u201c","\u201cJe tiens \xe0 toi, mais les appels \xe0 3 h du matin sont trop difficiles pour moi. Pouvons-nous parler plus t\xf4t dans la journ\xe9e ?\u201d","\u201c\u0623\u0646\u0627 \u0623\u0647\u062a\u0645 \u0628\u0643\u060c \u0644\u0643\u0646 \u0627\u0644\u0645\u0643\u0627\u0644\u0645\u0627\u062a \u0627\u0644\u0633\u0627\u0639\u0629 3 \u0635\u0628\u0627\u062d\u064b\u0627 \u0635\u0639\u0628\u0629 \u062c\u062f\u064b\u0627 \u0639\u0644\u064a\u0651. \u0647\u0644 \u064a\u0645\u0643\u0646\u0646\u0627 \u0627\u0644\u062a\u062d\u062f\u062b \u0641\u064a \u0648\u0642\u062a \u0644\u0627\u062d\u0642 \u0645\u0646 \u0627\u0644\u064a\u0648\u0645\u061f\u201d","\u201c\ub098\ub294 \ub2f9\uc2e0\uc744 \uac71\uc815\ud558\uc9c0\ub9cc \uc0c8\ubcbd 3\uc2dc\uc758 \uc804\ud654\ub294 \ub098\uc5d0\uac8c \ub108\ubb34 \ud798\ub4e4\uc5b4\uc694. \uc6b0\ub9ac\uac00 \ub0ae\uc5d0 \ub354 \uc77c\ucc0d \uc774\uc57c\uae30\ud560 \uc218 \uc788\uc744\uae4c\uc694?\u201d","\u201c\u6211\u5173\u5fc3\u4f60\uff0c\u4f46\u51cc\u66683\u70b9\u7684\u7535\u8bdd\u5bf9\u6211\u6765\u8bf4\u592a\u96be\u4e86\u3002\u6211\u4eec\u80fd\u65e9\u70b9\u8c08\u5417\uff1f\u201d","\u201c\u092e\u0948\u0902 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u092a\u0930\u0935\u093e\u0939 \u0915\u0930\u0924\u093e \u0939\u0942\u0902, \u0932\u0947\u0915\u093f\u0928 3 \u092c\u091c\u0947 \u0915\u0940 \u0915\u0949\u0932 \u092e\u0947\u0930\u0947 \u0932\u093f\u090f \u092c\u0939\u0941\u0924 \u0915\u0920\u093f\u0928 \u0939\u0948\u0964 \u0915\u094d\u092f\u093e \u0939\u092e \u0926\u093f\u0928 \u0915\u0947 \u092a\u0939\u0932\u0947 \u0939\u093f\u0938\u094d\u0938\u0947 \u092e\u0947\u0902 \u092c\u093e\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902?\u201d","\u201eTe curor, sed vocatiunculae 3 a.m. mihi nimis graves sunt. Possumusne prius loqui in die?\u201c","\u201cCi tengo a te, ma le chiamate alle 3 del mattino sono troppo difficili per me. Possiamo parlare prima durante il giorno?\u201d","\u201c\u0645\u0646 \u0628\u0647 \u062a\u0648 \u0627\u0647\u0645\u06cc\u062a \u0645\u06cc\u200c\u062f\u0647\u0645\u060c \u0627\u0645\u0627 \u062a\u0645\u0627\u0633\u200c\u0647\u0627 \u0633\u0627\u0639\u062a 3 \u0635\u0628\u062d \u0628\u0631\u0627\u06cc \u0645\u0646 \u0628\u0633\u06cc\u0627\u0631 \u0633\u062e\u062a \u0647\u0633\u062a\u0646\u062f. \u0622\u06cc\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u0645 \u0632\u0648\u062f\u062a\u0631 \u062f\u0631 \u0631\u0648\u0632 \u0635\u062d\u0628\u062a \u06a9\u0646\u06cc\u0645\u061f\u201d"],t.w)
