B.ae5=new A.d(B.c,["Boundaries name your limits while still expressing care. It is not all or nothing.","Los l\xedmites definen tus l\xedmites mientras expresas cuidado. No es todo o nada.","Grenzen benennen deine Grenzen, w\xe4hrend du immer noch F\xfcrsorge zeigst. Es ist nicht alles oder nichts.","Les fronti\xe8res d\xe9finissent tes limites tout en exprimant de l'attention. Ce n'est pas tout ou rien.","\u0627\u0644\u062d\u062f\u0648\u062f \u062a\u062d\u062f\u062f \u062d\u062f\u0648\u062f\u0643 \u0645\u0639 \u0627\u0644\u0627\u0633\u062a\u0645\u0631\u0627\u0631 \u0641\u064a \u0625\u0638\u0647\u0627\u0631 \u0627\u0644\u0631\u0639\u0627\u064a\u0629. \u0644\u064a\u0633 \u0643\u0644\u0647 \u0623\u0648 \u0644\u0627 \u0634\u064a\u0621.","\uacbd\uacc4\ub294 \uc5ec\uc804\ud788 \ubc30\ub824\ub97c \ud45c\ud604\ud558\uba74\uc11c \ub2f9\uc2e0\uc758 \ud55c\uacc4\ub97c \uba85\ud655\ud788 \ud569\ub2c8\ub2e4. \ubaa8\ub4e0 \uac83\uc774\uac70\ub098 \uc544\ubb34\uac83\ub3c4 \uc544\ub2d9\ub2c8\ub2e4.","\u754c\u9650\u5b9a\u4e49\u4e86\u4f60\u7684\u9650\u5236\uff0c\u540c\u65f6\u8868\u8fbe\u5173\u7231\u3002\u8fd9\u4e0d\u662f\u5168\u6709\u6216\u5168\u65e0\u3002","\u0938\u0940\u092e\u093e \u0906\u092a\u0915\u0947 \u0938\u0940\u092e\u093e\u0913\u0902 \u0915\u094b \u0928\u093f\u0930\u094d\u0927\u093e\u0930\u093f\u0924 \u0915\u0930\u0924\u0940 \u0939\u0948 \u091c\u092c\u0915\u093f \u0906\u092a \u0926\u0947\u0916\u092d\u093e\u0932 \u092d\u0940 \u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 \u092f\u0939 \u0938\u092c \u0915\u0941\u091b \u092f\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u0939\u0948\u0964","Termina describunt fines tuos, dum curam expriment. Non est omnia aut nihil.","I confini definiscono i tuoi limiti pur esprimendo cura. Non \xe8 tutto o niente.","\u0645\u0631\u0632\u0647\u0627 \u0645\u062d\u062f\u0648\u062f\u06cc\u062a\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0631\u0627 \u0645\u0634\u062e\u0635 \u0645\u06cc\u200c\u06a9\u0646\u0646\u062f \u062f\u0631 \u062d\u0627\u0644\u06cc \u06a9\u0647 \u0647\u0645\u0686\u0646\u0627\u0646 \u0645\u0631\u0627\u0642\u0628\u062a \u0646\u0634\u0627\u0646 \u0645\u06cc\u200c\u062f\u0647\u0646\u062f. \u0627\u06cc\u0646 \u0647\u0645\u0647 \u06cc\u0627 \u0647\u06cc\u0686 \u0646\u06cc\u0633\u062a."],t.w)
