B.ae0=new A.d(B.c,["Someone keeps \u201cborrowing\u201d your things and returning them damaged.\n\nBoundary-wise, what is a healthier response?","Alguien sigue \u201ctomando prestadas\u201d tus cosas y devolvi\xe9ndolas da\xf1adas.\n\nEn cuanto a l\xedmites, \xbfcu\xe1l es una respuesta m\xe1s saludable?","Jemand leiht st\xe4ndig deine Sachen aus und gibt sie besch\xe4digt zur\xfcck.\n\nWas ist in Bezug auf Grenzen eine ges\xfcndere Antwort?","Quelqu'un continue \xe0 \xab emprunter \xbb tes affaires et \xe0 les retourner endommag\xe9es.\n\nDu point de vue des fronti\xe8res, quelle est la r\xe9ponse la plus saine ?",'\u0634\u062e\u0635 \u0645\u0627 \u064a\u0633\u062a\u0645\u0631 \u0641\u064a "\u0627\u0633\u062a\u0639\u0627\u0631\u0629" \u0623\u063a\u0631\u0627\u0636\u0643 \u0648\u0625\u0631\u062c\u0627\u0639\u0647\u0627 \u062a\u0627\u0644\u0641\u0629.\n\n\u0645\u0646 \u0645\u0646\u0638\u0648\u0631 \u0627\u0644\u062d\u062f\u0648\u062f\u060c \u0645\u0627 \u0647\u0648 \u0627\u0644\u0631\u062f \u0627\u0644\u0623\u0643\u062b\u0631 \u0635\u062d\u0629\u061f','\ub204\uad70\uac00 \ub2f9\uc2e0\uc758 \ubb3c\uac74\uc744 \uacc4\uc18d "\ube4c\ub9ac\uace0" \uc190\uc0c1\ub41c \ucc44\ub85c \ub3cc\ub824\uc90d\ub2c8\ub2e4.\n\n\uacbd\uacc4 \uce21\uba74\uc5d0\uc11c \ub354 \uac74\uac15\ud55c \ubc18\uc751\uc740 \ubb34\uc5c7\uc778\uac00\uc694?',"\u6709\u4eba\u4e00\u76f4\u201c\u501f\u201d\u4f60\u7684\u4e1c\u897f\u5e76\u5f52\u8fd8\u65f6\u635f\u574f\u3002\n\n\u4ece\u8fb9\u754c\u89d2\u5ea6\u6765\u770b\uff0c\u4ec0\u4e48\u662f\u66f4\u5065\u5eb7\u7684\u56de\u5e94\uff1f",'\u0915\u094b\u0908 \u0906\u092a\u0915\u0940 \u091a\u0940\u091c\u0947\u0902 "\u0909\u0927\u093e\u0930" \u0932\u0947\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948 \u0914\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u0915\u094d\u0937\u0924\u093f\u0917\u094d\u0930\u0938\u094d\u0924 \u0915\u0930\u0915\u0947 \u0935\u093e\u092a\u0938 \u0915\u0930\u0924\u093e \u0939\u0948\u0964\n\n\u0938\u0940\u092e\u093e\u0913\u0902 \u0915\u0947 \u0932\u093f\u0939\u093e\u091c \u0938\u0947, \u0938\u092c\u0938\u0947 \u0938\u094d\u0935\u0938\u094d\u0925 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e \u0915\u094d\u092f\u093e \u0939\u094b\u0917\u0940?','Aliquis res tuas "praestans" accipit et eas laesae reddit.\n\nEx parte terminorum, quae responsio salubrior est?',"Qualcuno continua a \u201cprendere in prestito\u201d le tue cose restituendole danneggiate.\n\nDal punto di vista dei confini, qual \xe8 una risposta pi\xf9 sana?",'\u06a9\u0633\u06cc \u0645\u062f\u0627\u0645 \u0648\u0633\u0627\u06cc\u0644\u062a\u0627\u0646 \u0631\u0627 "\u0642\u0631\u0636 \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f" \u0648 \u0622\u0646\u200c\u0647\u0627 \u0631\u0627 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647 \u067e\u0633 \u0645\u06cc\u200c\u062f\u0647\u062f.\n\n\u0627\u0632 \u0646\u0638\u0631 \u0645\u0631\u0632\u0647\u0627\u060c \u0686\u0647 \u0648\u0627\u06a9\u0646\u0634\u06cc \u0633\u0627\u0644\u0645\u200c\u062a\u0631 \u0627\u0633\u062a\u061f'],t.w)
B.adi=new A.d(B.c,["Say nothing and keep lending them more items.","No decir nada y seguir prest\xe1ndoles m\xe1s cosas.","Nichts sagen und ihnen weiterhin mehr Dinge leihen.","Ne rien dire et continuer \xe0 leur pr\xeater plus de choses.","\u0644\u0627 \u062a\u0642\u0648\u0644 \u0634\u064a\u0626\u064b\u0627 \u0648\u0627\u0633\u062a\u0645\u0631 \u0641\u064a \u0625\u0642\u0631\u0627\u0636\u0647\u0645 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0623\u0634\u064a\u0627\u0621.","\uc544\ubb34 \ub9d0 \uc5c6\uc774 \uadf8\ub4e4\uc5d0\uac8c \ub354 \ub9ce\uc740 \ubb3c\uac74\uc744 \uacc4\uc18d \ube4c\ub824\uc8fc\uc138\uc694.","\u4ec0\u4e48\u4e5f\u4e0d\u8bf4\uff0c\u7ee7\u7eed\u501f\u7ed9\u4ed6\u4eec\u66f4\u591a\u4e1c\u897f\u3002","\u0915\u0941\u091b \u0928 \u0915\u0939\u0947\u0902 \u0914\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u0905\u0927\u093f\u0915 \u091a\u0940\u091c\u0947\u0902 \u0909\u0927\u093e\u0930 \u0926\u0947\u0928\u093e \u091c\u093e\u0930\u0940 \u0930\u0916\u0947\u0902\u0964","Nihil dicere et plura items illis praebere.","Non dire nulla e continuare a prestargli pi\xf9 cose.","\u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0646\u06af\u0648\u06cc\u06cc\u062f \u0648 \u0628\u0647 \u0622\u0646\u200c\u0647\u0627 \u0648\u0633\u0627\u06cc\u0644 \u0628\u06cc\u0634\u062a\u0631\u06cc \u0642\u0631\u0636 \u062f\u0647\u06cc\u062f."],t.w)
