B.a7Y=new A.d(B.c,["Destroy some of their things to get even.","Destruir algunas de sus cosas para vengarte.","Zerst\xf6re einige ihrer Sachen, um sich zu r\xe4chen.","D\xe9truire certaines de leurs affaires pour se venger.","\u062a\u062f\u0645\u064a\u0631 \u0628\u0639\u0636 \u0645\u0646 \u0623\u063a\u0631\u0627\u0636\u0647\u0645 \u0644\u0644\u0627\u0646\u062a\u0642\u0627\u0645.","\uadf8\ub4e4\uc758 \ubb3c\uac74\uc744 \uc77c\ubd80 \ud30c\uad34\ud558\uc5ec \ubcf5\uc218\ud558\uc138\uc694.","\u6467\u6bc1\u4ed6\u4eec\u7684\u4e00\u4e9b\u4e1c\u897f\u6765\u62a5\u590d\u3002","\u0909\u0928\u0915\u0940 \u0915\u0941\u091b \u091a\u0940\u091c\u0947\u0902 \u0928\u0937\u094d\u091f \u0915\u0930\u0947\u0902 \u0924\u093e\u0915\u093f \u092c\u0926\u0932\u093e \u0932\u0947 \u0938\u0915\u0947\u0902\u0964","Destruent aliqua eorum res ad ultionem.","Distruggi alcune delle loro cose per vendicarti.","\u0628\u0631\u062e\u06cc \u0627\u0632 \u0648\u0633\u0627\u06cc\u0644\u0634\u0627\u0646 \u0631\u0627 \u0628\u0631\u0627\u06cc \u0627\u0646\u062a\u0642\u0627\u0645 \u0646\u0627\u0628\u0648\u062f \u06a9\u0646\u06cc\u062f."],t.w)
