B.ad6=new A.d(B.c,["A classmate keeps asking you to do their part of group projects.\n\nWhich answer respects your limits?","Un compa\xf1ero de clase sigue pidi\xe9ndote que hagas su parte de los proyectos grupales.\n\n\xbfCu\xe1l respuesta respeta tus l\xedmites?","Ein Klassenkamerad bittet dich st\xe4ndig, seinen Teil der Gruppenprojekte zu \xfcbernehmen.\n\nWelche Antwort respektiert deine Grenzen?","Un camarade de classe continue \xe0 vous demander de faire sa part des projets de groupe.\n\nQuelle r\xe9ponse respecte vos limites ?","\u0632\u0645\u064a\u0644 \u0641\u064a \u0627\u0644\u0635\u0641 \u064a\u0637\u0644\u0628 \u0645\u0646\u0643 \u0628\u0627\u0633\u062a\u0645\u0631\u0627\u0631 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u062c\u0632\u0621 \u0645\u0646 \u0627\u0644\u0645\u0634\u0627\u0631\u064a\u0639 \u0627\u0644\u062c\u0645\u0627\u0639\u064a\u0629.\n\n\u0623\u064a \u0625\u062c\u0627\u0628\u0629 \u062a\u062d\u062a\u0631\u0645 \u062d\u062f\u0648\u062f\u0643\u061f","\ud55c \ubc18 \uce5c\uad6c\uac00 \uacc4\uc18d\ud574\uc11c \uadf8\ub8f9 \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uadf8\ub4e4\uc758 \ubd80\ubd84\uc744 \ud574\ub2ec\ub77c\uace0 \ubd80\ud0c1\ud569\ub2c8\ub2e4.\n\n\uc5b4\ub5a4 \ub2f5\ubcc0\uc774 \ub2f9\uc2e0\uc758 \ud55c\uacc4\ub97c \uc874\uc911\ud558\ub098\uc694?","\u4e00\u4f4d\u540c\u5b66\u4e0d\u65ad\u8981\u6c42\u4f60\u505a\u4ed6\u4eec\u5c0f\u7ec4\u9879\u76ee\u7684\u90e8\u5206\u5de5\u4f5c\u3002\n\n\u54ea\u4e2a\u56de\u7b54\u5c0a\u91cd\u4f60\u7684\u754c\u9650\uff1f","\u090f\u0915 \u0938\u0939\u092a\u093e\u0920\u0940 \u0906\u092a\u0938\u0947 \u0932\u0917\u093e\u0924\u093e\u0930 \u0938\u092e\u0942\u0939 \u092a\u0930\u093f\u092f\u094b\u091c\u0928\u093e\u0913\u0902 \u0915\u093e \u0909\u0928\u0915\u093e \u0939\u093f\u0938\u094d\u0938\u093e \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u0939 \u0930\u0939\u093e \u0939\u0948\u0964\n\n\u0915\u094c\u0928 \u0938\u093e \u0909\u0924\u094d\u0924\u0930 \u0906\u092a\u0915\u0947 \u0938\u0940\u092e\u093e\u0913\u0902 \u0915\u093e \u0938\u092e\u094d\u092e\u093e\u0928 \u0915\u0930\u0924\u093e \u0939\u0948?","Socius studiorum te semper rogat ut partem operis incepti faciendum.","Un compagno di classe continua a chiederti di fare la sua parte nei progetti di gruppo.\n\nQuale risposta rispetta i tuoi limiti?","\u06cc\u06a9 \u0647\u0645\u06a9\u0644\u0627\u0633\u06cc \u0645\u062f\u0627\u0645 \u0627\u0632 \u0634\u0645\u0627 \u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u062f \u06a9\u0647 \u0628\u062e\u0634 \u067e\u0631\u0648\u0698\u0647\u200c\u0647\u0627\u06cc \u06af\u0631\u0648\u0647\u06cc \u0622\u0646\u0647\u0627 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u062f\u0647\u06cc\u062f.\n\n\u06a9\u062f\u0627\u0645 \u067e\u0627\u0633\u062e \u0645\u062d\u062f\u0648\u062f\u06cc\u062a\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0631\u0627 \u0645\u062d\u062a\u0631\u0645 \u0645\u06cc\u200c\u0634\u0645\u0627\u0631\u062f\u061f"],t.w)
B.ad8=new A.d(B.c,["\u201cSure, I will just do everything every time.\u201d","\u201cClaro, lo har\xe9 todo cada vez.\u201d","\u201eKlar, ich mache einfach jedes Mal alles.\u201c","\u201cBien s\xfbr, je ferai tout \xe0 chaque fois.\u201d","\u201c\u0628\u0627\u0644\u0637\u0628\u0639\u060c \u0633\u0623\u0641\u0639\u0644 \u0643\u0644 \u0634\u064a\u0621 \u0641\u064a \u0643\u0644 \u0645\u0631\u0629.\u201d","\u201c\uc54c\uc558\uc5b4, \ub9e4\ubc88 \ub2e4 \ud560\uac8c.\u201d","\u201c\u5f53\u7136\uff0c\u6211\u6bcf\u6b21\u90fd\u505a\u6240\u6709\u7684\u4e8b\u60c5\u3002\u201d","\u201c\u092c\u093f\u0932\u0915\u0941\u0932, \u092e\u0948\u0902 \u0939\u0930 \u092c\u093e\u0930 \u0938\u092c \u0915\u0941\u091b \u0915\u0930 \u0932\u0942\u0902\u0917\u093e\u0964\u201d","\u201cCerte, omnia semper faciam.\u201d","\u201cCerto, far\xf2 tutto ogni volta.\u201d","\u201c\u0627\u0644\u0628\u062a\u0647\u060c \u0645\u0646 \u0647\u0631 \u0628\u0627\u0631 \u0647\u0645\u0647 \u0686\u06cc\u0632 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u062e\u0648\u0627\u0647\u0645 \u062f\u0627\u062f.\u201d"],t.w)
