B.a93=new A.d(B.c,["\u201cI cannot keep doing your part. I am willing to help you understand it, but not to do it for you.\u201d","\u201cNo puedo seguir haciendo tu parte. Estoy dispuesto a ayudarte a entenderlo, pero no a hacerlo por ti.\u201d","\u201eIch kann nicht weiterhin deinen Teil \xfcbernehmen. Ich bin bereit, dir zu helfen, es zu verstehen, aber nicht, es f\xfcr dich zu tun.\u201c","\u201cJe ne peux pas continuer \xe0 faire ta part. Je suis pr\xeat \xe0 t'aider \xe0 comprendre, mais pas \xe0 le faire pour toi.\u201d","\u201c\u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u0627\u0633\u062a\u0645\u0631\u0627\u0631 \u0641\u064a \u0623\u062f\u0627\u0621 \u062c\u0632\u0621\u0643. \u0623\u0646\u0627 \u0645\u0633\u062a\u0639\u062f \u0644\u0645\u0633\u0627\u0639\u062f\u062a\u0643 \u0641\u064a \u0641\u0647\u0645\u0647\u060c \u0648\u0644\u0643\u0646 \u0644\u064a\u0633 \u0644\u0644\u0642\u064a\u0627\u0645 \u0628\u0647 \u0646\u064a\u0627\u0628\u0629 \u0639\u0646\u0643.\u201d","\u201c\ub098\ub294 \ub124 \ubd80\ubd84\uc744 \uacc4\uc18d \ud560 \uc218 \uc5c6\uc5b4. \uc774\ud574\ud558\ub294 \ub370 \ub3c4\uc640\uc904 \uc218\ub294 \uc788\uc9c0\ub9cc, \ub300\uc2e0 \ud574\uc904 \uc218\ub294 \uc5c6\uc5b4.\u201d","\u201c\u6211\u4e0d\u80fd\u7ee7\u7eed\u505a\u4f60\u7684\u90e8\u5206\u3002\u6211\u613f\u610f\u5e2e\u52a9\u4f60\u7406\u89e3\u5b83\uff0c\u4f46\u4e0d\u662f\u66ff\u4f60\u505a\u3002\u201d","\u201c\u092e\u0948\u0902 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u093e \u0939\u093f\u0938\u094d\u0938\u093e \u0915\u0930\u0924\u0947 \u0930\u0939 \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e\u0964 \u092e\u0948\u0902 \u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0907\u0938\u0947 \u0938\u092e\u091d\u0928\u0947 \u092e\u0947\u0902 \u092e\u0926\u0926 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0901, \u0932\u0947\u0915\u093f\u0928 \u0907\u0938\u0947 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u0932\u093f\u090f \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u093e\u0964\u201d","\u201cNon possum tuam partem semper facere. Paratus sum te adiuvare intellegere, sed non facere pro te.\u201d","\u201cNon posso continuare a fare la tua parte. Sono disposto ad aiutarti a capirlo, ma non a farlo per te.\u201d","\u201c\u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645 \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647\u0645 \u06a9\u0647 \u0628\u062e\u0634\u06cc \u0627\u0632 \u062a\u0648 \u0631\u0627 \u0627\u0646\u062c\u0627\u0645 \u062f\u0647\u0645. \u0622\u0645\u0627\u062f\u0647\u200c\u0627\u0645 \u0628\u0647 \u062a\u0648 \u06a9\u0645\u06a9 \u06a9\u0646\u0645 \u062a\u0627 \u0622\u0646 \u0631\u0627 \u0628\u0641\u0647\u0645\u06cc\u060c \u0627\u0645\u0627 \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0622\u0646 \u0631\u0627 \u0628\u0631\u0627\u06cc\u062a \u0627\u0646\u062c\u0627\u0645 \u062f\u0647\u0645.\u201d"],t.w)
