B.afi=new A.d(B.c,["\u201cYou are lazy and terrible, I hope you fail.\u201d","\u201cEres vago y terrible, espero que fracases.\u201d","\u201eDu bist faul und schrecklich, ich hoffe, du scheiterst.\u201c","\u201cTu es paresseux et horrible, j'esp\xe8re que tu \xe9choueras.\u201d","\u201c\u0623\u0646\u062a \u0643\u0633\u0648\u0644 \u0648\u0641\u0638\u064a\u0639\u060c \u0622\u0645\u0644 \u0623\u0646 \u062a\u0641\u0634\u0644.\u201d","\u201c\ub108\ub294 \uac8c\uc73c\ub974\uace0 \ub054\ucc0d\ud574, \ub108\ub294 \uc2e4\ud328\ud558\uae38 \ubc14\ub780\ub2e4.\u201d","\u201c\u4f60\u61d2\u60f0\u53c8\u53ef\u6015\uff0c\u6211\u5e0c\u671b\u4f60\u5931\u8d25\u3002\u201d","\u201c\u0924\u0941\u092e \u0906\u0932\u0938\u0940 \u0914\u0930 \u092d\u092f\u093e\u0928\u0915 \u0939\u094b, \u092e\u0941\u091d\u0947 \u0909\u092e\u094d\u092e\u0940\u0926 \u0939\u0948 \u0915\u093f \u0924\u0941\u092e \u0905\u0938\u092b\u0932 \u0939\u094b \u091c\u093e\u0913\u0964\u201d","\u201cPigeres et horribile, spero te deficere.\u201d","\u201cSei pigro e terribile, spero che tu fallisca.\u201d","\u201c\u062a\u0648 \u062a\u0646\u0628\u0644 \u0648 \u0648\u062d\u0634\u062a\u0646\u0627\u06a9 \u0647\u0633\u062a\u06cc\u060c \u0627\u0645\u06cc\u062f\u0648\u0627\u0631\u0645 \u0634\u06a9\u0633\u062a \u0628\u062e\u0648\u0631\u06cc.\u201d"],t.w)
