B.abF=new A.d(B.c,["Healthy boundaries are clear and firm without needing to attack the other person.","Los l\xedmites saludables son claros y firmes sin necesidad de atacar a la otra persona.","Gesunde Grenzen sind klar und fest, ohne die andere Person anzugreifen.","Les fronti\xe8res saines sont claires et fermes sans avoir besoin d'attaquer l'autre personne.","\u0627\u0644\u062d\u062f\u0648\u062f \u0627\u0644\u0635\u062d\u064a\u0629 \u0648\u0627\u0636\u062d\u0629 \u0648\u062b\u0627\u0628\u062a\u0629 \u062f\u0648\u0646 \u0627\u0644\u062d\u0627\u062c\u0629 \u0625\u0644\u0649 \u0645\u0647\u0627\u062c\u0645\u0629 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0622\u062e\u0631.","\uac74\uac15\ud55c \uacbd\uacc4\ub294 \ub2e4\ub978 \uc0ac\ub78c\uc744 \uacf5\uaca9\ud560 \ud544\uc694 \uc5c6\uc774 \uba85\ud655\ud558\uace0 \ud655\uace0\ud569\ub2c8\ub2e4.","\u5065\u5eb7\u7684\u754c\u9650\u662f\u660e\u786e\u548c\u575a\u5b9a\u7684\uff0c\u65e0\u9700\u653b\u51fb\u5176\u4ed6\u4eba\u3002","\u0938\u094d\u0935\u0938\u094d\u0925 \u0938\u0940\u092e\u093e\u090f\u0902 \u0938\u094d\u092a\u0937\u094d\u091f \u0914\u0930 \u0926\u0943\u0922\u093c \u0939\u094b\u0924\u0940 \u0939\u0948\u0902, \u092c\u093f\u0928\u093e \u0926\u0942\u0938\u0930\u0947 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u092a\u0930 \u0939\u092e\u0932\u093e \u0915\u093f\u090f\u0964","Termina salubria clara et firma sunt, sine alium hominem petere.","I confini sani sono chiari e fermi senza dover attaccare l'altra persona.","\u0645\u0631\u0632\u0647\u0627\u06cc \u0633\u0627\u0644\u0645 \u0648\u0627\u0636\u062d \u0648 \u0645\u062d\u06a9\u0645 \u0647\u0633\u062a\u0646\u062f \u0628\u062f\u0648\u0646 \u0627\u06cc\u0646\u06a9\u0647 \u0646\u06cc\u0627\u0632\u06cc \u0628\u0647 \u062d\u0645\u0644\u0647 \u0628\u0647 \u0634\u062e\u0635 \u062f\u06cc\u06af\u0631 \u0628\u0627\u0634\u062f."],t.w)
