B.a9V=new A.d(B.c,["Someone keeps dragging you into long, upsetting arguments in DMs and comments.\n\nWhich boundary is most respectful to your nervous system?","Alguien sigue arrastr\xe1ndote a largas y molestas discusiones en mensajes directos y comentarios.\n\n\xbfQu\xe9 l\xedmite es el m\xe1s respetuoso para tu sistema nervioso?","Jemand zieht dich st\xe4ndig in lange, aufw\xfchlende Streitgespr\xe4che in DMs und Kommentaren.\n\nWelche Grenze ist am respektvollsten f\xfcr dein Nervensystem?","Quelqu'un continue \xe0 vous entra\xeener dans de longues et d\xe9rangeantes discussions par DM et commentaires.\n\nQuelle fronti\xe8re est la plus respectueuse pour votre syst\xe8me nerveux ?","\u0634\u062e\u0635 \u0645\u0627 \u064a\u0633\u062a\u0645\u0631 \u0641\u064a \u0633\u062d\u0628\u0643 \u0625\u0644\u0649 \u0645\u0646\u0627\u0642\u0634\u0627\u062a \u0637\u0648\u064a\u0644\u0629 \u0648\u0645\u0632\u0639\u062c\u0629 \u0641\u064a \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u062e\u0627\u0635\u0629 \u0648\u0627\u0644\u062a\u0639\u0644\u064a\u0642\u0627\u062a.\n\n\u0623\u064a \u062d\u062f \u0647\u0648 \u0627\u0644\u0623\u0643\u062b\u0631 \u0627\u062d\u062a\u0631\u0627\u0645\u064b\u0627 \u0644\u062c\u0647\u0627\u0632\u0643 \u0627\u0644\u0639\u0635\u0628\u064a\u061f","\ub204\uad70\uac00 \ub2f9\uc2e0\uc744 \uacc4\uc18d\ud574\uc11c DM\uacfc \ub313\uae00\ub85c \uae34 \ubd88\ucf8c\ud55c \ub17c\uc7c1\uc5d0 \ub04c\uc5b4\ub4e4\uc785\ub2c8\ub2e4.\n\n\uc5b4\ub5a4 \uacbd\uacc4\uac00 \ub2f9\uc2e0\uc758 \uc2e0\uacbd\uacc4\uc5d0 \uac00\uc7a5 \uc874\uc911\uc744 \ub098\ud0c0\ub0bc\uae4c\uc694?","\u6709\u4eba\u4e0d\u65ad\u5c06\u4f60\u62d6\u5165\u957f\u65f6\u95f4\u4e14\u4ee4\u4eba\u4e0d\u60a6\u7684\u4e89\u8bba\u4e2d\uff0c\u53d1\u751f\u5728\u79c1\u4fe1\u548c\u8bc4\u8bba\u4e2d\u3002\n\n\u54ea\u79cd\u754c\u9650\u6700\u5c0a\u91cd\u4f60\u7684\u795e\u7ecf\u7cfb\u7edf\uff1f","\u0915\u094b\u0908 \u0906\u092a\u0915\u094b \u0932\u0917\u093e\u0924\u093e\u0930 \u0921\u0940\u090f\u092e \u0914\u0930 \u091f\u093f\u092a\u094d\u092a\u0923\u093f\u092f\u094b\u0902 \u092e\u0947\u0902 \u0932\u0902\u092c\u0940, \u092a\u0930\u0947\u0936\u093e\u0928 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0940 \u092c\u0939\u0938\u094b\u0902 \u092e\u0947\u0902 \u0916\u0940\u0902\u091a\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964\n\n\u0915\u094c\u0928 \u0938\u093e \u0938\u0940\u092e\u093e \u0906\u092a\u0915\u0947 \u0924\u0902\u0924\u094d\u0930\u093f\u0915\u093e \u0924\u0902\u0924\u094d\u0930 \u0915\u0947 \u0932\u093f\u090f \u0938\u092c\u0938\u0947 \u0938\u092e\u094d\u092e\u093e\u0928\u091c\u0928\u0915 \u0939\u0948?","Aliquis te trahit in longas et perturbantes contentiones in DMs et commentariis.\n\nQuae terminatio est maximae reverentiae pro tuo systemate nervoso?","Qualcuno continua a trascinarti in lunghe e fastidiose discussioni nei DM e nei commenti.\n\nQuale confine \xe8 il pi\xf9 rispettoso per il tuo sistema nervoso?","\u06a9\u0633\u06cc \u0645\u062f\u0627\u0645 \u0634\u0645\u0627 \u0631\u0627 \u0628\u0647 \u0628\u062d\u062b\u200c\u0647\u0627\u06cc \u0637\u0648\u0644\u0627\u0646\u06cc \u0648 \u0622\u0632\u0627\u0631\u062f\u0647\u0646\u062f\u0647 \u062f\u0631 \u067e\u06cc\u0627\u0645\u200c\u0647\u0627\u06cc \u062e\u0635\u0648\u0635\u06cc \u0648 \u0646\u0638\u0631\u0627\u062a \u0645\u06cc\u200c\u06a9\u0634\u062f.\n\n\u06a9\u062f\u0627\u0645 \u0645\u0631\u0632 \u0628\u06cc\u0634\u062a\u0631\u06cc\u0646 \u0627\u062d\u062a\u0631\u0627\u0645 \u0631\u0627 \u0628\u0647 \u0633\u06cc\u0633\u062a\u0645 \u0639\u0635\u0628\u06cc \u0634\u0645\u0627 \u062f\u0627\u0631\u062f\u061f"],t.w)
B.a9C=new A.d(B.c,["Answer every comment instantly so they do not get angry.","Responder a cada comentario instant\xe1neamente para que no se enojen.","Jeden Kommentar sofort beantworten, damit sie nicht w\xfctend werden.","R\xe9pondre instantan\xe9ment \xe0 chaque commentaire pour qu'ils ne se f\xe2chent pas.","\u0623\u062c\u0628 \u0639\u0644\u0649 \u0643\u0644 \u062a\u0639\u0644\u064a\u0642 \u0641\u0648\u0631\u064b\u0627 \u062d\u062a\u0649 \u0644\u0627 \u064a\u063a\u0636\u0628\u0648\u0627.","\ubaa8\ub4e0 \ub313\uae00\uc5d0 \uc989\uc2dc \ub2f5\ubcc0\ud558\uc5ec \uadf8\ub4e4\uc774 \ud654\ub098\uc9c0 \uc54a\uac8c \ud558\uc138\uc694.","\u7acb\u5373\u56de\u590d\u6bcf\u4e2a\u8bc4\u8bba\uff0c\u4ee5\u514d\u4ed6\u4eec\u751f\u6c14\u3002","\u0939\u0930 \u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u0915\u093e \u0924\u0941\u0930\u0902\u0924 \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0902 \u0924\u093e\u0915\u093f \u0935\u0947 \u0917\u0941\u0938\u094d\u0938\u0947 \u092e\u0947\u0902 \u0928 \u0906\u090f\u0902\u0964","Omne commentum statim responde, ut irasci non possint.","Rispondi a ogni commento immediatamente affinch\xe9 non si arrabbiano.","\u0628\u0644\u0627\u0641\u0627\u0635\u0644\u0647 \u0628\u0647 \u0647\u0631 \u06a9\u0627\u0645\u0646\u062a \u067e\u0627\u0633\u062e \u062f\u0647\u06cc\u062f \u062a\u0627 \u0622\u0646\u0647\u0627 \u0639\u0635\u0628\u0627\u0646\u06cc \u0646\u0634\u0648\u0646\u062f."],t.w)
