B.aev=new A.d(B.c,["A friend brings a guest to your house without asking. You feel uncomfortable but do not want to seem rude.\n\nHow can you set a boundary that respects both you and the guest?","Un amigo trae un invitado a tu casa sin preguntar. Te sientes inc\xf3modo, pero no quieres parecer grosero.\n\n\xbfC\xf3mo puedes establecer un l\xedmite que respete tanto a ti como al invitado?","Ein Freund bringt einen Gast ohne zu fragen zu dir nach Hause. Du f\xfchlst dich unwohl, willst aber nicht unh\xf6flich erscheinen.\n\nWie kannst du eine Grenze setzen, die sowohl dich als auch den Gast respektiert?","Un ami am\xe8ne un invit\xe9 chez vous sans demander. Vous vous sentez mal \xe0 l'aise mais ne voulez pas para\xeetre impoli.\n\nComment pouvez-vous \xe9tablir une limite qui respecte \xe0 la fois vous et l'invit\xe9 ?","\u064a\u062c\u0644\u0628 \u0644\u0643 \u0635\u062f\u064a\u0642 \u0636\u064a\u0641\u064b\u0627 \u0625\u0644\u0649 \u0645\u0646\u0632\u0644\u0643 \u062f\u0648\u0646 \u0623\u0646 \u064a\u0633\u0623\u0644. \u062a\u0634\u0639\u0631 \u0628\u0639\u062f\u0645 \u0627\u0644\u0627\u0631\u062a\u064a\u0627\u062d \u0644\u0643\u0646\u0643 \u0644\u0627 \u062a\u0631\u064a\u062f \u0623\u0646 \u062a\u0628\u062f\u0648 \u0641\u0638\u064b\u0627.\n\n\u0643\u064a\u0641 \u064a\u0645\u0643\u0646\u0643 \u0648\u0636\u0639 \u062d\u062f\u0648\u062f \u062a\u062d\u062a\u0631\u0645\u0643 \u0648\u062a\u062d\u062a\u0631\u0645 \u0627\u0644\u0636\u064a\u0641\u061f","\uce5c\uad6c\uac00 \ub2f9\uc2e0\uc5d0\uac8c \ud5c8\ub77d \uc5c6\uc774 \uc190\ub2d8\uc744 \ub370\ub824\uc635\ub2c8\ub2e4. \ubd88\ud3b8\ud558\uc9c0\ub9cc \ubb34\ub840\ud558\uac8c \ubcf4\uc774\uace0 \uc2f6\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n\n\uc5b4\ub5bb\uac8c \uc790\uc2e0\uacfc \uc190\ub2d8\uc744 \ubaa8\ub450 \uc874\uc911\ud558\ub294 \uacbd\uacc4\ub97c \uc124\uc815\ud560 \uc218 \uc788\ub098\uc694?","\u670b\u53cb\u5728\u6ca1\u6709\u8be2\u95ee\u7684\u60c5\u51b5\u4e0b\u628a\u5ba2\u4eba\u5e26\u5230\u4f60\u5bb6\u3002\u4f60\u611f\u5230\u4e0d\u8212\u670d\uff0c\u4f46\u53c8\u4e0d\u60f3\u663e\u5f97\u7c97\u9c81\u3002\n\n\u4f60\u5982\u4f55\u8bbe\u5b9a\u65e2\u5c0a\u91cd\u81ea\u5df1\u53c8\u5c0a\u91cd\u5ba2\u4eba\u7684\u754c\u9650\uff1f","\u090f\u0915 \u092e\u093f\u0924\u094d\u0930 \u092c\u093f\u0928\u093e \u092a\u0942\u091b\u0947 \u0906\u092a\u0915\u0947 \u0918\u0930 \u090f\u0915 \u0905\u0924\u093f\u0925\u093f \u0932\u093e\u0924\u093e \u0939\u0948\u0964 \u0906\u092a \u0905\u0938\u0939\u091c \u092e\u0939\u0938\u0942\u0938 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0932\u0947\u0915\u093f\u0928 \u0906\u092a \u0905\u092d\u0926\u094d\u0930 \u0928\u0939\u0940\u0902 \u0926\u093f\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u0947\u0964\n\n\u0906\u092a \u0915\u0948\u0938\u0947 \u090f\u0915 \u0938\u0940\u092e\u093e \u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u091c\u094b \u0906\u092a\u0915\u094b \u0914\u0930 \u0905\u0924\u093f\u0925\u093f \u0926\u094b\u0928\u094b\u0902 \u0915\u094b \u0938\u092e\u094d\u092e\u093e\u0928\u093f\u0924 \u0915\u0930\u0924\u0940 \u0939\u0948?","Amicus tuus hospitem ad domum tuam sine quaestionibus adfert. Incommodus es, sed noli videri incivis.\n\nQuomodo limitum ponis, qui te et hospitem simul respectet?","Un amico porta un ospite a casa tua senza chiedere. Ti senti a disagio ma non vuoi sembrare scortese.\n\nCome puoi stabilire un confine che rispetti sia te che l'ospite?","\u06cc\u06a9 \u062f\u0648\u0633\u062a \u0628\u062f\u0648\u0646 \u067e\u0631\u0633\u06cc\u062f\u0646 \u0645\u0647\u0645\u0627\u0646\u06cc \u0631\u0627 \u0628\u0647 \u062e\u0627\u0646\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u0622\u0648\u0631\u062f. \u0634\u0645\u0627 \u0627\u062d\u0633\u0627\u0633 \u0646\u0627\u0631\u0627\u062d\u062a\u06cc \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u0627\u0645\u0627 \u0646\u0645\u06cc\u200c\u062e\u0648\u0627\u0647\u06cc\u062f \u0628\u06cc\u200c\u0627\u062f\u0628 \u0628\u0647 \u0646\u0638\u0631 \u0628\u0631\u0633\u06cc\u062f.\n\n\u0686\u06af\u0648\u0646\u0647 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0645\u0631\u0632\u06cc \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u06a9\u0647 \u0647\u0645 \u0634\u0645\u0627 \u0648 \u0647\u0645 \u0645\u0647\u0645\u0627\u0646 \u0631\u0627 \u0645\u062d\u062a\u0631\u0645 \u0628\u062f\u0627\u0631\u062f\u061f"],t.w)
