B.a8B=new A.d(B.c,["A colleague sends you an email with an urgent request.\n\nYou are busy with a deadline and can\u2019t respond immediately.\n\nHow do you set a boundary that respects both you and them?","Un colega te env\xeda un correo electr\xf3nico con una solicitud urgente.\n\nEst\xe1s ocupado con una fecha l\xedmite y no puedes responder de inmediato.\n\n\xbfC\xf3mo estableces un l\xedmite que respete tanto a ti como a ellos?","Ein Kollege schickt dir eine E-Mail mit einer dringenden Anfrage.\n\nDu bist mit einer Frist besch\xe4ftigt und kannst nicht sofort antworten.\n\nWie setzt du eine Grenze, die sowohl dich als auch ihn respektiert?","Un coll\xe8gue vous envoie un e-mail avec une demande urgente.\n\nVous \xeates occup\xe9 avec une \xe9ch\xe9ance et ne pouvez pas r\xe9pondre imm\xe9diatement.\n\nComment \xe9tablir une limite qui respecte \xe0 la fois vous et lui ?","\u064a\u0631\u0633\u0644 \u0644\u0643 \u0632\u0645\u064a\u0644 \u0628\u0631\u064a\u062f\u064b\u0627 \u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a\u064b\u0627 \u0645\u0639 \u0637\u0644\u0628 \u0639\u0627\u062c\u0644.\n\n\u0623\u0646\u062a \u0645\u0634\u063a\u0648\u0644 \u0628\u0645\u0648\u0639\u062f \u0646\u0647\u0627\u0626\u064a \u0648\u0644\u0627 \u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u0631\u062f \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0631.\n\n\u0643\u064a\u0641 \u062a\u0636\u0639 \u062d\u062f\u064b\u0627 \u064a\u062d\u062a\u0631\u0645\u0643 \u0648\u064a\u062d\u062a\u0631\u0645\u0647\u0645\u061f","\ub3d9\ub8cc\uac00 \uae34\uae09\ud55c \uc694\uccad\uc774 \ub2f4\uae34 \uc774\uba54\uc77c\uc744 \ubcf4\ub0c5\ub2c8\ub2e4.\n\n\ub9c8\uac10\uc77c\uc5d0 \ucad3\uae30\uace0 \uc788\uc5b4 \uc989\uc2dc \uc751\ub2f5\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.\n\n\uc5b4\ub5bb\uac8c \uc790\uc2e0\uacfc \uadf8\ub4e4 \ubaa8\ub450\ub97c \uc874\uc911\ud558\ub294 \uacbd\uacc4\ub97c \uc124\uc815\ud560 \uc218 \uc788\uc744\uae4c\uc694?","\u4e00\u4f4d\u540c\u4e8b\u7ed9\u4f60\u53d1\u4e86\u4e00\u5c01\u7d27\u6025\u8bf7\u6c42\u7684\u90ae\u4ef6\u3002\n\n\u4f60\u6b63\u5fd9\u4e8e\u4e00\u4e2a\u622a\u6b62\u65e5\u671f\uff0c\u65e0\u6cd5\u7acb\u5373\u56de\u590d\u3002\n\n\u4f60\u5982\u4f55\u8bbe\u5b9a\u65e2\u5c0a\u91cd\u81ea\u5df1\u53c8\u5c0a\u91cd\u4ed6\u4eec\u7684\u754c\u9650\uff1f","\u090f\u0915 \u0938\u0939\u0915\u0930\u094d\u092e\u0940 \u0906\u092a\u0915\u094b \u090f\u0915 \u0924\u093e\u0924\u094d\u0915\u093e\u0932\u093f\u0915 \u0905\u0928\u0941\u0930\u094b\u0927 \u0915\u0947 \u0938\u093e\u0925 \u0908\u092e\u0947\u0932 \u092d\u0947\u091c\u0924\u093e \u0939\u0948\u0964\n\n\u0906\u092a \u090f\u0915 \u0938\u092e\u092f \u0938\u0940\u092e\u093e \u0915\u0947 \u0938\u093e\u0925 \u0935\u094d\u092f\u0938\u094d\u0924 \u0939\u0948\u0902 \u0914\u0930 \u0924\u0941\u0930\u0902\u0924 \u0909\u0924\u094d\u0924\u0930 \u0928\u0939\u0940\u0902 \u0926\u0947 \u0938\u0915\u0924\u0947\u0964\n\n\u0906\u092a \u0915\u0948\u0938\u0947 \u090f\u0915 \u0938\u0940\u092e\u093e \u0928\u093f\u0930\u094d\u0927\u093e\u0930\u093f\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u091c\u094b \u0906\u092a\u0915\u094b \u0914\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u0926\u094b\u0928\u094b\u0902 \u0915\u094b \u0938\u092e\u094d\u092e\u093e\u0928\u093f\u0924 \u0915\u0930\u0924\u0940 \u0939\u0948?","Collega epistulam tibi mittit cum rogatione urgente.\n\nOccupatus es cum termino, nec statim respondere potes.\n\nQuomodo finem ponis, qui te et illos simul respectet?","Un collega ti invia un'e-mail con una richiesta urgente.\n\nSei occupato con una scadenza e non puoi rispondere immediatamente.\n\nCome stabilisci un confine che rispetti sia te che loro?","\u06cc\u06a9 \u0647\u0645\u06a9\u0627\u0631 \u0627\u06cc\u0645\u06cc\u0644\u06cc \u0628\u0627 \u06cc\u06a9 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0641\u0648\u0631\u06cc \u0628\u0631\u0627\u06cc \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f.\n\n\u0634\u0645\u0627 \u0645\u0634\u063a\u0648\u0644 \u06cc\u06a9 \u0645\u0647\u0644\u062a \u0647\u0633\u062a\u06cc\u062f \u0648 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0641\u0648\u0631\u0627\u064b \u067e\u0627\u0633\u062e \u062f\u0647\u06cc\u062f.\n\n\u0686\u06af\u0648\u0646\u0647 \u0645\u0631\u0632\u06cc \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u06a9\u0647 \u0647\u0645 \u0634\u0645\u0627 \u0648 \u0647\u0645 \u0622\u0646\u0647\u0627 \u0631\u0627 \u0645\u062d\u062a\u0631\u0645 \u0628\u062f\u0627\u0631\u062f\u061f"],t.w)
B.aa_=new A.d(B.c,["Ignore it for now and hope they forget.","Ign\xf3ralo por ahora y espera que se olviden.","Ignoriere es vorerst und hoffe, dass sie es vergessen.","Ignorez-le pour l'instant et esp\xe9rez qu'ils oublient.","\u062a\u062c\u0627\u0647\u0644\u0647\u0627 \u0627\u0644\u0622\u0646 \u0648\u0623\u0645\u0644 \u0623\u0646 \u064a\u0646\u0633\u0648\u0627.","\uc9c0\uae08\uc740 \ubb34\uc2dc\ud558\uace0 \uadf8\ub4e4\uc774 \uc78a\uc5b4\ubc84\ub9ac\uae38 \ubc14\ub78d\ub2c8\ub2e4.","\u73b0\u5728\u5ffd\u7565\u5b83\uff0c\u5e76\u5e0c\u671b\u4ed6\u4eec\u5fd8\u8bb0\u3002","\u0907\u0938\u0947 \u0905\u092d\u0940 \u0928\u091c\u0930\u0905\u0902\u0926\u093e\u091c \u0915\u0930\u0947\u0902 \u0914\u0930 \u0909\u092e\u094d\u092e\u0940\u0926 \u0915\u0930\u0947\u0902 \u0915\u093f \u0935\u0947 \u092d\u0942\u0932 \u091c\u093e\u090f\u0902\u0964","Ignora id nunc et spera eos oblivisci.","Ignoralo per ora e spera che si dimentichino.","\u0641\u0639\u0644\u0627\u064b \u0622\u0646 \u0631\u0627 \u0646\u0627\u062f\u06cc\u062f\u0647 \u0628\u06af\u06cc\u0631\u06cc\u062f \u0648 \u0627\u0645\u06cc\u062f\u0648\u0627\u0631 \u0628\u0627\u0634\u06cc\u062f \u06a9\u0647 \u0641\u0631\u0627\u0645\u0648\u0634 \u06a9\u0646\u0646\u062f."],t.w)
