B.abP=new A.d(B.c,["Acknowledge the email and let them know when you will respond.","Reconoce el correo electr\xf3nico y diles cu\xe1ndo responder\xe1s.","Best\xe4tige die E-Mail und lass sie wissen, wann du antworten wirst.","Reconna\xeetre l'e-mail et leur faire savoir quand vous r\xe9pondrez.","\u0627\u0639\u062a\u0631\u0641 \u0628\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0648\u0623\u062e\u0628\u0631\u0647\u0645 \u0645\u062a\u0649 \u0633\u062a\u0631\u062f.","\uc774\uba54\uc77c\uc744 \ud655\uc778\ud558\uace0 \uc5b8\uc81c \ub2f5\ubcc0\ud560\uc9c0 \uc54c\ub824\uc8fc\uc138\uc694.","\u786e\u8ba4\u90ae\u4ef6\u5e76\u544a\u8bc9\u4ed6\u4eec\u4f55\u65f6\u56de\u590d\u3002","\u0908\u092e\u0947\u0932 \u0915\u094b \u0938\u094d\u0935\u0940\u0915\u093e\u0930 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u092c\u0924\u093e\u090f\u0902 \u0915\u093f \u0906\u092a \u0915\u092c \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0902\u0917\u0947\u0964","Agnosce epistulam et dic eis quando respondeas.","Riconosci l'e-mail e fai sapere loro quando risponderai.","\u0627\u06cc\u0645\u06cc\u0644 \u0631\u0627 \u062a\u0623\u06cc\u06cc\u062f \u06a9\u0646\u06cc\u062f \u0648 \u0628\u0647 \u0622\u0646\u0647\u0627 \u0627\u0637\u0644\u0627\u0639 \u062f\u0647\u06cc\u062f \u06a9\u0647 \u06a9\u06cc \u067e\u0627\u0633\u062e \u062e\u0648\u0627\u0647\u06cc\u062f \u062f\u0627\u062f."],t.w)
