B.a9h=new A.d(B.c,["Reply immediately, even if you\u2019re too busy.","Responde inmediatamente, incluso si est\xe1s demasiado ocupado.","Antworte sofort, auch wenn du zu besch\xe4ftigt bist.","R\xe9pondez imm\xe9diatement, m\xeame si vous \xeates trop occup\xe9.","\u0631\u062f \u0641\u0648\u0631\u064b\u0627 \u062d\u062a\u0649 \u0648\u0625\u0646 \u0643\u0646\u062a \u0645\u0634\u063a\u0648\u0644\u064b\u0627 \u062c\u062f\u064b\u0627.","\ubc14\uc058\ub354\ub77c\ub3c4 \uc989\uc2dc \ub2f5\ubcc0\ud558\uc138\uc694.","\u7acb\u5373\u56de\u590d\uff0c\u5373\u4f7f\u4f60\u5f88\u5fd9\u3002","\u0924\u0941\u0930\u0902\u0924 \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0902, \u092d\u0932\u0947 \u0939\u0940 \u0906\u092a \u092c\u0939\u0941\u0924 \u0935\u094d\u092f\u0938\u094d\u0924 \u0939\u094b\u0902\u0964","Statim responde, etsi nimis occupatus es.","Rispondi immediatamente, anche se sei troppo occupato.","\u0641\u0648\u0631\u0627\u064b \u067e\u0627\u0633\u062e \u062f\u0647\u06cc\u062f\u060c \u062d\u062a\u06cc \u0627\u06af\u0631 \u062e\u06cc\u0644\u06cc \u0645\u0634\u063a\u0648\u0644 \u0647\u0633\u062a\u06cc\u062f."],t.w)
