B.aco=new A.d(B.c,["\u201cEverybody hates me.\u201d","\u201cTodos me odian.\u201d","\u201eJeder hasst mich.\u201c","\xab Tout le monde me d\xe9teste. \xbb","\u201c\u0627\u0644\u062c\u0645\u064a\u0639 \u064a\u0643\u0631\u0647\u0646\u064a.\u201d","\u201c\ubaa8\ub450\uac00 \ub098\ub97c \uc2eb\uc5b4\ud574.\u201d","\u201c\u6bcf\u4e2a\u4eba\u90fd\u6068\u6211\u3002\u201d","\u201c\u0938\u092c\u0915\u094b \u092e\u0941\u091d\u0938\u0947 \u0928\u092b\u0930\u0924 \u0939\u0948\u0964\u201d","\u201cOmnes me oderunt.\u201d","\u201cTutti mi odiano.\u201d","\u201c\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u0645\u062a\u0646\u0641\u0631\u0646\u062f.\u201d"],t.w)
B.adD=new A.d(B.c,["Thought:\n\u201cEverybody hates me.\u201d\n\nYou had one argument with a friend today, and your brain dropped this sentence in your lap.\nIs this closer to useful signal or noisy self-attack?","Pensamiento:\n\u201cTodos me odian.\u201d\n\nTuviste una discusi\xf3n con un amigo hoy, y tu cerebro dej\xf3 caer esta frase en tu regazo.\n\xbfSe trata de una se\xf1al \xfatil o un ataque ruidoso a ti mismo?","Gedanke:\n\u201eJeder hasst mich.\u201c\n\nDu hattest heute einen Streit mit einem Freund, und dein Gehirn hat diesen Satz in deinen Scho\xdf geworfen.\nIst das n\xfctzliche Signal oder einfach nur ein Selbstangriff?","Pens\xe9e :\n\u201cTout le monde me d\xe9teste.\u201d\n\nVous avez eu une dispute avec un ami aujourd\u2019hui, et votre cerveau a plac\xe9 cette phrase dans votre esprit.\nCela ressemble-t-il \xe0 un signal utile ou \xe0 une attaque bruyante sur soi-m\xeame ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0627\u0644\u062c\u0645\u064a\u0639 \u064a\u0643\u0631\u0647\u0646\u064a.\u201d\n\n\u062a\u062c\u0627\u062f\u0644\u062a \u0645\u0639 \u0635\u062f\u064a\u0642 \u0627\u0644\u064a\u0648\u0645\u060c \u0648\u0623\u0644\u0642\u0649 \u0639\u0642\u0644\u0643 \u0628\u0647\u0630\u0647 \u0627\u0644\u062c\u0645\u0644\u0629 \u0641\u064a \u062d\u0636\u0646\u0643.\n\u0647\u0644 \u0647\u0630\u0627 \u0623\u0642\u0631\u0628 \u0625\u0644\u0649 \u0625\u0634\u0627\u0631\u0629 \u0645\u0641\u064a\u062f\u0629 \u0623\u0645 \u0647\u062c\u0648\u0645 \u0630\u0627\u062a\u064a \u0636\u0648\u0636\u0627\u0626\u064a\u061f","\uc0dd\uac01:\n\u201c\ubaa8\ub450\uac00 \ub098\ub97c \uc2eb\uc5b4\ud574.\u201d\n\n\uc624\ub298 \uce5c\uad6c\uc640 \ud55c \ubc88 \ub17c\uc7c1\uc744 \ud588\uace0, \ub2f9\uc2e0\uc758 \ub1cc\ub294 \uc774 \ubb38\uc7a5\uc744 \ub2f9\uc2e0\uc758 \ubb34\ub98e\uc5d0 \ub5a8\uc5b4\ub728\ub838\uc2b5\ub2c8\ub2e4.\n\uc774\uac83\uc774 \uc720\uc6a9\ud55c \uc2e0\ud638\uc778\uc9c0 \uc544\ub2c8\uba74 \uc18c\uc74c\uc774 \uac00\ub4dd\ud55c \uc790\uae30 \uacf5\uaca9\uc778\uc9c0 \uc5b4\ub5a4\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6bcf\u4e2a\u4eba\u90fd\u6068\u6211\u3002\u201d\n\n\u4eca\u5929\u4f60\u548c\u4e00\u4e2a\u670b\u53cb\u53d1\u751f\u4e86\u4e00\u6b21\u4e89\u6267\uff0c\u4f60\u7684\u5927\u8111\u628a\u8fd9\u53e5\u8bdd\u4e22\u5230\u4f60\u8eab\u4e0a\u3002\n\u8fd9\u662f\u63a5\u8fd1\u6709\u7528\u7684\u4fe1\u53f7\uff0c\u8fd8\u662f\u5145\u6ee1\u566a\u97f3\u7684\u81ea\u6211\u653b\u51fb\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u0938\u092c\u0915\u094b \u092e\u0941\u091d\u0938\u0947 \u0928\u092b\u0930\u0924 \u0939\u0948\u0964\u201d\n\n\u0906\u092a\u0915\u093e \u0906\u091c \u090f\u0915 \u0926\u094b\u0938\u094d\u0924 \u0938\u0947 \u092c\u0939\u0938 \u0939\u0941\u0906 \u0925\u093e, \u0914\u0930 \u0906\u092a\u0915\u0947 \u0926\u093f\u092e\u093e\u0917 \u0928\u0947 \u092f\u0939 \u0935\u093e\u0915\u094d\u092f \u0906\u092a\u0915\u0947 \u0917\u094b\u0926\u0940 \u092e\u0947\u0902 \u0921\u093e\u0932\u093e\u0964\n\u0915\u094d\u092f\u093e \u092f\u0939 \u0909\u092a\u092f\u094b\u0917\u0940 \u0938\u0902\u0915\u0947\u0924 \u0915\u0947 \u0915\u0930\u0940\u092c \u0939\u0948 \u092f\u093e \u0936\u094b\u0930 \u0938\u0947 \u092d\u0930\u0940 \u0906\u0924\u094d\u092e-\u0939\u092e\u0932\u093e \u0939\u0948?","Cogitatio:\n\u201cOmnes me oderunt.\u201d\n\nHodie cum amico tuo pugnam habuisti, et animus tuus hanc sententiam in sinu tuo deiecit.\nHoc propinquum est utile signum vel nugarum ad se ipso impetum?","Pensiero:\n\u201cTutti mi odiano.\u201d\n\nHai avuto una discussione con un amico oggi e il tuo cervello ha gettato questa frase sulle tue gambe.\nQuesto \xe8 pi\xf9 vicino a un segnale utile o a un attacco rumoroso verso te stesso?","\u0641\u06a9\u0631:\n\u201c\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u0645\u062a\u0646\u0641\u0631\u0646\u062f.\u201d\n\n\u0627\u0645\u0631\u0648\u0632 \u0628\u0627 \u06cc\u06a9 \u062f\u0648\u0633\u062a \u0628\u062d\u062b\u06cc \u062f\u0627\u0634\u062a\u06cc\u060c \u0648 \u0645\u063a\u0632 \u062a\u0648 \u0627\u06cc\u0646 \u062c\u0645\u0644\u0647 \u0631\u0627 \u0628\u0647 \u062f\u0644\u062a \u0627\u0646\u062f\u0627\u062e\u062a.\n\u0622\u06cc\u0627 \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0647 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0641\u06cc\u062f \u0646\u0632\u062f\u06cc\u06a9 \u0627\u0633\u062a \u06cc\u0627 \u062d\u0645\u0644\u0647\u200c\u0627\u06cc \u067e\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627 \u0628\u0647 \u062e\u0648\u062f\u061f"],t.w)
B.abe=new A.d(B.c,["Useful signal I should fully trust.","Se\xf1al \xfatil en la que deber\xeda confiar completamente.","N\xfctzliches Signal, dem ich vollst\xe4ndig vertrauen sollte.","Signal utile auquel je devrais faire totalement confiance.","\u0625\u0634\u0627\u0631\u0629 \u0645\u0641\u064a\u062f\u0629 \u064a\u062c\u0628 \u0623\u0646 \u0623\u062b\u0642 \u0628\u0647\u0627 \u062a\u0645\u0627\u0645\u064b\u0627.","\uc644\uc804\ud788 \uc2e0\ub8b0\ud574\uc57c \ud560 \uc720\uc6a9\ud55c \uc2e0\ud638.","\u6211\u5e94\u8be5\u5b8c\u5168\u4fe1\u4efb\u7684\u6709\u7528\u4fe1\u53f7\u3002","\u0909\u092a\u092f\u094b\u0917\u0940 \u0938\u0902\u0915\u0947\u0924 \u091c\u093f\u0938\u0947 \u092e\u0941\u091d\u0947 \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0938\u0947 \u092d\u0930\u094b\u0938\u093e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Signum utile, quod plene confidere debet.","Segnale utile a cui dovrei fidarmi completamente.","\u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0641\u06cc\u062f\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u06a9\u0627\u0645\u0644\u0627\u064b \u0628\u0647 \u0622\u0646 \u0627\u0639\u062a\u0645\u0627\u062f \u06a9\u0646\u0645."],t.w)
