B.afc=new A.d(B.c,["Mostly noise: a hurt reaction, not an accurate map of \u201ceverybody\u201d.","Principalmente ruido: una reacci\xf3n herida, no un mapa preciso de \u201ctodos\u201d.","Vor allem L\xe4rm: eine verletzte Reaktion, keine genaue Karte von \u201eallen\u201c. ","Principalement du bruit : une r\xe9action bless\xe9e, pas une carte pr\xe9cise de \u201ctout le monde\u201d.",'\u0636\u0648\u0636\u0627\u0621 \u0641\u064a \u0627\u0644\u063a\u0627\u0644\u0628: \u0631\u062f \u0641\u0639\u0644 \u062c\u0631\u064a\u062d\u060c \u0648\u0644\u064a\u0633 \u062e\u0631\u064a\u0637\u0629 \u062f\u0642\u064a\u0642\u0629 \u0644\u0640 "\u0627\u0644\u062c\u0645\u064a\u0639".',"\ub300\ubd80\ubd84 \uc18c\uc74c: \uc0c1\ucc98 \ubc1b\uc740 \ubc18\uc751, \u201c\ubaa8\ub450\u201d\uc5d0 \ub300\ud55c \uc815\ud655\ud55c \uc9c0\ub3c4\ub294 \uc544\ub2d8.","\u4e3b\u8981\u662f\u566a\u97f3\uff1a\u53d7\u4f24\u7684\u53cd\u5e94\uff0c\u800c\u4e0d\u662f\u201c\u6bcf\u4e2a\u4eba\u201d\u7684\u51c6\u786e\u5730\u56fe\u3002","\u092e\u0941\u0916\u094d\u092f\u0924\u0903 \u0936\u094b\u0930: \u090f\u0915 \u0906\u0939\u0924 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e, \u201c\u0938\u092d\u0940\u201d \u0915\u093e \u0938\u091f\u0940\u0915 \u092e\u093e\u0928\u091a\u093f\u0924\u094d\u0930 \u0928\u0939\u0940\u0902\u0964",'Plurimum strepitus: actus vulneratus, non accurata tabula "omnium".',"Per lo pi\xf9 rumore: una reazione ferita, non una mappa precisa di \u201ctutti\u201d.",'\u0628\u06cc\u0634\u062a\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627: \u06cc\u06a9 \u0648\u0627\u06a9\u0646\u0634 \u0622\u0633\u06cc\u0628 \u062f\u06cc\u062f\u0647\u060c \u0646\u0647 \u06cc\u06a9 \u0646\u0642\u0634\u0647 \u062f\u0642\u06cc\u0642 \u0627\u0632 "\u0647\u0645\u0647".'],t.w)
