B.a7U=new A.d(B.c,["A prophecy I should repeat to myself often.","Una profec\xeda que deber\xeda repetirme a m\xed mismo con frecuencia.","Eine Prophezeiung, die ich mir oft wiederholen sollte.","Une proph\xe9tie que je devrais r\xe9p\xe9ter souvent.","\u0646\u0628\u0648\u0629 \u064a\u062c\u0628 \u0623\u0646 \u0623\u0643\u0631\u0631\u0647\u0627 \u0639\u0644\u0649 \u0646\u0641\u0633\u064a \u0643\u062b\u064a\u0631\u064b\u0627.","\ub0b4\uac00 \uc790\uc8fc \ubc18\ubcf5\ud574\uc57c \ud560 \uc608\uc5b8.","\u6211\u5e94\u8be5\u7ecf\u5e38\u5bf9\u81ea\u5df1\u91cd\u590d\u7684\u9884\u8a00\u3002","\u090f\u0915 \u092d\u0935\u093f\u0937\u094d\u092f\u0935\u093e\u0923\u0940 \u091c\u093f\u0938\u0947 \u092e\u0941\u091d\u0947 \u092c\u093e\u0930-\u092c\u093e\u0930 \u0916\u0941\u0926 \u0938\u0947 \u0926\u094b\u0939\u0930\u093e\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Prophetia, quam mihi saepe repetere debet.","Una profezia che dovrei ripetere spesso.","\u06cc\u06a9 \u067e\u06cc\u0634\u06af\u0648\u06cc\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u0628\u0647 \u0637\u0648\u0631 \u0645\u06a9\u0631\u0631 \u0628\u0631\u0627\u06cc \u062e\u0648\u062f \u062a\u06a9\u0631\u0627\u0631 \u06a9\u0646\u0645."],t.w)
