B.CE=new A.d(B.c,["The thought jumps from one argument to \u201ceverybody hates me\u201d. That is overgeneralization; it tells you more about your hurt than about reality.","El pensamiento salta de un argumento a \u201ctodos me odian\u201d. Eso es una sobregeneralizaci\xf3n; te dice m\xe1s sobre tu dolor que sobre la realidad.","Der Gedanke springt von einem Streit zu \u201eJeder hasst mich\u201c. Das ist eine \xdcberverallgemeinerung; es sagt dir mehr \xfcber deinen Schmerz als \xfcber die Realit\xe4t.","La pens\xe9e passe d\u2019une dispute \xe0 \xab tout le monde me d\xe9teste \xbb. C\u2019est une g\xe9n\xe9ralisation excessive ; cela te parle plus de ta douleur que de la r\xe9alit\xe9.","\u0627\u0644\u0641\u0643\u0631\u0629 \u062a\u0646\u062a\u0642\u0644 \u0645\u0646 \u062c\u062f\u0627\u0644 \u0648\u0627\u062d\u062f \u0625\u0644\u0649 \u201c\u0627\u0644\u062c\u0645\u064a\u0639 \u064a\u0643\u0631\u0647\u0646\u064a\u201d. \u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u062a\u0639\u0645\u064a\u0645 \u0627\u0644\u0645\u0641\u0631\u0637\u061b \u0625\u0646\u0647 \u064a\u062e\u0628\u0631\u0643 \u0623\u0643\u062b\u0631 \u0639\u0646 \u0623\u0644\u0645\u0643 \u0645\u0646 \u0648\u0627\u0642\u0639 \u0627\u0644\u062d\u0627\u0644.","\uc0dd\uac01\uc740 \ud558\ub098\uc758 \ub17c\uc7c1\uc5d0\uc11c \u201c\ubaa8\ub450\uac00 \ub098\ub97c \uc2eb\uc5b4\ud55c\ub2e4\u201d\ub85c \uc810\ud504\ud569\ub2c8\ub2e4. \uc774\uac83\uc740 \uacfc\uc789 \uc77c\ubc18\ud654\uc785\ub2c8\ub2e4; \uc774\uac83\uc740 \ud604\uc2e4\ubcf4\ub2e4 \ub2f9\uc2e0\uc758 \uc0c1\ucc98\uc5d0 \ub300\ud574 \ub354 \ub9ce\uc774 \ub9d0\ud574\uc90d\ub2c8\ub2e4.","\u8fd9\u4e2a\u60f3\u6cd5\u4ece\u4e00\u6b21\u4e89\u6267\u8df3\u5230\u201c\u6bcf\u4e2a\u4eba\u90fd\u6068\u6211\u201d\u3002\u8fd9\u5c31\u662f\u8fc7\u5ea6\u6cdb\u5316\uff1b\u5b83\u66f4\u591a\u5730\u544a\u8bc9\u4f60\u5173\u4e8e\u4f60\u7684\u4f24\u75db\uff0c\u800c\u4e0d\u662f\u73b0\u5b9e\u3002","\u092f\u0939 \u0935\u093f\u091a\u093e\u0930 \u090f\u0915 \u0924\u0930\u094d\u0915 \u0938\u0947 \u201c\u0938\u092c\u0915\u094b \u092e\u0941\u091d\u0938\u0947 \u0928\u092b\u0930\u0924 \u0939\u0948\u201d \u092e\u0947\u0902 \u0915\u0942\u0926 \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u092f\u0939 \u0905\u0927\u093f\u0915 \u0938\u093e\u092e\u093e\u0928\u094d\u092f\u0940\u0915\u0930\u0923 \u0939\u0948; \u092f\u0939 \u0906\u092a\u0915\u094b \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915\u0924\u093e \u0915\u0947 \u092c\u091c\u093e\u092f \u0906\u092a\u0915\u0947 \u0926\u0930\u094d\u0926 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0905\u0927\u093f\u0915 \u092c\u0924\u093e\u0924\u093e \u0939\u0948\u0964",'Cogitatio a contentione una ad "omnes me oderunt" salit. Haec est supergeneralizatio; magis tibi de dolore tuo quam de re ipsa dicit.',"Il pensiero salta da un litigio a \u201ctutti mi odiano\u201d. Questa \xe8 una sovra-generalisazione; ti dice pi\xf9 del tuo dolore che della realt\xe0.","\u0627\u06cc\u0646 \u0641\u06a9\u0631 \u0627\u0632 \u06cc\u06a9 \u0628\u062d\u062b \u0628\u0647 \u201c\u0647\u0645\u0647 \u0627\u0632 \u0645\u0646 \u0645\u062a\u0646\u0641\u0631\u0646\u062f\u201d \u0645\u06cc\u200c\u067e\u0631\u062f\u0627\u0632\u062f. \u0627\u06cc\u0646 \u06cc\u06a9 \u062a\u0639\u0645\u06cc\u0645 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0627\u0633\u062a\u061b \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0627\u0632 \u062f\u0631\u062f \u0634\u0645\u0627 \u0628\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f \u062a\u0627 \u0648\u0627\u0642\u0639\u06cc\u062a."],t.w)
