B.aeG=new A.d(B.c,["\u201cMy chest is tight when I think about this.\u201d","\u201cMi pecho se tensa cuando pienso en esto.\u201d","\u201eMeine Brust zieht sich zusammen, wenn ich daran denke.\u201c","\xab Ma poitrine se serre quand je pense \xe0 cela. \xbb","\u201c\u0635\u062f\u0631\u064a \u0645\u0634\u062f\u0648\u062f \u0639\u0646\u062f\u0645\u0627 \u0623\u0641\u0643\u0631 \u0641\u064a \u0647\u0630\u0627.\u201d","\u201c\uc774 \uc0dd\uac01\uc744 \ud558\uba74 \uac00\uc2b4\uc774 \uc870\uc5ec.\u201d","\u201c\u6bcf\u6b21\u6211\u60f3\u5230\u8fd9\u4e2a\uff0c\u6211\u7684\u80f8\u53e3\u5c31\u4f1a\u7d27\u3002\u201d","\u201c\u091c\u092c \u092e\u0948\u0902 \u0907\u0938\u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0938\u094b\u091a\u0924\u093e \u0939\u0942\u0901 \u0924\u094b \u092e\u0947\u0930\u0940 \u091b\u093e\u0924\u0940 \u0924\u0902\u0917 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964\u201d","\u201cPectus meum arctum est cum de hoc cogito.\u201d","\u201cIl mio petto si stringe quando penso a questo.\u201d","\u201c\u0648\u0642\u062a\u06cc \u0628\u0647 \u0627\u06cc\u0646 \u0641\u06a9\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645\u060c \u0633\u06cc\u0646\u0647\u200c\u0627\u0645 \u0641\u0634\u0631\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f.\u201d"],t.w)
B.aas=new A.d(B.c,["Thought:\n\u201cEvery time I think about this situation, my chest feels tight and my stomach drops.\u201d\n\nIs that sensation more like signal or noise?","Pensamiento:\n\u201cCada vez que pienso en esta situaci\xf3n, mi pecho se siente apretado y mi est\xf3mago se cae.\u201d\n\n\xbfEs esa sensaci\xf3n m\xe1s como una se\xf1al o ruido?","Gedanke:\n\u201eJedes Mal, wenn ich an diese Situation denke, zieht sich meine Brust zusammen und mein Magen f\xe4llt.\u201c\n\nIst dieses Gef\xfchl eher wie ein Signal oder wie L\xe4rm?","Pens\xe9e :\n\u201cChaque fois que je pense \xe0 cette situation, ma poitrine se serre et mon estomac se noue.\u201d\n\nCette sensation est-elle plus un signal ou du bruit ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0641\u064a \u0643\u0644 \u0645\u0631\u0629 \u0623\u0641\u0643\u0631 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u0627\u0644\u0629\u060c \u064a\u0634\u0639\u0631 \u0635\u062f\u0631\u064a \u0628\u0627\u0644\u0636\u064a\u0642 \u0648\u0645\u0639\u062f\u062a\u064a \u062a\u0647\u0628\u0637.\u201d\n\n\u0647\u0644 \u0647\u0630\u0647 \u0627\u0644\u0625\u062d\u0633\u0627\u0633 \u0623\u0642\u0631\u0628 \u0625\u0644\u0649 \u0625\u0634\u0627\u0631\u0629 \u0623\u0645 \u0636\u0648\u0636\u0627\u0621\u061f","\uc0dd\uac01:\n\u201c\uc774 \uc0c1\ud669\uc5d0 \ub300\ud574 \uc0dd\uac01\ud560 \ub54c\ub9c8\ub2e4 \uac00\uc2b4\uc774 \uc870\uc774\uace0 \ubc30\ub294 \ub0b4\ub824\uac11\ub2c8\ub2e4.\u201d\n\n\uc774 \uac10\uac01\uc740 \uc2e0\ud638\uc640 \uc18c\uc74c \uc911 \ubb34\uc5c7\uc5d0 \ub354 \uac00\uae4c\uc6b4\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6bcf\u6b21\u6211\u60f3\u5230\u8fd9\u4e2a\u60c5\u51b5\uff0c\u6211\u7684\u80f8\u53e3\u5c31\u4f1a\u7d27\uff0c\u80c3\u4e5f\u4f1a\u4e0b\u6c89\u3002\u201d\n\n\u8fd9\u79cd\u611f\u89c9\u66f4\u50cf\u662f\u4fe1\u53f7\u8fd8\u662f\u566a\u97f3\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u091c\u092c \u092e\u0948\u0902 \u0907\u0938 \u0938\u094d\u0925\u093f\u0924\u093f \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0938\u094b\u091a\u0924\u093e \u0939\u0942\u0902, \u0924\u094b \u092e\u0947\u0930\u0940 \u091b\u093e\u0924\u0940 \u0924\u0902\u0917 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948 \u0914\u0930 \u092e\u0947\u0930\u093e \u092a\u0947\u091f \u0917\u093f\u0930 \u091c\u093e\u0924\u093e \u0939\u0948\u0964\u201d\n\n\u0915\u094d\u092f\u093e \u0935\u0939 \u092d\u093e\u0935\u0928\u093e \u0905\u0927\u093f\u0915 \u0938\u0902\u0915\u0947\u0924 \u0915\u0940 \u0924\u0930\u0939 \u0939\u0948 \u092f\u093e \u0936\u094b\u0930 \u0915\u0940 \u0924\u0930\u0939 \u0939\u0948?","Cogitatio:\n\u201cCum de hac re cogito, pectus meum arctum est et venter cadit.\u201d\n\nHaec sensatio magis simile signum est an sonitus?","Pensiero:\n\u201cOgni volta che penso a questa situazione, il mio petto si stringe e il mio stomaco si abbassa.\u201d\n\nQuesta sensazione \xe8 pi\xf9 un segnale o rumore?","\u0641\u06a9\u0631:\n\u201c\u0647\u0631 \u0648\u0642\u062a \u0628\u0647 \u0627\u06cc\u0646 \u0648\u0636\u0639\u06cc\u062a \u0641\u06a9\u0631 \u0645\u06cc\u200c\u06a9\u0646\u0645\u060c \u0633\u06cc\u0646\u0647\u200c\u0627\u0645 \u0641\u0634\u0631\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u0645\u0639\u062f\u0647\u200c\u0627\u0645 \u067e\u0627\u06cc\u06cc\u0646 \u0645\u06cc\u200c\u0622\u06cc\u062f.\u201d\n\n\u0622\u06cc\u0627 \u0627\u06cc\u0646 \u062d\u0633 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0647 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0634\u0628\u06cc\u0647 \u0627\u0633\u062a \u06cc\u0627 \u0646\u0648\u06cc\u0632\u061f"],t.w)
B.a9A=new A.d(B.c,["Signal: my body is telling me something about stress or danger.","Se\xf1al: mi cuerpo me est\xe1 diciendo algo sobre el estr\xe9s o el peligro.","Signal: Mein K\xf6rper sagt mir etwas \xfcber Stress oder Gefahr.","Signal : mon corps me dit quelque chose sur le stress ou le danger.","\u0625\u0634\u0627\u0631\u0629: \u062c\u0633\u062f\u064a \u064a\u062e\u0628\u0631\u0646\u064a \u0628\u0634\u064a\u0621 \u0639\u0646 \u0627\u0644\u062a\u0648\u062a\u0631 \u0623\u0648 \u0627\u0644\u062e\u0637\u0631.","\uc2e0\ud638: \ub0b4 \ubab8\uc774 \uc2a4\ud2b8\ub808\uc2a4\ub098 \uc704\ud5d8\uc5d0 \ub300\ud574 \ubb54\uac00 \ub9d0\ud558\uace0 \uc788\uc5b4.","\u4fe1\u53f7\uff1a\u6211\u7684\u8eab\u4f53\u544a\u8bc9\u6211\u4e00\u4e9b\u5173\u4e8e\u538b\u529b\u6216\u5371\u9669\u7684\u4e8b\u60c5\u3002","\u0938\u0902\u0915\u0947\u0924: \u092e\u0947\u0930\u093e \u0936\u0930\u0940\u0930 \u092e\u0941\u091d\u0947 \u0924\u0928\u093e\u0935 \u092f\u093e \u0916\u0924\u0930\u0947 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0915\u0941\u091b \u092c\u0924\u093e \u0930\u0939\u093e \u0939\u0948\u0964","Signum: corpus meum aliquid de pressura aut periculo mihi dicit.","Segnale: il mio corpo mi sta dicendo qualcosa riguardo lo stress o il pericolo.","\u0633\u06cc\u06af\u0646\u0627\u0644: \u0628\u062f\u0646\u0645 \u0686\u06cc\u0632\u06cc \u062f\u0631 \u0645\u0648\u0631\u062f \u0627\u0633\u062a\u0631\u0633 \u06cc\u0627 \u062e\u0637\u0631 \u0628\u0647 \u0645\u0646 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f."],t.w)
