B.a8U=new A.d(B.c,["Random noise with zero meaning ever.","Ruido aleatorio sin ning\xfan significado.","Zuf\xe4lliger L\xe4rm ohne jegliche Bedeutung.","Bruit al\xe9atoire sans aucun sens.","\u0636\u0648\u0636\u0627\u0621 \u0639\u0634\u0648\u0627\u0626\u064a\u0629 \u0628\u0644\u0627 \u0645\u0639\u0646\u0649 \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.","\uc758\ubbf8 \uc5c6\ub294 \ubb34\uc791\uc704 \uc18c\uc74c.","\u6ca1\u6709\u4efb\u4f55\u610f\u4e49\u7684\u968f\u673a\u566a\u97f3\u3002","\u0915\u092d\u0940 \u092d\u0940 \u0915\u094b\u0908 \u0905\u0930\u094d\u0925 \u0928 \u0939\u094b\u0928\u0947 \u0935\u093e\u0932\u0940 \u092f\u093e\u0926\u0943\u091a\u094d\u091b\u093f\u0915 \u0936\u094b\u0930\u0964","Strepitus casuarius sine ullo sensu.","Rumore casuale senza alcun significato.","\u0646\u0648\u06cc\u0632 \u062a\u0635\u0627\u062f\u0641\u06cc \u0628\u062f\u0648\u0646 \u0647\u06cc\u0686 \u0645\u0639\u0646\u06cc\u200c\u0627\u06cc."],t.w)
