B.adq=new A.d(B.c,["A sign I should never feel anything again.","Una se\xf1al de que nunca debo volver a sentir nada.","Ein Zeichen, dass ich nie wieder etwas f\xfchlen sollte.","Un signe que je ne devrais plus jamais rien ressentir.","\u0625\u0634\u0627\u0631\u0629 \u0639\u0644\u0649 \u0623\u0646\u0647 \u064a\u062c\u0628 \u0623\u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u0623\u064a \u0634\u064a\u0621 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.","\ub2e4\uc2dc\ub294 \uc544\ubb34\uac83\ub3c4 \ub290\uaef4\uc11c\ub294 \uc548 \ub41c\ub2e4\ub294 \uc2e0\ud638.","\u4e00\u4e2a\u8868\u793a\u6211\u6c38\u8fdc\u4e0d\u5e94\u8be5\u518d\u611f\u53d7\u5230\u4efb\u4f55\u4e1c\u897f\u7684\u4fe1\u53f7\u3002","\u090f\u0915 \u0938\u0902\u0915\u0947\u0924 \u0915\u093f \u092e\u0941\u091d\u0947 \u092b\u093f\u0930 \u0915\u092d\u0940 \u0915\u0941\u091b \u092e\u0939\u0938\u0942\u0938 \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f\u0964","Signum quod numquam quidquam amplius sentiam.","Un segno che non dovrei mai pi\xf9 sentire nulla.","\u0646\u0634\u0627\u0646\u0647\u200c\u0627\u06cc \u06a9\u0647 \u0628\u0627\u06cc\u062f \u0647\u06cc\u0686\u200c\u0686\u06cc\u0632 \u062f\u06cc\u06af\u0631\u06cc \u0627\u062d\u0633\u0627\u0633 \u0646\u06a9\u0646\u0645."],t.w)
