B.aa3=new A.d(B.c,["Body reactions often contain useful information about stress, fear, or boundaries. They are not always precise, but they are not \u201cnothing\u201d.","Las reacciones del cuerpo a menudo contienen informaci\xf3n \xfatil sobre el estr\xe9s, el miedo o los l\xedmites. No siempre son precisas, pero no son \u201cnada\u201d.","K\xf6rperreaktionen enthalten oft n\xfctzliche Informationen \xfcber Stress, Angst oder Grenzen. Sie sind nicht immer pr\xe4zise, aber sie sind nicht \u201enichts\u201c.","Les r\xe9actions du corps contiennent souvent des informations utiles sur le stress, la peur ou les limites. Elles ne sont pas toujours pr\xe9cises, mais elles ne sont pas \xab rien \xbb.",'\u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u062a\u062d\u062a\u0648\u064a \u0631\u062f\u0648\u062f \u0641\u0639\u0644 \u0627\u0644\u062c\u0633\u0645 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0645\u0641\u064a\u062f\u0629 \u062d\u0648\u0644 \u0627\u0644\u062a\u0648\u062a\u0631 \u0623\u0648 \u0627\u0644\u062e\u0648\u0641 \u0623\u0648 \u0627\u0644\u062d\u062f\u0648\u062f. \u0644\u064a\u0633\u062a \u062f\u0627\u0626\u0645\u064b\u0627 \u062f\u0642\u064a\u0642\u0629\u060c \u0644\u0643\u0646\u0647\u0627 \u0644\u064a\u0633\u062a "\u0644\u0627 \u0634\u064a\u0621".',"\uc2e0\uccb4 \ubc18\uc751\uc740 \uc885\uc885 \uc2a4\ud2b8\ub808\uc2a4, \ub450\ub824\uc6c0 \ub610\ub294 \uacbd\uacc4\uc5d0 \ub300\ud55c \uc720\uc6a9\ud55c \uc815\ubcf4\ub97c \ud3ec\ud568\ud569\ub2c8\ub2e4. \ud56d\uc0c1 \uc815\ud655\ud558\uc9c0\ub294 \uc54a\uc9c0\ub9cc \u201c\uc544\ubb34\uac83\ub3c4 \uc544\ub2c8\ub2e4\u201d\ub294 \uc544\ub2c8\ub2e4.","\u8eab\u4f53\u53cd\u5e94\u901a\u5e38\u5305\u542b\u6709\u5173\u538b\u529b\u3001\u6050\u60e7\u6216\u8fb9\u754c\u7684\u6709\u7528\u4fe1\u606f\u3002\u5b83\u4eec\u5e76\u4e0d\u603b\u662f\u7cbe\u786e\u7684\uff0c\u4f46\u5b83\u4eec\u4e0d\u662f\u201c\u4ec0\u4e48\u90fd\u6ca1\u6709\u201d\u3002",'\u0936\u093e\u0930\u0940\u0930\u093f\u0915 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e\u090f\u0901 \u0905\u0915\u094d\u0938\u0930 \u0924\u0928\u093e\u0935, \u0921\u0930 \u092f\u093e \u0938\u0940\u092e\u093e\u0913\u0902 \u0915\u0947 \u092c\u093e\u0930\u0947 \u092e\u0947\u0902 \u0909\u092a\u092f\u094b\u0917\u0940 \u091c\u093e\u0928\u0915\u093e\u0930\u0940 \u092a\u094d\u0930\u0926\u093e\u0928 \u0915\u0930\u0924\u0940 \u0939\u0948\u0902\u0964 \u092f\u0947 \u0939\u092e\u0947\u0936\u093e \u0938\u091f\u0940\u0915 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u0940\u0902, \u0932\u0947\u0915\u093f\u0928 \u092f\u0939 "\u0915\u0941\u091b \u0928\u0939\u0940\u0902" \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u0940\u0964',"Corporis reactiones saepe continent utilissima indicia de pressura, timore, vel limitibus. Non semper sunt precisissima, sed non sunt \u201cnihil\u201d.","Le reazioni del corpo spesso contengono informazioni utili sullo stress, la paura o i confini. Non sono sempre precise, ma non sono \u201cniente\u201d.",'\u0648\u0627\u06a9\u0646\u0634\u200c\u0647\u0627\u06cc \u0628\u062f\u0646\u06cc \u0627\u063a\u0644\u0628 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0645\u0641\u06cc\u062f\u06cc \u062f\u0631 \u0645\u0648\u0631\u062f \u0627\u0633\u062a\u0631\u0633\u060c \u062a\u0631\u0633 \u06cc\u0627 \u0645\u0631\u0632\u0647\u0627 \u062f\u0627\u0631\u0646\u062f. \u0622\u0646\u200c\u0647\u0627 \u0647\u0645\u06cc\u0634\u0647 \u062f\u0642\u06cc\u0642 \u0646\u06cc\u0633\u062a\u0646\u062f\u060c \u0627\u0645\u0627 \u0622\u0646\u200c\u0647\u0627 "\u0647\u06cc\u0686\u200c\u0686\u06cc\u0632" \u0646\u06cc\u0633\u062a\u0646\u062f.'],t.w)
