B.abR=new A.d(B.c,["\u201cI\u2019m always a failure.\u201d","\u201cSiempre soy un fracaso.\u201d","\u201eIch bin immer ein Versager.\u201c","\xab Je suis toujours un \xe9chec. \xbb","\u201c\u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0641\u0627\u0634\u0644.\u201d","\u201c\ub098\ub294 \ud56d\uc0c1 \uc2e4\ud328\uc790\uc57c.\u201d","\u201c\u6211\u603b\u662f\u5931\u8d25\u3002\u201d","\u201c\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u090f\u0915 \u0935\u093f\u092b\u0932\u0924\u093e \u0939\u0942\u0902\u0964\u201d","\u201cSemper sum defectus.\u201d","\u201cSono sempre un fallimento.\u201d","\u201c\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u06cc\u06a9 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0647 \u0647\u0633\u062a\u0645.\u201d"],t.w)
B.a9g=new A.d(B.c,["Thought:\n\u201cI\u2019m always a failure.\u201d\n\nYou\u2019ve failed at one task, and your mind generalizes that to all of your efforts.\nIs this closer to useful signal or noisy self-attack?","Pensamiento:\n\u201cSiempre soy un fracaso.\u201d\n\nFallaste en una tarea, y tu mente generaliza eso a todos tus esfuerzos.\n\xbfSe trata de una se\xf1al \xfatil o un ataque ruidoso a ti mismo?","Gedanke:\n\u201eIch bin immer ein Versager.\u201c\n\nDu bist bei einer Aufgabe gescheitert, und dein Gehirn verallgemeinert das auf alle deine Bem\xfchungen.\nIst das ein n\xfctzliches Signal oder einfach nur ein Selbstangriff?","Pens\xe9e :\n\u201cJe suis toujours un \xe9chec.\u201d\n\nVous avez \xe9chou\xe9 dans une t\xe2che, et votre esprit g\xe9n\xe9ralise cela \xe0 tous vos efforts.\nCela ressemble-t-il \xe0 un signal utile ou \xe0 une attaque bruyante sur soi-m\xeame ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0641\u0627\u0634\u0644.\u201d\n\n\u0644\u0642\u062f \u0641\u0634\u0644\u062a \u0641\u064a \u0645\u0647\u0645\u0629 \u0648\u0627\u062d\u062f\u0629\u060c \u0648\u0639\u0642\u0644\u0643 \u064a\u0639\u0645\u0645 \u0630\u0644\u0643 \u0639\u0644\u0649 \u062c\u0645\u064a\u0639 \u062c\u0647\u0648\u062f\u0643.\n\u0647\u0644 \u0647\u0630\u0627 \u0623\u0642\u0631\u0628 \u0625\u0644\u0649 \u0625\u0634\u0627\u0631\u0629 \u0645\u0641\u064a\u062f\u0629 \u0623\u0645 \u0647\u062c\u0648\u0645 \u0630\u0627\u062a\u064a \u0636\u0648\u0636\u0627\u0626\u064a\u061f","\uc0dd\uac01:\n\u201c\ub098\ub294 \ud56d\uc0c1 \uc2e4\ud328\uc790\uc57c.\u201d\n\n\ud55c \uc791\uc5c5\uc5d0\uc11c \uc2e4\ud328\ud588\ub294\ub370, \ub124 \ub9c8\uc74c\uc740 \uadf8\uac83\uc744 \ubaa8\ub4e0 \ub178\ub825\uc5d0 \uc77c\ubc18\ud654\ud55c\ub2e4.\n\uc774\uac83\uc774 \uc720\uc6a9\ud55c \uc2e0\ud638\uc778\uc9c0 \uc544\ub2c8\uba74 \uc18c\uc74c\uc774 \uac00\ub4dd\ud55c \uc790\uae30 \uacf5\uaca9\uc778\uc9c0 \uc5b4\ub5a4\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6211\u603b\u662f\u5931\u8d25\u3002\u201d\n\n\u4f60\u5728\u4e00\u4e2a\u4efb\u52a1\u4e2d\u5931\u8d25\u4e86\uff0c\u4f60\u7684\u5927\u8111\u5c06\u8fd9\u4e00\u70b9\u63a8\u5e7f\u5230\u4f60\u6240\u6709\u7684\u52aa\u529b\u3002\n\u8fd9\u662f\u63a5\u8fd1\u6709\u7528\u7684\u4fe1\u53f7\uff0c\u8fd8\u662f\u5145\u6ee1\u566a\u97f3\u7684\u81ea\u6211\u653b\u51fb\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u090f\u0915 \u0935\u093f\u092b\u0932\u0924\u093e \u0939\u0942\u0902\u0964\u201d\n\n\u0906\u092a \u090f\u0915 \u0915\u093e\u0930\u094d\u092f \u092e\u0947\u0902 \u0935\u093f\u092b\u0932 \u0939\u094b \u0917\u090f \u0939\u0948\u0902, \u0914\u0930 \u0906\u092a\u0915\u093e \u092e\u0928 \u0907\u0938\u0947 \u0906\u092a\u0915\u0940 \u0938\u092d\u0940 \u0915\u094b\u0936\u093f\u0936\u094b\u0902 \u092a\u0930 \u0938\u093e\u092e\u093e\u0928\u094d\u092f\u0940\u0915\u0943\u0924 \u0915\u0930\u0924\u093e \u0939\u0948\u0964\n\u0915\u094d\u092f\u093e \u092f\u0939 \u0909\u092a\u092f\u094b\u0917\u0940 \u0938\u0902\u0915\u0947\u0924 \u0915\u0947 \u0915\u0930\u0940\u092c \u0939\u0948 \u092f\u093e \u0936\u094b\u0930 \u0938\u0947 \u092d\u0930\u0940 \u0906\u0924\u094d\u092e-\u0939\u092e\u0932\u093e \u0939\u0948?","Cogitatio:\n\u201cSemper sum defectus.\u201d\n\nUnum officium defecisti, et animus tuus id ad omnes conatus tuos generalizat.\nHoc propinquum est utile signum vel nugarum ad se ipso impetum?","Pensiero:\n\u201cSono sempre un fallimento.\u201d\n\nHai fallito in un compito e la tua mente generalizza questo a tutti i tuoi sforzi.\nQuesto \xe8 pi\xf9 vicino a un segnale utile o a un attacco rumoroso verso te stesso?","\u0641\u06a9\u0631:\n\u201c\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u06cc\u06a9 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0647 \u0647\u0633\u062a\u0645.\u201d\n\n\u062f\u0631 \u06cc\u06a9 \u06a9\u0627\u0631 \u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u06cc \u0648 \u0630\u0647\u0646\u062a \u0627\u06cc\u0646 \u0631\u0627 \u0628\u0647 \u0647\u0645\u0647 \u062a\u0644\u0627\u0634\u062a \u062a\u0639\u0645\u06cc\u0645 \u0645\u06cc\u200c\u062f\u0647\u062f.\n\u0622\u06cc\u0627 \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0647 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0641\u06cc\u062f \u0646\u0632\u062f\u06cc\u06a9 \u0627\u0633\u062a \u06cc\u0627 \u062d\u0645\u0644\u0647\u200c\u0627\u06cc \u067e\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627 \u0628\u0647 \u062e\u0648\u062f\u061f"],t.w)
