B.ado=new A.d(B.c,["\u201cI can never do anything right.\u201d","\u201cNunca puedo hacer nada bien.\u201d","\u201eIch kann nie etwas richtig machen.\u201c","\xab Je ne peux jamais rien faire de bien. \xbb","\u201c\u0623\u0646\u0627 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0641\u0639\u0644 \u0623\u064a \u0634\u064a\u0621 \u0628\u0634\u0643\u0644 \u0635\u062d\u064a\u062d.\u201d","\u201c\ub098\ub294 \uc808\ub300 \uc544\ubb34\uac83\ub3c4 \uc81c\ub300\ub85c \ud560 \uc218 \uc5c6\uc5b4.\u201d","\u201c\u6211\u6c38\u8fdc\u505a\u4e0d\u597d\u4efb\u4f55\u4e8b\u60c5\u3002\u201d","\u201c\u092e\u0948\u0902 \u0915\u092d\u0940 \u0915\u0941\u091b \u092d\u0940 \u0938\u0939\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u093e\u0964\u201d","\u201cNihil umquam recte facere possum.\u201d","\u201cNon riesco mai a fare nulla di giusto.\u201d","\u201c\u0645\u0646 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0631\u0627 \u062f\u0631\u0633\u062a \u0627\u0646\u062c\u0627\u0645 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645.\u201d"],t.w)
B.a9U=new A.d(B.c,["Thought:\n\u201cI can never do anything right.\u201d\n\nYou made a small mistake in a task, and now your mind is telling you that everything you do is wrong.\nIs this closer to useful signal or noisy self-attack?","Pensamiento:\n\u201cNunca puedo hacer nada bien.\u201d\n\nCometiste un peque\xf1o error en una tarea y ahora tu mente te dice que todo lo que haces est\xe1 mal.\n\xbfSe trata de una se\xf1al \xfatil o un ataque ruidoso a ti mismo?","Gedanke:\n\u201eIch kann nie etwas richtig machen.\u201c\n\nDu hast einen kleinen Fehler in einer Aufgabe gemacht und jetzt sagt dir dein Gehirn, dass alles, was du tust, falsch ist.\nIst das ein n\xfctzliches Signal oder einfach nur ein Selbstangriff?","Pens\xe9e :\n\u201cJe ne peux jamais rien faire de bien.\u201d\n\nVous avez fait une petite erreur dans une t\xe2che, et maintenant votre esprit vous dit que tout ce que vous faites est faux.\nCela ressemble-t-il \xe0 un signal utile ou \xe0 une attaque bruyante sur soi-m\xeame ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0623\u0646\u0627 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0641\u0639\u0644 \u0623\u064a \u0634\u064a\u0621 \u0628\u0634\u0643\u0644 \u0635\u062d\u064a\u062d.\u201d\n\n\u0644\u0642\u062f \u0627\u0631\u062a\u0643\u0628\u062a \u062e\u0637\u0623 \u0635\u063a\u064a\u0631\u064b\u0627 \u0641\u064a \u0645\u0647\u0645\u0629\u060c \u0648\u0627\u0644\u0622\u0646 \u064a\u0642\u0648\u0644 \u0644\u0643 \u0639\u0642\u0644\u0643 \u0623\u0646 \u0643\u0644 \u0634\u064a\u0621 \u062a\u0641\u0639\u0644\u0647 \u062e\u0627\u0637\u0626.\n\u0647\u0644 \u0647\u0630\u0627 \u0623\u0642\u0631\u0628 \u0625\u0644\u0649 \u0625\u0634\u0627\u0631\u0629 \u0645\u0641\u064a\u062f\u0629 \u0623\u0645 \u0647\u062c\u0648\u0645 \u0630\u0627\u062a\u064a \u0636\u0648\u0636\u0627\u0626\u064a\u061f","\uc0dd\uac01:\n\u201c\ub098\ub294 \uc808\ub300 \uc544\ubb34\uac83\ub3c4 \uc81c\ub300\ub85c \ud560 \uc218 \uc5c6\uc5b4.\u201d\n\n\uc791\uc5c5\uc5d0\uc11c \uc791\uc740 \uc2e4\uc218\ub97c \ud588\uace0, \uc774\uc81c \ub2f9\uc2e0\uc758 \ub1cc\ub294 \ub2f9\uc2e0\uc774 \ud558\ub294 \ubaa8\ub4e0 \uc77c\uc774 \uc798\ubabb\ub410\ub2e4\uace0 \ub9d0\ud569\ub2c8\ub2e4.\n\uc774\uac83\uc774 \uc720\uc6a9\ud55c \uc2e0\ud638\uc778\uc9c0 \uc544\ub2c8\uba74 \uc18c\uc74c\uc774 \uac00\ub4dd\ud55c \uc790\uae30 \uacf5\uaca9\uc778\uc9c0 \uc5b4\ub5a4\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6211\u6c38\u8fdc\u505a\u4e0d\u597d\u4efb\u4f55\u4e8b\u60c5\u3002\u201d\n\n\u4f60\u5728\u4e00\u4e2a\u4efb\u52a1\u4e2d\u72af\u4e86\u4e00\u4e2a\u5c0f\u9519\u8bef\uff0c\u73b0\u5728\u4f60\u7684\u5927\u8111\u544a\u8bc9\u4f60\uff0c\u4f60\u505a\u7684\u6bcf\u4ef6\u4e8b\u90fd\u662f\u9519\u7684\u3002\n\u8fd9\u662f\u63a5\u8fd1\u6709\u7528\u7684\u4fe1\u53f7\uff0c\u8fd8\u662f\u5145\u6ee1\u566a\u97f3\u7684\u81ea\u6211\u653b\u51fb\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902 \u0915\u092d\u0940 \u0915\u0941\u091b \u092d\u0940 \u0938\u0939\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u093e\u0964\u201d\n\n\u0906\u092a\u0928\u0947 \u090f\u0915 \u0915\u093e\u0930\u094d\u092f \u092e\u0947\u0902 \u090f\u0915 \u091b\u094b\u091f\u0940 \u0938\u0940 \u0917\u0932\u0924\u0940 \u0915\u0940, \u0914\u0930 \u0905\u092c \u0906\u092a\u0915\u093e \u092e\u0928 \u0906\u092a\u0915\u094b \u092f\u0939 \u092c\u0924\u093e \u0930\u0939\u093e \u0939\u0948 \u0915\u093f \u0906\u092a \u091c\u094b \u0915\u0941\u091b \u092d\u0940 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0935\u0939 \u0917\u0932\u0924 \u0939\u0948\u0964\n\u0915\u094d\u092f\u093e \u092f\u0939 \u0909\u092a\u092f\u094b\u0917\u0940 \u0938\u0902\u0915\u0947\u0924 \u0915\u0947 \u0915\u0930\u0940\u092c \u0939\u0948 \u092f\u093e \u0936\u094b\u0930 \u0938\u0947 \u092d\u0930\u0940 \u0906\u0924\u094d\u092e-\u0939\u092e\u0932\u093e \u0939\u0948?","Cogitatio:\n\u201cNihil umquam recte facere possum.\u201d\n\nParvum erratum in officio fecisti et nunc animus tuus dicit te omnia facere male.\nHoc propinquum est utile signum vel nugarum ad se ipso impetum?","Pensiero:\n\u201cNon riesco mai a fare nulla di giusto.\u201d\n\nHai fatto un piccolo errore in un compito, e ora la tua mente ti sta dicendo che tutto ci\xf2 che fai \xe8 sbagliato.\nQuesto \xe8 pi\xf9 vicino a un segnale utile o a un attacco rumoroso verso te stesso?","\u0641\u06a9\u0631:\n\u201c\u0645\u0646 \u0647\u06cc\u0686 \u0648\u0642\u062a \u0647\u06cc\u0686 \u0686\u06cc\u0632\u06cc \u0631\u0627 \u062f\u0631\u0633\u062a \u0627\u0646\u062c\u0627\u0645 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0645.\u201d\n\n\u0634\u0645\u0627 \u062f\u0631 \u06cc\u06a9 \u06a9\u0627\u0631 \u06a9\u0648\u0686\u06a9 \u0627\u0634\u062a\u0628\u0627\u0647 \u06a9\u0631\u062f\u06cc\u062f\u060c \u0648 \u062d\u0627\u0644\u0627 \u0630\u0647\u0646\u062a\u0627\u0646 \u0628\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f \u06a9\u0647 \u0647\u0645\u0647 \u0686\u06cc\u0632\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f \u0627\u0634\u062a\u0628\u0627\u0647 \u0627\u0633\u062a.\n\u0622\u06cc\u0627 \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0647 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0641\u06cc\u062f \u0646\u0632\u062f\u06cc\u06a9 \u0627\u0633\u062a \u06cc\u0627 \u062d\u0645\u0644\u0647\u200c\u0627\u06cc \u067e\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627 \u0628\u0647 \u062e\u0648\u062f\u061f"],t.w)
