B.a8x=new A.d(B.c,["\u201cI\u2019m always failing.\u201d","\u201cSiempre estoy fracasando.\u201d","\u201eIch scheitere immer.\u201c","\xab Je suis toujours en \xe9chec. \xbb","\u201c\u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0623\u0641\u0634\u0644.\u201d","\u201c\ub098\ub294 \ud56d\uc0c1 \uc2e4\ud328\ud574.\u201d","\u201c\u6211\u603b\u662f\u5931\u8d25\u3002\u201d","\u201c\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u0905\u0938\u092b\u0932 \u0939\u0942\u0902\u0964\u201d","\u201cSemper deficio.\u201d","\u201cSono sempre un fallimento.\u201d","\u201c\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06a9\u0633\u062a \u0645\u06cc\u200c\u062e\u0648\u0631\u0645.\u201d"],t.w)
B.adH=new A.d(B.c,["Thought:\n\u201cI\u2019m always failing.\u201d\n\nYou had a tough experience with a project, and now your mind is telling you that you are always failing.\nIs this closer to useful signal or noisy self-attack?","Pensamiento:\n\u201cSiempre estoy fracasando.\u201d\n\nTuviste una experiencia dif\xedcil con un proyecto, y tu mente te est\xe1 diciendo que siempre est\xe1s fracasando.\n\xbfEs una se\xf1al \xfatil o un ataque ruidoso a ti mismo?","Gedanke:\n\u201eIch scheitere immer.\u201c\n\nDu hattest eine schwierige Erfahrung mit einem Projekt, und dein Gehirn sagt dir, dass du immer scheiterst.\nIst das ein n\xfctzliches Signal oder einfach nur ein Selbstangriff?","Pens\xe9e :\n\u201cJe suis toujours en \xe9chec.\u201d\n\nVous avez eu une exp\xe9rience difficile avec un projet, et votre esprit vous dit que vous \xe9chouez toujours.\nCela ressemble-t-il \xe0 un signal utile ou \xe0 une attaque bruyante sur soi-m\xeame ?","\u0627\u0644\u0641\u0643\u0631\u0629:\n\u201c\u0623\u0646\u0627 \u062f\u0627\u0626\u0645\u064b\u0627 \u0623\u0641\u0634\u0644.\u201d\n\n\u0644\u0642\u062f \u0645\u0631\u0631\u062a \u0628\u062a\u062c\u0631\u0628\u0629 \u0635\u0639\u0628\u0629 \u0645\u0639 \u0645\u0634\u0631\u0648\u0639\u060c \u0648\u0627\u0644\u0622\u0646 \u064a\u0642\u0648\u0644 \u0644\u0643 \u0639\u0642\u0644\u0643 \u0623\u0646\u0643 \u062f\u0627\u0626\u0645\u064b\u0627 \u062a\u0641\u0634\u0644.\n\u0647\u0644 \u0647\u0630\u0627 \u0623\u0642\u0631\u0628 \u0625\u0644\u0649 \u0625\u0634\u0627\u0631\u0629 \u0645\u0641\u064a\u062f\u0629 \u0623\u0645 \u0647\u062c\u0648\u0645 \u0630\u0627\u062a\u064a \u0636\u0648\u0636\u0627\u0626\u064a\u061f","\uc0dd\uac01:\n\u201c\ub098\ub294 \ud56d\uc0c1 \uc2e4\ud328\ud574.\u201d\n\n\ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \ud798\ub4e0 \uacbd\ud5d8\uc744 \ud588\uace0, \uc774\uc81c \ub124 \ub1cc\ub294 \ud56d\uc0c1 \uc2e4\ud328\ud55c\ub2e4\uace0 \ub9d0\ud558\uace0 \uc788\uc5b4.\n\uc774\uac83\uc774 \uc720\uc6a9\ud55c \uc2e0\ud638\uc778\uc9c0 \uc544\ub2c8\uba74 \uc18c\uc74c\uc774 \uac00\ub4dd\ud55c \uc790\uae30 \uacf5\uaca9\uc778\uc9c0 \uc5b4\ub5a4\uac00\uc694?","\u60f3\u6cd5\uff1a\n\u201c\u6211\u603b\u662f\u5931\u8d25\u3002\u201d\n\n\u4f60\u5728\u4e00\u4e2a\u9879\u76ee\u4e2d\u7ecf\u5386\u4e86\u8270\u96be\u7684\u65f6\u523b\uff0c\u73b0\u5728\u4f60\u7684\u5927\u8111\u544a\u8bc9\u4f60\u4f60\u603b\u662f\u5931\u8d25\u3002\n\u8fd9\u662f\u63a5\u8fd1\u6709\u7528\u7684\u4fe1\u53f7\uff0c\u8fd8\u662f\u5145\u6ee1\u566a\u97f3\u7684\u81ea\u6211\u653b\u51fb\uff1f","\u0935\u093f\u091a\u093e\u0930:\n\u201c\u092e\u0948\u0902 \u0939\u092e\u0947\u0936\u093e \u0905\u0938\u092b\u0932 \u0939\u0942\u0902\u0964\u201d\n\n\u0906\u092a\u0928\u0947 \u090f\u0915 \u092a\u094d\u0930\u094b\u091c\u0947\u0915\u094d\u091f \u0915\u0947 \u0938\u093e\u0925 \u0915\u0920\u093f\u0928 \u0905\u0928\u0941\u092d\u0935 \u0915\u093f\u092f\u093e, \u0914\u0930 \u0905\u092c \u0906\u092a\u0915\u093e \u092e\u0928 \u0906\u092a\u0915\u094b \u092c\u0924\u093e \u0930\u0939\u093e \u0939\u0948 \u0915\u093f \u0906\u092a \u0939\u092e\u0947\u0936\u093e \u0905\u0938\u092b\u0932 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964\n\u0915\u094d\u092f\u093e \u092f\u0939 \u0909\u092a\u092f\u094b\u0917\u0940 \u0938\u0902\u0915\u0947\u0924 \u0915\u0947 \u0915\u0930\u0940\u092c \u0939\u0948 \u092f\u093e \u0936\u094b\u0930 \u0938\u0947 \u092d\u0930\u0940 \u0906\u0924\u094d\u092e-\u0939\u092e\u0932\u093e \u0939\u0948?","Cogitatio:\n\u201cSemper deficio.\u201d\n\nDura experientia cum projectu habuisti et nunc animus tuus dicit te semper deficere.\nHoc propinquum est utile signum vel nugarum ad se ipso impetum?","Pensiero:\n\u201cSono sempre un fallimento.\u201d\n\nHai avuto un\u2019esperienza difficile con un progetto, e ora la tua mente ti dice che stai sempre fallendo.\nQuesto \xe8 pi\xf9 vicino a un segnale utile o a un attacco rumoroso verso te stesso?","\u0641\u06a9\u0631:\n\u201c\u0645\u0646 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06a9\u0633\u062a \u0645\u06cc\u200c\u062e\u0648\u0631\u0645.\u201d\n\n\u0634\u0645\u0627 \u062a\u062c\u0631\u0628\u0647\u200c\u0627\u06cc \u0633\u062e\u062a \u0628\u0627 \u06cc\u06a9 \u067e\u0631\u0648\u0698\u0647 \u062f\u0627\u0634\u062a\u06cc\u062f \u0648 \u062d\u0627\u0644\u0627 \u0630\u0647\u0646\u062a\u0627\u0646 \u0628\u0647 \u0634\u0645\u0627 \u0645\u06cc\u200c\u06af\u0648\u06cc\u062f \u06a9\u0647 \u0647\u0645\u06cc\u0634\u0647 \u0634\u06a9\u0633\u062a \u0645\u06cc\u200c\u062e\u0648\u0631\u06cc\u062f.\n\u0622\u06cc\u0627 \u0627\u06cc\u0646 \u0628\u06cc\u0634\u062a\u0631 \u0628\u0647 \u0633\u06cc\u06af\u0646\u0627\u0644 \u0645\u0641\u06cc\u062f \u0646\u0632\u062f\u06cc\u06a9 \u0627\u0633\u062a \u06cc\u0627 \u062d\u0645\u0644\u0647\u200c\u0627\u06cc \u067e\u0631 \u0633\u0631 \u0648 \u0635\u062f\u0627 \u0628\u0647 \u062e\u0648\u062f\u061f"],t.w)
B.a88=new A.d(B.c,["This thought takes one failure and applies it to all future efforts. That is overgeneralization; it distorts reality and increases self-criticism.","Este pensamiento toma un fracaso y lo aplica a todos los esfuerzos futuros. Eso es una sobregeneralizaci\xf3n; distorsiona la realidad y aumenta la autocr\xedtica.","Dieser Gedanke nimmt ein Scheitern und wendet es auf alle zuk\xfcnftigen Bem\xfchungen an. Das ist eine \xdcberverallgemeinerung; es verzerrt die Realit\xe4t und verst\xe4rkt die Selbstkritik.","Cette pens\xe9e prend un \xe9chec et l\u2019applique \xe0 tous les efforts futurs. C\u2019est une g\xe9n\xe9ralisation excessive ; cela d\xe9forme la r\xe9alit\xe9 et augmente l\u2019autocritique.","\u062a\u0641\u0643\u0631 \u0647\u0630\u0647 \u0627\u0644\u0641\u0643\u0631\u0629 \u0641\u064a \u0641\u0634\u0644 \u0648\u0627\u062d\u062f \u0648\u062a\u0637\u0628\u0642\u0647 \u0639\u0644\u0649 \u062c\u0645\u064a\u0639 \u0627\u0644\u062c\u0647\u0648\u062f \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629. \u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u062a\u0639\u0645\u064a\u0645 \u0627\u0644\u0645\u0641\u0631\u0637\u061b \u0625\u0646\u0647 \u064a distort \u0627\u0644\u0648\u0627\u0642\u0639 \u0648\u064a\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0646\u0642\u062f \u0627\u0644\u0630\u0627\u062a\u064a.","\uc774 \uc0dd\uac01\uc740 \ud558\ub098\uc758 \uc2e4\ud328\ub97c \uac00\uc838\uc640 \ubaa8\ub4e0 \ubbf8\ub798\uc758 \ub178\ub825\uc5d0 \uc801\uc6a9\ud569\ub2c8\ub2e4. \uc774\uac83\uc740 \uacfc\uc789 \uc77c\ubc18\ud654\uc785\ub2c8\ub2e4; \ud604\uc2e4\uc744 \uc65c\uace1\ud558\uace0 \uc790\uae30 \ube44\ud310\uc744 \uc99d\uac00\uc2dc\ud0b5\ub2c8\ub2e4.","\u8fd9\u4e2a\u60f3\u6cd5\u628a\u4e00\u6b21\u5931\u8d25\u5e94\u7528\u5230\u6240\u6709\u672a\u6765\u7684\u52aa\u529b\u4e0a\u3002\u8fd9\u5c31\u662f\u8fc7\u5ea6\u6cdb\u5316\uff1b\u5b83\u626d\u66f2\u4e86\u73b0\u5b9e\u5e76\u589e\u52a0\u4e86\u81ea\u6211\u6279\u8bc4\u3002","\u092f\u0939 \u0935\u093f\u091a\u093e\u0930 \u090f\u0915 \u0905\u0938\u092b\u0932\u0924\u093e \u0915\u094b \u0932\u0947\u0915\u0930 \u0909\u0938\u0947 \u0938\u092d\u0940 \u092d\u0935\u093f\u0937\u094d\u092f \u0915\u0940 \u0915\u094b\u0936\u093f\u0936\u094b\u0902 \u092a\u0930 \u0932\u093e\u0917\u0942 \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u092f\u0939 \u0905\u0927\u093f\u0915 \u0938\u093e\u092e\u093e\u0928\u094d\u092f\u0940\u0915\u0930\u0923 \u0939\u0948; \u092f\u0939 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915\u0924\u093e \u0915\u094b \u0935\u093f\u0915\u0943\u0924 \u0915\u0930\u0924\u093e \u0939\u0948 \u0914\u0930 \u0906\u0924\u094d\u092e-\u0906\u0932\u094b\u091a\u0928\u093e \u092c\u0922\u093c\u093e\u0924\u093e \u0939\u0948\u0964","Hic cogitatio unum defectum sumit et ad omnia futura conamina applicat. Haec est supergeneralizatio; veritatem distorquet et autocriticam auget.","Questo pensiero prende un fallimento e lo applica a tutti i futuri sforzi. Questa \xe8 una sovra-generalisazione; distorce la realt\xe0 e aumenta l\u2019autocritica.","\u0627\u06cc\u0646 \u0641\u06a9\u0631 \u06cc\u06a9 \u0634\u06a9\u0633\u062a \u0631\u0627 \u06af\u0631\u0641\u062a\u0647 \u0648 \u0622\u0646 \u0631\u0627 \u0628\u0647 \u062a\u0645\u0627\u0645 \u062a\u0644\u0627\u0634\u200c\u0647\u0627\u06cc \u0622\u06cc\u0646\u062f\u0647 \u0627\u0639\u0645\u0627\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f. \u0627\u06cc\u0646 \u06cc\u06a9 \u062a\u0639\u0645\u06cc\u0645 \u0628\u06cc\u0634 \u0627\u0632 \u062d\u062f \u0627\u0633\u062a\u061b \u0648\u0627\u0642\u0639\u06cc\u062a \u0631\u0627 \u062a\u062d\u0631\u06cc\u0641 \u0645\u06cc\u200c\u06a9\u0646\u062f \u0648 \u0627\u0646\u062a\u0642\u0627\u062f \u0627\u0632 \u062e\u0648\u062f \u0631\u0627 \u0627\u0641\u0632\u0627\u06cc\u0634 \u0645\u06cc\u200c\u062f\u0647\u062f."],t.w)
